import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as v,q as D}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-50e8a801"]]),M=JSON.parse(`[{"page_url":"https://vi.wikipedia.org/wiki/H%C3%ACnh_t%C6%B0%E1%BB%A3ng_con_ng%E1%BB%B1a_trong_v%C4%83n_h%C3%B3a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Beef_Or_Salmon.jpg","page_title":"Hình tượng con ngựa trong văn hóa","context_page_description":"Hình tượng con ngựa hiện diện từ sớm trong văn hóa Đông-Tây, con ngựa là một trong những loài vật được con người thuần hóa và sử dụng trong đời sống hàng ngày và loài vật gắn liền với chiến trận là con vật cưỡi gắn liền với các vị tướng, danh nhân. Hình ảnh con ngựa còn là chủ đề cho các môn nghệ thuật như hội họa, điêu khắc, thơ văn... Đối với văn hóa phương Tây, ngựa gắn liền với nhiều biểu tượng thần thoại và gắn liền với hình ảnh Nhân Mã trong 12 Cung Hoàng đạo.\\nNgựa là một trong 12 con giáp của văn hóa phương Đông, cũng nằm trong số lục súc theo quan niệm của văn hóa một số nước. Ngựa là hình tượng đặc trưng cho phương Bắc, là biểu tượng cho sự trung thành và tận tụy đồng thời là biểu tượng cho tài lộc, thành công, hình ảnh con ngựa tung vó hý vang biểu tượng cho sự kiêu hãnh và tự do và thanh khiết."},{"page_url":"https://sv.wikipedia.org/wiki/Beurlay","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Map_commune_FR_insee_code_17045.png","page_title":"Beurlay","context_page_description":"Beurlay är en kommun i departementet Charente-Maritime i regionen Nouvelle-Aquitaine i västra Frankrike. Kommunen ligger i kantonen Saint-Porchaire som ligger i arrondissementet Saintes. År 2009 hade Beurlay 1 009 invånare."},{"page_url":"https://es.wikipedia.org/wiki/Mercedes_(Buenos_Aires)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Lucas_Biglia_%E2%80%93_Portugal_vs._Argentina%2C_9th_February_2011_%281%29.jpg","page_title":"Mercedes (Buenos Aires)","context_page_description":"La ciudad de Mercedes desde 1865, surgida de la primigenia Guardia de Luján, es la cabecera del partido homónimo, provincia de Buenos Aires, Argentina, situada a 96 km al oeste de Capital Federal y a 152 km de La Plata. Surgió en 1745 como un fortín, que albergó un poblado en 1752 y que fue trasladado al lugar actual en 1779. Es una de las pocas ciudades de Argentina donde convergen tres líneas ferroviarias, que la unen a los grandes centros de consumo del interior y del exterior. Esto motivó que a finales del siglo XIX, esta ciudad fuera propuesta como capital de la provincia de Buenos Aires, hecho que no ocurrió pero que en ese entonces le dio la denominación de «La Perla del Oeste».\\nLa ciudad es cabecera del Dto. Judicial Mercedes​ y del Arzobispado de Mercedes - Luján.\\nLa neogótica Catedral Basílica Nuestra Señora de las Mercedes —cabeza de la Arquidiócesis— se encuentra frente a lo que es el corazón de la ciudad, la Plaza San Martín, al igual que el Palacio Municipal y numerosos cafés y restaurantes."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A1%D5%B6%D5%BD%D5%AF%D5%A1_%D4%B2%D5%AB%D5%BD%D5%BF%D6%80%D5%AB%D6%81%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/N%C3%A1m.SNP_Benick%C3%A9hoDom_%28detail%29.jpg","page_title":"Բանսկա Բիստրիցա","context_page_description":"Բանսկա Բիստրիցա, քաղաք Սլովակիայի կենտրոնական մասում, Հրոն գետի ափին: Նույնանուն երկրամասի վարչական կենտրոնն է, համարվում է Կենտրոնական Սլովակիայի ոչ պաշտոնական մայրաքաղաքը: Բնակչության թվաքանակը՝ շուրջ 83 հազար: Պատմականորեն եղել է հանքագործական կարևոր կենտրոն: Հարուստ է պատմական և գեղարվեստական բարձր արժեք ունեցող հուշարձաններով:\\n2017 թվականին Եվրոպայի Բողոքական եկեղեցիների ընկերակցությունը Բանսկա Բիստրիցային շնորհել է «Ռեֆորմացիայի եվրոպական քաղաքի» պատվավոր կոչում:\\n2000-ական թվականներին Բանսկա Բիստրիցան դարձել էր Ուկրաինայի աշխարհազորային բանակի ռազմական պատմության ուսումնասիրման ակադեմիական կենտրոններից մեկը:"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Meade_County,_South_Dakota","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/The_Erskine_School.jpg","page_title":"National Register of Historic Places listings in Meade County, South Dakota","context_page_description":"This is a list of the National Register of Historic Places listings in Meade County, South Dakota.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Meade County, South Dakota, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 31 properties and districts listed on the National Register in the county, including 1 National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted April 26, 2019."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_portugiesischen_Lokomotiv-_und_Triebwagenbaureihen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Flickr_-_nmorao_-_Areia%2C_Lousal%2C_2009.05.19.jpg","page_title":"Liste der portugiesischen Lokomotiv- und Triebwagenbaureihen","context_page_description":"Diese Liste enthält eine Übersicht über die Lokomotiven und Triebwagen der portugiesischen Eisenbahnen, das heißt das Zugmaterial früherer Privatbahnen, der staatlichen Comboios de Portugal und ihrer Vorgänger, der kommunalen Metropolitano Ligeiro de Mirandela und den beiden privaten Verkehrsunternehmen Fertagus und Takargo Rail."},{"page_url":"https://en.wikipedia.org/wiki/List_of_honors_received_by_Maya_Angelou","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Angelou_Obama.jpg","page_title":"List of honors received by Maya Angelou","context_page_description":"African-American writer and poet Maya Angelou was honored by universities, literary organizations, government agencies, and special interest groups. Her honors include a Pulitzer Prize nomination for her book of poetry Just Give Me a Cool Drink of Water 'fore I Diiie, a Tony Award nomination for her role in the 1973 play Look Away, and five Grammys for her spoken albums. Beginning in 1982, Angelou held the first lifetime Reynolds Professorship of American Studies at Wake Forest University in Winston-Salem, North Carolina.\\nShe served on two presidential committees – for Gerald Ford in 1975 and for Jimmy Carter in 1977. In 2000, she was awarded the National Medal of Arts by President Bill Clinton. In 2010, she was awarded the Presidential Medal of Freedom, the highest civilian honor in the U.S., by President Barack Obama. More than thirty health care and medical facilities have been named after Angelou. She was awarded more than 50 honorary degrees."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D9%88%D9%84%DB%8C%D9%86_%D8%B4%D9%88%D9%85%DB%8C%DA%A9%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Carolyn_Shoemaker.jpg","page_title":"کارولین شومیکر","context_page_description":"کارولین شومیکر آمریکالی بیلیم اینسانی. ۲۴ ژوئن ۱۹۲۹ تاریخینده دۆنیایا گؤز آچیب. کارولین شومیکر چیکو‌ده‌کی کالیفورنیا ایالتی بیلیم‌یوردودا درس اوْخویوب. چالیشدیغی یئرلریندن بیری کالیفورنیا تکنولوژی انستیتوسو‌دیر. اوْ آسترونومی ساحه‌سینده چالیشیب."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Viadukte_der_Semmeringbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Steinhaus_am_Semmering_-_Semmeringbahn_-_Steinhausviadukt.jpg","page_title":"Liste der Viadukte der Semmeringbahn","context_page_description":"Die Liste der Viadukte der Semmeringbahn listet alle Viadukte entlang der Semmeringbahn auf.\\nDie Kilometerangaben in der folgenden Liste sind die offiziellen Streckenkilometer der Südbahnstrecke."},{"page_url":"https://en.wikipedia.org/wiki/Homeland_(season_8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Numan_Acar_Cannes_2017.jpg","page_title":"Homeland (season 8)","context_page_description":"The eighth and final season of the American spy thriller television drama series Homeland premiered on February 9, 2020, and concluded on April 26, 2020, on Showtime, consisting of 12 episodes."},{"page_url":"https://nl.wikipedia.org/wiki/Mexico_op_het_wereldkampioenschap_voetbal_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Flag_of_Mexico.svg","page_title":"Mexico op het wereldkampioenschap voetbal 2014","context_page_description":"Mexico was een van de deelnemende landen aan het wereldkampioenschap voetbal 2014 in Brazilië. Het land nam voor de vijftiende keer deel.\\nDe kwalificatie verliep niet gemakkelijk; er werd niet genoeg gewonnen om directe kwalificatie af te dwingen en gedurende het kwalificatieproces ontsloeg de voetbalbond tot driemaal toe de bondscoach. De vierde bondscoach, Miguel Herrera, dwong met het elftal op 20 november 2013 kwalificatie af via een intercontinentale play-off tegen Nieuw-Zeeland. Mexico werd op het WK in de tweede ronde uitgeschakeld door Nederland."},{"page_url":"https://de.wikipedia.org/wiki/Palais_Etzdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Laendgasse_50_Landshut-1.jpg","page_title":"Palais Etzdorf","context_page_description":"Das Palais Etzdorf ist eine ehemalige Residenz des Adelsgeschlechtes Etzdorff in der Altstadt von Landshut in Niederbayern. Es besitzt die Adresse Ländgasse 50 und liegt nur etwa hundert Meter westlich der Martinskirche."},{"page_url":"https://en.wikipedia.org/wiki/Waldibr%C3%BCcke_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Waldibr%C3%BCcke_railway_station.jpg","page_title":"Waldibrücke railway station","context_page_description":"Waldibrücke railway station is a railway station in the municipality of Emmen, in the Swiss canton of Lucerne. It is an intermediate stop on the standard gauge Seetal line of Swiss Federal Railways."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AF%D8%B9%D8%A7%D9%8A%D8%A9_%D8%A7%D9%84%D9%86%D8%A7%D8%B2%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Bundesarchiv_Bild_183-2004-0312-504%2C_N%C3%BCrnberg%2C_Reichsparteitag%2C_Rede_Adolf_Hitler.jpg","page_title":"الدعاية النازية","context_page_description":"الدعاية النازية،:Nationalsozialistische Propaganda، كانت من أقوى الأسلحة التي اعتمد عليها الحزب النازي، في الفترة ما بين عامي 1933 و1945. وكانت لها أيديولوجية سياسية تهدف كما يقول \\"هتلر\\" إلى غزو العالم. إنها دعاية لا عقلانية لأنها تهدف لإثارة المشاعر والعواطف لدى الأفراد، وتغلب الدعاية النازية الصورة على التبرير والحس الاندفاعي على المنطق.\\nاستطاع الإعلام الحربي الألماني أن يُدخل نظام الدعاية التي خُططت بشكل متطور بواسطة وزير الدعاية الألماني \\"جوزيف جوبلز\\". الذي كان له فضل كبير في إدخال النظم الدعائية الحديثة. واستخدمت الدعاية من خلال وسائل الإعلام الحربي في ذلك الوقت، حيث اعتمدت على المنشورات، والإذاعة، ومكبرات الصوت بشكل يثير الغرائز الأولية للفتك والتدمير. وحين ننظر إلى الدعاية الألمانية من ناحية قوتها الباطنة أي ما تنطوي عليه، فإنها تبدو في الواقع كأنها مدفعية سيكولوجية تستخدم كل ما من شأنه أن يصدم ويزعزع الكيان."},{"page_url":"https://it.wikipedia.org/wiki/Rafael_Dudamel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/CaracasB_est.merida_07_01_2007_MIGUEL_VALLENILLA.jpg","page_title":"Rafael Dudamel","context_page_description":"Rafael Edgar Dudamel Ochoa è un allenatore di calcio ed ex calciatore venezuelano, di ruolo portiere."},{"page_url":"https://de.wikipedia.org/wiki/Gerhard_Graubner","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Stadttheater_Lippstadt.jpg","page_title":"Gerhard Graubner","context_page_description":"Gerhard Moritz Graubner war ein deutscher Architekt und Hochschullehrer."},{"page_url":"https://hu.wikipedia.org/wiki/A_Felvid%C3%A9k_vil%C3%A1gh%C3%A1bor%C3%BAs_eml%C3%A9km%C5%B1veinek_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Nagyszarva_vh_eml%C3%A9km%C5%B1.JPG","page_title":"A Felvidék világháborús emlékműveinek listája","context_page_description":"Ez a lap a Szlovákia területén található világháborús emlékműveket és hősi halottak sírjait gyűjti fel. A lista megadja az emlékmű pontos helyét, emelésének idejét, az emlékmű készítőjét, az áldozatok számát, fényképét és egyéb kiegészítő információkat a forrásokkal együtt."},{"page_url":"https://hu.wikipedia.org/wiki/Filmsz%C3%ADnh%C3%A1z","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Football_match_in_cinema.jpg","page_title":"Filmszínház","context_page_description":"„Egy centiméter igazi költészet\\nÉs háromezer méter butaság.”\\n– Heltai Jenő: Mozi\\nA filmszínház olyan helyszín, amely filmek nyilvános, nagyobb közönség előtti vetítésére alkalmas. Többnyire egy épületen belül lévő termek csoportja vagy különálló épület, ritkábban szabadtéri mozi vagy egyszerűen szabadon álló vetítővászon, kivetítő. A többnyire homorúan emelkedő padlóra rögzített vagy mobil széksorokon, esetleg erkélyen helyet foglaló közönséggel szemben található a hatalmas vetítővászon, erre vetíti a vetítőgép a befűzött kópia képsorait. A 2000-es évektől egyre szélesebb körben terjed a digitális mozitechnika, amely szükségtelenné teszi a film fizikai forgalmazását-kezelését és így megoldást nyújt a kópiahiányra is.\\nA filmszínházakat jellemzően szolgáltatóipari vállalkozásként üzemeltetik, azaz a közönség mozijegy vásárlása ellenében tekintheti meg a kiválasztott filmet. Egy részük jól körülhatárolható közönséget céloz meg üzletpolitikájával és ennek megfelelően alakítja a vetített filmek műsorrendjét."},{"page_url":"https://fr.wikipedia.org/wiki/Karlskrona","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Admiralstorn_karlskrona_v%C3%A4st.jpg","page_title":"Karlskrona","context_page_description":"Karlskrona est une ville située sur la côte sud de la Suède, dispersée sur plusieurs îles de l'archipel du Blekinge. Elle est le chef-lieu de la commune de Karlskrona et du comté de Blekinge, et est habitée par 35 212 personnes.\\nLa ville a été fondée en 1680 par le roi Charles XI de Suède afin d'y être le siège de la marine royale suédoise et de son chantier naval, et son développement ultérieur fut ainsi fortement lié à celui de son port et de son chantier. Elle fut au milieu du XVIIIᵉ siècle la troisième plus grande ville du pays, en grande partie grâce à la forte demande en navires liées aux conflits pour le contrôle de la mer Baltique. La stabilité politique des XIXᵉ et XXᵉ siècles ont entraîné un certain déclin de l'activité du chantier et de la marine, mais la ville s'est progressivement reconvertie en une ville des hautes technologies, aidée en cela par son institut de technologie fondé en 1989."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%B8%D6%82%D5%B4%D5%AB%D5%B6%D5%A1%D5%AF%D5%A1%D5%B6_%D5%AD%D5%B8%D5%B0%D5%A1%D5%B6%D5%B8%D6%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Papanasi_cu_cirese.jpg","page_title":"Ռումինական խոհանոց","context_page_description":"Ռումինական խոհանոց, Ռումինիայի ազգային խոհանոց: Ենթարկվել է իտալական, թուրքական, բուլղարական, հունական, սերբական, գերմանական և մի շարք այլ խոհանոցների ազդեցությանը:"},{"page_url":"https://de.wikipedia.org/wiki/Takarabe_Takeshi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Takeshi_Takarabe.jpg","page_title":"Takarabe Takeshi","context_page_description":"Takarabe Takeshi war ein japanischer Admiral der Kaiserlichen Marine, der unter anderem von Mai 1923 bis Januar 1924, Juni 1924 bis April 1927 sowie Juli 1929 bis Oktober 1930 Marineminister war."},{"page_url":"https://en.wikipedia.org/wiki/Human_taxonomy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Naturalis_Biodiversity_Center_-_Martin_Hoffman_-_Carl_von_Linn%C3%A9_%28Linnaeus%29_in_his_Lapland_costume_-_painting.jpg","page_title":"Human taxonomy","context_page_description":"Human taxonomy is the classification of the human species within zoological taxonomy. The systematic genus, Homo, is designed to include both anatomically modern humans and extinct varieties of archaic humans. Current humans have been designated as subspecies Homo sapiens sapiens, differentiated according to some from the direct ancestor, Homo sapiens idaltu.\\nSince the introduction of systematic names in the 18th century, knowledge of human evolution has increased drastically, and a number of intermediate taxa have been proposed in the 20th to early 21st century. The most widely accepted taxonomy groups takes the genus Homo as originating between two and three million years ago, divided into at least two species, archaic Homo erectus and modern Homo sapiens, with about a dozen further suggestions for species without universal recognition.\\nThe genus Homo is placed in the tribe Hominini alongside Pan. The two genera are estimated to have diverged over an extended time of hybridization spanning roughly 10 to 6 million years ago, with possible admixture as late as 4 million years ago."},{"page_url":"https://nn.wikipedia.org/wiki/Den_nye_verda","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/CartedAmerique.jpeg","page_title":"Den nye verda","context_page_description":"«Den nye verda» er ei nemning som oppstod kring 1555 for å definere det amerikanske kontinentet og dei tilhøyrande øyar som ein heilskap. Amerika var den gongen eit nytt kontinent for europearar som tidlegare berre kjente til Europa, Asia og Afrika—«den gamle verda».\\nI dei seinare decennium har somme rekna uttrykket «den nye verda» som lett krenkjande, fordi det legg til grunn ei oppfatning av at berre det europeiske synspunktet er det som er rett. Derfor vert termen no berre nytta generelt i avgrensa samanhengar i visse sosiale lag. Først og fremst kan ein snakke om «den nye verda» i ein historisk kontekst kor ein diskuterer reisene åt Christofer Columbus, den spanske erobringa av Yucatán og liknande. Dernest kan ein i ein biologisk kontekst snakke om artar i «den gamle verda» og i «den nye verda».\\nMedan «den nye verda» femnar om Amerika, kan ein tale om Australasia som enten «den gamle verda» eller «den nye verda», spesielt når ein samtaler om New Zealand som fekk dei første busetjingar berre få generasjonar før Columbus nådde Amerika."},{"page_url":"https://ceb.wikipedia.org/wiki/Littleton_Common","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Reed-Wood_Place%2C_Littleton_Common_MA.jpg","page_title":"Littleton Common","context_page_description":"Lungsod ang Littleton Common sa Tinipong Bansa. Nahimutang ni sa kondado sa Middlesex County ug estado sa Massachusetts, sa sidlakang bahin sa nasod, 600 km sa amihanan-sidlakan sa Washington, D.C. 82 metros ibabaw sa dagat kahaboga ang nahimutangan sa Littleton Common, ug adunay 2,789 ka molupyo. Littleton Common nga nahimutang sa lanaw sa Forge Pond ang ulohan sa nasod.\\nAng yuta palibot sa Littleton Common kay patag, ug nga tinakpan sa ubos sa sidlakan. Kinahabogang dapit sa palibot ang Starr Hill, 121 ka metros ni kahaboga ibabaw sa dagat, 1.7 km sa habagatan sa Littleton Common. Dunay mga 511 ka tawo kada kilometro kwadrado sa palibot sa Littleton Common nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Lowell, 16.2 km sa amihanan-sidlakan sa Littleton Common. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Littleton Common. Sa rehiyon palibot sa Littleton Common, mga kalapukan talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Agosto, sa 22 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 1,397 milimetro matag tuig."},{"page_url":"https://eu.wikipedia.org/wiki/Imanol_Murua_Uria","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/ArgiaTaldea_02.jpg","page_title":"Imanol Murua Uria","context_page_description":"Imanol Murua Uria euskal idazle, kazetaria eta unibertsitateko irakaslea da.\\nEuskal Herriko Unibertsitatean Informazio Zientziatan lizentziatu zen 1989an. Geroago doktore-titulua lortu zuen 2014an Euskal Ikasketetan, Renoko Unibertsitatetik, eta Gizarte Komunikazioan, EHUtik. Kazetaritzako irakaslea da EHUn 2015etik. Sei libururen egile eta lauren ko-egile da. Bere azken liburuan ETAren jardun armatuaren bukaeraren kronika idatzi zuen 2015an. Bere doktorego-tesian gai horixe landu zuen, Txema Ramírez de la Piscina eta Joseba Zulaikaren zuzendaritzapean.\\n1980ko hamarkadaren amaieran, Argia aldizkariaren bueltan euskarazko egunkariaren proiektuaren gaineko gogoeta sortu zenean unibertsitatetik irten berria zen orduan Murua, baina Argia-n kolaboratzen zuen ordurako, belaunaldi bereko beste hainbat kazetarirekin batera: «Denbora gutxi generamala, ohartu ginen egunkariaren ideia oso serio hartua zutela, egunkaria martxan jartzeko garaia zela erabakia zutela... Tokatu zitzaigun momentu egokian leku egokian egotea, beste batzuek pentsatu zutena martxan jartzeko»."},{"page_url":"https://cs.wikipedia.org/wiki/Tituly_a_vyznamen%C3%A1n%C3%AD_Pavla_I._%C5%98eck%C3%A9ho","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Gartered_arms_of_Paul%2C_King_of_Greece.png","page_title":"Tituly a vyznamenání Pavla I. Řeckého","context_page_description":"Řecký král Pavel I. Řecký obdržel během svého života řadu řeckých i zahraničních vyznamenání. V letech 1947 až 1964 byl velmistrem řeckých řádů."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BF_%D0%BC%D1%83%D0%B7%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Michael_Jackson_glove_jacket_1984.png","page_title":"Поп музика","context_page_description":"Поп је музички жанр. У поп музици текст и певање преовладавају над композицијом и инструменталом. Ову музику одликују једноставни хармонијски и мелодијски стил за разлику од рок музике и постојање рефрена. Пјесме су кратке и уз њих се, углавном, може плесати. Она је омиљена од широких маса и самим тим и комерцијално успјешна. То је музички жанр са највећим бројем продатих носача звука.\\nНазив поп је настао од енглеске речи „popular“ што означава музику за забаву. Израз поп појавио се како би описао музику која се развила из рокенрол револуције средином 50-их година прошлог века и наставила свој развој, све до данас. Од тада у музици која се свиђа најширој публици, односно поп музици, доминирају звукови који су и даље укорењени у основним елементима рокенрола. У себи често садржи елементе рок, џез, етно, фолк, реге и/или соул музике. Сматра се поджанром забавне музике."},{"page_url":"https://fr.wikipedia.org/wiki/Sara_Jane_Lippincott","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Sara_jane_Lippincott_ca1850.jpg","page_title":"Sara Jane Lippincott","context_page_description":"Sara Jane Lippincott, née Clarke, connue sous le pseudonyme de Grace Greenwood, est une écrivain américaine. Elle militait en faveur de réformes sociales et pour les droits des femmes."},{"page_url":"https://pl.wikipedia.org/wiki/Horsk%C3%A1_Kvilda","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Sejpy_na_Hamersk%C3%A9m_potoce.JPG","page_title":"Horská Kvilda","context_page_description":"Horská Kvilda – gmina w Czechach, w powiecie Klatovy, w kraju pilzneńskim. Według danych z dnia 1 stycznia 2014 liczyła 66 mieszkańców."},{"page_url":"https://es.wikipedia.org/wiki/Northrop_C-19_Alpha","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Northrop_Alpha_%28Y1C-19%29.jpg","page_title":"Northrop C-19 Alpha","context_page_description":"El Northrop C-19 Alpha fue una serie de tres aviones adquiridos a Northrop por el Cuerpo Aéreo del Ejército de los Estados Unidos, en 1931. Eran versiones ligeramente modificadas del civil Northrop Alpha Tipo 2.​"},{"page_url":"https://pl.wikipedia.org/wiki/Sojusz_na_rzecz_Przysz%C5%82o%C5%9Bci_Austrii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/BZ%C3%96-Logo.png","page_title":"Sojusz na rzecz Przyszłości Austrii","context_page_description":"Sojusz na rzecz przyszłości Austrii – austriacka partia polityczna założona w 2005 przez Jörga Haidera, Huberta Gorbacha oraz innych polityków Wolnościowej Partii Austrii.\\nPartia powstała na skutek rozłamu w szeregach FPÖ. Założyciele BZÖ nie mogli dojść do porozumienia z innymi liderami FPÖ i odeszli, zakładając własną partię.\\n12 października 2008 po tragicznej śmierci Jörga Haidera na nowego szefa sojuszu został desygnowany Stefan Petzner, którego po dziesięciu dniach zastąpił Josef Bucher."},{"page_url":"https://de.wikipedia.org/wiki/William_Woodburn","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/WWoodburn.jpg","page_title":"William Woodburn","context_page_description":"William Woodburn war ein amerikanischer Politiker. Zwischen 1875 und 1877 sowie von 1885 bis 1889 vertrat er den Bundesstaat Nevada im US-Repräsentantenhaus."},{"page_url":"https://it.wikipedia.org/wiki/Dinaro_jugoslavo","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Originalslika-100-dinara-1994-UNC-513112.jpg","page_title":"Dinaro jugoslavo","context_page_description":"Dinaro jugoslavo è il nome collettivo della serie di valute ufficiali della ex Jugoslavia. Le prime quattro fanno riferimento ai periodi di esistenza della propriamente detta entità statuale panslavica, mentre le ultime cinque sono relative alle tribolate vicissitudini della Federazione serbo-montenegrina. Il dinaro era normalmente diviso in 100 para, ad eccezione del Dinaro jugoslavo riformato, Dinaro jugoslavo di ottobre e del Dinaro jugoslavo del 1994 che non avevano divisioni decimali."},{"page_url":"https://fi.wikipedia.org/wiki/Udmurtia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Residence%2C_Izhevsk.jpg","page_title":"Udmurtia","context_page_description":"Udmurtia eli Udmurtian tasavalta on Venäjän federaatioon kuuluva suomalais-ugrilaisten udmurttien nimikkotasavalta Koillis-Euroopassa Kama- ja Vjatkajokien välissä. Udmurtian pääkaupunki Iževsk sijaitsee linnuntietä noin 970 kilometriä Moskovasta itään."},{"page_url":"https://sv.wikipedia.org/wiki/Calder_Memorial_Trophy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Teemu_Selanne_on_the_ice_November_2010.jpg","page_title":"Calder Memorial Trophy","context_page_description":"Calder Memorial Trophy, tidigare Calder Trophy, är ett årligt pris som tilldelas årets bäste nykomling i National Hockey League under grundserien. Årets rookie utses av ishockeyjournalisterna i Professional Hockey Writers' Association.\\nUtmärkelsen har fått sitt namn efter Frank Calder som var NHL:s president åren 1917–1943."},{"page_url":"https://pl.wikipedia.org/wiki/Vuelta_a_Espa%C3%B1a_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Vuelta_a_Espa%C3%B1a_2016-_Vigo_04.jpg","page_title":"Vuelta a España 2016","context_page_description":"Vuelta a España 2016 – 71. edycja wyścigu kolarskiego, która odbywała się w dniach od 20 sierpnia do 11 września 2016 roku. Liczyła dwadzieścia jeden etapów o łącznym dystansie 3 315,4 km. Wyścig zaliczany był do rankingu światowego UCI World Tour 2016."},{"page_url":"https://la.wikipedia.org/wiki/Index_praesidum_Rei_publicae_Coreanae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Park_Chung-hee_1963%27s.png","page_title":"Index praesidum Rei publicae Coreanae","context_page_description":"Index Praesidum Coreanae ab anno 1948."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B1%DB%8C%D8%A7%DB%8C_%D9%85%D8%B1%D8%AF%D9%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Dead_Sea_Jordanian_Side_05.JPG","page_title":"دریای مرده","context_page_description":"دریای مرده یا بحرالمیّت دریاچهٔ آب شوری است که میان اردن، اسرائیل و مناطق فلسطینی واقع شده‌است. ۱۲ گونه ماهی در این دریاچه عمر ۱ سال به بالا دارند.\\nدر برخی منابع از آن با نام دریاچهٔ نمک یاد شده‌است. سواحل اطراف آن پست‌ترین نقطهٔ خشکی‌های زمین است.\\nاین دریا برای این دریای مرده نامیده می‌شود که هیچ جانور یا گیاهی به‌طور دائمی در آن زندگی نمی‌کند. آب آن هشت-نه برابر شورتر از آب اقیانوس‌هاست.\\nدریای مرده با کم‌آبی شدید مواجه است اما محو نخواهد شد. هرچه آب پایین می‌رود، غلظت و شوری دریاچه بیشتر می‌شود و نهایتاً به جایی می‌رسد که میزان تبخیر متوقف می‌شود؛ بنابراین دریای مرده احتمالاً به مراتب کوچک‌تر از این که هست می‌شود، اما به‌کل محو نمی‌شود."},{"page_url":"https://ka.wikipedia.org/wiki/Huawei","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Huawei_E220_HSDPA_USB_modem.jpg","page_title":"Huawei","context_page_description":"Huawei Technologies Co. Ltd. — ჩინური ტრანსნაციონალური კომპანია ტელეკომუნიკაციების სფეროში. სათავო ოფისი მდებარეობს გუანდუნის პროვინციის ქალაქ შენჟენში. მას შემდეგ რაც შვედურ ერიქსონს გაუსწრო, ჰუავეი სატელეკომუნიკაციო აღჭურვილობის უმსხვილესი მწარმოებელია მსოფლიოში.\\nკომპანია 1988 წელს ყოფილმა სამხედრო ოფიცერმა რენ ჟენგფეიმ დააარსა და გააფორმა კერძო კომპანიად, რომელსაც მასში დასაქმებულები ფლობდნენ. ჰუავეის მთავარი საქმიანობაა სატელეკომუნიკაციო ქსელების გამართვა, ოპერაციული და საკონსულტაციო მომსახურებისა და აღჭურვილობის წარმოება როგორც ჩინეთის, ისე მის ფარგლებს გარეთ არსებულ საწარმოებში; ასევე საკომუნიკაციო მექანიზმების წარმოება სამომხმარებლო ბაზრისთვის. კომპანიაში დასაქმებულია 140 000 ადამიანი, რომელთა 46% ჩართულია კვლევისა და გაუმჯობესების პროცესში. იგი ფლობს 20 R&D დაწესებულებას ჩინეთში, აშშ–ში, გერმანიაში, შვედეთში, ინდოეთში, რუსეთსა და თურქეთში. 2011 წელს ამ სფეროში მან $3,74 მილიარდი აშშ დოლარის ინვესტიცია ჩადო.\\n2010 წელს ჰუავეიმ 23,8 მლრდ ჩინური იუანის მოგება ნახა. მის პროდუქციასა და მომსახურებას იყენებენ მსოფლიოს 140–ზე მეტ ქვეყანაში. მსოფლიოს 50 უმსხვილესი სატელეკომუნიცაციო ოპერატორიდან 45–ს ამჟამად ჰუავეი ემსახურება."},{"page_url":"https://fr.wikipedia.org/wiki/Avenue_%C4%B0stiklal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Nostalgic_tram_on_Istiklal_Avenue_in_Istanbul.jpg","page_title":"Avenue İstiklal","context_page_description":"L’avenue Istiklal, en turc İstiklâl Caddesi, littéralement « avenue de l’Indépendance », anciennement connue sous le nom de Grande Rue de Péra, est l'une des plus célèbres avenues d’Istanbul. L’avenue est parcourue par près de 3 millions de personnes par jour le week-end. Située dans le quartier historique du district de Beyoğlu, c'est une rue piétonne d’environ trois kilomètres de long, qui abrite des boutiques. L'avenue, dont l'architecture turque est du XIXᵉ siècle, relie la place de Taksim au quartier génois autour de la tour de Galata.\\nLa place de Galatasaray est située environ au centre de l’avenue. Elle abrite l’un des meilleurs établissements d’enseignement, mis en place en Turquie au moment de l’Empire ottoman, initialement connu sous le nom de Galata Sarayi Enderun-u Hümayunu et aujourd’hui connu sous le nom de Galatasaray Lisesi.\\nDans le quartier historique Karaköy, vers la fin de l'avenue, il est possible de voir la deuxième plus ancienne station de métro du monde, généralement connu et désigné comme Tünel qui est entré en service en 1875. En outre, la German High School d'Istanbul est également situé près de Tünel."},{"page_url":"https://fr.wikipedia.org/wiki/Domony","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Both-Bagi-k%C3%BAria_%286996._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29.jpg","page_title":"Domony","context_page_description":"Domony est un village et une commune du comitat de Pest en Hongrie."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%AD%E5%B7%9E%E5%9C%B0%E9%93%8116%E5%8F%B7%E7%BA%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/2020042316%E5%8F%B7%E7%BA%BF%E8%BD%A6%E5%8E%A2%E5%86%85%E9%83%A8.jpg","page_title":"杭州地铁16号线","context_page_description":"杭州地铁16号线，是杭州地铁网络中的一条线路，标识色为升橙色。本线共有12座车站，东起于余杭区绿汀路站，西止于临安区九州街站，大致呈东西走向，全长35.12公里，全线于2020年4月23日开通。"},{"page_url":"https://uk.wikipedia.org/wiki/Jaguar_E-Type","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Jaguar_E_Type_Series_I_Coupe_%282%29.jpg","page_title":"Jaguar E-Type","context_page_description":"Jaguar E-type або XK-E — автомобіль компанії «Ягуар», що випускався в період з 1961 по 1975 рік. Автомобіль поєднує в собі: гарний зовнішній вигляд, високу продуктивність і конкурентоспроможність, дана модель була еталоном всіх машин 1960-го. Протягом існування цих машин їх було продано більше 70-ти тисяч. Максимальна швидкість — 241 км/год, 225 км/год.\\nУ березні 2008 року, Jaguar E-type посів 1 місце в рейтингу Daily Telegraph — \\"100 найкрасивіших машин\\" за весь час. У 2004 році журнал Sports Car International помістив цей автомобіль на 1 перше місце в їх рейтингу \\"Родстери 1960-го\\"​​. Вважається одним з найгарніших і стильних автомобілів у світі."},{"page_url":"https://nl.wikipedia.org/wiki/Lamoraal_van_Egmont","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Kasteel_van_Egmont_Zottegem_09.jpg","page_title":"Lamoraal van Egmont","context_page_description":"Lamoraal I van Gavere, graaf van Egmont was een generaal en staatsman in de Zeventien Provinciën vlak voor het begin van de Tachtigjarige Oorlog. In 1568 is hij ter dood gebracht als gevolg van het optreden van de hertog van Alva."},{"page_url":"https://nl.wikipedia.org/wiki/Koninklijke_Jordaanse_luchtmacht","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Royal_Jordanian_Air_Force_helicopter.jpg","page_title":"Koninklijke Jordaanse luchtmacht","context_page_description":"De Koninklijke Jordaanse luchtmacht staat in voor de verdediging van het Jordaanse luchtruim, ondersteuning van de Jordaanse landmacht en de interne veiligheidsdiensten."},{"page_url":"https://pl.wikipedia.org/wiki/Odznaka_%E2%80%9EZa_Zas%C5%82ugi_dla_Wojew%C3%B3dztwa_Suwalskiego%E2%80%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Odznaka_%E2%80%9EZa_Zas%C5%82ugi_dla_Wojew%C3%B3dztwa_Suwalskiego%E2%80%9D.jpg","page_title":"Odznaka „Za Zasługi dla Województwa Suwalskiego”","context_page_description":"Odznaka „Za Zasługi dla Województwa Suwalskiego” – polskie odznaczenie samorządowe władz województwa suwalskiego ustanowione 28 czerwca 1978 w formie jednostopniowej odznaki."},{"page_url":"https://no.wikipedia.org/wiki/Sverre_Fehn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/%C3%98kern_alders_og_sykehjem_1.jpg","page_title":"Sverre Fehn","context_page_description":"Olav Sverre Fehn var en norsk arkitekt.\\nFehn drev arkitektpraksis i Oslo og var professor ved Arkitekthøgskolen fra 1971 til han gikk av med pensjon i 1995. Hans stil har blitt karakterisert som «poetisk modernisme», og blant hans viktigste arbeider regnes Villa Schreiner i Oslo, Hedmarksmuseet på Hamar, Villa Busk i Bamble og Norsk Bremuseum i Fjærland."},{"page_url":"https://en.wikipedia.org/wiki/Beijing_Sinobo_Guoan_F.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Bjguoanduifu9697.JPG","page_title":"Beijing Sinobo Guoan F.C.","context_page_description":"Beijing Sinobo Guoan F.C. is a professional Chinese football club that currently participates in the Chinese Super League under licence from the Chinese Football Association. The team is based in the Chaoyang District in Beijing and their home stadium is the Workers' Stadium with a seating capacity of 66,161. Their shareholders are the real estate company Sinobo Group and CITIC Limited of CITIC Group, a state-owned enterprise of China. Beijing Guoan F.C. was founded as a professional team by CITIC Guoan Group, which was a subsidiary of CITIC Group until 2014. The club is one of the four teams to never have been relegated from the league since its debut in 2004.\\nThe club's predecessor was called Beijing Football Club and they predominantly played in the top tier, where they won several domestic league and cup titles. On December 29, 1992 the club was recognized to become a completely professional football club making them one of the founding members of the first fully professional top tier league in China. Since then they have gone on to win their first ever professional league title in the 2009 league season as well as the 1996, 1997, 2003 and 2018 Chinese FA Cup."},{"page_url":"https://tr.wikipedia.org/wiki/Suriye_%C4%B0%C3%A7_Sava%C5%9F%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Lattakia_20_june_2010.jpg","page_title":"Suriye İç Savaşı","context_page_description":"Suriye İç Savaşı, Suriye ordusu, Suriye hükûmeti ve Suriye'deki iç isyancılar arasında başlayan, sonrasında Irak ve Şam İslam Devleti, El Nusra ve bazı Kürt, Türkmen, Dürzi ve Süryani grupların da katıldığı, son dönemde ise Rusya, İran, Amerika Birleşik Devletleri, Türkiye ve İsrail gibi dış güçlerin de sınırlı ve düzenli olarak dahil olduğu çatışmalardır. Gösteriler 15 Mart 2011'de başlamış ve Nisan 2011 tarihinde ülke çapında yayılmıştır.\\nNisan 2011 tarihinde Suriye Ordusu eylem ve ayaklanmaları bastırmak için görevlendirilmiş ve askerler ülke genelinde göstericiler üzerine ateş açmıştır. Aylarca süren askeri kuşatmaların ardından gösteriler silahlı isyanlara dönüşmüştür. Çoğunlukla firari askerler ve sivil gönüllülerden oluşan muhalif güçler, merkezi bir liderlik olmaksızın isyana başlamışlardır. Ülke genelindeki hemen hemen her kasaba ve şehirde yaşanan çatışmalar asimetrik savaş niteliğindedir. 2013 yılında Hizbullah, Beşar Esad'a sadık Suriye ordusunun yanında savaşa dahil olmuştur. Beşar Esad yönetimi Rusya ve İran'dan askeriye ve para desteği alırken, muhalifler Katar ve Suudi Arabistan'dan silah ve mühimmat desteği almaktadır."},{"page_url":"https://en.wikipedia.org/wiki/Mill_Creek_Mountain","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Indian_Mound_Cemetery_Romney_WV_2010_04_25_13.JPG","page_title":"Mill Creek Mountain","context_page_description":"Mill Creek Mountain is a continuous mountain ridge that runs northeast through Hampshire and Hardy counties in the Eastern Panhandle region of the U.S. state of West Virginia. Rising to its greatest elevation of 2,650 feet at High Knob, Mill Creek is a folded mountain ridge, belonging to the Ridge-and-Valley Appalachians. Mill Creek Mountain forms the western edge of the South Branch Potomac River Valley and is named for Mill Creek that carves through it at Mechanicsburg Gap allowing the Northwestern Turnpike to pass through as well. Along with Sawmill Ridge, Mill Creek Mountain forms the Trough along the South Branch.\\nHanging Rocks at Wappocomo, south of Springfield, are located on the northern edge of the gap in Mill Creek Mountain formed by the South Branch."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%84%DB%8C%D9%88%D8%AA_%D8%A7%DA%86_%D9%84%DB%8C%D8%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Elliott-Lieb-07.jpeg","page_title":"الیوت اچ لیب","context_page_description":"اِلیوت ه. لیب فیزیک‌دان و ریاضی‌دانِ اهل ایالات متحده آمریکا است. وِی در حالِ حاضر عضوِ هیأتِ علمیِ دانش‌کده‌های ریاضی و فیزیکِ دانشگاه پرینستون است. او در سال ۱۹۹۸ برنده مدال بولتزمن شد."},{"page_url":"https://de.wikipedia.org/wiki/Flekker%C3%B8ya","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/FV457P_Flekker%C3%B8ytunnelen_III.jpg","page_title":"Flekkerøya","context_page_description":"Flekkerøya ist eine Insel im Skagerrak, südlich von Kristiansand, Norwegen. Sie ist, mit den sie umgebenden kleinen Inseln und Holmen, verwaltungstechnisch identisch mit dem Stadtbezirk Flekkerøy der Stadt Kristiansand, und hat mehr als 3500 Einwohner."},{"page_url":"https://vi.wikipedia.org/wiki/Maiacetus","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Adult_female_and_fetal_Maiacetus.jpg","page_title":"Maiacetus","context_page_description":"Maiacetus là danh pháp khoa học của một chi cá voi sinh sống ở thời kỳ đầu của Trung Eocen trong khu vực ngày nay là Pakistan. Chi này hiện tại chỉ chứa 1 loài có danh pháp Maiacetus inuus được miêu tả năm 2009 trên cơ sở của 2 mẫu vật, bao gồm một con cá voi cái đang mang thai và bào thai của nó được khai quật từ thành hệ Habib Rahi. Nó là miêu tả đầu tiên của bộ xương bào thai của cá voi cổ. Vị trí của bào thai gợi ý rằng những con cá voi của chi này sinh đẻ trên cạn.\\nLoài này có kích thước trung bình với bộ xương dài 2,6 m và cân nặng ước đạt 280–390 kg."},{"page_url":"https://pl.wikipedia.org/wiki/Ewrichu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Evrychou_as_seen_from_nearby_hills.JPG","page_title":"Ewrichu","context_page_description":"Ewrichu – wieś na Cyprze, w dystrykcie Nikozja."},{"page_url":"https://ro.wikipedia.org/wiki/Scaramouche_(film_din_1923)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Scaramouche_1923_movie_poster.jpg","page_title":"Scaramouche (film din 1923)","context_page_description":"Scaramouche este un film mut regizat de Rex Ingram[*] după un scenariu de Willis Goldbeck[*]. A fost produs în Statele Unite ale Americii și a avut premiera la 15 septembrie 1923, fiind distribuit de Metro Pictures. Coloana sonoră este compusă de William Axt[*]. În rolurile principale au jucat actorii Ramón Novarro, Alice Terry, Lewis Stone și Lloyd Ingraham.\\nScaramouche a intrat în domeniul public în Statele Unite la 1 ianuarie 2019."},{"page_url":"https://en.wikipedia.org/wiki/Tractor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Tractor-powered_Roadroller.jpg","page_title":"Tractor","context_page_description":"A tractor is an engineering vehicle specifically designed to deliver a high tractive effort at slow speeds, for the purposes of hauling a trailer or machinery such as that used in agriculture or construction. Most commonly, the term is used to describe a farm vehicle that provides the power and traction to mechanize agricultural tasks, especially tillage, but nowadays a great variety of tasks. Agricultural implements may be towed behind or mounted on the tractor, and the tractor may also provide a source of power if the implement is mechanised."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Markgr%C3%B6ningen","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Backhaus_Markgr%C3%B6ningen_vS.jpg","page_title":"Liste der Kulturdenkmale in Markgröningen","context_page_description":"In der Liste der Kulturdenkmale in Markgröningen sind die als unbewegliche Bau- und Kunstdenkmale verzeichneten Kulturdenkmale der baden-württembergischen Stadt Markgröningen dargestellt."},{"page_url":"https://hu.wikipedia.org/wiki/2019-es_Eurov%C3%ADzi%C3%B3s_Dalfesztiv%C3%A1l","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/A_Dal_2019_The_Middletonz_2019-02-23.jpg","page_title":"2019-es Eurovíziós Dalfesztivál","context_page_description":"A 2019-es Eurovíziós Dalfesztivál a hatvannegyedik Eurovíziós Dalfesztivál volt. Izraelben rendezték meg, mivel a 2018-as Eurovíziós Dalfesztivált az izraeli Netta Toy című dala nyerte. Ez volt a harmadik alkalom, hogy a dalfesztivált Izraelben rendezték meg, viszont az első, hogy Tel-Avivban.\\n41 ország erősítette meg részvételi szándékát. Bulgária visszalépett a versenytől, míg Ukrajna műsorszolgáltatója a nemzeti válogató körül kialakult konfliktusok után jelentette be távolmaradását.\\nA döntőt a holland Duncan Laurence nyerte meg Arcade című dalával."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B8%D1%88%D0%BE%D1%80_(%D0%9F%D0%B8%D1%80%D0%BE%D1%82)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Selo_Nisor%2C_Atar_Pirot.JPG","page_title":"Нишор (Пирот)","context_page_description":"Нишор је насеље Града Пирота у Пиротском округу. Према попису из 2011. има 89 становника."},{"page_url":"https://es.wikipedia.org/wiki/Paquita_Garz%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Paquita_Garz%C3%B3n.jpg","page_title":"Paquita Garzón","context_page_description":"Paquita Garzón fue una cantante, vedette y actriz española que hizo una gran carrera tanto en su país como en Argentina, en la época dorada cinematográfica.​"},{"page_url":"https://ceb.wikipedia.org/wiki/Amb%C4%81jog%C4%81i","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Ambajogai_Yogeshwari_Temple.jpg","page_title":"Ambājogāi","context_page_description":"Lungsod ang Ambājogāi sa Indiya. Nahimutang ni sa distrito sa Bid ug estado sa State of Mahārāshtra, sa sentro nga bahin sa nasod, 1,100 km sa habagatan sa New Delhi ang ulohan sa nasod. 633 metros ibabaw sa dagat kahaboga ang nahimutangan sa Ambājogāi, ug adunay 74,114 ka molupyo.\\nAng yuta palibot sa Ambājogāi kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 659 ka metro ug 1.3 km sa habagatan sa Ambājogāi. Dunay mga 276 ka tawo kada kilometro kwadrado sa palibot sa Ambājogāi nga hilabihan populasyon. Ambājogāi ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa Ambājogāi.\\nAng klima nga savanna. Ang kasarangang giiniton 27 °C. Ang kinainitan nga bulan Mayo, sa 35 °C, ug ang kinabugnawan Agosto, sa 22 °C. Ang kasarangang pag-ulan 1,154 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 315 milimetro nga ulan, ug ang kinaugahan Enero, sa 1 milimetro."},{"page_url":"https://tr.wikipedia.org/wiki/2008_Yaz_Olimpiyatlar%C4%B1%27nda_eskrim","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/2008_Fencing_Hall_of_the_National_Convention_Center.JPG","page_title":"2008 Yaz Olimpiyatları'nda eskrim","context_page_description":"2008 Yaz Olimpiyatları'nda eskrim müsabakaları Çin Ulusal Kongre Merkezi'nde 9 - 17 Ağustos tarihleri arasında düzenlenmiştir. Müsabakalar 10 dalda yapılmıştır."},{"page_url":"https://az.wikipedia.org/wiki/V%C3%BCqar_Aslanov","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/V%C3%BCqar_Aslanov.jpg","page_title":"Vüqar Aslanov","context_page_description":"Vüqar Aslanov - Qarabağ müharibəsi iştirakçısı, şəhid.\\nVüqar Qəmbər oğlu Aslanov 15 iyul 1970-ci ildə Laçın rayonunun Mişni kəndində anadan olub. Orta məktəbi bitirdikdən sonra hərbi xidmətə çağırılmış, Almaniyada hərbi qulluq edərkən erməni faşistlərinin xalqımıza qarşı zora¬kılıqlarını eşitmiş, torpaqlarımıza qarşı qəsdləri dəf etmək üçün Vətənə dönmüşdür.\\nVüqar Aslanov 1990-cı ildə hərbi xidməti başa vurub kəndə qayıtdı. Elə qayıdan kimi də könüllü olaraq özünümüdafiə dəstəsinə qoşuldu. Atası Qəmbər müəllim kimi təbiəti çox sevən Vüqar Vətənin müdafiəsinə biganə qala bilməzdi. Doğma torpaqların müdafiəsi üçün özünü səfərbər etdi.\\n1992-ci ildə Şuşa və Laçın rayonları ermənilər tərəfindən zəbt edildi. Vüqarın qulluq etdiyi batal¬yon Laçını tərk elədi. Az bir müddət sonra ordu hissələrimiz yenidən Laçın rayonunun şimal hissəsini düşmən qüvvələrindən təmizləməyə nail oldu. Bu zaman ən ağır döyüşlər “Hoçaz qayası” adlanan ərazidə və onun ətrafında baş verdi. Vüqarın aid olduğu batalyon görünməmiş şücaət göstərdi. Əksəriyyəti Mişni cavanlarından olan bu dəstənin fədakarlığı hamıya örnək olacaq bir kitabın səhifələridir."},{"page_url":"https://es.wikipedia.org/wiki/Ronnie_Lane","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Ronnie_Lane.jpg","page_title":"Ronnie Lane","context_page_description":"Ronald Frederick \\"Ronnie\\" Lane fue un cantante y músico de rock inglés. Fue miembro de bandas como Small Faces y Faces."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D1%8A%D0%BB%D1%8A%D0%B1%D0%BE%D0%B2%D0%B0_%D0%BE%D0%BF%D0%B0%D1%88%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Macroglossum_stellatarum_MHNT_sur_Raiponce.jpg","page_title":"Гълъбова опашка","context_page_description":"Гълъбовата опашка е вид молец от семейство Sphingidae. Дългият хобот и способността ѝ да смуче нектар в стоящ полет я правят да прилича забележително на колибри.\\nРазперът на крилата ѝ е около 4 – 5 cm. Предните крила са сивокафяви на цвят, а задните – оранжеви. Има сравнително добра способност за разпознаване на цветовете. Разпознава главно две групи багри – синьо и жълто, и подобно на пчелата не различава червения от черния цвят.\\nРазпространена е в северната част на Стария свят от Португалия до Япония, но пребивава само в топъл климат. През зимата рядко оцелява в северните ширини, на север от Алпите в Европа, и на север от Кавказ в Русия.\\nЛети през деня, особено при ярка слънчева светлина, по здрач, но също така и по време на дъжд."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%8A%D8%A7%D8%B1%DA%86%D9%88_%D8%B3%D9%88%D9%8A%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Agapetus_%28Yrj%C3%B6_Soini%29.jpg","page_title":"يارچو سوينى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nيارچو سوينى كان صحفى من فينلاندا."},{"page_url":"https://de.wikipedia.org/wiki/Soci%C3%A9t%C3%A9_Antoinette","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Motore_aeronautico_-_Museo_scienza_tecnologia_Milano_05088_dia.jpg","page_title":"Société Antoinette","context_page_description":"Die Société Antoinette war ein französischer Hersteller von Flugmotoren, Flugzeugen und Automobilen."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%87%D9%86%DA%AF_%D8%AF%D8%B1_%D9%BE%D8%A7%DA%A9%D8%B3%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Statue_of_Bhangra_in_Amritsar_26_September_2018.jpg","page_title":"فرهنگ در پاکستان","context_page_description":"فرهنگ در پاکستان با فرهنگهای گسترده شبه قاره هند و آسیای میانه در هم تنیده‌است. شامل گروه‌های قومی متعددی چون: پنجابی، سارایکیس، کشمیری، سندی، مهاجران، مکرانی در جنوب؛ بلوچ، هزاره‌ها و پشتون‌ها در غرب؛ و مردم دارد، واخی، شیناکی، بالتیز و بوروشو در شمال می‌شود. فرهنگ این گروه‌های قومی پاکستان تحت تأثیر بسیاری از همسایگان این کشور، مانند سایر آسیای جنوبی، ایرانی، ترک و همچنین مردمان آسیای میانه و غرب آسیا بسیار تأثیر گرفته‌است.\\nدر گروه‌های قومی در جنبه‌های فرهنگی مانند لباس، غذا و مذهب تفاوت‌هایی وجود دارد، به ویژه در مواردی که آداب و رسوم پیش از اسلام با آداب اسلامی متفاوت است. منشأ فرهنگی آنها همچنین تأثیرات دور و بومی، از جمله هند باستان و آسیای مرکزی را نشان می‌دهد. پاکستان اولین منطقه از شبه قاره هند بود که به‌طور کامل تحت تأثیر اسلام قرار گرفت و از این رو هویت اسلامی متمایزی از نظر تاریخی متفاوت با مناطق بیشتر در شرق ایجاد کرد."},{"page_url":"https://nl.wikipedia.org/wiki/Fiera_di_Primiero","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Fiera_di_Primiero_chiesa.jpg","page_title":"Fiera di Primiero","context_page_description":"Fiera di Primiero is een gemeente in de Italiaanse provincie Trente en telt 560 inwoners. De oppervlakte bedraagt 0,1 km², de bevolkingsdichtheid is 5600 inwoners per km².\\nDe volgende frazioni maken deel uit van de gemeente: -."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E9%9F%93%E6%B0%91%E5%9C%8B%E6%AD%B7%E5%8F%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Fireworks_at_the_closing_ceremonies_of_the_1988_Summer_Games.JPEG","page_title":"大韓民國歷史","context_page_description":"大韩民国历史是朝鲜半岛南北分治后南方政权的历史。自南北分治以来，韩国经历民主与独裁统治的交替：第一共和国处于李承晚的独裁统治之下，直至1960年四·一九运动垮台。以张勉为代表的民主内阁制第二共和国由于管理不力，成立仅8个月后被朴正熙军队推翻。之后从第三共和国到第五共和国，韩国都处于朴正熙及全斗焕军政府的威权统治之下。1987年之后，第六共和国开始逐渐建立起自由民主的政府。\\n在朴正熙执政的第三和第四共和国，韩国经济在政府主导的外向型发展策略执导下发展迅速，创造汉江奇迹，成为亚洲四小龙之一。在全斗焕执政的第五共和国，韩国经济继续保持了高速发展态势。民主化后首位文人总统金泳三执政期间，韩国进入发达国家行列，并成为经济合作与发展组织成员。1997年亚洲金融风暴期间，韩国经济遭到重创，但在金大中总统的带领下，韩国迅速摆脱危机，重归正轨。\\n二战后冷战时期，韩国主要是与资本主义国家发展关系。20世纪70年代初，随着冷战格局的结束，韩国开始与社会主义国家阵营接触。1988年，卢泰愚当选总统后，开始推行“北方政策”，积极与社会主义国家发展外交关系，并在1990年和1992年分别与前苏联和中华人民共和国建交。1993年，金泳三文人政府开始提出“世界化、民间化、多边化、多元化、区域合作和面向未来”的外交政策。韩国外交形成多层次、全方位的格局。"},{"page_url":"https://sv.wikipedia.org/wiki/Rosier_Faassen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Rosier_Faasen.jpg","page_title":"Rosier Faassen","context_page_description":"Pieter Jacobus Faassen, född 9 september 1833 i Haag, död 2 februari 1907 i Rotterdam, var en nederländsk dramatiker.\\nFaassen verkade från 1854 som ansedd skådespelare i Amsterdam, Haag och Rotterdam, men vann större rykte genom en hel rad av honom författade skådespel, som till exempel De oude kassier, Anne-Mie, Zwarte Griet och Platijn en Co., vilka troget avspeglar det nederländska folklivet och även har förtjänster i karaktärsteckningen. Genom sin omedelbarhet röjde de mark för det nyare realistiska dramat. Faassens dramatiska arbeten utgavs samlade i två band."},{"page_url":"https://sh.wikipedia.org/wiki/O_veli%C4%8Dinama_i_udaljenostima","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/AristarchusLunar_Eclipse2.png","page_title":"O veličinama i udaljenostima","context_page_description":"O veličinama i udaljenostima je jedina sačuvana knjiga koju je napisao Aristarh sa Samosa. U ovoj knjizi Aristarh je izračunao veličinu Sunca i Mjeseca, kao i njihovu udaljenost od Zemlje."},{"page_url":"https://vi.wikipedia.org/wiki/T%C3%B4n_gi%C3%A1o_t%E1%BA%A1i_Nh%E1%BA%ADt_B%E1%BA%A3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/%E5%BE%A1%E5%B6%BD%E7%A5%9E%E7%A4%BE%E7%8E%8B%E6%BB%9D%E5%8F%A3_%E4%BE%8B%E5%A4%A7%E7%A5%AD.jpg","page_title":"Tôn giáo tại Nhật Bản","context_page_description":"Tôn giáo ở Nhật Bản, được thống trị bởi hai tôn giáo chính: Thần đạo - Shinto và Phật giáo với các tổ chức liên quan. Theo cuộc điều tra được thực hiện vào năm 2006 và năm 2008, dưới 40% dân số của Nhật Bản tự nhận đi theo một tôn giáo có tổ chức: khoảng 35% là Phật giáo, 3% đến 4% là tín đồ của Thần đạo và các tôn giáo phái sinh từ Thần đạo, và ít hơn 1% đến 2.3% dân số theo Kitô giáo.\\nHầu hết người Nhật thờ cúng tổ tiên và các vị thần ở các đền thờ Thần đạo hoặc đền thờ cá nhân trong khi không xác định mình là người theo \\"Thần đạo\\" khi được phỏng vấn. Lý do là những từ này ít có ý nghĩa đối với phần lớn người Nhật hoặc những từ này có ý nghĩa là các hội viên chính thức của các tổ chức giáo phái Thần đạo. Thuật ngữ \\"tôn giáo\\" trong văn hóa Nhật Bản chỉ có nghĩa là các tôn giáo có tổ chức. Những người tự nhận là \\"không tôn giáo\\" trong cuộc điều tra thực sự có nghĩa là họ không thuộc về bất cứ tôn giáo có tổ chức nào, cho dù họ có thể tham gia vào các nghi lễ thờ cúng của Thần đạo.\\nCác học giả Isomae Jun kenichi và Jason Ānanda Josephson đã thách thức tính hữu dụng của thuật ngữ \\"tôn giáo\\" đối với \\"truyền thống\\" Nhật Bản."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%82%D1%83%D1%82%D0%B8%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Vatutine_prapor.png","page_title":"Ватутино","context_page_description":"Вату́тино — город областного значения в Черкасской области Украины."},{"page_url":"https://hu.wikipedia.org/wiki/Kudzsiri-havasok","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Tajak1.jpg","page_title":"Kudzsiri-havasok","context_page_description":"A Kudzsiri-havasok vagy Sebes-hegység a Déli-Kárpátok Páring csoportjához tartozó hegység. Legmagasabb pontja a 2130 méteres Péter-csúcs. A hegység viszonylag alacsony, illetve középmagas csúcsaival elég nagy területen helyezkedik el. Mai arculatát a természeti erők nagyfokú eróziós tevékenysége alakította ki.\\nNevét Kudzsir városról kapta."},{"page_url":"https://pl.wikipedia.org/wiki/Gr%C3%BCnebach","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Gr%C3%BCnebacher_H%C3%BCtte.jpg","page_title":"Grünebach","context_page_description":"Grünebach – miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Altenkirchen, wchodzi w skład gminy związkowej Betzdorf-Gebhardshain. Do 31 grudnia 2016 wchodziła w skład gminy związkowej Betzdorf."},{"page_url":"https://fr.wikipedia.org/wiki/BMW_Nazca","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/1991Italdesign-BMWNazcaC2-rear.jpg","page_title":"BMW Nazca","context_page_description":"BMW Nazca est une série de trois concept-car : BMW Nazca M12 de 1991, BMW Nazca C2 de 1992, et BMW Nazca C2 Spider de 1993, du constructeur automobile allemand BMW / Alpina, et du designer italien Italdesign."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A4%D7%A8%D7%99%D7%A7%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Netzgiraffe_%28Giraffa_camelopardalis_reticulata%29_Tierpark_Hellabrunn-13.jpg","page_title":"אפריקה","context_page_description":"אפריקה היא היבשת השנייה בשטחה ובגודל אוכלוסייתה אחרי אסיה. היבשת משתרעת על שטח של 30,244,050 קמ\\"ר, שהם כ-20.4% משטח היבשה של כדור הארץ. באפריקה מתגוררים יותר מ-1.2 מיליארד תושבים ב-61 טריטוריות ואזורים, שהם כמעט 16% מאוכלוסיית כדור הארץ. מצפון ליבשת נמצא הים התיכון, צפון מזרחה מוקף על ידי תעלת סואץ, ים סוף וחצי האי סיני, מדרום-מזרחה נמצא האוקיינוס ההודי, וממערבה — האוקיינוס האטלנטי. אם אין מונים את הסהרה המערבית שהיא אזור שנוי במחלוקת, יש באפריקה 54 מדינות, כולל האי מדגסקר ועוד מספר איים שלרוב נחשבים לחלק מהיבשת.\\nרוב מוחלט של החוקרים כיום סובר שאפריקה היא מקום מוצאם האבולוציוני של ההומינינים, של סוג האדם ושל האנושות בת ימינו. ראיות לכך הן התגליות הרבות, בעיקר במזרחה ובדרומה של היבשת, של מאובני הומינינים קדומים מתקופות של עד 7 מיליון שנים לפני זמננו, כמו סהלאנתרופוס צ'אדנסיס, ארדיפיתקוס רמידוס ומיני אוסטרלופיתקוס; של מאובני מיני אדם מתקופות של עד 2.5 מיליון שנה לפני זמננו, כמו הומו הביליס, הומו רודולפנסיס והומו ארגסטר; ואף מאובני האדם הנבון מתקופה של עד 200 אלף שנה לפני זמננו. גם תגליות גנטיות כמו חוה המיטוכונדרית ואדם כרומוזום Y תומכות במוצאה האפריקאי של האנושות."},{"page_url":"https://id.wikipedia.org/wiki/Kabupaten_Sumba_Barat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Air_Terjun_Lapopu%2C_Sumba_Barat.jpg","page_title":"Kabupaten Sumba Barat","context_page_description":"Kabupaten Sumba Barat adalah sebuah kabupaten yang terletak di provinsi Nusa Tenggara Timur, Indonesia. Ibu kotanya berada di Kota Waikabubak. Kabupaten Sumba Barat pernah mengalami pemekaran wilayah menjadi Kabupaten Sumba Barat Daya dan Kabupaten Sumba Tengah pada tahun 2007."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_%D0%A8%D0%B8%D1%80%D0%BE%D0%BA%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Roman_Shirokov_2012.jpg","page_title":"Роман Широков","context_page_description":"Роман Широков — Русия футболчысы, Русия милли футбол җыелмасы әгъзасы, Аурупа чемпионатының бронза призчысы, УЕФА кубогы һәм суперкубогы иясе, Русиянең Ел футболчысы, Русия чемпионатларының алтын, көмеш һәм бронза призчысы, Русия кубогы һәм суперкубогы иясе."},{"page_url":"https://en.wikipedia.org/wiki/List_of_municipal_flags_of_Ch%C5%ABbu_region","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Flag_of_Sasagami_Niigata.JPG","page_title":"List of municipal flags of Chūbu region","context_page_description":"This page lists the municipal flags of Chūbu region, Japan. It is a part of the List of Japanese municipal flags, which is split into regions due to its size."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Dorset","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Mappercombe_Manor_House_-_geograph.org.uk_-_1239605.jpg","page_title":"Grade I listed buildings in Dorset","context_page_description":"There are over 9,000 Grade I listed buildings in England. This is a list of these buildings and structures in the county of Dorset, grouped first by the two unitary authority areas: first Bournemouth, Christchurch and Poole, then Dorset."},{"page_url":"https://en.wikipedia.org/wiki/Geography_of_Kazakhstan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Kazakhstan_2001_CIA_map.jpg","page_title":"Geography of Kazakhstan","context_page_description":"Kazakhstan is located in Central Asia and Eastern Europe at 48°N 68°E. With an area of about 2,724,900 square kilometers, Kazakhstan is more than twice the combined size of the other four Central Asian states and 60% larger than Alaska. The country borders Turkmenistan, Uzbekistan, and Kyrgyzstan to the south; Russia to the north; Russia and the Caspian Sea to the west; and China's Xinjiang Uygur Autonomous Region to the east."},{"page_url":"https://es.wikipedia.org/wiki/Ibeas_de_Juarros","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Atapuerca_090.jpg","page_title":"Ibeas de Juarros","context_page_description":"Ibeas de Juarros es una localidad y un municipio​ situados en la provincia de Burgos, Castilla la Vieja, en la comunidad autónoma de Castilla y León, comarca de Alfoz de Burgos, partido judicial de Burgos, cabecera del ayuntamiento de su nombre. En su término municipal se encuentran dos lugares declarados Patrimonio de la Humanidad por la Unesco: el Yacimiento de Atapuerca y el Camino de Santiago.\\nEn 2015, en la aprobación por la Unesco de la ampliación del Camino de Santiago en España a «Caminos de Santiago de Compostela: Camino francés y Caminos del Norte de España», España envió como documentación un «Inventario Retrospectivo - Elementos Asociados» en el que en el n.º 1309 figura la localidad de Ibeas de Juarros, con un ámbito de elementos asociados.​"},{"page_url":"https://en.wikipedia.org/wiki/Rauen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Rauen_in_LOS.PNG","page_title":"Rauen","context_page_description":"Rauen is a municipality in the Oder-Spree district, in Brandenburg, Germany."},{"page_url":"https://en.wikipedia.org/wiki/Aulestad","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Aulestad%2C_Bj%C3%B8rnstjerne_Bj%C3%B8rnsons_hjem_i_Follebu.JPG","page_title":"Aulestad","context_page_description":"Aulestad is a farm and writer's house museum in Follebu in Innlandet county, Norway. It is located along County Road Fv255 between Vinstra and Hovemoen.\\nThe farm is best known as the former residence of Karoline and Bjørnstjerne Bjørnson. Nobel Laureate Bjørnstjerne Bjørnson lived here with his family from 1875 until his death in 1910. The farm is still owned by members of the Bjørnson family.\\nThe manor was added to The Sandvig Collections at Lillehammer after Karoline Bjørnson's death in 1934. In 1935 Aulestad opened as a museum. It serves as a museum of Bjørnstjerne Bjørnson's life and work. Since 2011. Aulestad has been part of the Lillehammer museum which operates Maihaugen, together with the Norwegian Olympic Museum and Bjerkebæk, the former home of author Sigrid Undset."},{"page_url":"https://af.wikipedia.org/wiki/Strelna","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Konstantin_Palace.jpg","page_title":"Strelna","context_page_description":"Strelna is ’n historiese nedersetting aan die Golf van Finland, sowat halfpad tussen Sint Petersburg en Peterhof in Rusland. Dit het ’n bevolking van 12 751."},{"page_url":"https://fr.wikipedia.org/wiki/Andr%C3%A9_V%C3%A9zinhet","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Andre_Vezinhet_Alco_02092009_cropped_by_Vpe.JPG","page_title":"André Vézinhet","context_page_description":"André Vezinhet, né le 7 septembre 1939 à Rodez, est un homme politique français. Il est membre du Parti socialiste."},{"page_url":"https://pt.wikipedia.org/wiki/Daredevil_(s%C3%A9rie_de_televis%C3%A3o)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Vincent_D%27Onofrio_TIFF_2014.jpg","page_title":"Daredevil (série de televisão)","context_page_description":"Daredevil é uma série de televisão americana criada para a Netflix por Drew Goddard que baseia-se no personagem de mesmo nome da Marvel. Ela situa-se e partilha dos acontecimentos dos filmes do Universo cinematográfico da Marvel. É a primeira de quatro séries que levou quatro heróis a se juntarem numa minissérie denominada Os Defensores. Marvel's Daredevil é produzido pela divisão Marvel Television numa associação com a ABC Studios, a DeKnight Productions e a Goddard Textiles, com Steven S. DeKnight sendo o showrunner da primeira temporada. Na segunda, Doug Petrie e Marco Ramirez assumiram o posto, e Goddard ficou como consultor.\\nCharlie Cox estrela como Matt Murdock, o Demolidor, um advogado cego que combate o crime à noite. Demolidor entrou em desenvolvimento no final de 2013, um ano após os direitos cinematográficos do personagem terem sido revertidos para Marvel, com Goddard inicialmente contratado em dezembro deste ano. DeKnight substituiu-o como showrunner e Cox foi contratado para estrelar em maio de 2014, com Deborah Ann Woll, Elden Henson e Rosario Dawson também estrelando, enquanto Jon Bernthal, Élodie Yung e Stephen Rider se juntaram ao elenco na segunda temporada."},{"page_url":"https://cy.wikipedia.org/wiki/Cardiff-by-the-Sea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Sunset_at_Cardiff-by-the-sea%2C_San_Diego.jpg","page_title":"Cardiff-by-the-Sea","context_page_description":"Dinas lan-môr yn Swydd San Diego, Califfornia, yr Unol Daleithiau, yw Cardiff-by-the-Sea. Fe'i lleolir ar yr arfordir rhwng Encinitas a Thraeth Solana. Mae'r Cefnfor Tawel i'r gorllewin, Encinitas i'r gogledd a dwyrain, a thraeth a lagŵn i'r de. Gyda phoblogaeth o lai na 12,000, mae Cardiff-by-the-Sea yn cael ei ystyried yn rhan o ddinas Encinitas bellach.\\nDechreuodd fel cymuned amaethyddol. Tyfodd yn gyflym o 1911 ymlaen gyda dyn busnes lleol, J. Frank Cullen, yn codi tai a'u gwerthu. Dywedir mai ei wraig, oedd yn Gymraes, a'i berswadiodd i enwi'r dref newydd ar ôl Caerdydd, Cymru.\\nHeddiw mae Cardiff-by-the-Sea yn boblogaidd ar gyfer bordhwylio a syrffio gan fod y tonnau mor dda.\\nYn ôl Cyfrufiad 2010 roedd gan y ddinas 71% gwyn, 21% Hispanic, 3% Asian, 1% Affro-Americanwr a 4% Arall"},{"page_url":"https://fi.wikipedia.org/wiki/Tippu_Tip","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/ZanzibarTipputip.jpg","page_title":"Tippu Tip","context_page_description":"Tippu Tip oli afrikkalainen orjakauppias. Hän rakensi mahtavan kauppaverkoston Itä-Afrikkaan. Tippu Tip kävi kauppaa myös muilla artikkeleilla ja omisti suuria plantaaseja Sansibarissa, jonka sulttaanin suojeluksessa hän oli."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%84%DA%A9%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Emamzadeh_Taher_3132.jpg","page_title":"دلکش","context_page_description":"عصمت باقرپور بابلی با نام هنری «دلکش»، خواننده موسیقی سنتی، فولکلور و پاپ ایرانی بود. از وی با عناوینی چون «زن حنجره طلایی»، «آتش کاروان هنر» یاد می‌شود. او ترانه‌هایش را تنها به دو زبان فارسی و مازندرانی خوانده‌است. وی همچنین در چند مورد به ترانه‌سرایی هم پرداخته و این کار را با تخلص «نیلوفر» انجام داده‌است. از جمله ترانه‌هایی که او خود نوشته و خوانده، ترانهٔ «ساز شکسته» است."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC%E4%B8%80%E6%AC%A1%E5%9B%BD%E9%9A%9B%E9%80%A3%E5%90%88%E7%B7%8A%E6%80%A5%E8%BB%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/UNEF_Yugoslav_soldiers_15-01-1957.jpg","page_title":"第一次国際連合緊急軍","context_page_description":"第一次国際連合緊急軍はエジプトに展開した国際連合平和維持活動。第二次中東戦争の停戦監視を請け負った。安保理では無く、総会の決議により派遣されたものである。国際連合憲章第7章の強制措置とは異なるPKO活動が認識され、組織編成されたのは、これが最初となる。第二次中東戦争が「スエズ危機」とも呼ばれるため通称「スエズ国連軍」。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_National_Historic_Landmarks_in_Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Navajo_Nation_Council_Chambers_6809.jpg","page_title":"Liste der National Historic Landmarks in Arizona","context_page_description":"Die Liste der National Historic Landmarks in Arizona ist eine Denkmalliste von derzeit 41 vom US-Innenministerium als National Historic Landmark anerkannten Stätten und Denkmälern von nationaler Bedeutung im Bundesstaat Arizona. Sie werden vom National Park Service verwaltet.\\nIn der Liste mitgezählt ist der Hoover Dam, der sich von Nevada nach Arizona erstreckt und die Yuma Crossing and Associated Sites, die auch nach Kalifornien hineinragen. Die Mission San Xavier del Bac war im Oktober 1960 das erste National Historic Landmark Arizonas, das letzte ist die Sage Memorial Hospital School of Nursing, die im Januar 2009 ernannt wurde."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%92%E1%83%95%E1%83%98%E1%83%9C%E1%83%94%E1%83%A3%E1%83%A0%E1%83%98_%E1%83%A2%E1%83%A3%E1%83%A0%E1%83%90%E1%83%99%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Tauraco_persa_-captive-8a.jpg","page_title":"გვინეური ტურაკო","context_page_description":"გვინეური ტურაკო — ტროპიკული ფრინველი ტურაკოსებრთა ოჯახისა. გავრცელებულია დასავლეთი აფრიკის ვაკისა და ჭალის ტყეებში, სენეგალიდან დასავლეთით კონგოს დემოკრატიულ რესპუბლიკამდე და სამხრეთით ჩრდილოეთ ანგოლამდე. როგორც ტურაკოსებრთა ოჯახის ყველა წარმომადგენელი, ცხოვრების უდიდეს ნაწილს ხეებზე ატარებს, მიწაზე მხოლოდ წყლის დასალევად ჩამოდის. ფრენს არც ისე კარგად, უპირატესობას ტოტიდან ტოტზე გადაცოცებას ანიჭებს."},{"page_url":"https://nl.wikipedia.org/wiki/Ames_Autobedrijf","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Ames_vestiging_Leerdam.jpg","page_title":"Ames Autobedrijf","context_page_description":"Ames Autobedrijf is een autodealer in de regio Drechtsteden, de Hoeksche Waard en Ridderkerk. Ames Autobedrijf maakt onderdeel uit van Amega Groep, waaronder ook de andere activiteiten van Ames vallen, zoals service, schadeherstel en lease. Amega Groep behoort tot een van de grotere dealerholdings van Nederland."},{"page_url":"https://en.wikipedia.org/wiki/St_Barnabas_Anglican_Church,_Broadway","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/%281%29St_Barnabas_Church_Broadway_Sydney-1.jpg","page_title":"St Barnabas Anglican Church, Broadway","context_page_description":"St Barnabas Anglican Church, Broadway is an Anglican church in the Diocese of Sydney, New South Wales, Australia. The church property is located on Broadway, near the University of Sydney and University of Technology, Sydney.\\nCommonly called Barneys, the church is well known in Sydney for its church signs, including a celebrated \\"battle\\" with the publican across the road. The church would put up one sign and the hotel would have another with a witty reply to the church's sign. Some of the signs attracted the attention of the Sydney media.\\nArthur Stace, the \\"Eternity\\" man, was a member of the church."},{"page_url":"https://en.wikipedia.org/wiki/2011_Australian_Open","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Rafa_Nadal_7850_2_Japan_Open_Tennis_Tokio_2010.jpg","page_title":"2011 Australian Open","context_page_description":"The 2011 Australian Open was a tennis tournament featuring six different competitions, and part of the 2011 ATP World Tour, the 2011 WTA Tour, ITF Junior Tour and the NEC Tour, as tournaments for professional, junior and wheelchair players were held. The tournament took place at Melbourne Park in Melbourne, Australia from 17 to 30 January, it was the 99th edition of the Australian Open and the first Grand Slam event of 2011. The tournament was played on hard courts and was organised by the International Tennis Federation and Tennis Australia.\\nRoger Federer was unsuccessful in his title defence, being defeated by Novak Djokovic in the semi-finals, and Serena Williams was unable to defend her title due to a foot injury she suffered shortly after winning Wimbledon last year. Djokovic won the Australian Open for the second time, and Kim Clijsters, the runner-up to Justine Henin-Hardenne in 2004, won her maiden Australian Open. In the men's doubles the Bryan Brothers won their fifth Australian Open while Gisela Dulko and Flavia Pennetta won their maiden Grand Slam title in the women's doubles."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BB%D0%B0%D0%B2%D0%BD%D0%B8%D1%9B%D0%B0_%D0%BA%D1%83%D1%9B%D0%B0_%D1%83_%D0%A1%D0%B5%D0%BD%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Ku%C4%87a_Slavni%C4%87a_u_Senti_02.jpg","page_title":"Славнића кућа у Сенти","context_page_description":"Славнића кућа у Сенти грађена је током 1904 - 1905. године. Као споменик културе, сврстана је у категорију споменика од великог значаја.\\nКућу Славнића у Сенти, пројектовао је мађарски архитекта, Бела Лајта, један од најбољих следбеника чувеног мађарског архитекте Еден Лехнера."},{"page_url":"https://ceb.wikipedia.org/wiki/Stelis_chlorantha","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Stelis_chlorantha_-_cutout_from_Flora_Brasiliensis_3-4-81_fig_II.jpg","page_title":"Stelis chlorantha","context_page_description":"Espesye sa orkidya ang Stelis chlorantha. Una ning gihulagway ni João Barbosa Rodrigues. Ang Stelis chlorantha sakop sa kahenera nga Stelis sa kabanay nga Orchidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://hu.wikipedia.org/wiki/Vat_Rong_Kun","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Wat_Rong_Khun-006.jpg","page_title":"Vat Rong Kun","context_page_description":"Wat Rong Khun, egy a megszokottól eltérő, kortárs buddhista templom a thaiföldi, Csiangraj régióban, Csiangraj várostól 15 km-re délnyugatra. A teljes egészében fehér és apró üvegdarabokkal és gazdag díszítőelemekkel kirakott épületet, a thai Gaudí-ként is emlegetett, Chalermchai Kositpipat tervezte 1997-ben. A turisták számára is ingyenesen látogatható épület egy nagyobb projekt része, amelynek elkészítése a tervező szerint évtizedeket fog igénybe venni."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%B0_%D0%A1%D0%B5%D1%80%D0%B1%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/General_Dimitrije_Cincar_Markovi%C4%87.jpg","page_title":"Список глав правительства Сербии","context_page_description":"Список глав правительства Сербии включает руководителей правительств Сербии, начиная с повстанческих правительств XIX века, независимо от исторического наименования должности руководителя правительства и степени независимости государства в этот период.\\nВ настоящее время правительство возглавляет Председатель правительства Республики Сербии, являющийся руководителем исполнительной власти страны. Глава партии, набравшей большинство голосов на парламентских выборах, становится главным претендентом на этот пост. Назначение на пост производится Президентом Сербии после голосования по кандидатуре в Народной скупщине, которой кандидат представляет свою программу действий. Председатель управляет деятельностью правительства и осуществляет её координацию, представляет кабинет на международной арене. На протяжении срока полномочий он обладает неприкосновенностью; может быть отрешён от должности путём объявления вотума недоверия правительству."},{"page_url":"https://es.wikipedia.org/wiki/Alicia_Gonz%C3%A1lez_D%C3%ADaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/DSC04531-Casa_del_Templo-Toledo.jpg","page_title":"Alicia González Díaz","context_page_description":"Alicia González Díaz conocida como Alicia González es una arquitecta española experta en arquitectura tradicional vernácula y patrimonio. Recibió el premio Europa Nostra en 1998, ​ por sus trabajos sobre recuperación del patrimonio arquitectónico y urbano en varias ciudades patrimonio de la Unesco.​"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%B4%D9%87%D8%B1%D9%87%D8%A7%DB%8C_%D8%AA%D8%A7%DB%8C%D9%88%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Kaohsiung_Tuntex_Sky_Tower_Innen_Bild_2_%282%29.jpg","page_title":"فهرست شهرهای تایوان","context_page_description":"در سلسله‌مراتب ساختاری از تقسیمات کشوری در تایوان، سه نوع از تقسیمات شهری است که در نام آنها وجود دارد:\\nشهرداری ویژه: کائوسیونگ، تایپه، تایچانگ، تاینان و تایپه\\nشهرستان: چیایی، هسینچو، و کیلانگ\\nشهرهای تحت کنترل: ۱۷ شهر در تایوان، شهر تحت کنترل است.\\nQuelle: Department of Statistics, Ministry of Interior, Republic of China"},{"page_url":"https://fr.wikipedia.org/wiki/Relations_entre_l%27Empire_romain_et_la_Chine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Emperor_Taizong_gives_an_audience_to_the_ambassador_of_Tibet.jpg","page_title":"Relations entre l'Empire romain et la Chine","context_page_description":"Les relations entre l'Empire romain et la Chine ont été essentiellement indirectes et ce tout au long de l’existence de ces deux empires. Il s'agit pour l'essentiel d'échanges occasionnels de marchandises, d'informations et de voyageurs entre l'Empire romain et la dynastie Han, ainsi qu'entre l'Empire byzantin et diverses dynasties chinoises. Ces empires se sont progressivement rapprochés avec l’expansion romaine au Proche-Orient et les incursions militaires chinoises dans l’Asie centrale. Les Romains comme les Chinois sont conscients que \\"l'autre\\" existe, mais cette conscience reste limitée et chaque empire a des connaissances très floues sur tout ce qui concerne l'autre. Seules quelques tentatives de contact direct sont connues grâce aux archives qui nous sont parvenues. De puissants empires tels que ceux des Parthes et des Kouchans séparent les deux pays et cherchent à maintenir le contrôle si lucratif qu'ils exercent sur le commerce de la soie. En définitive, ils empêchent tout contact direct entre ces deux puissances eurasiennes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%A1%D0%A8%D0%90_%D1%81_%D0%BF%D1%80%D0%B5%D0%BE%D0%B1%D0%BB%D0%B0%D0%B4%D0%B0%D1%8E%D1%89%D0%B8%D0%BC_%D0%BD%D0%B5%D0%B1%D0%B5%D0%BB%D1%8B%D0%BC_%D0%BD%D0%B0%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5%D0%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/New_2000_hispanic_percent.gif","page_title":"Штаты США с преобладающим небелым населением","context_page_description":"Штаты США с преобладающим небелым населением — группа административных единиц второго порядка на территории США, в которых преобладает не белое население, а разнообразные расовые и этноязыковые группы так называемого цветного населения — афроамериканцы, латиноамериканцы, азиаты, индейцы, люди смешанного происхождения. По состоянию на 2006 год таких штатов в стране 4, а также территория округа Колумбии — Вашингтона. Тем не менее, во всех них, за исключением округа Колумбии, белое англоязычное население сохраняет пока относительное большинство, так как цветное население достаточно разнообразно по своему составу. Помимо этого, небелое население преобладает в ряде заморских зависимых территорий США: Гуам, Американские Виргинские острова и Американское Самоа."},{"page_url":"https://id.wikipedia.org/wiki/Zenz%C5%8D_Kasai","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Kasai_Zenzo.jpg","page_title":"Zenzō Kasai","context_page_description":"Zenzō Kasai adalah novelis Jepang dari zaman Taishō. Karya-karyanya menggambarkan kemiskinan, orang penyakitan, dan kesendirian."},{"page_url":"https://zh.wikipedia.org/zh-cn/2016%E5%B9%B4%E5%9C%8B%E9%9A%9B%E8%B6%B3%E5%8D%94%E5%AE%A4%E5%85%A7%E4%BA%94%E4%BA%BA%E8%B6%B3%E7%90%83%E4%B8%96%E7%95%8C%E7%9B%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Copa_Mundial_de_F%C3%BAtbol_Sala_de_2016.png","page_title":"2016年國際足協室內五人足球世界盃","context_page_description":"2016年国际足联室内五人足球世界杯是第八届室内五人足球世界杯，于2016年9月10日至10月1日于哥伦比亚举行。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Brixen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Brixen-Altenmarktgasse11.JPG","page_title":"Liste der Baudenkmäler in Brixen","context_page_description":"Die Liste der Baudenkmäler in Brixen enthält die 278 als Baudenkmäler ausgewiesenen Objekte auf dem Gebiet der Gemeinde Brixen in Südtirol.\\nBasis ist das im Internet einsehbare offizielle Verzeichnis der Baudenkmäler in Südtirol. Dabei kann es sich beispielsweise um Sakralbauten, Wohnhäuser, Bauernhöfe und Adelsansitze handeln. Die Reihenfolge in dieser Liste orientiert sich an der Bezeichnung, alternativ ist sie auch nach der Adresse oder dem Datum der Unterschutzstellung sortierbar."},{"page_url":"https://sv.wikipedia.org/wiki/Corregidor","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Corregidor_overview_landsat2000.jpeg","page_title":"Corregidor","context_page_description":"Corregidor är en ö i Filippinerna strategiskt placerad cirka 48 kilometer väster om huvudstaden Manila och ligger mellan provinserna Bataan och Cavite. Ön har en landarea på 9 kvadratkilometer. Under andra världskriget var ön huvudkvarter för de allierade och säte för den filippinska regeringen då Japan invaderade Filippinerna i december 1941. Den 6 maj 1942 var de allierade tvungna att ge upp ön och överlämna den till japanerna. Ön återerövrades av de allierade i mars 1945."},{"page_url":"https://en.wikipedia.org/wiki/Oslo_City_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Gamle_r%C3%A5dhus_Oslo.jpg","page_title":"Oslo City Hall","context_page_description":"Oslo City Hall is a municipal building in Oslo, the capital of Norway. It houses the city council, the city's administration and various other municipal organisations. The building as it stands today was constructed between 1931 and 1950, with an interruption during the Second World War. It was designed by architects Arnstein Arneberg and Magnus Poulsson. The building is located in the city center, in the northern part of the Pipervika neighbourhood, and it faces Oslofjord.\\nOslo City Hall is built of red brick and has two towers, one 63 meters tall and other 66 meters tall. The bricks used are larger than what was typical at the time of construction, but are roughly the same size as bricks used in the Middle Ages. The bricks - measuring approximately 27,5 x 13 x 8,5 cm - were produced by Hovin Teglverk in Oslo. The eastern tower has a set of 49 bells. Various events and ceremonies take place in the building, including the Nobel Peace Prize ceremony which takes place every December."},{"page_url":"https://de.wikipedia.org/wiki/Springbrunnen_Saathain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Springbrunnen_Saathain.jpg","page_title":"Springbrunnen Saathain","context_page_description":"Der Saathainer Springbrunnen ist ein unter Denkmalschutz befindliches Baudenkmal im Ortsteil Saathain in der Gemeinde Röderland im südbrandenburgischen Landkreis Elbe-Elster. Er ist als ortsbildprägendes Baudenkmal im örtlichen Denkmalverzeichnis unter der Erfassungsnummer 09135490 verzeichnet.\\nDer Entwurf der Figur des im Jahre 1930 erschaffenen Springbrunnens wurde vom in Sondershausen geborenen Münchner Bildhauer Christoph Franz Peter erschaffen, welcher einst auch die männliche Bronzefigur „Schreck“ des im Jahre 1903 errichteten Herzog-Alfred-Brunnens im Coburger Hofgarten entworfen hatte. Der Standort des Brunnens befand sich ursprünglich vor dem Saathainer Schloss, das im April 1945 einem Brand zum Opfer gefallen war und von welchem in der Gegenwart nur noch die Grundmauern erhalten sind. 1953 erfolgte schließlich die Umsetzung auf seinen heutigen Standort auf den örtlichen Dorfplatz."},{"page_url":"https://de.wikipedia.org/wiki/St._Pius_X._(K%C3%B6ln)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/St._Pius_X.%2C_K%C3%B6ln-Flittard_-_0240.jpg","page_title":"St. Pius X. (Köln)","context_page_description":"St. Pius X. ist eine katholische Pfarrkirche im Kölner Stadtteil Flittard, die in den Jahren 1959 bis 1962 nach Plänen von Margot und Joachim Schürmann erbaut und im März 1961 geweiht wurde. Die Kirche steht unter dem Patrozinium des wenige Jahre vor dem Bau heiliggesprochenen Papstes Pius X. und ist seit 2001 denkmalgeschützt."},{"page_url":"https://de.wikipedia.org/wiki/Aurelio_Saffi","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Saffi.jpg","page_title":"Aurelio Saffi","context_page_description":"Aurelio Saffi war ein italienischer Politiker in der Zeit des Risorgimentos im radikalen, republikanischen Flügel, der von Giuseppe Mazzini verkörpert wurde.\\nEr absolvierte ein Studium der Rechtswissenschaft an der Universität Ferrara, begann jedoch seine politische Tätigkeit in seiner Heimatstadt. Dort nahm er Stellung gegen die schlecht geleitete Regierung, die von den Kirchenlegaten geführt wurde. Forlì war, wie damals auch Bologna und die ganze Romagna, Teil des Kirchenstaates. Saffi wurde Gemeinderatgeber und Sekretär der Provinz in den Jahren 1844–45. Er näherte sich schnell der Denkrichtung Giuseppe Mazzinis an, so dass er an der wichtigsten politischen Aktion teilnahm, die Mazzini organisiert hatte: die Errichtung der Römischen Republik. In der Hauptstadt wurde die Macht des damaligen Papstes Pius IX. eingeschränkt und republikartige Institutionen eingerichtet. Diese neugeschaffenen Institutionen sollten den damals durch die Vereinigten Staaten geschaffenen demokratischen Einrichtungen nahekommen."},{"page_url":"https://ro.wikipedia.org/wiki/Bistra,_Alba","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Josephinische_Landaufnahme_pg122.jpg","page_title":"Bistra, Alba","context_page_description":"Bistra este satul de reședință al comunei cu același nume din județul Alba, Transilvania, România.\\nEste situat în nord-vestul județului, pe cursul mijlociu al râului Arieș. Bistra este reședința comunei cu același nume."},{"page_url":"https://en.wikipedia.org/wiki/Hannusivka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Ganusivka_tys_prapor.png","page_title":"Hannusivka","context_page_description":"Hannusivka is a village in western Ukraine. It is located in the Tysmenytsky Raion of Ivano-Frankivsk Oblast.\\nHannusivka is a local government area with a rural council."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A4%BE%E0%A4%B0%E0%A4%A4%E0%A5%80%E0%A4%AF_%E0%A4%86%E0%A4%AE_%E0%A4%9A%E0%A5%81%E0%A4%A8%E0%A4%BE%E0%A4%B5,_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Rahul_Gandhi.jpg","page_title":"भारतीय आम चुनाव, 2019","context_page_description":"सत्रहवीं लोक सभा के गठन के लिए भारतीय आम चुनाव, देशभर में 11 अप्रैल से 19 मई 2019 के बीच 7 चरणों में अयोजित कराये गये। चुनाव के परिणाम 23 मई को घोषित किये, जिसमें भारतीय जनता पार्टी ने 303 सीटों पर जीत हासिल की, और अपने पूर्ण बहुमत बनाये रखा और भाजपा के नेतृत्व वाले गठबंधन ने 353 सीटें जीतीं। भाजपा ने 37.36% वोट हासिल किए, जबकि एनडीए का संयुक्त वोट शेयर 60.37 करोड़ वोटों का 45% था। कांग्रेस पार्टी ने 52 सीटें जीतीं और कांग्रेस के नेतृत्व वाले गठबंधन ने 92 सीटें जीतीं। अन्य दलों और उनके गठबंधन ने भारतीय संसद में 97 सीटें जीतीं।\\nआम चुनाव के साथ-साथ आंध्र प्रदेश, अरुणाचल प्रदेश, ओडिशा और सिक्किम राज्यों के विधानसभा चुनाव भी कराये गये।"},{"page_url":"https://de.wikipedia.org/wiki/Sam_Trickett","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Sam_Trickett_2014.jpg","page_title":"Sam Trickett","context_page_description":"Samuel „Sam“ Trickett ist ein professioneller britischer Pokerspieler aus England."},{"page_url":"https://eu.wikipedia.org/wiki/Ipar_Mazedoniako_futbol_selekzio_nazionala","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Ukro-Maki_%2812%29.jpg","page_title":"Ipar Mazedoniako futbol selekzio nazionala","context_page_description":"Ipar Mazedoniako futbol selekzio nazionala herrialde haren futbol gizonezko talde nagusia da. Philip II Arena estadioan jokatzen ditu etxeko partidak, Skopje hiriburuan."},{"page_url":"https://lb.wikipedia.org/wiki/Malmedy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Malmedy_JPG02.jpg","page_title":"Malmedy","context_page_description":"Malmedy, ass eng Stad a Gemeng, déi am Oste vun der Belsch, an der Provënz Léck, läit, do wou d'Warche an d'Warchenne zesummefléissen.\\nBellevaux-Ligneuville a Bevercé sinn aner Uertschaften, déi zu dëser Gemeng gehéieren."},{"page_url":"https://fr.wikipedia.org/wiki/Caza_muerta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Caza_muerta_%28Goya%29.jpg","page_title":"Caza muerta","context_page_description":"Caza muerta est un tableau de Francisco de Goya réalisé en 1775 et appartenant à la première série de cartons pour tapisserie destinée à la salle à manger du Prince des Asturies au palais de l'Escurial."},{"page_url":"https://it.wikipedia.org/wiki/Entella_(fiume)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Entella_mappa.png","page_title":"Entella (fiume)","context_page_description":"L'Entella è un breve fiume della Liguria."},{"page_url":"https://ca.wikipedia.org/wiki/Roger_II_de_Sic%C3%ADlia","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/DSC00538_-_Cattedrale_-_Tomba_di_Ruggero_II_%281095-1154%29_-_Foto_G._Dall%27Orto_28-09-2006.jpg","page_title":"Roger II de Sicília","context_page_description":"Roger II de Sicília, conegut com a Roger el normand, va ser rei de Sicília de la dinastia normanda dels Hauteville, fill del comte Roger I. Va aconseguir unificar sota un únic regne totes les conquestes nordmandes de la Itàlia meridional i organitzar sota la seva persona un govern centralitzat i eficient."},{"page_url":"https://en.wikipedia.org/wiki/1985_Atlantic_hurricane_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Danny_1985_track.png","page_title":"1985 Atlantic hurricane season","context_page_description":"The 1985 Atlantic hurricane season had 6 U.S. landfalling hurricanes, which was the highest number in 99 years. The season officially began on June 1 and lasted until November 30. It was an average season, with 11 named storms developing. This was partially attributed to a La Niña – a meteorological phenomenon that produces favorable conditions across the Atlantic basin, such as lower wind shear and higher sea surface temperatures. The first storm, Ana, developed on July 15 near Bermuda and caused minor effects in Canada while transitioning into an extratropical cyclone. Three other tropical cyclones – Claudette, Henri, and Isabel – did not significantly affect land. Claudette developed offshore of the Southeastern United States and brushed Bermuda and the Azores. Henri and Isabel were dissipating as they approached land. However, the precursor of the latter caused a severe flood in Puerto Rico that killed 180 people. Additionally, Tropical Storm Fabian and three tropical depressions did not have any known impact on land.\\nAlthough several storms caused minimal effects, several tropical cyclones also left extensive impact."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%A2%E1%83%A0%E1%83%90%E1%83%A2%E1%83%9D%E1%83%A1%E1%83%A4%E1%83%94%E1%83%A0%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Atmosphere_layers-ka.svg","page_title":"სტრატოსფერო","context_page_description":"სტრატოსფერო — დედამიწის ატმოსფეროს ფენა, რომელიც განლაგებულია ტროპოსფეროსა და მეზოსფეროს შორის. სტრატოსფეროს ჰაერის შედგენილობა ტროპოსფეროს შედგენილობის მსგავსია, მაგრამ მასში ნაკლებია წყლის ორთქლი და მეტია ოზონი. სტრატოსფეროს ქვედა საზღვარზე ტემპერატურა იცვლება -40 °C-დან -80 °C-მდე. სტრატოსფეროს ზედა საზღვარზე ტემპერატურა საშუალოდ 0 °C-ს უახლოვდება."},{"page_url":"https://pl.wikipedia.org/wiki/Wodospad_Skok","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Wodospad_Skok_a1.jpg","page_title":"Wodospad Skok","context_page_description":"Wodospad Skok – wodospad na potoku Młynica w Dolinie Młynickiej w słowackich Tatrach Wysokich. Nazwa wodospadu pochodzi od słowa skok, które w języku słowackim i w gwarze podhalańskiej oznacza wodospad, w językach południowosłowiańskich próg skalny, uskok, spiętrzenie. Znajduje się on na wysokim progu skalnym przegradzającym środkową część tej doliny. Ma wysokość około 25 m. Przy dużej wodzie na górnej krawędzi progu wodospad załamuje się, wyrzucając do przodu wodny prysznic. Wodospad najbardziej efektowny jest na początku lata tatrzańskiego, czyli w czerwcu, wyrzuca on wówczas średnio 880 litrów wody na sekundę. Ilość spływającej nim wody jest bardzo zmienna, w marcu na przykład jest to zaledwie 54 l/s. Przerażające wrażenie wywierał wodospad podczas wielkiej powodzi w 1958, gdy spływało nim ok. 30 tys. litrów wody na sekund, a woda ta toczyła duże kamienie.\\nW bezpośrednim sąsiedztwie wodospadu znajdują się dwa stawy; powyżej progu Staw nad Skokiem, z którego wypływa woda zasilająca wodospad, poniżej progu znajduje się Staw pod Skokiem. Obok wodospadu prowadzi żółty szlak turystyczny. Pokonuje on stromy próg skalny; miejsca najbardziej eksponowane zabezpieczone są łańcuchami."},{"page_url":"https://pt.wikipedia.org/wiki/Museu_de_Alberto_Sampaio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Orat%C3%B3rio_Tr%C3%ADptico_de_prata_do_Santu%C3%A1rio_de_Nossa_Senhora_da_Oliveira.jpg","page_title":"Museu de Alberto Sampaio","context_page_description":"O Museu de Alberto Sampaio é um museu português, dependente da Direção Regional de Cultura do Norte. Encontra-se instalado nos edifícios anexos à Igreja de Nossa Senhora da Oliveira, formando o conjunto da antiga Colegiada de Guimarães, classificado como Monumento Nacional desde 1910 e Património Mundial da Humanidade desde 2001. Está localizado na antiga freguesia de Oliveira do Castelo, atualmente inserida na União das Freguesias de Oliveira, São Paio e São Sebastião, na cidade e concelho de Guimarães, distrito de Braga."},{"page_url":"https://vi.wikipedia.org/wiki/H%C3%B3a_h%E1%BB%8Dc","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Ice_formations_2.jpg","page_title":"Hóa học","context_page_description":"Hóa học, một nhánh của khoa học tự nhiên, là ngành nghiên cứu về thành phần, cấu trúc, tính chất, và sự thay đổi của vật chất. Hóa học nói về các nguyên tố, hợp chất, nguyên tử, phân tử, và các phản ứng hóa học xảy ra giữa những thành phần đó.\\nHóa học đôi khi được gọi là \\"khoa học trung tâm\\" vì nó là cầu nối các ngành khoa học tự nhiên khác như vật lý học, địa chất học và sinh học."},{"page_url":"https://fi.wikipedia.org/wiki/Foodora","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Foodora_messenger.jpg","page_title":"Foodora","context_page_description":"Foodora on ruoankuljetuspalvelu, jonka pääkonttori sijaitsee Berliinissä. Palvelu on toiminnassa Suomessa, Ruotsissa ja Norjassa.\\nKäyttämällä Foodoran mobiilisovellusta, nettisivuja tai yrityspalvelua asiakkaat voivat tarkastella paikallisia ravintoloita, tehdä tilauksen sekä seurata tilauksen kulkua. Suomessa Foodora toimii yli 80 kaupungissa ympäri maan."},{"page_url":"https://en.wikipedia.org/wiki/Temple_Saint-%C3%89tienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Dom_von_Mulhouse.JPG","page_title":"Temple Saint-Étienne","context_page_description":"The Temple Saint-Étienne is a Calvinist church located in the city of Mulhouse, Alsace, France. Its congregation forms part of the Protestant Reformed Church of Alsace and Lorraine. Because of its central location on the main square of Mulhouse, the Place de la Réunion, and its 97 metre high bell tower, it is sometimes referred to as the \\"Cathedral of Mulhouse\\". The church was designed by the city architect Jean-Baptiste Schacre, who also designed the large Catholic St. Stephen's Church."},{"page_url":"https://en.wikipedia.org/wiki/Princess_Anna_of_Prussia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Anna_of_Prussia_-_Landgravine_of_Hesse.jpg","page_title":"Princess Anna of Prussia","context_page_description":"Princess Maria Anna Friederike was a Princess of Prussia. She was usually called Anna."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B3%A8%EC%A0%84%EB%8F%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Goldendance_bone_conduction_headset.jpg","page_title":"골전도","context_page_description":"골전도로 전도되는 것을 말한다. 골전도를 통한 소리 전달은 일반인이나 청각장애인 모두에게 사용될 수 있다."},{"page_url":"https://id.wikipedia.org/wiki/Hardcore_punk","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Bad_brains_1983.jpg","page_title":"Hardcore punk","context_page_description":"Hardcore punk adalah genre punk rock serta subbudaya yang lahir pada akhir dekade 1970-an. Hardcore punk lebih cepat, lebih keras, dan lebih agresif daripada bentuk punk rock lainnya. Asal usulnya dapat dilacak hingga pergerakan punk terdahulu di San Francisco dan California Selatan yang muncul sebagai tanggapan terhadap kebudayaan hippie yang masih dominan kala itu. Hardcore punk juga terinspirasi dari punk rock New York dan proto-punk. Suara punk New York lebih keras daripada saudaranya di San Francisco, menampilkan ekspresi anti-seni dari kemarahan, energi, dan humor subversif yang jantan. Hardcore punk juga menolak komersialisme, kemajuan industri musik, serta \\"apa pun yang menyerupai rock arus utama\\" dan sering membahas topik sosial dan politik dengan \\"lirik konfrontatif dan bermuatan politis.\\"\\nHardcore punk juga menjadi penyumbang dari gerakan bawah tanah Amerika Serikat pada awal 1980-an, khususnya di Washington DC, New York, New Jersey, Philadelphia, dan Boston—serta di Australia, Kanada, dan Britania Raya. Musik ini juga menelurkan gerakan straight edge dan subgerakan terkait, hardliner dan youth crew."},{"page_url":"https://de.wikipedia.org/wiki/Degersen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Degersen_vom_Gehrdener_Berg.JPG","page_title":"Degersen","context_page_description":"Degersen ist eine Ortschaft der Gemeinde Wennigsen in der Region Hannover."},{"page_url":"https://es.wikipedia.org/wiki/Segunda_vuelta_instant%C3%A1nea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Preferential_ballot.svg","page_title":"Segunda vuelta instantánea","context_page_description":"La segunda vuelta instantánea, también conocida como voto preferencial o voto alternativo, ​​ es un sistema electoral que sirve para elegir a un único ganador por mayoría absoluta de entre más de dos posibles candidatos. Se trata de un sistema de votación preferencial, en el cual el votante no se limita a marcar un solo candidato en la papeleta, sino que puede ordenar a varios candidatos de acuerdo con sus preferencias, de más preferido a menos preferido.\\nAl realizarse el escrutinio, inicialmente se cuentan solo las primeras preferencias de los votantes. Si un candidato obtiene entonces más de la mitad de los votos, ese candidato es proclamado vencedor. Si por el contrario ningún candidato ha obtenido mayoría absoluta, se produce entonces la segunda vuelta instantánea: se elimina al candidato con menos apoyos y se recuentan sus votos, pero asignándose ahora a las segundas preferencias marcadas en esas papeletas. Este proceso se repite hasta que un candidato gane obteniendo la mayoría absoluta de los votos.\\nEl término segunda vuelta instantánea se usa porque este método se asemeja en cierta medida al sistema electoral de doble vuelta."},{"page_url":"https://eu.wikipedia.org/wiki/Cyornis_omissus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Cyornis_omissus.jpg","page_title":"Cyornis omissus","context_page_description":"Cyornis omissus Cyornis generoko animalia da. Hegaztien barruko Muscicapidae familian sailkatua dago."},{"page_url":"https://en.wikipedia.org/wiki/Rom%C3%A1n_Gonz%C3%A1lez_(basketball)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Roman_gonzalez_beso.jpg","page_title":"Román González (basketball)","context_page_description":"Román Javier González is an Argentine-Italian professional basketball player. He is a 2.11 m, 125 kg center. González has dual Argentine and Italian citizenship."},{"page_url":"https://ca.wikipedia.org/wiki/Geografia_de_Senterada","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Senterada._Reguard_5.JPG","page_title":"Geografia de Senterada","context_page_description":"La Geografia de Senterada inclou la descripció dels elements geogràfics de Senterada, al Pallars Sobirà."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D0%BE%D1%85%D0%B1%D1%83%D1%80%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Hochburg_Panorama.jpg","page_title":"Хохбург","context_page_description":"Замъкът Хахберг е руина на средновековен замък близо до немския град Емендинген в Баден-Вюртемберг. След Хайделбергския замък това е вторият по големина замък в Баден. Той е родов замък на маркграфовете на Баден-Хахберг.\\nСъздава се вероятно от Хахо от свитата на Карл Велики. В документ от 1161 г. замъкът е наречен Castro Hahberc.\\nХайнрих I фон Баден-Хахберг, първият маркграф на Баден-Хахберг, управлява от замъка Хахберг в Южен Баден. На 25 юли 1415 г. маркграф Ото II продава замъка заедно с владенията Хахберг на маркграф Бернхард I от Баден."},{"page_url":"https://de.wikipedia.org/wiki/El_Raval","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Barcelona_1690-1695.JPG","page_title":"El Raval","context_page_description":"El Raval ist ein Stadtteil von Barcelona und gehört zum Verwaltungsbezirk Ciutat Vella.\\nEl Raval wurde im 14. Jahrhundert eingemeindet und ist mit 42.900 Einwohnern pro Quadratkilometer einer der am dichtesten besiedelten Stadtteile Barcelonas. Mit seiner engen Bebauung aus Fabriken und einfachen Mietshäusern aus der Zeit der Industriellen Revolution war El Raval lange Zeit ein Armenviertel. Durch umfangreiche Modernisierungen seit Mitte der 1980er Jahre im Zuge der Vorbereitung auf die Olympischen Spiele 1992 ist in vielen Teilen von El Raval eine deutliche Verbesserung der Lebensqualität zu verzeichnen, jedoch bei fortschreitender Gentrifizierung. Wegen seines hohen Migrantenanteils gilt El Raval als multikulturellster Stadtteil – etwa 50 % der Einwohner stammen aus rund 140 verschiedenen Nationen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%B7%D0%B0%D0%BA%D1%80%D1%8B%D1%82%D0%BE%D0%B3%D0%BE_%D1%82%D0%B8%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Gwangju-metro-106-Geumnamno-5ga-station-platform-20190521-075856.jpg","page_title":"Станция закрытого типа","context_page_description":"Станция закрытого типа — станция, посадочная платформа которой для безопасности пассажиров огорожена от станционных путей барьером в виде: платформенных раздвижных дверей, автоматических платформенных ворот, подъёмного барьера, неподвижного барьера и т.п. Проходы на посадку в выгоны открываются только после прибытия поезда на станцию. Конструкция предназначена для безопасности пассажиров: несанкционированный доступ на железнодорожные пути и к тоннелям ограничен, что предотвращает падение людей на пути и уменьшают риск несчастных случаев, предотвращает падение на пути мусора, который может быть пожароопасным. Также этот тип станции в случае установки платформенных раздвижных дверей улучшает климат-контроль на станции и устраняет необходимость использования машинистов и кондукторов при использовании в сочетании с пятью различными уровнями автоматизации управления поездами по шкале UITP, тем самым снижая затраты на рабочую силу.\\nВпервые в мире станцию данного типа с ещё металлическими платформенными раздвижными дверьми построили в 1961 году в Ленинградском метрополитене."},{"page_url":"https://pt.wikipedia.org/wiki/Fungi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Amanita_muscaria_01.jpg","page_title":"Fungi","context_page_description":"O reino Fungi é um grupo de organismos eucariotas, que inclui micro-organismos tais como as leveduras, os bolores, bem como os mais familiares cogumelos.\\nOs fungos são classificados num reino separado das plantas, animais e bactérias. Uma grande diferença é o facto de as células dos fungos terem paredes celulares que contêm quitina e glucanos, ao contrário das células vegetais, que contêm celulose. Estas e outras diferenças mostram que os fungos formam um só grupo de organismos relacionados entre si, denominado Eumycota, e que partilham um ancestral comum. Este grupo de fungos é distinto dos estruturalmente similares Myxomycetes e Oomycetes. A disciplina da biologia dedicada ao estudo dos fungos é a micologia, muitas vezes vista como um ramo da botânica, mesmo apesar de os estudos genéticos terem mostrado que os fungos estão mais próximos dos animais do que das plantas.\\nAbundantes em todo mundo, a maioria dos fungos é inconspícua devido ao pequeno tamanho das sua estruturas, e pelos seus modos de vida crípticos no solo, na matéria morta, e como simbiontes ou parasitas de plantas, animais, e outros fungos."},{"page_url":"https://fr.wikipedia.org/wiki/Aqueduc_du_Gier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Aqueduc_gallo-romain_du_Gier_Plat_de_l%27air_une_arche_est.jpg","page_title":"Aqueduc du Gier","context_page_description":"L’aqueduc du Gier est un des aqueducs antiques de Lyon desservant la ville antique de Lugdunum. Avec ses 85 km il est le plus long des quatre aqueducs ayant alimenté la ville en eau, et celui dont les structures sont le mieux conservées. Il doit son nom au fait qu'il puise aux sources du Gier, affluent du Rhône.\\nLes vestiges de l'aqueduc font l’objet de multiples protections au titre des monuments historiques : classements en 1875 le 20 mars 1912 et 1986."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D8%A7%D8%B1%D9%84%D9%88_%D9%BE%DB%8C%E2%80%8C%D8%AC%DB%8C_%D8%B3%DB%8C-%DB%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Harlow_PJC-2_N54KC.JPG","page_title":"هارلو پی‌جی سی-۲","context_page_description":"هارلو پی‌جی سی-۲ یک هواگرد ملخ‌پیشین تک‌موتوره از نوع چهار سرنشینه تک باله ساخت شرکت Harlow Aircraft Company است. هواگرد هارلو پی‌جی سی-۲ نخستین پروازش را در ۱۹۳۷ میلادی انجام داد. در مجموع، تعداد ۱۱ فروند از این هواگرد ساخته شده‌است.\\nطراح این هواگرد، Max B. Harlow بود."},{"page_url":"https://ast.wikipedia.org/wiki/Etxebarri","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Bandera_Etxebarri.png","page_title":"Etxebarri","context_page_description":"L'anteiglesia de San Esteban de Echévarri, ye un conceyu de la provincia de Vizcaya, País Vascu. N'ocasiones tamién se la llapada Echévarri, pa estremala de la llocalidá d'Echevarría, a la que tamién se suel llamar Echévarri. Mientres la dictadura franquista recibió'l nome de El Xeneralísimu. El so nome significa \\"casa nueva\\".\\nTa asitiáu na contorna del Gran Bilbao con una estensión de 3,26 km² y una población de 11 176 habitantes.\\nEl so equipu de fútbol, S.D. Etxebarri, tien 50 años d'hestoria y aportó a unu de los equipos más importantes de la contorna vizcaina."},{"page_url":"https://en.wikipedia.org/wiki/Geography_of_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Venezuela_veg_1972.jpg","page_title":"Geography of Venezuela","context_page_description":"Venezuela is a country in South America, and part of the Caribbean South America, bordering the Caribbean Sea and the North Atlantic Ocean, between Colombia and Guyana. It is situated on major sea and air routes linking North and South America. Located at the northernmost end of South America, Venezuela has a total area of 916,445 km² and a land area of 882,050 km². It is the 32nd largest country, about twice the size of California. Shaped roughly like an inverted triangle, the country has a 2,800 km long coastline. It is bound on the north by the Caribbean Sea and the Atlantic Ocean, on the east by Guyana, on the south by Brazil, and on the west by Colombia. It has the 55th largest Exclusive Economic Zone of 471,507 km². Its maritime territory borders Trinidad and Tobago, Dominica, the Dominican Republic, Grenada, St. Kitts and Nevis, St. Vincent and the Grenadines, France, the United Kingdom, the Netherlands, and the United States.\\nGeographic coordinates: 8°00′N 66°00′W"},{"page_url":"https://en.wikipedia.org/wiki/Subaru_Legacy_(seventh_generation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/2020_Subaru_Outback_Premium_AWD%2C_rear_2.29.20.jpg","page_title":"Subaru Legacy (seventh generation)","context_page_description":"The Subaru Legacy is the seventh generation of the Legacy range of mid-size cars. It made its debut at the 2019 Chicago Auto Show on February 7, 2019 and went on sale in the third quarter of 2019. This is the first Legacy model that isn't officially sold in Japan, as the nameplate usage ended there in June 2020."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D1%80%D0%B8%D0%BF%D0%BF%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Striper_Tool_-01.jpg","page_title":"Стриппер","context_page_description":"Съёмник изоляции, или стриппер — электромонтажный инструмент, предназначенный для удаления изоляции с концов проводов или разделки кабеля при электромонтажных работах."},{"page_url":"https://de.wikipedia.org/wiki/Kinderkreuzzug","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Gustave_dore_crusades_the_childrens_crusade.jpg","page_title":"Kinderkreuzzug","context_page_description":"Der Kinderkreuzzug war ein Ereignis, bei dem im Frühsommer des Jahres 1212 Tausende von Kindern, Jugendlichen und Erwachsenen aus Deutschland und aus Frankreich unter der Leitung visionärer Knaben zu einem unbewaffneten Kreuzzug ins Heilige Land aufbrachen. Der Zug scheint sich bereits an den Ufern des italienischen Mittelmeers aufgelöst zu haben."},{"page_url":"https://de.wikipedia.org/wiki/Uzun_Brakk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Hispar_La_top.jpg","page_title":"Uzun Brakk","context_page_description":"Der 6422 m hohe Uzun Brakk ist ein Berg im Panmah Muztagh im Karakorum im Sonderterritorium Gilgit-Baltistan in Pakistan."},{"page_url":"https://sv.wikipedia.org/wiki/Hydrellia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Hydrellia.cardamines.-.lindsey.jpg","page_title":"Hydrellia","context_page_description":"Hydrellia är ett släkte av tvåvingar. Hydrellia ingår i familjen vattenflugor."},{"page_url":"https://en.wikipedia.org/wiki/Manhattan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Flag_of_Borough_of_Manhattan.png","page_title":"Manhattan","context_page_description":"Manhattan, often referred to by residents of the New York City area as the City, is the most densely populated of the five boroughs of New York City, and coextensive with the County of New York, one of the original counties of the U.S. state of New York. Manhattan serves as the city's economic and administrative center, cultural identifier, and historical birthplace. The borough consists mostly of Manhattan Island, bounded by the Hudson, East, and Harlem rivers; as well as several small adjacent islands. Manhattan additionally contains Marble Hill, a small neighborhood now on the U.S. mainland, separated from the rest of Manhattan by the Harlem Ship Canal and later connected using landfill to the Bronx. Manhattan Island is divided into three informally bounded components, each aligned with the borough's long axis: Lower, Midtown, and Upper Manhattan.\\nManhattan has been described as the cultural, financial, media, and entertainment capital of the world, and the borough hosts the United Nations Headquarters."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0spanya%27daki_futbol_stadyumlar%C4%B1_listesi","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Octubre_de_2007026.jpg","page_title":"İspanya'daki futbol stadyumları listesi","context_page_description":"Aşağıda, İspanya'da bulunan futbol stadyumları kapasitelerine göre listelenmiştir:"},{"page_url":"https://lt.wikipedia.org/wiki/Registr%C5%B3_centras","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Center_of_Registers.JPG","page_title":"Registrų centras","context_page_description":"Registrų centras – Lietuvos valstybės įmonė, prižiūrinti Nekilnojamojo turto registrą ir kadastrą, Juridinių asmenų registrą, Adresų registrą bei Gyventojų registrą."},{"page_url":"https://ga.wikipedia.org/wiki/Art_Deco","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Art_Deco_Sculpture.jpg","page_title":"Art Deco","context_page_description":"Téarma giorraithe ar an Exposition Internationale des Arts Décoratifs et Industriels Modernes a tharla i bPáras sa bhliain 1925 é Art Deco. Faoi seo ciallaíonn an téarma ealaíona maisithe na 1920idí-1930idí go ginearálta agus an stíl nua-aoiseach a bhain leo, meascán de Chiúbachas is Ealaín Nua, le dathanna callánacha is an sruthlíniú a bhaineann le haerárthaigh is gluaisteáin, a úsáideadh mar mhaisiúcháin ar earraí tí cosúil le taephotaí, raidiónna is troscáin."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%B0%D1%9A%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Fshati_Ceraj%C3%AB_dhe_mjegulla.jpg","page_title":"Церања","context_page_description":"Церања на албанском Cerajë је насеље у општини Лепосавић на Косову и Метохији. Површина катастарске општине Церања где је атар насеља износи 468 ha. Село се налази 10 km југоисточно од Лепосавића, са леве стране Церањске реке, десне притоке Ибра. По положају кућа и њиховој међусобној удаљености село се дели на Горњу и Доњу махалу. Средња надморска висина села је 860 м. Насеље је по постанку старо."},{"page_url":"https://it.wikipedia.org/wiki/Regno_di_Gerusalemme","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/1889_The_Kingdom_of_Jerusalem%2C_shewing_the_Fiefs%2C_about_1187_A.D..jpg","page_title":"Regno di Gerusalemme","context_page_description":"Il regno di Gerusalemme era uno degli Stati crociati costituiti nel Vicino Oriente in seguito alla prima crociata nel 1099. La caduta di San Giovanni d'Acri, nel 1291, ne decretò l'estinzione."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A0%88%EB%B0%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Tunturisopuli_Lemmus_Lemmus.jpg","page_title":"레밍","context_page_description":"레밍 또는 나그네쥐는 비단털쥐과에 속하는 설치류의 일종으로, 쥐 가운데 작은 것을 부르는 말이거나 레밍족에 속하는 동물, 특히 노르웨이레밍 한 종만을 일컫는 말이다. 북유럽, 북아메리카, 유라시아 지역에 많이 서식하며 다리가 짧고 부드러운 털을 가졌다.\\n1980년대초 주한미군 사령관 위컴은 집단주의적 습성을 들어 한국인을 레밍에 비유하고 민주주의가 맞지 않다는 발언을 해서 널리 알려진 동물이기도 하다."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%BE%80%E6%BE%A4%E6%A6%AE%E4%B8%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Eiichi_Shibusawa_in_his_final_days.jpg","page_title":"澀澤榮一","context_page_description":"涩泽荣一是幕末─大正初期活跃的日本武士、官僚、实业家。"},{"page_url":"https://tr.wikipedia.org/wiki/Nobel_Kimya_%C3%96d%C3%BCl%C3%BC_sahipleri_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Alfred_Werner.jpg","page_title":"Nobel Kimya Ödülü sahipleri listesi","context_page_description":"Nobel Kimya Ödülü sahipleri kimyanın çeşitli dallarından biliminsanlarına İsveç Kraliyet Bilimler Akademisi tarafından her yıl takdim edilir. Nobel Ödülü, Alfred Nobel'in 1895 tarihli vasiyeti üzerine; kimya, fizik, edebiyat, barış, ve fizyoloji veya tıp alanlarında olmak üzere beş dalda seçkin katkılarda bulunanlara verilmeye başlanmıştır. Nobel'in vasiyetinde belirttiği gibi, ödül sahibine İsveç Kraliyet Bilimler Akademisi'nin seçtiği beş üyelik komite tarafından karar verilir ve ödül Nobel Vakfı tarafından karşılanır. Nobel Kimya Ödülü ilk kez 1901 yılında verilmiş, bu ödülü Hollanda'dan Jacobus Henricus van 't Hoff kazanmıştır. Her ödül sahibi, bir madalya, bir diploma ve miktarı yıllara göre değişen nakit para ile ödüllendirilir. 1901 yılında, van 't Hoff 150.782 İsveç kronu almıştır, ki bu Aralık 2007 tarihinde 7.731.004 İsveç kronuna eşdeğerdir. 2008 yılında, bu ödüle Osamu Shimomura, Martin Chalfie ve Roger Y. Tsien nail görülmüş ve 10.000.000 İsveç kronu ile ödüllendirilmişlerdir. Ödül töreni; geleneksel olarak Stokholm'da, Nobel'in ölüm yıldönümü olan 10 Aralık tarihinde yapılmaktadır."},{"page_url":"https://eu.wikipedia.org/wiki/Santa_Engrazia_baseliza_(Aizarna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Santa_engrazi_zestoa_0006.JPG","page_title":"Santa Engrazia baseliza (Aizarna)","context_page_description":"Santa Engrazia baseliza Gipuzkoako Zestoa udalerriko Aizarna auzoaren lursailetan dagoen baseliza bat da. Aizarnako herrigunetik urrun dago, Santa Engrazia muino edo mendiaren tontorrean. Bertatik, Ernio nahiz Izarraitz, Pagoetako Kurutzea eta Erlo mendien ikuspegi paregabea dago. 507 metrotako altueran dago kokatuta.\\nEuskal Herrian auzolanean eraikitako baseliza askoren antzera itxura eta egitura xumea ditu. Gaur egungo baseliza 1600ean eraiki zen, aurrekoa tximista batek jo eta bertan kiskaldu baitzuen.\\nNatura aldetik Santa Engrazia basaeliza Pagoetako natura parkean kokatzen da eta Parke Naturalaren gaineko ikuspegi onak daude bertatik.\\nKonfirmatu gabeko zenbait kontakizunen arabera, basaeliza gaztelu txiki bat izan zen ertaroan."},{"page_url":"https://lt.wikipedia.org/wiki/Did%C5%BEiojo_Lietuvos_kunigaik%C5%A1%C4%8Dio_Gedimino_ordino_Didysis_kry%C5%BEius","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/1st_Class_Order_of_the_Lithuanian_Grand_Duke_Gediminas.jpg","page_title":"Didžiojo Lietuvos kunigaikščio Gedimino ordino Didysis kryžius","context_page_description":"Lietuvos didžiojo kunigaikščio Gedimino ordino Didysis kryžius, iki 2002 m. Didžiojo Lietuvos kunigaikščio Gedimino ordino Didysis kryžius – ketvirtas pagal svarbą Lietuvos valstybės apdovanojimas, kuriuo Lietuvos Respublikos Prezidento dekretu apdovanojami nusipelnę Lietuvai asmenys, pasižymėję uoliu ir sąžiningu darbu valstybinėje tarnyboje ar visuomeninėje veikloje. Šiuo ordinu gali būti apdovanojami ir užsienio valstybių piliečiai.\\nLietuvos didžiojo kunigaikščio Gedimino ordino šventė yra Vasario 16-oji – Lietuvos valstybės atkūrimo diena."},{"page_url":"https://fy.wikipedia.org/wiki/Andr%C3%A9astsjerke_(Winaam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Sint_Andreaskerk_Wijnaldum.jpg","page_title":"Andréastsjerke (Winaam)","context_page_description":"De Andréastsjerke is in tsjerke yn Winaam by Harns.\\nDe ienbeukige tsjerke wie oarspronklik wijd oan Sint-Andreas. De let-goatyske tsjerke waard yn de fyftjinde iuw boud. De toer fan de tsjerke stoarte yn 1684 ynelkoar en waard dat jier ferfongen. Yn 1904 waard de toer, tagelyk mei de westside fan de tsjerke, opnij ferfongen. Dit boudiel waard yn in neogoatyske styl ûntwurpen troch Jurjen Bruns. Yn 1931 waard de tsjerke yngreven restaurearre en ûntplastere en opnij mei âld boumateriaal beklaaid. De tsjerke is in ryksmonumint. De preekstoel is makke yn 1728 troch Arjen Lous út Harns. Ek de tsjerkebanken binne makke yn de 18e iuw. It oargel út 1869 is makke troch Van Dam."},{"page_url":"https://no.wikipedia.org/wiki/Milit%C3%A6re_grader_og_distinksjoner_i_Sovjetunionen_1919-1954","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/%D0%9D%D0%BA%D0%B2%D0%B4%D0%BF%D0%B21940%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D1%88.png","page_title":"Militære grader og distinksjoner i Sovjetunionen 1919-1954","context_page_description":"Militære grader og distinksjoner i Sovjetunionen 1919-1954 viser de tjenstegrader under de ulike befalsordninger som fantes fra 1919 til 1954 i de sovjetiske væpnede styrker og paramilitære organer. Efter Oktoberrevolusjonen avskaffet bolsjevikene militære grader og distinksjoner. Det viste seg å være upraktisk i krig. Derfor inførtes i 1919 et system med stillingsdistinksjoner i Den røde armé og i Den røde flåte. Disse erstattes i 1935 av et system med militære grader. De ulike befalsstillinger ble markert med forskjellige geometriske tegn. Dette var først også saken ved de militære graderne. Men i 1943 introdusertes distinksjoner av tradisjonell tsarrussisk type.\\nInnen 1935 hadde NKVD sin forgjenger GPU benyttet et system ved stillingskategorier liknende det som bruktes i Den røde armé, men når arméen introduserte militære grader ble et system med spesielle tjenestegrader innført. I 1937 begynte NKVD at bruke de samme distinksjoner som Den røde armé for å utmerke sine spesielle grader. I 1943 introdusertes distinksjoner av tradisjonell tsarrussisk type også for NKVD og for det nye NKBG. I 1945 fikk alt personell i NKVD og NKGB militære grader."},{"page_url":"https://hu.wikipedia.org/wiki/G%C3%A9pi_csipkek%C3%A9sz%C3%ADt%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Hippolyte_Bayard-Handschuh_c._1840.jpg","page_title":"Gépi csipkekészítés","context_page_description":"A gépi csipkekészítés a kézi csipkekészítés gépesítése, a kézi csipkekészítés módszerének gépre való átvitele és továbbfejlesztése.\\nA csipke a textíliák egyik legművészibb és technikailag igen bonyolult szerkezetű fajtája. Általános nézet, hogy a mai értelemben vett csipke viszonylag modern termék, eredete a 15. századra vezethető vissza. Nincs rá bizonyíték, hogy olyan ókori leletek maradtak volna fenn, amelyek csipkének lennének tekinthetők.\\nA csipkék készítésével apácák kezdtek foglalkozni és a csipkéket oltárterítők, papi ruhák díszítésére használták. A csipkés öltözék a rang és a gazdaság jele volt. A csipkekészítés a legnagyobb lendületet a reneszánsz idején kapta. Az idők folyamán többféle technika és díszítési mód fejlődött ki a csipkekészítés különböző központjaiban.\\nA csipkéknek igen sokféle fajtája van. A csipkekészítésnek e cikkben tárgyalt módszere a szövetszélek eldolgozásából, a rojtokból fejlődött ki."},{"page_url":"https://en.wikipedia.org/wiki/Myolie_Wu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Myolie_Wu_%28cropped%29.jpg","page_title":"Myolie Wu","context_page_description":"Myolie Wu Hang-yee, is a Hong Kong actress and singer. Born in Hong Kong with Guangdong Taishan ancestry, she is signed under for the Hong Kong TVB television station and a singer under contracts with Neway Star. In 2011, she won \\"Best Actress\\" for her role in Curse of the Royal Harem, a TVB grand production, \\"Most Favourite TV Female Character\\" for her role in Ghetto Justice and also won \\"Extraordinary Elegant Actress\\" at the TVB Anniversary Awards 2011, making her the first ever Triple TV Queen of the year. By summer of 2015, Myolie left TVB to explore new avenues."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BB%D0%B5%D0%BC%D0%B5%D0%BD%D1%82%D1%8B_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BC%D0%B0%D1%80%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Ino_Tadataka_stamp.jpg","page_title":"Элементы почтовой марки","context_page_description":"Элементы почтовой марки — совокупность внешних признаков, отличающих почтовую марку как легитимный знак почтовой оплаты. Основные элементы прописаны в документах Всемирного почтового союза и приняты мировым сообществом как обязательные, этими документами руководствуются все страны — члены ВПС в рамках своей эмиссионной политики при выпуске марок. Таким образом, ЗПО официальных эмитентов принципиально отличаются от многих марок-предшественниц, непочтовых марок и прочих видов марок-синдерелл."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%91%D7%9C%D7%99%D7%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Egypte_louvre_222_hieroglypes.jpg","page_title":"תבליט","context_page_description":"תבליט הוא פסל שאינו חופשי בחלל אלא צמוד למשטח.\\nתכונתו העיקרית של התבליט, לעומת הפיסול, היא התאמתו ושעבודו לאדריכלות, כמו בשער הניצחון בפריז, המעוטר בשישה תבליטים. תכונה נוספת של התבליט היא העומק אשר נוצר כתוצאה ממרחק האובייקטים בתבליט מן הרקע. מרחק זה קובע את הצללים הנוצרים אשר יכולים להדגיש חלקים מסוימים בתבליט. אמנם יש שימוש בעקרון זה גם ביצירת פיסול חופשי, אולם הוא עקרון עבודה חשוב ביצירתם של תבליטים רבים.\\nישנם תבליטים בהם הדימוי 'יוצא' מן הרקע ובולט ממנו. תבליטים אלו נקראים תבליט גבוה. בתבליט שקוע, לעומת זאת, הדימויים נסוגים אל תוך המשטח ושקועים בו. חוסר ההפרדה בין נושא התבליט לבין הרקע שלו מוליד יצירה הנעה בין ניסיון ליצירת נפחיות ותלת-ממדיות לבין שטיחות.\\nישנן שיטות שונות ליצירת תבליט, בהן שיטות של החסרת חומר על ידי חריטה, חציבה, ריקוע או קידוח באבן או בעץ או בכל חומר אחר. שיטות אחרות ליצירת תבליט הן שיטות שבהן מוסיפים חומר כגון כיור או פיסול בחרס או בשעווה. שיטות אלו משמשות, על פי רוב, כשלב ביניים ליציקת התבליט במתכות שונות כגון ברונזה. בפיסול המודרני נוהגים להשתמש ביציקת תבליטים גם בטכניקה של יציקה על אובייקט חי.\\nלפי הבלשן יצחק אבינרי, את המילה העברית תבליט חידש הבלשן יצחק אפשטיין."},{"page_url":"https://pl.wikipedia.org/wiki/P%C5%82ock","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/P%C5%82ock%2C_ulica_Tumska.jpg","page_title":"Płock","context_page_description":"Płock – miasto w Polsce, na prawach powiatu, położone na Pojezierzu Dobrzyńskim i w Kotlinie Płockiej, nad Wisłą, w województwie mazowieckim, siedziba ziemskiego powiatu płockiego; historyczna stolica Mazowsza oraz stolica Polski w latach 1079–1138; siedziba rzymskokatolickiej kurii diecezji płockiej, port rzeczny, rafineria ropy naftowej, szkoły wyższe, teatry, muzea. Polskie miasto-bohater.\\nW preambule do Statutu Miasta Płocka użyto nazwy Stołeczne Książęce Miasto Płock.\\nPrawa miejskie uzyskał w 1237 roku, potwierdzone w latach 1361, 1435, 1462, 1514. Był miastem królewskim Korony Królestwa Polskiego w starostwie płockim województwa płockiego w 1784 roku.\\nW latach 1975–1998 miasto było stolicą województwa płockiego.\\nWedług danych GUS z 30 czerwca 2019 r. miasto liczyło 119 709 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Beth_Campbell_(artist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Spontaneous_future%28s%29%2C_Possible_Past_%282019%29.jpg","page_title":"Beth Campbell (artist)","context_page_description":"Beth Campbell is an American artist who works in drawing, sculpture, and installation."},{"page_url":"https://pt.wikipedia.org/wiki/The_Butterfly_Effect_(banda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/The_Butterfly_Effect_BDO_07.jpg","page_title":"The Butterfly Effect (banda)","context_page_description":"The Butterfly Effect é uma banda hard rock de Brisbane, Austrália, formada em 1999. A banda é constituída por Clint Boge, Ben Hall, Glenn Esmond e Kurt \\"Puddles\\" Goedhart."},{"page_url":"https://fr.wikipedia.org/wiki/Hydrant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Meyri%C3%A9-FR-38-bouche_d%27incendie-02c.jpg","page_title":"Hydrant","context_page_description":"Un poteau d'incendie ou bouche d’incendie en France, borne hydrante ou poteau d’incendie en Suisse, ou une borne-fontaine au Québec est un dispositif de lutte contre l'incendie mis en place par les communes, et par des sociétés privées dans leurs enceintes.\\nCette prise d'eau est disposée sur un réseau aérien ou souterrain d'eau sous pression permettant d'alimenter les fourgons d'incendie des sapeurs-pompiers.\\nCes réseaux sont soit dédiés à la lutte contre l'incendie, soit destinés à l'alimentation en eau potable, à l'irrigation ou à l'industrie. Ils sont constitués de canalisations d'un diamètre intérieur d'au moins 100 mm.\\nLes points d'accès au réseau sont situés de préférence à proximité de la chaussée, de manière à rester accessibles en permanence."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Leiblfing","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Hankofen-Kirche-Sankt-Georg.jpg","page_title":"Liste der Baudenkmäler in Leiblfing","context_page_description":"Auf dieser Seite sind die Baudenkmäler der niederbayerischen Gemeinde Leiblfing zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%B0%D0%BC%D1%8B%D1%85_%D0%BF%D1%80%D0%BE%D0%B4%D0%B0%D0%B2%D0%B0%D0%B5%D0%BC%D1%8B%D1%85_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D0%B5%D0%B9_%D0%B2_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Peugeot_307_HDi_Vorfacelift.JPG","page_title":"Список самых продаваемых автомобилей в Европе","context_page_description":"Приведены списки десяти самых продаваемых легковых автомобилей в Европе за соответствующий календарный год. Цветом отмечены новички списков."},{"page_url":"https://en.wikipedia.org/wiki/Trillium","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/The_Great_White_Trillium.JPG","page_title":"Trillium","context_page_description":"Trillium is a genus of about fifty flowering plant species in the family Melanthiaceae. Trillium species are native to temperate regions of North America and Asia, with the greatest diversity of species found in the southern Appalachian Mountains in the southeastern United States."},{"page_url":"https://en.wikipedia.org/wiki/Dmitrii_Frolov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Dir._Dmitri_Frolov.jpg","page_title":"Dmitrii Frolov","context_page_description":"Dmitri Alexeyevich Frolov is a Russian film director in independent experimental cinema and a director of photography. He has won several film awards."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Aulnay-sur-Iton","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Map_commune_FR_insee_code_27023.png","page_title":"Aulnay-sur-Iton","context_page_description":"Aulnay-sur-Iton sī ūi-tī Hoat-kok Haute-Normandie tōa-khu Eure séng ê chi̍t-ê commune."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Frankfurt_(Oder)_(Au%C3%9Fenbereiche)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Boossen_5251.JPG","page_title":"Liste der Baudenkmale in Frankfurt (Oder) (Außenbereiche)","context_page_description":"In der Liste der Baudenkmale in Frankfurt (Oder) (Außenbereiche) sind alle Baudenkmale in den Ortsteilen der Stadt Frankfurt (Oder) aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2018. Die Baudenkmale im Kerngebiet der Stadt sind in der Liste der Baudenkmale in Frankfurt (Oder) aufgeführt."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%A5%D6%80%D5%BF%D5%A5%D6%80%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Superpower1.png","page_title":"Գերտերություն","context_page_description":"Գերտերություն, այլ երկրների մեծամասնության նկատմամբ հսկայական քաղաքական, տնտեսական և ռազմական գերակշռություն ունեցող պետություն:"},{"page_url":"https://fr.wikipedia.org/wiki/Rallye_d%27Italie-Sardaigne_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Rajd_Sardynii_2018_-_Zwyci%C4%99zcy.jpg","page_title":"Rallye d'Italie-Sardaigne 2018","context_page_description":"Le Rallye de Sardaigne 2018 est le 7ᵉ rallye du Championnat du monde des rallyes 2018 et la 15ᵉ édition de l’épreuve. Il se déroule sur 20 épreuves spéciales. Il est remporté par le duo belge Thierry Neuville et Nicolas Gilsoul, remportant le rallye lors de l’ultime spéciale en devançant leurs rivaux aux championnats Sébastien Ogier et Julien Ingrassia de seulement 0 s 7."},{"page_url":"https://fr.wikipedia.org/wiki/Penmarch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/France-Bretagne-St_Guenol%C3%A9-panorama.jpg","page_title":"Penmarch","context_page_description":"Penmarch [pɛ̃maʁ] est une commune française du département du Finistère, en région Bretagne."},{"page_url":"https://it.wikipedia.org/wiki/Jean_Alesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Jean_alesi_1991.jpg","page_title":"Jean Alesi","context_page_description":"Giovanni Roberto Alesi, noto come Jean Alesi, è un ex pilota automobilistico e opinionista francese.\\nAlesi è di origine italiana, figlio di siciliani immigrati in Francia: il padre Franco Alesi era un carrozziere di Alcamo, mentre la mamma Francesca era di Riesi.\\nDopo vari successi ottenuti nelle categorie minori è approdato in Formula 1 nel 1989, andando a punti al debutto con la Tyrrell. Dal 1991 al 1995 Alesi ha guidato la Ferrari, con la quale ha vinto un Gran Premio. Alcuni giornalisti lo hanno accostato a Gilles Villeneuve per lo stile di guida ed è ricordato principalmente come figura che ha avuto un certo rilievo tra i tifosi.\\nCorse poi per Benetton, Sauber, Prost e Jordan, con la quale chiuse in F1.\\nDal 2002 al 2006 Alesi ha disputato il campionato DTM, cogliendo alcune vittorie e un quinto posto in classifica piloti.\\nA partire dal 2008 e fino al 2009, il pilota francese si è dedicato al campionato Speedcar Series, nel 2010 ha corso nel campionato Le Mans Series con una Ferrari 360 del team AF Corse.\\nNel 2012 corse la sua prima 500 Miglia di Indianapolis ed è il più anziano ad aver disputato il rookie test per l'ammissione alla gara."},{"page_url":"https://en.wikipedia.org/wiki/Gongylonema_pulchrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Gongylonema_pulchrum_nematode_from_man_Figure_2d.jpg","page_title":"Gongylonema pulchrum","context_page_description":"Gongylonema pulchrum is the only parasite of the genus Gongylonema capable of infecting humans.\\nGongylonema pulchrum infections are due to humans acting as accidental hosts for the parasite. There are seven genera of spirudia nematodes that infect human hosts accidentally: Gnathostoma, Thelazia, Gongylonema, Physaloptera, Spirocerca, Rictularia. The G. pulchrum parasite is a nematode worm of the order Spirurida. It is a relatively thin nematode, and like other worms within its class, it has no circulatory or respiratory system. Most other Gongylonema species infect birds and mammals: there are 25 species found in mammals and 10 species found in birds.\\nThis parasite is multi-cellular, and capable of movement. They have numerous rear mucosal projections, which assumedly assist propulsion through the thin layer of skin on the inside of the human host's mouth. They also have an excretory system possessing lateral canals. This parasite eats epithelial cells. Also, very often the canals are a place of inflammation, with accumulation of exudates in them. Gongylonema also swallows these exudates."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D8%B9%D9%84%D9%8A_%D9%83%D9%85%D8%A7%D9%84_%D8%A7%D9%84%D8%AF%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Mohammad_Ali_Kamal_ad-Din.jpg","page_title":"محمد علي كمال الدين","context_page_description":"محمد علي كمال الدين الحسيني صحفي وأديب وتربوي وكاتب عراقي."},{"page_url":"https://vi.wikipedia.org/wiki/NGC_4319","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/NGC_4319_I_HST2002.jpg","page_title":"NGC 4319","context_page_description":"NGC 4319 là tên của một thiên hà xoắn ốc có cấu trúc thanh chắn nằm trong chòm sao Thiên Long. Khoảng cách của thiên hà này với trái đất là khoảng xấp xỉ 77 triệu năm ánh sáng. Phân loại hình thái học của thiên hà này là SBab, ý là đây là thiên hà xoắn ốc có thanh chắn, có một cấu trúc đai bên trong và các nhánh xoắn ốc xiết chặt vừa phải. Thiên hà NGC 4319 nằm ở vị trí khá gần với hai thiên hà khác là NGC 4291 và NGC 4386. Ở khoảng trống giữa NGC 4319 và NGC 4291 có sự phát ra tia X, có lẽ đó là sự tương tác giữa 2 thiên hà đó. Thiên hà này có tỉ lệ khí Hydro bị ion hóa cao hơn Ngân Hà.\\nNăm 1971, nhà thiên văn học người Mĩ Halton Arp đã ghi chú có sự liên kết vật lí giữa NGC 4319 và Markarian 205, một thiên thể có giá trị dịch chuyển đỏ dường như cao hơn nhiều. Ông ấy cho rằng nếu Markarian 205 không phải là một thiên thể nền được nhô ra một cách tình cờ thì nó sẽ bị đẩy ra khỏi nhân thiên hà. Sự phát hiện ra mối liên kết giữa độ sáng biểu kiến với hai thiên thể này đã tạo ra một cuộc tranh luận lớn khi các nhà thiên văn học tìm cách bác bỏ khẳng định này và thay thế bằng những khẳng định khác."},{"page_url":"https://pt.wikipedia.org/wiki/Serra_Caiada","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Serra_caiada_-_panoramio.jpg","page_title":"Serra Caiada","context_page_description":"Serra Caiada, antes Presidente Juscelino, é um município brasileiro do estado do Rio Grande do Norte."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Hustope%C4%8D%C3%ADch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Hustope%C4%8De_-_Dukelsk%C3%A9_n%C3%A1m%C4%9Bst%C3%AD_27.jpg","page_title":"Seznam kulturních památek v Hustopečích","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Hustopeče v okrese Břeclav vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://sv.wikipedia.org/wiki/Sweltsa_mediana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Green_stonefly%2C_Sweltsa_mediana_%288710794107%29.jpg","page_title":"Sweltsa mediana","context_page_description":"Sweltsa mediana är en bäcksländeart som först beskrevs av Banks 1911. Sweltsa mediana ingår i släktet Sweltsa och familjen blekbäcksländor. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sv.wikipedia.org/wiki/Malstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Moskenstraumen.jpg","page_title":"Malström","context_page_description":"Malström, även kallat tidvattenström, är en kraftig virvelrörelse i vattnet i trånga sund som framkallas av ebb och flod.\\nMalströmmen skapas då stora vattenmassor kommer in i smala sund och inte hinner rinna tillbaka på grund av ett starkt inflöde. Resultatet blir en vattensamling som med hög kraft rinner tillbaka och skapar stora vattenvirvlar, vortex.\\nFöremål som kommit in i en malström dras mot vattenvirvelns mitt och sugs där ned under vattenytan. Strömmarna uppnår ibland mycket höga hastigheter och kan då utgöra en fara för att vistas i vattnet."},{"page_url":"https://en.wikipedia.org/wiki/Pan_(genus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Chimpanzee_mom_and_baby_cropped.jpg","page_title":"Pan (genus)","context_page_description":"The genus Pan consists of two extant species: the common chimpanzee and the bonobo. Taxonomically, these two ape species are collectively termed panins; however, both species are more commonly referred to collectively using the generalized term chimpanzees, or chimps. Together with humans, gorillas, and orangutans they are part of the family Hominidae. Native to sub-Saharan Africa, common chimpanzees and bonobos are currently both found in the Congo jungle, while only the common chimpanzee is also found further north in West Africa. Both species are listed as endangered on the IUCN Red List of Threatened Species, and in 2017 the Convention on Migratory Species selected the common chimpanzee for special protection."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%B3%E3%82%BB%E3%83%97%E3%82%B7%E3%83%A7%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/InceptionCast2July10.jpg","page_title":"インセプション","context_page_description":"『インセプション』は、クリストファー・ノーラン監督・脚本・製作による2010年のアメリカのSFアクション映画。第83回アカデミー賞では作品賞、脚本賞、撮影賞、視覚効果賞、美術賞、作曲賞、音響編集賞、録音賞の8部門にノミネートされ、撮影賞、視覚効果賞、音響編集賞、録音賞を受賞した。全米脚本家組合賞ではオリジナル脚本賞を受賞した。"},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Grochowska_w_Warszawie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Ulica_Grochowska_w_Warszawie_2014_011.JPG","page_title":"Ulica Grochowska w Warszawie","context_page_description":"Ulica Grochowska – ulica w dzielnicy Pragi-Południe w Warszawie."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Sigismond_(Haute-Savoie)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Map_commune_FR_insee_code_74252.png","page_title":"Saint-Sigismond (Haute-Savoie)","context_page_description":"Saint-Sigismond is een gemeente in het Franse departement Haute-Savoie en telt 587 inwoners. De plaats maakt deel uit van het arrondissement Bonneville."},{"page_url":"https://es.wikipedia.org/wiki/Loxococcus_rupicola","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Loxococcus_rupicola.jpg","page_title":"Loxococcus rupicola","context_page_description":"Loxococcus es un género monotípico con una única especie: Loxococcus rupicola H.Wendl. & Drude perteneciente a la familia de las palmeras."},{"page_url":"https://en.wikipedia.org/wiki/Aponotoreas_insignis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Aponotoreas_insignis_female.jpg","page_title":"Aponotoreas insignis","context_page_description":"Aponotoreas insignis is a moth of the family Geometridae. It is endemic to New Zealand."},{"page_url":"https://pl.wikipedia.org/wiki/Tatra_T3Mod","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/T3_MOD_359.jpg","page_title":"Tatra T3Mod","context_page_description":"Tatra T3Mod – typ tramwaju, który powstał w wyniku modernizacji czechosłowackiego tramwaju Tatra T3."},{"page_url":"https://jv.wikipedia.org/wiki/Aktuator","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Schwenkantrieb_auf_klappe.jpg","page_title":"Aktuator","context_page_description":"Aktuator ya iku perangkat Elektromekanik sing ngasilké daya obahan. bisa digawé saka sistem Motor Listrik, Motor DC Servo, Motor DC Stepper, Ultrasonic Motor, Linear Motor, Motor Torsi, Solenoida), Sistem Pneumatik (perangkat kompresi saka angin utawa gas Nitrogen, lan perangkat Hidrolik. Kanggo mundhakaké tenaga mèkanik aktuator utawa torsi obahan bisa dipasangké sistem Gearbox, bisa nganggo sistem direct-gear (sistem lèmpèng, sistem worm-gear, planetary gear lan liyané), sprochet-chain (gir-rante, gir-belt, utawa sistem wire-roller, lan sapanunggalané). Aktuator bisa dikon ngelakoaké hal tartamtu saka kontroler lan Kapinteran Gawéan saka prosèssor. contonè samisal ana robot sing ngatut garis warna, yèn ana warna tertentu sensor robot iku ngèki informasi kanggo kontroller lajeng kontroller ngongkon aktuator ngatut garis warna sing dikarepaké."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Turbigo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Stazione_di_Turbigo%2C_la_facciata_davanti.JPG","page_title":"Turbigo","context_page_description":"Turbigo sī Italia Lombardia toā-khu Milano Séng ê chi̍t ê comune."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1905","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Willem_Brandt_%281970%29.jpg","page_title":"Lijst van personen geboren in 1905","context_page_description":"Dit is een lijst van personen die geboren zijn in 1905.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/Phantomas_2","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Dungeon_of_Vincennes.jpg","page_title":"Phantomas 2","context_page_description":"Phantomas 2 es un videojuego desarrollado por Dinamic Software en plena edad de oro del software español.​ Está ambientado en el interior del castillo del conde Drácula, donde el jugador tiene que superar una serie de trampas hasta dar muerte al monstruo.​ El videojuego se presentó como un arcade de videoaventura combinado con un videojuego de plataformas.​​ Se desarrolló para las plataformas ZX Spectrum, Amstrad CPC, Commodore 64 y, un año después de su publicación, también en MSX.​ Se dio a conocer internacionalmente bajo el título de \\"Vampire\\" por medio de la distribuidora Code Masters.​"},{"page_url":"https://cs.wikipedia.org/wiki/Hr%C3%A1dek_(p%C5%99%C3%ADrodn%C3%AD_pam%C3%A1tka,_okres_Vset%C3%ADn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Hr%C3%A1dek_%2810%29.jpg","page_title":"Hrádek (přírodní památka, okres Vsetín)","context_page_description":"Hrádek je přírodní památka ev. č. 2027 na jihovýchodním okraji obce Študlov v okrese Vsetín. Oblast spravuje Agentura ochrany přírody a krajiny ČR.\\nDůvodem ochrany je květnatá louka s výskytem zvláště chráněných druhů rostlin, teplomilná flóra a entomofauna."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%BE%D0%B6%D0%B0_%D0%92%D0%B0%D1%81%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Boza_Vasic.JPG","page_title":"Божа Васић","context_page_description":"Божа Васић мултимедијални је уметник и фотограф, Југословенског порекла који живи и ствара у Торонту, Канада од 1988. године. Уметнички развој Боже Васића кретао се кроз различите фазе мултимедијалног истраживања у којима је вешто осликавао многе феномене везане за живот људи-миграната који су морали да напусте своје домовине.\\nБожа Васић до сада је излагао на више колективник, и 17 самосталних изложби и бијенала у земљи и иностранству, и на фестивалима документарног и телевизијског филма и видеа. Његови радови приказани су на многим манифестацијама попут; 8. бијенала у Хавани, Куба, 6. Југословенског бијенала младих у Вршцу, 13. и 14. међународног бијенала уметности у Португалу, независног бијенала у Ливерпулу итд. Бојине видео инсталације и фотографије на бази његових радова, излагане су и у уметничким центрима широм Канаде у којој више од две деценије живи и ствара."},{"page_url":"https://sv.wikipedia.org/wiki/Ilse_Werner","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Ilse_Werner_%281961%29.jpg","page_title":"Ilse Werner","context_page_description":"Ilse Werner, född 11 juli 1921 i Batavia, Nederländska Ostindien, död 8 augusti 2005 i Lübeck, Tyskland, nederländsk-tysk skådespelare."},{"page_url":"https://en.wikipedia.org/wiki/Maud_Naftel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Maud_Naftel_painting.jpg","page_title":"Maud Naftel","context_page_description":"Maud Naftel was an English watercolour painter."},{"page_url":"https://sl.wikipedia.org/wiki/Oplotni%C5%A1%C4%8Dica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Oplotniski_vintgar6.jpg","page_title":"Oplotniščica","context_page_description":"Potok Oplótniščica je levi pritok Dravinje, ki prav tako izvira v osrednjem delu Pohorja."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC%D1%81,_%D0%A0%D0%B0%D0%B9%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Williams_R._WMQ14_%282%29_%2814420243040%29.jpg","page_title":"Уильямс, Райн","context_page_description":"Райн Уильмс — американский профессиональный теннисист."},{"page_url":"https://en.wikipedia.org/wiki/Frank_Armstrong_Crawford_Vanderbilt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Frank_Armstrong_Crawford_Vanderbilt.jpg","page_title":"Frank Armstrong Crawford Vanderbilt","context_page_description":"Frank Armstrong Crawford Vanderbilt was an American socialite and philanthropist. During the American Civil War, she was a strong supporter of the Confederate States of America. After the war, she lived in New York City and married multi-millionaire Cornelius Vanderbilt, who donated $1 million to establish Vanderbilt University in Nashville, Tennessee."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BC%D0%BE%D0%B2_%D1%82%D0%B8%D0%BD%C4%95%D1%81%C4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Antarctica-pl.svg","page_title":"Сомов тинĕсĕ","context_page_description":"Сомов тинĕсĕ Кăнтăр океанăн Лăпкă океан секторĕнчи Виктори Çĕрĕпе юнашар тинĕс. Росс тинĕсĕпе Дюрвиль тинĕсĕсем хушшинче вырнаçнă. Лаптăкĕ 1 150 000 км².\\nÇурçĕрте Баллени утравĕсем пур. Çыранта Ленинградская Раççей антарктика станцийĕ вырнаçнă. Ятне пĕрремĕш совет антарктика экспедицин пуçлăхне, Сомов Михаила асăнса панă."},{"page_url":"https://it.wikipedia.org/wiki/Parco_nazionale_della_foresta_bavarese","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Bayerischer_wald_intakt.jpg","page_title":"Parco nazionale della foresta bavarese","context_page_description":"Il parco nazionale della foresta bavarese è un parco nazionale nella foresta bavarese orientale immediatemente sul confine tedesco con la Repubblica Ceca.\\nFu istituito il 7 ottobre 1970 come primo parco nazionale della Germania. Dopo l'espansione avvenuta il 1º agosto 1997, la sua superficie si estende per 24.250 ettari. Insieme alla confinante selva boema, la foresta bavarese forma la più grande area contigua coperta da foreste nell'Europa centrale."},{"page_url":"https://es.wikipedia.org/wiki/Clase_Vasco_da_Gama","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/NRP_Alvares_Cabral_040712-N-9742R-030.jpg","page_title":"Clase Vasco da Gama","context_page_description":"La clase Vasco da Gama es una clase de fragatas, del tipo MEKO 200 PN de concepción alemana, y el mayor buque de superficie de la Marinha Portuguesa. Portugal opera un total de 3 buques de esta clase, que fueron construidos en Kiel por Blohm + Voss y posteriormente por HDW, usando técnicas de construcción modular.\\nEl proyecto para la construcción de las 3 fragatas de esta clase fue autorizado por el gobierno portugués en 1985, cinco años después de producirse la solicitud de la Marinha para la adquisición de nuevos buques de superficie. El 60% de los fondos para la construcción de estos buques, provino de la ayuda militar de la OTAN.​ Las armadas de Turquía, Grecia, Australia y Nueva Zelanda, operan buques similares."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D0%B7%D1%81%D0%BB%D0%B5%D0%B4%D0%B2%D0%B0%D0%BD%D0%B5_%D0%BD%D0%B0_%D0%9A%D0%BE%D1%81%D0%BC%D0%BE%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Fish-eye_View_of_the_Hubble_Space_Telescope_and_Earth_%2828051099871%29.jpg","page_title":"Изследване на Космоса","context_page_description":"Изследването на Космоса представлява откриването и изследването на небесните структури в космическото пространство чрез развиваща се и нарастваща космическа технология. Докато изучаването на пространството се извършва предимно от астрономи с телескопи, физическото изследване на пространството се извършва както от безпилотни космически сонди, така и от пилотирани космически полети.\\nДокато наблюдението на обекти в космоса, известно като астрономия, предшества надеждната писана история, именно развитието на големи и сравнително ефективни ракети през средата на ХХ век позволява изследването на физическото пространство да стане реалност. Общите причини за изследване на пространството включват напредък в научните изследвания, национален престиж, обединяване на различни нации, гарантиране на бъдещото оцеляване на човечеството и развитие на военни и стратегически предимства.\\nИзследванията на космоса често се използват като заместваща конкуренция на геополитически съперничества като Студената война. Ранната ера на изследване на космоса се ръководи от космическа надпревара между Съветския съюз и САЩ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B2%D0%B8%D0%B3%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Svihov_KT_CZ_CoA.jpg","page_title":"Швигов","context_page_description":"Швигов, бывш. Швихау — город на юго-западе Чешской Республики, в районе Клатови Пльзенского края."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D1%96%D0%BD%D1%8C%D0%BA%D1%96%D0%B2_(%D1%81%D0%B5%D0%BB%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Zinkiv_vnk_prapor.png","page_title":"Зіньків (село)","context_page_description":"Зі́ньків — село Віньковецького району Хмельницької області на р. Ушиці.\\nРозташоване за 15 км від траси М20."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D0%9A_%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D0%B7%D0%B0%D0%BD_(%D0%A7%D0%B5%D1%80%D0%B2%D0%B5%D0%BD_%D0%B1%D1%80%D1%8F%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%D0%A1%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD_%D0%93%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8_%D0%A7%D0%B5%D1%80%D0%B2%D0%B5%D0%BD_%D0%B1%D1%80%D1%8F%D0%B3.jpg","page_title":"ФК Партизан (Червен бряг)","context_page_description":"„Партизан“ е футболен клуб от град Червен бряг, участващ в Северозападната група на Трета аматьорска футболна лига."},{"page_url":"https://uz.wikipedia.org/wiki/Saint-Suliac","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Map_commune_FR_insee_code_35314.png","page_title":"Saint-Suliac","context_page_description":"Saint-Suliac Fransiyaning Bretan mintaqasida joylashgan kommunadir. Ille-et-Vilaine departamenti Saint-Malo tumani tarkibiga kiradi."},{"page_url":"https://fi.wikipedia.org/wiki/Nasutoceratops","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Nasutoceratops_skeleton.jpg","page_title":"Nasutoceratops","context_page_description":"Nasutoceratops on sukupuuttoon kuollut suuri sarvinaamainen kasvinsyöjädinosaurus, joka eli noin 76–75,5 miljoonaa vuotta sitten myöhäisliitukaudella nykyisessä Etelä-Utahissa, Yhdysvalloissa."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D9%88%D8%B1%D8%B3%D9%8A%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/CurciuSB_%2848%29.JPG","page_title":"كورسيو","context_page_description":"كورسيو, قريه فى رومانيا."},{"page_url":"https://ru.wikipedia.org/wiki/1930_%D0%B3%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/MichailTomski.jpg","page_title":"1930 год","context_page_description":"1930 год по григорианскому календарю — невисокосный год, начинающийся в среду. Это 1930 год нашей эры, 930 год 2-го тысячелетия, 30 год XX века, 10 год 3-го десятилетия XX века, 1 год 1930-х годов."},{"page_url":"https://ro.wikipedia.org/wiki/Aruncuta,_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Aruncuta%2CCluj-DSCF2148.JPG","page_title":"Aruncuta, Cluj","context_page_description":"Aruncuta este un sat în comuna Suatu din județul Cluj, Transilvania, România.\\nÎn perioada 1846-1847 cercetările arheologice au scos la iveală mai multe obiecte din epoca romană, iar săpăturile arheologice de suprafață, din 1977, au scos în evidență că așezarea este locuită din mileniul al II-lea î.e.n. În hotarul satului a fost găsit un topor pană, din piatră, șlefuit și perforat, de tipul celui aflat în așezarea Coțofeni de la Boarta, iar în anul 1967, un sătean, a descoperit un tezaur monetar compus din 251 monede din argint, emise în perioada 1600 - 1707 în mai multe regiuni din Europa. În anul 2016 un sătean a găsit un topor din rocă dură de bazalt, șlefuit și perforat la dimensiunile: lungime = 105 mm., lățime = 75 mm. și grosime topor = 35 mm. Orificiul pentru coada toporului are forma unui trunchi de con { pentru o mai bună fixare }, în care baza mare are 2O mm., iar baza mica 18 mm. Jumătate din cercul de la baza mică este zencuit circa 5 mm., probabil un semn distinctiv pentru o mai ușoară identificare a toporului de către proprietarul din neolitic."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B1%D1%96%D0%BD%D0%B5%D1%82_%D0%BC%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%80%D1%96%D0%B2_%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Luis_Caputo_%28cropped%29.jpg","page_title":"Кабінет міністрів Аргентини","context_page_description":"Кабінет міністрів Аргентини — другий за впливовістю після Президента орган виконавчої влади Аргентини."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E8%BF%AA%E4%BC%AF%E5%B0%94%E6%A1%A5%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Dybbolsbro2.JPG","page_title":"迪伯尔桥站","context_page_description":"迪伯爾橋站是哥本哈根市郊鐵路的一座車站，因旁邊的鐵路跨線橋「迪伯爾橋」而得名。乘客也可經迪伯爾橋進出迪伯爾橋站。1934年11月1日隨哥本哈根市郊鐵路「哥本哈根火車總站⟷瓦爾比站」段通車而開通。站台曾於2009年擴建。"},{"page_url":"https://lt.wikipedia.org/wiki/Gladijus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Uncrossed_gladius.jpg","page_title":"Gladijus","context_page_description":"Gladijus – trumpas plačiaašmenis duriamasis Senovės Romos kalavijas.\\nAnkstyvieji Senovės Romos kalavijai buvo panašūs į graikų. Nuo III a. pr. m. e. romėnai pradėjo naudoti kalavijus, panašius į naudotus keltiberų ir kitų tautų per Ispanijos užkariavimą. Toks kardo tipas vadinosi Gladius Hispaniensis 'ispaniškas kardas'. Iš pradžių buvo manyta, kad jie panašūs į vėlyvuosius Mainz tipo kardus, bet įrodymai prielaidą paneigė. Šie ankstyvieji kalavijai buvo kitokio pavidalo, ilgesni ir siauresni, ir tikriausiai buvo tie, kuriuos Polibijus laikė tinkamais kirsti ir durti.\\nVėliau atsirado Mainz, Fulhamo ir Pompėjos tipo gladijai. Vėliau Publijus Flavijus Vegecijus Renatas mini kardus, vadinamus semispatomis ir spatomis, bei manė, kad juos galima laikyti gladijais.\\nVisiškai apsiginklavęs romėnų kareivis turėjo skydą, kelias ietis, kalaviją, tikriausiai durklą ir galbūt keletą sunkių smigių. Tradiciškai pirma į priešą metamos ietys, po to išsitraukiamas kalavijas. Karys puldavo su priešais atstatytu skydu ir durdavo kalaviju. Priešingai paplitusiai nuomonei, su visais gladijais būdavo galima ne tik durti, bet ir kirsti."},{"page_url":"https://en.wikipedia.org/wiki/Natal_Field_Artillery","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/SANDF_Natal_Field_Artillery_emblem.jpg","page_title":"Natal Field Artillery","context_page_description":"The Natal Field Artillery / King Cetshawayo Artillery Regiment is an artillery regiment of the South African Army. As a reserve unit, it has a status roughly equivalent to that of a British Army Reserve or United States Army National Guard unit. It is part of the South African Army Artillery Formation."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_Bel%C3%A9n_(Barcelona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Betlem_-_1.jpg","page_title":"Iglesia de Belén (Barcelona)","context_page_description":"La iglesia de Nuestra Señora de Belén es un templo parroquial católico de estilo barroco situado en la conjunción de la Rambla y la calle del Carmen, en Barcelona. Pertenece al arciprestazgo de la Rambla-Pueblo Seco.\\nEstá catalogada como monumento declarado en el registro de Bienes Culturales de Interés Nacional del patrimonio catalán y en el registro de Bienes de Interés Cultural del patrimonio español con el código RI-51-0009736.​"},{"page_url":"https://vi.wikipedia.org/wiki/Ramon_Menezes","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/RamonVit%C3%B3ria.JPG","page_title":"Ramon Menezes","context_page_description":"Ramon Menezes Hubner, hay Ramon, là một cựu cầu thủ bóng đá Brasil chơi ở vị trí tiền vệ hoặc tiền đạo, hiện làm công tác huấn luyện viên."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89lection_partielle_de_Rochester_and_Strood_de_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Official_portrait_of_Kelly_Tolhurst_crop_3.jpg","page_title":"Élection partielle de Rochester and Strood de 2014","context_page_description":"L'élection partielle de Rochester and Strood dans le Kent a eu lieu\\nle 20 novembre 2014 à la suite de la démission de Mark Reckless.\\nCette circonscription comprend la cité de Rochester, la ville de Strood et les environs.\\nMark Reckless a été réélu pour le UKIP avec 42,1% des voix."},{"page_url":"https://es.wikipedia.org/wiki/Georgios_Galitsios","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/2018-02-22_Entrainement_excel.jpg","page_title":"Georgios Galitsios","context_page_description":"Georgios Galitsios es un futbolista griego. Juega de lateral derecho y actualmente juega para el Anorthosis Famagusta de la Primera División de Chipre."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%9C%E8%8E%8E%E5%A4%AB%E4%BA%BA%E8%A0%9F%E5%83%8F%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Nelson_Mandela_Wax_Statue_in_Madame_Tussauds_London.jpg","page_title":"杜莎夫人蠟像館","context_page_description":"杜莎夫人蜡像馆，是位于英国伦敦的一间蜡像馆，在全球各地有众多分馆。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Vulkanen_in_Papua-Neuguinea","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Garbuna-volcano.jpg","page_title":"Liste von Vulkanen in Papua-Neuguinea","context_page_description":"Dies ist eine Liste von Vulkanen in Papua-Neuguinea, die während des Quartärs mindestens einmal aktiv waren."},{"page_url":"https://en.wikipedia.org/wiki/Rovaniemen_maalaiskunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Rovaniemi.maalaiskunta.sijainti.svg","page_title":"Rovaniemen maalaiskunta","context_page_description":"Rovaniemen maalaiskunta was a municipality of Finland. It merged with the city of Rovaniemi on January 1, 2006.\\nIt was located in the province of Lapland. The municipality had a population of 21,803 and covered an area of 7,915.51 km² of which 409.06 km² was water. The population density was 2.9 inhabitants per km².\\nThe municipality surrounded the town of Rovaniemi. In 2004 the two municipalities decided to unite into one municipality. The new municipality was formed on January 1, 2006 with the name Rovaniemen kaupunki. The new municipality has a population of approximately 57,000. With an area of 7,900 km² it is the largest city in Finland."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_bus_stations_in_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Bus_station_and_Blue_Street_-_geograph.org.uk_-_1440742.jpg","page_title":"List of bus stations in Wales","context_page_description":"This is a list of bus stations in Wales:"},{"page_url":"https://ca.wikipedia.org/wiki/Tanjung_Pinang","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Location_map_Indonesia_Bintan.png","page_title":"Tanjung Pinang","context_page_description":"Tanjung Pinang és la capital i la ciutat més gran de la província indonèsia de les Illes Riau. La ciutat, amb uns 150.000 habitants, compta amb un port que té connexions de transbordador i llanxa motora amb la resta d'illes de l'arxipèlag i amb Batam, Singapur i Johor Bahru. També és un punt d'entrada i sortida internacional."},{"page_url":"https://war.wikipedia.org/wiki/Meurthe-et-Moselle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Blason_d%C3%A9partement_fr_Meurthe-et-Moselle.svg","page_title":"Meurthe-et-Moselle","context_page_description":"An Meurthe-et-Moselle amo an usa ka departamento ha nasod han Fransya. An prefektura o kapital hini amo an Nancy."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%83%D1%80%D0%BD%D0%B0%D0%B2%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Sweden_relief_location_map.jpg","page_title":"Гурнаван","context_page_description":"Гурнаван — озеро на півночі Швеції. Розташоване на висоті 425 м над рівнем моря. Восьме за площею і найглибше озеро країни. Площа — 262,44 км², середня глибина — 45,8 м, найбільша глибина — 221 м. Стік по річці Шеллефтеельвен у Ботнічна затока Балтійського моря."},{"page_url":"https://en.wikipedia.org/wiki/Arsacid_dynasty_of_Armenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Arshakuni_Armenia_150-en.svg","page_title":"Arsacid dynasty of Armenia","context_page_description":"The Arsacid dynasty or Arshakuni, ruled the Kingdom of Armenia from 12 to 428. The dynasty was a branch of the Arsacid dynasty of Parthia. Arsacid kings reigned intermittently throughout the chaotic years following the fall of the Artaxiad dynasty until 62 when Tiridates I secured Parthian Arsacid rule in Armenia. However, he did not succeed in establishing his line on the throne, and various Arsacid members of different lineages ruled until the accession of Vologases II, who succeeded in establishing his own line on the Armenian throne, which would rule the country until it was abolished by the Sasanian Empire in 428.\\nTwo of the most notable events under Arsacid rule in Armenian history were the conversion of Armenia to Christianity by Gregory the Illuminator in 301 and the creation of the Armenian alphabet by Mesrop Mashtots in c. 405. The reign of the Arsacids of Armenia marked the predominance of Iranianism in the country."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8A%E6%B5%B7%E5%85%AC%E4%BA%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/LOHR_Translohr_STE_3.JPG","page_title":"上海公交","context_page_description":"上海市公共交通，是对中国上海市市域内现有各种城市公共交通的总称，包括公共汽车、电车、轨道交通、出租车和轮渡。截至2014年底，上海全市有地面公交运营企业32家，运营线路1,377条，运营路线总长度23,897公里，运营车辆16,155辆。公共汽车和电车是上海主要交通工具之一。仅1996年时，公交线路已达1,058条，运营线路长度达45,840公里，配备车辆13,323辆。线路总数、运营长度和车辆配备数为世界城市公共交通之最。2007年，上海全市有公交线路991条，公交车辆16,900辆，当年运营里程11.32亿公里，当年全市公交客运量26.52亿人次，创下运营规模、运营里程和载客人次三项世界第一。但随着上海轨道交通线路的逐渐增加，公交主管部门的发展思路变为“轨道交通为主、公交为辅”，许多公交线路被撤销、归并或缩线、部分线路也因客流下降对运能也作相应调整，2010年3月，单月内撤销的公交线路数量创下历史记录。2011年，推行公交优先发展战略。优化调整公交线路305条，先后开通42条“最后一公里”公交线路。"},{"page_url":"https://en.wikipedia.org/wiki/Achmed_Abdullah","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Argosy_19190628.jpg","page_title":"Achmed Abdullah","context_page_description":"Achmed Abdullah was an American writer. He is most noted for his pulp stories of crime, mystery and adventure. He wrote screenplays for some successful films. He was the author of the progressive Siamese drama Chang: A Drama of the Wilderness, an Academy Award-nominated film made in 1927. He earned an Academy Award nomination for collaborating on the screenplay to the 1935 film The Lives of a Bengal Lancer."},{"page_url":"https://ast.wikipedia.org/wiki/Yucat%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Deuda_del_sector_p%C3%BAblico_en_Yucat%C3%A1n.svg","page_title":"Yucatán","context_page_description":"Yucatán ye una de les trenta y dos entidá federatives qu'integren los Estaos Xuníos Mexicanos. La so capital y ciudá más poblada ye Mérida.\\nTa allugáu en la península de Yucatán, rexón sureste del país, llindando al norte col golfu de Méxicu, al sureste col estáu de Quintana Roo y al suroeste col estáu de Campeche. Como estáu llibre y soberanu foi incorporáu orixinalmente a la nación mexicana el 23 d'avientu de 1823, formando parte de los 19 estaos fundadores conforme a la Constitución Federal de los Estaos Xuníos Mexicanos de 1824.\\nAntes de la llegada d'españoles a la península de Yucatán, el nome d'esta rexón yera Mayab, qu'en llingua maya, traduzse como unos pocos. Foi una rexón bien importante pa la civilización maya, especialmente mientres el denomináu periodu posclásico, anque los asentamientos mayes más remotos na rexón envalórase que daten del sieglu III d. C., cuando les primeres migraciones provenientes del Petén establecer na rexón de Bacalar, nel oriente de la península."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%AB%E3%82%AB%E3%83%BB%E3%82%AA%E3%83%BC%E3%83%90%E3%83%BC%E3%82%A2%E3%83%AB%E3%83%97%E9%89%84%E9%81%93HG3/4%E5%BD%A2%E8%92%B8%E6%B0%97%E6%A9%9F%E9%96%A2%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Steffenbach_bridge.jpg","page_title":"フルカ・オーバーアルプ鉄道HG3/4形蒸気機関車","context_page_description":"フルカ・オーバーアルプ鉄道HG3/4形蒸気機関車は、かつてブリーク-フルカ-ディゼンティス鉄道 およびその後身のフルカ・オーバーアルプ鉄道で使用され、現在は保存鉄道であるフルカ山岳蒸気鉄道で運行されている山岳鉄道用ラック式蒸気機関車である。"},{"page_url":"https://tr.wikipedia.org/wiki/Cemal_Abd%C3%BCnnas%C4%B1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Nasser_portrait2.jpg","page_title":"Cemal Abdünnasır","context_page_description":"Cemal Abdünnasır, Mısırlı asker ve devlet adamı; devrimci, milliyetçi, sosyalist lider. Mısır'ın ikinci cumhurbaşkanıdır. Krallığa son veren darbenin ardından başbakan ve devlet başkanı olarak Mısır'da köklü dönüşümlere damgasını vurmuş, etkin bir dış politikayla Arap dünyasında bir önder rolü oynamıştır."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%9A%AE%E5%8D%A1%E8%BF%AA%E5%88%A9%E5%9C%A3%E9%9B%85%E5%90%84%E6%95%99%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/St_James_Church_Piccadilly.jpg","page_title":"皮卡迪利圣雅各教堂","context_page_description":"皮卡迪利聖雅各教堂是一座聖公會教堂，位於英國倫敦中心的皮卡迪利街，由克里斯多佛·雷恩爵士設計。\\n這座教堂用紅磚和波特蘭石砌築，內部三面為方形柱子支撐的拱廊，中殿為科林斯柱支撐。\\n1940年，第二次世界大戰期間，這座教堂曾遭轟炸而嚴重受損。\\n這座教堂定期舉辦音樂會，其中包括熱門的當代音樂家表演，例如R.E.M.和民間音樂家蘿拉·馬林。\\n像倫敦市中心的許多教堂一樣，聖雅各教堂被商業大廈包圍，當地人越來越少，在1960年代和70年代損失了不少信徒。1980年，唐納德·里夫斯擔任牧師，聲稱：「我不介意你做什麼，只要保持開放」。在1980年代和1990年代的大部分時間，人數和活力都有所增加，成為一個自由主義教堂，並得到社區的積極支持。"},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B3%A0%EC%88%98_(%EC%8B%9D%EB%AC%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Coriandrum_sativum_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-193.jpg","page_title":"고수 (식물)","context_page_description":"고수 또는 빈대풀은 미나리과에 딸린 한해살이풀이다. 동유럽 원산이다."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%8F%85%E5%8E%9F%E5%AF%9B%E5%AD%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Hirotaka_Sugawara_cropped_2_Hirotaka_Sugawara_19991006.jpg","page_title":"菅原寛孝","context_page_description":"菅原 寛孝は、日本の物理学者。大学共同利用機関法人高エネルギー加速器研究機構名誉教授、総合研究大学院大学名誉教授、沖縄科学技術大学院大学学長特別顧問。学位は理学博士。勲等は瑞宝中綬章。\\nカリフォルニア大学研究員、シカゴ大学研究員、東京教育大学理学部助手、東京大学原子核研究所助教授、高エネルギー物理学研究所物理研究系教授、高エネルギー物理学研究所物理研究部第一研究系教授、高エネルギー物理学研究所所長、高エネルギー加速器研究機構機構長、ハワイ大学教授、国立大学法人総合研究大学院大学理事などを歴任した。"},{"page_url":"https://en.wikipedia.org/wiki/1939_San_Diego_mayoral_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Mayor_Benbough.jpg","page_title":"1939 San Diego mayoral election","context_page_description":"The 1939 San Diego mayoral election was held on April 25, 1939 to elect the mayor for San Diego. Incumbent mayor Percy J. Benbough stood for reelection to a second term. In the primary election, Percy J. Benbough and Jacob Weinberger received the most votes and advanced to a runoff election. Benbough was then reelected mayor with a majority of the votes in the runoff."},{"page_url":"https://gl.wikipedia.org/wiki/Tren_de_levitaci%C3%B3n_magn%C3%A9tica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Transrapid-emsland.jpg","page_title":"Tren de levitación magnética","context_page_description":"O tren de levitación magnética, tamén coñecido como maglev é un tren que funciona con levitación magnética, caracterizada pola ausencia de contacto entre os vehículos e a vía por mor da utilización dun gran número de imáns para sustentarse. Este método é máis rápido, silencioso e suave ca os sistemas de transporte convencionais.\\nExisten dúas liñas comerciais de tren maglev que prestan servizo regular en 2015. O Sanghai Maglev, que é asemade o tren comercial máis rápido, cunha velocidade máxima de 430 km/h, e que conecta o Aeroporto Internacional de Sanghai Pudong con Pudong percorrendo a distancia de 30.5 quilómetros en 8 minutos e que comezou a operar en abril de 2004\\nEn marzo de 2005, o Xapón comezou a operar a liña, de relativamente baixa velocidade, HSST \\"Linimo\\" na Expo Mundial de 2005, nos primeiros tres meses a liña transportou 10 millóns de pasaxeiros. Tanto Corea do Sur como a República Popular da China están a construír as súas propias liñas maglev de baixa velocidade,"},{"page_url":"https://en.wikipedia.org/wiki/Stanislas_Robin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Stanislas_Robin.jpg","page_title":"Stanislas Robin","context_page_description":"Stanislas Robin is a French rugby league footballer who plays as a scrum-half or stand-off for Toulouse Olympique in the Betfred Championship.\\nHe previously played for the Catalans Dragons, Sheffield Eagles and the Villeneuve Leopards."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%A8%D8%B1%D9%8A%D9%85%D9%88%D9%86_(%D8%A7%D9%84%D8%A3%D8%B1%D8%AF%D9%8A%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Apremont081610.JPG","page_title":"أبريمون (الأردين)","context_page_description":"أبريمون هي بلدية فرنسية تقع في إقليم الأردين في منطقة غراند إيست."},{"page_url":"https://en.wikipedia.org/wiki/William_O%27Neill,_1st_Baron_O%27Neill","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/O%27Neill_Conroy_family_tree.jpg","page_title":"William O'Neill, 1st Baron O'Neill","context_page_description":"Reverend William O'Neill, 1st Baron O'Neill was an Anglo-Irish hereditary peer, clergyman and musical composer. Born William Chichester, he changed his surname to O'Neill in 1855."},{"page_url":"https://it.wikipedia.org/wiki/Christa_Stubnick","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Bundesarchiv_Bild_183-39836-0018%2C_Christa_Stubnick.jpg","page_title":"Christa Stubnick","context_page_description":"Christa Stubnick è un'ex velocista tedesca.\\nPrese parte ai Giochi olimpici di Melbourne 1956 conquistando la medaglia d'argento nei 100 metri piani e nei 200 metri piani."},{"page_url":"https://pl.wikipedia.org/wiki/Apoloniusz_Zawilski","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Apoloniusz_Zawilski.jpg","page_title":"Apoloniusz Zawilski","context_page_description":"Apoloniusz Zawilski – polski historyk, pisarz, pułkownik Wojska Polskiego."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Josh_Lucas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Josh_Lucas_July_14%2C_2014_%28cropped%29.jpg","page_title":"Josh Lucas","context_page_description":"Joshua Lucas Easy Dent Maurer sī chi̍t-ūi Bí-kok ê cha-po͘ ián-goân."},{"page_url":"https://cs.wikipedia.org/wiki/Severomakedonsk%C3%A1_kuchyn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Zlaten_Dab.JPG","page_title":"Severomakedonská kuchyně","context_page_description":"Severomakedonská kuchyně je tradiční kuchyně v Severní Makedonii, zástupce balkánské kuchyně odrážející vlivy Středomoří, řecké kuchyně, turecké kuchyně a kuchyně Blízkého východu, a v menším rozsahu italské, německé a východoevropské kuchyně. Relativně teplé klima Severní Makedonie nabízí vynikající podmínky pro růst různých druhů zeleniny, ovoce a bylin. Severomakedonská kuchyně je také známá pro rozmanitost a kvalitu mléčných výrobků, vína a místních alkoholických nápojů, například rakije.\\nZa národní jídlo Severní Makedonie se pokládají tavče gravče a likér mastika."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D1%83%D0%BD%D1%96%D1%86%D0%B8%D0%BF%D0%B0%D0%BB%D1%96%D1%82%D0%B5%D1%82%D1%96%D0%B2_%D0%B4%D0%B5%D0%BF%D0%B0%D1%80%D1%82%D0%B0%D0%BC%D0%B5%D0%BD%D1%82%D1%83_%D0%A0%D0%B5%D1%8E%D0%BD%D1%8C%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/La_R%C3%A9union_location-map_administrative.jpg","page_title":"Список муніципалітетів департаменту Реюньйон","context_page_description":"Нижче наведено список 24 муніципалітетів департаменту Реюньйон."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC%E4%BA%8C%E6%AC%A1%E4%B8%96%E7%95%8C%E5%A4%A7%E6%88%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/RIAN_archive_834147_Hoisting_the_banner_in_Port-Artur._WWII_%281941-1945%29.jpg","page_title":"第二次世界大戦","context_page_description":"第二次世界大戦は、1939年から1945年までの6年余りにわたって、日本、ドイツ、イタリアの日独伊三国同盟を中心とする枢軸国陣営と、イギリス、ソビエト連邦、オランダ、フランス、アメリカ、中華民国、ベルギーなどの連合国陣営との間で戦われた戦争で、第一次世界大戦以来の全世界的規模の戦争となった。\\n1939年9月のドイツ軍によるポーランド侵攻と続くソビエト連邦によるポーランド侵攻、そして英仏からドイツへの宣戦布告によりヨーロッパは戦場と化した。その後1941年12月のマレー作戦による日本とイギリスやオランダとの開戦と、続くアメリカへの真珠湾攻撃と宣戦布告による、いわゆる太平洋戦争開戦によって、戦火は全世界に拡大し、人類史上最大規模の戦争となった。"},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Guandu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Shao_cao_195-200.png","page_title":"Battle of Guandu","context_page_description":"The Battle of Guandu was fought between the warlords Cao Cao and Yuan Shao in 200 CE in the late Eastern Han dynasty. Cao Cao's decisive victory against Yuan Shao's numerically superior forces marked the turning point in their war. The victory was also the point at which Cao Cao became the dominant power in northern China, leading to the establishment of the state of Cao Wei in the Three Kingdoms period."},{"page_url":"https://ceb.wikipedia.org/wiki/Yellowhead_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Yellowhead_Lake.jpg","page_title":"Yellowhead Lake","context_page_description":"Lanaw ang Yellowhead Lake sa Kanada. Nahimutang ni sa lalawigan sa British Columbia, sa sentro nga bahin sa nasod, 3,200 km sa kasadpan sa Ottawa ang ulohan sa nasod. 1,105 metros ibabaw sa dagat kahaboga ang nahimutangan sa Yellowhead Lake. Naglangkob kin og 1.7 ka kilometro kwadrado. Hapit nalukop sa lasang nga dagomkahoy ang palibot sa Yellowhead Lake. Naglukop ni og 2.0 km gikan sa amihanan ngadto sa habagatan ug 3.4 km gikan sa sidlakan ngadto sa kasadpan.\\nSa mosunod nga mga natural nga mga bahin makita sa Yellowhead Lake:\\nWitney Lake\\nAng klima hemiboreal. Ang kasarangang giiniton -4 °C. Ang kinainitan nga bulan Hulyo, sa 10 °C, ug ang kinabugnawan Disyembre, sa -16 °C."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%A7%DA%A9%D9%88_%D9%84%D8%A6%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Premios_Goya_2018_-_Paco_Le%C3%B3n.jpg","page_title":"پاکو لئون","context_page_description":"پاکو لئون هنرپیشه و کارگردان فیلم اهل اسپانیا است.\\nاز فیلم‌ها یا برنامه‌های تلویزیونی که وی در آن نقش داشته‌است می‌توان به کویینز اشاره کرد."},{"page_url":"https://en.wikipedia.org/wiki/List_of_sport_utility_vehicles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Yema_F16_02_China_2015-04-08.jpg","page_title":"List of sport utility vehicles","context_page_description":"This page lists sport utility vehicles currently in production as well as past models. The list includes crossover SUVs, Mini SUVs, Compact SUVs and other similar vehicles. Also includes hybrid, luxury, sport or tuned, military, electric and fuel cell versions. Due to confusion, Sport Utility Trucks are also in this list.\\nNote: Many of the vehicles are related to other vehicles in the list. A vehicle listed as a 'past model' may still be in production in an updated form under a different name, it may be listed under that name in the 'currently in production' section. Also, some vehicles are sold under different marques in different geographical locations, therefore some vehicles may be listed more than once but usually link to the same page. Different states may also classify vehicles differently. What may be considered an SUV in one state, may not in another state. Example; The Chevrolet Nafees is known as the Chevrolet Zeeyan in Russia and Brazil, and in Australia and New Zealand, it is marketed by GM Holden. Some images provided below may be pictures of outdated models."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Kmu2.jpg","page_title":"Нагорода","context_page_description":"Нагоро́да — щось, що видається як заохочення за заслуги, відзнаки, в знак подяки за що-небудь. Одним з призначень нагороди є надання особливого соціального статусу особі що отримує нагороду.\\nДо нагород відносять: почесні знаки, призи, премії, почесні грамоти, цінні подарунки та почесні звання."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%A5%8A%E9%8D%BE%E5%81%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/1965-7_1965%E5%B9%B4_%E6%9D%A8%E9%94%BA%E5%81%A5%E5%9C%A8%E8%93%9D%E7%94%B0%E4%BA%BA%E9%81%97%E9%AA%B8%E5%8F%91%E7%8E%B0%E5%9C%B0.jpg","page_title":"楊鍾健","context_page_description":"楊鍾健，字克強，陝西華縣人，中國地質學家及古生物學家，中國古脊椎動物研究的學科奠基人。"},{"page_url":"https://it.wikipedia.org/wiki/Cristina_di_Svezia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Gustav_of_Wasaborg_%281616%29_c_1652_by_S%C3%A9bastien_Bourdon.jpg","page_title":"Cristina di Svezia","context_page_description":"Cristina di Svezia, o Cristina Alessandra Maria dopo la conversione al Cattolicesimo, è stata regina di Svezia dal 1632, ma con pieni poteri solo dal 1650, fino all'abdicazione avvenuta nel 1654.\\nFiglia di re Gustavo II Adolfo di Svezia e della regina Maria Eleonora del Brandeburgo, succedette sul trono all'età di sei anni dopo la prematura scomparsa del genitore. Educata dal potente alto cancelliere Axel Oxenstierna e figlia di uno dei massimi difensori del protestantesimo durante la guerra dei trent'anni, suscitò grande scandalo quando nel 1654, nel pieno di una profondissima crisi religiosa, si convertì al cattolicesimo e abdicò in favore del cugino Carlo Gustavo che divenne re Carlo X. Temendo le reazioni e le vendette dei protestanti lasciò subito la Svezia per trascorrere il resto della sua esistenza in vari Paesi d'Europa stabilendosi poi definitivamente a Roma dove si occupò di opere caritatevoli, di arte, musica e teatro in un movimento culturale che, dopo la sua morte, portò alla fondazione dell'Accademia dell'Arcadia nel 1690."},{"page_url":"https://pl.wikipedia.org/wiki/Linia_kolejowa_nr_158","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Wykolejenie_Rybnik-Rymer.JPG","page_title":"Linia kolejowa nr 158","context_page_description":"Linia kolejowa nr 158 Rybnik Towarowy – Chałupki – linia kolejowa w południowo-zachodniej części województwa śląskiego. Linia na całej długości jest zelektryfikowana, odcinek Rybnik Towarowy – Wodzisław Śląski jest dwutorowy, a odcinek Wodzisław Śląski – Chałupki jednotorowy.\\nLinia jest linią pierwszorzędną na odcinku Rybnik Towarowy – Wodzisław Śląski oraz drugorzędną na odcinku Wodzisław Śląski – Chałupki. Na całej długości jest linią o znaczeniu państwowym. Przynależy ona do oddziału regionalnego PKP Polskich Linii Kolejowych w Tarnowskich Górach."},{"page_url":"https://nl.wikipedia.org/wiki/Eskimo%27s","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Carved_19th_century_Eskimo_mammoth_tusk_De_Young_Museum_34430_2.JPG","page_title":"Eskimo's","context_page_description":"Eskimo's zijn een aantal inheemse bevolkingsgroepen die Groenland, het noorden van Canada, Alaska en het uiterste oosten van Siberië bewonen. De Inuit worden politiek en vaak ook wetenschappelijk niet tot de indianen gerekend.\\nAlhoewel de Canadese Eskimo's zelf liever met hun eigen woord inuit zouden worden aangeduid, de Groenlandse Eskimo's, die gebruikelijk ook tot de Inuit worden gerekend, zichzelf de kalaallit noemen en de aanzienlijke minderheid in Alaska en het noordoosten van het Russische Verre Oosten zichzelf yupik noemt, werd Eskimo in het Nederlands veel gebruikt voor de gehele bevolkingsgroep. In de Verenigde Staten worden Eskimo's ook wel Native Alaskans genoemd."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Cache_County,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Lafayette_Hendricks_House_Richmond_Utah.jpeg","page_title":"National Register of Historic Places listings in Cache County, Utah","context_page_description":"This is a list of the National Register of Historic Places listings in Cache County, Utah.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Cache County, Utah, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 76 properties and districts listed on the National Register in the county. Another 4 sites in the county were once listed, but have since been removed.\\nThis National Park Service list is complete through NPS recent listings posted June 26, 2020."},{"page_url":"https://sh.wikipedia.org/wiki/Indijanci","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Alto_orinoco5.jpg","page_title":"Indijanci","context_page_description":"Indijanci je kolektivni naziv za prastanovnike Amerike, raznorazne narode mongoloidnog izgleda raširene od arktičke Kanade i Aljaske do Ognjene zemlje u Čileu i Argentini. Međusobno se razlikuju po jezicima, kulturi i fizičkom izgledu. Većinom su to bila lovačko-sakupljačka društva kao iz Brazila i iz Kalifornije i Nevade. Neki su bili ribari iz Južne Amerike. U njihove najrazvijenije narode koji su uspjeli podići visokorazvijene civilizacije spadaju narodi Olmeka, Tolteka, Maja i Asteka iz Meksika te Inka iz Perua.\\nDanas su mnogi smješteni po rezervatima, osobito u Kanadi, Sjedinjenim Državama i Brazilu. Prvi se put spominju otkrićem Amerike 1492. godine."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8F%99%EC%84%B1%EA%B5%90%ED%86%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/110317_%EB%8F%99%EC%84%B1%EA%B5%90%ED%86%B5_303%EB%B2%88_%ED%98%84%EB%8C%80%EC%9E%90%EB%8F%99%EC%B0%A8_%EB%89%B4%EC%8A%88%ED%8D%BC%EC%97%90%EC%96%B4%EB%A1%9C%EC%8B%9C%ED%8B%B0_%ED%8E%98%EC%9D%B4%EC%8A%A4%EB%A6%AC%ED%94%84%ED%8A%B8_%EC%B2%9C%EC%97%B0%EA%B0%80%EC%8A%A4%EB%B2%84%EC%8A%A4_2011%EB%85%84%EC%8B%9D_%EB%92%B7%EB%A9%B4.JPG","page_title":"동성교통","context_page_description":"동성교통은 경기도 성남시에 연고를 두고 있는 서울특별시의 시내버스 업체다. 본사는 경기도 성남시 중원구 상대원동에 있다. 대진여객, 남성교통, 대명운수 등을 계열사로 두었으나 대진여객, 남성교통과 지분관계를 정리하였으며, 각각 독자 법인이 되었으므로 현재 계열사는 성남 대명운수만 있다. 대진여객과 남성교통은 친인척 관계로만 남아 있다. 사업자 등록은 서울특별시 성북구 보국문로 204 로 되어 있다."},{"page_url":"https://de.wikipedia.org/wiki/Australischer_Amethystpython","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Morelia_kinghorni_swallows_a_small_Macropod.jpg","page_title":"Australischer Amethystpython","context_page_description":"Der Australische Amethystpython, auch Kinghorns Python, zählt zur Familie der Pythons und wird dort in die Gattung der Amethystpythons gestellt. Er wurde erst im Jahr 2000 als eigene Art vom Amethystpython abgetrennt. Mit gesicherten Längen über fünf Meter ist dieser schlanke Python die weitaus größte Schlange Australiens und gleichzeitig eine der längsten Schlangen der Welt. Das Verbreitungsgebiet umfasst den tropischen Nordosten Australiens und ein paar vorgelagerte Inseln der Torres-Straße. Hier bewohnt er vordergründig dichten Regenwald wo er etwa die Hälfte der Zeit auf Bäumen verbringt. Die Nahrung besteht aus einer Vielzahl unterschiedlicher Wirbeltiere, die der Größe des Pythons angepasst werden. Große Individuen erbeuten relativ häufig kleine Kängurus, die selten gegen 10 Kilogramm schwer sein können. Australische Amethystpythons sind wie alle Arten der Pythonidae eierlegend und gehören zu den Arten, bei denen die Weibchen die Bebrütungstemperatur durch Muskelzittern erhöhen können."},{"page_url":"https://ca.wikipedia.org/wiki/Metro_de_Bak%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Xalqlar_dostlu%C4%9Fu_metrostansiyas%C4%B1.JPG","page_title":"Metro de Bakú","context_page_description":"El Metro de Bakú és un sistema de metro que serveix a la capital de l'Azerbaidjan, Bakú. Obert el 1967, el sistema es va expandir com una xarxa moderna. Com la majoria dels altres sistemes de l'antiga URSS, moltes de les estacions són adorns nacionals molt profunds i exquisidament adornats, que sovint es barregen amb la ideologia soviètica."},{"page_url":"https://sh.wikipedia.org/wiki/Zvjezda%C4%8De","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Marthasterias_glacialis_Linosa_067.jpg","page_title":"Zvjezdače","context_page_description":"Zvjezdače su razred pokretnih morskih životinja iz koljena bodljikaša sploštena tijela na kojemu se ističu krakovi."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Mary","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Welder_Library.jpg","page_title":"University of Mary","context_page_description":"The University of Mary is a private, Benedictine university near Bismarck, North Dakota. It was established in 1959 as Mary College.\\nThe university is the largest degree-granting institution in Bismarck. It has study abroad campuses in Rome and Arequipa, Peru, and also operates academic programs at satellite locations in North Dakota, Minnesota, Montana, Kansas, and Arizona. It is endorsed by The Newman Guide to Choosing a Catholic College. It has been recognized as a College of Distinction since 2017, the only such institution in North Dakota. In 2019, the National Council of State Boards of Nursing exam results ranked the University of Mary’s nursing program as #1 regionally and #1 of 2,061 nursing programs nationwide."},{"page_url":"https://ro.wikipedia.org/wiki/Gurghiu,_Mure%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Gurghiu_Calvinist_Church.JPG","page_title":"Gurghiu, Mureș","context_page_description":"Gurghiu, mai demult Sântimbrul Gurghiului, este satul de reședință al comunei cu același nume din județul Mureș, Transilvania, România."},{"page_url":"https://de.wikipedia.org/wiki/Gex_(Ain)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Eglise_SDJ_Gex%2C_France.jpg","page_title":"Gex (Ain)","context_page_description":"Gex ist eine französische Gemeinde mit 12.652 Einwohnern im Département Ain in der Region Auvergne-Rhône-Alpes. Sie ist Hauptort des Arrondissements Gex sowie Sitz des Kommunalverbandes Pays de Gex."},{"page_url":"https://de.wikipedia.org/wiki/Bienenfresser_(Familie)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Merops_bullockoides_1_Luc_Viatour.jpg","page_title":"Bienenfresser (Familie)","context_page_description":"Die Bienenfresser oder Spinte bilden eine Familie mittelgroßer Vögel, die in Afrika, in West- und Südeuropa, teilweise auch in Mittel- und Osteuropa, im Nahen Osten, Südasien, Südostasien, Australien und Neuguinea vorkommen. In reinen Wüstengebieten, z. B. in der Sahara oder der zentralarabischen Wüste, sowie in Nord-, Mittel- und Südamerika kommen Bienenfresser nicht vor. Sie werden zu den Rackenvögeln gestellt."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_Belmonte_de_Tajo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Escudo_de_Belmonte_de_Tajo.svg","page_title":"Condado de Belmonte de Tajo","context_page_description":"El condado de Belmonte de Tajo es un título nobiliario español, de Castilla. Fue creado por el rey Carlos II, con la denominación de Belmonte y mediante Real Despacho del 23 de abril de 1691, en favor de Juan de Prado Mármol y de la Torre, poseedor de las casas y mayorazgos de sus apellidos en Madrid, regidor perpetuo de esta villa y señor de la de Belmonte de Tajo, alférez mayor de los Peones de Castilla, caballero de la Orden de Alcántara, ministro del Consejo de Hacienda. El señorío y mayorazgo de Belmonte fue fundado por su antepasado Álvar García de Toledo, del Consejo del rey Felipe II y su alcalde de Casa y Corte.​​"},{"page_url":"https://cs.wikipedia.org/wiki/Chomutov","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Chomutov_CV_CZ.png","page_title":"Chomutov","context_page_description":"Chomutov je statutární město v Ústeckém kraji, 49 km jihozápadně od Ústí nad Labem. Zaujímá plochu 29,26 km² a žije zde přibližně 49 tisíc obyvatel. Je 22. největším městem České republiky, pátým v Ústeckém kraji a největším v okrese Chomutov."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BB%B6%E5%B2%A1%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Nobeoka_Station_20130501.jpg","page_title":"延岡站","context_page_description":"延岡車站是位於宮崎縣延岡市幸町三丁目，九州旅客鐵道和日本貨物鐵道的日豐本線車站。事務管號碼為▲920554。\\n高千穗鐵道高千穗線曾經駛入此站，在2005年颱風彩蝶吹襲日本後使鐵路暫停營業，後來沒有經過復收，於2007年正式廢止。"},{"page_url":"https://ast.wikipedia.org/wiki/Gael_Garc%C3%ADa_Bernal","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/GaelGarciaBernalTIFFSept2012.jpg","page_title":"Gael García Bernal","context_page_description":"Gael García Bernal ye un actor, direutor y productor mexicanu.\\nGael ye fíu de los actores José Ángel García y Patricia Bernal y entamó la so carrera faciendo teatru y televisión.\\nEstudió interpretación na London Central School of Speech and Drama y participó en películes como El crimen del padre Amaro, Diarios de motocicleta o La mala educación."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%DB%8C%D8%A8%D9%86%DB%8C%D8%AA%D8%B2-%D8%AF%D8%A7%D9%85%E2%80%8C%DA%AF%D8%A7%D8%B1%D8%AA%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Ribnitz_Damgarten_town_hall.jpg","page_title":"ریبنیتز-دام‌گارتن","context_page_description":"شهر ریبنیتز-دام‌گارتن در ایالت مکلنبورگ-فورپومن در کشور آلمان واقع شده است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BA%D0%B0%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BE%D0%B2%D0%B5%D1%82_(%D0%91%D0%B0%D0%BA%D0%B0%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Coat_of_Arms_of_Bakaly_rayon_%28Bashkortostan%29.png","page_title":"Бакалинский сельсовет (Бакалинский район)","context_page_description":"Бакалинский сельсовет — муниципальное образование в Бакалинском районе Башкортостана.\\nВ 2008 году объединен с сельским поселением Старокуяновский сельсовет."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AF%D9%81%D8%A7%D8%B9_%D8%A7%D9%84%D8%AC%D9%88%D9%8A_%D8%A7%D9%84%D9%85%D9%84%D9%83%D9%8A_%D8%A7%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Crotale_NG_P1220851.jpg","page_title":"الدفاع الجوي الملكي السعودي","context_page_description":"قُوّات الدِفَّاع الجوّي المَلكِيَّ السُّعُوديَّ هي فرع خدمة الدفاع الجوي للقوات المسلحة الملكية وواحدة من أركان الحرب العامة النِظامية بوزارة الدفاع السعودية. وهي القوة العسكرية المعنية بتأمين الحماية التامة لأجواء المملكة العربية السعودية، بالإشتراك مع القوات الجوية الملكية، وذلك باستخدام أرقى ما توصلت إليه التقنية الحديثة من الوسائل القادرة على إزالة خطر الطائرات المهاجمة والصواريخ المعادية عن كافة المناطق الحيوية والنقاط الحساسة التي تمثل مصادر الثروة ومختلف مراكز الإنتاج في البلاد. وتعد أنظمة قوات الدفاع الجوي السعودي من أعقد أنظمة الدفاع الجوي في منطقة الشرق الأوسط والعالم الإسلامي."},{"page_url":"https://de.wikipedia.org/wiki/Gesangsp%C3%A4dagogik","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/UtQueantLaxis-Arezzo.svg","page_title":"Gesangspädagogik","context_page_description":"Die Gesangspädagogik beschäftigt sich mit dem Aufbau einer für den musikalischen Gebrauch geeigneten Gesangstechnik und mit der Verbindung der erworbenen stimmtechnischen Fertigkeiten mit der künstlerischen Interpretation von Vokalmusik.\\nGesangsunterricht wird an öffentlichen und privaten Musikschulen, Konservatorien, Musikhochschulen sowie im Privatunterricht gegeben und läuft generell im Einzelunterricht ab. Über Förderprogramme wird Gesangsunterricht an Schulen vermehrt auch als Unterricht in Kleingruppen oder in Klassenverbänden erteilt. Auch Volkshochschulen bieten Gesangsunterricht in Gruppen an. Für Chöre besteht die Möglichkeit der chorischen Stimmbildung."},{"page_url":"https://hu.wikipedia.org/wiki/K%C5%99t%C4%9Bnov","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/K%C5%99t%C4%9Bnov_znak.jpg","page_title":"Křtěnov","context_page_description":"Křtěnov település Csehországban, a Blanskói járásban. Křtěnov Prosetín, Olešnice, Lhota u Olešnice, Crhov és Louka településekkel határos. Lakosainak száma 214 fő."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D8%B3%D8%A7%D9%BE%DB%8C%D9%86%D8%B2%D8%A7%DB%8C_%D8%B1%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/MarcelloPiacentini1900.jpg","page_title":"دانشگاه ساپینزای رم","context_page_description":"دانشگاه ساپینزای رم، با نام رسمی ساپینزا - دانشگاه رم، بزرگترین دانشگاه اروپا و قدیمی‌ترین دانشگاه شهر رم در ایتالیا است که در سال ۱۳۰۳ میلادی، تأسیس شده‌است. بر طبق رتبه‌بندی آکادمیک دانشگاه‌های جهان دانشگاه ساپینزا در بین ۳۰ دانشگاه برتر اروپا جای دارد.\\nدر سال ۲۰۱۳، دانشگاه ساپینزا رم طبق اعلام مرکز رتبه‌بندی دانشگاه‌های جهان، رتبه ۶۲ در جهان و بالاترین رتبه در ایتالیا قرار دارد.\\nاین دانشگاه توسط رتبه‌بندی علمی دانشگاه‌های جهان به‌طور مرتب، اولین رتبه در میان دانشگاه‌های اروپای جنوبی قرار دارد. این دانشگاه در میان بالای ۳ درصد از دانشگاه‌های جهان قرار دارد. هم‌چنین، دانشگاه ساپینزا معمولاً به عنوان یکی از ده دانشگاه برتر اروپا است.\\nدانشگاه ساپینزا رم یکی از معتبرترین دانشگاه‌های اروپا و معتبرترین دانشگاه ایتالیا است. از جمله فارغ‌التحصیلان این دانشگاه، بسیاری از برندگان جایزه نوبل، رئیس پارلمان اروپا، سران چندین کشور و دانشمندان و فضانوردان قابل توجه است.\\nساپینزا به ایتالیایی به معنای حکمت یا فرزانگی است."},{"page_url":"https://ms.wikipedia.org/wiki/Gilda_(perhimpunan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Shoemaker_Book_of_Trades.png","page_title":"Gilda (perhimpunan)","context_page_description":"Gilda [gil-da, pinjaman Bahasa Belanda: gilde] atau perseikatan [pĕr-sĕ-i-kat-an] adalah suatu kelompok menghubungkan para petukang atau saudagar untuk memantau kegiatan usaha atau perniagaan mereka di daerah tertentu. Badan-badan ini pada awalnya tertua dibentuk sebagai suatu persatuan persaudaraan awam Kristian atau usahawan. Gilda diatur mirip perhimpunan profesi, serikat pekerja, kartel dan kumpulan rahsia. Keberadaannya acap kali bergantung pada anugerah surat paten dari seorang kepala monarki atau kepala pemerintahan lainnya untuk menguasai serta mengendalikan kegiatan usaha demi kepentingan anggota-anggotanya, untuk mempertahankan kepemilikan sarana kerja, dan untuk menjamin kelancaran pasokan bahan baku. Tinggalan sejarah gilda-gilda tradisional yang masih kekal sampai sekarang adalah balai gilda, gedung pertemuan para anggota gilda. Anggota gilda yang kedapatan berlaku curang di muka umum akan dikenai denda atau dicabut keanggotaannya.\\nSalah satu kemajuan penting yang dihasilkan oleh kegiatan berserikat ala gilda adalah pendirian universitas di kota Bologna, kota Oxford, dan kota Paris."},{"page_url":"https://en.wikipedia.org/wiki/List_of_existing_model_dwellings","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Evelina_Mansions_SE5_-_geograph.org.uk_-_165920.jpg","page_title":"List of existing model dwellings","context_page_description":"Model Dwellings were buildings or estates constructed, mostly during the Victorian era, along philanthropic lines to provide decent living accommodation for the working class. They were typically erected by private model dwellings companies and usually with the aim of making a return on investment hence the description of the movement as \\"five per cent philanthropy.\\" As such they were forerunners of modern-day municipal housing.\\nThis is a list of still-standing model dwellings, organised by builder. Most of these companies are now defunct; a few, such as the Peabody Trust are still operating and building new accommodation, and others have been subsumed by larger firms. This list covers urban development on the principal of \\"five per cent philanthropy\\"; for communities built to house workers for a particular trade or employer, see model village or company town."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%95%D7%9F_%D7%92%27%D7%95%D7%A0%D7%A1%D7%95%D7%9F_(%D7%A4%D7%95%D7%9C%D7%99%D7%98%D7%99%D7%A7%D7%90%D7%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ron_Johnson%2C_official_portrait%2C_112th_Congress.jpg","page_title":"רון ג'ונסון (פוליטיקאי)","context_page_description":"רונלד הרולד \\"רון\\" ג'ונסון הוא פוליטיקאי אמריקאי חבר המפלגה הרפובליקנית. מכהן כסנאטור מטעם מדינת ויסקונסין וכיו\\"ר הוועדה לביטחון לאומי ולענייני ממשל בסנאט."},{"page_url":"https://en.wikipedia.org/wiki/Magnus_Gullerud","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Magnus_Gullerud-GoldenLeague-20160110.JPG","page_title":"Magnus Gullerud","context_page_description":"Magnus Gullerud is a Norwegian handball player for GWD Minden and the Norwegian national team.\\nHe participated at the 2019 World Men's Handball Championship."},{"page_url":"https://it.wikipedia.org/wiki/Capi_di_Stato_del_Messico","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/President_Manuel_Gonzalez.jpg","page_title":"Capi di Stato del Messico","context_page_description":"I capi di Stato del Messico si sono succeduti a partire dal 1824. Il Paese è una repubblica presidenziale, per cui il presidente è sia capo dello Stato che capo del governo.\\nLa cronologia dei capi di Stato messicani è complessa a causa dell'instabilità politica del paese durante i primi cinquantasei anni di vita come nazione indipendente e durante il secondo decennio del XX secolo. In quattro momenti della sua storia, ci furono due capi esecutivi paralleli allo stesso tempo, a capo di diverse fazioni nelle guerre civili o esterne. Il primo caso fu durante la Guerra della Riforma in cui vi era un governo liberale e un altro governo conservatore; il secondo quando ci fu un governo repubblicano e un altro monarchico; un terzo ci fu all'inizio del Porfiriato quando c'era un governo rivoluzionario e un altro legalista; e infine una quarta volta, quando si fronteggiavano il governo costituzionalista e il governo della Convenzione di Aguascalientes."},{"page_url":"https://cs.wikipedia.org/wiki/Xaverovsk%C3%BD_h%C3%A1j","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Xaverovsk%C3%BD_potok.jpg","page_title":"Xaverovský háj","context_page_description":"Xaverovský háj je les tvořící východní výběžek území Dolních Počernic v Praze, vklíněný mezi osadu Xaverov v Horních Počernicích a průmyslovou zónu Běchovic. Větší část lesa je od roku 1982 chráněna jako přírodní památka ev. č. 737. Důvodem ochrany je 69,9 ha zalesněné plochy. Nachází se zde totiž významné porosty dubů v mnoha přirozených typech. Oblast spravuje Agentura ochrany přírody a krajiny ČR.\\nXaverovský háj je součást přírodního parku Klánovice-Čihadla, který je největším přírodním parkem na území Prahy."},{"page_url":"https://da.wikipedia.org/wiki/Roncesvallespasset","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Roncesvalles_conjunto.jpg","page_title":"Roncesvallespasset","context_page_description":"Roncesvallespasset er et bjergpas i den selvstyrende provins Navarra. Passet ligger i 1.057 moh. på vej N 134 ca. 1 km nord for landsbyen Roncesvalles. Det er et af de lavestbeliggende pas i den vestlige del af Pyrenæerne, og det har været brugt som overgangssted mellem Sydfrankrig og Nordspanien. Passet var gennem århundreder den vigtigste overgang for pilgrimme på vej mod Santiago de Compostela, men baskiske røvere gjorde det usikkert at færdes dér, og man forlagde ruten til Somportpasset, indtil vejen atter blev sikret i det 11. århundrede."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%B1%E5%8D%80_(%E8%87%BA%E4%B8%AD%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Taichung_Le_Cheng_Matsu_Temple.JPG","page_title":"東區 (臺中市)","context_page_description":"東區為台灣臺中市的市轄區之一，為臺中市最初實施市制時的市域之一。該區與北區、中區、西區、南區、北屯區、西屯區及南屯區屬於臺中市都心區域。"},{"page_url":"https://sk.wikipedia.org/wiki/Z%C3%A1kladn%C3%A1_%C5%A1kola_(Stropkov,_Mlynsk%C3%A1_697/7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Areal_skoly.jpg","page_title":"Základná škola (Stropkov, Mlynská 697/7)","context_page_description":"Základná škola Mlynská, Stropkov je základná škola na Mlynskej ulici 7 v Stropkove. Škola je štátna s vyučovacím jazykom slovenským. Škola poskytuje podľa klasifikácií stupeň vzdelania ISCED 1 a ISCED 2. Zriaďovateľom školy je mesto."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%AE%D8%AA_%D8%AF%D8%B1%DA%AF%D8%A7%D9%87_%D9%82%D9%84%DB%8C%E2%80%8C%D8%A8%DB%8C%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/%D8%AA%D8%AE%D8%AA_%D8%AF%D8%B1%DA%AF%D8%A7%D9%87_%D9%82%D9%84%DB%8C%E2%80%8C%D8%A8%DB%8C%DA%AF_7.jpg","page_title":"تخت درگاه قلی‌بیگ","context_page_description":"تخت درگاه قلی بیگ عمارتی است که در جنوب شرقی شهر کرمان و در زاویه جنوبی کوه قلعه دختر قرار دارد. این مکان مقبره یکی از نوادگان بیرام بیگ به نام درگاه قلی بیگ است. درگاه قلی بیگ از امرای اواخر دوره صفویه و رئیس ایل افشار در کرمان بوده‌است. وی، تنها فرد معروف افشار بود که طی ۱۵۰ سال بعد از گنجعلیخان نامش بر سر زبانها بوده‌است.\\nدکتر باستانی پاریزی در این مورد می‌نویسد، درگاه قلی بیگ در کرمان موقعیت مناسبی به دست آورد و قسمتی از سرآسیاب فرسنگی را جزو املاک خود ساخت و در جوار باغ بیرم آباد در دل کوه ساختمان زیبایی به وجود آورد و در پایین کوه نیز دریاچه‌ای ایجاد نمود و آب سرآسیاب فرسنگی را با مجرایی که در دل سنگ کنده بود پایین دریاچه رساند. آثار دریاچه هنوز در کنار تخت باقی است. ژنرال سرپرسی سایکس، در سفرنامه خود دربارهٔ تخت درگاه قلی بیگ چنین می‌نویسد، در زاویه جنوبی این رشته کوه قلعه دختر دهنه‌ای است که سکویی در مدخل آن از سنگ و وسط آن قبر رضا قلی بیگ گماشته ابراهیم خان ظهیرالدوله را بنا کرده‌اند و در قسمت تحتانی آن علایم و آثار حوض بزرگی مشاهده می‌شود که سابق به این وسیله رودخانه بهرام کرد که این ایام باغین را مشروب می‌کند پر می‌شده و در قسمت فوقانی آن دیده‌بانی بر پاست که مأموران به وسیله آن اهالی شهر را از هجوم و یورش افغان‌ها و بلوچ‌ها اطلاع می‌داده‌اند."},{"page_url":"https://en.wikipedia.org/wiki/Franz%C3%B6sisch_Buchholz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Tram_stop_Berlin_Rosenthaler_Str_%282010%29.jpg","page_title":"Französisch Buchholz","context_page_description":"Französisch Buchholz, also known simply as Buchholz, is a German locality within the Berlin borough of Pankow."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_national_fruits","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Jujube_mure.jpg","page_title":"List of national fruits","context_page_description":"This is a list of national fruits arranged alphabetically by country. Some national fruits are officially designated, some are unofficial."},{"page_url":"https://cs.wikipedia.org/wiki/Volby_do_Poslaneck%C3%A9_sn%C4%9Bmovny_Parlamentu_%C4%8Cesk%C3%A9_republiky_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Ivan_Barto%C5%A1_portrait_June_28%2C_2017.jpg","page_title":"Volby do Poslanecké sněmovny Parlamentu České republiky 2017","context_page_description":"Volby do Poslanecké sněmovny Parlamentu České republiky v roce 2017 se uskutečnily 20. a 21. října. Ve volbách zvítězilo hnutí ANO 2011, které získalo 29,64 % hlasů a 78 mandátů. Na druhém místě skončila ODS, jež získala 11,32 % a 25 poslanců. Následovaná byla na třetím místě Českou pirátskou stranou s 10,79 % a na čtvrtém místě SPD s 10,64 %. Obě tyto strany získaly shodně 22 mandátů. V poslanecké sněmovně ještě zasedli zástupci KSČM, ČSSD, KDU-ČSL, TOP 09 a Starostů a nezávislých. Volební účast činila 60,84 % z celkového počtu 8 374 501 registrovaných voličů.\\nObčané České republiky, kteří dosáhli 18 let a nebyli omezeni ve svéprávnosti k výkonu volebního práva, zvolili 200 poslanců do Poslanecké sněmovny, dolní komory Parlamentu České republiky, pomocí systému poměrného zastoupení. Obyvatelé ČR mohli volit i mimo místo svého trvalého bydliště, museli si ale včas vyřídit voličský průkaz.\\nOd roku 1996 šlo o sedmé volby do Poslanecké sněmovny. Kandidovalo 31 stran a hnutí, tedy o 7 více, než při minulých předčasných volbách v roce 2013. Celkem bylo navrženo 7 524 kandidátů a 2 154 z nich byly ženy. Do sněmovny se nakonec dostalo 9 uskupení."},{"page_url":"https://en.wikipedia.org/wiki/Q1_(building)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Q1_building%2C_Gold_Coast%2C_Queensland.jpg","page_title":"Q1 (building)","context_page_description":"Q1 Tower is a 322.5-metre skyscraper in Surfers Paradise, Queensland, Australia. The residential tower on the Gold Coast was the world's tallest residential building from 2005 to 2011. As of 2020 it is the ninth-tallest residential tower in the world and is the tallest building in Australia and the Southern Hemisphere, and the second-tallest free-standing structure in the Southern Hemisphere, behind the Sky Tower in Auckland, New Zealand. The Q1 officially opened in November 2005.\\nThe landmark building was recognised as one of Queensland's icons during the state's 150th-birthday celebrations."},{"page_url":"https://en.wikipedia.org/wiki/Expressivity_(genetics)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Incomplete_Cleft_Lip.png","page_title":"Expressivity (genetics)","context_page_description":"In genetics, expressivity is the degree to which a phenotype is expressed by individuals having a particular genotype. Expressivity is related to the intensity of a given phenotype; it differs from penetrance, which refers to the proportion of individuals with a particular genotype that actually express the phenotype."},{"page_url":"https://ca.wikipedia.org/wiki/Viviane_Reding","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Viviane_Reding_%28Martin_Rulsch%29_01.jpg","page_title":"Viviane Reding","context_page_description":"Viviane Reding és una política luxemburguesa que ha desenvolupat la major part de la seva carrera al Parlament Europeu, de què actualment és membre. Entre 1999 i 2014 va ser membre de la Comissió Europea."},{"page_url":"https://tr.wikipedia.org/wiki/Kimyasal_reaktiflik","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/LewisAcid.png","page_title":"Kimyasal reaktiflik","context_page_description":"Kimyasal reaktiflik, bir reaksiyonun meydana gelme eğilimiyle ilişkilidir. Kimyasal tepkimelerin gerçekleşmesini belirleyen faktörler termodinamik düzeyinde incelenir. Termodinamik olarak bir reaksiyon eğer tepkimenin ürünleri reaktanlara kıyasla daha düşük serbest enerji düzeyinde ise gerçekleşir. Diğer taraftan Reaktiflik ise genel olarak bir maddenin kimyasal değişikliklere ya da kimyasal tepkimelere girme eğilimine denir. Elementlerin atomik yapısı ve elektronlarının dizilişi elementlerin ve oluşturdukları moleküllerin reaktifliğinde önemli rol oynar. Soygazların örneğin kimyasal olarak çok az reaktiflik gösterdiği belirtilir. Dolayısıyla kimyasal bileşik oluşturmaları zordur. Bu durum soygazların tam dolu olan en dış elektron kabuğundan dolayıdır.\\nKimyasal denge, asit ve baz kimyası, elektron aktarımı tepkimesi ve entropi gibi konular kimyasal reaktifliğin temel kavramlarıdır."},{"page_url":"https://id.wikipedia.org/wiki/Sanchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/A_Gate_to_the_Stupa_of_Sanchi_1932.jpg","page_title":"Sanchi","context_page_description":"Stupa Sanchi terletak di Kota Sanchi di Distrik Raisen, Negara Madhya Pradesh, India, dan terletak sekitar 46 km arah timur laut dari Bhopal.\\n' Stupa Agung' di Sanchi adalah bangunan batu tertua di India, aslinya diperintahkan pembangunannya oleh Maharaja Ashoka Agung pada abad ke-3 SM. Stupa ini dimahkotai chatra, struktur seperti payung yang menyimbolkan derajat tinggi dan keagungan, dimaksudkan untuk menghormati relik yang tersimpan di dalam stupa. Pembangunan stupa ini diawasi oleh permaisuri Ashoka, Devi, yang adalah anak perempuan Vidisha. Sanchi juga merupakan kota kelahiran istri Ashoka, serta lokasi Ashoka. Pada abad pertama SM, empat gerbang berhias dan pagar langkan yang mengelilingi stupa ditambahkan.\\nTorana yang terdapat di penjuru kelulung stupa melambangkan cinta, kedamaian, kepercayaan, dan keberanian. Situs Warisan Dunia ini kini dirawat dengan baik, terbuka untuk kunjungan wisatawan dari pukul 8:00 pagi hingga 7:00 malam. Kunjungan ke situs ini menghabiskan waktu kira-kira satu setengah jam, untuk kunjungan non-riset. Mengambil foto diperbolehkan dan tersedia petunjuk audio."},{"page_url":"https://nl.wikipedia.org/wiki/Porthmadog","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Porthmadog_-_Harbour.JPG","page_title":"Porthmadog","context_page_description":"Porthmadog is een kustplaats in het Welse graafschap Gwynedd aan de noordelijke inham van Cardigan Bay.\\nPorthmadog telde bij de census van 2001 4.187 inwoners."},{"page_url":"https://nl.wikipedia.org/wiki/Deborah_Ostrega","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Deborah_ostrega-1511031856.jpg","page_title":"Deborah Ostrega","context_page_description":"Deborah Ostrega is een Belgische presentatrice, actrice en zangeres. Ze is opgegroeid in het Limburgse Beringen."},{"page_url":"https://fr.wikipedia.org/wiki/Extraction_de_l%27uranium","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Uranium-production-1945-2010.svg","page_title":"Extraction de l'uranium","context_page_description":"L’extraction de l'uranium est une industrie minière qui va de la prospection initiale jusqu'au produit transportable, le « yellowcake ». Elle est la première étape du cycle du combustible nucléaire visant à fournir le combustible des réacteurs nucléaires. Elle comprend les opérations successives suivantes :\\nla prospection de nouveaux gisements ;\\nla préparation d'un site pour l'exploitation d'un gisement ;\\nl'extraction du minerai, seul ou en coextraction avec de l'or, du cuivre, du phosphate... ;\\nle traitement du minerai pour concentrer l'uranium sous forme de « yellowcake »,\\nle transport sécurisé du yellow cake,\\nle démantèlement des équipements industriels et la gestion de l'après-mine.\\nEn 2014, les trois premiers pays producteurs d'uranium dans le monde — le Kazakhstan, le Canada et l'Australie — totalisent les deux tiers de la production mondiale. La production d'uranium, qui atteint 56,2 milliers de tonnes la même année, est en baisse de 5,7 % par rapport à 2013."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%81%D0%BA%D0%B8_%D0%B7%D0%B5%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Lepus_europaeus_%28Causse_M%C3%A9jean%2C_Loz%C3%A8re%29-cropped.jpg","page_title":"Европски зец","context_page_description":"Зец или европски зец, дивљи зец, пољски зец је врста сисара из породице зечева. Природни ареал врсте је већи део Европе и део југозападне и централне Азије, људском активношћу врста је уведена у делове Аустралије, као и Јужне и Северне Америке."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D1%80%D0%B8%D1%87%D0%B0%D0%BB%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Disposable_Razor.JPG","page_title":"Бричалка","context_page_description":"Бричалка – вид предмет кој служи за отстранување на несаканите влакна од телото, особено од лицето. Постојат различни видови бричалки како што се трајните, еднократните и електричните бричалки."},{"page_url":"https://cs.wikipedia.org/wiki/Perwurzgupf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Maximilianhube1.JPG","page_title":"Perwurzgupf","context_page_description":"Perwurzgupf je hora v Rottenmannských Taurách na území rakouské spolkové země Štýrsko. Nachází se v hlavním hřebeni asi 7,5 km západojihozápadně od osady Hohentauern. Na severovýchodě jej hluboké sedlo Perwurzpolster odděluje od hory Kleiner Bösenstein a na jihozápadě mělké bezejmenné sedlo od hory Zinkenkogel. Severozápadní svahy hory klesají do údolí potoka Perwurzbach a jihovýchodní do závěru údolí Pölsental. Severozápadně od Perwurzgupfu se pod sedlem Perwurzpolster rozkládá jezero Geißrinksee."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%8A%89%E5%A3%AB%E6%AF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/%E5%8A%89%E5%A3%AB%E6%AF%85.jpg","page_title":"劉士毅","context_page_description":"刘士毅，字仁夫，江西都昌人，中华民国陆军二级上将，炮工、造兵学专业，与新桂系渊源甚深。"},{"page_url":"https://en.wikipedia.org/wiki/Chittagong","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Stacking_Intermodal_container_in_Port_of_Chittagong_%2811%29.jpg","page_title":"Chittagong","context_page_description":"Chittagong, officially Chattogram and known as the Port City of Bangladesh, is a major coastal city and financial centre in southeastern Bangladesh. The city has a population of more than 2.5 million while the metropolitan area had a population of 4,009,423 in 2011, making it the second-largest city in the country. It is the capital of an eponymous District and Division. The city is located on the banks of the Karnaphuli River between the Chittagong Hill Tracts and the Bay of Bengal. Modern Chittagong is Bangladesh's second most significant urban center after Dhaka.\\nChittagong plays a vital role in the Bangladeshi economy. The Port of Chittagong, one of the world's oldest ports, whose coast appeared on Ptolemy's world map, is the principal maritime gateway to the country. The port is the busiest international seaport on the Bay of Bengal and the third busiest in South Asia. The Chittagong Stock Exchange is one of the country's two stock markets. Several Chittagong-based companies are among the largest industrial conglomerates and enterprises in Bangladesh."},{"page_url":"https://es.wikipedia.org/wiki/Amico_Aspertini","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Aspertini_wolfegg.jpg","page_title":"Amico Aspertini","context_page_description":"Amenico Aspertini fue un pintor renacentista - manierista italiano que nació y murió en Bolonia. Considerado uno de los exponentes más brillantes de la llamada Escuela Boloñesa."},{"page_url":"https://nl.wikipedia.org/wiki/Harmonium_Museum_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Harmonium_Museum_Barger_Compascuum_-_collectie_Jules_de_Korte.JPG","page_title":"Harmonium Museum Nederland","context_page_description":"Het Harmonium Museum Nederland is een museum dat gewijd is aan het harmonium, een toetsinstrument dat door middel van luchtdruk muziek voortbrengt. Het werd in 2001 opgericht en is gevestigd in het Veenpark in Barger-Compascuum. Het museum heeft de grootste harmoniumcollectie ter wereld met 250 harmoniums waarvan er 150 opgesteld staan. Daarnaast zijn er uitzonderlijke instrumenten te zien, door hun aard of vroegere bespeler, en is er een grote theaterzaal aanwezig waar zangworkshops en uitvoeringen worden gegeven. Een groot aantal instrumenten in het museum is gerestaureerd en kan bespeeld worden."},{"page_url":"https://pt.wikipedia.org/wiki/Francisco_Rubio","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Frank_Rubio_official_portrait.jpg","page_title":"Francisco Rubio","context_page_description":"Francisco Carlos \\"Frank\\" Rubio é um piloto de helicóptero, cirurgião de voo e astronauta da NASA da turma de 2017."},{"page_url":"https://nl.wikipedia.org/wiki/Hypatia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Hypatia_-_mid_19th_century_engraving.jpg","page_title":"Hypatia","context_page_description":"Hypatia was een Oost-Romeinse wiskundige en filosofe.\\nZij wordt wel de eerste vrouwelijke wiskundige genoemd. Ze leefde in Alexandrië, in Egypte, en doceerde wiskunde en neoplatonische filosofie.\\nHypatia werd door de eeuwen heen op verschillende manieren gezien. Voor de klassieke oudheid stierf Hypatia als de kampioen van traditionele religie en filosofie, die het slachtoffer werd van een vijandig gezind, christelijk regime. Tijdens de Verlichting werd ze gezien als de laatste verdediger van de antieke wereld, toen de klassieke rationaliteit werd overheerst door bijgeloof. In de twintigste eeuw werd ze, bij het dagen van een nieuwe tijd, gezien als voorvechtster van de onafhankelijkheid van vrouwen, tegen een patriarchaat dat de sociale rol van vrouwen en hun carrièremogelijkheden beperkte.\\nZij werd in stukken gereten door een menigte christenen, waarschijnlijk Parabolani. Sommigen beweren dat de patriarch Cyrillus van Alexandrië daar de hand in had.\\nCyrillus kwam in conflict met de Romeinse gouverneur Orestes, nadat Cyrillus jarenlang tegenstanders onder Alexandrijnse groeperingen probeerde uit te schakelen."},{"page_url":"https://it.wikipedia.org/wiki/Janina_Fautz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/MJK_71183_Janina_Fautz_%28arte-Empfang%2C_Berlinale_2020%29.jpg","page_title":"Janina Fautz","context_page_description":"Janina Naomi Fautz è un'attrice tedesca."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Knights_and_Ladies_of_the_Thistle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Charles_Boyle%2C_4th_Earl_of_Orrery_by_Charles_Jervas.jpg","page_title":"List of Knights and Ladies of the Thistle","context_page_description":"The Most Ancient and Most Noble Order of the Thistle was founded in 1687. Dates shown are for election or installation. Probably incomplete.\\nNameImageLifeDateNotes"},{"page_url":"https://ce.wikipedia.org/wiki/NGC_2281","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/NGC_2281.jpg","page_title":"NGC 2281","context_page_description":"NGC 2281 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A3%BD%E6%B0%B7%E7%9A%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Ice_cube_tray.jpg","page_title":"製氷皿","context_page_description":"製氷皿とは、冷凍庫あるいは電気冷蔵庫の冷凍室などで一定した形をもつ氷を同時に大量に作るための容器である。アイストレーともいう。"},{"page_url":"https://en.wikipedia.org/wiki/George_A._Norris","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/FrankForwardBuilding.JPG","page_title":"George A. Norris","context_page_description":"George Alexander Norris was a Canadian artist and sculptor. Norris is best known for his many public sculptures in Vancouver, British Columbia."},{"page_url":"https://gl.wikipedia.org/wiki/Jean_Shrimpton","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Jean_Shrimpton_%281965%29_2.jpg","page_title":"Jean Shrimpton","context_page_description":"Jean Rosemary Shrimpton, nada en High Wycombe o 6 de novembro de 1942, é unha modelo e actriz inglesa. Foi unha icona do Swinging London e é considerada como unha das primeiras supermodelos do mundo.\\nApareceu nas portadas de numerosas revistas como Vogue, Harper Bazar, Vanity Fair, Glamour, Elle, Ladie's Home Journal, Newsweek ou Time. En 2012, Shrimpton foi nomeada por Time como unha das 100 iconas más influentes de toda a historia. En 1967 protagonizou xunto a Paul Jones o filme Privilege."},{"page_url":"https://en.wikipedia.org/wiki/Earl_of_Northampton","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Coat_of_arms_of_the_Marquess_of_Northampton.svg","page_title":"Earl of Northampton","context_page_description":"Earl of Northampton is a title in the Peerage of England that has been created five times."},{"page_url":"https://en.wikipedia.org/wiki/John_Dooley_(politician)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Senator_John_Dooley_%28cropped%29.jpg","page_title":"John Dooley (politician)","context_page_description":"John Braidwood Dooley was an Australian politician who served as a Senator for New South Wales from 1928 to 1935. He was a member of the Australian Labor Party and served as an assistant minister in the Scullin Government."},{"page_url":"https://ms.wikipedia.org/wiki/Graphium_doson","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Commonjay_cat_sec.jpg","page_title":"Graphium doson","context_page_description":"Graphium doson, atau Common Jay, adalah kupu-kupu yang termasuk dalam kelompok keluarga Papilionidae dan sub-keluarga Papilioninae. Ia mempunyai lebar sayap sekitar 50–65 mm."},{"page_url":"https://no.wikipedia.org/wiki/K%C3%B8benhavn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/S%C3%B8ndre_Frihavn_K%C3%B8benhavn.jpg","page_title":"København","context_page_description":"København er hovedstaden i Danmark og er med 1 375 995 innbyggere i 2014 landets største byområde. Dette omfatter helt eller delvis 18 kommuner. Sentrum for byområdet utgjøres av Københavns kommune som med sine 605 985 innbyggere er Danmarks mest folkerike. I hele den 3 030 km² store Hovedstadsregionen, som også sammenfaller med Københavns lokaltrafikkområde, bor det ca. 1,9 millioner mennesker. Den danske hovedstad er i tillegg sentrum for Øresundsregionen som inkluderer Malmö. Øresundsregionen dekker 20 649 km² av Danmark og Sverige og har 2,5 millioner innbyggere i Danmark og 3,7 millioner innbyggere når også den svenske delen regnes med. Denne regionen er blant Europas fremste sentra for innovasjon, bioteknologi og andre kompetansenæringer.\\nKøbenhavn ligger på Sjællands østkyst og strekker seg inn over deler av Amager i øst. En rekke broer og en tunnel forbinder bydelene på Sjælland og Amager. Siden 2000 har København og Malmö vært forbundet via Øresundsforbindelsen.\\nI København finnes Danmarks sentrale institusjoner som Folketinget, kongehuset, høyesterett og den statlige sentraladministrasjonen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BC%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_(%D0%BB%D0%B0%D0%BD%D0%B4%D1%88%D0%B0%D1%84%D1%82%D0%BD%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/%D0%9B%D0%B8%D0%BC%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B0%D0%BD%D0%B4%D1%88%D0%B0%D1%84%D1%82%D0%BD%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA_192.jpg","page_title":"Лиманський (ландшафтний заказник)","context_page_description":"Лима́нський зака́зник — ландшафтний заказник місцевого значення в Україні."},{"page_url":"https://de.wikipedia.org/wiki/Geschwister_Weisheit","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Dresden-Geschwister-Weisheit.jpg","page_title":"Geschwister Weisheit","context_page_description":"Die Geschwister Weisheit sind eine Künstlerfamilie aus Siebleben, einem Ortsteil von Gotha in Thüringen. Sie präsentieren seit 1900 in mehreren Generationen Hochseilartistik.\\nDabei vollführen die Mitglieder der Seiltänzertruppe eine Fünf-Personen-Pyramide als Drahtseilakt auf dem Hochseil. Auch eine sogenannte Steilseildarbietung ohne Netz mit und ohne Balancierstange gehört zu ihrem Repertoire, ebenso wie die Motorradshow mit zehn Artisten und drei Motorrädern in bis zu 40 m Höhe. Auch ein Original-Formel-E-Rennwagen in 30 m Höhe auf doppelt gespanntem Drahtseil ist Bestandteil ihres Programms.\\nGegründet wurde die Truppe von Friedrich Wilhelm Weisheit, die zweite Generation wurde von seinem Sohn Lorenz Weisheit geführt, dem Vater des jetzigen Chefs, Rudi Weisheit."},{"page_url":"https://fi.wikipedia.org/wiki/Arao","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/%E5%B2%A9%E6%9C%AC%E7%9C%BC%E9%8F%A1%E6%A9%8B_-_panoramio.jpg","page_title":"Arao","context_page_description":"Arao on Japanin kaupunki Kyūshūn saarella Kumamoton prefektuurissa. Se sijaitsee prefektuurin luoteisosassa Ariakenmeren rannalla ja rajautuu pohjoisessa Fukuokan prefektuurin Ōmutan kaupunkiin, jonka kanssa se muodostaa yhtenäisen kaupunkialueen. Araossa on 52 315 asukasta ja sen pinta-ala on 57,37 neliökilometriä.\\nArao alkoi kehittyä voimakkaasti kaivoskaupunkina sen jälkeen, kun Miiken hiilikaivoksen Mandan kaivos avattiin sinne vuonna 1897. Toisen maailmansodan aikana ja sodan jälkeen sinne sijoittui myös muun muassa kemianteollisuutta. Silloiselle Araon maaseutukaupungille myönnettiin kaupunkioikeudet vuonna 1942, kun siihen liitettiin neljä muuta kuntaa. Myöhemmin kaupungin hiilikaivokset on suljettu. Miiken kaivos lisättiin vuonna 2015 Unescon maailmanperintöluetteloon osana kohdetta ”Meiji-kauden Japanin teollisen vallankumouksen sijaintipaikat: rauta ja teräs, laivanrakennus ja kivihiili”. Kaupungin muita elinkeinoja ovat vanhastaan olleet omenapäärynöiden ja mikan-mandariinien viljely. Kaupungissa toimii myös Greenland-huvipuisto.\\nAraota palvelee JR Kyūshūn Kagoshima-päälinja."},{"page_url":"https://de.wikipedia.org/wiki/Arabischer_Fr%C3%BChling","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Destruction_in_Homs_%282%29.jpg","page_title":"Arabischer Frühling","context_page_description":"Als Arabischer Frühling oder auch Arabellion wird eine im Dezember 2010 beginnende Serie von Protesten, Aufständen und Revolutionen in der Arabischen Welt bezeichnet. Diese richten sich, beginnend mit der Revolution in Tunesien, in etlichen Staaten im Nahen Osten und in Nordafrika gegen die dort autoritär herrschenden Regime und die politischen und sozialen Strukturen dieser Länder. Ursprünglich war der Begriff positiv besetzt und man erhoffte sich Verbesserung in Hinblick auf die Menschenrechtslage in den betroffenen Ländern; mittlerweile hat sich dieses Bild ins Gegenteil verkehrt."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Nagaokaky%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Nagaokakyo_stn.jpg","page_title":"Gare de Nagaokakyō","context_page_description":"La gare de Nagaokakyō est une gare ferroviaire localisée dans la ville de Nagaokakyō, dans la préfecture de Kyoto au Japon. La gare est exploitée par la JR West.\\nLa gare de Nagaokakyō est l'une des deux gares de la ville de Nagaokakyō. La seconde est la gare de Nagaoka-Tenjin qui est exploitée par la Hankyu Corporation."},{"page_url":"https://es.wikipedia.org/wiki/Fuensanta_Nieto","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/%28Fuensanta_Nieto_de_la_Cierva%29_Medallas_de_Oro_al_M%C3%A9rito_a_las_Bellas_Artes_%28cropped%29.jpg","page_title":"Fuensanta Nieto","context_page_description":"Fuensanta Nieto de la Cierva, es una arquitecta española de la generación que a partir de los años noventa adquire prestigio nacional e internacional a través de concursos públicos de arquitectura; con diversos premios y condecoraciones entre ellas la medalla Alvar Aalto, concedido por el museo finlandés de arquitectura y la Asociación Finlandesa de Arquitectos.​​​"},{"page_url":"https://it.wikipedia.org/wiki/Urio","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Chiesa_dei_santi_Quirico_e_Giulitta_02.jpg","page_title":"Urio","context_page_description":"Urio è una frazione del comune comasco di Carate Urio, alla cui denominazione contribuisce."},{"page_url":"https://en.wikipedia.org/wiki/Jacob_Rabinow","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/RabinowJacob_006.jpg","page_title":"Jacob Rabinow","context_page_description":"Jacob Rabinow was an engineer and inventor. He earned a total of 229 U.S. patents on a variety of mechanical, optical and electrical devices."},{"page_url":"https://fr.wikipedia.org/wiki/Rosi%C3%A8res-en-Santerre","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/LCH_338_-_ROSIERES_-_Int%C3%A9rieur_de_la_Gare.JPG","page_title":"Rosières-en-Santerre","context_page_description":"Rosières-en-Santerre est une commune française située dans le département de la Somme en région Hauts-de-France."},{"page_url":"https://es.wikipedia.org/wiki/Elecci%C3%B3n_presidencial_de_Croacia_de_1997","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/FranjoTudman.JPG","page_title":"Elección presidencial de Croacia de 1997","context_page_description":"Las elecciones presidenciales se celebraron en Croacia el 15 de junio de 1997.​ Eran las segundas elecciones presidenciales desde la independencia en 1991. El resultado fue una victoria para el presidente en funciones Franjo Tuđman, dirigente del partido Unión Democrática Croata, quién recibió 61.41% del voto y era re-elegido a un segundo cinco año plazo. Tuđman recibió la mayoría de los votos válidos sin necesidad del balotaje. Tuđman recibió una mayoría de los votos en 20 de los 21 condados de Croacia, mientras Vlado Gotovac solo logró ganar en Istria.\\nLa participación fue de 54.62%, lo cual era una disminución grande comparado con el 74.9% de cinco años atrás. Además, aproximadamente 459 000 votos menos estuvieron en comparación a la elección de 1992.​ Las elecciones también presentaron el número más pequeño de candidatos a la presidencia, participando solamente tres: Franjo Tuđman, Zdravko Tomac y Vlado Gotovac. El margen de victoria es también el más grande en cualquier elección de Croacia.\\nTuđman juró para un segundo mandato el 5 de agosto de 1997."},{"page_url":"https://sk.wikipedia.org/wiki/Budakeszk%C3%BD_okres","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Budakeszi_j%C3%A1r%C3%A1s.png","page_title":"Budakeszký okres","context_page_description":"Budakeszký okres je okres v severnom Maďarsku v Peštianskej župe. Jeho správnym centrom je mesto Budakeszi."},{"page_url":"https://it.wikipedia.org/wiki/Ravenala_madagascariensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Ravenala_madagascariensis_1.jpg","page_title":"Ravenala madagascariensis","context_page_description":"L'albero del viaggiatore o palma del viaggiatore è una pianta erbacea ad alto fusto, endemica del Madagascar, appartenente alla famiglia delle Strelitziaceae.\\nDeve il suo nome al fatto che le sue caratteristiche foglie a ventaglio, la cui base a forma di coppa raccoglie l'acqua piovana, sono utilizzate dai viaggiatori per dissetarsi.\\nErroneamente assimilata alle palme, è in realtà una pianta erbacea ad alto fusto, al pari del banano."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%BF%D0%B5%D1%80%D0%B5%D0%BD%D1%96_%D0%B4%D0%B8%D0%BD%D0%BE%D0%B7%D0%B0%D0%B2%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Jinfengopteryx_elegans_2.JPG","page_title":"Оперені динозаври","context_page_description":"Пір'яний покрив був поширений у ряду груп динозаврів. Довгі роки учені припускали наявність оперення у деяких родин хижих динозаврів, які можуть бути споріднені предкам сучасних птахів, але прямі докази наявності пір'я у динозаврів з'явилися тільки в середині 90-х років XX століття, коли у китайській провінції Ляонін було знайдено рештки дрібного хижого динозавра з відбитками пір'яного покриву.\\nНині наявність пір'яного покриву твердо встановлена у представників 8 родин хижих динозаврів, що належать до підряду теропод. Ряд учених вважає, що пір'яний покрив спочатку виконував функцію теплоізоляції, захищаючи тварин від холоду і перегрівання, надалі у деяких видів динозаврів подовжене пір'я на передніх кінцівках стало виконувати демонстраційні функції в шлюбний період, а згодом, використовуватися деревними видами для ширяння.\\nХарактер пір'яного покриву відрізнявся у різних груп динозаврів. Деякі види були покриті дрібним волосовидним пухом, що нагадує шерсть ссавців, інші мали на хвості і передніх кінцівках довге пір'я, з жорстким центральним стержнем і розгалуженими борідками як у сучасних птахів."},{"page_url":"https://de.wikipedia.org/wiki/Zielona_G%C3%B3ra","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ivano-Frankivsk_coa.png","page_title":"Zielona Góra","context_page_description":", deutsch Grünberg in Schlesien, ist eine Großstadt mit über 140.000 Einwohnern und neben Gorzów Wielkopolski eine der beiden Hauptstädte der polnischen Woiwodschaft Lebus. Sie ist kreisfreie Stadt, Universitätsstadt und römisch-katholischer Bischofssitz. Darüber hinaus ist Zielona Góra die Kreisstadt des Powiat Zielonogórski."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%AA%D9%8A%D9%81%D8%A7%D9%86%D9%88_%D8%AC%D8%A7%D8%B1%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Nino_Garris_2006.jpg","page_title":"ستيفانو جاريس","context_page_description":"ستيفانو جاريس ‏ هو لاعب كرة السلة ألماني، ولد في بادربورن، شارك في بطولة كأس العالم لكرة السلة 2002، وبطولة أمم أوروبا لكرة السلة 2001، وبطولة أمم أوروبا لكرة السلة 2003، مركز لعبه هو لاعب هجوم صغير الجسم."},{"page_url":"https://pl.wikipedia.org/wiki/Polskoj%C4%99zyczne_stacje_telewizyjne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/FilmBox_Premium_HD_logo.png","page_title":"Polskojęzyczne stacje telewizyjne","context_page_description":"Historia telewizji w Polsce sięga 1937 roku, kiedy to w Warszawie uruchomiona została pierwsza doświadczalna stacja telewizyjna. W październiku 1952 roku emisję regularnego programu rozpoczął nadawca publiczny – Telewizja Polska. Od 1970 nadawany jest Program 2 telewizji publicznej, a od 1992 – program satelitarny dla Polonii zagranicznej.\\nRynek telewizji prywatnej rozwija się w Polsce od początku lat 90. Wtedy to funkcjonowanie rozpoczęły pierwsze prywatne stacje telewizyjne o zasięgu lokalnym, a następnie satelitarna telewizja Polsat, która w 1994 uzyskała ogólnopolską koncesję na nadawanie naziemne.\\nKolejnymi prywatnymi nadawcami rozpowszechniającymi program tą drogą były stacje: TVN, Nasza TV, TV Niepokalanów oraz płatna telewizja Canal+. Pojawiać się zaczęły również kolejne programy satelitarne. Wśród nich także – od połowy lat 90. – pierwsze kanały tematyczne zagranicznych nadawców emitowane w języku polskim.\\nObecnie na polskim rynku telewizyjnym działa prawie 200 kanałów o zasięgu ogólnokrajowym nadawanych przede wszystkim drogą satelitarną, z których dominująca część posiada charakter kanałów tematycznych."},{"page_url":"https://da.wikipedia.org/wiki/Maierh%C3%B6fen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Maierhoefen_im_Landkreis_Lindau.png","page_title":"Maierhöfen","context_page_description":"Maierhöfen er en kommune i Landkreis Lindau, i regierungsbezirk Schwaben, i den tyske delstat Bayern. Den er en del af Verwaltungsgemeinschaft Argental."},{"page_url":"https://en.wikipedia.org/wiki/City_Park_West,_Denver","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Looking_west_down_22nd_Street%2C_City_Park_West%2C_Denver_CO.jpg","page_title":"City Park West, Denver","context_page_description":"City Park West is a neighborhood of Denver, Colorado. It is a district of mostly single-family homes, small apartment buildings, and one very large hospital complex. The center of the district features the medical facilities of Presbyterian/St. Luke's Hospital, Exempla St. Joseph's Hospital, and a number of other medical office buildings and related facilities. Exempla Saint Joseph's Hospital has embarked on a major\\nexpansion project to create the newest, most modern hospital in Colorado. The new facility opened in December 2014.\\nLike many of Denver's Center City districts, City Park West is experiencing a number of smaller, multi-family infill projects on vacant or underutilized lots in among the mature landscape and classic early-20th century homes for which the district is known. Also, the stretch of East Colfax along City Park West's southern boundary is showing evidence of new vitality and investment with great potential for additional infill projects along that important commercial corridor."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%89%E6%96%AF%E5%9F%8E%E5%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Cour_guise.jpg","page_title":"吉斯城堡","context_page_description":"吉思城堡是一座经过多次改建的城堡，位于法国北方上法兰西大区埃纳省的吉斯市。最初建于十世纪，在十六世纪改建成要塞。半毁于一战的战火，现为当地的历史景点。"},{"page_url":"https://pl.wikipedia.org/wiki/Encore_Las_Vegas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/EncoreResortCasino.JPG","page_title":"Encore Las Vegas","context_page_description":"Encore Las Vegas lub Encore at Wynn Las Vegas – superluksusowy hotel i kasyno, położony przy ulicy Las Vegas Strip w Paradise, w stanie Nevada. Encore jest powiązany z siostrzanym kompleksem Wynn Las Vegas; oba są bowiem własnością Wynn Resorts Limited, zarządzanego przez Steve'a Wynna.\\nEncore otrzymał ocenę pięciu diamentów AAA i uważany jest za jeden z najbardziej luksusowych hoteli na świecie. Należące do kompleksu spa oraz Tower Suites, czyli apartamenty położone w odseparowanej części głównej wieży hotelowej, uzyskały również pięciogwiazdkową ocenę Forbesa w 2010 roku. Encore oraz Wynn zdobyły najwięcej pięciogwiazdkowych nagród Forbesa ze wszystkich obiektów wypoczynkowych oraz kasyn na świecie."},{"page_url":"https://cs.wikipedia.org/wiki/Narni","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Narnirocca.JPG","page_title":"Narni","context_page_description":"Narni je historické město s 20 tisíci obyvateli ve střední Itálii, v Umbrii, asi 67 km jižně od Perugie. Přes Narni vedla hlavní silnice do Říma, Via Flaminia, která zde překračovala řeku Nar. Z mostu, který dal postavit císař Augustus roku 14 př. n. l., se zachoval krajní oblouk."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%AB%E3%82%BA%E3%83%90%E3%83%BC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Artistic_rendering_of_a_Sasanian_spahbed.jpg","page_title":"マルズバーン","context_page_description":"南西アジア史、より詳細には、イラン世界の歴史において、マルズバーン又はマルズパーンは、古代ないし中世の時代に用いられた、国境地帯や辺境地域の総督、太守、あるいは辺境伯を意味する称号である。アルシャク朝パルティアやサーサーン朝ペルシア帝国が設定した階級であるが、単なる一軍の長に留まらず、拡大された権限が与えられていた。プロコピオスによると東ローマ帝国のストラテゴスに相当する地位であるという。"},{"page_url":"https://pt.wikipedia.org/wiki/Horn%C3%A9_Trhovi%C5%A1te","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Horn%C3%A9_Trhovi%C5%A1te_kostol_03.jpg","page_title":"Horné Trhovište","context_page_description":"Horné Trhovište é um município da Eslováquia, situado no distrito de Hlohovec, na região de Trnava. Tem 7,54 km² de área e sua população em 2018 foi estimada em 596 habitantes."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%83%83%E3%83%8F%E3%82%A6%E5%BC%B7%E5%88%B6%E5%8F%8E%E5%AE%B9%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/KZDachau1945.jpg","page_title":"ダッハウ強制収容所","context_page_description":"ダッハウ強制収容所は、ドイツ・バイエルン州・ミュンヘンの北西15キロほどのところにある都市ダッハウに存在したナチス・ドイツの強制収容所である。ナチスの強制収容所の中ではオラニエンブルク強制収容所と並んで最も古い強制収容所と言われ、後に創設された多くの強制収容所のモデルとなった。「ダハウ強制収容所」と書かれる事もある。\\n現在、別館については、難民をはじめとするホームレスの保護施設として使用されている。"},{"page_url":"https://en.wikipedia.org/wiki/Whitstone_and_Bridgerule_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Whitstone_and_Bridgerule_station_-_geograph.org.uk_-_727855.jpg","page_title":"Whitstone and Bridgerule railway station","context_page_description":"Whitstone and Bridgerule was a railway station on the Bude Branch that closed in 1966. The station was opened in 1898 by the London and South Western Railway when the line was extended from Holsworthy station to the new terminus of the line at Bude.\\nThe station had been proposed for closure in the Beeching Report. The station sat inconveniently between the settlements of Bridgerule in Devon and Whitstone in Cornwall."},{"page_url":"https://es.wikipedia.org/wiki/Gentiana_scabra","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Gentiana_scabra_var._buergeri_03.jpg","page_title":"Gentiana scabra","context_page_description":"Gentiana scabra es una especie de planta herbácea perteneciente a la familia, se encuentra en Estados Unidos y Japón. Florece en julio y agosto con flores de color azul o azul oscuro."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D8%AE%D8%A7%D9%86%D9%87_%DA%86%D8%B1%D9%85%E2%80%8C%D8%B3%D8%A7%D8%B2%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%D8%AF%D9%88%D8%AF_%DA%A9%D8%B4_%D8%B3%D8%A7%D8%A8%D9%82_%DA%A9%D8%A7%D8%B1%D8%AE%D8%A7%D9%86%D9%87_%DA%86%D8%B1%D9%85_%D8%B3%D8%A7%D8%B2%DB%8C.jpg","page_title":"کارخانه چرم‌سازی","context_page_description":"کارخانه چرم سازی یا کارخانهٔ چرم‌سازی خسروی مربوط به اوایل دوره پهلوی اول است و در تبریز، تقاطع خیابان شریعتی جنوبی و آزادی واقع شده و این اثر در تاریخ ۱۶ مهر ۱۳۷۹ با شمارهٔ ثبت ۲۷۹۱ به‌عنوان یکی از آثار ملی ایران به ثبت رسیده‌است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BA%D0%B8%D1%81%D0%BB%D0%BE%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Mycobacterium_mycolic_acids.svg","page_title":"Миколовые кислоты","context_page_description":"Микóловые кислóты — обобщённое название группы длинноцепочечных разветвлённых жирных кислот, имеющие общую формулу R₁-CHOH-CHR₂-COOH, с перекрестными сшивками, содержащие по 60-90 атомов углерода в молекуле. Являются исключительным компонентом клеточной стенки микобактерий, включая патогенную Mycobacterium tuberculosis. Выполняют защитную функцию, благодаря низкой реакционной способности этих кислот, которые делают поверхность микобактерий воскообразной и сильно гидрофобной, а также очень устойчивой к негативному внешнему воздействию. Это способствует их выживанию в экстремальных условиях. Миколовые кислоты M.tuberculosis являются самыми длинными и имеют наибольшие боковые цепи. Большинство миколовых кислот также содержат различные функциональные группы. Впервые были выделены в 1938 году Андерсоном, Стодолой и Лесюком на кафедре химии Йельского университета из экстракта M.tuberculosis."},{"page_url":"https://no.wikipedia.org/wiki/Tyskland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Bundesarchiv_B_145_Bild-F057884-0009%2C_Willy_Brandt.jpg","page_title":"Tyskland","context_page_description":"Tyskland, offisielt Forbundsrepublikken Tyskland, er et land i Sentral-Europa. Landet er en føderasjon av 16 delstater og er et av verdens største industriland. Tyskland grenser i nord mot Nordsjøen, Danmark og Østersjøen, i øst mot Polen og Tsjekkia, i sør mot Østerrike og Sveits og i vest mot Frankrike, Luxembourg, Belgia og Nederland. Tyskland er det største medlemslandet i Den europeiske union målt i BNP.\\nMed ca. 83,1 millioner innbyggere er Tyskland Europas mest folkerike land, dersom man ser bort fra Russland, som delvis ligger i Asia."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%BE%D0%B1%D0%B5%D1%88%D0%B8%D0%BD_(%D0%9C%D0%B0%D0%B7%D0%BE%D0%B2%D0%B5%D1%86%D1%8C%D0%BA%D0%B5_%D0%B2%D0%BE%D1%94%D0%B2%D0%BE%D0%B4%D1%81%D1%82%D0%B2%D0%BE)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Ko%C5%9Bci%C3%B3%C5%82_w_Dobieszynie.jpg","page_title":"Добешин (Мазовецьке воєводство)","context_page_description":"Добешин — село в Польщі, у гміні Стромець Білобжезького повіту Мазовецького воєводства.\\nНаселення — 425 осіб.\\nУ 1975-1998 роках село належало до Радомського воєводства."},{"page_url":"https://en.wikipedia.org/wiki/List_of_municipal_flags_of_Ch%C5%ABbu_region","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Flag_of_Tochio_Niigata.JPG","page_title":"List of municipal flags of Chūbu region","context_page_description":"This page lists the municipal flags of Chūbu region, Japan. It is a part of the List of Japanese municipal flags, which is split into regions due to its size."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%A2n_v%E1%BA%ADn_%C4%91%E1%BB%99ng_Olympic","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Eisstadion_Badrutts_Park.JPG","page_title":"Sân vận động Olympic","context_page_description":"Sân vận động Olympic là tên thường gọi dành cho sân vận động chính của một kỳ Thế vận hội. Sân Olympic thường được sử dụng để tổ chức lễ khai mạc và lễ bế mạc. Nhiều, nhưng không phải tất cả, các địa điểm này có bao gồm từ Sân vận động Olympic trong tên của sân.\\nSân vận động Olympic thường được sử dụng như một sân vận động đa năng nơi tổ chức các môn của Thế vận hội.\\nTại Thế vận hội Mùa hè, các nội dung môn điền kinh thường được tổ chức tại Sân vận động Olympic. Ngoại lệ vào Thế vận hội Mùa hè 1900 và 2016 cũng như tại Thế vận hội trẻ Mùa hè 2010 và 2018.\\nMột số sân vận động đã được sử dụng tại hơn một Thế vận hội, ở những thành phố đã tổ chức Đại hội nhiều hơn một lần.\\nLysgårdsbakkene là sân vận động chính của một kỳ Thế vận hội Mùa đông và một kỳ Thế vận hội trẻ Mùa đông. Bergiselschanze là sân vận động chính của hai kỳ Thế vận hội Mùa đông và một kỳ YOG Mùa đông. Olympiahalle cũng có cùng số lần là sân vận động Olympic như Bergiselschanze trong hai kỳ Thế vận hội Mùa đông, nhưng chưa từng tổ chức YOG Mùa đông. Chỉ có một sân vận động, Los Angeles Memorial Coliseum, là sân vận động chính của hai kỳ Thế vận hội Mùa hè."},{"page_url":"https://en.wikipedia.org/wiki/Roberto_Clemente","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Pirates_21RC.png","page_title":"Roberto Clemente","context_page_description":"Roberto Enrique Clemente Walker was a Puerto Rican professional baseball right fielder who played 18 seasons in Major League Baseball for the Pittsburgh Pirates. He was inducted into the National Baseball Hall of Fame in 1973, becoming both the first Latin American and Caribbean player to be enshrined. His untimely death established the precedent that, as an alternative to the five-year retirement period, a player who has been deceased for at least six months is eligible for entry into the Hall of Fame.\\nClemente was an All-Star for 13 seasons, playing in 15 All-Star Games. He was the National League Most Valuable Player in 1966, the NL batting leader in 1961, 1964, 1965, and 1967, and a Gold Glove Award winner for 12 consecutive seasons from 1961 through 1972. His batting average was over .300 for 13 seasons and he had 3,000 hits during his major league career. He also was a two-time World Series champion. Clemente is the first Latin American and Caribbean player to win a World Series as a starting position player, to receive an NL MVP Award, and to receive a World Series MVP Award."},{"page_url":"https://hu.wikipedia.org/wiki/Neptunusz_(bolyg%C3%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Neptune.jpg","page_title":"Neptunusz (bolygó)","context_page_description":"A Neptunusz a Naptól számítva a nyolcadik, legkülső bolygó a Naprendszerben. Csillagrendszerünk négy óriásbolygója közül a méretét tekintve az utolsó, a tömegét nézve viszont az Uránuszt megelőzve a harmadik legnagyobb. Színe miatt Neptunusról, a tengerek római istenéről nevezték el. Jele az isten háromágú szigonyát jelképezi. 14 ismert holdja van, ezek közül a két ismertebb a Nereida és a Triton."},{"page_url":"https://en.wikipedia.org/wiki/Kim_Tae-woo_discography","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/20170916_Kim_Tae_Woo_concert.jpg","page_title":"Kim Tae-woo discography","context_page_description":"This is the discography of South Korean singer Kim Tae-woo. Debuting in 1999 as a member of the group g.o.d, he began his solo career in 2006 and has since recorded seven studio albums."},{"page_url":"https://de.wikipedia.org/wiki/Polarforschung","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Polarstern_rothera_hg.jpg","page_title":"Polarforschung","context_page_description":"Als Polarforschung wird die wissenschaftliche Erkundung der Polargebiete Arktis und Antarktis bezeichnet. Ihren Beginn kann man auf etwa das 18. Jahrhundert ansetzen. Forschungsthemen waren vor allem die Meteorologie, die Geophysik, die allgemeine Geographie und die Meereskunde.\\nIn der Arktis ging es anfänglich vor allem um die Entdeckung neuer Landgebiete bzw. Wasserwege und um kürzere Verbindungen von Europa nach Asien. Als sich gezeigt hatte, dass der direkte Weg über den Nordpol nicht eisfrei war, begaben sich viele Expeditionen auf die Suche nach der Nordostpassage bzw. der Nordwestpassage.\\nIm Süden stand hingegen die Erforschung des 1772 entdeckten Kontinents Antarktika im Vordergrund. Ende des 19. und Anfang des 20. Jahrhunderts wurde die Bezwingung der geografischen Pole zum Hauptthema. Gleichzeitig begann eine Entwicklung zur umfassenden, interdisziplinären Erforschung der Polargebiete mit Schwerpunkten in der Geophysik, Ozeanografie, Glaziologie und Biologie."},{"page_url":"https://sl.wikipedia.org/wiki/Prizori%C5%A1%C4%8Da_lige_NHL","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/PengrowthSaddledomeNight.jpg","page_title":"Prizorišča lige NHL","context_page_description":"Seznam prizorišč lige NHL, ki vključuje pretekle, sedanje in prihodnje dvorane."},{"page_url":"https://de.wikipedia.org/wiki/Esca_(Weinbau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/ESCA_Blattsymptom_1.JPG","page_title":"Esca (Weinbau)","context_page_description":"Bei der Esca-Krankheit handelt es sich um eine komplexe Abbaukrankheit von Weinreben die in den letzten drei Jahrzehnten weltweit stark zugenommen hat. Sie ist eine der gefährlichsten Rebholzkrankheiten. Die Bezeichnung Esca leitet sich aus dem Lateinischen ab und bedeutet Zunder – ein Hinweis auf die zunderähnliche Konsistenz des Holzes im späten Krankheitsstadium. Sie wird von verschiedenen holzzersetzenden Pilzen verursacht. Seit den 1990er Jahren verbreitet sich die Esca Krankheit zunehmend in den nördlichen Weinbauregionen. Die Krankheit ist gefährlich, weil sie zum Absterben der Rebstöcke führen kann."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%91%AA%E9%9B%85%E6%96%87%E6%98%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/D%C3%ADa_Internacional_de_los_Pueblos_Ind%C3%ADgenas_%287852553230%29.jpg","page_title":"瑪雅文明","context_page_description":"馬雅文明是中部美洲古文明，主要分布於墨西哥東南部、瓜地馬拉、貝里斯、宏都拉斯和薩爾瓦多西部地區，以馬雅人而得名。其分布區域大致分為三部分：北部的低地，包括猶加敦半島在內；中部的高地，分布有恰帕斯馬德雷山脈；南部的太平洋海岸平原。馬雅文明的技術基本處於新石器時代和銅石並用時代的水平，但卻在天文學、曆法、數學、藝術、建築及文字等方面有極高成就。\\n馬雅文明最早形成於約公元前2000年之前，在那時，農業得到最初發展，出現了早期聚落。根據中部美洲斷代史的劃分，馬雅文明在前古典期發展出最早的複雜社會，出現定居的農業生活，玉米、豆類、南瓜和辣椒是其主要作物。前750年前後，出現早期的城市，至前500年已經建成祭祀建築，建起外牆經精心粉刷的大型神廟；前3世紀出現象形文字系統。到前古典期晚期，佩滕盆地和瓜地馬拉高地上已建立起多個大型城市。馬雅文明在古典期步入繁盛，各地較大規模的居民點數以百計，部分城市形成城邦，其間以複雜的貿易網相聯繫，北部低地的提卡爾和卡拉克穆爾城邦逐漸崛起。不過，分布於今墨西哥中部的特奧蒂瓦坎文明也在此時期對馬雅城邦展開侵略。9世紀，馬雅文明的中部地區突然出現集體性的政治崩潰，是為古典期衰落，引發連年內亂，大量城市陷入廢棄，人口開始北移。到後古典期，來自墨西哥腹地的托爾特克人征服了馬雅地區北部的猶加敦半島，建立起強大的奇琴伊察城邦，後又有好戰的馬雅潘和基切王國建立霸權統治，好戰之風導致戰亂頻仍，馬雅文化趨於衰敗。16世紀，西班牙殖民帝國征服中部美洲，逐步征服馬雅各邦，1697年，最後一個馬雅城邦諾赫佩滕陷落，馬雅文明就此滅亡。\\n在馬雅文明興盛的古典期，各城邦的領袖稱為「聖主」，聯繫人神兩界，地位世襲，長子是首要繼承人；王位的有力候選人通常善於作戰。馬雅城邦政治架構主要為互相制約的緊密體系，不過具體情況依不同城邦而有所分別。到古典時代晚期，貴族影響力加大，聖主不再大權獨攬。馬雅城市大多沒有規則的發展方式，城市中心既是祭祀中心，亦為行政中心，周圍被不規則的居民區包圍。城市的不同區域由路網連接。城市的主要建築包括宮殿、金字塔寺廟、蹴球場和天文觀測台等。馬雅文明發展出了高度複雜的藝術形式，廣泛運用各種工藝原料，如木材、玉石、黑曜石、陶器和石碑等。馬雅精英富於涵養，其創製的象形文字體系馬雅文字是前哥倫布時代美洲唯一成熟的書寫系統，常見於石碑和陶器。馬雅人主要使用折頁書本記錄其歷史和文化，稱為馬雅手抄本，但大部分書籍都被西班牙人摧毀，現存且不具有爭議的馬雅書面史料僅餘三冊。馬雅人發展出了高度精密的曆法系統，且在數學領域也有較高造詣，先於歐洲人引入「零」的概念。\\n18世紀末，馬雅文明開始得到傳統學術界注意，19世紀末，一批重要遺址得到發掘，馬雅文明的現代考古學研究拉開序幕。到20世紀30年代以後，馬雅文明的研究進展較快，形成專門的馬雅學學科。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D0%B5%D0%BD%D1%81%D1%96%D0%BB%D1%8C%D0%B2%D0%B0%D0%BD%D1%81%D0%BA%D1%96_%D1%9E%D0%BD%D1%96%D0%B2%D0%B5%D1%80%D1%81%D1%96%D1%82%D1%8D%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Upenn-shield.png","page_title":"Пенсільванскі ўніверсітэт","context_page_description":"Пенсільванскі ўніверсітэт або Універсітэт Пенсільваніі — прыватны ўніверсітэт у горадзе Філадэльфія, штат Пенсільванія, заснаваны ў 1740 годзе Бенджамінам Франклінам. Пенсільванскі ўніверсітэт — адна з найстарэйшых вышэйшых навучальных устаноў і першы ўніверсітэт у ЗША.\\nНягледзячы на назву, універсітэт з'яўляецца прыватным і яго часам блытаюць з дзяржаўным Дзяржаўным універсітэтам штата Пенсільванія, размешчаным у горадзе Стэйт Каледж, а таксама з Філадэльфійскім універсітэтам.\\nУ 2011 годзе ўніверсітэт прыняў 12.3 % абітурыентаў, якія падалі дакументы на бакалаўрыят. Гэта быў рэкордна нізкі працэнт прынятых на першы курс студэнтаў за ўсю гісторыю існавання ўніверсітэта.\\nБенджамін Франклін, заснавальнік універсітэта, прапагандаваў адукацыйную праграму, якая б факусавалася на практычна карыснай адукацыі для гандлю і грамадскай службы, быўшы ў той жа час сфакусаваным на класіцы.\\nШкола бізнесу Уортана, адна з самых прэстыжных і вядомых бізнес-школ свету, з'яўляецца часткай Пенсільванскага ўніверсітэта.\\nПры ўніверсітэце з канца XIX стагоддзя існуе Музей археалогіі і антрапалогіі Пенсільванскага ўніверсітэта."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E6%97%A5%E6%9C%AC%E6%94%BE%E9%80%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/JOCF-TV_Analog_TV_Transmitting_Tower_2009.jpg","page_title":"南日本放送","context_page_description":"株式会社南日本放送は、鹿児島県を放送対象地域とした中波放送事業とテレビジョン放送事業を行っている、特定地上基幹放送事業者である。\\n略称はMBC。\\nラジオはJRN系列とNRN系列のクロスネット、テレビはJNN系列の単独ネット。"},{"page_url":"https://de.wikipedia.org/wiki/Kowalki_(Tychowo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Ko%C5%9Bci%C3%B3%C5%82_w_Kowalkach.JPG","page_title":"Kowalki (Tychowo)","context_page_description":"Kowalki ist ein Dorf in der polnischen Woiwodschaft Westpommern und gehört zur Gemeinde Tychowo im Kreis Białogard."},{"page_url":"https://en.wikipedia.org/wiki/Panasonic","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Matsushita_IMP_Building_20061105-001.jpg","page_title":"Panasonic","context_page_description":"Panasonic Corporation, formerly known as the Matsushita Electric Industrial Co., Ltd., founded in 1918 as a lightbulb socket manufacturer, is a major Japanese multinational electronics company, headquartered in Kadoma, Osaka. In addition to consumer electronics of which it had been the world's largest maker in the late 20th century, Panasonic offers a wide range of products and services, including rechargeable batteries, automotive and avionic systems, and even home renovation and construction.\\nPanasonic has a primary listing on the Tokyo Stock Exchange and is a constituent of the Nikkei 225 and TOPIX indices. It has a secondary listing on the Nagoya Stock Exchange."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B4%BF%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B4%BF_%E0%B4%B9%E0%B4%BE%E0%B4%82%E0%B4%AC%E0%B5%8D%E0%B4%B2%E0%B4%BF%E0%B5%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Nikki_Hamblin_7737.jpg","page_title":"നിക്കി ഹാംബ്ലിൻ","context_page_description":"ന്യൂസിലാൻഡിന്റെ മദ്ധ്യദൂര ഓട്ടക്കാരിയാണ് നിക്കി ഹാംബ്ലിൻ. 800 മീറ്റർ, 1500 മീറ്റർ ഇനങ്ങളിൽ അവർ മത്സരിച്ചുവരുന്നു. 2009ലാണ് ഹാംബ്ലിനു ന്യൂസിലാൻഡ് പൗരത്വം ലഭിച്ചത്. 2016ലെ റയോ ഒളിമ്പിക്സിലെ 5000 മീറ്റർ മത്സരത്തിനിടയിൽ പരിക്കേറ്റ അമേരിക്കൻ താരത്തെ മത്സരം മുഴുമിപ്പിക്കാതെ നിക്കി ഹാംബ്ലിൻ ആശ്വസിപ്പിച്ചത് വ്യാപകമായി അനുമോദിയ്ക്കപ്പെട്ടു. ഫൈനലിലേയ്ക്കു ഇരുവർക്കും അനുമതിനൽകുകയും ചെയ്തു."},{"page_url":"https://es.wikipedia.org/wiki/Club_Estudiantes_de_La_Plata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Cl%C3%A1sicoplatense1932.jpg","page_title":"Club Estudiantes de La Plata","context_page_description":"El Club Estudiantes de La Plata es una entidad polideportiva de Argentina, ubicada en la ciudad de La Plata, provincia de Buenos Aires. Fue fundado como club de fútbol el 4 de agosto de 1905, cuenta con más de 42 000 socios y su equipo de fútbol se desempeña en la Primera División de Argentina.​\\nSu mayor logro deportivo lo obtuvo en 1968, cuando se consagró campeón del mundo​ al derrotar al Manchester United de Inglaterra en la final de la Copa Intercontinental.​Estudiantes está en el grupo de los únicos seis equipos argentinos que han ganado el máximo campeonato de clubes de fútbol a nivel mundial.​ También disputó las finales de esa copa en 1969, 1970 y 2009, en esta última bajo el nuevo formato de Mundial de Clubes de la FIFA.\\nComenzó su participación futbolística oficial en 1906, al incorporarse a los torneos de AFA, y es el único club de la ciudad de La Plata en haber obtenido títulos oficiales nacionales e internacionales, de carácter regular, en la era profesional.​ Ha ganado cinco campeonatos de Primera División del fútbol argentino en el profesionalismo​ y uno en el amateurismo​."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%D8%A4%D8%B1%D8%AF%D9%88%D9%86%D8%AC%D9%88_%D8%A7%DB%8C%D8%B4%D8%AA%D9%88%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Stephen_IV_of_Hungary.jpg","page_title":"دؤردونجو ایشتوان","context_page_description":"دؤردونجو ایشتوان بیر شاهزاده ایدی. ۱۱۶۳–۱۱۶۵ ایل‌لر آراسیندا حؤکومت ائدیب. آتاسی ایکینجی بلای دیر."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%88%D0%B8%D0%B1%D0%BE%D1%80%D0%B0,_%D0%95%D1%80%D0%B5%D0%BC%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Jeremi_Przybora_Polish_radio_writer_1951.jpg","page_title":"Пшибора, Ереми","context_page_description":"Ере́ми Стани́слав Пшибо́ра — польский радиодиктор, поэт, писатель, сценарист, сатирик, актёр, певец. Был известен своими работами в театре, кино и кабаре."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Antoine_(Nouveau-Brunswick)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Memorial_to_Louis_J._Robichaud.jpg","page_title":"Saint-Antoine (Nouveau-Brunswick)","context_page_description":"Saint-Antoine est un village canadien du comté de Kent, à l'est du Nouveau-Brunswick."},{"page_url":"https://uk.wikipedia.org/wiki/MAN_Lion%27s_Coach","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/MAN_Lion%E2%80%99s_Coach_of_Bomatur_in_Helsinki_%281%29.jpg","page_title":"MAN Lion's Coach","context_page_description":"MAN Lion's Coach - сімейство туристичних автобусів, що випускається німецьким виробником MAN AG."},{"page_url":"https://gl.wikipedia.org/wiki/Xu%C3%ADzos_de_N%C3%BAremberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Defendants_in_the_dock_at_the_Nuremberg_Trials.jpg","page_title":"Xuízos de Núremberg","context_page_description":"Os Xuízos ou Procesos de Núremberg é o nome que recibiron os xuízos levados a cabo polos aliados contra algunhas das principais figuras do réxime nazi, trala fin da Segunda Guerra Mundial. De forma paralela, leváronse a cabo os Xuízos de Toquio para condenar aos criminais de guerra nipóns. Os xuízos realizáronse entre o 20 de novembro de 1945 a 1949 na cidade alemá de Nuremberg. Foron condenados principalmente crimes en contra da paz, crimes de guerra e crimes en contra da humanidade.\\nAs probas que se realizaron ás principais figuras do réxime nazi durante estes xuízos estiveron baseadas no método intrapsíquico."},{"page_url":"https://id.wikipedia.org/wiki/Ficus_celebensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Ficus_celebensis.JPG","page_title":"Ficus celebensis","context_page_description":"Ficus celebensis adalah spesies tumbuhan dalam suku ara-araan. Tumbuhan ini diketahui berasal dari Sulawesi dan telah dibudidayakan di daerah-daerah tropis lainnya."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Halle_(Saale)/N%C3%B6rdliche_Innenstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Neumarktstr.11.jpg","page_title":"Liste der Kulturdenkmale in Halle (Saale)/Nördliche Innenstadt","context_page_description":"In der Liste der Kulturdenkmale in Halle (Saale)/Nördliche Innenstadt sind alle Kulturdenkmale der kreisfreien Stadt Halle (Saale) des Stadtteils Nördliche Innenstadt aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://de.wikipedia.org/wiki/Bago-Bluff-Nationalpark","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Spotted_Pardalote_Samsonvale_Aug02.JPG","page_title":"Bago-Bluff-Nationalpark","context_page_description":"Der Bago Bluff Nationalpark liegt im Bundesstaat New South Wales in Australien, etwa 410 km nordöstlich von Sydney und etwas südwestlich von Wauchope, von wo aus man über den Oxley Highway den besten Zugang zum Park hat. Er hat eine Fläche von 4023 ha und wurde im Januar 1999 unter Schutz gestellt."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D1%8C%D0%BA%D0%B0_%D0%BC%D1%96%D1%84%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Banshee.jpg","page_title":"Ірландська міфологія","context_page_description":"Ірла́ндська міфоло́гія або ірла́ндська мітоло́гія — міфологія Ірландії, яка входить до корпусу кельтської міфології. Збережені джерела дозволяють поділити корпус текстів ірландської міфології на чотири основних цикли: міфологічний, уладський, Цикл Фінна і королівський, чи історичний. Крім того, існує значна кількість матеріалів, що не входять до циклів. Міфи були записані католицькими монахами. Однак, тільки ірландські саги залишились майже без впливу християнства, хоча й у них трапляються алюзії та ремінісценції із біблійних історій і навіть давньогрецьких міфів."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E9%90%98%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Admiralty_Station_2016_12_part10.jpg","page_title":"金鐘站","context_page_description":"金鐘站是港鐵荃灣綫、港島綫的跨月台轉車站，同時為南港島綫的下行終點站及唯一轉車站，亦是未來東鐵綫的南行終點站。車站位於香港中西區金鐘夏慤道、海富中心、德立街及夏慤花園地底，於1980年2月12日啟用。車站擴建後的垂直距離深入地底43米，是成為全香港第三深的車站。"},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%8C%97%E5%A4%A7%E7%8E%8B%E5%A2%93%E5%BF%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/%E5%A5%91%E4%B8%B9%E5%A4%A7%E5%AD%97-%E5%8C%97%E5%A4%A7%E7%8E%8B%E5%A2%93%E5%BF%97.jpg","page_title":"北大王墓志","context_page_description":"北大王墓誌是遼代的一合墓誌，志石刻有契丹大字27行，共789字。志蓋正面刻有篆體漢字「北大王墓誌」，背面刻有漢字21行。北大王墓位於內蒙古赤峰阿魯科爾沁旗昆都鎮的一個遼墓群中。墓誌1975年冬發現，現存阿魯科爾沁旗博物館。\\n墓主人耶律萬辛生於972年，卒於1042年，重熙四年被封為北大王。\\n志文所刻契丹大字字數較多，字體工整，是研究契丹大字的重要材料。目前已經釋讀出幾十個字。"},{"page_url":"https://en.wikipedia.org/wiki/Louis_Jehle_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Louis_Jehle%27s_Queen_Anne_House_Garden_Table.jpg","page_title":"Louis Jehle House","context_page_description":"The Louis Jehle House is a historic house located at 511 E. Fifth St. in Pana, Illinois. The house was built in 1895 for local businessman Louis Jehle. Prominent Bloomington architect George H. Miller designed the Queen Anne house; it is Miller's only design in Pana. A round tower with a Palladian window rises above the house's front entrance, which is located in a full-length porch. A second, octagonal tower extends above the roof line on the east side of the house. The second story and both towers are sided with patterned shingles. The house has a multi-component roof with a main gabled section and a cross gable in the back.\\nThe Queen Anne features eleven spectacular stained glass windows and several jeweled stained glass doors. It is the only home in Christian County that is on the National Register of Historic Places.\\nIn addition, the home has three beautiful fireplaces adorned with mirrors and hand carved mantels. The hardwood floors throughout are exceptional and various patterns inlaid with different hard woods.\\nThe house was added to the National Register of Historic Places on April 20, 1995."},{"page_url":"https://be.wikipedia.org/wiki/%D0%AF%D0%BD_%D0%A7%D0%B0%D1%87%D0%BE%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Jan_%C4%8Ca%C4%8Dot._%D0%AF%D0%BD_%D0%A7%D0%B0%D1%87%D0%BE%D1%82_%281847%29.jpg","page_title":"Ян Чачот","context_page_description":"Ян Анто́ні Чачо́т — беларускі і польскі паэт, драматург, перакладчык, фалькларыст, мовазнавец.\\nПаэт сабраў каля тысячы аўтэнтычных беларускіх народных песень і выдаў іх у шасці зборніках «Сялянскіх песень…» у перакладзе на польскую мову, восьмую частку з якіх апублікаваў у беларускім арыгінале. У сваёй прадмове да «Сялянскіх песень з-над Нёмана і Дзвіны» 1846 годзе ён зрабіў нарыс граматычных асаблівасцей беларускай мовы і ўпершыню паставіў пытанне аб прынцыпах будучага «крывіцкага» правапісу. У сваёй баладнай творчасці Янам Чачотам было адлюстравана дванаццаць паданняў і народных казак, а таксама дзесяць матываў з народных вераванняў і звычаяў. Пазнейшыя збіральнікі народнай творчасці у сваіх зборніках актыўна публікавалі запісаны Янам Чачотам фальклорны матэрыял, пры гэтым не заўсёды пазначаючы крыніцу прыведзеных тэкстаў.\\nЯго руплівая дзейнасць па збіранні беларускага фальклору і спробы ўнармавання беларускай граматыкі, паводле польскіх і беларускіх даследчыкаў, з’яўляюцца досвіткам беларускага нацыянальна-культурнага адраджэння. У пераважнай большасці выпадкаў паэт называе беларускую мову «славянакрывіцкай мовай» альбо «крывіцкім дыялектам»."},{"page_url":"https://en.wikipedia.org/wiki/2008_Atlantic_hurricane_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Dolly_2008_track.png","page_title":"2008 Atlantic hurricane season","context_page_description":"The 2008 Atlantic hurricane season was the most disastrous Atlantic hurricane season since 2005, causing over 1,000 deaths and nearly $50 billion in damage. The season ranked as the third costliest ever at the time, but has since fallen to sixth costliest. It was an above-average season, featuring sixteen named storms, eight of which became hurricanes, and five which further became major hurricanes. It officially started on June 1 and ended on November 30. These dates conventionally delimit the period of each year when most tropical cyclones form in the Atlantic basin. However, the formation of Tropical Storm Arthur caused the season to start one day early. It was the only year on record in which a major hurricane existed in every month from July through November in the North Atlantic. Bertha became the longest-lived July tropical cyclone on record for the basin, the first of several long-lived systems during 2008.\\nThe season was devastating for Haiti, where nearly 800 people were killed by four consecutive tropical cyclones, especially Hurricane Hanna, in August and September. These four storms caused about $1 billion in damage in Haiti alone."},{"page_url":"https://uz.wikipedia.org/wiki/Grangues","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Map_commune_FR_insee_code_14316.png","page_title":"Grangues","context_page_description":"Grangues Fransiyaning Quyi Normandiya mintaqasida joylashgan kommunadir. Calvados departamenti Lisieux tumani tarkibiga kiradi."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_Sf%C3%A2ntul_Nicolae_din_C%C4%83line%C8%99ti-Bucecea","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Biserica_Sf._Nicolae_din_Calinesti-Bucecea1.jpg","page_title":"Biserica Sfântul Nicolae din Călinești-Bucecea","context_page_description":"Biserica \\"Sf. Nicolae\\" din Călinești-Bucecea este un lăcaș de cult ortodox ctitorit în anul 1813 de vornicul Costache Miclescu în satul Călinești, suburbie a orașului Bucecea.\\nBiserica \\"Sf. Nicolae\\" din Călinești-Bucecea a fost inclusă pe Lista monumentelor istorice din județul Botoșani din anul 2015 la numărul 242, având codul de clasificare BT-II-m-B-01952."},{"page_url":"https://lv.wikipedia.org/wiki/Amerikas_Savienot%C4%81s_Valstis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/USSupremeCourtWestFacade.JPG","page_title":"Amerikas Savienotās Valstis","context_page_description":"Amerikas Savienotās Valstis, arī ASV jeb Savienotās Valstis, ir federāla konstitucionāla republika, kas sastāv no 50 štatiem un no viena federālā apgabala. Valsts atrodas galvenokārt Ziemeļamerikas centrālajā daļā, kur tās savstarpēji saistītie 48 štati un galvaspilsētas apgabals Vašingtona ir izvietoti starp Atlantijas un Kluso okeānu. Ziemeļos tā robežojas ar Kanādu, bet dienvidos ar Meksiku. Kontinenta ziemeļrietumos atrodas Aļaskas štats un Klusajā okeānā Havajas. Savienoto Valstu pakļautībā ir arī teritorijas Karību jūrā un Klusajā okeānā.\\nAr 9,83 miljoniem km² lielu platību un 306 miljoniem iedzīvotāju Savienotās Valstis ir trešā vai ceturtā lielākā valsts pasaulē pēc platības, savukārt pēc iedzīvotāju skaita tā ir trešā lielākā valsts. Amerikāņi ir viena no pasaules etniski daudzveidīgākajām un daudzkulturālākajām nācijām. ASV ekonomika ir lielākā nacionālā ekonomika pasaulē, 2008. gadā tās iekšzemes kopprodukts bija 14,3 triljoni ASV dolāru.\\nMazāk nekā pirms 400 gadiem Savienoto Valstu teritoriju apdzīvoja tikai Amerikas pamatiedzīvotāji. Sekoja Eiropas valstu koloniālais periods. Valsts tika izveidota no 13 Lielbritānijas Karalistes kolonijām Atlantijas okeāna krastā."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BB%D0%B8%D1%88%D1%81%D1%8C%D0%BA%D1%96_%D0%B3%D0%BE%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Yardimli03.jpg","page_title":"Талишські гори","context_page_description":"Талишські, Талиські, Талишинські гори, Талиш — гори на південному сході Кавказу, в Азербайджані, на кордоні з Іраном. Служать продовженням системи Малого Кавказу, від якого відокремлені прогинанням, зайнятою нижньою течією р. Аракс. Складаються з трьох подовжніх хребтів: Головного Вододільного пасма, Пештасарського і Буроварського. Переважаюча висота головного пасма 2000—2200 м, найбільша — 2477 м.\\nГори складені флішовими і вулканогенними товщами з інтрузіями основних порід. Сейсмічність.\\nНа східних схилах гір субтропічні, вище переважні букові ліси; на головному пасмі — нагірна ксерофітна і гірська лукостепова рослинність.\\nНа території Талиських гір розташована ділянка Гірканського національного парку, утвореного в 2003 році на місці Гірканського державного заповідника, в якому розташовується реліктовий ліс третинного періоду.\\nНа сході Талиські гори відокремлені від Каспійського моря Талиською низовиною, що лежить, як і все каспійське узбережжя, на 28 м нижче рівня світового океану. Малий Кавказ і Талиські гори є сполучною ланкою між Понтійськими горами на півночі Малої Азії і хребтом Ельбурс."},{"page_url":"https://simple.wikipedia.org/wiki/Civil_parishes_in_Cornwall","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Altarnun_-_The_Kings_Head%2C_Fivelanes_-_geograph.org.uk_-_511738.jpg","page_title":"Civil parishes in Cornwall","context_page_description":null},{"page_url":"https://en.wikipedia.org/wiki/Jean-Yves_Lechevallier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Cristaux.Jean_Yves_Lechevallier.jpg","page_title":"Jean-Yves Lechevallier","context_page_description":"Jean-Yves Lechevallier, [ ʒɑ̃ iv ləʃəvæljeɪ ] born in 1946 in Rouen, Normandy, is a French sculptor painter, and laureate of the Flame of Europe art competition organized by the Robert Schuman association for Europe in 1977 to commemorate the 20th anniversary of the Rome treaties."},{"page_url":"https://pl.wikipedia.org/wiki/Grupa_Knura","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Zamkowa_DK15_%286%29.jpg","page_title":"Grupa Knura","context_page_description":"Grupa Knura – grupa skał w miejscowości Łutowiec w województwie śląskim, w powiecie myszkowskim, w gminie Niegowa. Znajdują się wśród pól po północnej stronie zabudowań tej miejscowości. Należą do niej 4 skały: Zamkowa z resztkami Strażnicy Łutowiec, Knur, Locha i Warchlak. Skały te są popularnym obiektem wspinaczki skalnej. Są to wapienne skały o wysokości 8-20 m, o ścianach pionowych lub przewieszonych. Wspinacze poprowadzili na nich 41 dróg wspinaczkowych:\\nKnur – 25 dróg o trudności III– VI.3 w skali Kurtyki,\\nLocha – 6 dróg o trudności VI – VI.1,\\nWarchlak – 1 droga o trudności VI.2,\\nZamkowa – 9 dróg o trudności _V – VI.2+.\\nDrogi posiadają dobrą asekuracje.\\nObok skał wspinaczkowych znajdują się jeszcze mniejsze skały, które nie wzbudziły zainteresowania wspinaczy."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D0%BB%D1%83%D1%86%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Slutsk_Gymnasium_east.jpg","page_title":"Слуцак","context_page_description":"Слу́цак — места ў Беларусі, на рацэ Случы. Адміністрацыйны цэнтар Слуцкага раёну Менскай вобласьці. Насельніцтва на 2018 год — 61 818 чалавек. Знаходзіцца за 105 км на поўдзень ад Менску. Вузел чыгунак на Асіпавічы, Баранавічы, Салігорск. Аўтамабільныя дарогі на Менск, Бабруйск, Івацэвічы, Салігорск.\\nСлуцак — магдэбурскае места, цэнтар гістарычнага рэгіёну, старажытны замак Вялікага Княства Літоўскага. Колішняя рэзыдэнцыя князёў Алелькавічаў, якая за Радзівіламі стала цэнтрам вытворчасьці шаўковых паясоў, аднаго з сымбаляў беларусаў. У 1920 годзе ў ваколіцах Слуцку адбылося ўзброенае выступленьне ў абарону незалежнасьці Беларусі. Да нашага часу захаваліся барокавыя царква Сьвятога Міхала Арханёла і жылы корпус кляштару бэрнардынаў, клясыцыстычныя будынкі шляхецкага сходу, Трайчанскага манастыра і кальвінскай гімназіі, помнікі архітэктуры XVIII—XIX стагодзьдзяў. Сярод мясцовых славутасьцяў вылучаліся мескія ўмацаваньні з трыма мураванымі брамамі, зруйнаваныя расейскімі ўладамі, а таксама царква Сьвятой Тройцы, касьцёл Сьвятога Антонія, кальвінскі збор і сынагога, помнікі архітэктуры XVII—XIX стагодзьдзяў, зьнішчаныя савецкімі ўладамі."},{"page_url":"https://fr.wikipedia.org/wiki/Biarritz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Biarritz_-_Vue_des_Bains_du_Port_Vieux_-_Fonds_Ancely_-_B315556101_A_MERCEREAU_7_058.jpg","page_title":"Biarritz","context_page_description":"Biarritz est une commune française située dans le département des Pyrénées-Atlantiques en région Nouvelle-Aquitaine, dans le Sud-Ouest de la France. Bordée par l'océan Atlantique, la ville dispose d'une façade maritime longue de 4 kilomètres, dans le creux du golfe de Gascogne, à moins de 25 kilomètres de la frontière avec l'Espagne.\\nLa localité résulte de l'union de deux centres de peuplement ancien, l'un voué à l'agriculture et l'autre tourné vers les métiers marins. Ancienne paroisse de Bayonne, le quartier Saint-Martin s'en émancipe à une date encore inconnue, à la fin du XVIᵉ siècle ou au début du XVIIᵉ siècle. D'abord port de pêche à la baleine, la localité connaît un bouleversement économique au XIXᵉ siècle à l'avènement des bains de mer. Napoléon III et l'impératrice Eugénie en font leur lieu de villégiature et créent une résidence et son parc avec une cité nouvelle en prolongement. Grace à eux, le gotha et toute la belle société européenne fréquentent la station balnéaire. Cette activité ne faiblit pas durant le XIXᵉ siècle et le début du XXᵉ siècle jusqu'à la crise de 1929."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Montcony","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ch%C3%A2teau_de_Montcony.JPG","page_title":"Château de Montcony","context_page_description":"Le château de Montcony est un édifice civil français situé sur la commune de Montcony en Bresse louhannaise, dans le département de Saône-et-Loire. C'est une propriété privée qui ne se visite pas."},{"page_url":"https://eo.wikipedia.org/wiki/Caatiba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Bras%C3%A3o_Caatiba_2.png","page_title":"Caatiba","context_page_description":"Caatiba estas municipo en la brazila subŝtato Bahio, kiu havis 11.420 loĝantojn en 2010."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_peluru_kendali_udara_ke_darat","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Kh-25ML.jpg","page_title":"Daftar peluru kendali udara ke darat","context_page_description":"Halaman ini memuat daftar peluru kendali udara ke darat. Daftar ini mungkin belumlah lengkap."},{"page_url":"https://hr.wikipedia.org/wiki/Zapadni_Kavkaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/European_bison_on_stamp_Russia_West_Caucasus_2006.jpg","page_title":"Zapadni Kavkaz","context_page_description":"Zapadni Kavkaz zapadni dio planinskog vijenca Kavkaza, od Crnog mora do planine Elbrus u Rusiji. Kako je to jedini veliki planinski vijenac u Europi koji nije pretrpio značajne promjene ljudskim djelovanjem, zbog čega je još 1978. godine upisan je na UNESCO-v popis mjesta svjetske baštine u Europi.\\nNa najzapadnijem dijelu zaštićenog područja od 298.903 ha, od ljetovališta Soči, nalazi se Kavkaški nacionalni park biosfere koji je osnovan još 1924. godine u pokrajinama Krasnodarski kraj, Adigejska i Karačajevsko-Čerkeska.\\nOvo područje je bilo naseljeno prije 500.000 godina o čemu svjedoči više od 150 lokaliteta u kojima su pronađeni ljudski ostaci. No, ipak je ovaj krajolik ostao nepromijenjen ljudskim djelovanjem; sve do nedavno. Danas se tu javljaju posljedice sječe drveća, ispaše stoke, lova, rekreacija i turizma. Oko 40-50.000 turista posjeti rezervat bisfere svake godine."},{"page_url":"https://eu.wikipedia.org/wiki/Mando_Diao","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Mando_Diao_Live3.jpg","page_title":"Mando Diao","context_page_description":"Mando Diao garage rock musika taldea da, 1960ko hamarkadako ukituekin. Taldea Suedian sortua da, Borlängetik konkretuki.\\nTaldea 1995ean jaio zen, baina hasieran taldekideak serio hartu ez zuten proiektua izan zen, taldekideak taldetik sartu eta irteten baitziren. Geroago proiektua seriotasunarekin hartzea erabaki zuten. Sei hilabete abestiak egiten eman ondoren, taldeari Mando Diao jartzea erabaki zuten. Beraien lehen kontzertuak hiriko taberna eta lokaletan izan ziren 1999an. Ondoren, 2002an kaleratu zuten, Bring Em In, lehenengo diska izango dena. Hortik aurrera arrakasta handia izan dute eta beste 3 diska kaleratu dituzte.\\nKontzertu asko eman dituzte munduan zehar eta musika jaialdi nagusietan hartu dute parte"},{"page_url":"https://id.wikipedia.org/wiki/Wanita_dalam_Senat_Amerika_Serikat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Sen._Martha_McSally_official_Senate_headshot_116th_congress.jpg","page_title":"Wanita dalam Senat Amerika Serikat","context_page_description":"U.S. Senate History: Women in the Senate\\n\\"Women in the U.S. Senate 1922–2010\\" Center for American Women and Politics, Eagleton Institute of Politics, Rutgers, The State University of New Jersey\\nSteinhauer, Jennifer. \\"Once Few, Women Hold More Power in Senate\\". The New York Times. Diakses tanggal March 23, 2013.\\nMaurer, Elizabeth. \\"Legislating History: 100 Years of Women in Congress\\". National Women's History Museum. 2017."},{"page_url":"https://fr.wikipedia.org/wiki/Born_This_Way","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Lady_Gaga_Heavy_Metal_Lover.jpg","page_title":"Born This Way","context_page_description":"Born This Way est le troisième album studio de la chanteuse américaine Lady Gaga, sorti le 23 mai 2011 et produit par Interscope Records. Précédant sa sortie, le premier single éponyme de l'album, Born This Way est sorti le 11 février 2011. Son second single Judas est sorti sur iTunes le 15 avril 2011 à la suite d'une fuite sur Internet ; sa sortie initiale était prévue pour le 19 avril 2011. Un troisième single, The Edge of Glory, est sorti le 9 mai à 22h00 en France métropolitaine. Par la suite, le morceau Hair est sorti sur iTunes en tant que single promotionnel le 16 mai 2011. Il s'est classé à la première position de 33 pays et nᵒ 1 sur les 23 plateformes Itunes. Un quatrième single Yoü and I sort le 15 août, puis en fin d'année, le 12 novembre 2011, un cinquième : Marry the Night.\\nLe titre de l'album a été révélé lorsque Lady Gaga a accepté le prix du Vidéoclip de l'année lors de la cérémonie des MTV Video Music Awards 2010 alors que la date de sortie a été confirmée sur sa page officielle Twitter le 1ᵉʳ janvier 2011 à minuit. De fin mai à octobre 2011, l'album s'était écoulé à 8 millions d'exemplaires."},{"page_url":"https://sl.wikipedia.org/wiki/Grad_Re%C5%A1tanj","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Grad_Re%C5%A1tanj_VII._2011.JPG","page_title":"Grad Reštanj","context_page_description":"Grad Reštanj je nekoč stal v naselju Reštanj v občini Krško."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D9%85%D9%88%D9%86%D8%AA_%D8%A7%D8%AF%D8%B2%D9%8A%D8%B2%D8%A7_%DA%A4%D9%88%D9%84%D9%83%D8%A7%D9%86%D9%8A%D9%83_%D9%83%D9%88%D9%85%D9%BE%D9%84%D9%8A%D9%83%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Mount_Edziza%2C_British_Columbia.jpg","page_title":"جبل مونت ادزيزا ڤولكانيك كومپليكس","context_page_description":"مونت ادزيزا ڤولكانيك كومپليكس هوا جبل فى كندا فى قاره الامريكتان."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB%D0%B0%D0%B1%D0%B0%D0%BD_(%D3%99%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B6%D0%B0%D0%BD_%D0%BC%D1%83%D0%B7%D1%8B%D0%BA%D0%B0_%D2%A1%D0%BE%D1%80%D0%B0%D0%BB%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/%D0%91%D0%B0%D0%BB%D0%B0%D0%B1%D0%B0%D0%BD.jpg","page_title":"Балабан (әзербайжан музыка ҡоралы)","context_page_description":"Балабан, йә ҡайһы саҡта баламан — телле ағастан яһалған ике таяҡлы тынлы музыка ҡоралы. 9 уйнау тишектәренән торған торбанан ғибәрәт. Әзербайжандарҙың, үзбәктәрҙең һәм ҡайһы бер төньяҡ кавказ халыҡтарының халыҡ уйын ҡоралы тынлы музыкаль инструмент…. Әзербайжанда шулай уҡ балабанды дюдюк тип атайҙар. Конструкцияһы һәм яңғырашы буйынса балабанға дудук, Грузияла — дудуки яҡын тора.\\nХроматик тауыш сығарыу һәм кәрәкле күләмдә өрөү көсөн табыу маҡсатында, тишектәрҙе өлөшләтә ҡаплау алымын ҡулланалар. Балабан тауышы йомшаҡ, еңелсә ҡалтырауыҡ һәм баҙыҡ тембрлы. Ғәҙәттә 2 балабан ҡулланалар — береһендә көй уйнайҙар, икенсеһендә — эҙмә-эҙлекле орган пунктын. Ҡайһы саҡта икенсеһенә һуҡма инструменттар ҡушыла. Балабанда йыр, бейеү көйҙәре, пьесалар башҡарыла. Балабан оркестрҙарға һәм халыҡ уйын ҡоралдары ансамбленә ҡушылып уйнай.\\nӘзербайжан тикшеренеүсеһе Ҡасимов дәлилләүе буйынса, Мингечаур территорияһында хәҙерге балабандың прототибы тип һаналған б. э. т. I быуатҡа ҡараған һөйәктән эшләнгән тынлы музыка ҡоралы табылған."},{"page_url":"https://it.wikipedia.org/wiki/Chiese_rupestri_di_Matera","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/SANTA_MARIA_DE_ARMENIS_1.jpg","page_title":"Chiese rupestri di Matera","context_page_description":"Le chiese rupestri del territorio di Matera, fondate principalmente nell'Alto Medioevo, sono edifici scavati nella roccia.\\nInizialmente nate come strutture religiose, nel corso del tempo hanno subito diverse trasformazioni d'uso, diventando abitazioni o ricoveri per animali.\\nSono un'importante testimonianza della presenza di comunità di monaci benedettini, longobardi e bizantini.\\nTalune chiese, inoltre, pur nella sostanziale impostazione latina, presentano elementi bizantini, o viceversa, chiese architettonicamente greche hanno spazi liturgici di tipo latino.\\nLe chiese rupestri contengono spesso affreschi ed elementi scultorei, che, oltre alla funzione decorativa, inducevano alla contemplazione e alla preghiera.\\nNel Medioevo piccole comunità di laici e monaci immigrati dalle zone della Cappadocia, Armenia, Siria ed Asia Minore, dopo aver perso le possibilità di culto, si rifugiarono in queste grotte che diventarono luoghi di preghiera decorati con affreschi bizantini, arricchendo di arte e cultura orientale l'intero comprensorio."},{"page_url":"https://es.wikipedia.org/wiki/Presidente_de_la_C%C3%A1mara_de_Diputadas_y_Diputados_de_Chile","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Juan_Jose_Aldunate_Larrain.JPG","page_title":"Presidente de la Cámara de Diputadas y Diputados de Chile","context_page_description":"El presidente de la Cámara de Diputadas y Diputados de la República de Chile​ es la máxima autoridad de la Cámara de Diputados de aquel país. El cargo fue establecido en 1811 por el Primer Congreso Nacional de Chile.\\nSe encuentra, tras el ministro del Interior y Seguridad Pública y el presidente del Senado, en el tercer lugar en la línea de sucesión del presidente de la República, en caso de impedimento temporal o vacancia, según la Constitución Política de la República.\\nEl cargo está actualmente en manos de Diego Paulsen Kehr del partido Renovación Nacional. Fue elegido el 7 de abril de 2020.​ Detrás de él están sus vicepresidentes; el primero es Francisco Undurraga y el segundo Rodrigo González Torres."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%B5_%D0%A0%D0%B0%D1%85%D0%B8%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/St_Ra_%284%29.JPG","page_title":"Старое Рахино","context_page_description":"Старое Ра́хино — деревня в Крестецком районе Новгородской области. Входит в состав Новорахинского сельского поселения."},{"page_url":"https://it.wikipedia.org/wiki/Virginia_Woolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Virginia_Woolf_%282%29.jpg","page_title":"Virginia Woolf","context_page_description":"Adeline Virginia Woolf, nata Stephen, nota semplicemente come Virginia Woolf, è stata una scrittrice, saggista e attivista britannica.\\nConsiderata come una delle principali figure della letteratura del XX secolo, attivamente impegnata nella lotta per la parità di diritti tra i sessi, fu, assieme al marito, militante del fabianesimo. Nel periodo fra le due guerre fu membro del Bloomsbury Group e figura di rilievo nell'ambiente letterario londinese.\\nLe sue opere più famose comprendono i romanzi La signora Dalloway, Gita al faro e Orlando. Tra le opere di saggistica emergono Il lettore comune e Una stanza tutta per sé; in quest'ultima opera compare la celebre citazione: «Una donna deve avere denaro, cibo adeguato e una stanza tutta per sé se vuole scrivere romanzi.»\\nI suoi lavori sono stati tradotti in oltre cinquanta lingue. Tra i suoi traduttori si annoverano Jorge Luis Borges, Marguerite Yourcenar, Giulia Niccolai, Cristina Campo e Nadia Fusini."},{"page_url":"https://sv.wikipedia.org/wiki/Haliotis_fulgens","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Haliotis_fulgens_001.jpg","page_title":"Haliotis fulgens","context_page_description":"Haliotis fulgens är en snäckart som beskrevs av Philippi 1845. Haliotis fulgens ingår i släktet Haliotis och familjen Haliotididae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%81%93398%E5%8F%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Route398_Yuzawa.jpg","page_title":"国道398号","context_page_description":"国道398号は、宮城県石巻市から秋田県由利本荘市に至る一般国道である。"},{"page_url":"https://nl.wikipedia.org/wiki/Klokkentoren_van_Ballum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Ballum_Ameland_toren_kerk.jpg","page_title":"Klokkentoren van Ballum","context_page_description":"De klokkentoren van Ballum is een klokkentoren in Ballum op Ameland in de Nederlandse provincie Friesland."},{"page_url":"https://gl.wikipedia.org/wiki/Porto_Novo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Marche_ouando_porto-novo.jpg","page_title":"Porto Novo","context_page_description":"Porto Novo, Porto-Novo ou Portonovo, oficialmente Porto-Novo e tamén coñecido como Hogbonou e Adjacé, é a capital oficial da Benín. É un porto sito nun entrante do golfo da Guinea, na parte suroriental do país. Porto Novo é a segunda cidade máis grande de Benín, detrás de Cotonou, porén supéraa en importancia cultural e política. O transpaís de Porto Novo produce aceite de palma, algodón e kapok. Nos anos 1990 foi descuberto petróleo en augas fóra da costa, produto que se converteu nun importante motor das exportacións."},{"page_url":"https://gl.wikipedia.org/wiki/Historia_de_Roma","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Basilica_11.png","page_title":"Historia de Roma","context_page_description":"A historia urbana de Roma, a urbe por excelencia, \\"cidade eterna\\", caput mundi, desenvólvese por case que tres milenios dende a confederación dun grupo de aldeas espalladas nuns outeiros á beira do Tíber, ata se converter na capital da civilización máis avanzada da antigüidade e séculos despois, xa na Idade Moderna, no centro espiritual e artístico máis venerado da cultura occidental."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pinturas_de_Eliseu_Visconti","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/EliseuVisconti-D307-Nu_sentado_%281%29.jpg","page_title":"Lista de pinturas de Eliseu Visconti","context_page_description":"Esta é uma lista de pinturas de Eliseu Visconti.\\nEliseo d'Angelo Visconti foi um pintor, desenhista e professor ítalo-brasileiro representante da pintura impressionista no Brasil. Vindo da Itália, imigrou para o Brasil na década de 1870.\\nEstudou no Liceu de Artes e Ofícios no Rio de Janeiro em 1883, com Victor Meirelles e Estêvão Silva. Ni ano seguinte ingressou na Academia Imperial de Belas Artes. Estudou também em Paris na École Nationale et Spéciale des Beaux-Arts aonde cursa arte decorativa na École Guérin. Um de seus principais trabalhos foi a decoração do Theatro Municipal do Rio de Janeiro.\\nA acervo de obras do artista, autenticadas e catalogadas com mais de 1.200 obras, faz parte das principais coleções dos Museus do Brasil.\\nEsta lista é gerada a partir dos dados do Wikidata e é atualizada periodicamente por um robô.\\nEdições feitas no conteúdo da lista serão removidas na próxima atualização!"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Plov_Tashkent.jpg","page_title":"Плов","context_page_description":"Плов — блюдо восточной кухни, основу которого составляет варёный рис. Отличительным свойством плова является его рассыпчатость, достигаемая соблюдением технологии приготовления риса и добавлением в плов животного или растительного жира, препятствующего слипанию крупинок. Посуда для подачи плова на стол называется «пловница», в Средней Азии — ляган."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Aubin-en-Bray","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Blason_r%C3%A9gion_fr_Picardie.svg","page_title":"Saint-Aubin-en-Bray","context_page_description":"Saint-Aubin-en-Bray est une commune française située dans le département de l'Oise en région Hauts-de-France."},{"page_url":"https://de.wikipedia.org/wiki/Crillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%C3%89glise_Saint-Lucien_de_Crillon_001.JPG","page_title":"Crillon","context_page_description":"Crillon ist eine französische Gemeinde mit 491 Einwohnern im Département Oise in der Region Hauts-de-France. Die Gemeinde liegt im Arrondissement Beauvais und ist Teil der Communauté de communes de la Picardie Verte und des Kantons Grandvilliers."},{"page_url":"https://vi.wikipedia.org/wiki/Cao_X%C6%B0%C6%A1ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Turpan-gaochang-d05.jpg","page_title":"Cao Xương","context_page_description":"Cao Xương, cũng gọi là Qara-hoja hay Kara-Khoja, là khu vực từng tồn tại một thành phố ốc đảo được xây dựng tại rìa phía bắc của sa mạc Taklamakan tại Tân Cương, Trung Quốc. Địa điểm này cũng được biết tới với các tên gọi Chotscho, Khocho, Qocho, hay Qočo. Vào thời nhà Minh và nhà Thanh, Cao Xương được gọi là \\"Cáp Lạp Hòa Trác\\" và Hỏa Châu.\\nCao Xương là một trung tâm thương mại sầm uất, là một điểm dừng chân của các thương nhân trên Con đường tơ lụa. Thành bị phá hủy do chiến tranh vào thế kỷ 14, các tàn tích cung điện cổ xưa và các phần thành nội và thành ngoại vẫn có thể trông thấy cho đến tận ngày nay. Các di tích nằm cách 30 km về phía đông nam của thành phố Turfan. Gần Cao Xương là các lăng mộ Astana."},{"page_url":"https://es.wikipedia.org/wiki/National_League_2017-18","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/FlagOfLancashire.PNG","page_title":"National League 2017-18","context_page_description":"La temporada 2017-18 de la National League, conocida como la Vanarama National League por motivos de patrocinio, fue la tercera temporada de la quinta división inglesa, desde su creación en 2015. el Lincoln City fue el último campeón del título. En el play-off, ascendió el Forest Green Rovers.\\nUn total de 24 equipos participan en la competición, incluyendo 18 equipos de la temporada anterior, 2 provenientes de la National League North 2016-17, 2 provenientes de la National League South 2016-17 y 2 provenientes de la Football League Two 2016-17."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9B%BC%E6%B5%B7%E5%A7%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/SchlossEhrenhof_2017.jpg","page_title":"曼海姆","context_page_description":"曼海姆是德国巴登-符腾堡州继斯图加特和卡尔斯鲁厄之后的第三大城市，人口约31万，与莱茵兰-普法尔茨州城市路得维希港隔莱茵河相望。曼海姆是一座大学城，这座曾经的普法尔茨皇城如今也是欧洲都市圈莱茵-内卡三角的经济和文化中心。"},{"page_url":"https://sco.wikipedia.org/wiki/Perciformes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Perciformes_collage.jpg","page_title":"Perciformes","context_page_description":"Perciformes, an aa cried the Percomorphi or Acanthopteri, are the lairgest order o vertebrates, containin aboot 40% o aw bony fishes. Perciformes means \\"perch-like\\". Thay belang tae the class o ray-finned fish, an comprise ower 10,000 species foond in almaist aw aquatic environments. The order contains aboot 160 faimilies, which is the maist o ony order within the vertebrates. It is an aa the maist variably sized order o vertebrates, rangin frae the 7 mm Schindleria brevipinguis tae the 5 m Makaira species. Among well-kent members o this group are cichlids, sunfish/bluegill, damselfish, bass, an perch."},{"page_url":"https://sl.wikipedia.org/wiki/St._P%C3%B6lten","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Turm_der_Stadtbefestigung_und_Reste_der_Stadtmauer_Dr._Karl_Renner_Promenade_29.JPG","page_title":"St. Pölten","context_page_description":"Sankt Pölten, pogosto skrajšano St. Pölten, je glavno mesto dežele Spodnja Avstrija v severovzhodni Avstriji. Z 52.747 prebivalci je največje mesto v Spodnji Avstriji. St. Pölten je mesto z lastnim statutom, zato je občina in okraj v Mostviertlu. St. Pölten leži ob vznožju Alp ob reki Traisen in je bil naseljen že v kameni dobi. Je eno najstarejših mest v Avstriji.\\nOd konca 18. stoletja je tudi sedež rimskokatoliške škofije."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%98%A5%E7%A7%8B%E9%96%A3_(%E9%AB%98%E9%9B%84%E5%B8%82)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/%E4%BB%8A%E5%B1%8F%E5%B1%B1%E5%A1%94%E5%BD%B1.JPG","page_title":"春秋閣 (高雄市)","context_page_description":"春秋阁，全名“东南帝阙乐善社启明堂春秋阁”，又称“春秋御阁”，是为纪念武圣关公而建的庙宇，位于台湾高雄市左营区的莲池潭畔。\\n春秋阁建于民国42年，为两座中国宫殿式楼阁，一称春阁，另一称秋阁，春秋阁之名取其合称。两楼阁各为四层八角，绿瓦黄墙，宛如宝塔，古色古香的塔影倒映水中。其间有九曲桥相通。\\n春秋阁的前端有一尊骑龙观音，地方相传观音菩萨曾骑龙在云端现身，指示信徒要依其现身之形态建造圣像在春阁与秋阁之间，故有现在的骑龙观音圣像。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%94%CE%AE%CE%BC%CE%BF%CF%82_%CE%A4%CF%85%CE%BB%CE%AF%CF%83%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Dimos_Tylisou.png","page_title":"Δήμος Τυλίσου","context_page_description":"Ο Δήμος Τυλίσου ήταν δήμος του Νομού Ηρακλείου ο οποίος συστάθηκε βάσει του Προγράμματος 'Καποδίστριας', με τη συνένωση παλαιότερων κοινοτήτων της περιοχής, οι οποίες απετέλεσαν τα δημοτικά διαμερίσματα που τον απάρτιζαν. Ο δήμος λειτούργησε την περίοδο 1999 -2010, με το πέρας της οποίας καταργήθηκε, καθώς τέθηκε σε εφαρμογή το Προγράμματος 'Καλλικράτης' και εντάχθηκε στο νέο Δήμο Μαλεβιζίου. Βρισκόταν στα δυτικά του Νομού Ηρακλείου, καταλάμβανε έκταση 131.064 στρεμμάτων και έδρα του είχε οριστεί το χωριό Τύλισος. Σύμφωνα με την Απογραφή του 2001, ο πληθυσμός του δήμου ανερχόταν σε 3.491 κατοίκους.\\nΟ δήμος περιελάμβανε 10 δημοτικά διαμερίσματα:\\nΔ.δ. Τυλίσου -- η Τύλισος\\nΔ.δ. Αηδονοχωρίου -- το Αηδονοχώρι\\nΔ.δ. Αστυρακίου\\nτο Αστυράκι\\nτο Καμαράκι\\nΔ.δ. Γωνιών Μαλεβιζίου -- οι Γωνίες\\nΔ.δ. Δαμάστας\\nη Δαμάστα\\nτο Αστρινό\\nΔ.δ. Καμαρίου -- το Καμάρι\\nΔ.δ. Καμαριώτου -- ο Καμαριώτης\\nΔ.δ. Κεραμουτσίου -- το Κεραμούτσι\\nΔ.δ. Μαράθου -- ο Μάραθος\\nΔ.δ. Μονής -- η Μονή"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Walker_County_(Alabama)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/First_Methodist_Church_of_Jasper_02.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Walker County (Alabama)","context_page_description":"Die Liste der Registered Historic Places im Walker County führt alle Bauwerke und historischen Stätten im Walker County in Alabama auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://tr.wikipedia.org/wiki/1990_Cannes_Film_Festivali","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Monica_Vitti_1990.jpg","page_title":"1990 Cannes Film Festivali","context_page_description":"1990 Cannes Film Festivali, 10-21 Mayıs'ta yapılan 43. Cannes Film Festivalidir."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%95%D7%91_%D7%93%D7%99%D7%9C%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Allen_Ginsberg_and_Bob_Dylan_by_Elsa_Dorfman.jpg","page_title":"בוב דילן","context_page_description":"בוב דילן הוא זמר-יוצר אמריקאי-יהודי, הנחשב לאחד מגדולי הכותבים במוזיקה הפופולרית האמריקאית. זהו האמן הראשון בהיסטוריה מעולם המוזיקה שזכה בפרס נובל, כאשר זכה בפרס נובל לספרות לשנת 2016.\\nהצלחתו הגדולה של דילן הייתה בשנות ה-60 של המאה ה-20. התנועה לזכויות האזרח אימצה את שירו \\"Blowin' in the Wind\\" כהמנון חצי רשמי, ומיליוני צעירים הזדהו עם שירו \\"The Times They Are A-Changin'\\", בתקופה שאירעו שינויים חברתיים מהותיים בארצות הברית. עם זאת, גם כיום ניכרת השפעתו הרבה של דילן על עולם המוזיקה הפופולרית ועל מוזיקאים רבים.\\nדילן נחשב כמי שמתח את גבולות המוזיקה הפופולרית מעבר לנושאים המוכרים של \\"הוא והיא\\" אל תחומי הפוליטיקה, הפילוסופיה ועוד. הליריקה בשיריו מאופיינת בכפלי משמעויות ומשחקי מילים רבים. דילן חידש בשיריו את המסגרות המוכרות של המוזיקה האמריקאית ושאב ממקורות הפולק, הקאנטרי, הבלוז, הרוק ואף הג'אז, הסווינג ומוזיקת ברודוויי."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D9%83_%D9%88%D8%A7%D9%84%D8%A7%D8%B3_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%B1%D8%A9_%D9%82%D8%AF%D9%85_%D8%A3%D9%85%D8%B1%D9%8A%D9%83%D9%8A%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Mike_Wallace_%28American_football%29.JPG","page_title":"مايك والاس (لاعب كرة قدم أمريكية)","context_page_description":"مايك والاس ‏ هو لاعب كرة قدم أمريكية أمريكي، ولد في 1 أغسطس 1985 في ميامي في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/Highway_M23_(Ukraine)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Ukraine_road_m23.jpg","page_title":"Highway M23 (Ukraine)","context_page_description":"Highway M23 is one of the shortest Ukrainian international highway which connects Berehove with Khust and runs in the southern portion of the region next to the Hungarian and Romanian borders. From Berehove to the little settlement of Vylok the M23 is part of European route E58 and European route E81 which drift of towards the Romanian border at the border checkpoint Okli on a regional route."},{"page_url":"https://ga.wikipedia.org/wiki/P%C3%A1draig_%C3%93_Fiannachta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/St._Mary%27s_Church%2C_Dingle%2C_Nave_20150803_1.jpg","page_title":"Pádraig Ó Fiannachta","context_page_description":"Sagart, duine léannta agus scríbhneoir ab ea Pádraig Ó Fiannachta; \\"duine de mhórscoláirí na Gaeilge agus na hÉireann\\", de réir tuairisc.ie, agus \\"ba fhathach in iomaire an léinn, an aistriúcháin agus na foilsitheoireachta é an Monsignor Pádraig Ó Fiannachta\\"."},{"page_url":"https://fy.wikipedia.org/wiki/Swarte_Harne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Zwarte_Haan1.jpg","page_title":"Swarte Harne","context_page_description":"Swarte Harne is in buorskip oan de Waadseedyk, by Sint-Jabik yn de eardere gemeente It Bilt, no fúzjegemeente De Waadhoeke. De namme komt ek foar as Zwarte Haan, Swarte Herne en De Swarte Haan Swarte Harne is nei de yndiking fan 1715 ûntstien oan 'e Nije Biltdyk. By de seedyk stiet it H.G. Miedemagemaal, dat de ôfwettering fan It Bilt yn de waadsee fersoarget. It gemaal is ferneamd nei de eardere foarsitter fan it wetterskip Noardlik Westergoa, Henk Miedema.\\nDe namme harne komt fan in hoeke tusken twa seediken. Oant 1948 wie dêr it fear op It Amelân en Skylge. It plak krige syn namme troch in herberch De Schwarte Hinde dy't yn 1811 neamd wurdt, swart is de kleur fan it slyk yn de Waadsee.\\nSwarte Harne wurdt ek wol \\"it begjin fan de wrâld\\" neamd, omdat it Jabikspaad dêr begjint. It buorskip leit ek oan it Fryske Kustpaad"},{"page_url":"https://id.wikipedia.org/wiki/Dewan_Perwakilan_Rakyat_Daerah_Kota_Bukittinggi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Logo_Kota_Bukittinggi.png","page_title":"Dewan Perwakilan Rakyat Daerah Kota Bukittinggi","context_page_description":"Dewan Perwakilan Rakyat Daerah Kota Bukittinggi adalah badan legislatif unikameral kota Bukittinggi, Sumatra Barat, Indonesia. Dewan ini terdiri dari 25 anggota yang dipilih berdasarkan daftar terbuka dari partai dalam pemilihan umum legislatif. Pemilihan dilakukan setiap lima tahun serentak dengan pemilihan anggota Dewan Perwakilan Rakyat dan Dewan Perwakilan Daerah seluruh Indonesia.\\nAnggota DPRD Kota Bukittinggi periode 2019–2024 terdiri dari perwakilan 8 partai politik hasil pemilihan umum legislatif 2019. Perwakilan Partai Gerakan Indonesia Raya dan Partai Keadilan Sejahtera mengisi perolehan kursi terbanyak. Berdasarkan UU Nomor 27 tahun 2009, struktur pimpinan DPRD Kota Bukittinggi terdiri atas satu orang ketua dan dua orang wakil ketua yang dipilih dari partai politik berdasarkan urutan perolehan kursi terbanyak."},{"page_url":"https://ru.wikipedia.org/wiki/Lincoln_Motor_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/2ND-Lincoln-Navigator.jpg","page_title":"Lincoln Motor Company","context_page_description":"Líncoln — американский автомобильный производитель, принадлежащий Ford Motor Company. В 2011 году объём продаж подразделения в США составил 85 643 автомобиля.\\nАвтомобили марки продаются в США, Канаде, Мексике, странах Ближнего Востока. В 2014 году Lincoln начал поставки машин на китайский рынок."},{"page_url":"https://ca.wikipedia.org/wiki/Fagiano_Okayama_FC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Supporter_of_Fagiano_Okayama.JPG","page_title":"Fagiano Okayama FC","context_page_description":"El Fagiano Okayama FC és un club de futbol japonès de la ciutat d'Okayama."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%90%D7%9D_%D7%92%D7%A8%D7%99%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Pamela_Suzette_Grier%2C_2012_%28cropped%29.jpg","page_title":"פאם גריר","context_page_description":"פמלה סוזט \\"פאם\\" גריר היא שחקנית אמריקאית. גריר ידועה בתור מלכת סרטי הבלקספלויטיישן והיא מכוכבות האקשן הראשונות בהוליווד. הייתה מועמדת לפרס גלובוס הזהב על הופעתה במותחן הפשע \\"ג'קי בראון\\"."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A5%81%E0%A4%97%E0%A4%B2_%E0%A4%B0%E0%A4%BE%E0%A4%AE%E0%A4%BE%E0%A4%AF%E0%A4%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/The_blind_hermit_and_his_wife_mourn_their_son%2C_who_was_slain_accidentally_by_Dasaratha.jpg","page_title":"मुगल रामायण","context_page_description":"मुगल बादशाह अकबर द्वारा रामायण का फारसी अनुवाद करवाया था। उसके बाद हमीदाबानू बेगम, रहीम और जहाँगीर ने भी अपने लिये रामायण का अनुवाद करवाया था।"},{"page_url":"https://es.wikipedia.org/wiki/Inmigraci%C3%B3n_espa%C3%B1ola_en_Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Tom%C3%A1s_Povedano_de_Arcos.jpg","page_title":"Inmigración española en Costa Rica","context_page_description":"La inmigración española en Costa Rica se refiere al movimiento migratorio más numeroso e importante que recibió históricamente la República de Costa Rica, pues desde la época colonial constituye la mayor comunidad europea del país.​ Hoy en día, los hispanocostarricenses son el principal y más destacado grupo étnico de la nación. Igualmente, la comunidad española de Costa Rica es la más numerosa de América Central, y —como en toda Latinoamérica— tiene un importante peso cultural y demográfico.​\\nDurante la segunda mitad del siglo XIX y hasta la primera del siglo XX arribaron oleadas inmigratorias de todas las regiones de España. Sin embargo, y principalmente después de los años 1900, la mayoría absoluta siempre provino de Cataluña, seguida de lejos por Galicia, Asturias y Castilla y León.​\\nLa inmigración española en Costa Rica formó una columna vertebral para la consolidación del Estado actual e identidad cultural del país. Hoy en día, se encuentran conexiones importantes de todo tipo con la cultura española. Existiendo —además— en la genealogía costarricense multitud de apellidos y linajes españoles.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%88%A5%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Mount_Bessan_from_Murod%C5%8D1994-10-09.jpg","page_title":"別山","context_page_description":"別山は、富山県・飛騨山脈の立山連峰にある標高は2,880mの山。"},{"page_url":"https://it.wikipedia.org/wiki/Britannia_(provincia_romana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/By_Bertha_Fort_-_geograph.org.uk_-_460130.jpg","page_title":"Britannia (provincia romana)","context_page_description":"Britannia fu il nome di una provincia prima, poi di più province dell'impero romano situate nell'isola di Gran Bretagna in un tempo compreso tra il 43/44 e il 410."},{"page_url":"https://tr.wikipedia.org/wiki/Nico_Pulzetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Pulzetti.png","page_title":"Nico Pulzetti","context_page_description":"Nico Pulzetti, Padova takımında orta saha pozisyonunda görev yapan İtalyan futbolcudur.\\nProfesyonel kariyerine 2003 yılında Cesena kulübünde başladı. Daha sonra sırasıyla Castelnuovo, Verona, Livorno, Bari, Chievo, Bologna, Siena, Cesena, Spezia ve Padova kulüplerinde oynadı."},{"page_url":"https://nl.wikipedia.org/wiki/Marathon_van_Hongkong","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Hong_Kong_Marathon_Finish_Line_2011.jpg","page_title":"Marathon van Hongkong","context_page_description":"De Marathon van Hongkong, is een hardloopevenement over een afstand van 42,195 km, dat jaarlijks in de stad Hongkong wordt gehouden. De marathon vindt plaats in de maand januari of februari. De hoofdsponsor is de Standard Chartered Bank. De wedstrijd heeft het predicaat \\"Silver Label Road Race\\", de een na hoogste status van de Internationale Atletiekfederatie.\\nDe loop werd voor het eerst gehouden in 1981, had toen de naam Hong Kong Shenzhen Marathon en werd georganiseerd door de Amateur Atletiekvereniging van Hongkong. Van 1989 tot 1991 en van 1994 tot 1996 is de wedstrijd niet gehouden vanwege een gebrek aan financiële middelen.\\nHet evenement in 1997 was het symbool van de terugkeer van Hongkong naar de Volksrepubliek China. Vanaf deze editie namen ook Afrikaanse topatleten deel.\\nVan 2004 tot 2008 maakte het evenement deel uit van de \\"Greatest Race on Earth\\", gesponsord door de Standard Chartered Bank. De andere wedstrijden uit deze race waren de marathon van Singapore, de marathon van Bombay en de marathon van Nairobi.\\nDe wedstrijd was het toneel van het Aziatische marathonkampioenschap in de jaren 2002, 2008, 2013 en 2015."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Sittard","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Sittard_Petruskerk.jpg","page_title":"Lijst van rijksmonumenten in Sittard","context_page_description":"De stad Sittard telt 170 inschrijvingen in het rijksmonumentenregister, hieronder een overzicht. Zie ook de gemeentelijke monumenten in Sittard."},{"page_url":"https://fr.wikipedia.org/wiki/Hydrocarbure_aromatique","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Benzene_circle.svg","page_title":"Hydrocarbure aromatique","context_page_description":"Un hydrocarbure aromatique ou arène est un hydrocarbure dont la structure moléculaire comprend un cycle possédant une alternance formelle de liaison simple et double, et respectant la règle de Hückel sur l'aromaticité. Le terme d'« aromatique » fut donné à ces molécules avant la découverte du phénomène physique d'aromaticité, et est dû au fait que ces molécules ont une odeur en général douce.\\nLa configuration aromatique de six atomes de carbone est nommée cycle benzénique, d'après le plus simple hydrocarbure aromatique possible, le benzène. Les hydrocarbures aromatiques peuvent être monocycliques ou polycycliques."},{"page_url":"https://ru.wikipedia.org/wiki/Eagle_(%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BC%D0%B0%D1%80%D0%BA%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Eagle_Vision_%2793-%2797.jpg","page_title":"Eagle (автомобильная марка)","context_page_description":"Eagle — подразделение американского концерна Chrysler, существовавшее в период с 1988 по 1999. Было создано на основе компании AMC. Штаб-квартира компании находилась в городе Оберн-Хиллс, штат Мичиган, США"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A9%99%E5%B8%B6%E8%97%8D%E5%B0%BA%E8%9B%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Milionia_basalis.JPG","page_title":"橙帶藍尺蛾","context_page_description":"橙带蓝尺蛾，亦名黄带枝尺蛾，尺蛾科中的一种昼行性飞蛾。常被视为蝴蝶。主要寄主于竹柏或罗汉松等树木，在校园内常见。偶尔有大发生的现象。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8E%AF%E7%BB%95%E6%95%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/3D-Link.PNG","page_title":"环绕数","context_page_description":"在数学中，环绕数是描述三维空间中两条闭曲线环绕的一个数值不变量。直观上，环绕数表示每一条曲线缠绕另一条曲线的次数。环绕数总是整数，但有可能取正数或负数，取决于这两条曲线的定向。\\n环绕数由高斯以环绕积分的形式引入。它在纽结理论、代数拓扑和微分几何的研究中是重要的对象，并在数学和科学中有许多应用，包括量子力学、电磁学以及 DNA超螺旋的研究。"},{"page_url":"https://eu.wikipedia.org/wiki/Renascen%C3%A7a_(Paran%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Igreja_do_Distrito_de_Baulandia.jpg","page_title":"Renascença (Paraná)","context_page_description":"Renascença Brasilgo udalerri bat da, Paraná estatuan kokatua. 6.812 biztanle ditu 425,274 km²ko eremuan."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A4%D0%BE%D1%80%D0%B4_%D0%A4%D0%B8%D0%B5%D1%81%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Ford_Fiesta_front_20070920.jpg","page_title":"Форд Фиеста","context_page_description":"Форд фиеста е автомобил кој го производуваа америчката фабрика на автомобили Форд. Производите се од 1976 до денес."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A2%D9%8A%D9%81%D9%8A_%D8%A7%D9%84%D8%B3%D8%A7%D9%85%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/DSC_0133_%286273113406%29.jpg","page_title":"آيفي السامة","context_page_description":"آيفي السامة ‏ هي شخصية خيالية تظهر في القصص المصورة التي تقوم بنشرها دي سي كومكس. عادة تظهر كعدوة للبطل الخارق باتمان. من ابتكار كل من روبرت كانير وشيلدون مولدوف. كان أول ظهور لها في باتمان رقم 181. هي مهووسة بالنباتات، علم النبات، الانقراض البيئي وحماية البيئة. تستخدم السموم من النباتات وفيرومون السيطرة على العقل من أجل الأنشطة الإجرامية الخاصة بها والتي تهدف عادة إلى حماية الأنواع المهددة بالانقراض والبيئة الطبيعية. تصبح هارلي كوين صديقة لها وشريكة لها في الجريمة.\\nقامت أوما ثورمان بتأدية دور آيفي السامة في فيلم باتمان وروبن، وأدت ديان بيرشينج صوتها في الرسوم المتحركة باتمان. ظهرت الشخصية أيضا في ألعاب فيديو مثل باتمان: أركام أسايلم، باتمان: أركام سيتي وباتمان: فارس أركم، وفي المسلسل الأمريكي غوثام."},{"page_url":"https://tr.wikipedia.org/wiki/Sien_(Van_Gogh_serisi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Sien-with-Child-on-her-Lap_F1071_Vincent_van_Gogh.jpg","page_title":"Sien (Van Gogh serisi)","context_page_description":"Sien, Vincent van Gogh'un Hollanda'da yaşarken aynı adlı metresinin çizimlerinden oluşan seridir. Sanatçının bu serisindeki Keder adlı çalışması çizim yapmayı öğrenirken geçirdiği döneminin en önemli eserlerinden biridir.\\nBilinen adıyla Sien Hoornik, Clasina Maria Hoornik van Gogh'un Lahey'de yaşadığı 1881'den 1883'e kadar olan dönemin büyük çoğunluğunda sanatçıyla birlikteydi. Van Gogh Sien'i, hamile bir fahişeydi, model olarak kullanmış ve sonrasında onu kızıyla birlikte evine aldı. Sanatçı Sien ve kızını yoksul çalışanların zorlu yaşamını anlatan çizimleri ve resimlerinde dönem dönem kullandı. Bu ilişki sanatçının ailesi ve destekçileri tarafından hoş görülmedi ancak van Gogh'un kardeşi Theo kendisine olan desteğini yine de çekmedi. Sien ile ilişkisi van Gogh'un kendisini hem resim yapmada hem de ekonomik olarak destekleyen, hayran olduğu kuzeni ve Hague Ekolü'nün tanın bir ressamı Anton Mauve'in de ona olan desteğini durdurdu. Kardeşi Theo'nun ısrarlarıyla, van Gogh 1883'te Drenthe'e gidip orada resim yapmak için hayatı boyunca birlikte yaşadığı tek kadın olan Sien ile ilişkisini sonlandırdı."},{"page_url":"https://en.wikipedia.org/wiki/Harue_Koga","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Innocent_Moonlit_Night_%281929%29_by_Harue_Koga.jpg","page_title":"Harue Koga","context_page_description":"Harue Koga was a Japanese surrealist/avant-garde painter active in the Taishō period and early Showa Period."},{"page_url":"https://fr.wikipedia.org/wiki/Fronti%C3%A8re_entre_la_Cor%C3%A9e_du_Nord_et_la_Cor%C3%A9e_du_Sud","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Korean_dmz_map.png","page_title":"Frontière entre la Corée du Nord et la Corée du Sud","context_page_description":"La frontière entre la Corée du Nord et la Corée du Sud délimite les territoires de ces deux États. Elle est actuellement constituée d'une frontière terrestre matérialisée par la zone coréenne démilitarisée, et d'une frontière maritime dont la section ouest forme la Northern Limit Line."},{"page_url":"https://en.wikipedia.org/wiki/Imperial_County,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Imperial_valley_fields.jpg","page_title":"Imperial County, California","context_page_description":"Imperial County is a county in the U.S. state of California. As of the 2010 census, the population was 174,528. The county seat is El Centro. Established in 1907 from a division of San Diego County, it was the last county to be formed in California.\\nImperial County includes the El Centro, California Metropolitan Statistical Area. It is also part of the Southern California border region, the smallest but most economically diverse region in the state. It is located in the Imperial Valley, in the far southeast of California, bordering both Arizona and the Mexican state of Baja California.\\nAlthough this region is a desert, with high temperatures and low average rainfall of 3 inches per year, the economy is heavily based on agriculture due to irrigation, supplied wholly from the Colorado River via the All-American Canal.\\nThe Imperial Valley is divided between the United States and Mexico, and Imperial County is heavily influenced by Mexican culture. Approximately 80% of the county's population is Hispanic, with the vast majority being of Mexican origin."},{"page_url":"https://fr.wikipedia.org/wiki/Chamaerops_humilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Chamaerops_humilis_leaves02.jpg","page_title":"Chamaerops humilis","context_page_description":"Le palmier nain, palmier doum ou doum ou faux palmier doum est un palmier de petite taille, originaire des régions bordant la mer Méditerranée occidentale. Il est apprécié comme plante ornementale.\\nC'est la seule espèce du genre Chamaerops. Les autres espèces initialement classées dans ce genre ont été reclassées dans des genres voisins comme Trachycarpus, notamment Chamaerops fortunei devenu Trachycarpus fortunei.\\nLes Grecs appelaient le Chamaerops humilis, Phoenix chamaeriphes, ce qui signifie littéralement « palmier jeté à terre ».\\nCette plante est à l'origine du jour « chamerops » qui désigne le quatorzième jour du mois de floréal dans le calendrier républicain, soit l'équivalent du 3 mai dans le calendrier grégorien."},{"page_url":"https://de.wikipedia.org/wiki/Stadttheater_Bremerhaven","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Stadttheater_Bremerhaven_-_Mask_of_Tiefsinn_by_Roch_and_Feuerhahn_1909.png","page_title":"Stadttheater Bremerhaven","context_page_description":"Das Stadttheater Bremerhaven ist ein 1867 gegründetes Dreispartenhaus im Zentrum Bremerhavens mit Aufführungen von Opern, Operetten, Musicals, Schauspielen und Tanztheater. Die 1911 gebaute Spielstätte wurde bei dem schweren Bombenangriff in der Nacht des 18. September 1944 vollständig zerstört. Reste der Jugendstil-Fassade wurden in das 1952 neu gebaute Theatergebäude integriert."},{"page_url":"https://cs.wikipedia.org/wiki/Lond%C3%BDnsk%C3%A1_univerzita","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/University_of_London_illustration_1867.jpg","page_title":"Londýnská univerzita","context_page_description":"Londýnská univerzita je britskou federální univerzitou, která se skládá z 31 afilací: 19 jednotlivých univerzitních institucí a 12 výzkumných institutů. Londýnská univerzita je počtem studentů největší univerzitou ve Spojeném království – studuje zde 135 090 studentů bydlících na kolejích a více než 45 000 studentů účastnících se programu University of London International Programmes.\\nUniverzita byla založena díky královské výsadní listině, vydané v roce 1836, která spojila London University a King's College, aby společně utvořily Londýnskou univerzitu.\\nAbsolventi Londýnské univerzity mohou používat tzv. post-nominal letters 'Lond.', které mohou umístit za své tituly."},{"page_url":"https://fi.wikipedia.org/wiki/Mangrovevireo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Vireo_pallens.jpg","page_title":"Mangrovevireo","context_page_description":"Mangrovevireo on amerikkalainen varpuslintu. Sen esiintymisalue ulottuu Meksikon länsiosista Keski-Amerikkaan Nicaraguaan saakka. Lajista tunnetaan kymmenen alalajia. Osbert Salvin kuvaili lajin holotyypin Nicaraguan Realejosta vuonna 1863."},{"page_url":"https://it.wikipedia.org/wiki/Potassio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Potassium.JPG","page_title":"Potassio","context_page_description":"Il potassio è l'elemento chimico di numero atomico 19. Il suo simbolo è K e deriva dall'iniziale del nome latino kalium.\\nÈ un metallo alcalino tenero, bianco-argenteo che si trova in natura combinato con altri elementi sia nell'acqua di mare sia in molti minerali. Si ossida rapidamente all'aria ed è molto reattivo, specie con l'acqua; somiglia molto al sodio per il suo comportamento chimico. Trattasi di un elemento facilmente infiammabile e corrosivo."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%9B%E1%83%90%E1%83%9C%E1%83%A2%E1%83%90_%E1%83%9B%E1%83%9D%E1%83%A0%E1%83%A2%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/SamanthaMorton09TIFF.jpg","page_title":"სამანტა მორტონი","context_page_description":"სამანტა მორტონი — ინგლისელი მსახიობი და რეჟისორი. მიღებული აქვს ოქროს გლობუსის ჯილდო."},{"page_url":"https://hu.wikipedia.org/wiki/Jap%C3%A1n_labdar%C3%BAg%C3%B3-bajnoks%C3%A1g_(m%C3%A1sodoszt%C3%A1ly)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Ishin_Memorial_Park_Stadium_outview.JPG","page_title":"Japán labdarúgó-bajnokság (másodosztály)","context_page_description":"J2 League a Professzionális Japán Labdarúgó Liga második vonala, a Japán Labdarúgó-szövetség másodosztálya. Az osztály a többi J. League osztállyal egyetemben jelenleg a Meiji Yasuda Life szponzorálása alatt áll, és ezért hivatalosan a Meiji Yasuda J2 League nevet viseli. A 2014-es szezonig a J. League Division 2 nevet viselte. Jelenleg a J2 League a második szintet képviseli a Japán Labdarúgó-szövetség rendszerében. A legmagasabb osztályt a J1 League képviseli.\\nMásodosztályú labdarúgás már 1972 óta létezik Japánban; mindazonáltal csak az 1999-es szezon során lett hivatásos profi liga 10 csapat részvételével. A legmagasabb osztályból egy kieső csapat csatlakozott a már fél-profi másodosztály és a korábbi Japan Football League"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D1%8B%D0%B9_%D0%92%D0%BE%D1%81%D1%82%D0%BE%D0%BA_(%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Shkval_gunboat.jpg","page_title":"Красный Восток (монитор)","context_page_description":"«Кра́сный Восто́к» — монитор российского и советского флота, относящийся к типу «Шквал»; один из восьми мониторов этого типа."},{"page_url":"https://tr.wikipedia.org/wiki/Cide","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Cidede_aksam.jpg","page_title":"Cide","context_page_description":"Cide, Türkiye Cumhuriyeti'nin Karadeniz Bölgesi'nde yer alan Kastamonu ilinin bir ilçesidir.\\nİlçe 939 km²'lik bir alanı kaplar ve toplam nüfusu 22.642'dir.\\n1868 yılında ilçe olan Cide’nin 85 köyü ve bu köylere bağlı 204 mahallesi bulunmaktadır. İlçede belediyeye bağlı altı mahalle vardır. İlçeye bağlı belde ve kasaba yoktur."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Quentin_de_Saint-Quentin-de-Baron","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/St_Quentin_de_Baron_Eglise_St_Quentin_Modillons_28.JPG","page_title":"Église Saint-Quentin de Saint-Quentin-de-Baron","context_page_description":"L'église Saint-Quentin est une église catholique située dans la commune de Saint-Quentin-de-Baron, dans le département de la Gironde, en France."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%BD%D1%82%D0%B5%D1%80%D0%BF%D1%80%D0%B5%D1%82%D0%B0%D1%86%D0%B8%D1%98%D0%B0_%D1%98%D0%B5%D0%B7%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Garry_Kasparov_-_Klaus_Bednarz_at_lit_Cologne_2007_-_%286748%29.jpg","page_title":"Интерпретација језика","context_page_description":"Интерпретација или тумачење представља олакшавање усмене знаковно-језичке комуникације, истовремено или узастопно, између корисника који говоре различите језике. Традуктологија представља систематично учење теорија, описа и апликације тумачења и превођења.\\nИнтерпретатор је особа која преводи мисао или експресију у матерњи језик, као експресију истог значења, узастопно у \\"реалном времену\\" или истовремено када излагач прави паузе између једне или две реченице.\\nУлога интерпретатора је да пренесе сваки семантички елемент као и тон и да региструје тј. растумачи сваку намеру и осећај поруке коју излагач прича на неком језику, на тражени језик\\nЗа написане говоре и предавања, понекад се користи читање претходно преведених текстова."},{"page_url":"https://de.wikipedia.org/wiki/Illighausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/IllighausnRiegel.jpg","page_title":"Illighausen","context_page_description":"Illighausen ist eine ehemalige Orts- und Munizipalgemeinde und eine Ortschaft der Gemeinde Lengwil im Bezirk Kreuzlingen des Kantons Thurgau in der Schweiz. Das Haufendorf Illighausen liegt auf dem Seerücken südöstlich von Kreuzlingen.\\nSeit 1998 bildet die ehemalige Munizipalgemeinde Illighausen mit deren Ortsgemeinden Illighausen und Oberhofen bei Kreuzlingen die politische Gemeinde Lengwil, während die früher ebenfalls zur Munizipalgemeinde Illighausen zählende Ortsgemeinde Schönenbaumgarten seit 1998 zu Langrickenbach und der Weiler Ast aus der ehemaligen Ortsgemeinde Oberhofen zu Berg gehört."},{"page_url":"https://en.wikipedia.org/wiki/Pralayollas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Nazrul.jpg","page_title":"Pralayollas","context_page_description":"Pralayollas, also known after its first line as Tora sab jayadbhani kar is a popular revolutionary Bengali song set to Dadra Tala, whose lyrics and tune were written by national poet Kazi Nazrul Islam in 1921. It was the first revolutionary Bengali poem collected in early 1922 in a volume titled Agnibeena: the first anthology of Nazrul's poems."},{"page_url":"https://en.wikipedia.org/wiki/Lucas_Dumbrell_Motorsport","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Russell_Ingall_in_Lucas_Dumbrell_Motorsport_car_23%2C_departing_pitlane_during_the_V8_Supercars_Test_Day_%281%29.jpg","page_title":"Lucas Dumbrell Motorsport","context_page_description":"Lucas Dumbrell Motorsport was an Australian motor racing team that competed in the Virgin Australia Supercars Championship. The team was sold to Phil Munday and re-branded as 23Red Racing at the end of 2017."},{"page_url":"https://cs.wikipedia.org/wiki/Rupnikova_linie","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Seja_Odbora_za_obrambo_v_utrdbi_Rupnikove_linije_2016_1.JPG","page_title":"Rupnikova linie","context_page_description":"Rupnikova linie byla linie stálého opevnění, který byl budován od roku 1926 až do roku 1941 v Jugoslávii, na hranicích s Itálií, od roku 1938 také na nové hranici s Třetí říší a Maďarskem a v menší míře na ostatních hranicích. Byla stavěna podle vzoru Československého opevnění a Maginotovy linie. Pojmenovaná je po generálu Leonu Rupnikovi."},{"page_url":"https://en.wikipedia.org/wiki/List_of_almshouses_in_the_United_Kingdom","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Tollemache_Almshouses.JPG","page_title":"List of almshouses in the United Kingdom","context_page_description":"The following is a list of British almshouses:"},{"page_url":"https://sh.wikipedia.org/wiki/Membranofoni_instrumenti","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Standard_timpani_setup.jpg","page_title":"Membranofoni instrumenti","context_page_description":"Muzički instrumenti su sredstva pomoću kojih muzičari stvaraju muziku u živom izvođenju. Najtačnija i najpreciznija podela muzičkih instrumenata, zavisno od građe i načina dobijanja tona i zvuka, je na sledeće muzičke instrumente:\\n1. Membranofone ili opnozvučne instrumente\\n2. Idiofone instrumente\\n3. Kordofone, hordofone ili žičane instrumente\\n4. Aerofone instrumente\\n5. Elektrofone, eterofone ili elektronske instrumente"},{"page_url":"https://de.wikipedia.org/wiki/Lengelbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Lengelbachtal-13.jpg","page_title":"Lengelbach","context_page_description":"Der Lengelbach, auch Lengel und im Ober- und Mittellauf auch Stiedenbach genannt, ist ein etwa 11,4 km langer, südsüdöstlicher und orographisch rechter Zufluss der Eder im Landkreis Waldeck-Frankenberg in Nordhessen."},{"page_url":"https://ceb.wikipedia.org/wiki/Aiguille_de_Triolet","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Ghiacciaio_di_Tal%C3%A8fre_001.JPG","page_title":"Aiguille de Triolet","context_page_description":"Tumoy sa bukid ang Aiguille de Triolet sa Pransiya. Nahimutang ni sa amihanan-sidlakang bahin sa nasod, 500 km sa habagatan-sidlakan sa Paris ang ulohan sa nasod. 3,870 metros ibabaw sa dagat kahaboga ang nahimutangan sa Aiguille de Triolet, o 317 ka metros sa ibabaw sa naglibot nga tereyn. Mga 1.2 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Aiguille de Triolet kay kasagaran kabukiran, apan sa diha-diha nga ang mga palibot nga kini mao ang kabungtoran. Kinahabogang dapit sa palibot ang Mont Blanc, 4,810 ka metros ni kahaboga ibabaw sa dagat, 15.5 km sa habagatan-kasadpan sa Aiguille de Triolet. Dunay mga 17 ka tawo kada kilometro kwadrado sa palibot sa Aiguille de Triolet may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Chamonix-Mont-Blanc, 11.9 km sa kasadpan sa Aiguille de Triolet. Hapit nalukop sa kasagbotan ang palibot sa Aiguille de Triolet. Sa rehiyon palibot sa Aiguille de Triolet, kabukiran, ug yelo talagsaon komon.\\nAng klima tundra. Ang kasarangang giiniton -2 °C. Ang kinainitan nga bulan Agosto, sa 8 °C, ug ang kinabugnawan Disyembre, sa -13 °C. Ang kasarangang pag-ulan 1,303 milimetro matag tuig."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D0%B0%D1%9E%D0%BD%D0%BE%D1%87%D0%BD%D0%B0-%D1%9E%D1%81%D1%85%D0%BE%D0%B4%D0%BD%D1%8F%D1%8F_%D0%B0%D0%BA%D1%80%D1%83%D0%B3%D0%B0_(%D0%91%D0%B0%D1%82%D1%81%D0%B2%D0%B0%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Botswana-North-East.png","page_title":"Паўночна-ўсходняя акруга (Батсвана)","context_page_description":"Паўночна-усходняя акруга — адна з дзевяці акруг Батсваны, якая размяшчаецца на паўночным усходзе краіны і мяжуе з Зімбабвэ. Адміністрацыйны цэнтр — Масунга. Плошча — 5 120 км², насельніцтва складае 132 422 чалавек."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BB%D0%BB%D0%B8,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/William_Lilly.jpg","page_title":"Лилли, Уильям","context_page_description":"Уильям Лилли — английский астролог, писатель. Автор «Христианской астрологии», оказавшей существенное влияние на всю последующую литературу на английском языке по хорарной астрологии."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Milan_Metro_stations","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cologno_Monzese_-_stazione_metropolitana_Cologno_Centro_-_esterno.jpg","page_title":"List of Milan Metro stations","context_page_description":"The Milan Metro is the rapid transit/metro system serving Milan, Italy. The network comprises 4 lines, identified by different numbers and colors, with a total route length of 100 kilometres and 106 stations. The system has a daily ridership of over one million.\\nThe metro network is connected to the Milan suburban railway service through several stations. Metro lines are identified by the letter \\"M\\", while suburban line numbers are preceded by the letter \\"S\\"."},{"page_url":"https://en.wikipedia.org/wiki/California_Historical_Landmarks_in_Del_Norte_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/BrotherJonathan-Cemetery_Crescent_City%2C_CA.jpg","page_title":"California Historical Landmarks in Del Norte County","context_page_description":"This list includes properties and districts listed on the California Historical Landmark listing in Del Norte County, California. Click the \\"Map of all coordinates\\" link to the right to view a Google map of all properties and districts with latitude and longitude coordinates in the table below."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BB%D1%8C%D1%8F-%D0%B4%D0%B5-%D0%A1%D0%B8%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Velilla_de_Cinca_-_Ayuntamiento_-_Iglesia_de_San_Lorenzo_01.jpg","page_title":"Велилья-де-Синка","context_page_description":"Велилья-де-Синка — муниципалитет в Испании, входит в провинцию Уэска, в составе автономного сообщества Арагон. Муниципалитет находится в составе района Бахо-Синка. Занимает площадь 16,5 км². Население — 450 человек. Расстояние — 99 км до административного центра провинции."},{"page_url":"https://vi.wikipedia.org/wiki/Libellula","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Libellula_vibrans_NBII.jpg","page_title":"Libellula","context_page_description":"Libellula là một chi chuồn chuồn ngô trong họ Libellulidae, phân bố rộng khắp vùng ôn đới của bắc bán cầu. Hầu hết các loài được tìm thấy ở Mỹ, các loài ở đây có kích thước lớn thường sống ở những hồ nước ngọt vào mùa hè. Nhiều loài có cánh sặc sỡ."},{"page_url":"https://nv.wikipedia.org/wiki/Dzi%C5%82tah_w%C3%B3yiyiitsah%C3%AD_biz%C3%A9%C3%A9%CA%BC_%C5%82igaa%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/White-throated_Tyrannulet_-_Colombia_S4E1366_%2816872351571%29.jpg","page_title":"Dziłtah wóyiyiitsahí bizééʼ łigaaígíí","context_page_description":"Dziłtah wóyiyiitsahí bizééʼ łigaaígíí éí tsídii tsídígíí dah yikahjí atah yisdzoh, áádóó éí Shádiʼááhjí kéyah dah siʼánígíí bikááʼgóó hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Mecocerculus leucophrys\\" deiłníigo dayózhí."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_pemenang_Miss_Universe","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Janelle_Commissiong%2C_ACF_2014.png","page_title":"Senarai pemenang Miss Universe","context_page_description":"Berikut ialah senarai wanita yang memenangi gelaran Miss Universe."},{"page_url":"https://br.wikipedia.org/wiki/Herri_al_Leon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Braunschweig_Brunswick_Heinrich_der_Loewe_%28Dom_2005%29.jpg","page_title":"Herri al Leon","context_page_description":"Herri al Leon, pe Heinrich der Löwe en alamaneg, a voe Dug Sachsen adal 1142 ha dug Bavaria adal 1156, div zugelezh a zalc'has betek 1180. Unan eus galloudusañ priñsed Alamagn e oa, ken na deuas e gevezer ha kenderv eus an tiegezh Hohenstaufen Friedrich Barbarossa, hag e vab Herri VI, da dennañ digantañ Dugelezh Sachsen ha dugelezh Bavaria"},{"page_url":"https://en.wikipedia.org/wiki/Rose%E2%80%93Baley_Party","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/The_How_and_Why_Library_009.jpg","page_title":"Rose–Baley Party","context_page_description":"The Rose–Baley Party was the first European American emigrant wagon train to traverse the 35th parallel route known as Beale's Wagon Road, established by Edward Fitzgerald Beale, from Zuni Pueblo, New Mexico to the Colorado River near present-day Needles, California.\\nIn 1858, a wealthy businessman from Keosauqua, Iowa, Leonard John Rose, formed the party after hearing stories from gold miners returning from California. He subsequently financed a well-equipped wagon train that included twenty horses and two hundred head of purebred red Durham cattle. He also acquired four large covered wagons and three yoke of oxen to pull them each wagon. The Rose company left Iowa in early April, and in mid-May they were joined by the Baley company, led by a forty-four-year-old veteran of the Black Hawk War, Gillum Baley. Their combined outfits numbered twenty wagons, forty men, fifty to sixty women and children, and nearly five hundred head of cattle. John Udell, a 62-year-old Baptist minister kept a daily journal of the party's travels, recording the locations of their campsites, documenting their progress, and noting the availability of resources."},{"page_url":"https://cs.wikipedia.org/wiki/Doln%C3%AD_Kramol%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Doln%C3%AD_Kramol%C3%ADn_Most_03.jpg","page_title":"Dolní Kramolín","context_page_description":"Dolní Kramolín je malá vesnice, část městyse Chodová Planá v okrese Tachov. Nachází se asi 2,5 km na severovýchod od Chodové Plané. Je zde evidováno 45 adres. V roce 2011 zde trvale žilo 43 obyvatel.\\nDolní Kramolín je také název katastrálního území o rozloze 3,51 km²."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D8%A8%DA%A9%D9%87%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%B2%DB%8C%D8%B3%D8%AA%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Protein_Interaction_Network_for_TMEM8A.png","page_title":"شبکه‌های زیستی","context_page_description":"شبکهٔ زیستی به هر شبکه‌ای گفته می‌شود که برای سیستم‌های زیستی مورد استفاده قرار می‌گیرد. یک شبکه به سیستمی گفته می‌شود که شامل زیربخش‌هایی باشد که به یکدیگر در غالب یک کل، پیوند داشته باشند، مانند گونه‌های مختلف که در شبکهٔ غذایی کل با یکدیگر در ارتباطند. شبکه‌های زیستی نمایش ریاضی‌ای برای ارتباطات موجود در مطالعات محیط زیستی، تکاملی و مطالعات فیزیولوژیکی همانند شبکه‌های عصبی را ارائه می‌دهند. تحلیل و کار روی شبکه‌های زیستی با توجه به بیماری‌های انسان، منجر به ایجاد حوزهٔ شبکهٔ دارویی شده‌است.\\nمطالعهٔ شبکه‌های زیستی، درک مدل آن‌ها، تحلیل و تجسم آن‌ها در علم امروز نقش بسیار مهمی دارد. درک این شبکه‌ها برای دید زیستی بهتر از داده‌های پیچیده و بسیار زیادی که در حال تولید شدن هستند بسیار ضروری است. تجسم و تصور شبکه از روش‌های بنیادینی است که به فهم شبکه‌های زیستی برای آشکار کردن ویژگی‌های مهم فرایندهای زیرلایهٔ بیوشیمیایی کمک می‌کند.\\nتعداد بسیاری از شبکه‌های زیستی مهم مربوط به مولکول‌هایی مانند DNA, RNA، پروتئین‌ها و ترکیبات مورد نیاز برای سوخت‌وساز سلول و فعل و انفعالات بین آن‌ها می‌باشد. شبکهٔ تنظیم ژن‌ها و هدایت سیگنال‌ها به ما می‌گوید هر ژن چگونه و بر اثر چه عواملی فعال یا سرکوب می‌شود و بوسیلهٔ آن می‌فهمیم کدام پروتئین‌ها در چه زمان مشخصی در سلول تولید می‌شوند."},{"page_url":"https://en.wikipedia.org/wiki/List_of_machine_guns","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/LMG_24_29_2.JPG","page_title":"List of machine guns","context_page_description":"This is a list of machine guns and their variants.\\nThe tables are sortable."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D0%B0%D0%BF%D0%B0%D0%B3%D0%BE%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D1%8E%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Buteo_galapagoensis_distribution.PNG","page_title":"Галапагосский канюк","context_page_description":"Галапагосский канюк, или галапагосский сарыч — хищная птица из семейства ястребиных, эндемик Галапагосских островов."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%9C%E3%83%86%E3%83%B3%E3%83%95%E3%82%A3%E3%83%B3%E3%83%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Cactus_ground_finch_Santa_Cruz.jpg","page_title":"サボテンフィンチ","context_page_description":"サボテンフィンチ は、フウキンチョウ科のダーウィンフィンチ類に属する鳥類の1種。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%BE%D0%BB%D0%BE%D0%B2%D1%96%D1%87%D0%B0_%D0%B7%D0%B1%D1%96%D1%80%D0%BD%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_%D0%B7_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_%D1%81%D0%B5%D1%80%D0%B5%D0%B4_%D0%BB%D1%8E%D0%B4%D0%B5%D0%B9_%D0%B7_%D0%B2%D0%B0%D0%B4%D0%B0%D0%BC%D0%B8_%D1%81%D0%BB%D1%83%D1%85%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/%D0%9D%D0%A2%D0%91_%D0%9B%D1%8E%D1%81%D1%82%D0%B4%D0%BE%D1%80%D1%84.jpg","page_title":"Чоловіча збірна України з футболу серед людей з вадами слуху","context_page_description":"Чоловіча дефлімпійська збірна України з футболу — чоловіча футбольна збірна, яка представляє Україну на міжнародних змаганнях з футболу серед людей з вадами слуху. Ставала чемпіоном Дефлімпійських ігор 2009 року та двічі срібний призер."},{"page_url":"https://sv.wikipedia.org/wiki/Begonia_reniformis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Begonia_reniformis_BotGardBln27120A.jpg","page_title":"Begonia reniformis","context_page_description":"Begonia reniformis är en begoniaväxtart som beskrevs av Jonas Dryander. Begonia reniformis ingår i släktet begonior, och familjen begoniaväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Olej_bawe%C5%82niany","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Russellllinters.jpg","page_title":"Olej bawełniany","context_page_description":"Olej bawełniany - otrzymywany jest z nasion różnych gatunków bawełny – jako produkt uboczny.\\nNasiona te zawierają 14-25% oleju tłustego, półschnącego, rzadko używanego w farmacji, częściej w celach technicznych lub spożywczych. Olej zawiera związek fenolowy – gossypol."},{"page_url":"https://et.wikipedia.org/wiki/David_Harvey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/David_Harvey2.jpg","page_title":"David Harvey","context_page_description":"David W. Harvey FBA on tunnustatud inimgeograaf. Ta on antropoloogia ja geograafia professor New Yorgi Linnaülikoolis ja kuulub 20 tsiteerituima humanitaarteadlase hulka. Ta on ka maailma tsiteerituim akadeemiline geograaf ja tema raamatud ja esseed on mõjutanud kaasaegse geograafia distsipliini kujunemist.\\nHarvey on tegelenud kapitalismikriitika ja kriitilise geograafiaga ja mitmed tema seisukohad on olulised ühiskondlikus ja poliitilises debatis. Tänu Harveyle hakati kapitalismi kriitika juures taas sotsiaalse klassi mõistet ja marksistlikke meetodeid kasutama. Ta pooldab inimeste õigust linnale ja on tärkava Rahvusvahelise Osalusühiskonna Organisatsiooni üleminekukomitee liige.\\nHarvey uurimishuvide hulka kuuluvad geograafia, sotsiaalteooria, urbaanne poliitökonoomia, linnastumine arenenud kapitalistlikes riikides, marksism ja sotsiaalne õiglus."},{"page_url":"https://en.wikipedia.org/wiki/Kurt_Cobain","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Kurt_St_Thomas_1991_cropped.jpg","page_title":"Kurt Cobain","context_page_description":"Kurt Donald Cobain was an American singer-songwriter and musician, best known as the guitarist, primary songwriter and frontman of the rock band Nirvana. Through his angst-fueled songwriting and anti-establishment persona, Cobain's compositions widened the thematic conventions of mainstream rock music. He was often heralded as a spokesman of Generation X and is considered to be one of the most influential musicians in the history of alternative rock.\\nBorn in Aberdeen, Washington, Cobain formed the band Nirvana with Krist Novoselic and Aaron Burckhard in 1987 and established it as part of the Seattle music scene which later became known as grunge. After signing with major label DGC Records, Nirvana found global success with \\"Smells Like Teen Spirit\\" from their critically acclaimed second album Nevermind. Although Cobain was hailed as the voice of his generation following Nirvana's sudden success, he resented this, believing his message and artistic vision had been misinterpreted by the public."},{"page_url":"https://en.wikipedia.org/wiki/First_Battle_of_Tijuana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Magonistas_mexicanos_en_Tijuana_1911.jpg","page_title":"First Battle of Tijuana","context_page_description":"The First Battle of Tijuana was an early engagement of the Mexican Revolution and the first significant victory for the Magonistas. Tijuana was captured and held by rebel forces on May 9, 1911 and was used as a haven for recruiting American volunteers from California."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%B9%CE%BF%CF%8D%CF%84%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/BrighamYoung1.jpg","page_title":"Γιούτα","context_page_description":"Η Πολιτεία της Γιούτα είναι δυτική πολιτεία των ΗΠΑ. Ήταν η 45η πολιτεία που έγινε δεκτή στην Ένωση στις 4 Ιανουαρίου του 1896. Έχει έκταση 219.882 τ.χλμ. και πληθυσμό 3.161.105 κατοίκους. Περίπου το 80% του πληθυσμού ζει γύρω από το Μέτωπο Γουάσατς, μια αστική περιοχή με κέντρο την πρωτεύουσα Σολτ Λέικ Σίτι. Σε αντίθεση, τεράστιες εκτάσεις της πολιτείας είναι σχεδόν ακατοίκητες, κάνοντας τον πληθυσμό τον έκτο πιο αστικοποιημένο στις ΗΠΑ.\\nΤο όνομα «Γιούτα» προέρχεται από την γλώσσα των Ινδιάνων Γιουτ και σημαίνει «άνθρωποι των βουνών».\\nΗ Γιούτα είναι γνωστή ως μια από τις πιο θρησκευτικά ομοιογενείς πολιτείες στις ΗΠΑ. Μεταξύ 58% και 72% των κατοίκων της Γιούτα αναφέρονται να είναι μέλη της Εκκλησίας του Ιησού Χριστού των Αγίων των Τελευταίων Ημερών, η οποία επηρεάζει ευρέως τον πολιτισμό της Γιούτα και την καθημερινή ζωή.\\nΗ πολιτεία αποτελεί κέντρο μεταφορών, πληροφορικής και έρευνας, κυβερνητικών υπηρεσιών και εγκαταστάσεων ορυχείων καθώς και τουριστικός προορισμός για υπαίθρια αναψυχή. Σύμφωνα με τις εκτιμήσεις πληθυσμού του Γραφείου Απογραφών των ΗΠΑ, η Γιούτα ήταν η ταχύτερα αναπτυσσόμενη πολιτεία στις Ηνωμένες Πολιτείες το 2008."},{"page_url":"https://fr.wikipedia.org/wiki/Camou-Cihigue","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Camou_%28Camou-Cihigue%2C_Pyr-Atl%2C_Fr%29_%C3%A9glise.JPG","page_title":"Camou-Cihigue","context_page_description":"Camou-Cihigue est une commune française, située dans le département des Pyrénées-Atlantiques en région Nouvelle-Aquitaine.\\nLe gentilé est Gamerear."},{"page_url":"https://eu.wikipedia.org/wiki/Iru%C3%B1eko_harresiak","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Portal_de_Francia.JPG","page_title":"Iruñeko harresiak","context_page_description":"Iruñeko harresiak Nafarroako hiriburu Iruñeko Alde Zaharra inguratzen duten harresiak dira. Hiri osoa hertsirik edukitzeko eraikiak, hiria zabaltzekotan zati batzuk eraitsiak izan ziren. Gaur egun zati nabarmenak mantentzen dira, bereziki hiri historikoaren iparraldean eta Iruñeko zitadelaren bost aldeetatik hiru babesten. Hainbat bastioi, rebellin eta kontragoardia ikus daitezke oraindik zitadela, Takonera edo Redin inguruan."},{"page_url":"https://fr.wikipedia.org/wiki/Kate_Walsh","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Private_Practice-Logo.svg","page_title":"Kate Walsh","context_page_description":"Kate Walsh née Kathleen Erin Walsh le 13 octobre 1967 à San Jose en Californie est une actrice américaine.\\nElle est principalement connue pour son interprétation du Dʳ Addison Montgomery dans les séries médicales Grey's Anatomy et Private Practice, entre 2005 et 2013 ainsi que pour son rôle d'Olivia Baker dans la série dramatique 13 Reasons Why, entre 2017 et 2018."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A6%BE%E0%A6%A8%E0%A6%BF_%E0%A6%87%E0%A6%A8_%E0%A6%A6%E0%A7%8D%E0%A6%AF_%E0%A6%AC%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%82%E0%A6%95_%E0%A6%B2%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%A1%E0%A6%BE%E0%A6%B0_%E0%A6%AE%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Professional_wrestling_ladder_match.jpg","page_title":"মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচ","context_page_description":"মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচ হল পেশাদার কুস্তির পদন্নোতি ডাব্লিউডাব্লিউই কর্তৃক আয়োজিত ল্যাডার ম্যাচ। প্রথম দিকে রেসলম্যানিয়াতে মানি ইন দ্য ব্যাংক লেডার ম্যাচ অনুষ্ঠিত হত, পরে মানি ইন দ্য ব্যাংক প্রতি-দর্শনে-পরিশোধ প্রতিষ্ঠার মাধ্যমে রেসলম্যানিয়া থেকে বিচ্ছিন্ন করা হয়। ২০০৫ সালের রেসলম্যানিয়া ২১ এ প্রথমবারের মত মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচ অনুষ্ঠিত হয়। সেই ম্যাচে র এর সেরা সুপারস্টাররা অংশগ্রহণ করে। সেই ম্যাচে বিজয়ী ছিলেন এজ। ২০০৬ থেকে ২০১০, এমআইটিবি ম্যাচ, সকল ডাব্লিউডাব্লিউই ব্রান্ডে মুক্ত ছিল, রেসলম্যানিয়া ছিল মানি ইন দ্য ব্যাংক ল্যাডার ম্যাচের প্রধান অবলম্বন। ২০১০ সালে দ্বিতীয় এবং তৃতীয় মানি ইন দ্য ব্যাংক অনুষ্ঠিত হয় যখন মানি ইন দ্য ব্যাংক প্রতি-দর্শনে-পরিশোধ অনুষ্ঠান শুরু হয়। এটি রেসলম্যানিয়া থেকে ভিন্ন হয়, এই নতুন আয়োজনে দুই ধরনের ল্যাডার ম্যাচ হয়– দুইটি চুক্তি ছিল, যথাক্রমে ডাব্লিউডাব্লিউই চ্যাম্পিয়নশীপ এবং ওয়ার্ল্ড হেভিওয়েট চ্যাম্পিয়নশীপ।\\nবার্ষিক মানি ইন দ্য ব্যাংক প্রতি-দর্শনে-পরিশোধ আয়োজন প্রতিষ্ঠার পূর্বে কুস্তিগীররা এই চুক্তি ব্যবহার করে যেকোন ওয়ার্ল্ড হেভিওয়েট চ্যাম্পিয়নশীপের ম্যাচ খেলার দাবি করতে পারে।\\nপ্রতি-দর্শনে-পরিশোধ প্রতিষ্ঠার পর থেকে এই চুক্তি দিয়ে অন্য যেকোন চ্যাম্পিয়নশীপ অংশগ্রহণ করা যায়।"},{"page_url":"https://gl.wikipedia.org/wiki/Jos%C3%A9_Gea_Escolano","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Mons._Gea_Escolano_%2830279526014%29.jpg","page_title":"José Gea Escolano","context_page_description":"José Gea Escolano, nado en Real de Gandía o 14 de xuño de 1929 e finado en Valencia o 6 de febreiro de 2017, foi un eclesiástico católico español que foi bispo de Mondoñedo-Ferrol."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B1%DA%A9%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bomarzo_parco_mostri_orco.jpg","page_title":"ارکوس","context_page_description":"اُرکوس یا اورکوس، یکی از خدایان دنیای زیرین یا عالم مردگان، و مجازات‌کننده سوگند شکنان در اساطیر رومی و ایتالیایی بود. او بیشتر از آنکه معادل هادس یونانی باشد، معادل و همسان با پلوتون رومی بود و بعدها با دیس پاتر نیز همسان شناخته شد. وی در نقاشی‌های مقبره یا معبد معروفی در اتروسک به صورت یک غول ریشوی پُرمو، مجسم شده‌است. معبد مربوط به ارکوس احتمالاً در تپه پالاتین واقع در رم قرار داشته‌است. این احتمال نیز وجود دارد که وی را بتوان حرف نویسی شده یا ترجمانی از شبح یونانی که هورکوس دانست که تجسم انسانی و شخصیتمند سوگند و قسم و یکی از پسران اریس بود.\\nاورکوس در اساطیر روم باستان خدای مرگ بود که مردگان را به دنیای زیرین می‌برد."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%86%DA%A9%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Cancale.jpg","page_title":"کنکل","context_page_description":"کنکل یک کمون در کشور فرانسه است که در canton of Cancale واقع شده‌است."},{"page_url":"https://id.wikipedia.org/wiki/Nuku_Muhammad_Amiruddin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Nuku_Muhammad_Amiruddin.jpg","page_title":"Nuku Muhammad Amiruddin","context_page_description":"Muhammad Amiruddin atau lebih dikenal dengan nama Sultan Nuku adalah seorang sultan dari Kesultanan Tidore yang dinobatkan pada tanggal 13 April 1779, dengan gelar “Sri Paduka Maha Tuan Sultan Saidul Jehad el Ma’bus Amiruddin Syah Kaicil Paparangan” [1] Selama masa perang dengan VOC, Nuku disebut juga sebagai Jou Barakati, artinya Tuan Yang Diberkahi.\\nSebagai penghargaan terhadap jasa-jasanya, Pemerintah Republik Indonesia menganugerahkan Sultan Nuku sebagai \\" Pahlawan Nasional Indonesia\\" berdasarkan Keputusan Presiden RI No. 071/TK/1995, tanggal 7 Agustus 1995.[2]"},{"page_url":"https://ms.wikipedia.org/wiki/Orang_Tungus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Manchuguard.jpg","page_title":"Orang Tungus","context_page_description":"Orang Tungus merupakan bangsa-bangsa yang bertutur dalam bahasa-bahasa Tungus yang tergolong dalam famili bahasa Altaik. Nama Tungus berasal dari Tunguska, sebuah kawasan di Siberia."},{"page_url":"https://fr.wikipedia.org/wiki/Course_de_c%C3%B4te_Zbraslav_-_J%C3%ADlovi%C5%A1t%C4%9B","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Zbraslav_-_pohled_od_vyhl%C3%ADdkov%C3%A9ho_alt%C3%A1nu_na_%C3%BAbo%C4%8D%C3%AD_kopce_Z%C3%A1vist.jpg","page_title":"Course de côte Zbraslav - Jíloviště","context_page_description":"La course de côte Zbraslav-Jíloviště est une ancienne compétition automobile tchèque disputée en Bohème pour voitures de course et motocyclettes, dans la région de Bohême centrale à l'ouest de Prague, sur un parcours immuable de 5.6 kilomètres. Elle se déroulait habituellement au printemps, entre la mi-avril et la mi-mai."},{"page_url":"https://lb.wikipedia.org/wiki/Radarastronomie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Goldstone_Deep_Space_Network.jpg","page_title":"Radarastronomie","context_page_description":"D'Radarastronomie ass eng Method fir Ënnersich vu physikaleschen Eegenschafte an bildleche Duerstellunge vun Himmelskierper aus eisem Sonnesystem ze maachen. Bei dëser Technik ginn Mikrowelle vun engem grousse Radioteleskop oder engem anere Sender, dee fäeg ass staark gebëndelt Mikrowellestralen a Richtung vun engem z'ënnersichenden Objet ze verschécken, an uschléissend mat engem Radioteleskop oder Verbond vu Radioteleskope déi reflektéiert Mikrowellen, also den Echo z'ënnersichen. D'Radarastronomie ënnerscheet sech vun der normaler Radioastronomie doran, datt d'Radioastronomie eng reng passiv Observatiounsmethod vun der ukommender Stralung vun engem Objet ass an Radarastronomie aktiv selwer Stralung fortschéckt. An der Radarastronomie gëtt zousätzlech nach tëscht gepulster an kontinuéierlecher Mikrowellesendung ënnerscheet."},{"page_url":"https://en.wikipedia.org/wiki/Fosdinovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Fosdinovo_6.jpg","page_title":"Fosdinovo","context_page_description":"Fosdinovo is a comune in the Province of Massa and Carrara in the Italian region Tuscany, located about 110 kilometres northwest of Florence and about 15 kilometres northwest of Massa.\\nFosdinovo borders the following municipalities: Aulla, Carrara, Castelnuovo Magra, Fivizzano, Ortonovo, Sarzana.\\nThe town is home to a medieval castle of the Malaspina family, rulers of the duchy of Massa. It is also the seat of the Medieval Festival of Fosdinovo and the Forza del Sorriso Festival. This second festival is a new, vital festival where the chief theme is the smile.\\nNear to the castle is the Church of San Remigio, built in the 13th century by the Bishops of Luni. The baroque church contains the marble tomb of Galeotto Malaspina. The Oratorio della Compagnia dei Bianchi was built in the 16th century and features a white marble facade donated by Pasquale Malaspina in 1666."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%94%D0%B0%D1%83%D1%8B%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/King_david_tomb.jpg","page_title":"Дауыт","context_page_description":"Дауыт — Талуттан ҡала Исраил халҡының икенсе батшаһы, Бет-Ләхәмдә тыуып үҫкән Йишайҙың кинйә улы. Библияға ярашлы, ҡырҡ йыл батшалыҡ итә: ете йыл да алты ай — Йәһүҙиәнең, унан һуң утыҙ өс йыл берләшкән Исраил менән Йәһүҙиә батшалығының батшаһы була. Төрлө хронологиялар буйынса, хакимлыҡ итеү даталары: беҙҙең эраға тиклем 1055—1015 йылдар, беҙҙең эраға тиклем 1012—972 йылдар, беҙҙең эраға тиклем 1005—965 йылдар, традицион йәһүд хронологияһы буйынса, беҙҙең эраға тиклем 876—836 йылдар тирәһе. Дауыт иң камил хаким итеп һүрәтләнә. Дауыттың тарихта булыу-булмауы фәнни бәхәстәр уртаһында ҡалыуын дауам итә.\\nБиблиялағы пәйғәмбәрлек итеүҙәргә ярашлы, Дауыт ырыуынан Мәсих сығырға тейеш. Йәһүд традицияһы буйынса Мәсих киләсәктә килергә тейеш, ә христиан Яңы Ғәһеде буйынса, Мәсих күптән килгән, ул — Ғайса Мәсих."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%84%D8%A7%D8%AD_%D8%A7%D9%84%D8%AC%D9%88_%D8%A7%D9%84%D8%B3%D9%84%D8%B7%D8%A7%D9%86%D9%8A_%D8%A7%D9%84%D8%B9%D9%85%D8%A7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/JaguarSO1_IL-38_1987.jpeg","page_title":"سلاح الجو السلطاني العماني","context_page_description":"سلاح الجو السلطاني العُماني تم تشكيل سلاح الجو السلطاني العُماني في 1 مارس 1959م، حيث كانت به ثلاث طائرات تدريب و طائرتا نقل فقط تعمل على مهبط صغير في بيت الفلج، وفي عام 1961م دخلت السلاح أربع طائرات، تبعتها في عام 1967م اثنا عشر طائرة، و منذ أن تولى السلطان قابوس بن سعيد بن تيمور آل سعيد مقاليد الحكم في عُمان عام 1970م وسلاح الجو السلطاني العُماني يؤدي دوره الوطني المناط به في حماية أجواء الوطن، وإسناد أسلحة قوات السلطان المسلحة والمساهمة في بنائه وتنميته، وإيماناً من جلالته بهذا الدور فقد تم في العام نفسه شراء ثلاث طائرات و ست طائرات وثـمان طائرات عمودية، وذلك لتوفير حماية للحركة اللازمة لوحدات قوات السلطان المسلحة العاملة في المناطق الجبلية، وفي عام 1971م دخلت الخدمة خمس طائرات لتقديم الإسناد اللازم لجهود التنمية في السلطنة، وفي فبراير 1975م دخلت طائرات في خدمة السلاح وأدت دوراً مهما في تقديم الإسناد الجوي القريب، وتنفيذ مهام عملياتية هامة."},{"page_url":"https://en.wikipedia.org/wiki/M%C3%A1tra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Ilonavalleywaterfall2017.jpg","page_title":"Mátra","context_page_description":"The Mátra is a mountain range in northern Hungary, between the towns Gyöngyös and Eger. The country's highest peak, Kékestető, belongs to this mountain range.\\nThe Mátra is part of the North Hungarian Mountains and belongs by origin to the largest young volcanic zone of Europe. It is situated between the valleys of River Tarna and River Zagyva. The Mátra can be divided into several readily distinguishable parts. The highest point of the Western Mátra is Muzsla. The Central Mátra consists of the plateau of Mátrabérc and the groups of the volcanic cones of Galya-tető and Kékes. Steep, rugged slopes, screes, talus slopes and slides alternate with one another, covered with closed beech forests. Gentler slopes and parallel valleys flow down to the south, the largest of which is the so-called Nagy-völgy. The 'main entrance' to the Mátra was formed in parallel with the valley of Nagy-patak, ranging from Mátrafüred to Mátraháza. From the vineyard-covered landscape of the foot of the Mátra travellers can arrive at the wooded mountains in a flash. To the east, after the steep escarpment of the 898-meter-high Sas-kő, the 650-750-meter-high peaks of the Eastern Mátra follow one another."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%8A%D8%B3%D8%AA%D9%8A%D8%A7%D9%86%D9%88_%D8%B1%D9%88%D9%86%D8%A7%D9%84%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/C.Ronaldo_%286%29.jpg","page_title":"كريستيانو رونالدو","context_page_description":"كريستيانو رونالدو دوس سانتوس أفيرو المعروف بـ كريستيانو رونالدو. هو لاعب كرة قدم برتغالي يلعب في مركز الهجوم مع نادي يوفنتوس في الدوري الإيطالي الدرجة الأولى و‌منتخب البرتغال لكرة القدم. غالبا ما يُعتبر أفضل لاعب في العالم ويعتبره الكثيرون من أعظم اللاعبين في تاريخ كرة القدم، حصل رونالدو على خمسة كرات ذهبية كأكثر لاعب أوروبي، وهو أول لاعب يفوز بأربعة أحذية ذهبية أوروبية. وقد فاز بـ 32 بطولة رسمية في مسيرته، من ضمنها سبعة ألقاب دوري، وخمسة ألقاب في دوري أبطال أوروبا ولقب واحد في بطولة أمم أوروبا ولقب البطولة الافتتاحية لدوري الأمم الأوروبية. يحمل رونالدو الرقم القياسي لأكبر عدد من الأهداف والصناعة في تاريخ دوري أبطال أوروبا. وهو أحد اللاعبين القلائل الذين شاركوا في أكثر من 1000 مباراة رسمية في مسيرتهم وسجل أكثر من 700 هدف رسمي مع الأندية والمنتخب.\\nولد ونشأ في جزيرة ماديرا البرتغالية، تم تشخيص رونالدو بتسارع دقات القلب في عمر 15 سنة، خضع على أثرها إلى عملية جراحية لعلاج حالته. بدأ مسيرته في نادي سبورتينغ لشبونة قبل أن يوقع مع مانشستر يونايتد في سن 18 عامًا في 2003. بعد فوزه بكأسه الأولى كأس الاتحاد الإنجليزي، خلال موسمه الأول في إنجلترا، ساعد اليونايتد على الفوز بثلاثة ألقاب متتالية في الدوري الإنجليزي الممتاز وبطولة واحدة في دوري أبطال أوروبا وبطولة واحدة في كأس العالم للأندية."},{"page_url":"https://en.wikipedia.org/wiki/Neukirchen_an_der_V%C3%B6ckla","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Neukirchen_an_der_V%C3%B6ckla_Kirche.JPG","page_title":"Neukirchen an der Vöckla","context_page_description":"Neukirchen an der Vöckla is a municipality in the district of Vöcklabruck in the Austrian state of Upper Austria."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%AF%D8%A7%D9%85_%D9%84%D9%88_%D9%81%D9%88%D9%86%D8%AF%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Le_Fondre%2C_Adam_%28cropped%29.jpg","page_title":"آدام لو فوندر","context_page_description":"آدام لو فوندر بازیکن فوتبال اهل بریتانیا است.\\nاز باشگاه‌هایی که در آن بازی کرده‌است می‌توان به باشگاه فوتبال ردینگ، باشگاه فوتبال بولتون واندررز، باشگاه فوتبال ولورهمپتون واندررز، باشگاه فوتبال استوک‌پورت کانتی، باشگاه فوتبال روترهام یونایتد، باشگاه فوتبال روچدیل، باشگاه فوتبال کاردیف سیتی، و باشگاه فوتبال ویگان اتلتیک اشاره کرد."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%88%D1%83%D0%B6%D0%BD%D0%B0_%D0%9A%D0%BE%D1%80%D0%B5%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/President_Donald_J._Trump_welcomes_President_Moon_Jae-in_of_the_Republic_of_Korea_to_the_White_House_%2835520219101%29.jpg","page_title":"Јужна Кореја","context_page_description":"Јужна Кореја — суверена држава која се наоѓа во јужниот дел на Корејскиот Полуостров. Службено се нарекува Република Кореја и во резолуцијата на OОН од 1948 г. е опишана како единствена законски влада во Кореја. Меѓународното име на Кореја доаѓа од старата династија Корјо во периодот кога многу западни нации го забележале постоење на династијата на Корејскиот Полуостров. Корејското име „Техан-мингук“ може да се преведе како „Република на великиот Хан“. „Хан“ е името на народите на полуостровот и во некои делови на Манџурија. Ова име на народите потекнува од името на единствениот древен бог на корејските народи, наречен „Хананим“.\\nНејзините соседи се Кина на запад, Јапонија на исток, Северна Кореја на север, и на Источнокинеското Море на југ. Јужна Кореја се наоѓа во умерена северна зона и има претежно планински рељеф. Нејзината територија зафаќа вкупна површина од 100,032 квадратни километри и има население од речиси 50 милиони. Главен и најголем град е Сеул, со население од 10.421.782 жители.\\nАрхеолошки наоди покажуваат дека Корејскиот Полуостров бил населен до стариот палеолит."},{"page_url":"https://fi.wikipedia.org/wiki/Ampumahiihto_talviolympialaisissa_2018_%E2%80%93_miesten_normaalimatka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Jakov_Fak_%28cropped%29.jpg","page_title":"Ampumahiihto talviolympialaisissa 2018 – miesten normaalimatka","context_page_description":"Ampumahiihdon miesten 20 kilometrin normaalimatkan kilpailu talviolympialaisissa 2018 järjestettiin 15. helmikuuta 2018 Alpensian ampumahiihtokeskuksessa Pyeongchangissa, Etelä-Koreassa."},{"page_url":"https://nl.wikipedia.org/wiki/Paul_Michiels","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Paul_michiels_soulsister.png","page_title":"Paul Michiels","context_page_description":"Paul Anna Kamiel Michiels is een Belgische zanger. Zijn bijnaam luidt \\"polle pap\\"."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%AC%D8%A7%D8%AF%D9%87%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%A7%DB%8C%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Qom_FW.jpg","page_title":"فهرست جاده‌های ایران","context_page_description":"فهرست جاده‌های ایران پیرامون بررسی در رابطه با جاده‌های ایران است. در پایان حکومت قاجاریه طول راه‌های ایران حدود ۳۹۰۰ کیلومتر بود. در دوران حکومت رضاشاه طول راه‌ها به ۲۴ هزار کیلومتر رسید. در آغاز انقلاب سفید محمدرضا شاه ایران دارای ۳۵۰۰۰ کیلومتر راه بود. با اجرای برنامه‌های عمرانی اول تا چهارم قبل از انقلاب سال ۱۳۵۷ طول راه‌ها به ۴۲ هزار کیلومتر و در برنامه عمرانی پنجم قبل از انقلاب به ۴۶۰۰۰ کیلومتر راه افزایش یافت. ایران در سال ۱۳۸۷، دارای ۱۴۶۵ کیلومتر آزادراه، ۵۴۶۸ کیلومتر بزرگراه بود.\\nایران در سال ۱۳۸۹ دارای ۲۰۰٬۰۰۰ کیلومتر راه اصلی، فرعی و روستایی بود که از این مقدار ۸۰٬۰۰۰ کیلومتر راه اصلی و فرعی و ۱۲۰٬۰۰۰ کیلومتر راه روستایی بود.\\nدر سال ۱۳۹۱، ایران دارای ۱۰٬۷۸۹ کیلومتر بزرگراه بود که در سال ۱۳۸۸، ۱٬۵۴۵ کیلومتر و در سال ۱۳۸۹ ۱٬۶۰۸ کیلومتر و در سال ۱۳۹۰، ۱٬۸۴۸ کیلومتر بزرگراه احداث شده بود.\\nدر دهه ۸۰، ۲۴۱٬۲۳۶ نفر در ایران بر اثر تصادفات رانندگی جان خود را از دست داده‌اند. استان تهران با ۲۸٬۴۰۸ کشته بیش‌ترین کشته در ایران را به خود اختصاص داده‌است که پس از آن خراسان با ۲۴٬۴۱۶ نفر و فارس با ۱۸٬۰۰۶ نفر در رتبه‌های بعدی بیشتری کشته‌ها در ایران هستتند.\\nبیش‌ترین فصل کشته‌ها در ایران، تابستان و بیش‌ترین ماه کشته‌ها بر اثر تصادف، شهریور است."},{"page_url":"https://de.wikipedia.org/wiki/Signalsystem_M","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Fl%C3%BCgel3_Hauptsg_Tag_2.png","page_title":"Signalsystem M","context_page_description":"Als Signalsystem M wird seit 1986 in Abgrenzung zu den neueren Signalsystemen L und N das mittlerweile ersetzte Schweizer Formsignalsystem bezeichnet."},{"page_url":"https://it.wikipedia.org/wiki/Bowery_Boys","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Michael_Walsh_%28Congressman%29.jpg","page_title":"Bowery Boys","context_page_description":"I Bowery Boys erano un'organizzazione criminale newyorkese, nativista, anticattolica e anti-irlandese con sede nella Bowery, quartiere di Manhattan; l'organizzazione è stata attiva attorno allla metà del XIX secolo.\\nGli avversari principali dei Bowery Boys erano gli immigrati del quartiere irlandese di Five Points, molto più poveri rispetto alla gente proveniente dalla Bowery, classe lavoratrice benestante. La zona era talmente degradata da venir considerata uno dei peggiori bassifondi americani del tempo.\\nI Bowery Boys hanno combattuto contro molteplici gruppi provenienti dai Five Points, uno dei quali era la gang dei Dead Rabbits, con cui hanno avuto rapporti ostili per decenni.\\nGli adepti della gang cercavano di mantenere uno stile di vita conforme alla legge, nonostante l'organizzazione avesse la fama di essere una delle gang newyorkesi più malfamate dell'epoca.\\nQuesto dato anche dal fatto che gran parte dei membri erano vigili del fuoco volontari affiliati alla Haward Engine Company #34.\\nCiò era favorevole all'organizzazione criminale in quanto queste compagnie organizzavano dei club di tiro anche ad un livello paramilitare."},{"page_url":"https://el.wikipedia.org/wiki/%CE%94%CE%B7%CE%BC%CE%BF%CF%84%CE%B9%CE%BA%CF%8C_%CE%A3%CF%84%CE%AC%CE%B4%CE%B9%CE%BF_%CE%92%CE%AD%CF%81%CE%BF%CE%B9%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/VeriaVsGiannina.JPG","page_title":"Δημοτικό Στάδιο Βέροιας","context_page_description":"Το Δημοτικό Στάδιο Βέροιας, παλαιότερα Εθνικό Στάδιο Βέροιας, είναι γήπεδο πολλαπλών χρήσεων στη Βέροια, που κυρίως χρησιμοποιείται για αγώνες ποδοσφαίρου, και είναι η έδρα της ομάδας της Βέροιας. Βρίσκεται στην ιδιοκτησία του Δήμου Βέροιας."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BE%D0%BD%D0%B8%D1%85%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Panaritium01.jpg","page_title":"Паронихия","context_page_description":"Парони́хия, воспаление околоногтевого валика. Другое название парони́хия — околоногтевой панариций, синоним — парони́хий."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_Gabenor_Aceh","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Ibrahim_Hasan%2C_Gubernur_Aceh.jpg","page_title":"Senarai Gabenor Aceh","context_page_description":"Berikut ini adalah senarai gubernur provinsi Aceh sejak 1945 hingga saat ini."},{"page_url":"https://en.wikipedia.org/wiki/Western_world","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Byzantium%401180.jpg","page_title":"Western world","context_page_description":"The Western world, also known as the West, refers to various regions, nations and states, depending on the context, most often consisting of the majority of Europe, Australasia, and the Americas. The Western world is also known as the Occident, in contrast to the Orient, or Eastern world. It might mean the Northern half of the North–South divide. Western civilization is commonly said to include: Australia, Canada, New Zealand, the United Kingdom, the United States, all European member countries of the EU and EFTA, plus European microstates.\\nAncient Greece and Ancient Rome are generally considered to be the birthplaces of Western civilization—Greece having heavily influenced Rome—the former due to its impact on philosophy, democracy, science, aesthetics, as well as building designs and proportions and architecture; the latter due to its influence on art, law, warfare, governance, republicanism, engineering and religion. Western civilization is also strongly associated with Christianity, which is in turn shaped by Hellenistic philosophy, Judaism and Roman culture."},{"page_url":"https://en.wikipedia.org/wiki/Metamorphic_zone","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Scotland_metamorphic_zones_EN.svg","page_title":"Metamorphic zone","context_page_description":"In geology, a metamorphic zone is an area where, as a result of metamorphism, the same combination of minerals occur in the bedrock. These zones occur because most metamorphic minerals are only stable in certain intervals of temperature and pressure."},{"page_url":"https://sh.wikipedia.org/wiki/2000","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Milan_Bandi%C4%87%2C_grudska_ve%C4%8Der_ZG_2009.jpg","page_title":"2000","context_page_description":"2000. je bila prijestupna godina koja počinje u subotu, prema gregorijanskom kalendaru. Moderna kultura je smatra i početkom 21. stoljeća i 3. tisućljeća, iako je to po strogim kriterijima gregorijanskog kalendara zapravo bila 2001.\\nOva godina bila je obilježena kao:\\nMeđunarodna godina kulture mira.\\nSvjetska godina matematike.\\nGodina 2000. je bila najtoplija ikada u Beogradu: prosečna temperatura 14,1 °C, u odnosu na prosek od 11,7 °C. Takođe i jedna od najsušnijih u regionu."},{"page_url":"https://pt.wikipedia.org/wiki/Fungi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Lobaria_pulmonaria_010108a.jpg","page_title":"Fungi","context_page_description":"O reino Fungi é um grupo de organismos eucariotas, que inclui micro-organismos tais como as leveduras, os bolores, bem como os mais familiares cogumelos.\\nOs fungos são classificados num reino separado das plantas, animais e bactérias. Uma grande diferença é o facto de as células dos fungos terem paredes celulares que contêm quitina e glucanos, ao contrário das células vegetais, que contêm celulose. Estas e outras diferenças mostram que os fungos formam um só grupo de organismos relacionados entre si, denominado Eumycota, e que partilham um ancestral comum. Este grupo de fungos é distinto dos estruturalmente similares Myxomycetes e Oomycetes. A disciplina da biologia dedicada ao estudo dos fungos é a micologia, muitas vezes vista como um ramo da botânica, mesmo apesar de os estudos genéticos terem mostrado que os fungos estão mais próximos dos animais do que das plantas.\\nAbundantes em todo mundo, a maioria dos fungos é inconspícua devido ao pequeno tamanho das sua estruturas, e pelos seus modos de vida crípticos no solo, na matéria morta, e como simbiontes ou parasitas de plantas, animais, e outros fungos."},{"page_url":"https://ht.wikipedia.org/wiki/Santiago_Ramundo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Santiago_Ramundo.png","page_title":"Santiago Ramundo","context_page_description":"Santiago Ramundo, ki fèt 10 me 1984 nan Bwènozè, se yon aktè, chantè ak pwodiktè ajanten."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%96%B0%E4%BA%9E%E4%B8%AD%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Southeast_of_New_Asia_Middle_School_and_Hop_Yat_Road_Entrance.jpg","page_title":"新亞中學","context_page_description":"新亚中学，是位于香港九龙靠背垄农圃道的一所津贴中学。该校为新亚书院成为香港中文大学一间成员学院、迁往沙田马料水后，新亚书院创办人钱穆教授在农圃道前书院校舍开办的一所非牟利中文中学，继承新亚书院办学精神，发扬中华文化、复兴中国伦理道德，培养学生的“新亚人素质”。\\n现时该校以中文作为主要教学语言，开办中一至中六级各四班。历任校董会成员包括新儒家哲学家兼新亚书院创办人唐君毅、汉学家余英时、教育家沈亦珍、历史学家孙国栋、新亚书院前院长梅贻宝、资深传媒人香树辉等。"},{"page_url":"https://cs.wikipedia.org/wiki/Alfred_T._Palmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Slag_runoff_Republic_Steel.jpg","page_title":"Alfred T. Palmer","context_page_description":"Alfred T. Palmer byl americký filmař a válečný fotograf."},{"page_url":"https://hu.wikipedia.org/wiki/Bourbon_M%C3%A1ria_Anna_Vikt%C3%B3ria_portug%C3%A1l_kir%C3%A1lyn%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Infanta_Mar%C3%ADana_V%C3%ADctor%C3%ADa_de_Espa%C3%B1a%2C_Queen_of_Portugal_and_the_Algarves.jpg","page_title":"Bourbon Mária Anna Viktória portugál királyné","context_page_description":"Bourbon Mária Anna Viktória, a Bourbon-házból származó spanyol infánsnő, V. Fülöp spanyol király és Farnese Erzsébet legidősebb leánygyermeke, aki I. József portugál királlyal kötött 1729-es házassága révén Portugália és Algarve királynéja 1750-től, majd beteg férje mellett az ország régense 1774-től annak 1777-es haláláig. I. Mária portugál királynő édesanyja."},{"page_url":"https://cs.wikipedia.org/wiki/Lokomotiva_498.0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Lokomotiva_Albatros%2C_v%C3%BDrobn%C3%AD_tabulka.jpg","page_title":"Lokomotiva 498.0","context_page_description":"Lokomotiva 498.0 zvaná „albatros“ je první poválečnou rychlíkovou lokomotivou v Československu. Konstrukčně navazuje na řadu 486.0 ze třicátých let a její výroba proběhla v letech 1946–47 ve Škodových závodech v Plzni. 40 vyrobených kusů bylo určeno především pro těžké rychlíky na hlavních tratích jako náhrada starší řady 387.0.\\nDíky elektrifikaci tratí a výrobě navazující řady 498.1 po roce 1955 byly lokomotivy z elitních výkonů stahovány a odcházely na méně důležité výkony. Dosluhovaly v sedmdesátých letech na osobních vlacích v Děčíně, Táboře a dalších lokalitách. Jako poslední byly zrušeny lokomotivy 498.001 a 022 v červnu 1976. Druhá jmenovaná byla převezena do železničního skanzenu v České Třebové a zachována do současnosti jako historická."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Aachen-Mitte_(A%E2%80%93H)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Gottfriedstra%C3%9Fe_28.JPG","page_title":"Liste der Baudenkmäler in Aachen-Mitte (A–H)","context_page_description":"Die Liste der Baudenkmäler in Aachen-Mitte (A–H) enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Stadtbezirks Aachen-Mitte in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Aachen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A6%B0%EB%93%A0_B._%EC%A1%B4%EC%8A%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/LBJ_Library_2017.jpg","page_title":"린든 B. 존슨","context_page_description":"린든 베인스 존슨은 미국의 36대 대통령이다. 그는 별명인 LBJ로 알려졌다. 베트남 전쟁과 관련된 국외정책은 실패한 것으로 여겨지나, 인권향상을 비롯한 국내정책은 성공적이었다고 평가받는다. 신장 192cm로 미국 역대대통령 중에 2번째로 키가 크다.\\n민주당 대통령 후보 경선에서 케네디 후보에게 패배하였으나 케네디 정부의 부통령이 되었다. 그러던 1963년 대통령으로 재임하던 케네디가 피살되자 제36대 대통령직을 승계했으며, 1964년 선거에서 공화당의 배리 골드워터 후보를 꺾고 재선되었다.\\n그는 '위대한 사회' 건설을 주장하여 교육, 주택과 도시 개발, 교통, 환경보호주의, 이민 정책의 의안 제출권에 책임을 맡았으나, 베트남 전쟁에서는 사태의 심각화를 초래하였다. 또한 남부 출신의 지도자로서 흑인에 대한 차별을 없애야 한다고 주장하며, 인권운동 결의서를 세웠다. 1965년에는 흑인들이 투표할 권리를 얻을 법안을 청하여 투표권법을 승인시켰다.\\n하지만 베트남 전쟁이 장기화 되면서 국내에서 반전 운동이 일어나 인기를 잃게 되자, 1968년 두 번 이상 대통령 선거에 출마하지 않겠다는 발표를 하여 이듬해 임기 종료와 함께 퇴임했다."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%95%D7%A1%D7%98%D7%95_%D7%97%D7%95%D7%A1%D7%94_%D7%93%D7%94_%D7%90%D7%95%D7%A8%D7%A7%D7%99%D7%A1%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Justo_Jos%C3%A9_de_Urquiza.jpg","page_title":"חוסטו חוסה דה אורקיסה","context_page_description":"חוסטו חוסה דה אורקיסה היה איש צבא ופוליטיקאי ארגנטינאי, מושל הפרובינציה של אנטרה ריוס, מנהיג המפלגה הפדרלית הארגנטינאית, ונשיא הקונפדרציה הארגנטינאית בשנים 1854–1860."},{"page_url":"https://en.wikipedia.org/wiki/Tuxtla_Guti%C3%A9rrez","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/CloseServingPozol.jpg","page_title":"Tuxtla Gutiérrez","context_page_description":"Tuxtla Gutiérrez is the capital and the largest city of the Mexican southeast state of Chiapas. It is the most developed, populated and therefore the state's most important municipality. A busy government, commercial and services-oriented city, Tuxtla had one of the fastest growing rates in Mexico in the last 40 years. Unlike many other areas in Chiapas, it is not a tourist attraction, but a transportation hub for tourists coming into the state, with a major airport and a bus terminal."},{"page_url":"https://nl.wikipedia.org/wiki/Sozj","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Soz_river.JPG","page_title":"Sozj","context_page_description":"De Sozj is een rivier in Rusland, Oekraïne en Belarus.\\nHet is een zijrivier van de Dnjepr.\\nDe 648 km lange Sozj ontspringt op 8 km ten zuiden van de Russische stad Smolensk en stroomt zuidwaarts naar het Wit-Russische stadje Kritsjev. Van daar af is de rivier voor vrachtschepen bevaarbaar. De waterstand van de Sozj wordt door talrijke sluizen gereguleerd. Verder zuidwaarts stroomt de Sozj door de stad Homel.\\nIn het zuiden vormt de Sozj de grens tussen Belarus en Oekraïne, om in dat laatste land uiteindelijk in de Dnjepr uit te monden.\\nDe rivier is 's winters meestal van begin december tot eind maart dichtgevroren.\\nDe oppervlakte van het stroomgebied van de Sozj is circa 42.140 km²."},{"page_url":"https://pt.wikipedia.org/wiki/GE_C36-7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/GE_C36-7_390_EFC.jpg","page_title":"GE C36-7","context_page_description":"A GE C36-7 é uma locomotiva diesel - elétrica produzida pela GE a partir de 1978 até meados de 1985, sendo utilizada nos EUA, China, México, Gabão.\\nTendo sido produzida nos EUA, Austrália e Brasil um total de 602 unidades.\\nAs locomotivas produzidas no Brasil foram exportadas para México em 1980 para a empresa National de México."},{"page_url":"https://sv.wikipedia.org/wiki/Tjarents_litteratur-_och_konstmuseum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Yeghishe_Charents_Armenian_poet.jpg","page_title":"Tjarents litteratur- och konstmuseum","context_page_description":"Tjarents litteratur- och konstmuseum i Jerevan i Armenien har landets mest omfattande kollektion av armeniska manuskript och böcker från de senaste 300 åren. Efter att museet från början 1954 var tänkt att tjäna som den armeniska socialistiska sovjetrepublikens museum, har det utvecklats till ett ansett forskningscenter, där arkiven efter omkring sex hundra armeniska författare, dramatiker och musiker förvaras idag.\\nI museets samlingar ingår också många fotografier, affischer, utkast, kläder, teaterartiklar, personliga tillhörigheter och musikinstrument."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D1%82%D0%B5%D0%BD%D0%B4%D0%BE%D1%80%D1%84_(%D0%92%D0%B5%D1%80%D1%85%D0%BD%D1%96%D0%B9_%D0%9F%D1%84%D0%B0%D0%BB%D1%8C%D1%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Altendorf_14_08_2013.jpg","page_title":"Альтендорф (Верхній Пфальц)","context_page_description":"Альтендорф — громада в Німеччині, розташована в землі Баварія. Підпорядковується адміністративному округу Верхній Пфальц. Входить до складу району Швандорф. Складова частина об'єднання громад Наббург.\\nПлоща — 23,16 км². Населення становить 890 ос."},{"page_url":"https://uk.wikipedia.org/wiki/AntRay","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Antalya_Tram_-_2014.10_-_panoramio.jpg","page_title":"AntRay","context_page_description":"AntRay — діюча мережа легкорейкового транспорту у місті Анталія, Туреччина. Відкрита у березні 2009 року.\\nЛінія з'єднала центр Анталії з автовокзалом і північними районами міста, завдовжки 11,1 км з 16 станціями. Ширина колії — 1435 мм. Час в дорозі — 34 хвилини.\\nНа лінії експлуатуються сучасні вагони іспанського виробника CAF. 14 потягів з 5-ма зчленованими вагонами.\\nІнтервал руху — 10 хвилин. Час роботи — 6.00 — 23.00. На станціях є каси, в ​​яких можна придбати пластикову проїзну картку A-KENT. Вартість проїзду по цій картці 1,8 ліри."},{"page_url":"https://en.wikipedia.org/wiki/List_of_destroyer_classes_of_the_United_States_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/USS_Norfolk_%28DL-1%29_underway_c1964.jpg","page_title":"List of destroyer classes of the United States Navy","context_page_description":"The first automotive torpedo was developed in 1866, and the torpedo boat was developed soon after. In 1898, while the Spanish–American War was being fought in the Caribbean and the Pacific, Assistant Secretary of the Navy Theodore Roosevelt wrote that the Spanish torpedo boat destroyers were the only threat to the American navy, and pushed for the acquisition of similar vessels. On 4 May 1898, the US Congress authorized the first sixteen torpedo boat destroyers and twelve seagoing torpedo boats for the United States Navy.\\nIn World War I, the U.S. Navy began mass-producing destroyers, laying 273 keels of the Clemson and Wickes-class destroyers. The peacetime years between 1919 and 1941 resulted in many of these flush deck destroyers being laid up. Additionally, treaties regulated destroyer construction. The 1500-ton destroyers built in the 1930s under the treaties had stability problems that limited expansion of their armament in World War II. During World War II, the United States began building larger 2100-ton destroyers with five-gun main batteries, but without stability problems.\\nThe first major warship produced by the U.S."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_militaire_de_la_Chine","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Song_Zheyuan_2.jpg","page_title":"Histoire militaire de la Chine","context_page_description":"Guerres d'expansion du roi Wu Ding - Dynastie Shang\\nPériode des Royaumes combattants\\n-206 : Ziying, dernier dirigeant de la dynastie Qin capitule devant Liu Bang, dirigeant d'une révolte populaire et fondateur de la dynastie Han.\\n-154 : échec de la rébellion des sept États menée par des membres de la famille royale de la dynastie Han.\\n18 : révolte des Sourcils Rouges en Chine\\n184 : Zhang Jiao conduit la rébellion des Turbans jaunes contre la dynastie Han.\\n613 : la révolte de Yang Xuangan est écrasée par la dynastie Sui.\\n755-763 : révolte d'An Lushan contre la dynastie Tang.\\n875-884 : rébellion du contrebandier Huang Chao contre la dynastie Tang, qui contribue à son effondrement.\\nInvasions mongoles XIIIe & XIVe siècles\\n1368 : Ming Hongwu dirige des paysans han au cours de la Révolte des Turbans rouges contre la dynastie Yuan mongole établissant ainsi la dynastie Ming."},{"page_url":"https://ca.wikipedia.org/wiki/Tur%C3%B3_del_Gomis","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/L%27Estany._Tur%C3%B3_del_Gomis.svg","page_title":"Turó del Gomis","context_page_description":"El Turó del Gomis és una muntanya de 871 metres d'altitud a cavall dels termes municipals de l'Estany i Santa Maria d'Oló, a la comarca del Moianès.\\nEstà situat al nord-oest del centre del terme i del mateix poble de l'Estany, lluny de la població, a la meitat de la Serra de l'Estany. És a la dreta del torrent del Gomis. Es troba al nord-oest de Montfred i de les Feixes de França, i al sud-est de l'Heura i de la Rovirassa."},{"page_url":"https://pt.wikipedia.org/wiki/Miss%C3%B5es_diplom%C3%A1ticas_da_R%C3%BAssia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Map_of_diplomatic_missions_of_Russia.PNG","page_title":"Missões diplomáticas da Rússia","context_page_description":"Abaixo estão listadas as embaixadas e consulados da Rússia:"},{"page_url":"https://nn.wikipedia.org/wiki/T%C3%B8nne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Barrels2.jpg","page_title":"Tønne","context_page_description":"Ei tønne, eller tynne, i somme tilfelle også kalla fat, er eit lukka rundt ilåt med bogne vegger som tradisjonelt er laga av tønnestavar av tre og bunden saman med tønneband av metall eller tilsmidd treband, oftast av hassel.\\nTønner har vore brukte til å lagra og frakta drikkevarer og matvarer i fleire hundreår. Rundt om i Europa har tønner vore framstilla i mange ulike storleikar, i Noreg har storleiken på tønner brukt til handelsvarer vorte standardisert. Ein person som set saman tretønner vert kalla bøkker. Ulike treslag har vore brukte til tønner, men tønner til å lagre flytande varer skal helst vere produsert av eik. Det vert framleis produsert tønner av tre, i dag blir dei særleg brukte til å lagra alkoholdrikkar for mogning. Dei blir då kalla fat.\\nDet er no vanleg å produsere tønner for lagring og transport av væsker i plast, aluminium eller andre metall i ulike storleikar. Ofte kallar ein då behaldaren fat som i oljefat for oljeprodukt, men når ein lagrar farleg avfall nyttar ein ofte nemninga gifttønne.\\nTønner har gjeve opphav til fleire ulike måleiningar, først og fremst for volum. Det har ulik storleik avhengig om det er tørre eller flytande varer som vert målt."},{"page_url":"https://sl.wikipedia.org/wiki/Piramida","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Thanjavur_temple.jpg","page_title":"Piramida","context_page_description":"Piramída je v gradbeništvu in arhitekturi trirazsežna struktura v obliki matematične piramide.\\nPiramida je struktura, katere zunanje površine so trikotne in se stekajo v eno samo točko na vrhu. Osnova piramide ima lahko obliko trikotnika, štirikotnika ali poligona. Ker so čistih oblik, so piramide označevale objekte s posebno vlogo; v preteklosti sakralna in spominska, v sodobnosti so to atraktivni objekti za razne namene.\\nOblika piramide je taka, da je večina teže bližje tlom in da je manj materiala višje na piramidi, ki potiska težo navzdol. Ta porazdelitev teže je dovoljevala zgodnjim civilizacijam ustvariti stabilne monumentalne strukture.\\nPiramide so zgradile civilizacije v mnogih delih sveta. Tisoče let so bile največje strukture na Zemlji piramide. Prve Rdeče Piramide v nekropoli Dashur in Velika piramida Khufuja, obe iz Egipta, slednja še vedno ostaja eno izmed sedmih čudes starega sveta. Khufujeva piramida, zgrajena večinoma iz apnenca šteje za arhitekturno mojstrovino. Vsebuje okrog 1.300.000 blokov težkih od 2,5 do 15 ton in ima kvadratno osnovo, s stranico približno 230 m ter obsega 13 hektarjev površine."},{"page_url":"https://la.wikipedia.org/wiki/Les_Cro%C3%BBtes","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Map_commune_FR_insee_code_10118.png","page_title":"Les Croûtes","context_page_description":"Les Croûtes est commune Francicum 98 incolarum praefecturae Albae in provincia Campania et Arduenna."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%AD%CF%86%CF%85%CF%81%CE%B1_%CF%84%CE%BF%CF%85_%CE%A4%CE%BF%CF%85%CE%AF%CE%BA%CE%B5%CE%BD%CE%B1%CE%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Twickenham_Bridge_320r1.jpg","page_title":"Γέφυρα του Τουίκεναμ","context_page_description":"Η γέφυρα του Τουίκεναμ βρίσκεται επί του Τάμεση στην περιοχή Ρίτσμοντ του νοτιοανατολικού Λονδίνου. Η κατασκευή της ολοκλήρωθηκε το 1933 ως μέρος της ευρύτερης αρτηριακής οδού A316 για την αποσυμφόρηση της οδικής κίνησης των γειτονικών περιοχών, και συνδέει την περιοχή του παλαιού πάρκου των ελαφιών του Ρίτσμοντ με την περιοχή Σαιντ Μάργκαρετς του Τουίκεναμ. Καθώς υπήρχε ήδη από πολύ παλιά η σε κοντινή απόσταση γέφυρα του Ρίτσμοντ, η νέα οδική γέφυρα ονομάστηκε βάσει της περιοχής της άλλης όχθης, με το κέντρο του Τουίκεναμ να βρίσκεται σε περίπου 3 χλμ απόσταση από την γέφυρα. Από το 2008 αποτελεί προστατευόμενο κτίσμα σύμφωνα με τις βρετανικές διατάξεις προστασίας της πολιτιστικής κληρονομιάς."},{"page_url":"https://sv.wikipedia.org/wiki/Maui-nukupuu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Hemignathus_lucidus_affinis.jpg","page_title":"Maui-nukupuu","context_page_description":"Maui-nukupuu är en akut hotad, möjligen utdöd, fågel i familjen finkar. Utbredningsområdet är begränsat till en enda ö i Hawaiiöarna."},{"page_url":"https://fi.wikipedia.org/wiki/Per_von_Afzelius","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Pehr_von_Afzelius.jpg","page_title":"Per von Afzelius","context_page_description":"Per von Afzelius oli ruotsalainen lääkäri. Hän osallistui Suomen sotaan 1788–1790 rykmentinlääkärinä. Vuodesta 1789 hän oli armeijan lääkintätoimen ylipäällikkö. Hän uudisti kenttäsairaalahoitoa ja palkkasi lääketieteen opiskelijoita alilääkäreiksi."},{"page_url":"https://lt.wikipedia.org/wiki/Kliukai_(Ignalina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Did%C5%BEiasalio_sen.%2C_Lithuania_-_panoramio_%284%29.jpg","page_title":"Kliukai (Ignalina)","context_page_description":"Kliukai – kaimas Ignalinos rajono savivaldybėje, 3 km į pietryčius nuo Tverečiaus, tarp Birvėtos ir jos intako Šakelelės, raistų ir šlapynių apsuptyje. Pro kaimą eina kelias 4402 Adutiškis–Jakeliai–Tverečius–Vidžiai, atsišakoja 1419 Kliukai–Sekonys–Pivorai–Galalaukiai. Kliukų pietuose yra Pirmojo pasaulinio karo Vokietijos imperijos karių kapai."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_technischen_Denkmale_im_Landkreis_Nordsachsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Schildau_Windmuehle_Prosthainerstr-01.jpg","page_title":"Liste der technischen Denkmale im Landkreis Nordsachsen","context_page_description":"Die Liste der technischen Denkmale im Landkreis Nordsachsen enthält die Technischen Denkmale im Landkreis Nordsachsen.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://it.wikipedia.org/wiki/Acquedotto_romano","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Aqueduct_of_Segovia_08.jpg","page_title":"Acquedotto romano","context_page_description":"I Romani hanno costruito numerosi acquedotti per portare acqua da sorgenti distanti nelle loro città, rifornendo thermae, latrine, fontane e abitazioni private. Le acque di scarico furono eliminate con complessi sistemi fognari e scaricate in corsi d'acqua nelle vicinanze, mantenendo le città pulite e prive di effluenti. Alcuni acquedotti fornivano acqua per le operazioni di estrazione o per la macinazione del grano.\\nGli acquedotti spostavano acqua solo per gravità, essendo costruiti con una leggera pendenza verso il basso all'interno di condotti di pietra, mattoni o cemento. La maggior parte erano sepolti sotto terra, e seguivano i suoi contorni; dei picchi che furono aggirati o, meno spesso, forati con un tunnel. Dove c'erano valli o pianure, il condotto era sostenuto da opere con arcate, o il suo contenuto era immesso a pressione in tubi di piombo, ceramica o pietra e sifonati. La maggior parte dei sistemi di acquedotto comprendeva vasche di sedimentazione, paratoie e serbatoi di distribuzione per regolare la fornitura secondo le necessità.\\nIl primo acquedotto di Roma riforniva una fontana situata nel mercato del bestiame della città."},{"page_url":"https://en.wikipedia.org/wiki/Jemmy_Button","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Jemmy_Button.jpg","page_title":"Jemmy Button","context_page_description":"Orundellico, known as \\"Jeremy Button\\" or \\"Jemmy Button\\", was a native Fuegian of the Yaghan people from islands around Tierra del Fuego, in modern Chile and Argentina. He was taken to England by Captain FitzRoy in HMS Beagle and became a celebrity for a period."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%95%BF%E5%B1%B1%E9%95%87_(%E5%BB%89%E6%B1%9F%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Lianjiang%2C_Zhanjiang%2C_Guangdong%2C_China_-_panoramio_%2879%29.jpg","page_title":"长山镇 (廉江市)","context_page_description":"长山镇，是中华人民共和国广东省湛江市廉江市下辖的一个乡镇级行政单位。"},{"page_url":"https://en.wikipedia.org/wiki/Rodenbach_(Wapelbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Verl-Rodenbach02.jpg","page_title":"Rodenbach (Wapelbach)","context_page_description":"Rodenbach is a river of North Rhine-Westphalia, Germany. It is a right tributary of the Wapelbach near Verl."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%85%D5%A1%D5%AF%D5%B8%D6%82%D5%A2_%D4%BF%D5%B8%D6%82%D5%A2%D5%AB%D6%81%D5%AF%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Hist9.jpg","page_title":"Յակուբ Կուբիցկի","context_page_description":"Յակուբ Կուբիցկի, կլասիցիզմի դարաշրջանի լեհ ճարտարապետ:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%82%D0%B0%D0%BB%D1%8C%D1%81,_%D0%96%D0%B0%D0%BD-%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Portaels_Jean_Francois_An_Oriental_Beauty.jpg","page_title":"Портальс, Жан-Франсуа","context_page_description":"Жан-Франсуа Портальс — бельгийский художник-ориенталист, профессор."},{"page_url":"https://fi.wikipedia.org/wiki/Lauri_Posti","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Lauri-Posti-1968.jpg","page_title":"Lauri Posti","context_page_description":"Lauri Albert Posti oli suomalainen fennougristi, Helsingin yliopiston itämerensuomalaisten kielten professori ja akateemikko. Vuonna 1975 hän toimi Suomen opetusministerinä 13. kesäkuuta – 30. marraskuuta ETY-kokouksen aikaan."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A7%80%EB%B0%94_%EB%8F%84%EC%8B%9C_%EB%AA%A8%EB%85%B8%EB%A0%88%EC%9D%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Chiba_Urban_Monorail_Series_1000_0003.jpg","page_title":"지바 도시 모노레일","context_page_description":"지바 도시 모노레일 주식회사는 일본 지바현의 철도 기업이다. 현수식 모노레일 노선을 운영한다."},{"page_url":"https://ca.wikipedia.org/wiki/Arquitectura_rom%C3%A0nica","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Forrellat_rom%C3%A0nic_de_Santa_Cec%C3%ADlia_de_Moll%C3%B3.jpg","page_title":"Arquitectura romànica","context_page_description":"L'arquitectura romànica és l'estil de construcció desenvolupat a l'Europa cristiana propi de l'art romànic. Majoritàriament, s'accepta que es desenvolupà durant els segles XI i XII, malgrat que se'n troben exemples del segle x i que l'ús de l'estil subsisteix durant el xiii, i que alguns autors han datat el seu inici en el segle viii incloent-hi les construccions preromàniques. Artísticament, és normal dividir el període medieval en preromànic fins al segle X, durant l'alta edat mitjana, romànic durant la primera meitat de la baixa edat mitjana i gòtic el posterior. A partir d'inicis del II mil·lenni, l'estil es difon, ràpidament i homogènia, pel continent, principalment com a conseqüència de l'acusat fervor religiós que va envair la societat europea occidental, i és considerada el primer estil unitari europeu després de l'arquitectura romana antiga, darrere la qual s'havien desenvolupat diversos estils, propis de determinats llocs i períodes."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D8%A7%D9%86%D9%87_%DA%A9%D8%A7%D8%B1%D9%84_%D9%85%D8%A7%D8%B1%DA%A9%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Trier_BW_2014-06-21_11-11-49.jpg","page_title":"خانه کارل مارکس","context_page_description":"خانه کارل مارکس موزه و خانه کارل مارکس در تری‌یر است. در سال ۱۸۱۸ میلادی کارل مارکس نویسنده و فیلسوف آلمانی در این خانه متولد شده است. این خانه در حال حاضر موزه زندگی و نوشته‌های مارکس و همچنین موزه تاریخ کمونیسم است."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Schwabing","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Bismarckstr._1_Muenchen-1.jpg","page_title":"Liste der Baudenkmäler in Schwabing","context_page_description":"Auf dieser Seite sind die Baudenkmäler im Münchner Stadtteil Schwabing im Stadtbezirk 12 Schwabing-Freimann aufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung und ein Fotoalbum mit ausgewählten Bildern.\\nDiese Liste ist Teil der Liste der Baudenkmäler in München. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://nl.wikipedia.org/wiki/Ria_van_Dijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Shoot%21.jpg","page_title":"Ria van Dijk","context_page_description":"Maria Augustina Norberta van Dijk ook genoemd Luchtbuks Ria is een vrijgevochten Tilburgse middenstander en kermisliefhebster die vanaf 1936 jaarlijks foto's van zichzelf schiet op diverse kermissen. Haar fotoshoots worden regelmatig geëxposeerd. Met de fotoserie is zij iconisch geworden voor de vrouwenemancipatie en de Tilburgse kermis in het bijzonder."},{"page_url":"https://be.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D1%81%D1%86%D0%B5_(%D0%9F%D1%83%D1%85%D0%B0%D0%B2%D1%96%D1%86%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Zamo%C5%9Bcie%2C_park.JPG","page_title":"Замосце (Пухавіцкі раён)","context_page_description":"Замо́сце — вёска ў Пухавіцкім раёне Мінскай вобласці. Уваходзіць у склад Навапольскага сельсавета. Месціцца за 43 км на паўночны захад ад Мар’інай Горкі, 36 км ад Мінска."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D1%83%D0%BD%D0%B8%D1%87%D0%B8_%D0%9C%D0%B8%D0%BA%D0%B0%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Gunichi_Mikawa.jpg","page_title":"Гуничи Микава","context_page_description":"Гуничи Микава је био вицеадмирал јапанске царске морнарице током Другог светског рата."},{"page_url":"https://en.wikipedia.org/wiki/List_of_County_Governors_of_M%C3%B8re_og_Romsdal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Birger_Kildal_-_Oslo_Museum_-_OB.X1685.jpg","page_title":"List of County Governors of Møre og Romsdal","context_page_description":"This is a list of the County Governors of Møre og Romsdal county in Norway. The office of County Governor is a government agency of the Kingdom of Norway. The title was Amtmann and then Fylkesmann.\\nRomsdalens amt was established in 1671, but after just four years it was divided into two amts: Romsdal and Sunnmøre. In 1680, Sunnmøre was merged into Bergenhus amt. Then in 1689, the three regions of Romsdal, Sunnmøre and Nordmøre were again merged into one amt/county: Romsdalen. Then in 1701 Romsdalen amt was split and divided between Trondhjems amt and Bergenhus amt. In 1704, the three regions of Romsdal, Sunnmøre and Nordmøre were again merged into one county. The borders of the county have not been changed much since 1704. The annex parish of Vinje within the larger Hemne parish was transferred from Romsdalens amt to Søndre Trondhjems amt in 1838. In 1919, the name of the county was changed to Møre fylke. In 1936, the name was again changed to Møre og Romsdal fylke.\\nThe county governor is the government's representative in the county. The governor carries out the resolutions and guidelines of the Storting and Government."},{"page_url":"https://en.wikipedia.org/wiki/Fender_Twin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/1973_Twin_Reverb.jpg","page_title":"Fender Twin","context_page_description":"The Fender Twin and Twin Reverb are guitar amplifiers made by Fender Musical Instruments Corporation. The Twin was introduced in 1952, two years before Fender began selling Stratocaster electric guitars. The amps are known for their characteristically clean tone.\\nThe Twin has seen a number of revisions since its introduction, both internal and external, with its designs sometimes varying greatly from one year to the next. Several variations on the amp's original design have been produced through the years, including the Twin Reverb, the Super Twin, the Twin Reverb II, and the Twin Reverb '65 Reissue. The Cyber Twin, which combined a tube amp with a digital processor, was introduced in January 2001.\\nMany notable musicians have used Fender Twin amplifiers, including Mark Knopfler, David Gilmour, Chuck Berry, Mike Oldfield, The Beatles, Jimi Hendrix, Eric Clapton, Keith Richards, Steve Jones, Jerry Garcia, Eric Johnson, Joe Bonamassa and Tommy Emmanuel."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D1%80%D0%B8%D0%BA%D1%88%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Tuktukpktalad05b.jpg","page_title":"Авторикша","context_page_description":"Авторикша або тук-тук — тип моторизованого транспортного засобу, що використовується як персональний транспортний засіб і таксі. Фактично є моторизованою версією традиційного рикші або велорикші, що має вигляд невеликого триколісного візку з одним водієм, форма кабінного мотоциклу. Авторикші широко поширені в азійських країнах, таких як Бангладеш, Камбоджа, Індія, Лаос, Пакистан, Шрі-Ланка і Таїланд та деяких країнах Африки, зокрема Ефіопії та частинах Єгипту.\\nЦей вид транспорту є одним з найнебезпечніших засобів пересування по місту, у зв'язку з підвищеною аварійністю і відсутністю систем безпеки. Попри це, популярний серед туристів, так як дуже зручний для невеликих поїздок по містах, де погано розвинений громадський транспорт."},{"page_url":"https://en.wikipedia.org/wiki/Challenge_of_Barletta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Barletta_monumento_disfida_apr06_02.jpg","page_title":"Challenge of Barletta","context_page_description":"The Challenge of Barletta was a duel fought in the countryside of Trani, near Barletta, southern Italy, on 13 February 1503, on the plains between Corato and Andria."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_S%C3%BClz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/K%C3%B6ln-S%C3%BClz_Nikolausstrasse_108_-_Bild_2_Denkmal_4482.jpg","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Sülz","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Sülz, Stadtbezirk Köln-Lindenthal, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_P%C3%ADritu_(Anzo%C3%A1tegui)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Escudo_Piritu_Anzoategui.PNG","page_title":"Municipio Píritu (Anzoátegui)","context_page_description":"Píritu​ es uno de los 21 municipios que forman parte del Estado Anzoátegui, Venezuela, en 1993 consiguió la autonomía del Municipio Peñalver. Está ubicado en el norte de dicho Estado, tiene una superficie de 225 km²​ y una población de 33.733 habitantes.​ El Municipio Píritu está dividido en dos parroquias, Píritu y San Francisco. Su capital es la ciudad de Píritu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BC%D0%B5%D1%80%D1%88%D0%B8%D0%B5_%D0%B2_%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D0%B5_2019_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Castres_Olympique_-_Pr%C3%A9sentation_de_l%27%C3%A9quipe_2015-2016_-_Ibrahim_Diarra_1.jpg","page_title":"Умершие в декабре 2019 года","context_page_description":"Это список известных людей, соответствующих установленным критериям значимости, умерших в декабре 2019 года.\\nПричина смерти указывается лишь в исключительных случаях. В остальных случаях — не указывается.\\n← Ноябрь 2019"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D1%88%D1%82%D0%B8%D1%82%D0%B0_%D0%BD%D0%B0_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%BD%D0%B5%D1%82%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/FIREWALL1.JPG","page_title":"Заштита на интернету","context_page_description":"Модерни рачунари управљају нашим новцем, здравством, железницом, авиосаобраћајем и сл. Од нас се очекује да верујемо у информационе технологије. Многе користи нашег партнерства са машинама су јасне. Међутим, потпуно поверење у модерну рачунарску технологију може да буде апсурдно и, у доста случајева, опасно. У сваком озбиљном систему данас се разматрају безбедносни изазови примене савремених информационих технологија: правне дилеме, етичка питања и ризици поузданости."},{"page_url":"https://ca.wikipedia.org/wiki/Adrien_Brody","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Adrien_Brody_2011_Shankbone.JPG","page_title":"Adrien Brody","context_page_description":"Adrien Brody és un actor estatunidenc, guanyador d'un oscar. Va rebre el reconeixement del públic després de fer de protagonista a la pel·lícula El pianista, de Roman Polanski."},{"page_url":"https://fr.wikipedia.org/wiki/Powelliphanta_marchantii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Powelliphanta_marchanti_DOC_1986.jpg","page_title":"Powelliphanta marchantii","context_page_description":"Powelliphanta marchanti est une espèce de mollusques gastéropodes de la famille des Rhytididae."},{"page_url":"https://hu.wikipedia.org/wiki/Haba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Pyramid_of_Khaba.png","page_title":"Haba","context_page_description":"Haba vagy Khaba az óegyiptomi III. dinasztia tagja. Sem származása, sem a dinasztiában elfoglalt időrendi helye, sem uralkodásának időtartama és ideje nem tisztázott. Néhány nevével ellátott emlék alapján a mai Zavijet el-Arjan mellett épített, de soha be nem fejezett lépcsős piramis tulajdonosának tartják. A torinói királylista Szehemhet utódaként egy Hudzsefaként rekonstruált név olvasható hat év uralkodási idővel, míg az abüdoszi királylista ugyanezen a helyen egy Szedzsesz nevet tartalmaz. Talán a Haba Hór-név volt, míg az uralkodói név Hudzsefa, amelyet az abüdoszi írnok nem tudott kiolvasni.\\nA Zavijet el-Arjan melletti ókori temető több masztabájában találtak kővázákat, amelyeken a szereh-keretbe írt Haba név szerepel, ilyen volt például a Z-500 jelű sír. Dzsószer utánra datálását csak az elvétve előforduló szenu-keret indokolja."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D1%8F%D0%BD%D0%B8_(%D0%92%D0%BE%D0%BB%D0%BE%D1%87%D0%B8%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Poliany_vol_prapor.png","page_title":"Поляни (Волочиський район)","context_page_description":"Поля́ни — село в Україні, у Волочиській міській територіальній громаді Волочиського району Хмельницької області. Населення становить 881 особу."},{"page_url":"https://it.wikipedia.org/wiki/Distretto_di_%C5%BDark%C3%B6l","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Fyodorov_District_Kazakhstan.png","page_title":"Distretto di Žarköl","context_page_description":"Il distretto di Žarköl è un distretto del Kazakistan con capoluogo Žarköl."},{"page_url":"https://ca.wikipedia.org/wiki/Arquebisbat_de_Huancayo","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/11junin.jpg","page_title":"Arquebisbat de Huancayo","context_page_description":"L'arquebisbat de Huancayo és una seu de l'Església Catòlica a Perú. Al 2013 tenia 812.000 batejats sobre una població de 874.000 habitants. Actualment està regida pel bisbe cardenal Pedro Ricardo Barreto Jimeno, S.J."},{"page_url":"https://sv.wikipedia.org/wiki/De_Dion-axel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/DeDion_Axle_Diagram.png","page_title":"De Dion-axel","context_page_description":"En De Dion-axel är en typ av hjulupphängning för bilar. Det är en sofistikerad typ av icke-individuell hjulupphängning och en betydande förbättring jämfört med en stel hjulaxel eller pendelaxel. De Dion-axeln har kardanknutar både vid hjulnaven och vid differentialväxeln och använder ett odelat rör för att hålla hjulen parallella. Till skillnad från en krängningshämmare är De Dion-röret inte fäst direkt i chassit och är inte avsett att fjädra. Fjädringsgeometrin påminner om den typ av stel hjulaxel som finns på Volvo 440 och Alfa Romeo Alfasud, men saknar möjlighet till torsionsvridning.\\nTill De Dion-axelns fördelar hör:\\nDen ofjädrade vikten reduceras jämfört med en stel bakaxel, eftersom differentialväxeln är fäst vid chassit.\\nTill skillnad från en individuell hjulupphängning uppstår inga förändringar av cambervinklarna när fjädringen avlastas. Eftersom cambervinkeln på båda hjulen är fixerade vid noll grader, bibehålls det goda grepp som breda däck ger. Samtidigt reduceras tendenserna till studsande hjul som uppstår när motorstarka bilar ska ha ner kraften i vägen.\\nMen där finns även nackdelar:"},{"page_url":"https://nl.wikipedia.org/wiki/Obama_(Fukui)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Myotsuji_and_pagoda.jpg","page_title":"Obama (Fukui)","context_page_description":"Obama is een havenstad aan de Wakasa-baai aan de Japanse Zee in de prefectuur Fukui in Japan. De oppervlakte van de stad is 232,85 km² en begin 2009 had de stad ruim 31.000 inwoners.\\nDe stad Obama steunde in 2008 Barack Obama bij de Amerikaanse presidentsverkiezingen. Men hoopte dat dit een positieve invloed zou hebben op het toerisme. De naamsovereenkomst werd door diverse media belicht."},{"page_url":"https://de.wikipedia.org/wiki/Iowa-Klasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/USS_New_Jersey_16_inch_guns.jpg","page_title":"Iowa-Klasse","context_page_description":"Die Iowa-Klasse ist eine Klasse von Schlachtschiffen, die die US Navy während des Zweiten Weltkrieges in Dienst stellte.\\nDie Iowas gehören zu den letzten Vertretern dieser Gattung, lediglich die britische HMS Vanguard und die französische Jean Bart wurden später in Dienst gestellt. Sechs Schiffe wurden auf Kiel gelegt, jedoch nur vier tatsächlich vollendet. Die Einheiten nahmen am Pazifik-, Korea-, Vietnam- sowie, nach umfassender Modernisierung, am Zweiten Golfkrieg teil, wurden jedoch aufgrund des hohen Personalbedarfs in Friedenszeiten immer wieder der Reserveflotte zugeordnet. Im März 2006 wurden die Schiffe vermutlich endgültig aus dem Schiffsregister gestrichen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BB%D1%8C%D1%84_%D0%91%D0%BE%D1%81%D1%82%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Ralph_Boston_1960.jpg","page_title":"Ральф Бостон","context_page_description":"Ральф Га́рольд Бо́стон — американський легкоатлет, олімпійський чемпіон, срібний та бронзовий призер літніх Олімпійських ігор зі стрибків у довжину."},{"page_url":"https://hu.wikipedia.org/wiki/Cuyahoga_megye","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Cuyahoga_County_Courthouse.jpg","page_title":"Cuyahoga megye","context_page_description":"Cuyahoga megye az Amerikai Egyesült Államokban, azon belül Ohio államban található. Megyeszékhelye és legnagyobb városa Cleveland. Lakosainak száma 1 263 154 fő. +/- Cuyahoga megye Summit, Lake, Geauga, Medina, Lorain és Portage megyékkel határos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC%D0%B1%D1%83%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Tropenmuseum_Royal_Tropical_Institute_Objectnumber_H-3352_Aquarel_voorstellende_schoeners_voor_ee.jpg","page_title":"Домбург","context_page_description":"Домбург — город и одна из семи коммун округа Ваника в Суринаме. Домбург расположен на левом берегу реки Суринам, примерно в 16 километрах от столицы страны Парамарибо. На севере и востоке он граничит с курортом Домбург в округе Коммевейне. Рядом с городом находится белый пляж. Согласно переписи населения 2012 года в Домбурге проживал 5 661 человек.\\nПлантация Домбург, на которой выращивали сахарный тростник, была основана в начале XVIII века и просуществовала до 1863 года. В том году, после отмены рабства в Суринаме, производство потеряло рентабельность и плантация пришла в упадок. В 1880 году колониальная администрация поселила здесь бывших рабов, поделив бывшую плантацию на несколько фермерских хозяйств. Одновременно с этим в Домбурге были построены школы, открыт рынок и учреждена коммуна. Дом владельца плантации был преобразован в здание местной администрации. Позднее, здесь также стали селить трудовых мигрантов из Нидерландской Ост-Индии.\\nВ этом городе родился Дези Баутерсе — один из организаторов военного переворота в Суринаме в 1980 году и участников Декабрьских убийств, с 2010 года являющийся президентом Суринама."},{"page_url":"https://eo.wikipedia.org/wiki/Golfo_Halong","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Vietnam_-_Baie_d%27Ha_Long_-_50_%2813%29.JPG","page_title":"Golfo Halong","context_page_description":"La Halong-golfo estas parto de la Tonkin-golfo en Vjetnamio. En la golfo troviĝas 2000 insuletoj, klifoj el kalkŝtono, kiuj facile formiĝis pro fortoj de la naturo. Inter la fluso kaj malfluso estas 3 m. La golfo estas vizitebla nur per boatoj, ekskursaj ŝipoj. Ĝi kaj la samnoma urbo Ha Long estas parto de la Monda Natura Heredaĵo de UNESKO. Halong signifas: golfo de la alteriĝanta drako"},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%99%D7%9C%D7%91%D7%A8%D7%98_%D7%A7%D7%95%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/ANCExplorer_Gilbert_R._Cook_grave.jpg","page_title":"גילברט קוק","context_page_description":"גילברט ר. קוק היה מייג'ור גנרל בצבא ארצות הברית, אשר פיקד על כוחות בחזית מערב אירופה במלחמת העולם השנייה."},{"page_url":"https://en.wikipedia.org/wiki/Aurelian","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Porta_Asinaria_2948.JPG","page_title":"Aurelian","context_page_description":"Aurelian was Roman emperor from 270 to 275. His reign featured an unprecedented series of military victories which reunited the Roman Empire after it had practically disintegrated under the pressure of barbarian invasions and internal revolts. His successes were instrumental in ending the Crisis of the Third Century, earning him the title Restitutor Orbis – \\"Restorer of the World\\".\\nBorn in humble circumstances, he rose through the military ranks to become emperor. During his reign, he defeated the Alamanni after a devastating war. He also defeated the Goths, Vandals, Juthungi, Sarmatians, and Carpi. Aurelian restored the Empire's eastern provinces after his conquest of the Palmyrene Empire in 273. The following year he conquered the Gallic Empire in the west, reuniting the Empire in its entirety. He was also responsible for the construction of the Aurelian Walls in Rome, the abandonment of the province of Dacia, and monetary reform. Although Domitian, two centuries previous, was the first emperor who had demanded to be officially hailed as dominus et deus, these titles never occurred in written form on official documents until the reign of Aurelian."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%A1%E0%A5%87%E0%A4%95%E0%A5%8B%E0%A4%9F%E0%A4%BE_%E0%A4%9C%E0%A5%8B%E0%A4%A8%E0%A4%B8%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Dakota_Johnson_2014_%28cropped%29.jpg","page_title":"डेकोटा जोनसन","context_page_description":"डेकोटा मेई जोनसन एक अमेरिकी चलचित्र अभिनेत्री र मोडल हुन्।"},{"page_url":"https://pt.wikipedia.org/wiki/Rouvroy-sur-Audry","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/FR-08-Rouvroy-sur-Audry.JPG","page_title":"Rouvroy-sur-Audry","context_page_description":"Rouvroy-sur-Audry é uma comuna francesa na região administrativa de Grande Leste, no departamento das Ardenas. Estende-se por uma área de 9,15 km². Em 2010 a comuna tinha 570 habitantes."},{"page_url":"https://it.wikipedia.org/wiki/Parit%C3%A0_dello_zero","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/012345Pairs.svg","page_title":"Parità dello zero","context_page_description":"La parità dello zero è una nozione matematica caratterizzata, nonostante la sua semplicità, da limitata consapevolezza nella popolazione delle società occidentali, dovuta a bias cognitivo e spesso a fraintendimenti del concetto nel percorso di istruzione scolastica inferiore. Lo zero è infatti un numero pari in quanto ne soddisfa banalmente la definizione, essendo un multiplo intero di 2 dato dal fatto che 0 × 2 = 0. Ciononostante, una percentuale significativa di studenti, adulti e insegnanti nutre convinzioni errate sull'argomento, e tra le più comuni vi è l'idea che zero non sia né pari né dispari.\\nLe regole di parità dell'aritmetica richiedono che lo 0 sia pari. Lo 0 è l'elemento neutro additivo dell'insieme degli interi pari ed è l'elemento a partire dal quale tutti gli altri numeri naturali pari sono definiti ricorsivamente. Alcune applicazioni di questa ricorsione, utilizzate dalla teoria dei grafi alla geometria computazionale, si basano sul fatto che lo 0 sia pari. Oltre ad essere divisibile per 2, lo 0 è divisibile per ogni intero positivo."},{"page_url":"https://en.wikipedia.org/wiki/Pyrgomorpha_conica","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Pyrgomorpha_conica_2.jpg","page_title":"Pyrgomorpha conica","context_page_description":"Pyrgomorpha conica is a species of pyrgomorph native to the Mediterranean Basin and Gran Canaria."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Esslingen_am_Neckar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/ES_J%C3%A4gerhaus_1907.jpg","page_title":"Liste der Kulturdenkmale in Esslingen am Neckar","context_page_description":"In der Liste der Kulturdenkmale in Esslingen am Neckar sind Bau- und Kunstdenkmale der Stadt Esslingen am Neckar verzeichnet. Die Liste wurde nach der Denkmaltopographie Bundesrepublik Deutschland erstellt.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Esslingen erhältlich."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EB%82%98%ED%9B%84%EB%84%A4_%EC%BC%80%EC%9D%B4%EC%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Keiji_Inafune_-_Japan_Expo_13-_2012-0706-_P1410048.JPG","page_title":"이나후네 케이지","context_page_description":"이나후네 케이지는 일본의 비디오 게임 개발자이다. 1980년대 후반 캡콤에 입사해 일러스트레이터로서 경력을 시작했다. 1987년에 발매된 스트리트 파이터 가 그가 처음으로 참여한 게임이며, 당시 가정용 비디오 게임 시장을 노리던 회사의 정책 하에 패미컴용으로 제작된 록맨 시리즈의 주요 개발진의 일원이 됐다. 처음에는 아티스트로서 록맨 X의 제로 등의 캐릭터 디자인을 맡았고, 종국에는 프로듀서 후지사와 도쿠로의 이탈로 1996년의 록맨 8부터 시리즈의 프로듀서로 등극했다. 이후 록맨 대시, 록맨 에그제, 록맨 제로 등 록맨 세부 시리즈의 제작 총괄을 맡았고, 로스트 플래닛, 데드 라이징, 귀무자 등 다른 캡콤 프렌차이즈 제작에도 관여했다.\\n2010년에 캡콤을 퇴사한 이후 본인이 CEO인 회사 콤셉트를 설립해 게임 제작을 이어나갔다. 콤셉트는 2017년에 LEVEL-5에 매각돼 자회사가 됐다."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B4%D8%AA_%D8%B1%D9%88%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Meerani_Dam_Turbat_Kech.jpg","page_title":"دشت رود","context_page_description":"دشت رود رودی است به دریای عرب می‌ریزد. این رود از کشور پاکستان می‌گذرد."},{"page_url":"https://ba.wikipedia.org/wiki/%D2%BA%D0%B0%D0%BD%D0%B4%D1%83%D2%93%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Luscinia_megarhynchos_Istria_01.jpg","page_title":"Һандуғас","context_page_description":"Һандуғас, былбыл — турғайҙан бер ни тиклем ҙурыраҡ. Оҙон ғына аяҡлы, төҙөк кәүҙәле ҡош. Ерҙә йәки ағастарҙың аҫҡы ботаҡтарында йөрөйҙәр. Һайрағанда үрге ботаҡтарға күсә. Өҙлөкһөҙ ҡойроғон һелккеләй. Һырты һорғолт көрән, кәүҙәһенең аҫ яғы аҡһыл һоро. Башҡа ҡоштар менән бутарлыҡ түгел.\\nТоноҡ ҡына тауышлы: «Фьюйт, тррр». Һайрауы һәр кешегә билдәле. Япрағлы һәм аралаш урмандарҙа, туғайҙарҙа, ағаслы һыу буйҙарында йәшәй. Төрлө бөжәктәр менән туҡлана. Күсмә ҡош. Киң таралған. Ерҙә оялай.\\nҒәҙәттә, 5 бөртөк һарғылт көрән йомортҡа һала."},{"page_url":"https://hu.wikipedia.org/wiki/Zaragozai_Szent_Vince","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/180731_Szent_Vince_szobra_a_Bory-v%C3%A1rban.jpg","page_title":"Zaragozai Szent Vince","context_page_description":"Szent Vince a korai keresztény idők azon szentjei közé tartozik, akik történeti valósága kétségtelen, de életükről és halálukról alig maradt fenn megbízható híradás."},{"page_url":"https://de.wikipedia.org/wiki/Wappen_der_Republik_Tatarstan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Coat_of_Arms_of_Tatarstan.svg","page_title":"Wappen der Republik Tatarstan","context_page_description":"Das Wappen der Republik Tatarstan ist ein staatliches Symbol Tatarstans und seit dem 7. Februar 1992 offizielles Wappen der autonomen Republik.\\nDas Wappen ist in den Nationalfarben Tatarstans – rot, grün und weiß – gehalten. Zentrales Element des Wappens ist ein geflügelter weißer Irbis, mit angehobener rechten Vorderpfote, auf einer cadmiumroten Sonnenscheibe. Der Irbis trägt ein Schild mit einer Asternrosette, die aus acht Blütenblättern besteht. Umrandet ist die Sonnenscheibe von einem weißen Rand, gefolgt von einem goldfarbenen tatarischen Volksornament auf kobaltgrünem Grund. Am unteren Teil des Ornamentes steht die Aufschrift Tatarstan.\\nDas heutige Wappen wurde von Nasym Gabdrachmanowitsch Chansafarow und Rif Zägri ulı Fäxretdinev geschaffen."},{"page_url":"https://en.wikipedia.org/wiki/January_1901","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Queen_Victoria_by_Bassano.jpg","page_title":"January 1901","context_page_description":"The following events occurred in January 1901:"},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A5%8C%E0%A4%A4%E0%A4%BF%E0%A4%95%E0%A5%80_%E0%A4%AE%E0%A5%87%E0%A4%82_%E0%A4%A8%E0%A5%8B%E0%A4%AC%E0%A5%87%E0%A4%B2_%E0%A4%B5%E0%A4%BF%E0%A4%9C%E0%A5%87%E0%A4%A4%E0%A4%BE%E0%A4%93%E0%A4%82_%E0%A4%95%E0%A5%80_%E0%A4%B8%E0%A5%82%E0%A4%9A%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Robert_Laughlin%2C_Stanford_University.jpg","page_title":"भौतिकी में नोबेल विजेताओं की सूची","context_page_description":"भौतिकी के विभिन्न क्षेत्रों में वैज्ञानिकों को रॉयल स्वीडिश एकेडमी ऑफ साइंसेज द्वारा प्रतिवर्ष भौतिकी में नोबेल पुरस्कार दिया जाता है। यह अल्फ्रेड नोबेल के 1895 के वसीयत द्वारा स्थापित पांच नोबेल पुरस्कारों में से एक है, जो भौतिकी में उत्कृष्ट योगदान के लिए प्रदान किया गया है। नोबेल की इच्छा के अनुसार, यह पुरस्कार नोबेल फाउंडेशन द्वारा दिया जाता है और रॉयल स्वीडिश एकेडमी ऑफ साइंसेज द्वारा प्रदान किया जाता है। यह पुरस्कार स्टॉकहोम में 10 दिसंबर को एक वार्षिक समारोह में नोबेल की मृत्यु की वर्षगांठ पर प्रदान किया जाता है। प्रत्येक प्राप्तकर्ता को एक पदक, एक डिप्लोमा और एक मौद्रिक पुरस्कार, जो कि पूरे वर्ष में भिन्न होता है, मिलता है।"},{"page_url":"https://nl.wikipedia.org/wiki/Willem-Alexander_der_Nederlanden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Maxima_Rutte_Willem-Alexander.jpg","page_title":"Willem-Alexander der Nederlanden","context_page_description":"Willem-Alexander Claus George Ferdinand, Koning der Nederlanden, Prins van Oranje-Nassau, Jonkheer van Amsberg is sinds 30 april 2013 Koning der Nederlanden. Hij is het oudste kind uit het huwelijk van Beatrix, Prinses der Nederlanden, en Claus, Prins der Nederlanden, Jonkheer van Amsberg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D0%BA%D0%B0%D0%BD%D0%B3%D1%96%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/uk/f/f3/Astroplatypus_incompertus_mycangium.jpg","page_title":"Мікангій","context_page_description":"Мікангій — зовнішній орган на тілі членистоногих для збереження й поширення спор і гіфів грибів, які живляться за рахунок рослинних субстратів. Звичайно, це Аскомікотові гриби. Найчастіше мікангій мають самиці комах, личинки яких мешкають у деревині, що послаблена і/або розкладається. Серед них чимало міцетофагів, для яких гриби та спори є їжею. Комахи інших харчових груп, завдячуючи грибам, пришвидшують розкладання деревини до їстівного для комах стану і послаблюють захисні властивості рослини. Взаємини між грибом та цими комахами є прикладом мутуалізму. Мікангії мають також деякі кліщі."},{"page_url":"https://sv.wikipedia.org/wiki/Insj%C3%B6n,_Leksands_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Insj%C3%B6n_fr%C3%A5n_ovan_%283%29.JPG","page_title":"Insjön, Leksands kommun","context_page_description":"Insjön, är en tätort i Leksands kommun, tillika kyrkort i Åls socken, Dalarnas län och ligger cirka 10 kilometer sydost om Leksand.\\nOrten genomkorsas av riksväg 70 samt av järnvägen Dalabanan."},{"page_url":"https://fr.wikipedia.org/wiki/Puritanisme","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Puritan_Hearthstone.png","page_title":"Puritanisme","context_page_description":"Le puritanisme est un courant spirituel du calvinisme qui désirait « purifier » l'Église d'Angleterre du catholicisme à partir de 1559 et en Nouvelle-Angleterre à partir de 1630."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%90%9D%E4%BC%A6%C2%B7%E8%94%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Lauren_Tsai_by_Gage_Skidmore.jpg","page_title":"萝伦·蔡","context_page_description":"蘿倫·蔡，模特兒藝名Lala，是一名美國華裔女模特兒、演員兼插畫家。2016年，因出演《雙層公寓：夏威夷》為人熟知。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%95%E0%B9%89%E0%B8%AD%E0%B8%81%E0%B8%A3%E0%B8%B0%E0%B8%88%E0%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Cataract_in_human_eye.png","page_title":"ต้อกระจก","context_page_description":"ต้อกระจกเป็นโรคของตาอย่างหนึ่ง คือภาวะที่เกิดความขุ่นขึ้นที่เลนส์ตาหรือปลอกหุ้มเลนส์ตาซึ่งปกติจะมีความใส เมื่อขุ่นแล้วจะทำให้แสงผ่านได้แย่กว่าปกติ\\nสาเหตุของการเกิดต้อกระจก\\nการเกิดต้อกระจกนั้นส่วนใหญ่มีสาเหตุมาการเสื่อมของเลนส์ตา โดยส่วนมากโรคต้อกระจกนี้จะพบกับผู้ทีมีอายุ 65 ปีขึ้นไป บางรายอาจเกิดจากการติดเชื้อไวรัสจากมารดาขณะตั้งครรภ์ หรือการที่กินยาสเตียรอยด์เป็นประจำก็เป็นสาเหตุของการเกิดต้อกระจกได้เช่นกัน"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%95%D7%91%D7%A8%D7%98_%D7%9C%D7%95%D7%A4%D7%96_(%D7%A4%D7%96%D7%9E%D7%95%D7%A0%D7%90%D7%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Robert_Lopez.jpg","page_title":"רוברט לופז (פזמונאי)","context_page_description":"רוברט לופז הוא כותב שירים של מחזות זמר. ידוע במיוחד בזכות כתיבת השירים במחזות הזמר אבניו קיו וספר המורמונים והסרט לשבור את הקרח.\\nלופז זכה בפרסי האוסקר, אמי, גראמי וטוני. הוא אחד מחמישה עשר האנשים שזכו בארבעת הפרסים, הזוכה שזכה בהם בזמן הקצר ביותר ובגיל הצעיר ביותר, והיחיד בעל זכייה כפולה בכל אחד מהפרסים."},{"page_url":"https://en.wikipedia.org/wiki/Wolfgang_Treu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/WolfgangTreu.jpg","page_title":"Wolfgang Treu","context_page_description":"Wolfgang Treu was the mayor of Vienna from 1528 to 1530, 1532 to 1533 and 1536 to 1537. The Siege of Vienna occurred during his first term in office."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%90%E1%80%9B%E1%80%AF%E1%80%90%E1%80%BA%E1%80%92%E1%80%8F%E1%80%B9%E1%80%8D%E1%80%AC%E1%80%9B%E1%80%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Chi_You.gif","page_title":"တရုတ်ဒဏ္ဍာရီ","context_page_description":"တရုတ်ဒဏ္ဍာရီ သည် တရုတ်နိုင်ငံ၌ နှုတ်အားဖြင့်သော်လည်းကောင်း စာပေမှတ်တမ်းများဖြင့်သော်လည်းကောင်း လက်ဆင့်ကမ်းသယ်ဆောင်ခဲ့သော ဒဏ္ဍာရီတစ်ခုဖြစ်သည်။ တရုတ်ဒဏ္ဍာရီတွင် ဒေသဆိုင်ရာ၊ ယဉ်ကျေးမှုဆိုင်ရာ ရိုးရာအစဉ်လာများမှ အမျိုးမျိုးသော ဒဏ္ဍာရီများပါဝင်သည်။ တရုတ်ဒဏ္ဍာရီသည် တစ်မူတည်းဖြစ်သည့် အမျိုးအစားမဟုတ်သကဲ့သို့ ရှေးခေတ်ဟန်လူမျိုးများကြား၌ပင် ပေါင်းစပ်ထည့်သွင်းစနစ်မျိုးလည်းမဟုတ်ပေ။ တိုင်းရင်းသားလူမျိုးများ၊ သမိုင်းခေတ်များ၊ ပထဝီဒေသဆိုင်ရာ နယ်မြေများ၊ အမျိုးမျိုးအစားစားသော လူတန်းစားများ စသည်တို့၏ ရိုးရာအစဉ်လာများ၌ တရုတ်ဒဏ္ဍာရီကို တွေ့ကြုံနိုင်ပါသည်။ တရုတ်ပြည်သည် များပြားလှသော ဒဏ္ဍာရီအစဉ်လာများပေါက်ဖွားရာ ဇာတိလည်းဖြစ်၍ ဟန်လူမျိုးများ၏ ဒဏ္ဍာရီ၊ ဟန်ခေတ်မတိုင်မီ ဟွားရှီးလူမျိုးများ၏ ဒဏ္ဍာရီ၊ တိဘက်ဒဏ္ဍာရီ၊ တားကစ်ဒဏ္ဍာရီ၊ ကိုရီးယားဒဏ္ဍာရီနှင့် အခြားများစွာသော ဒဏ္ဍာရီများပါဝင်သည်။ သို့သော် တရုတ်ဒဏ္ဍာရီသည် တရုတ်ဘာသာစကား၌ပါသော အကြောင်းအရာများကို အလေးပေးသည့်အနေထားရှိသည်။\\nဒဏ္ဍာရီခပ်များများတွင် အံ့ဩဖွယ်ရာကောင်းသော လူနှင့် သက်ရှိများ၊ မှော်အစွမ်း တန်ခိုးအစွမ်းသုံးခြင်း စသဖြင့် စိတ်လှုပ်ရှားစရာကောင်းသော ဇာတ်လမ်းပုံပြင်များပါဝင်သည်။ ထိုကဲ့သို့သောအကြောင်းအရာများသည် ဒဏ္ဍာရီဆန်သော ခေတ်၊ ဒေသများ၌ ထူးထူးခြားခြားဖြစ်ပျက်လေ့ရှိသည်။"},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CF%81%CF%87%CE%B7%CE%B3%CF%8C%CF%82_%CE%BA%CF%81%CE%AC%CF%84%CE%BF%CF%85%CF%82_%CF%84%CF%89%CE%BD_%CE%9A%CE%BF%CE%BC%CE%BF%CF%81%CF%8E%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Seal_of_the_Comoros.svg","page_title":"Αρχηγός κράτους των Κομορών","context_page_description":"Οι Κομόρες έγιναν ανεξάρτητο κράτος από την Γαλλία το 1975. Αρχηγός Κράτους με βάση το Σύνταγμα είναι ο Πρόεδρος της Ένωσης των Κομορών, ωστόσο δεν ήταν λίγες οι φορές που αρχηγοί κράτους υπήρξαν στρατιωτικοί ηγέτες και ηγέτες που ήλθαν στην εξουσία έπειτα από πραξικόπημα.\\nΟ πρόεδρος Αχμέτ Αμπνταλά δολοφονήθηκε στις 26 Νοεμβρίου 1989, στη διάρκεια πραξικοπήματος από τον Σαΐντ Μοχάμεντ Τζοχάρ, δίδυμο αδερφό του προηγούμενου προέδρου. Το 1998 πέθανε εν ενεργεία ο πρόεδρος Μοχάμετ Τακί Αμπντουλκαρίμ.\\nΜε βάση το σημερινό σύνταγμα, ο Πρόεδρος της Ένωσης των Κομορών εκλέγεται από το λαό για θητεία 5 ετών."},{"page_url":"https://zh.wikipedia.org/zh-tw/2009%E5%B9%B4%E5%9C%B0%E4%B8%AD%E6%B5%B7%E7%A7%BB%E6%B0%91%E6%B5%B7%E9%9A%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Libya_2009_shipwreck.png","page_title":"2009年地中海移民海难","context_page_description":"2009年3月27日，至少有一艘運送從利比亞到義大利的移民的船傾覆了。據信，這艘船載有250名來自埃及、突尼西亞、巴勒斯坦和奈及利亞的移民。義大利和利比亞海軍的救援行動從船上救出了21名倖存者，並打撈了21具屍體。在救援工作被取消之前，另外77具屍體隨後被衝上利比亞海岸。另外兩艘船隻也在利比亞和義大利之間失蹤，其中大約有250人。3月29日，一艘載有350人的第四艘船在同一海域被義大利商船救起。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B8%B0%E0%B8%AE%E0%B9%8C%E0%B8%A3%E0%B8%B4%E0%B8%8B%E0%B8%95%E0%B8%AD%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Isfahan_counties.svg","page_title":"ชะฮ์ริซตอน","context_page_description":"เคาน์ตีในอิหร่านเรียกว่า ชะฮ์ริซตอน เป็นการปกครองแบบรัฐขนาดใหญ่กว่า คำว่า ชะฮ์ริซตอน มาจากภาษาเปอร์เซีย คำว่า ชะฮ์ร šahr และ อุซตอน stân ได้ “Country เขตปกครองท้องถิ่น” น่าจะให้ความหมายที่ใกล้เคียงกับ shahrestan ได้มากที่สุด\\nเขตปกครองท้องถิ่นทั้งหลายของอิหร่านแบ่งออกเป็นหนึ่งบัคช์ อำเภอหรือมากกว่า, เขตปกครองท้องถิ่นโดยทั่วไปจะรวมเมืองสองเมืองกับตำบลที่รวมหมู่บ้านต่างๆเข้าด้วยกันซึ่งเป็นการจับกลุ่มของหมู่บ้านที่อยู่ติดกัน หนึ่งเมืองที่อยู่ในเขตปกครองจะเป็นเมืองหลวงของเขตปกครองนั้น\\nแต่ละเขตปกครองจะถูกควบคุมโดยสำนักงานที่เรียกว่า ฟัรมอนดอรี ซึ่งประสานงานสาธารณะต่างๆกับหน่วยงานทั้งหลาย โดยมีฟัรมอนดอรและเจ้าหน้าที่ระดับสูงสุดอยู่ในภาคส่วน\\nในบรรดามลรัฐต่างๆของอิหร่าน ฟอร์ซมีจำนวนชะฮ์ริซตอนมากที่สุด ขณะที่กุมเป็นชะฮ์ริซตอนเดียวที่กลายเป็นมลรัฐ ในปีพ. ศ. 2548 อิหร่านมี 324 ชะฮ์ริซตอน"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2005","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/NBN_C9_gernaey.MM.jpg","page_title":"Lijst van personen overleden in 2005","context_page_description":"Dit is een lijst van personen die zijn overleden in 2005."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1934","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Yves_Coppens_detail.jpg","page_title":"Lijst van personen geboren in 1934","context_page_description":"Dit is een lijst van personen die geboren zijn in 1934.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://lt.wikipedia.org/wiki/Gruo%C5%BEninkai","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Grendav%C4%97s_sen.%2C_Lithuania_-_panoramio_%288%29.jpg","page_title":"Gruožninkai","context_page_description":"Gruožninkai – kaimas Trakų rajono pietuose, 5 km į pietryčius nuo Onuškio. Seniūnaitijos centras. Keliai į Onuškį, Lieponius, Semeniškes. Kaimo pietryčiuose telkšo Gruožio ir Gruožaičio ežerai, o iš šiaurės rytų prieina Samninkėlių miškas."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Detmold-Kernstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Detmold_-_027_-_Krumme_Stra%C3%9Fe_18.jpg","page_title":"Liste der Baudenkmäler in Detmold-Kernstadt","context_page_description":"Die Liste der Baudenkmäler in Detmold-Kernstadt enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Detmold-Kernstadt in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Detmold eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://nl.wikipedia.org/wiki/Kanton_Marseille-Saint-Barth%C3%A9lemy","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Sainte-Marthe-en-Provence_2006_01.jpg","page_title":"Kanton Marseille-Saint-Barthélemy","context_page_description":"Marseille-Saint-Barthélemy is een kanton van het Franse departement Bouches-du-Rhône. Het kanton maakt deel uit van het arrondissement Marseille.\\nHet kanton omvat de volgende wijken van Marseille:\\nLes Arnavaux\\nLe Canet\\nLe Merlan\\nBon Secours\\nSaint-Barthélémy\\nSainte-Marthe\\nGrand Saint-Barthélémy"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%9C%8B%E6%B3%B0%E8%88%AA%E7%A9%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/P3010516_%2825959417001%29.jpg","page_title":"國泰航空","context_page_description":"国泰航空有限公司是香港第一间提供民航服务的航空公司，为太古集团及寰宇一家成员，以香港国际机场作为枢纽。国泰航空的主要业务是经营定期航空业务、航空货运、航空饮食及航机处理，旗下子公司包括国泰港龙航空、香港快运航空、香港华民航空及香港机场地勤服务有限公司。\\n国泰航空曾经于2003、2005、2009、2014年期间4度赢得世界航空业权威机构Skytrax的“年度最佳航空公司”大奖，亦被Skytrax评为“五星级航空公司”之一。"},{"page_url":"https://es.wikipedia.org/wiki/T%C3%A2rgu_Jiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Stema_jud_Gorj.jpg","page_title":"Târgu Jiu","context_page_description":"Târgu Jiu es una ciudad de Rumania en el distrito Gorj, Oltenia. Está ubicada en la costa este del río Jiu, de donde proviene el nombre."},{"page_url":"https://en.wikipedia.org/wiki/1990_Pacific_hurricane_season","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Polo_1990_track.png","page_title":"1990 Pacific hurricane season","context_page_description":"The 1990 Pacific hurricane season was a very active season which observed 21 named storms within the basin. The season also produced the fourth highest ACE index value on record. The season was officially started on May 15 in the eastern Pacific, and on June 1 in the central Pacific, and lasted until November 30. These dates conventionally delimit the period of each year when most tropical cyclones form in the northeastern Pacific Ocean. However, these bounds were slightly exceeded when Hurricane Alma formed on May 12.\\nHurricane Alma became the third earliest tropical cyclone in the Eastern Pacific basin since the satellite era began in 1966, while Trudy is the third strongest October eastern Pacific hurricane on record. Overall, the impact of this season was minimal. Tropical Storm Rachel made two landfalls in Mexico and brought rain to the United States. Hurricane Boris brought light showers to California."},{"page_url":"https://it.wikipedia.org/wiki/Renaud_Jay","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Renaud_Jay_FIS_Cross-Country_World_Cup_2012_Quebec.jpg","page_title":"Renaud Jay","context_page_description":"Renaud Jay è un fondista francese."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%BDeleznice_Slovenskej_republiky","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Logo_%C5%BDeleznice_Slovenskej_republiky.jpg","page_title":"Železnice Slovenskej republiky","context_page_description":"Železnice Slovenskej republiky – podmiot odpowiadający za zarządzanie państwową siecią kolejową na Słowacji, do 2001 także przewoźnik kolejowy.\\nPrzedsiębiorstwo było następcą Kolei Czechosłowackich na terenie Słowacji, po podziale Czechosłowacji w 1993 r. Do 1996 miało ustawowy monopol na przewozy kolejowe, po tej dacie było faktycznym monopolistycznym przewoźnikiem. 1 stycznia 2002 przedsiębiorstwo podzielono, pozostawiając ŽSR jedynie zarząd infrastrukturą, natomiast przewozami kolejowymi zajęła się spółka Železničná spoločnosť, podzielona następnie od 1 stycznia 2005 na Železničná spoločnosť Slovensko zajmującą się przewozami pasażerskimi i Železničná spoločnosť Cargo Slovakia, zajmującą się przewozami towarowymi.\\nW roku 2008 r. w słowackim rozkładzie jazdy były: 174 pociągi osobowe, 53 pociągi przyspieszone, 79 pociągów pospiesznych, 12 ekspresów, 13 pociągów InterCity, 13 pociągów EuroCity, 19 pociągów EURegio, 2 EuroNight, 22 RegionalExpressów."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%BApula_(bot%C3%A1nica)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/FagusSylvNuts.jpg","page_title":"Cúpula (botánica)","context_page_description":"En botánica, el término cúpula puede referirse a:​\\nEn la familia Fagaceae, producción de origen axial, acrecida durante el desarrollo del fruto o de la infrutescencia y que los envuelve en mayor o menor grado; acompaña a los aquenios propios de sus representantes. También llamado calibio. Ejemplos: la base de las bellotas de los robles, el \\"erizo\\" de las castañas, el \\"hayuco\\" de las hayas.\\nIntumescencia seminífera de los Tejos.\\nEnvoltura que se halla en torno al macrosporangio de las Pteridospermatophyta."},{"page_url":"https://simple.wikipedia.org/wiki/Bratislava","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Einsteinova.jpg","page_title":"Bratislava","context_page_description":"Bratislava is the capital city of Slovakia. About 450,000 people live there. It used to be called Pressburg or Pozsony and by some other names. Bratislava is the seat of national government, the presidency, and the parliament. It has several museums, galleries and of other educational, cultural and economic institutions.\\nThere is a small Old Town, and a castle called Bratislavský Hrad. The Danube river goes through Bratislava."},{"page_url":"https://pl.wikipedia.org/wiki/Pochodna_kierunkowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Directional_derivative_contour_plot.svg","page_title":"Pochodna kierunkowa","context_page_description":"Pochodna kierunkowa – pochodna funkcji wielu zmiennych obliczona w kierunku dowolnego wektora jednostkowego Pochodna kierunkowa jest uogólnieniem pojęcia pochodnej cząstkowej na dowolne kierunki, przy czym pochodne cząstkowe są tożsame z pochodnymi w kierunkach wektorów jednostkowych bazy układu współrzędnych."},{"page_url":"https://en.wikipedia.org/wiki/Kinilaw","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Ensaladang_Lato_%28Seaweed_Salad%29_-_Philippines_2.jpg","page_title":"Kinilaw","context_page_description":"Kinilaw is a raw seafood dish and preparation method native to the Philippines. It is also referred to as Philippine ceviche due to its similarity to the Latin American dish Ceviche. It is more accurately a cooking process that relies on vinegar and/or acidic fruit juices to denature the ingredients, rather than a dish, as it can also be used to prepare meat and vegetables.\\nkilawin is a meat-based preparation method quite similar but not the same as kinilaw. It is more common in the northern Philippines and use blanched and lightly grilled meat. Kinilaw dishes are usually eaten as appetizers before a meal, or as finger food with alcoholic drinks."},{"page_url":"https://sr.wikipedia.org/wiki/BMW_X3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/2018_BMW_X3_xDrive30d_M_Sport_Automatic_3.0_Front.jpg","page_title":"BMW X3","context_page_description":"BMW X3 је компактни луксузни кросовер који производи немачка фабрика аутомобила BMW од 2003. године."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B5%A4%E6%B1%A0%E9%A7%85_(%E6%84%9B%E7%9F%A5%E7%9C%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Turumai%26Meitetsu_Toyota_Line_Akaike_Station_02.JPG","page_title":"赤池駅 (愛知県)","context_page_description":"赤池駅は、愛知県日進市赤池1丁目にある、名古屋市営地下鉄・名古屋鉄道の駅。駅番号は名古屋市営地下鉄がT20、名鉄がTT07。\\n名古屋市営地下鉄の鶴舞線と、名鉄の豊田線が乗り入れる。名古屋市交通局と名鉄の共同使用駅で駅自体は名古屋市交通局が管轄しているため、当駅は名鉄の旅客案内上では無人駅という扱いになっている。\\n名古屋市営地下鉄唯一の名古屋市外にある駅である。\\n鶴舞線と豊田線を直通する列車は当駅で乗務員交代となる。"},{"page_url":"https://pl.wikipedia.org/wiki/Pojazd_wolnobie%C5%BCny","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Claas-lexion-570-1.jpg","page_title":"Pojazd wolnobieżny","context_page_description":"Pojazd wolnobieżny – według ustawy o ruchu drogowym w Polsce pojazd silnikowy, którego konstrukcja ogranicza prędkość jazdy do 25 km/h, z wyjątkiem ciągników rolniczych. Pojazdy wolnobieżne są wykorzystywane w rolnictwie, leśnictwie, budownictwie i transporcie bliskim. Do prowadzenia tego typu pojazdów wystarczy prawo jazdy kat. B, jednakże przy ciągnięciu przyczep o dmc przekraczającej 750 kg potrzebna jest jeszcze rozszerzenie uprawnień lub kat. T. Natomiast do obsługi tych maszyn, które są wyposażone w osprzęt roboczy potrzebne jest także zaświadczenie eksploatacyjne dla pojazdów rolniczych, zaświadczenie kwalifikacyjne dla pojazdów leśnych i wózków transportowych, oraz książeczka operatora dla pojazdów budowlanych. Urządzenia nie są pojazdami wolnobieżnymi, przez co nie muszą spełniać wymagań prawnych dla nich określonych."},{"page_url":"https://de.wikipedia.org/wiki/Deutschunterricht","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Auerbachs_Keller_%28cropped%29.JPG","page_title":"Deutschunterricht","context_page_description":"Der Deutschunterricht dient der Entwicklung der Lese-, Schreib-, Sprech- und Hörverstehenskompetenz in der deutschen Sprache. Auf höherem Niveau beabsichtigt er traditionell besonders die Entwicklung der Fähigkeit, deutschsprachige Literatur sowie ins Deutsche übersetzte Weltliteratur zu verstehen, sowie die Fähigkeit, selbständig zusammenhängende und argumentativ schlüssige Texte zu verfassen.\\n„Deutschunterricht vermittelt auf die deutsche Sprache, Literatur und andere Medien bezogene Kompetenzen an Bildungsinstitutionen, in denen Deutsch eine bzw. die Amts- oder zumindest Verkehrs- und übliche Unterrichtssprache ist.“ Allerdings wird unter der Bezeichnung „Deutschunterricht“ eine Vielzahl von Unterrichtsformen zusammengefasst, die sich hinsichtlich ihrer Lernziele und ihrer didaktischen Konzepte erheblich unterscheiden können. Was unter „Deutschunterricht“ jeweils verstanden wird, hängt unter anderem davon ab, an welche Zielgruppe sich der Unterricht richtet. Grundlegend für Ziele und Methoden ist traditionell die Unterscheidung von muttersprachlichem und fremdsprachlichem Deutschunterricht."},{"page_url":"https://de.wikipedia.org/wiki/Panossas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Panossas_-_Ch%C3%A2teau_d%27Antouillet.JPG","page_title":"Panossas","context_page_description":"Panossas ist eine französische Gemeinde mit 706 Einwohnern im Département Isère in der Region Auvergne-Rhône-Alpes. Panossas liegt im Arrondissement La Tour-du-Pin und im Kanton Charvieu-Chavagneux. Die Einwohner werden Panossiens genannt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%87%D0%B0%D1%80%D1%8F%D0%BD,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82_%D0%A1%D0%B5%D0%B4%D1%80%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Protest_against_Kocharyan_18.05.2019_2.jpg","page_title":"Кочарян, Роберт Седракович","context_page_description":"Робе́рт Седра́кович Кочаря́н — государственный и политический деятель Республики Армения и Нагорно-Карабахской республики. Второй президент Республики Армения с 30 марта 1998 года по 9 апреля 2008 года. Первый президент непризнанной Нагорно-Карабахской Республики."},{"page_url":"https://de.wikipedia.org/wiki/Bayerisches_Armeemuseum","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Turm_Triva_Ingolstadt.jpg","page_title":"Bayerisches Armeemuseum","context_page_description":"Das Bayerische Armeemuseum ist das militärhistorische Museum des Freistaats Bayern. Es wurde 1879 in München gegründet. Ein Teil des ehemaligen Münchner Museumsbaus bildet heute den Zentralbau der neuen Bayerischen Staatskanzlei. Das Museum befindet sich seit 1972 in Ingolstadt. Die Hauptsammlung ist im Neuen Schloss untergebracht, die 1994 eröffnete Dauerausstellung zum Ersten Weltkrieg im Reduit Tilly und das 2012 dem Armeemuseum eingegliederte Bayerische Polizeimuseum im Turm Triva. Unter der Leitung des Historikers Ansgar Reiß entwickelte sich die Einrichtung zu einem Lernort auf modernem museumspädagogischen Niveau."},{"page_url":"https://fr.wikipedia.org/wiki/Xavier_Wurth","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/B_20100429_100001.jpg","page_title":"Xavier Wurth","context_page_description":"Xavier Wurth, né à Liège en 1869 et décédé en 1933 dans la même ville, est un peintre belge de paysages, de marines et de portraits."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A2%D9%8A%D8%B3%D9%84%D9%86%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Hellnar_church.jpg","page_title":"آيسلندا","context_page_description":"جمهورية آيسلندا هي دولة جزرية أوروبية في شمال المحيط الأطلسي على الحافة وسط الأطلسي. يبلغ تعداد سكانها 320,000 نسمة ومساحتها الكلية 103,000 كم2. عاصمتها هي ريكيافيك وهي أكبر مدن البلاد، حيث أنها والمناطق الجنوبية الغربية موطن لأكثر من ثلثي سكان البلاد. آيسلندا بلد نشط بركانياً وجيولوجياً. يتألف بر البلاد من هضبة تتميز بحقول الرمال والجبال والأنهار الجليدية، بينما تصب العديد من الأنهار الجليدية في البحار عبر الأراضي المنخفضة. يقوم تيار الخليج بتلطيف مناخ آيسلندا مما يجعله معتدلاً ومناسباً للحياة رغم موقعها على حدود الدائرة القطبية الشمالية.\\nاستناداً إلى لانتاناومابوك كان الزعيم النرويجي انجولفر ارنارسون أول من استوطن آيسلندا بشكل دائم في 874م. قام آخرون بزيارة الجزيرة قبل ذلك وبقوا فيها طوال الشتاء. خلال القرون التالية استوطن الجزيرة مهاجرون من الشعوب الشمالية والغالية. كانت الجزيرة منذ عام 1262 وحتى عام 1918 جزءاً من الملكية النرويجية والدانمركية بعد ذلك. اعتمد شعب الجزيرة حتى القرن العشرين على الزراعة وصيد السمك بشكل كبير. في عام 1994 وقعت آيسلندا على اتفاقية التجارة الحرة الأوروبية وبالتالي دخل التنوع في الاقتصاد من صيد الأسماك حتى الخدمات الاقتصادية والمالية. وفقاً لتقرير حرية الصحافة تمتلك آيسلندا أكثر صحافة حرة في العالم."},{"page_url":"https://nl.wikipedia.org/wiki/Dow_Jones_Industrial_Average","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/DJIA_historical_graph_to_jul11_%28log%29.svg","page_title":"Dow Jones Industrial Average","context_page_description":"De Dow Jones Industrial Average is de oudste aandelenindex van de Verenigde Staten. Deze index is gecreëerd door de redacteuren van de Wall Street Journal en de oprichter van Dow Jones & Company, Charles Dow. De index staat ook bekend als de Dow Jones, de Dow 30 of simpelweg de Dow. De afkorting DJIA wordt daarnaast regelmatig gebruikt."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Caradec","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Croix_%C3%A0_Saint-Caradec_%28rue_de_Kercado%29_01.JPG","page_title":"Saint-Caradec","context_page_description":"Saint-Caradec es una población y comuna francesa, situada en la región de Bretaña, departamento de Côtes-d'Armor, en el distrito de Saint-Brieuc y cantón de Loudéac."},{"page_url":"https://fr.wikipedia.org/wiki/Yaakov_Rosner","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/%D7%90%D7%A4%D7%99%D7%A7%D7%99%D7%9D_-_%D7%A2%D7%92%D7%91%D7%A0%D7%99%D7%95%D7%AA%2C_%D7%AA%D7%95%D7%A6%D7%A8%D7%AA_%D7%90%D7%A4%D7%99%D7%A7%D7%99%D7%9D-JNF021236.jpeg","page_title":"Yaakov Rosner","context_page_description":"Yaakov Rosner, ou Jakob Rosner, יעקב רוזנר, ou encore Jack Rosner, né en 1902 à Munich et mort le 26 août 1950 à Tel-Aviv, est un photographe israélien."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%AC%AC65%E5%B1%8A%E5%A5%A5%E6%96%AF%E5%8D%A1%E9%87%91%E5%83%8F%E5%A5%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Al_Pacino.jpg","page_title":"第65届奥斯卡金像奖","context_page_description":"第65屆奧斯卡頒獎典禮是美國電影藝術與科學學院旨在獎勵1992年最優秀電影的一場晚會，於太平洋時區1993年3月29日下午18點在洛杉磯的多蘿茜·錢德勒大廳舉行，共計頒發了23個類別的奧斯卡金像獎。晚會透過美國廣播公司在美國直播，由吉爾·凱茨擔任製作人，路易斯·J·霍維茨執導。男演員比利·克里斯托連續第4年擔任主持。兩個多星期前的3月6日，女演員莎朗·史東在洛杉磯的世紀廣場酒店主持頒發奧斯卡科技成果獎。\\n克林·伊斯威特執導的《殺無赦》獲得包括最佳影片、導演在內的4項大獎，是這個夜晚的最大贏家，還為金·哈克曼贏得男配角獎。艾爾·帕西諾和艾瑪·湯普遜分別因《女人香》和《此情可問天》獲男、女主角獎。瑪麗莎·托梅憑《智勇急轉彎》拿下女配角獎。晚會的電視直播平均吸引了約4,570萬美國觀眾收看。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BB%CE%B5%CE%BE%CE%AC%CE%BD%CE%B4%CF%81%CE%B5%CE%B9%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Book_of_Wonders_folio_36a_cropped.jpg","page_title":"Αλεξάνδρεια","context_page_description":"Η Αλεξάνδρεια είναι η 2η μεγαλύτερη πόλη και το κυριότερο λιμάνι της Αιγύπτου. Βρίσκεται στα δυτικά του δέλτα του Νείλου, χτισμένη σε έναν μακρόστενο ισθμό μεταξύ της Μαρεώτιδος λίμνης και της Μεσογείου Θάλασσας. Ανήκει διοικητικά στο Κυβερνείο της Αλεξάνδρειας. Ιδρύθηκε το 331 π.Χ. από τον Αλέξανδρο τον Μέγα και είναι η δεύτερη πρωτεύουσα της σύγχρονης Αιγύπτου μετά το Κάιρο. Κατά την αρχαιότητα υπήρξε το σπουδαιότερο λιμάνι και πρωτεύουσα της χώρας, ενώ στην ακμή της αποτελούσε το μεγαλύτερο οικονομικό κέντρο ολόκληρης της Βόρειας Αφρικής και μία από τις επιφανέστερες εστίες πολιτισμού του κόσμου, διάσημη για τη βιβλιοθήκη και τον Φάρο της, ένα από τα επτά θαύματα του κόσμου, κτισμένο στο ομώνυμο νησί.\\nΗ σύγχρονη Αλεξάνδρεια έχει εξελιχτεί σε μεγάλο θαλάσσιο εμπορευματικό κόμβο και εξυπηρετεί περί το 80% των αιγυπτιακών εισαγωγών και εξαγωγών. Είναι επίσης φημισμένος τουριστικός προορισμός και σημαντικό βιομηχανικό κέντρο λόγω των αγωγών πετρελαίου και φυσικού αερίου που ξεκινούν από το Σουέζ. Ο πληθυσμός της είναι 4.812.186 και καταλαμβάνει έκταση 300 τετραγωνικών χιλιομέτρων."},{"page_url":"https://es.wikipedia.org/wiki/WALL%C2%B7E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Bshose.jpg","page_title":"WALL·E","context_page_description":"WALL•E o WALL-E es una película de animación realizada casi íntegramente por computadora, perteneciente a los géneros de ciencia ficción y comedia, estrenada en 2008, dirigida por Andrew Stanton, y producida por Walt Disney Pictures y Pixar Animation Studios. La trama sigue a un robot de la línea WALL•E, diseñada para limpiar la basura que cubre a la Tierra después de que fuese devastada y abandonada por el ser humano en un futuro lejano. Tras esto, se enamora de EVA, una robot tipo sonda y combate, que es enviada al planeta para investigar si existen indicios de vida, lo cual significaría que el lugar puede ser nuevamente habitado por la humanidad. Una vez que consigue su objetivo y encuentra una planta, EVA se dirige rápidamente a la nave de la que provino, Axiom, por lo que WALL•E la sigue al espacio exterior en una aventura que cambia el destino de ambos para salvar a la naturaleza y a la humanidad.\\nStanton había trabajado anteriormente con Pixar al dirigir Buscando a Nemo, que le valió el Óscar como mejor película de animación."},{"page_url":"https://bs.wikipedia.org/wiki/Magnus_Carlsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Carlsen_Magnus.jpg","page_title":"Magnus Carlsen","context_page_description":"Sven Magnus Øen Carlsen norveški je šahovski velemajstor. 22. novembra 2013. pobjedom protiv Viswanathana Ananda na Svjetskom prvenstvu u šahu 2013. postao je 17. klasični, a ukupno 21. svjetski prvak. Godinu kasnije odbranio je titulu protiv istog igrača. Trenutno je s rejtingom 2850 broj 1 na FIDE-inoj rang-listi. U januaru 2012. postao je 7. broj 1 u historiji FIDE-ine rang-liste. Njegov najveći rejting iz maja 2014. iznosio je 2882, što je najveći rejting svih vremena. Prvi je šahovski velemajstor koji osim prihoda sa šahovskih turnira zarađuje i kao model, reklamirajući poznate modne marke. Od oko milion eura, koje je zaradio 2012, 70% su mu prihodi od modnih i drugih sponzora.\\nCarlsen je stekao titulu velemajstora 26. aprila 2004. kada je imao 13 godina i 148 dana, pa je po tome treći najmlađi velemajstor u historiji. Na rang-listi za januar 2010. dospio je na prvo mjesto sa 19 godina i 32 dana, čime je postao najmlađi igrač u historiji šaha kome je to uspjelo, oborivši rekord Vladimira Kramnika. Također je osvojio i Svjetsko prvenstvo u brzopoteznom šahu 2009."},{"page_url":"https://sv.wikipedia.org/wiki/Robert_Aitken_(bokf%C3%B6rl%C3%A4ggare)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Robert_Aitken_%281734%E2%80%931802%29_%28cropped%29.jpg","page_title":"Robert Aitken (bokförläggare)","context_page_description":"Robert Aitken född 1734 i Dalkeith, Skottland, död 1802 i Philadelphia, Pennsylvania, USA. Amerikansk bokförläggare som var den förste som publicerade Bibeln på engelska 1782 i det då nybildade USA."},{"page_url":"https://sv.wikipedia.org/wiki/Centerpartiet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Riksdagsvalet_2018_%28Centerpartiet%29.svg","page_title":"Centerpartiet","context_page_description":"Centerpartiet, även kallat Centern, är ett svenskt socialliberalt och grönt politiskt parti. På partiets valsedlar anges partibeteckningen Centerpartiet. Partiledare är sedan 2011 Annie Lööf.\\nCenterpartiet antog sitt nuvarande namn 1957 som ersatte det tidigare Bondeförbundet som använts från 1913. På 1970-talet var Centerpartiet det ledande borgerliga partiet. Partiet ingick på 1950-talet i några socialdemokratiska koalitionsregeringar och stödde även 1995–1998 en socialdemokratisk regering. Sedan 2004 ingår Centerpartiet tillsammans med Moderaterna, Kristdemokraterna och Liberalerna i den borgerliga Alliansen som efter valet 2006 styrde Sverige 2006–2014.\\nPartiet var ursprungligen landsbygdsinriktat och förespråkade sparsamhet med statens pengar. I takt med folkhemmets uppbyggnad, med urbanisering och landsbygdens avfolkning som följd, blev decentralisering partiets främsta ledord. Samtidigt fick liberala strömningar större genomslag i partiet och individen betonades. Sedan 2013 definierar partiet sin liberala ideologi som \\"social, decentralistisk och grön\\". Viktiga utgångspunkter för Centerpartiet är federalism, öppet samhälle med individen i fokus."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%9Ajvil%C3%A1gi_posz%C3%A1taf%C3%A9l%C3%A9k","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Vermivora_celata2.jpg","page_title":"Újvilági poszátafélék","context_page_description":"Az újvilági poszátafélék a madarak osztályának verébalakúak rendjébe tartozó család. 32 nem és 131 faj tartozik a családba."},{"page_url":"https://ceb.wikipedia.org/wiki/Areas_galactina","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Areas_galactina_-_Doi_Su_thep%2C_Chiang_Mai_%285922869871%29.jpg","page_title":"Areas galactina","context_page_description":"Espesye sa alibangbang ang Areas galactina. Una ning gihulagway ni Hoev. ni adtong 1840. Ang Areas galactina sakop sa kahenera nga Areas sa kabanay nga Arctiidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://lt.wikipedia.org/wiki/Andrius_Katinas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Andrius_Katinas.JPG","page_title":"Andrius Katinas","context_page_description":"Andrius Katinas – lietuvių šokėjas, choreografas, šiuolaikinio šokio kūrėjas, gyvenantis ir dirbantis Helsinkyje, apdovanojimo „Philip Morris Lietuva eskizas“ laureatas."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B0%D0%B6%D0%BD%D0%BE_%D1%98%D0%B5_%D0%B7%D0%B2%D0%B0%D1%82%D0%B8_%D1%81%D0%B5_%D0%95%D1%80%D0%BD%D0%B5%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Oscar_Wilde_%281854-1900%29_1889%2C_May_23._Picture_by_W._and_D._Downey.jpg","page_title":"Важно је звати се Ернест","context_page_description":"Важно је звати се Ернест, тривијална комедија за озбиљне људе је драма Оскара Вајлда. Премијерно је изведена 14. фебруара 1895. године у Позоришту Сент Џејмс у Лондону. То је фарса у којој протагонисти баве измишљеним личностима како би избегли тешке друштвене обавезе. Радећи у оквиру друштвених конвенција касног викторијанског Лондона, главне теме драме су тривијалност с којом третирају озбиљне институције као што је брак, и сатира викторијанског морала. Неки савремени критичари хвале хумор драме као врхунац Вајлдове уметничке каријере, док су други опрезни због недостатка друштвене поруке. Фарса и духовит дијалог помогли су да Важно је звати се Ернест постане једна од најпопуларнијих драма.\\nУспешна премијера била је врхунац Вајлдове каријере, али је и најавила његов пад. Маркиз од Квинсберија, чији је син лорд Алфред Даглас био Вајлдов љубавник, планирао је да баци на писца букет трулог поврћа и да прекине представу. Вајлд је за сазнао па је Квинсберију одбијен пријем. Њихова свађа дошла је до врхунца на суду, где је Вајлдова хомосексуалност откривена викторијанској јавности и он је осуђен на затворску казну."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Gauting","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/St._Michael_%28Buchendorf%29.jpg","page_title":"Liste der Baudenkmäler in Gauting","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Gemeinde Gauting zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://da.wikipedia.org/wiki/Kino_Den_Bl%C3%A5_Engel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Kino_Den_Bl%C3%A5_Engel.jpg","page_title":"Kino Den Blå Engel","context_page_description":"Kino Den Blå Engel er en biograf i Kalundborg på Vestsjælland. Den blev grundlagt i 1958 under navnet Ny Kino."},{"page_url":"https://eu.wikipedia.org/wiki/Ruten_Liburua","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/1795-William-Blake-Naomi-entreating-Ruth-Orpah.jpg","page_title":"Ruten Liburua","context_page_description":"Ruten liburua Bibliako Itun Zaharreko liburuetako bat da, zaharrenetakoa. Grekozko eta latinezko itzulpenek Epaileen liburuaren ondoren dakarte, liburuaren hasiera-hasieran daukan aipamenagatik. Liburuko pertsonaietako baten izena darama: Rut emakume atzerritarra."},{"page_url":"https://hu.wikipedia.org/wiki/Van_Gogh_szob%C3%A1ja_Arles-ban_(Van_Gogh_festm%C3%A9nyei)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Vincent_Willem_van_Gogh_135.jpg","page_title":"Van Gogh szobája Arles-ban (Van Gogh festményei)","context_page_description":"A Van Gogh szobája Arles-ban a művész három, csaknem egyforma festményének magyar elnevezése. A művész maga egyszerűen csak Hálószoba néven említette őket. A három autentikus változat könnyen megkülönböztethető egymástól a falon látható képek alapján.\\nA képek Van Gogh szobáját ábrázolják az Arles-ban, a Lamartine tér 2. szám alatt volt egy fogadóban, ami – szintén Van Gogh képei alapján – a Sárga ház néven vált híressé.\\nAz épület maga a II. világháború során egy légitámadás alatt megsérült és később lebontották. A kutatók azonban megtalálták eredeti alaprajzait, és ez eldöntötte a vitát, hogy a szoba ábrázolása a festményen a művész sajátos látásmódja, esetleg betegsége miatt szabálytalan-e, vagy pedig ilyen volt a valóságban is. Az utóbbi a helyzet, a szoba szabálytalan, trapéz alakú volt, ez nem a művészi fantázia terméke. A szemben lévő fal az ablakkal a bal oldali fallal tompaszöget, a jobb oldalival hegyesszöget zárt be. A jobb oldali ajtó a lépcsőházba nyílt, a bal oldali egy vendégszobába, amit Van Gogh barátja, Gauguin számára tartott fenn.\\nVan Gogh a festményen 1888 októberében kezdett el dolgozni."},{"page_url":"https://nl.wikipedia.org/wiki/Bartholome%C3%BCskerk_(Noordlaren)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Romaans_venster_zuidzijde_schip_-_Noordlaren_-_20169123_-_RCE.jpg","page_title":"Bartholomeüskerk (Noordlaren)","context_page_description":"De Bartholomeüskerk aan de Lageweg 8 in Noordlaren is een kerk die oorspronkelijk gewijd was aan de heilige apostel Bartholomeüs.\\nDe oudste stichting van de kerk wordt gedateerd in de 12e eeuw, toen er een houten kerk verrees. In de loop van de 13e eeuw werd het huidige stenen kerkgebouw in verschillende fasen gebouwd. In de 15e eeuw kreeg de kerk in grote lijnen haar huidige aanzicht. De kerk werd gerestaureerd in de jaren 1970, waarbij veel oorspronkelijke elementen weer in het zicht werden gebracht. De kerk is onder andere bekend om haar bijzondere schilderingen en om haar 16e-eeuwse offerbus.\\nDe kerk is in gebruik bij de protestantse gemeente Noordlaren-Glimmen. Wanneer er gekerkt wordt is de kerk zondagsmiddags geopend voor bezichtiging. De kerk wordt verder gebruikt voor rouw- en trouwdiensten en soms vinden er concerten plaats."},{"page_url":"https://ms.wikipedia.org/wiki/Toyota_Vitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/2012_Toyota_Yaris_LE_--_11-23-2011.jpg","page_title":"Toyota Vitz","context_page_description":"Toyota Yaris atau Toyota Vitz adalah kereta hatchback kecil yang dihasilkan ole Toyota Motor Corporation. Yaris lahir pertama kali pada tahun 1999 di Eropah dengan reka bentuk, prestasi enjin, dan jaminan keselamatan serta penggunaan bahan bakar yang optimum, untuk memasuki pasaran Eropah. Satu tahun selepas awal pelancarannya, tepatnya pada tahun 2000 Yaris memperoleh anugerah European Car of The Year Award. Bukan hanya itu saja Yaris juga diiktiraf sebagai standard model kenderaan Compact two box di Jepun dan Amerika Utara. Untuk pasaran Asia, Yaris dipasang di Thailand, sedangkan untuk pasaran Eropah, Yaris dibuat di Perancis."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%83%9C%E6%98%94%E6%A1%A5%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/201908_Station_Building_of_Shengxiqiao_%282%29.jpg","page_title":"胜昔桥站","context_page_description":"胜昔桥站位于湖南省娄底市娄星区大埠桥街道，是沪昆铁路上的火车站。车站由广州局集团娄底车务段管辖，目前仅办理专用铁路整车货物发到，是娄星区的煤炭发送基地。"},{"page_url":"https://en.wikipedia.org/wiki/Mary_Wiseman_(actress)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Mary_Wiseman_SDCC_2017.jpg","page_title":"Mary Wiseman (actress)","context_page_description":"Mary Wiseman is an American actress who is known for playing Ensign Sylvia Tilly in Star Trek: Discovery."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%88%D1%83%D0%B3%D0%BE%D0%B7%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0_%D0%A4%D0%B8%D0%BD%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Turku_Cathedral_profile.jpg","page_title":"Југозападна Финска","context_page_description":"Југозападна Финска е регион во југозападниот дел на Финска. Се граничи со регионите Сатакунта, Канта-Хаме и Уусимаа. Главeн и најнаселен град во регионот е Турку.\\nОбласта во која денес се наоѓа југозападниот дел на Финска, е во голема мера иста како и историската провинција Финска, која го носи ова име, бидејќи е оригинален дом на племето познато како Финци."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AB%E3%83%8E%E3%83%BC%E3%83%BBR.S.18","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Niko_Hulkenberg-Test_Days_2018_Circuit_Barcelona_%281%29.jpg","page_title":"ルノー・R.S.18","context_page_description":"ルノー・R.S.18 は、ルノーが2018年のF1世界選手権参戦用に開発したフォーミュラ1カーである。"},{"page_url":"https://pt.wikipedia.org/wiki/Palaemonoidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Gnathophyllum_americanum_R%C3%A9union.JPG","page_title":"Palaemonoidea","context_page_description":"Palaemonoidea é uma grande e diversa superfamília de camarões que contém cerca de 1000 espécies validamente descritas. A posição da família Typhlocarididae não é clara, mas a monofilia do grupo que contém as restantes famílias está bem suportado."},{"page_url":"https://fi.wikipedia.org/wiki/V%C3%A4in%C3%B6_Valve","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Puolustusministerin_lippu.png","page_title":"Väinö Valve","context_page_description":"Väinö Lahja Rikhard Valve oli suomalainen jääkärikenraali ja viimeinen elossa ollut jääkäri. Hän sai jääkärikoulutuksen Saksassa jääkäripataljoona 27:ssä ja osallistui Suomen sisällissotaan valkoisten puolella muun muassa Tampereen ja Viipurin taisteluissa. Hän toimi rannikkopuolustuksen ja merivoimien komentajana 1920-luvulta jatkosodan jälkeiseen aikaan saakka. Valve toimi puolustusministerinä 1. joulukuuta 1944 – 17. huhtikuuta 1945 ja oli perustamassa Sotainvalidien Veljesliittoa toimien sen puheenjohtajana 1943–56."},{"page_url":"https://es.wikipedia.org/wiki/Ruta_Estatal_de_California_60","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Pomona_Freeway.jpg","page_title":"Ruta Estatal de California 60","context_page_description":"La Ruta Estatal 60 es una carretera estatal en el estado de California. Empieza desde la Interestatal 10 cerca del río Los Ángeles en Los Ángeles al este hacia la I-10 en el condado de Riverside, con entrelazamientos en la Ruta Estatal 57 y la Interestatal 215.​\\nEsta ruta forma parte del Sistema de Autovías y Vías Expresas de California.​"},{"page_url":"https://en.wikipedia.org/wiki/Lingnan_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Minister_Hall_in_Canton.JPG","page_title":"Lingnan architecture","context_page_description":"Lingnan architecture, or Cantonese architecture, refers to the characteristic architectural style of the Lingnan region – the Southern Chinese provinces of Guangdong and Guangxi. Usually, it is referring to the architecture associated with the Cantonese people, with other peoples in the area having their own styles. This style began with the architecture of the ancient non-Han Nanyue people and absorbed certain architectural elements from the Tang Empire and Song Empire as the region sinicized in the later half of the first millennium AD."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Rotherbaum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Stolperstein_Mollerstra%C3%9Fe_16_%28Andreas_Bruck%29_in_Hamburg-Rotherbaum.JPG","page_title":"Liste der Stolpersteine in Hamburg-Rotherbaum","context_page_description":"Die Liste der Stolpersteine in Hamburg-Rotherbaum enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Rotherbaum verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die in Hamburg-Rotherbaum lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5897 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://ca.wikipedia.org/wiki/Menucourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Mairie_menucourt.jpg","page_title":"Menucourt","context_page_description":"Menucourt és un municipi francès, situat al departament de Val-d'Oise i a la regió d'Illa de França. L'any 2007 tenia 5.167 habitants.\\nForma part del cantó de Vauréal, del districte de Pontoise i de la Comunitat d’aglomeració de Cergy-Pontoise."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%AB%E3%83%81%E3%82%A8%E3%83%BB%E3%83%A9%E3%82%BF%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Pantheon-Assas_University_-_Panth%C3%A9on.jpg","page_title":"カルチエ・ラタン","context_page_description":"カルチエ・ラタンは、パリの地名である。カルチェラタンとも表記する。\\nセーヌ川左岸、5区と6区にまたがる区域で、カルチエは「地区」、ラタンとは「ラテン語」のことであり、「ラテン語地区」を意味する。これはフランス語が未統一であった時代、ヨーロッパ各地から集まった学生たちが当時の学問や教会における国際共通語であったラテン語で会話したことに由来する。\\nパリ大学をはじめ、名門高等教育機関が集中しており、昔から学生街として有名である。1960年代、特に五月革命のときに、様々な反体制学生運動の中心地であった。\\nパンテオン、サン・ミシェル広場、サンジェルマン大通りなどの観光名所も多く、リュクサンブール庭園もほど近い。"},{"page_url":"https://en.wikipedia.org/wiki/48th_Fighter_Wing","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/F-100f-56-3990-48tfw.jpg","page_title":"48th Fighter Wing","context_page_description":"The 48th Fighter Wing is part of the United States Air Force's Third Air Force, assigned to Headquarters Air Command Europe and United States Air Forces in Europe. It is based at RAF Lakenheath, England. The 48 FW is the only F-15 wing based in Europe and consists of both F-15C/D Eagle and F-15E Strike Eagle aircraft. The 48 FW was given the name \\"Statue of Liberty Wing\\" on 4 July 1954 and remains the only U.S. Air Force unit with both a name and a numerical designation.\\nThe 48 FW operates in support of United States Air Forces in Europe – Air Forces Africa, United States European Command and NATO."},{"page_url":"https://pt.wikipedia.org/wiki/Paul_Cornell","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Paul_cornell.jpg","page_title":"Paul Cornell","context_page_description":"Paul Cornell é um escritor britânico."},{"page_url":"https://oc.wikipedia.org/wiki/Oakland_(Calif%C3%B2rnia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/OAKLAND%2C_CA%2C_USA_-_Skyline_and_Bridge.JPG","page_title":"Oakland (Califòrnia)","context_page_description":"Oakland es una granda ciutat de l'estat american de Califòrnia qu'es lo sèti de la comtat d'Alameda. Sa populacion èra estimada a 425 195 abitants en 2017. Sa superfícia totala es 202,4km²."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%80%D0%B0%D1%82%D0%BD%D1%8B%D0%B9_%D0%B0%D0%B3%D0%BE%D0%BD%D0%B8%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Antagonist_2.png","page_title":"Обратный агонист","context_page_description":"Обратный агонист — это химическое соединение, которое связывается с тем же самым клеточным рецептором, что и агонист, однако производит физиологические эффекты, в целом противоположные физиологическим эффектам агониста.\\nНеобходимым предварительным условием для возможности существования обратного агониста является то, что рецептор должен иметь некий ненулевой базальный уровень конституциональной внутренней активности в отсутствие связывания с ним лигандов. В таком случае агонист повышает активность рецепторной системы выше базального уровня. А обратный агонист делает противоположную вещь — понижает активность рецепторной системы ниже базального уровня, стабилизируя рецептор в «неактивном» состоянии и делая переход рецептора в активированное состояние менее энергетически выгодным и менее вероятным. А нейтральный антагонист сам по себе не оказывает влияния на активность рецептора в отсутствие агонистов или обратных агонистов, однако блокирует воздействие на рецептор как агонистов, так и обратных агонистов."},{"page_url":"https://sv.wikipedia.org/wiki/Karl%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Karl%C3%ADk%2C_cesta_v_obci.JPG","page_title":"Karlík","context_page_description":"Karlík är en ort i Tjeckien. Den ligger i länet Mellersta Böhmen, i den centrala delen av landet, 20 km sydväst om huvudstaden Prag. Karlík ligger 214 meter över havet och antalet invånare är 329.\\nTerrängen runt Karlík är kuperad söderut, men norrut är den platt. Karlík ligger nere i en dal. Den högsta punkten i närheten är 387 meter över havet, 1,0 km nordväst om Karlík. Runt Karlík är det ganska tätbefolkat, med 52 invånare per kvadratkilometer. Närmaste större samhälle är Modřany, 13,6 km nordost om Karlík. Trakten runt Karlík består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är juli, då medeltemperaturen är 20 °C, och den kallaste är januari, med -6 °C. Genomsnittlig årsnederbörd är 941 millimeter. Den regnigaste månaden är juni, med i genomsnitt 126 mm nederbörd, och den torraste är mars, med 36 mm nederbörd."},{"page_url":"https://ro.wikipedia.org/wiki/Migren%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Butterbur.jpg","page_title":"Migrenă","context_page_description":"Migrena este o afecțiune cronică ce se caracterizează prin cefalee recurentă, de intensitate moderată spre severă, adesea asociată cu o serie de simptome ale sistemului nervos autonom. Termenul provine din greacă de la ἡμικρανία, „durere într-o parte a capului”, de la ἡμι-, „jumătate” și κρανίον, „craniu”.\\nÎn mod tipic, migrenele sunt unilaterale și au un caracter pulsatil, cu o durată cuprinsă între 2 și 72 de ore. Simptomele asociate pot include greață, vărsături, fotofobie, fonofobie, durerea fiind în general agravată de activitățile fizice. Până la o treime din pacienți percep o aură: o tulburare trecătoare de natură vizuală, senzitivă, lingvistică sau motorie, care semnalează că în curând se va instala cefaleea.\\nSe consideră că migrenele sunt determinate de un amestec de factori genetici și de mediu. Aproximativ două treimi din cazuri sunt determinate de predispoziții ereditare. Fluctuațiile hormonale pot avea, de asemenea, un rol: migrena afectează un număr ușor mai ridicat de băieți decât de fete înainte de pubertate, însă în cazul adulților este de două-trei ori mai frecventă la femei decât la bărbați. De obicei, tendința de apariție a migrenelor scade în timpul sarcinii."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%BD%D0%B0_(%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA_%D0%9C%D0%BE%D0%BA%D1%88%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%D0%A6%D0%BD%D0%B0.jpg","page_title":"Цна (приток Мокши)","context_page_description":"Цна — река в Тамбовской и Рязанской областях России, левый приток Мокши. Длина реки — 451 км, площадь водосборного бассейна — 21 500 км². Образуется слиянием рек Белый Плёс и Мокрая Вершина. Высота устья — 86 м над уровнем моря.\\nНа реке стоят города Котовск, Тамбов, Моршанск, Сасово."},{"page_url":"https://pt.wikipedia.org/wiki/Surubim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Bras%C3%A3o_de_Surubim.png","page_title":"Surubim","context_page_description":"Surubim é um município brasileiro do estado de Pernambuco, conhecido como a Capital da Vaquejada. Administrativamente, o município é formado pelos distritos sede e Chéus. Sua população, de acordo com estimativas do Instituto Brasileiro de Geografia e Estatística em 2018, era de 64 520 habitantes."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89cole_de_la_Salp%C3%AAtri%C3%A8re_(hypnose)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/%C3%89cole_de_la_Salp%C3%AAtri%C3%A8re.JPG","page_title":"École de la Salpêtrière (hypnose)","context_page_description":"L'École de la Salpêtrière, aussi appelée École de Paris, est, avec l'École de Nancy, l'une des deux grandes écoles ayant participé à l'« âge d'or » de l'hypnose en France de 1882 à 1892. Elle est basée à l'hôpital de la Salpêtrière. Le chef de file de cette école, le neurologue Jean Martin Charcot, contribue à réhabiliter l'hypnose comme sujet d'étude scientifique en la présentant comme un fait somatique propre à l'hystérie. Charcot utilise également l'hypnose comme méthode d'investigation, pensant mettre ses patientes hystériques dans un « état expérimental » permettant de reproduire et d'interpréter leurs symptômes.\\nLes travaux de la Salpêtrière introduisent également une nouvelle vision des phénomènes hystériques. Charcot ne considère plus les malades hystériques comme des simulatrices et découvre, à la surprise générale, que l'hystérie n'est pas le privilège des femmes. Enfin, Charcot rattache l'hystérie aux phénomènes de paralysies post-traumatiques, établissant les bases d'une théorie du traumatisme psychique."},{"page_url":"https://de.wikipedia.org/wiki/Flughafen_La_Rochelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/La_rochelle_airport.JPG","page_title":"Flughafen La Rochelle","context_page_description":"Der Flughafen La Rochelle ist ein Flughafen in Westfrankreich an der Atlantikküste zweieinhalb Kilometer nordwestlich von La Rochelle im Département Charente-Maritime. Er besitzt eine 2255 m lange Asphaltlandebahn und wird von der Industrie- und Handelskammer La Rochelle betrieben. Im Jahr 2016 wurden 219.848 Passagiere abgefertigt."},{"page_url":"https://de.wikipedia.org/wiki/Konstantin_Jegorowitsch_Makowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%9C%D0%B0%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9.jpg","page_title":"Konstantin Jegorowitsch Makowski","context_page_description":"Konstantin Jegorowitsch Makowski war ein russischer Maler und Mitglied der Gruppe der Wanderaussteller. Sein Bruder war der Maler Wladimir Makowski."},{"page_url":"https://nds.wikipedia.org/wiki/Paul_C%C3%A9sar_Helleu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Sargent_-_Paul_Helleu_Sketching_with_his_Wife.jpg","page_title":"Paul César Helleu","context_page_description":"Paul César Helleu weer en franzöössch Maler, Radeerer un Illustrator vun den Realismus. He weer bekannt för sien Porträtbiller vun de berühmten un muisten Fruen in de Belle Époque."},{"page_url":"https://hu.wikipedia.org/wiki/Gyulafeh%C3%A9rv%C3%A1ri_f%C5%91egyh%C3%A1zmegye","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Gyulafeh%C3%A9rv%C3%A1r%2C_R%C3%B3mai-Kat%C3%B3likus_P%C3%BCsp%C3%B6ki_palota_-_panoramio.jpg","page_title":"Gyulafehérvári főegyházmegye","context_page_description":"A Gyulafehérvári főegyházmegye a történelmi Erdély területét magába foglaló római katolikus részegyház Romániában. 1932-ig az Erdélyi püspökség nevet viselte. Érseki székhelye Gyulafehérváron van; székesegyháza a gyulafehérvári érseki székesegyház. Védőszentje Szent László király.\\nA Szent István király által alapított püspökségek egyike, 1009 óta létezik. A középkorban dinamikusan fejlődött;\\nelső székesegyházát Szent László idejében emelték. A reformáció után, az Erdélyi Fejedelemség alatt birtokait államosították, püspöki széke 160 évig betöltetlen volt, egy időben a katolikus papokat is kitiltották Erdélyből. Fordulatot a Habsburg uralom hozott, különösen Mária Terézia támogatta a katolikusokat. A trianoni békeszerződés után Romániához került, ahol megtűrt státusba került; a második világháború után pedig a katolikusok rendszeres üldözéseknek voltak kitéve. Ebben az időszakban szolgált Márton Áron püspök. 1991-ben emelték főegyházmegyei rangra. Érseke 2020. február 22-étől kezdve Kovács Gergely."},{"page_url":"https://de.wikipedia.org/wiki/Kazimierz_Ma%C5%82achowski","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Kazimierz_Ma%C5%82achowski.PNG","page_title":"Kazimierz Małachowski","context_page_description":"Kazimierz Małachowski war ein polnischer General."},{"page_url":"https://eo.wikipedia.org/wiki/Ereaj_montoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Monti-Erei-map-bjs.jpg","page_title":"Ereaj montoj","context_page_description":"La Ereaj montoj estas montara sistemo situanta en la centro de la insulo Sicilio, precipe en la centra kaj norda parto de la provinco Enna. La plej alta pinto estas la Monto Altesina, kun 1.192 super la marnivelo.\\nLa Ereaj montoj havas kalkoŝtonan originon kaj ne atingas grandajn altecojn. En la pasinteco, tie troviĝis la plej grava produktado de sulfuro en la tuta mondo, kiel hodiaŭ atestas la multnombraj min-parkoj, kiu plej granda estas Floristella-Grottacalda.\\nEkzistas pluraj lagoj en la montara sistemo, kiel la lago Pergusa, kies bunta kaj diversa birdaro igis ĝin unua naturrezervejo en Sicilio, kaj la lago Pozzillo, la akvorezervejo plej granda de la insulo.\\nPro la abrupta pejzaĝo, apenaŭ estas grandaj loĝlokoj. La montara sistemo estas la hejmo de la plej granda itala urbo situanta super 900 m je alteco kaj la plej granda provinca ĉefurbo en Eŭropo, Enno, kiu gastigas ĉirkaŭ sesonon el la tuta loĝantaro de Ereaj montoj."},{"page_url":"https://nl.wikipedia.org/wiki/Champlin_(Ardennes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Champlin_%28Ardennes%29_%C3%A9glise%2C_int%C3%A9rieur.JPG","page_title":"Champlin (Ardennes)","context_page_description":"Champlin is een gemeente in het Franse departement Ardennes en telt 77 inwoners. De plaats maakt deel uit van het arrondissement Charleville-Mézières."},{"page_url":"https://no.wikipedia.org/wiki/Joe_E._Brown","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Joe_E_Brown_in_Bright_Lights_trailer.jpg","page_title":"Joe E. Brown","context_page_description":"Joseph Evans Brown var en amerikansk skuespiller og komiker.\\nBrown reiste over store deler av USA sammen med en sirkustropp før han begynte med teater og han hadde blant annet flere opptredener på Broadway. På denne tiden arbeidet han også som komiker. Men dette yrket la han etter hvert på hylla da han fikk flere filmroller. Han fikk tidlig en kontrakt med filmstudioet Warner Bros. og spilte inn flere filmer hos dette studioet. I 1937 forlot han Warner Bros. for å arbeide for David Loew. I 1938 spilte han i filmen Født gladiator, en løs filmatisering av Philip Gordon Wylies roman, Gladiator, som påvirket etableringen av Supermann. Han gradvis over til å lage B-filmer.\\nI 1942 ble Browns sønn, kaptein Don E. Brown, drept da hans militære fly styrtet i nærheten av Palm Springs i California. Under den andre verdenskrig, brukte Brown mye av sin tid på å underholde de amerikanske troppene. Brown ble belønnet med en æres-Tony i 1948 for å ha turnert i USA med teaterstykket Harvey. Hans mest kjente filmrolle i etterkrigstiden var i komedien Noen har det hett. Brown var også å se i flere musikaler og var en idrettsentusiast, både i flere av filmene og på personlig basis."},{"page_url":"https://sh.wikipedia.org/wiki/Selica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Grus_grus_flocks.jpg","page_title":"Selica","context_page_description":"Selicama se nazivaju životinje općenito, koje pojedina godišnja doba provode u različitim područjima. No, kako je ova pojava najpoznatija kod ptica, najčešće se pod ovim nazivom misli upravo na njih, nazivajući ih pticama selicama.\\nProcjenjuje se, da se godišnje seli oko 50 milijardi ptica, od toga oko 5 milijardi između Europe i Afrike.\\nMnoge ptice selice koje u područjima Srednje Europe provode ljeto, zimi odlaze u topliju Južnu Europu ili Sjevernu Afriku. Takve vrste nazivaju se selicama na kraće udaljenosti. Druge odlaze u Južnu Afriku i smatra ih se selicama \\"dugoprugašima\\". Pored toga, u područja srednje Europe na zimovanje dolaze neke ptice iz Skandinavije ili Sibira. Tako mnoge arktičke vodene ptice zimuju na obalama Sjevernog mora i uz njene pritoke. I mnoge pjevice Sjeverne i Istočne Europe dolaze u topliju unutrašnjost Zapadne i Srednje Europe. Vjeruje se, da se za orijentiranje koriste magnetizmom i konstelacijom zvijezda.\\nJoš jedan razlog da ptice ljeti idu na sjever je i dužina dnevne svjetlosti. Bitno duže vrijeme insolacije omogućuje im i duže vrijeme za potragu za hranom neophodnom što je vrlo povoljno za podizanje mladunaca."},{"page_url":"https://sh.wikipedia.org/wiki/Selica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Grus_grus_flocks.jpg","page_title":"Selica","context_page_description":"Selicama se nazivaju životinje općenito, koje pojedina godišnja doba provode u različitim područjima. No, kako je ova pojava najpoznatija kod ptica, najčešće se pod ovim nazivom misli upravo na njih, nazivajući ih pticama selicama.\\nProcjenjuje se, da se godišnje seli oko 50 milijardi ptica, od toga oko 5 milijardi između Europe i Afrike.\\nMnoge ptice selice koje u područjima Srednje Europe provode ljeto, zimi odlaze u topliju Južnu Europu ili Sjevernu Afriku. Takve vrste nazivaju se selicama na kraće udaljenosti. Druge odlaze u Južnu Afriku i smatra ih se selicama \\"dugoprugašima\\". Pored toga, u područja srednje Europe na zimovanje dolaze neke ptice iz Skandinavije ili Sibira. Tako mnoge arktičke vodene ptice zimuju na obalama Sjevernog mora i uz njene pritoke. I mnoge pjevice Sjeverne i Istočne Europe dolaze u topliju unutrašnjost Zapadne i Srednje Europe. Vjeruje se, da se za orijentiranje koriste magnetizmom i konstelacijom zvijezda.\\nJoš jedan razlog da ptice ljeti idu na sjever je i dužina dnevne svjetlosti. Bitno duže vrijeme insolacije omogućuje im i duže vrijeme za potragu za hranom neophodnom što je vrlo povoljno za podizanje mladunaca."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B8%D0%BB%D0%B0_(%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/NAIA_from_the_Air.JPG","page_title":"Манила (аэропорт)","context_page_description":"Международный аэропорт Манила имени Ниноя Акино — гражданский аэропорт, обслуживающий агломерацию Столичного региона. Крупнейшая воздушная гавань Филиппин расположена на границе между городами Пасай и Паранак, примерно в семи километрах к югу от Манилы и к юго-востоку от Макати.\\nПорт находится в ведении государственной компании «Управление международным аэропортом Манилы» и является главным транзитным узлом для всех филиппинских авиаперевозчиков.\\nАэропорт носит название в честь бывшего филиппинского сенатора Бенигно «Ниноя» Акино младшего, убитого в этом же аэропорту 21 августа 1983 года при возвращении из эмиграции из Соединённых Штатов Америки.\\nВ 2012 году услугами международного аэропорта Манилы воспользовались 31 558 002 пассажира. По объёмам пассажирских перевозок порт является одним из самых загруженных коммерческих аэропортов Азиатского региона."},{"page_url":"https://sk.wikipedia.org/wiki/Li%C4%8Dno","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Licno_kostel_20080906.jpg","page_title":"Lično","context_page_description":"Lično je obec v Česku v okrese Rychnov nad Kněžnou v Královohradeckom kraji. 1. januára 2012 tu žilo 586 obyvateľov, z toho 309 mužov a 277 žien, pričom priemerný vek v obci bol 41,7 roka."},{"page_url":"https://it.wikipedia.org/wiki/Pavel_Ha%C5%A1ek","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Pavel_Ha%C5%A1ek_2011.jpg","page_title":"Pavel Hašek","context_page_description":"Pavel Hašek è un calciatore ceco, difensore del Dukla Praga."},{"page_url":"https://en.wikipedia.org/wiki/Enghien-les-Bains","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Enghien-les-Bains_-_les_thermes_02.jpg","page_title":"Enghien-les-Bains","context_page_description":"Enghien-les-Bains is a commune in the northern suburbs of Paris, France. It is located 13.5 kilometres from the centre of Paris, in the département of Val-d'Oise.\\nEnghien-les-Bains is famous as a spa resort and a well-to-do suburb of Paris, developed in the nineteenth century around the scenic lake of Enghien. A casino, the only one in the vicinity of Paris, is located on the shores of the lake."},{"page_url":"https://tr.wikipedia.org/wiki/Pars","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Baby_spotted_leopard.jpg","page_title":"Pars","context_page_description":"Pars, Leopar olarak da bilinir, kedigiller familyasından Panthera cinsinin 4 büyük kedi türünden biri. Önceleri parsın, aslan ve panterin melezi olduğu düşünülüyordu. Leopar ismi de Latince Leo ile panter manasında kullanılan Pard kelimelerinin birleştirilmesiyle oluşturulmuştur. İlk doğa bilimciler leopar ve panterleri renkleriyle değil de panterin daha uzun olan kuyruğunu dikkate alarak kuyruk uzunluklarıyla ayırmışlardır."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_oameni_din_statul_Arizona","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Rep._Ed_Pastor.jpg","page_title":"Listă de oameni din statul Arizona","context_page_description":"Această pagină este o listă de oameni sau de personalități notabile care au fost născute în statul Arizona.\\nAceastă listă este generată cu date din Wikidata și este actualizată periodic de un robot.\\nEditările făcute în listă vor fi șterse la următoarea actualizare!\\nSfârșitul listei autogenerate."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Seckau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Seckau_-_Bildstock_%28bei_Seckau_61%29.JPG","page_title":"Liste der denkmalgeschützten Objekte in Seckau","context_page_description":"Die Liste der denkmalgeschützten Objekte in Seckau enthält die 25 denkmalgeschützten, unbeweglichen Objekte der österreichischen Marktgemeinde Seckau im steirischen Bezirk Murtal."},{"page_url":"https://cy.wikipedia.org/wiki/Jerash","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Jarash_-_4140963442.jpg","page_title":"Jerash","context_page_description":"Mae Jerash yn dinas yn yr Iorddonen, ac yn dref weinyddol Ardal Lywodraethol Jerash sef y gofernad lleol. Mae wedi ei leoli tua 50 km i'r gogledd o'r brifddinas, Amman. Poblogaidd yn ddinas yn 2015 oedd 50,745,\\nMae'n adnabyddus am ei gwyliau diwylliannol a chelfyddydol blynyddol a gynhalir ym mis Gorffennaf sy'n denu artistiaid o bob cwr o'r byd."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BE%D0%BB%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Neiden_Chapel.jpg","page_title":"Сколти","context_page_description":"Сколти или Сколти Лапонци су лапонска група народа. Они тренутно живе око села Севетијарви, Кевајарви и Нелим у општини Инари, на пар места у Мурманској области и у селу Неиден у општини Сер Варангер. Сматрају се аутохтоним народом који живе у граничном појасу данашње Финске, Русије и Норвешке, тј. на Кољском полуострву и суседној Феноскандији. Део су културне групе источних Лапонаца и говоре сколтским језиком. Припадници су православне вере, док остали Лапонци и Финци припадају лутеранској цркви."},{"page_url":"https://id.wikipedia.org/wiki/Dumanjug","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Dumanjug_Cebu_1.JPG","page_title":"Dumanjug","context_page_description":"Dumanjug adalah munisipalitas yang terletak di provinsi Cebu, Filipina.\\nPada tahun 2007, munisipalitas ini memiliki populasi sebesar 44.807 jiwa."},{"page_url":"https://it.wikipedia.org/wiki/Alain_Prost","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/ProstAlain_McLarenMP4-2B_1985.jpg","page_title":"Alain Prost","context_page_description":"Alain Marie Pascal Prost è un ex pilota automobilistico francese, vincitore di 51 Gran Premi di Formula 1 e quattro volte campione del Mondo.\\nIl suo debutto in Formula 1 risale al 1980 su McLaren e la sua attività di pilota nella massima categoria di competizioni su pista è proseguita fino al 1993.\\nLe sue numerose vittorie lo hanno portato a diventare il pilota più vincente della storia della Formula 1, superando nel 1987 il record di gare vinte appartenuto fino a quel momento a Jackie Stewart. Il primato è stato poi battuto, 14 anni dopo, da Michael Schumacher.\\nLa sua carriera è stata contrassegnata da molti duelli con altri famosi piloti del tempo, come Niki Lauda, Nigel Mansell, Nelson Piquet e soprattutto Ayrton Senna; piloti che, per alcune stagioni, ha anche avuto come compagni di scuderia: in Ferrari è stato al fianco di Mansell e in McLaren prima di Lauda e successivamente di Senna.\\nDopo il suo ritiro dalla Formula 1, dal 1997 al 2001 è stato costruttore nella massima serie, portando la sua Prost Grand Prix a disputare 83 Gran Premi, senza tuttavia cogliere vittorie."},{"page_url":"https://en.wikipedia.org/wiki/Tiracola_plagiata","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Tiracola_plagiata7.jpg","page_title":"Tiracola plagiata","context_page_description":"Tiracola plagiata, the cacao armyworm, is a moth of the family Noctuidae. The species was first described by Francis Walker in 1857. It is found from south-east Asia, South India, Sri Lanka, Myanmar to the South Pacific Islands, including the northern two-thirds of Australia."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%AF%E0%B6%9A%E0%B7%94%E0%B6%AB%E0%B7%94_%E0%B6%86%E0%B7%83%E0%B7%92%E0%B6%BA%E0%B7%8F%E0%B7%80%E0%B7%9A_%E0%B6%B4%E0%B7%8A%E2%80%8D%E0%B6%BB%E0%B6%AD%E0%B7%92%E0%B6%B8%E0%B7%8F_%E0%B6%9A%E0%B6%BD%E0%B7%8F%E0%B7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Dancing_Girl_of_Mohenjo-daro.jpg","page_title":"දකුණු ආසියාවේ ප්‍රතිමා කලාව","context_page_description":"පළමු හඳුනාගත් ඉන්දියානු උපමහාද්වීපයේ ප්‍රතිමා හමුවන්නේ ඉන්දු නිම්න ශිෂ්ටාචාරයෙනි. මේවා වර්තමාන පාකිස්ථානයට අයත් මොහෙන්ජො-දාරෝ සහ හරප්පා යන ස්ථානවලින් හමුවේ. මේ අතරට මොහෙන්ජො-දාරෝවේ සුප්‍රකට කුඩා ලෝකඩ නළඟන ප්‍රතිමාව ද වේ. කෙසේනමුත් මෙවැනි ලෝකඩ සහ ශෛලමය ප්‍රතිමා විරළ අතර, මැටියෙන් තැනූ රූප සහ ශෛලමය මුද්‍රා බහුලව දක්නට ලැබේ. මෙම මුද්‍රා තුළ සත්ත්ව රූප හෝ දේවතා රූප සියුම් ලෙස කැටයම් කොට ඇත‍. ඉන්දු නිම්න ශිෂ්ටාචාරයේ බිඳ වැටීමෙන් පසු, බෞද්ධ යුගය තෙක්ම ප්‍රතිමා පිළිබඳ හමුවන්නේ සාධක අල්ප වූ සංඛ්‍යාවකි. මේ අතරට දායිමාබාද් වලින් හමුවූ ක්‍රි.පූ. 1500ට අයත් යැයි සැලකෙන ලෝකඩ රූප අයත් වේ. මේ නිසා ඉන්දියානු ශෛලමය ස්මාරක ප්‍රතිමා ශිල්පයේ මහා සම්ප්‍රදාය ඇරඹෙන්නේ සාපේකෂව පසුකලෙක බව පෙනේ. මෙය ක්‍රි.පූ. 270 සිට 232 දක්වා වූ අශෝක අධිරාජයාගේ සමයේ සිදු විය. ඉන්දියාව පුරාම පිහිටුවන ලද ඔහුගේ රාජාඥාවන් ඇතුළත් අශෝක ස්තම්භවල ශීර්ෂයෙහි සිංහ රූප ඇතුළු ප්‍රකට සත්ත්ව රූ දැකගත හැක. මේ අතරින් වර්තමානයේ ශේෂව ඇත්තේ සයක් පමණි. අලංකාර ප්‍රතිමා, බොහෝවිට උන්නත කැටයම් ස්වරූපයෙන් විශාල පරිමාණයෙන් හමුවන්නේ මුල්කාලීන බෞද්ධ ස්තූපවලිනි. මේ අතරින් සාංචි ස්තූපයට වැදගත් ස්ථානයක් හමුවේ; මේවා දැව භාවිතයෙන් සිදුකළ නිර්මාණ සම්ප්‍රදායයන්ගෙන් සම්භවය වන්නට ඇතැයි සැලකේ. මෙම සම්ප්‍රදාය පසුව හින්දු ආගම විසින් ද අනුගමනය කරන ලදී.\\nක්‍රි.පූ."},{"page_url":"https://en.wikipedia.org/wiki/Lopadotemachoselachogaleokranioleipsanodrimhypotrimmatosilphiokarabomelitokatakechymenokichlepikossyphophattoperisteralektryonoptekephalliokigklopeleiolagoiosiraiobaphetraganopterygon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/%D0%9B%CE%BF%CF%80%CE%B1%CE%B4%CE%BF%CF%84%CE%B5%CE%BC%CE%B1%CF%87%CE%BF%CF%83%CE%B5%CE%BB%CE%B1%CF%87%CE%BF%CE%B3%CE%B1%CE%BB%CE%B5%CE%BF%CE%BA%CF%81%CE%B1%CE%BD%CE%B9%CE%BF%CE%BB%CE%B5%CE%B9%CF%88%CE%B1%CE%BD%CE%BF%CE%B4%CF%81%CE%B9%CE%BC%CF%85%CF%80%CE%BF%CF%84%CF%81%CE%B9%CE%BC%CE%BC%CE%B1%CF%84%CE%BF%CF%83%CE%B9%CE%BB%CF%86%CE%B9%CE%BF%CE%BA%CE%B1%CF%81%CE%B1%CE%B2%CE%BF%CE%BC%CE%B5%CE%BB%CE%B9%CF%84%CE%BF%CE%BA%CE%B1%CF%84%CE%B1%CE%BA%CE%B5%CF%87%CF%85%CE%BC%CE%B5%CE%BD%CE%BF%CE%BA%CE%B9%CF%87%CE%BB%CE%B5%CF%80%CE%B9%CE%BA%CE%BF%CF%83%CF%83%CF%85%CF%86%CE%BF%CF%86%CE%B1%CF%84%CF%84%CE%BF...%CE%BD%CE%BF%CF%80%CF%84%CE%B5%CF%81%CF%8D%CE%B3%CF%89%CE%BD.jpg","page_title":"Lopadotemachoselachogaleokranioleipsanodrimhypotrimmatosilphiokarabomelitokatakechymenokichlepikossyphophattoperisteralektryonoptekephalliokigklopeleiolagoiosiraiobaphetraganopterygon","context_page_description":"Lopado­temacho­selacho­galeo­kranio­leipsano­drim­hypo­trimmato­silphio­karabo­melito­katakechy­meno­kichl­epi­kossypho­phatto­perister­alektryon­opte­kephallio­kigklo­peleio­lagoio­siraio­baphe­tragano­pterygon is a fictional dish mentioned in Aristophanes' comedy Assemblywomen.\\nIt is a transliteration of the Ancient Greek word λοπαδο­τεμαχο­σελαχο­γαλεο­κρανιο­λειψανο­δριμ­υπο­τριμματο­σιλφιο­καραβο­μελιτο­κατακεχυ­μενο­κιχλ­επι­κοσσυφο­φαττο­περιστερ­αλεκτρυον­οπτο­κεφαλλιο­κιγκλο­πελειο­λαγῳο­σιραιο­βαφη­τραγανο­πτερύγων. Liddell & Scott translate this as \\"name of a dish compounded of all kinds of dainties, fish, flesh, fowl, and sauces.\\"\\nIt is the longest Greek word. The Greek word has 182 letters and 78 syllables. The transliteration has 182 Latin characters. It is the longest word ever to appear in literature according to the Guinness World Records."},{"page_url":"https://eu.wikipedia.org/wiki/Olargues","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Olargues_vue_generale.JPG","page_title":"Olargues","context_page_description":"Olargues Okzitaniako udalerri bat da. Administratiboki Frantziako Hérault departamenduan dago, Okzitania eskualdean. 2013an 598 biztanle zituen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_ships_of_the_Egyptian_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/VPCM_BT120.jpg","page_title":"List of ships of the Egyptian Navy","context_page_description":"This is a list of Egyptian Navy ships including all ships of the Egyptian Navy as well as its predecessors.\\nThe Egyptian Navy is the largest navy in the Middle East and Africa, and is the sixth largest in the world measured by the number of vessels. The majority of the Egyptian Navy's ships were received from the Soviet Union in the 1960s and China in the 1980s. Since the late 1990s Egyptian Navy made a modernization project in which new vessels were acquired from western sources such as the United States, Germany and France."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_Sf%C3%A2nta_Parascheva_a_%C8%98elarilor_din_Sofia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Sv_petka_sv_nedelya001.jpg","page_title":"Biserica Sfânta Parascheva a Șelarilor din Sofia","context_page_description":"Biserica Sfânta Parascheva a Șelarilor este o biserică ortodoxă medievală bine conservată, situat în stația de metrou din Piața Sfânta Nedelia, în centrul orașului Sofia, în Bulgaria, în vestul Bulgariei."},{"page_url":"https://fr.wikipedia.org/wiki/Hypertexte","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Vannevar_Bush_1940.jpg","page_title":"Hypertexte","context_page_description":"Un hypertexte est un document ou un ensemble de documents contenant des unités d'information liées entre elles par des hyperliens. Ce système permet à l'utilisateur d'aller directement à l'unité qui l'intéresse, à son gré, d'une façon non linéaire. Le terme, créé en 1965 par Ted Nelson, désigne, dans les premières années, un champ de recherche d'orientation littéraire fonctionnant sur un système fermé. En parallèle, les grandes industries commencent à définir un langage de balisage standardisé afin de gérer leurs documents sur un ordinateur central. C'est cette technologie que retiendra Tim Berners-Lee pour relier entre elles les ressources de l'Internet dans le World Wide Web."},{"page_url":"https://ast.wikipedia.org/wiki/Campu_de_Gurs","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Gurs_tombes-3.JPG","page_title":"Campu de Gurs","context_page_description":"El campu de Gurs —camp de Gurs en francés orixinal o camp des basques a efeutos alministrativos franceses — foi un campu de refuxaos construyíu nel añu 1939 na comuña francesa homónima poles autoridaes de la Tercer República con cuenta d'acoyer combatientes españoles republicanos y voluntarios de les Brigaes Internacionales que, tres la derrota de la Segunda República, trespasaren la frontera con Francia y que, a partir de 1940 mientres la Segunda Guerra Mundial, pasó a desempeñar la función de campu de concentración.\\nPola so proximidá al País Vascu, taba previstu p'allugar a refuxaos procedentes d'esta rexón, tres la cayida del frente de Cataluña. Sicasí, ante l'ábanu de refuxaos españoles qu'entraben en Francia por esta frontera, les autoridaes franceses tuvieron qu'ampliar el campu ya internaron nél a toa clase de combatientes procedentes de la España republicana.\\nAl empezar la Segunda Guerra Mundial, el gobiernu francés internó nél a ciudadanos alemanes y d'otros países consideraos allegaos a ésti, según a franceses consideraos peligrosos poles sos idees polítiques y a presos por delitos comunes treslladaos dende cárceles cercanes al mandu de guerra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%BE%D0%BC%D0%B8%D0%BD%D0%B0%D0%BD%D1%82%D0%BE%D0%B2_%D0%BD%D0%B0_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D1%83%D1%8E_%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%8E_%D0%BF%D0%BE_%D0%BB%D0%B8%D1%82%D0%B5%D1%80%D0%B0%D1%82%D1%83%D1%80%D0%B5_(%D0%A5_%E2%80%94_%D0%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Per_Hallstr%C3%B6m.jpg","page_title":"Список номинантов на Нобелевскую премию по литературе (Х — Я)","context_page_description":"Нобелевская премия по литературе — престижная награда, ежегодно вручаемая Нобелевским фондом за достижения в области литературы с 1901 года. Одна из пяти Нобелевских премий, учреждённых Альфредом Нобелем в его завещании.\\nЗа выбор лауреатов Нобелевской премии по литературе отвечает Шведская Академия, которая состоит из 18 мест, пожизненно занимаемых известными шведскими писателями, учёными, общественными деятелями. В её составе действует Нобелевский комитет по литературе. Он представляет собой рабочую группу, включающую от четырёх до пяти человек, которая оценивает номинации и представляет свои рекомендации Академии."},{"page_url":"https://fr.wikipedia.org/wiki/Rochers_Liancourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Ulleung_island_from_above.jpg","page_title":"Rochers Liancourt","context_page_description":"Les rochers Liancourt, également appelés Dokdo en coréen ou Takeshima en japonais, sont un petit groupe d'îlots situé en mer du Japon, contrôlés de facto par la Corée du Sud mais revendiqués par le Japon. Faisant l'objet d'un contentieux non résolu entre les deux pays, ils sont aujourd'hui rattachés par l'administration de la Corée du Sud à l'île d'Ulleungdo, distante de 87 km, dans la région du Gyeongsang du Nord, et par le Japon à la commune d'Okinoshima, dans l'archipel Oki, distant de 157 km, dans la préfecture de Shimane. Ces îlots ont été la cible de bombardements d’entraînement de l'armée américaine qui ont causé la mort de 30 pêcheurs le 8 juin 1948."},{"page_url":"https://pl.wikipedia.org/wiki/Huntington_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Pacific_Boulevard_and_Clarendon_Avenue.jpg","page_title":"Huntington Park","context_page_description":"Huntington Park – miasto w Stanach Zjednoczonych, w stanie Kalifornia, w hrabstwie Los Angeles. W 2010 zamieszkiwało je 58 114 osób. Miasto leży na wysokości 52 metrów n.p.m. i zajmuje powierzchnię 7,811 km².\\nPrawa miejskie uzyskało 1 września 1906."},{"page_url":"https://de.wikipedia.org/wiki/Hof_(Saale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/J_C_Reinhart_M%C3%A4useturm_Ehrenfels_1787.jpg","page_title":"Hof (Saale)","context_page_description":"Hof ist eine an der Saale gelegene fränkische kreisfreie Stadt im Nordosten von Bayern. Sie ist mit 47.296 Einwohnern nach Bamberg und Bayreuth die drittgrößte Stadt des Regierungsbezirks Oberfranken, zusammen mit dem Stadtumland bildet die Stadt einen urbanen Raum mit etwa 70.000 Einwohnern.\\nDie Stadt ist Oberzentrum, Hochschulstadt mit fast 6.000 Studenten, Mittelpunkt des Hofer Landes und Sitz der Kreisverwaltung des Landkreises Hof, der die Stadt vollständig umgibt. Hof ist mit 115 Nationalitäten eine internationale Stadt, die Hochschule unterhält eine enge Zusammenarbeit mit Indien.\\nSeit 1993 ist Hof Mitglied der Europaregion Euregio Egrensis und seit 2005 der Metropolregion Nürnberg. Zudem ist Hof das Zentrum der Region Hochfranken. Hof liegt in der Planungsregion Oberfranken-Ost, deren Verwaltungssitz die Stadt ist.\\nDie Stadt liegt an der Bayerischen Porzellanstraße.\\nDie Stadt hat ein großes Angebot an Kultur und Freizeitmöglichkeiten. Der Theresienstein und der Untreusee sind die beiden Naherholungsgebiete Hofs. Die Freiheitshalle ist die größte Veranstaltungshalle Nordostbayerns. Das Theater Hof ist ein Vierspartentheater und Hauptspielstätte der Hofer Symphoniker."},{"page_url":"https://de.wikipedia.org/wiki/Caroline_Weber","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/CarolineWeber_RhythmischeGymnastin_Austria.jpg","page_title":"Caroline Weber","context_page_description":"Caroline Weber ist eine ehemalige österreichische Gymnastin. Sie qualifizierte sich zweimal für Olympische Spiele und erreichte bei der EM 2011 sowie der EM 2013 das Gerätefinale der besten acht. Sie ist die erfolgreichste Gymnastin in der Geschichte des Österreichischen Fachverbandes für Turnen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Hoheluft-West","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Stolperstein_Scheideweg_33_%28Gustav_W%C3%A4chter%29_in_Hamburg-Hoheluft-West.JPG","page_title":"Liste der Stolpersteine in Hamburg-Hoheluft-West","context_page_description":"Die Liste der Stolpersteine in Hamburg-Hoheluft-West enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Hoheluft-West verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hamburg-Hoheluft-West lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5848 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://eo.wikipedia.org/wiki/Zingst","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Rettungsschuppen_zingst_2006.jpg","page_title":"Zingst","context_page_description":"Zingst [CINGST] estas komunumo en Germanio. Ĝi troviĝas en la distrikto Antaŭpomerio-Rügen de la federacia lando Meklenburgo-Antaŭpomerio, sur duoninsulo kiu rigardeblas la plej orienta parto de pli vasta nuna duoninsulo Fischland-Darß-Zingst en la Balta Maro. Ĝis la 19-a jarcento Zingst estis insulo, kaj nur tiam ligiĝis al la okcidenta duoninsulo Darß. Fine de decembro 2015 la komunumo havis 3 077 loĝantojn."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B1%D8%A8_%D8%A7%D9%84%D8%B9%D8%B1%D8%A7%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/080216_3-14_graduation.jpg","page_title":"حرب العراق","context_page_description":"حرب العراق هي نزاع مسلح طويل الأمد بدأ مع غزو العراق عام 2003 من قبل قوات التحالف بقيادة الولايات المتحدة. أطاح الغزو بحكومة صدام حسين. ومع ذلك، فقد استمر الصراع في الكثير من أوقات العقد المقبل على أنه تمرد وظهرت معارضة لقوات الاحتلال وحكومة ما بعد الغزو العراقية. قتل ما يقدر بنحو 151,000 إلى 600,000 عراقي أو أكثر في 3–4 سنوات الأولى من الصراع. أعلنت الولايات المتحدة رسميا انسحابها من البلاد في عام 2011 لكن عادت وشاركت في 2014 على رأس ائتلاف جديد; واستمر التمرد والصراع المسلح الأهلي.\\nبدء الغزو في 20 مارس 2003، بقيادة الولايات المتحدة، ثم انضمت المملكة المتحدة والعديد من حلفاء التحالف، حيث أطلقوا حملة القصف المسماة \\"الصدمة والترويع\\". أدى الغزو إلى انهيار الحكومة البعثية؛ واعتقل صدام خلال عملية الفجر الأحمر في ديسمبر كانون الأول من العام نفسه ثم أعدم بعد ثلاث سنوات. ومع ذلك، أدى فراغ السلطة بعد سقوط صدام وسوء إدارة الاحتلال إلى انتشار العنف الطائفي بين الشيعة والسنة، فضلاً عن تمرد طويل ضد الولايات المتحدة وقوات التحالف."},{"page_url":"https://es.wikipedia.org/wiki/Liga_Premier_de_Rusia_2011-12","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Zenit2011.JPG","page_title":"Liga Premier de Rusia 2011-12","context_page_description":"La Liga Premier 2011-12 fue la 20.ª edición de la Liga Premier de Rusia. La temporada comenzó el 12 de marzo de 2011 y finalizó el 22 de mayo de 2012. El club Zenit San Petersburgo revalidó su título de campeón, obteniendo su tercer título de liga."},{"page_url":"https://de.wikipedia.org/wiki/Volksmiliz_(Ukraine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/2015-05-05._%D0%A0%D0%B5%D0%BF%D0%B5%D1%82%D0%B8%D1%86%D0%B8%D1%8F_%D0%BF%D0%B0%D1%80%D0%B0%D0%B4%D0%B0_%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B_099.jpg","page_title":"Volksmiliz (Ukraine)","context_page_description":"Volksmiliz ist die Eigenbezeichnung paramilitärischer Truppen in der Ostukraine. Sie wurden gleichzeitig in verschiedenen Städten aktiv, nachdem sich Präsident Wiktor Janukowytsch aus der Hauptstadt abgesetzt hatte. Seit dem April 2014 kämpfen sie für die Volksrepubliken Donezk und Lugansk, und damit gegen regierungstreue Einheiten im Ukrainekrieg.\\nWie auf der Krim waren aus Russland eindringende bewaffnete Sondertruppen beteiligt. Im November 2014 sagte Igor Girkin, dass der Krieg in der Ostukraine von ihm und seiner Einheit ausgelöst worden sei: „Den Auslöser zum Krieg habe ich gedrückt. Wenn unsere Einheit nicht über die Grenze gekommen wäre, wäre alles so ausgegangen wie in Charkiw und in Odessa“. Girkin, zeitweilig Verteidigungsminister der Volksrepublik Donezk, hatte im Mai 2014 erklärt, zwei Drittel der Rebellen seien Ukrainer.\\nRussland unterstützt die Milizen durch das Einsickernlassen von Freischärlern und durch Lieferungen von schweren Waffen bis hin zu Kampfpanzern: Anführer der Kämpfer bestätigten im Sommer 2014 die Anwesenheit aktiver russischer Soldaten „auf Urlaub“. Deren Ausrüstung verrät immer wieder, dass sie aktive russische Soldaten sind."},{"page_url":"https://pt.wikipedia.org/wiki/Arnedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Arnedo.png","page_title":"Arnedo","context_page_description":"Arnedo é um município da Espanha\\nna província e comunidade autónoma de La Rioja, de área 85,40 km² com população de 14082 habitantes e densidade populacional de 164,89 hab./km²."},{"page_url":"https://de.wikipedia.org/wiki/Hamina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Haminan_raatihuone.jpg","page_title":"Hamina","context_page_description":"Hamina ist eine südostfinnische Hafenstadt am Finnischen Meerbusen, 150 km östlich von Helsinki."},{"page_url":"https://en.wikipedia.org/wiki/Amar_Abba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/AmarAbba.jpg","page_title":"Amar Abba","context_page_description":"Amar Abba is a former Ambassador Extraordinary and Plenipotentiary of the People's Democratic Republic of Algeria to the Russian Federation. He was later named the Ambassador to the United Kingdom with concurrent accreditation in the Republic of Ireland."},{"page_url":"https://es.wikipedia.org/wiki/Bioerosi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/BoredEncrustedShell.JPG","page_title":"Bioerosión","context_page_description":"La bioerosión describe la descomposición de los sustratos oceánicos duros - y con menos frecuencia los terrestres - por organismos vivos. La bioerosión marina puede ser causada por moluscos, gusanos poliquetos, forónidos, esponjas, crustáceos, equinoides y peces; puede ocurrir en las costas, en los arrecifes de coral y en los barcos; sus mecanismos incluyen la perforación biótica, la perforación, y el raspado. En tierra firme, la bioerosión suele ser realizada por plantas pioneras u organismos similares a las plantas, como el liquen, y en su mayor parte es de carácter químico o mecánico en la naturaleza.\\nLa bioerosión de los arrecifes de coral genera la arena de coral fina y blanca característica de las islas tropicales. El coral es convertido en arena por bioerosionadores internos como algas, hongos, bacterias y esponjas, bivalvos, sipunculanos, poliquetos, percebes acrotorácicos y forónidos, generando un sedimento extremadamente fino con diámetros de 10 a 100 micrómetros. Entre los bioerosionadores externos se encuentran los erizos de mar y los quitones. Estas fuerzas en conjunto producen una gran cantidad de erosión."},{"page_url":"https://sr.wikipedia.org/wiki/Dicranum_scoparium","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Broom_moss_%28Orphan_Lk%29_2.JPG","page_title":"Dicranum scoparium","context_page_description":"Метлача врста је маховине, родом из Северне Америке. Обично формира простирке на тлу у сувим до влажним шумовитим пределима."},{"page_url":"https://nl.wikipedia.org/wiki/O42","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Oranjesingel_42_Filmhuis_O42_%28Voormalig_VillaLUX%2C_O%2742%29_Nijmegen.jpg","page_title":"O42","context_page_description":"Het pand aan de Oranjesingel 42 in Nijmegen, kortweg O42, is een voormalige studentensociëteit en cultureel podium en filmtheater."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D1%98%D0%B5%D1%80_%D0%9A%D0%BE%D1%80%D0%BD%D0%B5%D1%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Pierre_Corneille_2.jpg","page_title":"Пјер Корнеј","context_page_description":"Пјер Корнеј - француски трагичар, еден од тројцата големи француски драматурзи на 17 век, заедно со Молиер и Расин. Со драмското творештво од речиси четириесет години, Корнеј се смета за „татко на француската трагедија“."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%DB%8C%D9%84%DB%8C%D8%A7%D9%85_%D8%A7%DB%8C._%D8%A8%D9%88%D8%B1%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/William_E._Burney_%28Colorado_Congressman%29.jpg","page_title":"ویلیام ای. بورنی","context_page_description":"ویلیام ای. بورنی آمریکالی سیاستچی و دموکرات حزبینین عوضوو ایدی. دنور شهرینده دۆنیاسین دَییشیب."},{"page_url":"https://es.wikipedia.org/wiki/Anatom%C3%ADa_topogr%C3%A1fica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Gray1220-es.svg","page_title":"Anatomía topográfica","context_page_description":"La anatomía topográfica o quirúrgica, es la disciplina de la anatomía que divide el cuerpo humano en zonas o regiones anatómicas para facilitar su estudio, apreciando sobre todo las relaciones, topografía y contenidos de cada una.​"},{"page_url":"https://de.wikipedia.org/wiki/Stadtbefestigung_Freising","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Obere_Hauptstra%C3%9Fe_Freising.jpg","page_title":"Stadtbefestigung Freising","context_page_description":"Die Stadtbefestigung Freising umschloss bis ins späte 19. Jahrhundert die Bischofsstadt Freising."},{"page_url":"https://en.wikipedia.org/wiki/Atlantis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Faroe_stamp_493_Djurhuus_poems_-_atlantis.jpg","page_title":"Atlantis","context_page_description":"Atlantis is a fictional island mentioned in an allegory on the hubris of nations in Plato's works Timaeus and Critias, where it represents the antagonist naval power that besieges \\"Ancient Athens\\", the pseudo-historic embodiment of Plato's ideal state in The Republic. In the story, Athens repels the Atlantean attack unlike any other nation of the known world, supposedly bearing witness to the superiority of Plato's concept of a state. The story concludes with Atlantis falling out of favor with the deities and submerging into the Atlantic Ocean.\\nDespite its minor importance in Plato's work, the Atlantis story has had a considerable impact on literature. The allegorical aspect of Atlantis was taken up in utopian works of several Renaissance writers, such as Francis Bacon's New Atlantis and Thomas More's Utopia. On the other hand, nineteenth-century amateur scholars misinterpreted Plato's narrative as historical tradition, most famously Ignatius L. Donnelly in his Atlantis: The Antediluvian World."},{"page_url":"https://es.wikipedia.org/wiki/Tiril_Eckhoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Tiril_Eckhoff%2C_biathlete.jpg","page_title":"Tiril Eckhoff","context_page_description":"Tiril Kampenhaug Eckhoff es una deportista noruega que compite en biatlón.\\nParticipó en dos Juegos Olímpicos de Invierno, obteniendo en total cinco medallas, oro y dos bronces en Sochi 2014 y plata y bronce en Pyeongchang 2018.​\\nGanó nueve medallas en el Campeonato Mundial de Biatlón entre los años 2015 y 2020.​"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_27_januari","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Princess_Sophie_of_Bavaria.jpg","page_title":"Lijst van personen geboren op 27 januari","context_page_description":"Dit is een lijst van personen die geboren zijn op 27 januari.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n258 v.Chr. - Qin Shi Huangdi, keizer, keizer van China, staatsman uit de Qin-dynastie bewerken\\n1491 - Jacobus Meyerus, historicus bewerken\\n1518 - Jan van Locquenghien, Belgische burgemeester van Brussel bewerken\\n1542 - Gioseffo Guami, componist en organist bewerken\\n1546 - Joachim Frederik van Brandenburg, Duitse markgraaf, aartsbisschop, Keurvorst en katholiek bisschop, apostolistisch administrateur en rooms-katholiek priester bewerken\\n1571 - Abbas I van Perzië, koning, Sjah uit het Safavidenrijk bewerken\\n1585 - Hendrick Avercamp, Nederlandse kunstschilder bewerken\\n1615 - Nicolas Fouquet, Franse burggraaf, politicus, econoom en magistraat bewerken\\n1621 - Thomas Willis, arts, anatoom, fysioloog en neuroloog uit het Koninkrijk Engeland bewerken"},{"page_url":"https://fr.wikipedia.org/wiki/Cuisine_hongkongaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Stirred_instant_noodle_with_cheese_sauce_and_pork_jowl.jpg","page_title":"Cuisine hongkongaise","context_page_description":"La cuisine hongkongaise a été influencée par plusieurs cuisines : la cuisine cantonaise, la cuisine européenne, des cuisines chinoises non cantonaises, et d'autres cuisines asiatiques. Du fait de sa situation de port et d'ancienne colonie britannique, Hong Kong a donc bénéficié de multiples influences et fournit une large gamme de restaurants, ce qui lui valu d'être labellisée « Gourmet Paradise » « World's Fair of Food »"},{"page_url":"https://nl.wikipedia.org/wiki/Thiago_Pereira","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Thiago_Pereira_Gold_Pan_2007.jpg","page_title":"Thiago Pereira","context_page_description":"Thiago Machado Vilela Pereira is een Braziliaanse zwemmer. Hij vertegenwoordigde zijn vaderland op de Olympische Zomerspelen 2004 in Athene, de Olympische Zomerspelen 2008 in Peking en op de Olympische Zomerspelen 2012 in Londen."},{"page_url":"https://eo.wikipedia.org/wiki/Giuseppe_Verdi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Milano_Scala_19c.jpg","page_title":"Giuseppe Verdi","context_page_description":"Giuseppe VERDI estis itala komponisto, de la epoko de Romantisma muziko, konata ĉefe pro siaj operoj.\\nLi estas konsiderata, kun Richard Wagner, la elstara operkomponisto de la 19a jarcento.\\nVerdi hegemomiis en la itala opera scenejo post la epokoj de Bellini, Donizetti kaj Rossini. Liaj verkoj estas ofte plenumitaj en operejoj tra la tuta mondo kaj, trans la limoj de la ĝenro, kelkaj el liaj temoj ekdelonge enradikiĝis en la populara kulturo, kiaj ekzemple \\"La donna è mobile\\" el Rigoletto, \\"Libiamo ne' lieti calici\\" el La traviata, \\"Va, pensiero\\" el Nabucco, la \\"Coro di zingari\\" el Il trovatore kaj eble ĉefe la \\"Triumfa Marŝo\\" el Aida.\\nMovita de la morto de samlandano Alessandro Manzoni, Verdi verkis Rekvieman Diservon en 1874 honore al Manzoni, verko nun konsiderata kiel majstroverko de la tradicio de oratorio kaj atestaĵo pri lia kapablo ekster la fako opero. Idealisto kaj politike engaĝiĝinta, li restis – kun Garibaldi kaj Cavour – simbola figuro de la reunuiga procezo de la Itala duoninsulo."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%86%D9%88%D9%81_(%D9%86%D8%A8%D8%B1%D8%A7%D8%B3%D9%83%D8%A7)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Tarnov%2C_Nebraska_from_E.JPG","page_title":"تارنوف (نبراسكا)","context_page_description":"تارنوف ‏ هي منطقة سكنية تقع في الولايات المتحدة في مقاطعة بلاتي، نبراسكا. يقدر عدد سكانها بـ 46 نسمة ومساحتها 0.08 كم² وترتفع عن سطح البحر 503 متر."},{"page_url":"https://en.wikipedia.org/wiki/Nicolaes_Willingh","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/INT._EERSTE_KAMER%2C_ZAAL%2C_PLAFONDSCHILDERINGEN%2C_DETAIL_%28TIJDENS_RESTAURATIE%29_-_%27s-Gravenhage_-_20309368_-_RCE.jpg","page_title":"Nicolaes Willingh","context_page_description":"Nicolaes Willingh, was a Dutch Golden Age painter."},{"page_url":"https://nn.wikipedia.org/wiki/Norr%C3%B8nt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Old_norse%2C_ca_900.PNG","page_title":"Norrønt","context_page_description":"Norrønt eller oldnordisk er språket som vart brukt i Noreg, på Island og dei andre norrøne busetjingane i Nordsjøområdet i tida frå om lag 700 til om lag midten på 1300-talet.\\nNamnet oldnordisk kjem av at ein ei tid tenkte at norrønt var opphavet til alle dei nordiske språka. Dette fann ein seinare ut ikkje var tilfellet då opphavsspråket er urnordisk, medan norrønt er det felles vestnordiske språket som har utvikla seg til norsk, færøysk, islandsk og norn.\\nDet var ikkje noko klart skilje mellom desse ulike dialektane, og fram til 1200-talet såg ein på dei som det same språket; dansk eller dǫnsk tunga. Dei som snakka dette språket kunne òg lett samtala med talarar av andre germanske språk, som gammalengelsk, gammalsaksisk og andre nedertyske språk."},{"page_url":"https://vi.wikipedia.org/wiki/Mukacheve_(huy%E1%BB%87n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Mukachivskiy_rayon_gerb.png","page_title":"Mukacheve (huyện)","context_page_description":"Huyện Mukachevo là một huyện của tỉnh Zakarpattia thuộc Ukraina. Huyện Mukachevo có diện tích 997 km², dân số theo điều tra dân số ngày 5 tháng 12 năm 2001 là 101572 người với mật độ 102 người/km2. Trung tâm huyện nằm ở Mukachevo."},{"page_url":"https://en.wikipedia.org/wiki/West_Mahanoy_Township,_Schuylkill_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/West_Mahanoy_Twp_Hall%2C_Schuylkill_Co_PA.JPG","page_title":"West Mahanoy Township, Schuylkill County, Pennsylvania","context_page_description":"West Mahanoy Township is a township in Schuylkill County, Pennsylvania, United States. The population was 6,166 at the 2000 census."},{"page_url":"https://vi.wikipedia.org/wiki/Heinrich_L%C3%BCbke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Bundesarchiv_Bild_146-1994-034-22A%2C_Heinrich_L%C3%BCbke.jpg","page_title":"Heinrich Lübke","context_page_description":"Karl Heinrich Lübke là Tổng thống thứ hai của Cộng hoà Liên bang Đức từ năm 1959 đến năm 1969. Trước khi làm Tổng thống, ông từng giữ chức Bộ trưởng Nông nghiệp Liên bang."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%90%D0%BA%D0%B2%D0%B0%D1%80%D0%B8%D1%83%D0%BC%D1%8B%D0%BD_%D0%B7%D0%B0%D0%B3%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/5balasharks.jpg","page_title":"Аквариумын загас","context_page_description":"Энэ жагсаалт нь аквариумын загасны нийтлэг нэршилийн жагсаалт юм.\\nАймаг: Амьтан Animalia\\nХүрээ: Хөвчтөн Chordata"},{"page_url":"https://pl.wikipedia.org/wiki/Cerkiew_%C5%9Bw._Jerzego_w_Siemian%C3%B3wce","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Poland_Siemian%C3%B3wka_church.jpg","page_title":"Cerkiew św. Jerzego w Siemianówce","context_page_description":"Cerkiew św. Jerzego – prawosławna cerkiew parafialna w Siemianówce. Należy do dekanatu Hajnówka diecezji warszawsko-bielskiej Polskiego Autokefalicznego Kościoła Prawosławnego.\\nŚwiątynia mieści się przy ulicy Szkolnej."},{"page_url":"https://vec.wikipedia.org/wiki/Saint-Aignan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Saint-Aignan_-_%C3%89glise_de_Saint-Aignan_-_Photo_Francis_Neuvens_lesardennesvuesdusol.fotoloft.fr.jpg","page_title":"Saint-Aignan","context_page_description":"Saint-Aignan el xé on comun de 149 abitanti del departemento de Ardennes che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://zh.wikipedia.org/wiki/50%E5%85%83%E4%BA%BA%E6%B0%91%E5%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/RMB1-50-4A.jpg","page_title":"50元人民币","context_page_description":"人民币50元面值最早出现于1948年12月1日，但随着第一套人民币的退市，该面额从人民币的币值等级中消失，直到第四套人民币发行。\\n其中由于第一套人民币与第二套人民币是以1:10000的比率进行的兑换，故第一套人民币中50元的币值与目前流通的50元人民币币值不等。"},{"page_url":"https://it.wikipedia.org/wiki/Myocastor_coypus","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Ragondin_effray%C3%A9.jpg","page_title":"Myocastor coypus","context_page_description":"La nutria, detta anche\\nmiopotamo coipo, castoro d’acqua e ratto di palude, è un mammifero roditore originario del Sudamerica, unica specie vivente del genere Myocastor e della famiglia Myocastoridae."},{"page_url":"https://sv.wikipedia.org/wiki/Ziziphus_rugosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Ziziphus_rugosa_02.JPG","page_title":"Ziziphus rugosa","context_page_description":"Ziziphus rugosa är en brakvedsväxtart som beskrevs av Jean-Baptiste de Lamarck. Ziziphus rugosa ingår i släktet Ziziphus och familjen brakvedsväxter."},{"page_url":"https://es.wikipedia.org/wiki/Mobiliario_urbano_de_Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Fanal_Ciutadella.jpg","page_title":"Mobiliario urbano de Barcelona","context_page_description":"El mobiliario urbano de Barcelona está gestionado por el Área de Ecología, Urbanismo y Movilidad del Ayuntamiento de Barcelona. Su evolución se ha desarrollado acorde a los progresos realizados en el conjunto del urbanismo barcelonés y, en general, a la evolución histórica y territorial de la ciudad, y en consonancia con otros factores definitorios del espacio público, como la arquitectura, las infraestructuras urbanas y la adecuación y mantenimiento de espacios naturales o de construcción. Si bien su principal característica ha sido desde siempre la funcionalidad, por regla general han sido frecuentemente objetos de diseño y de consideración estética, ya que amueblan el espacio público donde se desarrolla la sociedad urbana.\\nLa evolución urbanística de la Ciudad Condal ha sido constante desde su fundación en época romana hasta la actualidad, si bien ha sido desde el siglo XIX cuando se ha acentuado gracias al plan de Ensanche y la agregación de municipios limítrofes."},{"page_url":"https://pt.wikipedia.org/wiki/James_MacDonough","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/James_MacDonough.jpg","page_title":"James MacDonough","context_page_description":"James MacDonough é um músico americano, conhecido como o ex-baixista das bandas Megadeth e Iced Earth."},{"page_url":"https://et.wikipedia.org/wiki/Lebed%C3%B5n","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Lebedyn_gerb.png","page_title":"Lebedõn","context_page_description":"Lebedõn on linn Ukrainas Sumõ oblastis. Oblastilise alluvusega Lebedõn on Lebedõni rajooni keskus, kuid ei kuulu ise rajooni koosseisu.\\nAsula tekkis 1652. aastal. Põhjasõja ajal 1708. aastal asus Lebedõnis Peeter I peakorter. Linnaõigused sai Lebedõn 1797. aastal ja oli seejärel maakonnalinn Harkovi kubermangu koosseisus. 1920. aastatel sai Lebedõn Harkivi oblasti rajoonikeskuseks ja alates 1939. aastast Sumõ oblasti rajoonikeskuseks.\\n2001. aasta rahvaloenduse andmetel oli Lebedõni elanikest ukrainlasi 92,88%, venelasi 6,27%, valgevenelasi 0,30% ja mustlasi 0,09%."},{"page_url":"https://pl.wikipedia.org/wiki/U%C5%BCpol","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/U%C5%BEpaliai1.JPG","page_title":"Użpol","context_page_description":"Użpol lub Uszpole – miasteczko na Litwie, położone w okręgu uciańskim w rejonie uciańskim, siedziba starostwa Użpol, 17 km na północ od Uciany, 877 mieszkańców.\\nZnajduje się tu kościół katolicki z XIX wieku, cerkiew św. Mikołaja z cmentarzem z XIX wieku, gimnazjum i poczta. Miejscowy dwór był ośrodkiem rozległego majątku.\\nOd 1998 roku miejscowość posiada własny herb nadany dekretem Prezydenta Republiki Litewskiej."},{"page_url":"https://nl.wikipedia.org/wiki/Nationaal_park_Alutaguse","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Agusalu_maastikukaitseala.JPG","page_title":"Nationaal park Alutaguse","context_page_description":"Het Nationaal Park Alutaguse is een nationaal park in Estland, opgericht in 2018. Het omvat een gebied van 435,68 km² in het noordoosten van het land. Het gebied bestaat onder andere uit duinen, de draslanden en meanders van de Narva, het merengebied van Kurtna, moerassen, venen, bossen. Het nationaal park ontstond in 2018 nadat elf voordien al beschermde natuurgebieden werden samengevoegd. In het park leeft onder andere steenarend, moerassneeuwhoen, vliegende eekhoorn, zwarte ooievaar, bruine beer, lynx, wolf."},{"page_url":"https://de.wikipedia.org/wiki/Aram_(Damaskus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Kingdoms_of_the_Levant_Map_830.png","page_title":"Aram (Damaskus)","context_page_description":"Aram-Damaskus war ein aramäisches Königreich mit der Hauptstadt Damaskus und existierte vermutlich vom 13. Jahrhundert v. Chr. bis 733 v. Chr. In der Bibel wird der Name Aram auch für andere aramäische Königreiche verwendet."},{"page_url":"https://pl.wikipedia.org/wiki/Tramwaje_w_Grazu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Tramway_graz23.jpg","page_title":"Tramwaje w Grazu","context_page_description":"Tramwaje w Grazu – system komunikacji tramwajowej działający w austriackim mieście Graz.\\nPierwszy tramwaj wyjechał na ulicę Grazu 6 maja 1878. W 1899 przeprowadzono elektryfikacje linii tramwajowej. Obecnie miasto obsługiwane jest przez 6 linii tramwajowych łączących dzielnice z centrum miasta, wszystkie linie łączą się na Jakominiplatz i Hauptplatz. Tramwaje są biało-zielone, w większości produkcji niemieckiej bądź austriackiej.\\nTramwaje w centrum mają wydzielone torowisko, w odleglejszych osiedlach, szczególnie powstałych w latach 70. XX wieku, w niektórych miejscach torowisko jest w jezdni. Tramwaje w Grazu są w systemie komunikacyjnym obejmującym całą Styrię."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AF%B8%EC%8A%A4_USA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Ali_Landry_2.jpg","page_title":"미스 USA","context_page_description":"미스 USA 대회는 미국의 미인 대회이며, 미스 유니버스 참가를 위한 미국 대표 참가자를 뽑는 대회이다. 우승자는 1년간 유방암과 난소암 그리고 USO를 위한 봉사 활동을 펼치게 되며 각종 이벤트 참가와 임대 아파트에서 무상임대 로 거주할 수 있는 권리, 소정의 월급과 상품을 제공 받는다."},{"page_url":"https://hr.wikipedia.org/wiki/Grko-Makedonci","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Flag_of_Greek_Macedonia.png","page_title":"Grko-Makedonci","context_page_description":"Grko-Makedonci Ime jednoj skupini Grka koja sebe naziva imenom Μακεδόνες Makedonci, a nastanjeni su na grčkom području Makedonije, i naziv ne podrazumijeva nikakvu etničku pripadnost, nego jedino kao stanovnike toga dijela Grčke. Istovremeno u proturječju sa time, takozvani Grko-Makedonci se, navode kao većinsko kršćansko stanovništvo u ranom 20 stoljeću, u vilajetu Selânik (Solun) i u Manastiru (Bitola). -Prema istom izvoru mnogi Grko-Makedonci imigrirali su između 1924.-1974. u Australiju, poglavito iz gradova Florina, Kastoria i Kozani. Grčko-Makedonska zajednica u Melbournu imala je konflikata sa makedonskim Makedoncima poradi starih klulturnih simbola, koji aludiraju na Filipa II Makedonskog i drevno makedonsko podrijetlo."},{"page_url":"https://it.wikipedia.org/wiki/Bent_Schmidt_Hansen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Bent_Schmidt_Hansen_%281969%29.jpg","page_title":"Bent Schmidt Hansen","context_page_description":"Bent Schmidt Hansen è stato un calciatore danese, di ruolo centrocampista."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%8F%E5%9E%8B%E5%A4%AA%E9%98%B3%E7%93%B6%E5%AD%90%E8%8D%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Heliamphora_neblinae_var._parva_isotype.jpg","page_title":"小型太阳瓶子草","context_page_description":"小型太阳瓶子草是委内瑞拉内布利纳山特有的食虫植物。其生长于海拔1750至2200米处。"},{"page_url":"https://pt.wikipedia.org/wiki/Sha_Na_Na","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Sha_Na_Na_1972.JPG","page_title":"Sha Na Na","context_page_description":"Sha Na Na é um grupo cômico de rock formado na cidade de Nova York, que apresenta versões de sucessos do doo-wop dos anos 50, além de interpretar a cultura urbana daquela época em seus shows.\\nA banda teve início em 1968 sob o nome The Kingsmen enquanto os integrantes estudavam na Universidade de Colúmbia, mas o nome foi mudado pois já existia um grupo homônimo. A formação original trazia os Vocalistas Rob Leonard, Scott Powell, Johnny Contardo, Frederick \\"Denny\\" Greene, Richard \\"Ritchie\\" Joffe, Don York, John \\"Bowzer\\" Bowman, mais os Guitarristas Chris Donald, Elliot Cahn e Henry Gross, o Baixista e Vocalista Bruce Clarke, o Baterista e Vocalista de Apoio John \\"Jocko\\" Marcellino, o Pianista, Tecladista e Vocalista \\"Screamin'\\" Scott Simon e o Saxofonista e Vocalista Leonard Baker.\\nTornaram-se conhecidos em 1969 depois de tocar no Festival de Woodstock.\\nCom o advento nos anos 70 da onda de nostalgia pela década de 50 o nível de popularidade do Sha Na Na aumentou rapidamente, inspirando o surgimento de grupos similares na América do Norte e no Reino Unido. A banda ainda continua a se apresentar com alguns dos integrantes originais."},{"page_url":"https://en.wikipedia.org/wiki/Edgware","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Edgware%2C_Kings_Parade%2C_Edgwarebury_Lane_-_geograph.org.uk_-_1422782.jpg","page_title":"Edgware","context_page_description":"Edgware is a suburban town in north London, mostly in the London borough of Barnet but with a small part falling in Harrow. Edgware is centred 9.5 miles north-northwest of Charing Cross and has its own commercial centre. Edgware has a generally suburban character, typical of the rural-urban fringe. It was an ancient parish in the county of Middlesex directly east of the ancient Watling Street, and gives its name to the present day Edgware Road that runs from central London towards the town. The community benefits from some elevated woodland on a high ridge marking the Hertfordshire border of gravel and sand. It includes the areas of Burnt Oak, The Hale, Edgwarebury, Canons Park, and parts of Queensbury.\\nEdgware is principally a shopping and residential area, identified in the London Plan as one of the capital's 35 major centres, and one of the northern termini of the Northern line. It has a bus garage, a shopping centre called the Broadwalk Centre, a library, a hospital—Edgware Community Hospital, and two streams—Edgware Brook and Deans Brook, both tributaries of a small brook known as Silk Stream, which in turn merges with the River Brent at Brent Reservoir."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%A7%D9%86%D8%A7%D9%83%D9%8A_(%D9%88%D9%8A%D8%B3%D9%83%D9%88%D9%86%D8%B3%D9%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/WaunakeeWisconsinDowntown2.jpg","page_title":"واناكي (ويسكونسن)","context_page_description":"واناكي ‏ هي بلدة تقع في الولايات المتحدة في مقاطعة دان (ويسكونسن). يقدر عدد سكانها بـ 12,097 نسمة ومساحتها 16.55 كم²وترتفع عن سطح البحر 283 متر."},{"page_url":"https://pt.wikipedia.org/wiki/Fabales","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Polygala_myrtifolia0.jpg","page_title":"Fabales","context_page_description":"Fabales é uma ordem de plantas com flor pertencente à classe Magnoliopsida, com distribuição cosmopolita, embora mais frequente nas zonas tropicais, e com alta distribuição altitudinal. A ordem agrupa entre 19 000 e 22 000 espécies, incluindo plantas com grande importância económica."},{"page_url":"https://fr.wikipedia.org/wiki/Association_intercommunale_des_services_sociaux_et_de_sant%C3%A9_de_Savonie_du_Sud","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Mikkelin_keskussairaala_-_p%C3%A4%C3%A4sis%C3%A4%C3%A4nk%C3%A4ynti-_Porrassalmenkatu_35%E2%80%9337_-_Maunuksela_-_Mikkeli.jpg","page_title":"Association intercommunale des services sociaux et de santé de Savonie du Sud","context_page_description":"L'association intercommunale des services sociaux et de santé de Savonie du Sud est un district hospitalier de la région de Savonie du Sud."},{"page_url":"https://cs.wikipedia.org/wiki/Leteck%C3%A1_z%C3%A1kladna_Mountain_Home","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/366th_Fighter_Wing.png","page_title":"Letecká základna Mountain Home","context_page_description":"Letecká základna Mountain Home je vojenská letecká základna letectva Spojených států amerických, nacházející se ve státě Idaho, dvacet kilometrů jihozápadně od města Mountain Home, šedesát pět kilometrů jihovýchodně od města Boise. Od roku 1972 je domovskou základnou pro 366. stíhací křídlo s přezdívkou „Gunfighters“ spadající pod kontrolu Velitelství vzdušného boje. Hlavním úkolem základny je poskytovat vzdušnou bojovou podporu a v případně potřeby vybojovat vzdušnou nadvládu v návaznosti na probíhající boje v zahraničí. 366. stíhací křídlo je vybaveno víceúčelovýmí stíhacími letouny McDonnell Douglas F-15E Strike Eagle."},{"page_url":"https://pl.wikipedia.org/wiki/Starburst","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Starburst01.jpg","page_title":"Starburst","context_page_description":"Starburst – przenośny przeciwlotniczy zestaw rakietowy produkowany w Wielkiej Brytanii przez przedsiębiorstwo Thales Air Defence. Zestaw wywodzi się z systemu Javelin, którego jest rozwinięciem. Konstrukcja pocisku pozostała taka sama jak w zestawie Javelin, podstawową różnicą jest to, że naprowadzanie radiowe zastąpione zostało naprowadzaniem w wiązce lasera. Operator ma za zadanie utrzymywać cel na środku celownika zestawu, zestaw wysyła wiązkę laserową, na którą naprowadza się pocisk. System Starburst wszedł do służby w armii brytyjskiej w 1990 roku i wkrótce zastąpił zestaw Javelin w oddziałach. Po raz pierwszy został użyty bojowo podczas wojny w Zatoce Perskiej w 1991 roku."},{"page_url":"https://en.wikipedia.org/wiki/Substituted_cathinone","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/4-F-PPP_structure.png","page_title":"Substituted cathinone","context_page_description":"Substituted cathinones, which include some stimulants and entactogens, are derivatives of cathinone. They feature a phenethylamine core with an alkyl group attached to the alpha carbon, and a ketone group attached to the beta carbon, along with additional substitutions. Cathinone occurs naturally in the plant khat whose leaves are chewed as a recreational drug."},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A8ge_de_Hubant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Fondation_et_statuts_du_coll%C3%A8ge_de_Huban_ou_de_l%27Ave_Maria.jpg","page_title":"Collège de Hubant","context_page_description":"Le collège de Hubant, aussi appelé collège Ave Maria est un collège de l'ancienne université de Paris."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%D1%8A%D0%B5%D0%BA%D1%82%D0%BE%D0%B2_%D0%B2%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D1%8F_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%A7%D0%B5%D1%85%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Z%C3%A1mek_Litomy%C5%A1l_1.JPG","page_title":"Список объектов всемирного наследия ЮНЕСКО в Чехии","context_page_description":"В списке Всеми́рного насле́дия ЮНЕ́СКО в Че́шской Респу́блике значится 12 наименований, это составляет 1,1 % от общего числа. Все объекты включены в список по культурным критериям, причём 3 из них признаны шедеврами человеческого гения. Кроме этого, по состоянию на 2014 год, 18 объектов на территории Чехии находятся в числе кандидатов на включение в список всемирного наследия. Чешская Республика ратифицировала Конвенцию об охране всемирного культурного и природного наследия 26 марта 1993 года. Однако, первые три объекта, находящиеся на территории Чехии были занесены в список в 1992 году на 16-й сессии Комитета всемирного наследия ЮНЕСКО, когда страна еще являлась частью Чехословакии."},{"page_url":"https://ast.wikipedia.org/wiki/Idioma_%C3%ADberu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Mapa_lleng%C3%BCes_paleohisp%C3%A0niques-cast.jpg","page_title":"Idioma íberu","context_page_description":"El íberu o ibéricu yera una llingua paleohispánica prerromana falada polos íberos en tola mariña mediterránea peninsular. La so estensión diría dende'l ríu Hérault en Francia al norte hasta non más al sur de Porcuna, en Xaén.\\nDellos investigadores consideren l'íberu como una llingua franca que s'estendiera gracies al comerciu, aguiyonáu pol contautu colos griegos focenses, ente qu'otru investigadores consideren al íberu como la llingua materna d'un grupu y lingüísticamente homoxéneu."},{"page_url":"https://zh.wikipedia.org/zh-my/%E7%85%A5%E7%84%B6%E6%87%BF%E5%B1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/EResidence_after_Topping-out_in_December_2018.jpg","page_title":"煥然懿居","context_page_description":"焕然懿居，前称“马头围道／春田街发展项目”，是香港市区重建局的一个重建项目，位于九龙鹤园马头围道43至45J号、鹤园街6至8号及春田街1至23号单数楼宇，占地3,377平方米，涉及17幢楼宇、业权159个和770名居民。项目重建成2幢住宅大楼，提供约493伙。市建局在2018年12月31日公布“港人首置上车盘”价单，以市价六二折发售，2019年3月抽签、6月拣楼，2020年5月入伙。示范单位设于大角咀福全街奥柏·御峯商场，但参观者必须事先于网上预约。"},{"page_url":"https://eo.wikipedia.org/wiki/Naoki_Ishihara","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Naoki_Ishihara.jpg","page_title":"Naoki Ishihara","context_page_description":"Naoki Ishihara estas japana futbalisto.\\nLi futbalis ĉe Shonan Bellmare, Omiya Ardija, Sanfrecce Hiroshima, Urawa Reds kaj Vegalta Sendai."},{"page_url":"https://sk.wikipedia.org/wiki/Milovice_u_Ho%C5%99ic","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Milovice_-_kostel_Svat%C3%A9ho_Petra_a_Pavla.jpg","page_title":"Milovice u Hořic","context_page_description":"Milovice u Hořic sú obec v Česku v okrese Jičín v Královohradeckom kraji. 1. januára 2012 tu žilo 311 obyvateľov, z toho 152 mužov a 159 žien, pričom priemerný vek v obci bol 34,9 roka."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%81%E3%83%B3%E3%82%BF%E3%82%AA%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Tsintao_DB.jpg","page_title":"チンタオサウルス","context_page_description":"チンタオサウルス は中生代白亜紀後期カンパニアンからマーストリヒシアンに生息した、大型の鳥脚類恐竜。"},{"page_url":"https://nl.wikipedia.org/wiki/Neuf-Brisach","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Neuf-Brisach_151.jpg","page_title":"Neuf-Brisach","context_page_description":"Neuf-Brisach is een gemeente in het Franse departement Haut-Rhin en telt 1973 inwoners. De plaats maakt deel uit van het arrondissement Colmar. De oppervlakte van Neuf-Brisach bedraagt 1,3 km², de bevolkingsdichtheid is 1518 inwoners per km²."},{"page_url":"https://de.wikipedia.org/wiki/HipChat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Hipchat_Atlassian_logo.png","page_title":"HipChat","context_page_description":"HipChat war eine Software des australischen Softwareunternehmens Atlassian für Chats bzw. Instant Messaging für Unternehmen, die im Büro und auch mobil genutzt werden konnte. Zu den Funktionen gehörten beispielsweise sicher verschlüsselte Gruppenchats, Videochats oder auch Bildschirmübertragungen. Sie richtete sich an alle Unternehmen, unabhängig von ihrer Branche. Sie gehörte in den Bereich der kollaborativen Software."},{"page_url":"https://vi.wikipedia.org/wiki/Actias_luna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Actias_luna_5th_instar_3_sjh.JPG","page_title":"Actias luna","context_page_description":"Actias luna là một loài bướm đêm có cánh màu xanh đá vôi và thân trắng. Ấu trùng có màu xanh lá cây. Đây là loài bướm đêm Tân Bắc giới trong họ Saturniidae, phân họ Saturniinae. Loài bướm này được tìm thấy ở Bắc Mỹ, từ phía đông của Đại Bình nguyên ở Hoa Kỳ – Florida đến Maine, và từ Saskatchewan về phía đông qua trung tâm Quebec tới Nova Scotia ở Canada."},{"page_url":"https://nds.wikipedia.org/wiki/Henry_L%C3%BCders","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sculpture_Durchdringung_Jorge_La_Guardia_Berliner_Allee_Hanover_Germany_01.jpg","page_title":"Henry Lüders","context_page_description":"Henry Lüders weer en düütschen Politiker von de DVP.\\nLüders is 1884 in Hannover boren. He weer Slossermeester un harr en Slosseree in de Raiffeisenstraat in Hannover.\\nNadem de Afornte in’n Prüüßschen Landdag, Heinrich Oetjen, an’n 25. Oktober 1927 doodbleven is, is Lüders an’n 8. November 1927 för Oetjen narückt. He is bet to de nächste Wahl 1928 Afornten bleven.\\nNa sien Dood is sien Vermögen an en Stiftung gahn. Düsse Lüders-Stiftung hett ünner annern en Reeg Kunstwarken in Hannover opstellen laten.\\n1982 hett em to Ehren de Driftstraat in Hannover den ne’en Naam Henry-Lüders-Straat kregen."},{"page_url":"https://es.wikipedia.org/wiki/Comit%C3%A9_Clandestino_Revolucionario_de_los_Pobres-Comando_Justiciero_28_de_Junio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/GMX_horizontal_-_SEDENA.png","page_title":"Comité Clandestino Revolucionario de los Pobres-Comando Justiciero 28 de Junio","context_page_description":"El Comité Clandestino Revolucionario de los Pobres-Comando Justiciero 28 de Junio o más conocido como CJ28 es un grupo guerrillero fundado en julio de 1998 en el estado de Guerrero.​​ Este grupo toma como inspiración al comandante Lucio Cabañas Barrientos, para según \\"seguir combatiendo al aparato represor y asesino del Estado burgués\\" y \\"aplicar justicia revolucionaria contra los delatores, traidores, torturadores, asaltantes y violadores, y todos los autores intelectuales y materiales de todas la masacres\\".​​​"},{"page_url":"https://pl.wikipedia.org/wiki/Sandy_M%C3%B6lling","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Sandy-Moelling.jpg","page_title":"Sandy Mölling","context_page_description":"Sandy Mölling – niemiecka prezenterka, tancerka, aktorka i wokalistka popularnego zespołu No Angels, powstałego w programie „Popstars”. Zespół stał się najbardziej utytułowanym niemieckim girlsbandem na świecie. Po rozpadzie zespołu w 2003 roku rozpoczęła karierę solową wydając 2 albumy. Odniosła największy sukces solowy spośród wszystkich „aniołków”. W 2005 roku była nominowana do nagród „ECHO Awards” w kategorii „Best Female National”. W 2007 roku za namową Lucy reaktywowała zespół No Angels wydając album „Destiny”. Po spekulacjach telewizji RTL, 19 listopada Sandy oświadczyła iż spodziewa się dziecka. Pod koniec marca urodziła syna Jaydena. W 2014 roku zespół No Angels definitywnie zakończył działalność."},{"page_url":"https://ca.wikipedia.org/wiki/Pagothenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Pagothenia_brachysoma.jpg","page_title":"Pagothenia","context_page_description":"Pagothenia és un gènere de peixos pertanyent a la família dels nototènids."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D0%B4%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Tabula_Traiana.jpg","page_title":"Кладово","context_page_description":"Кладово — город на востоке Сербии, административный центр общины Кладово в Борском округе.\\nГород расположен на правом берегу Дуная, на противоположном берегу — румынский город Дробета-Турну-Северин. Неподалёку, во II—IV вв., существовал один из крупнейших мостов античности — мост Траяна, соединявший местность близ нынешнего Кладова и древнюю Дробету. В окрестностях города, выше по течению Дуная, у сужения его русла «Железные ворота» расположен национальный парк Джердап и гидроэлектростанция Джердап I.\\nГород дал название неудачной попытке большой группы евреев покинуть Европу в 1939 году."},{"page_url":"https://ceb.wikipedia.org/wiki/Uzhgorodskiy_Raion","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Uzhgorodskyi-Raion.png","page_title":"Uzhgorodskiy Raion","context_page_description":"Rayon ang Uzhgorodskiy Raion sa Okraniya. Nahimutang ni sa lalawigan sa Zakarpattia Oblast, sa kasadpang bahin sa nasod, 600 km sa kasadpan sa Kiev ang ulohan sa nasod. Adunay 75,000 ka molupyo. Naglangkob kin og 870 ka kilometro kwadrado.\\nAng yuta sa Uzhgorodskiy Raion kay patag sa habagatang-kasadpan, apan sa amihang-sidlakan nga kini mao ang kabungtoran.\\nMga lungsod sa Uzhgorodskiy Raion:\\nUzhhorod\\nAng klima klima sa kontinente. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 23 °C, ug ang kinabugnawan Enero, sa -5 °C. Ang kasarangang pag-ulan 970 milimetro matag tuig. Ang kinabasaan nga bulan Pebrero, sa 108 milimetro nga ulan, ug ang kinaugahan Abril, sa 58 milimetro."},{"page_url":"https://fi.wikipedia.org/wiki/Kurd_La%C3%9Fwitz_-palkinto","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Elstercon3.jpg","page_title":"Kurd Laßwitz -palkinto","context_page_description":"Kurd Laßwitz -palkinto on palkinto saksankieliselle tieteiskirjallisuudelle. Palkinto on perustettu vuonna 1980. Vuodesta 1984 lähtien palkinnolle on ollut myös ulkomaisen romaanin kategoria."},{"page_url":"https://ro.wikipedia.org/wiki/Nantes-en-Ratier","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Nantes-en-Rattier.jpg","page_title":"Nantes-en-Ratier","context_page_description":"Nantes-en-Ratier este o comună în departamentul Isère din sud-estul Franței. În 2009 avea o populație de 811 de locuitori."},{"page_url":"https://es.wikipedia.org/wiki/Mercedes-Benz_O_371","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/100_5904.JPG","page_title":"Mercedes-Benz O 371","context_page_description":"El Mercedes-Benz O 371 es un modelo de autobús de pasajeros diseñado y construido en Brasil desde 1983 hasta 1996, bajo licencia alemana de Mercedes-Benz. Reeemplazo del Mercedes-Benz O 303 en América del Sur, donde fue ampliamente usado. Su sucesor es el O 400.\\nCuenta con tres versiones primarias: R, RS y RSD; y dos secundarias: RSL y RSE."},{"page_url":"https://fi.wikipedia.org/wiki/Lunohod_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Lunokhod-2_model%2C_detail.jpg","page_title":"Lunohod 2","context_page_description":"Lunohod 2 oli Neuvostoliiton toinen kuukulkija. Se laukaistiin Luna 21 -luotaimen kanssa Mare Serenitatisiin eli Kirkkauden mereen Lunohod 1:n jälkeen tammikuussa 1973. Laukaisu tapahtui 8. tammikuuta 1973 ja Kuuhun laskeutuminen 15. tammikuuta 1973.\\nLunohod 2 oli 135 cm korkea, ja sen massa oli 840 kg. Sen pituus oli 170 cm ja leveys 160 cm. Sen kussakin kahdeksassa pyörässä oli itsenäinen jousitus, oma moottori ja jarru. Kuukulkijalla oli kaksi nopeusaluetta: n. 1 km/h ja n. 2 km/h.\\nLunohod 2:ssa oli kolme televisiokameraa, joista yksi oli sijoitettu korkealle suunnistusta varten ja pystyi ottamaan korkealaatuisia kuvia 3,2, 5,7, 10,9 ja 21,1 sekunnin valotusajoilla. Näitä kuvia tutki Maassa oleva viisihenkinen ohjaustiimi, joka lähetti kuukulkijaan komentoja reaaliajassa. Energialähteenä oli aurinkopaneeli. Radioaktiivisen polonium-210-isotoopin lämpöä käytettiin kuukulkijan lämmittämiseen Kuun pitkän yön aikana. Kuukulkijassa oli neljä panoraamakameraa."},{"page_url":"https://it.wikipedia.org/wiki/Governo_Soult_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Soult2.jpg","page_title":"Governo Soult II","context_page_description":"Il Governo Soult II è stato un governo francese durante la monarchia di luglio, in carica dal 12 maggio 1839 al 20 febbraio 1840, per un totale di 9 mesi e 9 giorni."},{"page_url":"https://fr.wikipedia.org/wiki/Percy_Cox","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Percy_Cox_1916.JPG","page_title":"Percy Cox","context_page_description":"Le major-général Sir Percy Zachariah Cox est un officier de l'armée indienne britannique et administrateur du bureau des colonies au Moyen-Orient. Il est l'une des figures majeures de la création du Moyen-Orient actuel. Il est né le 20 novembre 1864 et il est mort le 20 février 1937."},{"page_url":"https://en.wikipedia.org/wiki/Blonay%E2%80%93Chamby_museum_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Blonay-Chamby_Compagnie_Genevoise_de_Tramways_Electriques_-_370_-_01.jpg","page_title":"Blonay–Chamby museum railway","context_page_description":"The Blonay–Chamby museum railway is a short 3-kilometre-long steep but adhesion worked metre gauge heritage railway operated as part of the Blonay - Chamby Railway Museum using vintage steam and electric locomotives and rolling stock. It is rail-connected at both ends, at its upper terminus, at Chamby with the Chemin de Fer Montreux Oberland Bernoise and at the lower end, Blonay, with the Vevey - Les Pleiades, Chemin de fer électriques Veveysans, line."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E6%B3%95%E5%AE%9A%E5%8F%A4%E8%B9%9F%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/MaryknollConventSchool_1.jpg","page_title":"香港法定古蹟列表","context_page_description":"香港的法定古蹟是指受到香港法例第53章《古物及古蹟條例》所保護的歷史建築、以及考古或古生物地點與構築物。古物事務監督經諮詢古物諮詢委員會，並經香港特別行政區行政長官批准後，可刊憲公告宣布個別地方、建築物、地點或構築物為法定古蹟。\\n截至2020年5月22日，全香港共有126項法定古蹟，其中53項位於香港島、13項位於九龍、60項位於新界、9項位於離島。"},{"page_url":"https://sv.wikipedia.org/wiki/Leptomyrmex_flavitarsus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Leptomyrmex_flavitarsus_casent0127180_head_2.jpg","page_title":"Leptomyrmex flavitarsus","context_page_description":"Leptomyrmex flavitarsus är en myrart som först beskrevs av Smith 1859. Leptomyrmex flavitarsus ingår i släktet Leptomyrmex och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Louis_Bl%C3%A9riot","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Bleriot_et_son_a%C3%A9roplage_2_%28%C3%A9t%C3%A9_1911_%C3%A0_Hardelot%29.jpg","page_title":"Louis Blériot","context_page_description":"Louis Charles Joseph Blériot, né le 1ᵉʳ juillet 1872 à Cambrai et mort le 1ᵉʳ août 1936 à Paris, est un constructeur de lanternes d'automobiles, d'avions, de motocyclettes et de chars à voile, et un pilote précurseur et pionnier de l'aviation française.\\nIngénieur de l'École centrale Paris, il a déposé plus de 100 brevets d'invention, dont celle du manche à balai ou « cloche Blériot » en 1907, dont la paternité est revenue finalement à Robert Esnault-Pelterie en 1919.\\nIl a volé pour la première fois en 1907 dans un avion de sa conception. En 1909, il obtient le brevet de pilote nᵒ 1 délivré en France.\\nEntre 1905 et 1909 il a produit 11 prototypes dont le fameux Blériot XI avec lequel il fut le premier à traverser la Manche en avion le 25 juillet 1909."},{"page_url":"https://en.wikipedia.org/wiki/Quaternary_glaciation","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Phanerozoic_Climate_Change.png","page_title":"Quaternary glaciation","context_page_description":"The Quaternary glaciation, also known as the Pleistocene glaciation, is an alternating series of glacial and interglacial periods during the Quaternary period that began 2.58 Ma, and is ongoing. Although geologists describe the entire time period as an \\"ice age\\", in popular culture the term \\"ice age\\" is usually associated with just the most recent glacial period during the Pleistocene. Since the planet Earth still has ice sheets, geologists consider the Quaternary glaciation to be ongoing, with the Earth now experiencing an interglacial period.\\nDuring the Quaternary glaciation, ice sheets appeared. During glacial periods they expanded, and during interglacial periods they contracted. Since the end of the last glacial period the only surviving ice sheets are the Antarctic and Greenland ice sheets. Other ice sheets, such as the Laurentide Ice Sheet, formed during glacial periods and completely disappeared during interglacials."},{"page_url":"https://en.wikipedia.org/wiki/Kees_Verschuren","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Rotterdamse_haven.jpg","page_title":"Kees Verschuren","context_page_description":"Henricus Petrus Cornelis Verschuren is a Dutch sculptor, painter and former lecturer at the Willem de Kooning Academie in Rotterdam, known for his monumentalist sculptures in public places in the Netherlands."},{"page_url":"https://en.wikipedia.org/wiki/Bocce","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Bochas_oliver_family.jpg","page_title":"Bocce","context_page_description":"Bocce, sometimes anglicized as bocce ball, bocci or boccie, is a ball sport belonging to the boules family, closely related to British bowls and French pétanque, with a common ancestry from ancient games played in the Roman Empire. Developed into its present form in Italy, bocce is played around Europe and also in other areas with Italian immigrants, including Australia, North America, and South America. Initially played only by the Italian immigrants, the game has slowly become more popular with their descendants and more broadly."},{"page_url":"https://nl.wikipedia.org/wiki/Bazel_(Zwitserland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Nuremberg_chronicles_-_BASILEA.png","page_title":"Bazel (Zwitserland)","context_page_description":"Bazel of Basel is een stad in het noordwesten van Zwitserland, op het drielandenpunt met Frankrijk en Duitsland. De stad ligt aan de Rijn, de Birs komt in Bazel in de Rijn uit.\\nBazel telt ruim 175.000 inwoners, waarmee het naar inwonertal de derde stad van Zwitserland is. De hele agglomeratie, die ook de Franse stad Saint-Louis en de Duitse steden Weil am Rhein en Lörrach omvat, telt ongeveer 830.000 inwoners. De stad Bazel beslaat vrijwel geheel het kanton Basel-Stadt. In het oosten van het stadskanton liggen, op circa 450 meter hoogte, de meer landelijke gemeenten Riehen en Bettingen. De officieel gesproken taal is het Duits. In Bazel wordt echter voornamelijk Bazelduits gesproken, het enige Nederalemannische dialect dat in Zwitserland wordt gesproken, en dat voor Nederlandstaligen moeilijk verstaanbaar is.\\nBazel is een belangrijk cultureel centrum binnen Zwitserland. Ook is het hoofdkantoor van de Bank for International Settlements hier gevestigd en is er een grote farmaceutische industrie."},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_de_Cluny","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Ibn_Butlan_Receuil_de_Sante_Rhenanie_2nd_half_15th_century.jpg","page_title":"Musée de Cluny","context_page_description":"Le musée de Cluny, de son nom officiel Musée national du Moyen Âge - Thermes et hôtel de Cluny, est situé dans le 5ᵉ arrondissement de Paris, au cœur du Quartier latin, dans un hôtel particulier du XIIIᵉ siècle : l'hôtel de Cluny. Il possède l'une des plus importantes collections mondiales d'objets et d'œuvres d'art de l'époque médiévale et les thermes de Cluny, qui y sont contigus, en font également partie."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%AC%E0%A4%BE%E0%A4%B2%E0%A5%80_(%E0%A4%87%E0%A4%A8%E0%A5%8D%E0%A4%A1%E0%A5%8B%E0%A4%A8%E0%A5%87%E0%A4%B8%E0%A4%BF%E0%A4%AF%E0%A4%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/GarudaWisnuKencana_head.jpg","page_title":"बाली (इन्डोनेसिया)","context_page_description":"बाली इन्डोनेसियामा अवस्थित एक टापु तथा प्रदेश हो। बाली प्रदेशमा बाली टापु तथा नजिकैका अन्य नुसा पेनिदा, नुसा लेम्बोङान र नुसा चेनिङान जस्ता साना टापुहरू पनि समाहित छन्। यो टापु सुन्दा टापुसमूहको तल्लो भागमा सबैभन्दा पश्चिमी छेउमा रहेको छ। बालीको पश्चिममा जाभा टापु र पूर्वमा लोम्बक टापु रहेका छन्। यसको राजधानी सहर देन्पासर टापुको दक्षिणमा रहेको छ।\\nइन्डोनेसियाली हिन्दू अल्पसङ्ख्यकहरूको बाहुल्यता रहेको बालीमा सन् २०१० मा गरिएको जनगणना अनुसार ३८ लाख ९० हजार सात सय सन्ताउन्न मानिसहरू बसोबास गर्दथे। सन् २०१४ को जनवरीमा यहाँको जनसङ्ख्या करीब ४२ लाख २५ हजार पुगेको अनुमान गरिएको थियो। सन् २०१० को जनसङ्ख्याका अनुसार बालीमा कुल जनसङ्ख्याको ८३.५ प्रतिशत बालेलीहरूले हिन्दू धर्म अबलम्बन गरेको पाइएको थियो भने १३.४ प्रतिशतले मुस्लिम, २.५ प्रतिशतले क्रिस्चियन र ०.५ प्रतिशतले बौद्ध धर्म अबलम्बन गरेका थिए।\\nबाली एउटा प्रख्यात पर्यटकीय गन्तब्यको टापु हो। सन् १९८० को दशकदेखि पर्यटकहरूको सङ्ख्यामा उल्लेखनीय मात्रामा बृद्धि भएको पाइन्छ। यहाँको करीब ८० प्रतिशत ब्यापार व्यवसाय पर्यटनसँग सम्बन्धित रहेको छ। यो टापु परम्परागत तथा आधुनिक नृत्य, मूर्तिकला, चित्रकला, छाला तथा धातुका सामग्रीहरू तथा सङ्गीत जस्ता उच्चकोटीका कला तथा कला सामग्रीहरूका लागि प्रख्यात छ।"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B0%D1%80%D1%82%D0%B0%D1%80_%D1%81%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Tatarsk%C3%A1_om%C3%A1%C4%8Dka.jpg","page_title":"Тартар сос","context_page_description":"Тартар сос је сос француског порекла, чији су главни састојци мајонез и ситно исецкан капар. Осим тога, у тартар сос се често додају и кисели краставци, лимунов сок као и биље попут мирођије и першуна.\\nНајчешће се користи као додатак морским плодовима као што су: шкољке, острига, рибљи ћевапи, рибљи сендвичи итд. Неретко се користи и као прилог бифтеку, који се у комбинацији са сосом назива тартарски бифтек."},{"page_url":"https://lv.wikipedia.org/wiki/Ventava","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/G_135%2C_Sjonhem.JPG","page_title":"Ventava","context_page_description":"Ventava bija senās Kursas zeme Ventas upes lejtecē no Abavas ietekas uz leju līdz pat jūrai. Tā robežojās ar Vanemas zemi austrumos un Bandavas zemi dienvidos. Tagad tās teritorijā daļēji atrodas Ventspils novads, kā arī neliela daļa no Kuldīgas novada. Līdz 1230. gadam Ventava bija Kursas valdnieka Lamekina valsts sastāvā ar nosaukumu \\"Sagares zeme\\"."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BD%D0%B4%D1%8B%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Convallaria_majalis_range.png","page_title":"Ландыш","context_page_description":"Ла́ндыш — монотипный либо олиготипный род однодольных растений семейства Спаржевые.\\nКак правило, считается монотипным родом с единственным видом Ландыш майский. Впрочем, в некоторых таксономических классификациях выделяются два других вида — ландыш Кейзке и ландыш горный.\\nРанее род включали в семейство Лилейные или выделяли в отдельное семейство Ландышевые; в классификации APG II род был включён в семейство Иглицевые. По состоянию на 2013 год в большинстве международных баз данных род Ландыш входит в состав семейства Спаржевые."},{"page_url":"https://fr.wikipedia.org/wiki/Bolinder-Munktell","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Carl_Gerhard_Bolinder.JPG","page_title":"Bolinder-Munktell","context_page_description":"Bolinder-Munktell est une ancienne société suédoise de construction de tracteurs agricoles, de moissonneuse-batteuse, de machines forestières, d'engins de génie civil et de véhicule chenillé en caoutchouc. Elle a été formée en 1932 par la fusion des entreprises Munktell et Bolinder, son motoriste. Elle était basée à Eskilstuna. Son abréviation est communément BM. L'entreprise a fusionné avec Volvo en 1950."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%B3mulo_Betancourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Betancourt%2C_Gabald%C3%B3n_M%C3%A1rquez_and_Villalba.jpg","page_title":"Rómulo Betancourt","context_page_description":"Rómulo Ernesto Betancourt Bello fue un político y periodista venezolano. Presidente de Venezuela interino entre 1945 y 1948, y constitucional entre 1959 y 1964.\\nRómulo Betancourt es reconocido como uno de los más importantes políticos venezolanos del siglo XX. Su participación dentro de la política venezolana comenzó en 1927/8. Como líder estudiantil, dirigió conjuntamente con otros destacados jóvenes de la época, la primera manifestación popular en contra de la dictadura de Juan Vicente Gómez. Betancourt fue uno de los más conocidos opositores clandestinos al gomecismo, condición que le costó el destierro del país hasta la muerte del dictador. Entre 1931 y 1935 fue miembro del Buró Político del Partido Comunista Costarricense. Posteriormente fue expulsado durante los gobiernos de Eleazar López Contreras y por los Gobiernos militares que tomaron el poder desde 1949 hasta 1958.\\nEn 1941 fundó junto a otros destacados líderes de la izquierda política venezolana, el partido Acción Democrática que pronto se convirtió en el primer partido político del país en lo que resta de siglo."},{"page_url":"https://en.wikipedia.org/wiki/Morris_Canal","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Inclined_Plane_12_East_on_Morris_Canal_from_HABS.png","page_title":"Morris Canal","context_page_description":"The Morris Canal was a 107-mile common carrier coal canal across northern New Jersey in the United States that connected the two industrial canals at Easton, Pennsylvania, across the Delaware River from its western terminus at Phillipsburg, New Jersey, to New York Harbor and the New York City markets via its eastern terminals in Newark and on the Hudson River in Jersey City, New Jersey.\\nWith a total elevation change of more than 900 feet, the canal was considered an ingenious technological marvel for its use of water-driven inclined planes, the first in the United States, to cross the northern New Jersey hills.\\nIt was built primarily to move coal to industrializing eastern cities that had stripped their environs of wood. Completed to Newark in 1831, the canal was extended eastward to Jersey City between 1834 and 1836. In 1839, hot blast technology was married to blast furnaces fired entirely using anthracite, allowing the continuous high-volume production of plentiful anthracite pig iron."},{"page_url":"https://oc.wikipedia.org/wiki/Vernoy","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Vernoy.JPG","page_title":"Vernoy","context_page_description":"Vernoy es una comuna francesa, situada dins lo departament d'Yonne e la region de Borgonha."},{"page_url":"https://hu.wikipedia.org/wiki/Raiatea","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Joshua_Reynolds_-_Portrait_of_Omai.jpg","page_title":"Raiatea","context_page_description":"Raiatea a Társaság-szigetcsoporthoz tartozó Szélcsendes szigetcsoport legnagyobb szigete, 315 km-re Tahititól.\\nRaiateát sokan az ősi Polinézia központi szigeteként tartják számon és valószínűsíthető, hogy innen indult Hawaii, Aotearoa és más kelet-polinéziai szigetek benépesítése. A szigetet egyes hagyományok szerint Havai'i-nak is nevezték.\\nA sziget délkeleti partján található a történelmi jelentőségű vallási helyszín, Taputapuatea marae, amelyet i.sz. 1000 környékén építettek.\\nRaiatea legfőbb települése Uturoa, amely a Szélcsendes szigetcsoport. A településen középiskolák is vannak, amelyet több szigetről is látogatnak diákok."},{"page_url":"https://de.wikipedia.org/wiki/Patrick_Blanc","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/CaixaForumMadridyJardinVertical.jpg","page_title":"Patrick Blanc","context_page_description":"Patrick Blanc ist ein französischer Botaniker, der bis 2014 am CNRS arbeitete, und ein international bekannter Gartenarchitekt und -künstler. Blanc wurde durch seine „Pflanzenwände“ bekannt, senkrechte Beete, auf denen er dem jeweiligen Lokalklima angepasste Pflanzen wachsen lässt. Die Erfindung von begrünten Wänden geht zurück auf ein Patent im Jahr 1938 von Professor Stanley Hart White an der University of Illinois, Urbana-Champaign, Blanc modernisierte das Verfahren und machte es weltweit bekannt."},{"page_url":"https://la.wikipedia.org/wiki/Notitia_Dignitatum","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Notitia_dignitatum_-_insignia_comitis_largitionum.jpg","page_title":"Notitia Dignitatum","context_page_description":"Notitia Dignitatum est documentum Imperii Romani saeculi V p.C.n. quod fastos magistratuum provinciarum indicesque copiarum et aedificiorum publicorum habet. Hoc modo incipit, itaque nomen documenti:\\nNotitia dignitatum omnium tam civilium quam militarium utriusque imperii occidentis orientisque.\\nTextus Notitiae Imperium Occidentale anni 420 describit, Imperium Orientale anni 400."},{"page_url":"https://pt.wikipedia.org/wiki/Buja%C4%8Di%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Buja%C4%8Di%C4%87_-_op%C5%A1tina_Valjevo_-_zapadna_Srbija_-_panorama_17.jpg","page_title":"Bujačić","context_page_description":"Bujačić é uma vila da Sérvia localizada no município de Valjevo, pertencente ao distrito de Kolubara. A sua população era de 422 habitantes segundo o censo de 2011."},{"page_url":"https://ia.wikipedia.org/wiki/Moses_Housepian","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Dr_Moses_Housepian%2C_1916.jpg","page_title":"Moses Housepian","context_page_description":"Dr. Moses Minas Housepian era un medico armenie-statounitese qui faceva un mission medical humanitari a Armenia russe in 1916, ubi ille dava assistentia medical al refugiatos del genocidio armenie in un epidemia de typho tanto effectivemente que ille era appellate per multe de su patientes Dr. Purgich, significante \\"Dr. Salvator\\" in armenio.\\"\\nDr Housepian era active in le partito Liberal Democratic Armenie, cuje capitulo in le Citate de Nove York era postumemente appellate in su honor.\\nPost su morte su sposa, Makrouhie Housepian, era durante multe annos un membro del Concilio del Union General Armenie de Benevolentia. Moses e Makrouhie Housepian era le parentes de Marjorie Housepian Dobkin e Edgar Housepian."},{"page_url":"https://sw.wikipedia.org/wiki/Ohio_(mto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Rising-sun-indiana-ohio-river--from-above.jpg","page_title":"Ohio (mto)","context_page_description":"Mto Ohio ni tawimto muhimu wa mto Mississippi katika mashariki ya Marekani.\\nUrefu wake ni kilomita 1,579 kuanzia chanzo chake kwenye maungano ya mto Allegheny na mto Monongahela karibu na mji wa Pittsburgh hadi mdomo kwenye mto Mississippi. Njia ya mto ni mpaka kati ya majimbo sita ya Marekani na beseni yake inajumlihsa eneo la majimbo 14. Tawimto kubwa ya kuingia ni mto Tenessee.\\nKatika historia ya Marekani ilikuwa njia muhimu ya mawasiliano kabla ya kujengwa kwa barabara na reli. Wakati wa karne ya 19 Ohio ilikuwa mpaka kati ya maeneo yaliyoruhusu utumwa na majimbo yaliyokataa utumwa.\\nMto huu umepakana na majimbo ya Ohio, Kentucky, Illinois, Indiana, West Virginia na Pennsylvania. Miji muhimu kando la mto ni Louisville, Kentucky, Paducah, Kentucky, Cincinnati, Ohio na Pittsburgh, Pennsylvania."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%AA%D9%8A%D9%81_%D8%B3%D8%AA%D9%8A%D9%81%D9%84%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Seann_William_Scott_at_the_Austin_Film_Festival_promoting_Role_Models_in_October_2008.jpg","page_title":"ستيف ستيفلر","context_page_description":"ستيف ستيفلر ‏ هو الشخصية الرئيسية في سلسلة أفلام أميريكان باي ‏.\\nويلعب دور الشغصية الممثل شون ويليام سكوت وأول ضهور للشخصية كان في أول أجزاء الفيلم أميريكان باي."},{"page_url":"https://en.wikipedia.org/wiki/List_of_MPs_elected_in_the_2017_United_Kingdom_general_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Official_portrait_of_Angus_Brendan_MacNeil_crop_2.jpg","page_title":"List of MPs elected in the 2017 United Kingdom general election","context_page_description":"The fifty-seventh Parliament of the United Kingdom was the legislature following the 2017 general election of Members of Parliament to the House of Commons of the United Kingdom. Parliament consists of the House of Lords and the elected House of Commons. Each of Parliament's 650 constituencies returned one Member of Parliament to the House of Commons. In the 2017 general election a record number of women were elected as MPs.\\nThe State Opening of Parliament at the Palace of Westminster by Queen Elizabeth II was on 21 June 2017. The subsequent parliamentary session was the longest since the formation of the United Kingdom in 1707, and the longest to sit at Westminster since the Long Parliament in the 17th century. The second and last parliamentary session however was the shortest since October 1948, lasting less than a month, from 14 October 2019 until Parliament dissolved at 00:01 on 6 November 2019.\\nIt was marked by unprecedented political turmoil as Governments led by both Theresa May and Boris Johnson were unable to win a series of important votes on the issue of Brexit."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%82%D9%88%D9%82_%D8%A7%D9%84%D8%A5%D9%86%D8%B3%D8%A7%D9%86_%D9%81%D9%8A_%D8%A7%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Map_of_judicial_corporal_punishment.svg","page_title":"حقوق الإنسان في السعودية","context_page_description":"تستند حقوق الإنسان في المملكة العربية السعودية إلى تفسيرات المذهب الحنبلي في الشريعة الإسلامية. الحكم في السعودية قائم على مبادئ العدل والمساواة وتعمل السعودية حاليًا على مراجعة الاستراتيجية الوطنية لحقوق الإنسان في المملكة وخطتها التنفيذية التي ترتكز على ستة محاور رئيسة ينبثق منها أكثر من 100 مبادرة تشمل جميع مجالات حقوق الإنسان. وتتضمن رؤية المملكة 2030 العديد من مجالات حقوق الإنسان، كالحق في الحياة، والحق في الأمن، والحق في الصحة، والحق في التربية والتعليم والتدريب والحق في العمل وحماية الأسرة وتمكين المرأة، وتعزيز المشاركة في الحياة السياسية والعامة وغيرها.\\nويتم تنفيذ عقوبة الإعدام على جرائم محددة. المظاهرات والاحتجاجات ممنوعة بشكل تام ومنذ الاحتجاجات والتظاهرات بين عامي 2011 و2013 أصبح إعلان أو توجيه أي شكل من أشكال المعارضة أو النقد بحق المسؤولين السياسيين أو رجال الدين في السعودية أو جريمة. وتتعرض الحكومة السعودية لانتقادات تتعلق باضطهاد الأقليات الدينية والعرقية والنساء. وتنفي المملكة وقوع أي انتهاكات تتعلق بحقوق الإنسان رغم قيام مجموعات مختصة بحقوق الإنسان مثل منظمة العفو الدولية وهيومن رايتس ووتش والجمعية الوطنية لحقوق الإنسان بالسعودية مرات عديدة بالتعبير عن قلقها على وضع حقوق الإنسان في البلاد."},{"page_url":"https://hu.wikipedia.org/wiki/Szent_Luk%C3%A1cs_gy%C3%B3gyf%C3%BCrd%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Szent_Luk%C3%A1cs_gy%C3%B3gyf%C3%BCrd%C5%91_kert_eml%C3%A9kpadok.JPG","page_title":"Szent Lukács gyógyfürdő","context_page_description":"A Szent Lukács gyógyfürdő Budapest egyik legrégebbi gyógyfürdője."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%94%D5%A5%D5%A9%D6%80%D5%AB%D5%B6_%D5%80%D5%A5%D6%83%D5%A2%D5%A8%D6%80%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Katharine_Hepburn_promo_pic.jpg","page_title":"Քեթրին Հեփբըրն","context_page_description":"Քեթրին Հեփբըրն, ամերիկացի դերասանուհի, 12 անգամ ներկայացվել է Օսկարի և արժանացել 4 Օսկարի Օսկար լավագույն դերասանուհու համար անվանակարգում, ինչը կինոյի պատմության մեջ ռեկորդ է, դերասան-դերասանուհիներից ամենաշատը հենց նա է ստացել Օսկար մրցանակ։\\nԱմերիկյան կինոակադեմիան իր կողմից հրապարակած Ամերիկյան բոլոր ժամանակների ֆիլմերի 100 մեծագույն աստղերի ցանկում նրան ընդգրկել է պատվավոր 1 տեղում։"},{"page_url":"https://eu.wikipedia.org/wiki/Id_Kah_meskita","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Id_Kah_Mosque_Kashgar_Xinjiang_China_%E6%96%B0%E7%96%86_%E5%96%80%E4%BB%80_%E5%96%80%E4%BB%80%E6%B8%85%E7%9C%9F%E5%AF%BA_-_panoramio_%284%29.jpg","page_title":"Id Kah meskita","context_page_description":"Id Kah meskita, Kashgar hirian dagoen meskita da, Txinan dagoen handiena. Egunero 10.000 fededun hartzen ditu baina 20.000-rentzako tokia du."},{"page_url":"https://az.wikipedia.org/wiki/Va%C4%9Fc%C4%B1q","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Cattle_Egret_%28Bubulcus_ibis%29_-walking_in_grass3.jpg","page_title":"Vağcıq","context_page_description":"Vağcıq, Misir vağı — vağlar fəsiləsinə aid heyvan cinsi."},{"page_url":"https://eo.wikipedia.org/wiki/C%C3%A9cile_Tormay","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Tormay_C%C3%A9cile_eml%C3%A9kt%C3%A1bla%2C_Bp.%2C_K%C5%91farag%C3%B3_utca_3.jpg","page_title":"Cécile Tormay","context_page_description":"Cécile Tormay [sEsil tormai], laŭ hungarlingve kutima sinsekvo Tormay Cécile estis hungara verkisto, tradukisto. Ŝia nobela antaŭnomo estis nádudvari. Ŝia patro estis Béla Tormay, ŝia avo estis Károly Tormay.\\nCécile Tormay naskiĝis la 8-an de oktobro 1875 en Budapeŝto. Ŝi mortis la 2-an de aprilo 1937 en Mátraháza."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%96%AF%E6%B4%9B%E4%BC%90%E5%85%8B%E6%80%BB%E7%BB%9F%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Andrej_Kiska_in_Senate_of_Poland.jpg","page_title":"斯洛伐克总统列表","context_page_description":"斯洛伐克總統是斯洛伐克的國家元首，任期五年，由公民直選產生。以下為斯洛伐克總統列表。"},{"page_url":"https://fr.wikipedia.org/wiki/Mara%C3%AEchage","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/March%C3%A9_boulevard_de_Reuilly_septembre_2018_7.jpg","page_title":"Maraîchage","context_page_description":"Le maraîchage, ou horticulture maraîchère ou agriculture maraîchère est la culture de végétaux à usage alimentaire, de manière professionnelle, c'est-à-dire dans le but d'en faire un profit ou simplement d'en vivre, ce qui le distingue du jardinage."},{"page_url":"https://de.wikipedia.org/wiki/Edvards_Pavlovskis","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Coat_of_arms_of_Edvards_Pavlovskis.svg","page_title":"Edvards Pavlovskis","context_page_description":"Edvards Pavlovskis ist Bischof von Jelgava."},{"page_url":"https://sv.wikipedia.org/wiki/Rhododendron_spinuliferum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Rhododendron_spinuliferum_137-8408.jpg","page_title":"Rhododendron spinuliferum","context_page_description":"Rhododendron spinuliferum är en ljungväxtart som beskrevs av Adrien René Franchet. Rhododendron spinuliferum ingår i släktet rododendron, och familjen ljungväxter. Utöver nominatformen finns också underarten R. s. glabrescens."},{"page_url":"https://en.wikipedia.org/wiki/Rupert,_Count_Palatine_of_Veldenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Rupprecht_von_Pfalz-Veldenz.jpg","page_title":"Rupert, Count Palatine of Veldenz","context_page_description":"Rupert was the Duke of Veldenz from 1543 until 1544."},{"page_url":"https://de.wikipedia.org/wiki/%C3%96sterreichische_Alpine_Skimeisterschaften_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Bernhard_Graf_Austrian_Championships_2009.jpg","page_title":"Österreichische Alpine Skimeisterschaften 2013","context_page_description":"Die Österreichischen Alpinen Skimeisterschaften 2013 fanden von 20. März bis 8. April im Tiroler Pitztal statt. Ursprünglich sollten sämtliche Rennen am Pitztaler Gletscher stattfinden, prognostizierte Neuschneemengen zwangen die Veranstalter jedoch, die Technikrennen und Super-G nach Jerzens zu verlegen. Die Super-Kombinationen konnten wie bereits im Vorjahr nicht stattfinden. Die Rennen waren zumeist international besetzt, um die Österreichische Meisterschaft fuhren jedoch nur die österreichischen Teilnehmer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I_%D0%94%D0%BE%D0%B1%D1%80%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Alexandru_cel_Bun.jpg","page_title":"Александр I Добрый","context_page_description":"Алекса́ндр I До́брый — молдавский господарь, правитель Молдавского княжества в период 1400—1432 годов. Из династии Мушатинов.\\nОбъявил себя Господарём 23-го апреля 1399-го года. Первый документ от его имени, в статусе господаря, датируется 29 июня 1400 года. До 1408 года правил совместно со своим братом жупаном Богданом."},{"page_url":"https://eu.wikipedia.org/wiki/Ass%C3%A9-le-Boisne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/FrancePaysDeLaLoireAsseLeBoisneEglise.jpg","page_title":"Assé-le-Boisne","context_page_description":"Assé-le-Boisne Frantziako udalerria da, Sarthe departamenduan dagoena, Pays de la Loire eskualdean. 2013an 877 biztanle zituen."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BF%AA%E5%A5%A5%E6%88%88%C2%B7%E5%BA%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Diogo_C%C3%A3o.jpg","page_title":"迪奥戈·康","context_page_description":"迪奥戈·康是葡萄牙探险家，1580年代他沿非洲西岸进行了两次航行，成为了第一个发现并深入非洲第二大河刚果河考察的欧洲人，也是第一个到达西南非洲的鲸湾的欧洲航海家。"},{"page_url":"https://no.wikipedia.org/wiki/Acosta","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Acosta.canton.png","page_title":"Acosta","context_page_description":"Acosta er en kanton i provinsen San José i Costa Rica. Kantonen hadde 20 209 innbyggere i 2011. Arealet er på 342,24 km². Kantonens administrasjonssentrum er San Ignacio."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%94%E1%83%A0%E1%83%99%E1%83%9D%E1%83%A1%E1%83%A3%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Dilma_and_Cristina_in_Mercosur_Summit.jpg","page_title":"მერკოსური","context_page_description":"მერკოსური — სუბ-რეგიონული ბლოკი სამხრეთ ამერიკაში, რომელშიც შედიან არგენტინა, ვენესუელა, ბრაზილია, ურუგვაი და პარაგვაი. ასოცირებული ქვეყნებია ჩილე, ბოლივია, კოლუმბია, ეკვადორი და პერუ. დამკვირვებელი სახელმწიფოებია ახალი ზელანდია და მექსიკა.\\nორგანიზაციის მიზანია თავისუფალი ვაჭრობისა ხელშეწყობა და ხალხის, საქონლისა და ვალუტის თავისუფალი მოძრაობა. ოფიციალური ენებია ესპანური, პორტუგალიური და გუარანი. დაარსების დღიდან, ორგანიზაცია მრავალჯერ განახლდა, შესწორდა და შეიცვალა. ამჟამად ის სრული საბაჟო კავშირი და სავაჭრო ბლოკია. მერკოსური და ანდების საზოგადოება სამხრეთ ამერიკის ინტერგრაციის უწყვეტი პროცესის ძირითადი კომპონენტებია, ორივე მათგანს კი სამხრეთ ამერიკის ერთა კავშირი აერთიანებს."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AC%D9%8A%D9%86_%D9%85%D9%88%D9%84%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Regine_M%C3%BCller_%28Martin_Rulsch%29_2013-02-28_1.jpg","page_title":"ريجين مولير","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nريجين مولير سياسيه من المانيا."},{"page_url":"https://pl.wikipedia.org/wiki/Grzybowice_Wielkie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Panorama_of_the_villages_Velyki_Hrybovychi.JPG","page_title":"Grzybowice Wielkie","context_page_description":"Grzybowice Wielkie – wieś na Ukrainie, w obwodzie lwowskim, w rejonie żółkiewskim. W 2001 roku liczyła 1,704 mieszkańców. Założona w 1440 roku."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%B1%CF%81%CE%BA%CE%BF%CF%86%CE%AC%CE%B3%CE%B1_%CF%86%CF%85%CF%84%CE%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Sarracenia_purpurea.jpg","page_title":"Σαρκοφάγα φυτά","context_page_description":"Σαρκοφάγα φυτά είναι τα φυτά που παρουσιάζουν μία σειρά από ιδιότητες που τους επιτρέπουν να λαμβάνουν τα θρεπτικά τους συστατικά από την παγίδευση και κατανάλωση ζώων ή πρωτόζωων, συνήθως εντόμων και αρθρόποδων. Εμφανίζουν πέντε βασικές λειτουργικές ιδιότητες που όλες μαζί συνθέτουν το φαινόμενο της σαρκοφαγίας: παγίδευση της λείας με το σχηματισμό εξειδικευμένων παγίδων, θανάτωση της παγιδευμένης λείας, πέψη της λείας, αφομοίωση των μεταβολιτών-θρεπτικών συστατικών από τη νεκρή και χωνευμένη λεία και χρήση αυτών των μεταβολιτών για την επιβίωση κι ανάπτυξη του φυτού. Τα Σαρκοφάγα φυτά ορίζονται από την ταυτόχρονη παρουσία όλων αυτών των ιδιοτήτων καθώς κάθε μια από αυτές μπορεί να εμφανιστεί σε διαφορετικό πλαίσιο σε ορισμένα μη σαρκοφάγα φυτά όπως για παράδειγμα, η προσέλκυση ή η παγίδευση. Επιβιώνουν σε ενδιαιτήματα με χαμηλή περιεκτικότητα σε θρεπτικά συστατικά, όπως άζωτο, φωσφόρο, θείο και μεταλλικά στοιχεία.\\nΗ σαρκοφαγία στα φυτά είναι μία καινούρια στρατηγική διατροφής που έχει εξελιχθεί σε τουλάχιστον 9 διαφορετικές χρονικές περιόδους σε περισσότερα από 700 είδη αγγειόσπερμων, κατά κύριο λόγο σε περιοχές με σημαντικά περιορισμένο άζωτο και φωσφόρο."},{"page_url":"https://en.wikipedia.org/wiki/Coron_(house)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Somain_-_Corons_De_Sessevalle.jpg","page_title":"Coron (house)","context_page_description":"In urbanism, a coron is a historical type of working-class housing found in parts of France and Belgium. Emerging during the Industrial Revolution, corons were a form of low-cost dwelling commonly found in coal mining and steelmaking regions of Wallonia and the Nord-Pas-de-Calais. Originating as a form of vernacular architecture, their design and materials were increasingly upgraded over time and some were even constructed as parts of purpose-built model villages. They can be considered a counterpart of the back-to-back housing found in industrial parts of the United Kingdom.\\nOver a hundred coron sites are listed as World Heritage sites in Northern France selected by the United Nations Educational, Scientific and Cultural Organization."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D9%88%D8%B1%D8%A8%D8%A9_%D8%A7%D9%84%D8%AF%D8%AC%D8%A7%D8%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Chicken_Noodle_Soup.jpg","page_title":"شوربة الدجاج","context_page_description":"شوربة الدجاج هي أحد الأطباق التقليدية في العديد من الثقافات حول العالم."},{"page_url":"https://nv.wikipedia.org/wiki/T%C3%B3_w%C3%B3naan%C3%ADd%C4%99%CC%81%C4%99%CC%81%CA%BC_ch%CA%BCa%C5%82_k%CA%BCaasd%C3%A1h%C3%AD_nizh%C3%B3n%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Beautiful_Mantella_%28Mantella_pulchra%29%2C_Vohimana_reserve%2C_Madagascar_%2811763124235%29.jpg","page_title":"Tó wónaanídę́ę́ʼ chʼał kʼaasdáhí nizhónígíí","context_page_description":"Tó wónaanídę́ę́ʼ chʼał kʼaasdáhí nizhónígíí éí chʼał íiyisígíí dah yikahjí atah yisdzoh, áádóó éí Mágí Bitseeʼ Noodǫ́zí Bikéyahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Mantella pulchra\\" deiłníigo dayózhí."},{"page_url":"https://it.wikipedia.org/wiki/Roberte_Cusey","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Roberte_Cusey_1927.jpg","page_title":"Roberte Cusey","context_page_description":"Roberte Cusey è stata una modella francese, vincitrice del titolo di Miss Jura 1925 Miss Francia 1926, eletta quattro anno dopo la precedente vincitrice Pauline Pô.\\nIl termine \\"Miss Francia\\" fu ufficialmente inventato nel 1926 da Robert e Jean Cousin. Pertanto Roberte Cusey fu la prima donna a fregiarsi del titolo di \\"Miss Francia\\" e non \\"la donna più bella di Francia.\\"\\nIn seguito si classificò ottava al concorso di Miss Universo."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%89%E3%83%AC%E3%82%A4%E3%82%AF%E7%B4%9A%E8%A3%85%E7%94%B2%E5%B7%A1%E6%B4%8B%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/HMS_Leviathan_LOC_19124.jpg","page_title":"ドレイク級装甲巡洋艦","context_page_description":"ドレイク級装甲巡洋艦 はイギリス海軍の装甲巡洋艦。1902年、1903年に4隻が竣工した。クレッシー級の拡大改良型で機関出力が大幅に増強され、前級の21ノットに比べて23ノットを達成し、フランス海軍の装甲巡洋艦「ジャンヌ・ダルク」の21,8ノットを凌駕している。第一次世界大戦では二番艦「グッド・ホープ」が1914年11月1日コロネル沖海戦でドイツ艦隊と交戦、沈没。「ドレイク」が1917年10月2日ドイツ潜水艦「U79」の雷撃により沈没した。"},{"page_url":"https://ca.wikipedia.org/wiki/Gr%C3%A8cia_Occidental","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/GreeceWest.png","page_title":"Grècia Occidental","context_page_description":"La Grècia Occidental és una de les tretze perifèries o regions de Grècia. Està situada a l'oest del país. La seva capital és Patres."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%86%D1%91%D0%BB_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%9A%D0%B0%D1%86%D1%8F%D1%80%D1%8B%D0%BD%D1%8B_(%D0%97%D0%B0%D0%B3%D1%80%D0%B0%D0%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Pjevaliste_Akademska_crkva_Sv_Katarine_090609.jpg","page_title":"Касцёл Святой Кацярыны (Заграб)","context_page_description":"Касцёл Святой Кацярыны — касцёл у Заграбе, Харватыя, кафедра Заграбскай архіепархіі. Помнік архітэктуры барока, лічыцца адным з найпрыгажэйшых храмаў Заграба. Асвечаны ў гонар Святой Кацярыны.\\nРазмешчаны ў цэнтры горада — у Верхнім горадзе, на плошчы Святой Кацярыны."},{"page_url":"https://es.wikipedia.org/wiki/Buenache_de_Alarc%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Buenache_de_Alarc%C3%B3n_45.jpg","page_title":"Buenache de Alarcón","context_page_description":"Buenache de Alarcón es un municipio español de la provincia de Cuenca, en la comunidad autónoma de Castilla-La Mancha, ubicado en la ribera izquierda del río Júcar. Se encuentra entre las poblaciones de Hontecillas y Olmedilla de Alarcón."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Poilu_victorieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Port-sur-Sa%C3%B4ne_statue.jpg","page_title":"Le Poilu victorieux","context_page_description":"Le Poilu victorieux, aussi appelé Poilu de la Victoire, est une œuvre du sculpteur français Eugène Bénet, réalisée en 1920. Représentant un poilu, un soldat français de la Première Guerre mondiale, et destinée aux monuments aux morts, elle en orne plusieurs centaines à travers la France."},{"page_url":"https://en.wikipedia.org/wiki/Commemorative_coins_of_Latvia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Blaumanis_rev.jpg","page_title":"Commemorative coins of Latvia","context_page_description":"The commemorative coins of Latvia are issued by the National Bank of Latvia, headquartered in Riga, Latvia, but minted outside Latvia by:\\nRahapaja Oy: 3 + 26 coins\\nValcambi sa: 14 coins\\nRoyal Mint: 12 coins\\nRoyal Dutch Mint: 6 coins\\nAustrian Mint: 5 coins\\nBerlin Mint 3 coins\\nParis Mint: 1 coin"},{"page_url":"https://de.wikipedia.org/wiki/Sommerpelz_(Mode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Ellen_Glasgow_by_Dupont.jpg","page_title":"Sommerpelz (Mode)","context_page_description":"Als Sommerpelz wird in der Mode die im Sommer zu tragende Bekleidung aus Fell bezeichnet. Zeitweise bildete der Sommerpelz einen erheblichen Umsatzanteil der Pelzbranche in der sogenannten „ruhigen“, „stillen“ oder „toten Zeit“. In der Zoologie wird unter einem Sommerpelz oder Sommerfell dagegen das nach einem Fellwechsel im Frühjahr meist weniger dichte Fell der pelztragenden Tiere verstanden.\\nDaneben bestehen regionale, zumeist den Trachten zuzuordnende Pelze, die ganzjährig getragen werden, wie der Sporran, die Männertasche zum schottischen Kilt oder der Rotfuchsschweif an der Mütze des Fuchsmajors mancher deutscher Studentenverbindungen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%BE%D1%85%D0%BE%D0%BB%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D0%B4%D0%BE%D0%BB%D0%B8%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Trzydniowia%C5%84ska_Dolina_a1.jpg","page_title":"Хохоловська долина","context_page_description":"Хохоловська долина — найдовша і найбільша долина в польських Татрах, розташована на західних відрогах Західних Татр і становить орографічно ліву гілку долини Чорного Дунайця. Займає площу понад 35 км² і має довжину близько 10 км. Простягається від головного хребта до підніжжя гори. Адміністративно розташована у селі Вітув."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%B1%D1%81,_%D0%AE%D0%B4%D0%B6%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Eugene_V._Debs%2C_bw_photo_portrait%2C_1897.jpg","page_title":"Дебс, Юджин","context_page_description":"Юджин Ви́ктор Дебс — деятель рабочего и левого движения США, один из организаторов Социалистической партии Америки, а также профсоюзной организации «Индустриальные рабочие мира». Лидер Соцпартии и её пятикратный кандидат на президентских выборах, набиравший до 6 % голосов американских избирателей."},{"page_url":"https://en.wikipedia.org/wiki/List_of_first_batch_of_declared_historic_buildings_in_Hangzhou","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/1-45_Villa_at_214%2C_Nanshan_Road.jpg","page_title":"List of first batch of declared historic buildings in Hangzhou","context_page_description":"Declared historic buildings' of Hangzhou are districts, artifacts or buildings legally declared to be \\"protected\\". According to the \\"Regularations of historic districts and historic buildings in Hangzhou\\" effectivated from 1 January 2005, historic buildings are those artifacts or districts that have lasted more than 50 years, and of significant values for history, science, and art study. In Hangzhou, declaring a historic building requires consulting the urban planning administration bureau, and the real estate administration bureau.\\nAs of 31 June 2011, there are 287 declared historic buildings in Hangzhou, proclaimed as 5 batches.[17] In the near future, it is going to issue the sixth batch which includes 51 historic houses.\\n75 buildings were declared to be the first batch of historic buildings in Hangzhou, in May 2004. The following information is provided by Real Estate Admiustration Bureau & Research Institute for Historic buildings in Hangzhou."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%B0%E5%B1%A4%E5%87%A6%E5%88%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/ANDRA_bloc_laboratoire-2004-09.svg","page_title":"地層処分","context_page_description":"地層処分とは、原子力発電所から発生する使用済み燃料の再処理の際に発生する高レベル放射性廃棄物やTRU廃棄物の最終処分方法の一つである。放射性物質の濃度が高く、半減期の長い放射性物質を含むため、人が触れるおそれのない深部地下にこれを埋設することであり、低レベル放射性廃棄物の処分である「浅地中処分」とは区別される。"},{"page_url":"https://pt.wikipedia.org/wiki/%C3%81lbum_Comparativo_da_Cidade_de_S%C3%A3o_Paulo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Milit%C3%A3o_A._de_Azevedo_-_%C3%81lbum_Comparativo%2C_capa_-_Acervo_do_Museu_Paulista_da_USP.jpg","page_title":"Álbum Comparativo da Cidade de São Paulo","context_page_description":"O Álbum Comparativo da Cidade de São Paulo 1862-1887 foi um álbum fotográfico de Militão Augusto de Azevedo, fotógrafo carioca, publicado pela Photographia Americana em 1887, empresa pertencente ao próprio autor. O álbum conta com 60 fotos de pontos importantes da cidade de São Paulo, fazendo uma comparação desses lugares entre o anos de 1862 e 1887. Em grande medida, o álbum é bastante retomado hoje em dia não só em estudos históricos sobre o desenvolvimento da cidade de São Paulo como, também, em estudos a respeito da noção de modernidade empregada pelo Estado moderno brasileiro na época de sua publicação. A publicação é considerada pioneira na comparação da evolução urbana brasileira, e é considerada a obra mais importante do fotógrafo brasileiro Militão Augusto de Azevedo, uma vez que consagrou, segundo Vânia Carneiro de Carvalho, um modelo de comparação do desenvolvimento urbano que se tornaria amplamente adotado por orgãos públicos como forma de publicidade para os empreendimentos governamentais; e pelo mercado editorial:\\nOs repertórios documentais urbanos são muito antigos."},{"page_url":"https://fr.wikipedia.org/wiki/Zone_prioritaire_pour_la_biodiversit%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Hamster.jpg","page_title":"Zone prioritaire pour la biodiversité","context_page_description":"La Zone prioritaire pour la biodiversité est un nouveau zonage de protection de la nature, mis en place en France le 15 février 2017.\\nIl doit faciliter le rétablissement d'habitats vitaux pour des espèces menacées et/ou protégées."},{"page_url":"https://ca.wikipedia.org/wiki/Robert_Adam","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Home_House_05.jpg","page_title":"Robert Adam","context_page_description":"Robert Adam FRSE FRS FSA FSA FRSA va ser un arquitecte escocès, dissenyador d'interiors i també de mobles. Era fill de William Adam, l'arquitecte més important de l'època d'Escòcia, i va aprendre l'ofici amb ell. Després de la mort del seu pare, amb el seu germà major John, Robert es va fer càrrec del negoci familiar que incloïa lucratius treballs pel Board of Ordinance.\\nEn 1754 se'n va anar a Roma, passant gairebé cinc anys en el continent estudiant arquitectura amb Charles-Louis Clérisseau i Giovanni Battista Piranesi. Al seu retorn a Gran Bretanya es va establir per a la pràctica professional a Londres, on va estar acompanyat pel seu germà menor James. Allí va desenvolupar el «estil Adam» i la seva teoria del «moviment» en l'arquitectura, basant-se en els seus estudis de l'antiguitat, convertint-se en un dels arquitectes de moda i més reeixits del país. Adam va ocupar el càrrec d'«Arquitecte d'Obres del Rei» entre 1761 i 1769.\\nAdam va ser un dels líders de la primera fase de la recuperació clàssica a Anglaterra i Escòcia, des de prop de 1760 fins a la seva mort."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%84%D9%81%D8%A7%D8%B1%D9%86%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Vista_de_Alfarnate.jpg","page_title":"الفارنات","context_page_description":"الفارنات یک شهرستان در اسپانیا است که در اندلس واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Vaughan_Metropolitan_Centre","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/VMC_KPMG_building_2018.jpg","page_title":"Vaughan Metropolitan Centre","context_page_description":"Vaughan Metropolitan Centre is a central business district in Vaughan, Ontario, Canada. Measuring 179 hectares, the district is located at the intersection of Highway 7 and Jane Street, northeast of the Highway 400 and Highway 407 interchange, at the site of the historic farming community of Edgeley within the larger district of Concord. It is served by the Vaughan Metropolitan Centre subway station, which is the northwestern terminus of Line 1 Yonge–University of the Toronto subway system. It is also a major transit hub for York Region Transit, as well as Viva and Züm bus rapid transit services."},{"page_url":"https://es.wikipedia.org/wiki/Jim_Hutton","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Jim_Hutton_Ellery_Queen_1976.JPG","page_title":"Jim Hutton","context_page_description":"Jim Hutton fue un actor televisivo y cinematográfico estadounidense."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Bad_Homburg_vor_der_H%C3%B6he","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Bad_Homburg%2C_Elisabethenstra%C3%9Fe_27.JPG","page_title":"Liste der Kulturdenkmäler in Bad Homburg vor der Höhe","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Bad Homburg vor der Höhe, Hochtaunuskreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nDie Kulturdenkmäler der einzelnen Ortsteile sind in eigenen Listen enthalten:\\nListe der Kulturdenkmäler in Dornholzhausen\\nListe der Kulturdenkmäler in Gonzenheim\\nListe der Kulturdenkmäler in Kirdorf\\nListe der Kulturdenkmäler in Ober-Erlenbach\\nListe der Kulturdenkmäler in Ober-Eschbach"},{"page_url":"https://nl.wikipedia.org/wiki/Garderenseweg_180","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Boerderij1_Garderenseweg180_Speuld.jpg","page_title":"Garderenseweg 180","context_page_description":"De boerderij aan de Garderensweg 180 is een monumentale pand in de Gelderse plaats Speuld in de gemeente Ermelo."},{"page_url":"https://en.wikipedia.org/wiki/Lysander,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Lysanderhomes3.jpg","page_title":"Lysander, New York","context_page_description":"Lysander is a town in Onondaga County, New York, United States. The population was 21,759 at the 2010 census. The town was named after Lysander, a Spartan military leader, by a clerk interested in the classics. The town is in the northwest corner of Onondaga County and is northwest of Syracuse. Much of the town is a suburb of Syracuse."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B0%D0%B1%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%9F%D1%91%D1%82%D1%80_%D0%9C%D0%B0%D1%82%D0%B2%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Karabanov_PM.jpg","page_title":"Карабанов, Пётр Матвеевич","context_page_description":"Пётр Матвеевич Карабанов — русский поэт-архаист из рода Карабановых."},{"page_url":"https://nl.wikipedia.org/wiki/Cairn_Holy_Chambered_Cairns","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Cairn_Holy_II.jpg","page_title":"Cairn Holy Chambered Cairns","context_page_description":"Cairn Holy Chambered Cairns zijn twee complete neolithische graven, karakteristiek voor Galloway, gelegen langs de A75 ten zuidoosten van Creetown op een heuvel uitkijkend op Wigtown Bay in de Schotse regio Dumfries and Galloway."},{"page_url":"https://en.wikipedia.org/wiki/Nasal_administration","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Action_photo_of_nasal_spray_on_a_black_background.jpg","page_title":"Nasal administration","context_page_description":"Nasal administration is a route of administration in which drugs are insufflated through the nose. It can be a form of either topical administration or systemic administration, as the drugs thus locally delivered can go on to have either purely local or systemic effects. Nasal sprays are locally acting drugs such as decongestants for cold and allergy treatment, whose systemic effects are usually minimal. Examples of systemically active drugs available as nasal sprays are migraine drugs, nicotine replacement, and hormone treatments."},{"page_url":"https://ca.wikipedia.org/wiki/Tlatelolco","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/PLAZA_DE_LAS_TRES_CULTURAS-1.jpg","page_title":"Tlatelolco","context_page_description":"Tlatelolco és un barri important de la delegació Cuauhtémoc, una de les 16 municipalitats en què està dividida la ciutat de Mèxic"},{"page_url":"https://en.wikipedia.org/wiki/Beaumont_Hospital,_Dublin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Welcome_to_Beaumont_Hospital_bilingual_sign_%282020%29.jpg","page_title":"Beaumont Hospital, Dublin","context_page_description":"Beaumont Hospital is a large teaching hospital located in Beaumont, Dublin, Ireland. It is managed by RCSI Hospitals - one of the hospital groups established by the Health Service Executive. Its academic partner is the Royal College of Surgeons in Ireland.\\nSt. Joseph's Hospital is also under the management of the Beaumont Hospital Board."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A1%9E%E5%B0%94%E7%BB%B4%E4%BA%9A%E5%90%9B%E4%B8%BB%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Stefan_the_First-Crowned%2C_fresco_from_Mile%C5%A1eva.jpg","page_title":"塞尔维亚君主列表","context_page_description":"塞爾維亞君主列表列出塞爾維亞從早期歷史記載，直至1945年帝制被廢止間，所有的君主名稱。"},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Franciszka_z_Asy%C5%BCu_w_Brzezinach","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Brzeziny%2C_ko%C5%9Bci%C3%B3%C5%82_pw._%C5%9Bw._Franciszka_z_Asy%C5%BCu.jpg","page_title":"Kościół św. Franciszka z Asyżu w Brzezinach","context_page_description":"Kościół świętego Franciszka z Asyżu – rzymskokatolicki kościół parafialny należący do Franciszkanów. Znajduje się w dekanacie brzezińskim archidiecezji łódzkiej."},{"page_url":"https://et.wikipedia.org/wiki/STS-7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/STS-7_PALABA-B1_deploy.jpg","page_title":"STS-7","context_page_description":"STS-7 oli NASA Space Shuttle'i programmi seitsmes missioon ja kosmosesüstik Challengeri teine missioon.\\nChallenger viis orbiidile mitu satelliiti ja selle meeskonda kuulus NASA esimene naisastronaut Sally Ride. Lisaks oli see stardi ajal suurima meeskonnaga kosmoselaev läbi aegade ja esimene missioon, kus osales NASA 8. astronautide grupi liige. 8. astronautide grupp oli esimene rühm, mis moodustati Space Shuttle'i programmi jaoks. STS-7 startis 18. juunil 1983 ja maandus 24. juunil."},{"page_url":"https://es.wikipedia.org/wiki/Himno_Europeo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Flag_of_Europe.svg","page_title":"Himno Europeo","context_page_description":"El himno de la Unión Europea, oficialmente Himno Europeo, es uno de los cuatro símbolos oficiales de la Unión Europea.​ El himno tiene su origen en la Oda a la Alegría, escrita por Friedrich von Schiller en 1785 y la composición realizada por Ludwig van Beethoven para su novena sinfonía. Fue adoptado oficialmente en 1985.​\\nEste himno, según la Unión Europea, no sustituye a los himnos nacionales de los países de la UE, sino que \\"celebra los valores que todos ellos comparten\\".​"},{"page_url":"https://pt.wikipedia.org/wiki/For%C3%A7a_A%C3%A9rea_Su%C3%AD%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Grd_badge.jpg","page_title":"Força Aérea Suíça","context_page_description":"A Força Aérea Suíça é o componente aéreo das Forças Armadas da Suíça. Estabelecida em 31 de julho de 1914 e em Outubro de 1936 se tornou um serviço independente, separado do Exército.\\nEm tempos de paz, Dübendorf é o Quartel General da Força Aérea. A Força Aérea Suíça opera a partir de várias bases fixas, mas seu pessoal é também treinado para realizar operações aéreas de aeródromos temporários improvisados em rodovias. Em caso de crise ou guerra muitas rodovias são especialmente preparadas para esta opção."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB_%D0%A1%D1%82%D1%96%D0%BD%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Bronze-service-star-3d.png","page_title":"Карл Стінер","context_page_description":"Карл Вейд Стінер — американський воєначальник, генерал армії США, командувач силами спеціальних операцій Збройних сил США, Об'єднаного Командування спеціальних операцій. Учасник війн у В'єтнамі та в Перській затоці."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%BE%D5%A5%D5%BF%D5%AB%D6%84_%D4%BB%D5%BD%D5%A1%D5%B0%D5%A1%D5%AF%D5%B5%D5%A1%D5%B6%D5%AB_%D5%BF%D5%B8%D6%82%D5%B6-%D5%A9%D5%A1%D5%B6%D5%A3%D5%A1%D6%80%D5%A1%D5%B6_(%D4%B3%D5%B5%D5%B8%D6%82%D5%B4%D6%80%D5%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/%D5%8F%D5%B8%D6%82%D5%B6-%D5%A9%D5%A1%D5%B6%D5%A3%D5%A1%D6%80%D5%A1%D5%B6%60_%D4%B1%D5%BE._%D4%BB%D5%BD%D5%A1%D5%B0%D5%A1%D5%AF%D5%B5%D5%A1%D5%B6%D5%AB%2C_%D5%AF%D5%A5%D5%B6%D6%81%D5%A1%D5%B2%D5%A1%D5%B5%D5%AB%D5%B6_%D5%AB%D6%80%D5%A5%D6%801_%286%29.JPG","page_title":"Ավետիք Իսահակյանի տուն-թանգարան (Գյումրի)","context_page_description":"Ավետիք Իսահակյանի տուն-թանգարան, Ավետիք Իսահակյանի տուն-թանգարանը գործում է 1975 թվականից, մեծ քնարերգուի հայրական տանը, որը կառուցվել է 1828 թվականին՝ բանաստեղծի պապի՝ Նիկողայոս Իսահակյանի կողմից։"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86_%D0%9C%D0%BE%D0%BD%D1%81%D0%B5%D1%80%D1%80%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Monserrate_Palace_-_Sintra%2C_Portugal_%288451615855%29.jpg","page_title":"Палац Монсеррат","context_page_description":"Палац Монсеррат — це палацова вілла, розташована поблизу Сінтри, традиційного літнього курорту Браганського дому в передгір'ях, що виходять на Атлантичний океан на північ від столиці Лісабона."},{"page_url":"https://it.wikipedia.org/wiki/Mon%C3%A9teau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Mairie_de_Moneteau.JPG","page_title":"Monéteau","context_page_description":"Monéteau è un comune francese di 3.858 abitanti situato nel dipartimento della Yonne nella regione della Borgogna-Franca Contea."},{"page_url":"https://war.wikipedia.org/wiki/Acropora_humilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Acropora_humilis_Maldives.jpg","page_title":"Acropora humilis","context_page_description":"Acropora humilis in uska species han Anthozoa nga syahan ginhulagway ni James Dwight Dana hadton 1846. An Acropora humilis in nahilalakip ha genus nga Acropora, ngan familia nga Acroporidae. Ginklasipika han IUCN an species komo harani ha karat-an. Waray hini subspecies nga nakalista."},{"page_url":"https://bs.wikipedia.org/wiki/Internodij","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Polygonum_amphibium_%284973671699%29.jpg","page_title":"Internodij","context_page_description":"Stablljika je jedna od dvije glavne strukturne osi vaskularneih biljki, druga je korijen. Stabljika se obično dijeli na čvorove i internodije:\\nČvorovi ili nodiji nose jedan ili više listova, kao i pupoljke koji mogu izrasti u grane"},{"page_url":"https://tg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%BC%D0%B0%D0%BD%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Kathmandu-Strassenhandel-92-Haendler_fuer_Festtagsbedarf-2015-gje.jpg","page_title":"Катманду","context_page_description":"Шаҳри Катманду бо аҳолии 850 ҳаз. маркази таърихи, иқтисодӣ, сиёсӣ ва мадании Непал ва водии Катманду мебошад. Координатҳо: 27°43′ с. ш. 85°22′ в. д."},{"page_url":"https://eo.wikipedia.org/wiki/Pico_(insulo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Pico_Hochland_1.jpg","page_title":"Pico (insulo)","context_page_description":"Pico [piko] estas la dua plej granda insulo de la portugala atlantika arkipelago de Acoroj kaj la plej granda insulo de la Mezaj Acoroj, situanta je 28º 20' okcidenta longitudo kaj 38º 30' norda latitudo.\\nPico situas proksime al la insulo Faial, kaj al la insulo São Jorge. Ĝia areo estas 433,30 km² kaj sur la insulo vivas proksimume 15500 loĝantoj. La insulo havas longecon de ĉirkaŭ 90 km kaj larĝecon de ĉirkaŭ 20 km. Krom la haveno Madalena, kiu situas en la okcidento rekte je la alia flanko de la insulo Faial gravas iomete Lajes do Pico en la sudo kaj la haveno de São Roque.\\nSur la insulo estas la plej alta monto de Portugalio, la Ponta do Pico kun alteco de 2351 metroj. La monto havas vulkanan originon. La marbordo estas tre kruta. Vidinda estas la rokaro Arco do Cachorro en la samnoma golfeto.\\nPost ĝia malkovro, oni nomis ĝin São Dinis. La nuna nomo venas de la alta monto, kiu finas per akra pinto. Pico estas la plej monteca insulo de la Acoroj. Oni ekloĝis la insulon en 1460, stabile ekde la fondo de São Mateus en 1482.\\nLa insulo estas konata pro vinkultivado, kiu ĉefe troviĝas en ĝia okcidenta parto."},{"page_url":"https://vi.wikipedia.org/wiki/Linh_tr%C6%B0%E1%BB%9Fng_m%C5%A9i_%C6%B0%E1%BB%9Bt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Extant_strepsirrhine_range_with_fossil_sites.png","page_title":"Linh trưởng mũi ướt","context_page_description":"Linh trưởng mũi ướt là một phân bộ của loài linh trưởng bao gồm vượn cáo và các loài linh trưởng khác thuộc Bộ Bán hầu, trong đó bao gồm các loài vượn cáo ở Madagascar, galagos và pottos từ châu Phi, và các con culi chậm từ Ấn Độ và Đông Nam Á. Cũng thuộc thuộc phân bộ là Adapiforms, loài linh trưởng đã tuyệt chủng, một nhóm đa dạng và phổ biến mà phát triển mạnh trong thế Eocen ở châu Âu, Bắc Mỹ, và châu Á, nhưng biến mất khỏi nhất của Bắc bán cầu vì khí hậu trở lạnh. Hai phân loại hàng đầu cho sự phân chia thuộc phân loài linh trưởng sống Strepsirrhine vào một trong hai siêu họ trong cận bộ vượn cáo hoặc vượn cáo và Lorisiformes. Ngày nay, nhóm Strepsirrhini đã loại trừ khỉ lùn Tarsier, mà bây giờ được nhóm vào thuộc phân bộ linh trưởng lớn khác là Haplorhini, cùng với những con khỉ không đuôi và vượn."},{"page_url":"https://en.wikipedia.org/wiki/Maracay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Parte_de_Turmero.jpg","page_title":"Maracay","context_page_description":"Maracay is a city in north-central Venezuela, near the Caribbean coast, and is the capital and most important city of the state of Aragua. Most of it falls under the jurisdiction of Girardot Municipality. The population of Maracay and its surroundings in the 2011 census was 955,362. In Venezuela, Maracay is known as \\"Ciudad Jardín\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B0%D1%85%D1%96%D0%B2_%D0%94%D0%BE%D0%BC%D1%96%D0%BD%D1%96%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Curacao-Icterus-Icterus-2013.JPG","page_title":"Список птахів Домініки","context_page_description":"Цей список є списком видів птахів, спостережених на території Домініки. Він включає 195 видів, з них 2 види є ендеміками, 6 завезених людьми, 121 вид є рідкісними або випадковими залітними та 1 вимерлий на острові."},{"page_url":"https://sv.wikipedia.org/wiki/Hauville","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/MeulesMoulinHauville.jpg","page_title":"Hauville","context_page_description":"Hauville är en kommun i departementet Eure i regionen Normandie i norra Frankrike. Kommunen ligger i kantonen Routot som tillhör arrondissementet Bernay. År 2009 hade Hauville 1 273 invånare."},{"page_url":"https://es.wikipedia.org/wiki/Dir%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Map_commune_Mali_-_DIRE.svg","page_title":"Diré","context_page_description":"Diré es una comuna o municipio del círculo de Diré de la región de Tombuctú, en Malí. En abril de 2009 tenía una población censada de 20 337 habitantes.​\\nSe encuentra ubicada al sur de la región de Tombuctú, junto a la frontera con la región de Mopti."},{"page_url":"https://ro.wikipedia.org/wiki/Csaholc,_Szabolcs-Szatm%C3%A1r-Bereg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Csaholc%2C_4967_Hungary_-_panoramio_%281%29.jpg","page_title":"Csaholc, Szabolcs-Szatmár-Bereg","context_page_description":"Csaholc este un sat în districtul Fehérgyarmat, județul Szabolcs-Szatmár-Bereg, Ungaria, având o populație de 571 de locuitori."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_gabenor_Negeri-Negeri_Selat","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Williamrobinson.jpg","page_title":"Senarai gabenor Negeri-Negeri Selat","context_page_description":"Gabenor Negeri-negeri Selat telah dilantik oleh Syarikat Hindia Timur Inggeris sehingga 1867, apabila negeri Selat menjadi tanah jajahan. Selepas itu Gabenor dilantik oleh Pejabat Kolonial. Jawatan itu wujud dari 1826 hingga 1946. Antara 1942 dan 1945 jawatan itu tidak diisi, kerana negeri Selat ketika itu di bawah pendudukan Jepun. Dari abad ke-19 dan seterusnya, Gabenor Negeri-negeri Selat adalah biasanya juga Pesuruhjaya Tinggi British di Tanah Melayu."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%B8%D0%BC_III_%D0%95%D1%84%D0%B5%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Anthimos_of_Efesos.jpg","page_title":"Антим III Ефески","context_page_description":"Антим е православен духовник, митрополит на Вселенската патриаршия."},{"page_url":"https://de.wikipedia.org/wiki/Rudersdorf_(Burgenland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Kirche_dobersdorf.JPG","page_title":"Rudersdorf (Burgenland)","context_page_description":"Rudersdorf ist eine Marktgemeinde im Bezirk Jennersdorf im Burgenland in Österreich mit 2156 Einwohnern. Der ungarische Ortsname der Gemeinde ist Radafalva."},{"page_url":"https://nl.wikipedia.org/wiki/Tutu_Puoane","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Tutu_Puoane_2008.jpg","page_title":"Tutu Puoane","context_page_description":"Nonthuthuzelo Puoane is een jazz-zangeres uit Zuid-Afrika.\\nTutu Pouane werd geboren in een township nabij Pretoria en studeerde aan de University of Cape Town. Ze trok in 2002 naar Europa, meer bepaald naar Den Haag, waar ze een tijdlang studeerde. In 2004 verhuisde ze naar Antwerpen.\\nZe trad op in Zuid-Afrika, Italië, Zwitserland, Duitsland, de VS, België en Nederland. Met het Brussels Jazz Orchestra werkte ze samen voor het hommageprojecten Billie Holiday en Nina Simone. Ook stond ze al op de concertpodia met Dré Pallemaerts en Toots Thielemans. Puoane bewees zich voor het eerst solo met haar albums Song en Quiet Now."},{"page_url":"https://ca.wikipedia.org/wiki/Corc_gros","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Spuszczel_pospolty_larwa.jpg","page_title":"Corc gros","context_page_description":"El corc gros és una espècie de coleòpter polífag de la família dels cerambícids. És una de les diverses espècies anomenades vulgarment corcs de la fusta."},{"page_url":"https://de.wikipedia.org/wiki/Bergstedter_Kirche","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Kberg_2_weihekreuze.jpg","page_title":"Bergstedter Kirche","context_page_description":"Die Bergstedter Kirche ist eines der ältesten Kirchengebäude im Hamburger Raum mit sehenswerten Kunstwerken. Sie gehört heute zum Hamburger Bezirk Wandsbek und zur Nordkirche. Bis zum Groß-Hamburg-Gesetz gehörten der Ort Bergstedt und damit auch die Kirche zu Stormarn."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Category_A_listed_buildings_in_Glasgow","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Old_Cinema%2C_Moss_Side_Road%2C_Shawlands_-_geograph.org.uk_-_926591.jpg","page_title":"List of Category A listed buildings in Glasgow","context_page_description":"This is a list of Category A listed buildings in Glasgow, Scotland.\\nIn Scotland, the term listed building refers to a building or other structure officially designated as being of \\"special architectural or historic interest\\". Category A structures are those considered to be \\"buildings of national or international importance, either architectural or historic, or fine little-altered examples of some particular period, style or building type.\\" Listing was begun by a provision in the Town and Country Planning Act 1947, and the current legislative basis for listing is the Planning Act 1997. The authority for listing rests with Historic Scotland, an executive agency of the Scottish Government, which inherited this role from the Scottish Development Department in 1991. Once listed, severe restrictions are imposed on the modifications allowed to a building's structure or its fittings. Listed building consent must be obtained from local authorities prior to any alteration to such a structure. There are approximately 47,400 listed buildings in Scotland, of which around 8% are Category A."},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Weltmeisterschaften_2015/400_m_H%C3%BCrden_der_M%C3%A4nner","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Beijing_National_Stadium_2015IAAF-1.JPG","page_title":"Leichtathletik-Weltmeisterschaften 2015/400 m Hürden der Männer","context_page_description":"Der 400-Meter-Hürdenlauf der Männer bei den Leichtathletik-Weltmeisterschaften 2015 fand am 22., 23. und 25. August 2015 in Peking, Volksrepublik China, statt.\\nEs siegte der Kenianer Nicholas Bett. Vizeweltmeister wurde Denis Kudrjawzew aus Russland vor Jeffery Gibson von den Bahamas."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A0%BC%E5%A5%A5%E5%B0%94%E5%9F%BA%C2%B7%E5%A1%94%E5%A1%94%E5%86%85%E6%96%AF%E5%BA%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Gheorghe_T%C4%83t%C4%83rescu.jpg","page_title":"格奥尔基·塔塔内斯库","context_page_description":"格奥尔基·塔塔内斯库，罗马尼亚政治家，2次担任罗马尼亚总理，3次担任外交部长，一次担任国防部长。他是国家自由党中新自由主义派的代表人物。一开始是Ion G. Duca的合作者，持反共主义立场，与国家自由党领袖Dinu Brătianu、外相尼古莱·蒂杜莱斯库时有冲突。他首度执政时与卡罗尔二世接近，对法西斯主义持矛盾态度。1940年同意将比萨拉比亚和北布科维纳割让给苏联，并因此辞职。\\n二战爆发后，他开始反对扬·安东内斯库的罗马尼亚法西斯政府的独裁统治，并与罗马尼亚共产党结盟。他在1938年和1944年两度被国家自由党开除。1946至47年，他担任巴黎和会罗马尼亚代表团团长。后与共产党关系破裂。共产党取得政权后，他被捕，成为政治犯。获释后不久病逝。"},{"page_url":"https://en.wikipedia.org/wiki/Adalita_Srsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Adalita_from_Magic_Dirt%2C_Rockwiz%2C_Canberra.jpg","page_title":"Adalita Srsen","context_page_description":"Adalita Srsen is an Australian rock musician who is a founding member of the rock band Magic Dirt and a solo artist. She released her second solo album, All Day Venus, in September 2013. She is known simply as Adalita."},{"page_url":"https://cs.wikipedia.org/wiki/Franti%C5%A1ek_My%C5%A1%C3%A1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Franti%C5%A1ek_My%C5%A1%C3%A1k-004.jpg","page_title":"František Myšák","context_page_description":"František Myšák patřil mezi nejznámější pražské cukráře a jeho cukrárnu a kavárnu ve Vodičkově ulici navštěvovali významní umělci, sportovci a politici."},{"page_url":"https://gl.wikipedia.org/wiki/Isoglosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Cantabamos-cant%C3%A1bamos_idioma_gallego.png","page_title":"Isoglosa","context_page_description":"Unha isoglosa é unha liña imaxinaria que divide xeograficamente a existencia de dous fenómenos lingüísticos distintos. Os trazos poden ser fonéticos, fonolóxicos, morfolóxicos, sintácticos e mesmo pragmáticos.\\nPartindo como exemplo do galego actual, as isoglosas dos principais fenómenos contribúen a delimitar o territorio dos tres bloques lingüísticos: occidental, central e oriental. Porén, unha isoglosa pode internarse non só nas falas dun determinado idioma, senón en dominios pertencentes ao que se consideran linguas distintas. Este fenómeno tipifica as áreas ocupadas por dialectos procedentes dun tronco común, de aí que cando se trata de describir tecnicamente as variantes desde o punto de vista sincrónico non sexa apropiado referirse a linguas, senón a fenómenos dialectais que se van sucedendo a través de continuum lingüísticos.\\nOs problemas na definición de lingua proceden dunha súa característica: a continuidade. En lingüística fálase de continuum lingüístico na Romania, debido a que existen trazos que xeograficamente se perden nun límite e outros que se perden noutro. A estas fronteiras distribucionais ou isoglosas poden agruparse ou aparecer illadas:"},{"page_url":"https://pl.wikipedia.org/wiki/McDonnell_Douglas_F-15_Eagle","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/F-15A_first_prototype_1.jpg","page_title":"McDonnell Douglas F-15 Eagle","context_page_description":"McDonnell Douglas F-15 Eagle – amerykański ciężki myśliwiec przewagi powietrznej, przeznaczony do działań w każdych warunkach atmosferycznych."},{"page_url":"https://fr.wikipedia.org/wiki/Star%C3%A9_Hory","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Star%C3%A9_Hory_flag.png","page_title":"Staré Hory","context_page_description":"Staré Hory, est un village de Slovaquie situé dans la région de Banská Bystrica."},{"page_url":"https://en.wikipedia.org/wiki/The_International_Cat_Association","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Judging_Pyramid.jpg","page_title":"The International Cat Association","context_page_description":"The International Cat Association is considered the world's largest genetic cat registry. Originally a North American organization, it now has a worldwide presence. The organization has a genetic registry for pedigreed and household pet cats and is one of the world's largest sanctioning bodies for cat shows."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A5%D0%B0%D1%80%D1%8D%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Harari_Flag.jpg","page_title":"Харэр","context_page_description":"Харэр — горад на ўсходзе Эфіопіі. Адміністрацыйны цэнтр рэгіёну Харары. Важны камерцыйны цэнтр Эфіопіі, галоўны ісламскі горад краіны."},{"page_url":"https://en.wikipedia.org/wiki/William_H._Hastie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/HON._WILLIAM_H._HASTIE_-_CHAMPION_OF_JUSTICE_-_NARA_-_535685.jpg","page_title":"William H. Hastie","context_page_description":"William Henry Hastie Jr. was an American lawyer, judge, educator, public official, and civil rights advocate. He was the first African American to serve as Governor of the United States Virgin Islands, as a federal judge, and as a federal appellate judge. He served as a United States Circuit Judge of the United States Court of Appeals for the Third Circuit and previously served as District Judge of the District Court of the Virgin Islands."},{"page_url":"https://de.wikipedia.org/wiki/Hans_Mark","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Hans_Mark_-_1998.JPEG","page_title":"Hans Mark","context_page_description":"Hans Michael Mark ist ein US-amerikanischer Physiker, Ingenieur und Wissenschaftsmanager. Er hatte hohe zivile Positionen in der Air Force und NASA und war von 1977 bis 1979 Direktor des National Reconnaissance Office.\\nHans Mark ist der Sohn des Chemikers Herman Mark und floh mit seiner Familie vor den Nationalsozialisten aus Wien nach England und 1940 in die USA. Er wurde 1945 US-Staatsbürger, besuchte die Stuyvesant High School in New York City und studierte Physik an der University of California in Berkeley mit dem Bachelor-Abschluss 1951 sowie am Massachusetts Institute of Technology, an dem er 1954 promoviert wurde. Damals beschäftigte er sich mit experimenteller Kernphysik und Neutronenphysik. Von 1955 bis 1958 war er am Lawrence Radiation Laboratory in Berkeley, dann Assistant Professor am MIT und 1960 wieder am Lawrence Livermore National Laboratory. 1964 wurde er Vorstand der Abteilung Kerntechnik der University of California in Berkeley und zuständig für den Berkeley Research Reactor.\\nAb 1969 war er Direktor des Ames Research Center der NASA in Mountain View."},{"page_url":"https://sl.wikipedia.org/wiki/Medijski_grad","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Medija_Castle_1900.jpg","page_title":"Medijski grad","context_page_description":"Medijski grad ali grad Medija je stal v naselju Podlipovica, zahodno od Izlak. Obnovljena je grajska kapelica, v kateri redno potekajo kulturne prireditve ter v zadnjih letih tudi poroke. Sam grad ter konjušnico so partizani porušili. Zraven gradu naj bi bil tudi rov, ki je povezoval grad z vrelcem, ki pa so ga zasuli.\\nNa gradu so shranjeni posmrtni ostanki Janeza Vajkarda Valvasorja."},{"page_url":"https://nl.wikipedia.org/wiki/Cap-Ha%C3%AFtien_(stad)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Cathedral_Cap_Haitien_Haiti.jpg","page_title":"Cap-Haïtien (stad)","context_page_description":"Cap-Haïtien is een stad en gemeente met 274.000 inwoners, aan de noordkust van Haïti. Het is de hoofdstad van het gelijknamige arrondissement en van het departement Nord. Traditioneel is het een vakantiebestemming, wat echter wordt beperkt door de onstabiele situatie in het land. Door de ligging, relatief dicht bij Florida, is het een belangrijke uitvalsbasis naar de Verenigde Staten."},{"page_url":"https://de.wikipedia.org/wiki/Isuzu_Wizard","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Isuzu_Wizard_001.JPG","page_title":"Isuzu Wizard","context_page_description":"Der Isuzu MU / Wizard war ein SUV, das Isuzu zwischen 1989 und 2004 produzierte. Der 3-türige Isuzu MU erschien 1989 und der auf ihm basierende 5-türige Isuzu Wizard 1990. Isuzu vertrieb die Modelle weltweit unter verschiedenen Namen außerhalb des Heimatmarktes. Auch von der an Isuzu beteiligten General Motors wurde das Fahrzeug unter verschiedenen Namen produziert."},{"page_url":"https://sv.wikipedia.org/wiki/Dampleux","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Map_commune_FR_insee_code_02259.png","page_title":"Dampleux","context_page_description":"Dampleux är en kommun i departementet Aisne i regionen Hauts-de-France i norra Frankrike. Kommunen ligger i kantonen Villers-Cotterêts som ligger i arrondissementet Soissons. År 2009 hade Dampleux 433 invånare."},{"page_url":"https://ca.wikipedia.org/wiki/Plans_del_Girbau","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Granera._Plans_del_Girbau.svg","page_title":"Plans del Girbau","context_page_description":"Els Plans del Girbau és un conjunt de plans escalonats del terme municipal de Granera, al Moianès.\\nSón a la zona nord-occidental del terme, a l'oest i al sud de la masia del Girbau de Baix i del Girbau de Baix. És a la dreta del torrent del Girbau."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%AC%D9%85%D8%A9_%D8%AF%D9%84%D9%8A%D9%84_%D8%A7%D9%84%D9%84%D9%8A%D8%B2%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Laser_Meets_Lightning.jpg","page_title":"نجمة دليل الليزر","context_page_description":"نجمة دليل الليزر ‏ هو عملية انشاء نجمة صناعية في طبقات الجو عبر طرق البصريات المكيفة والتي يتم استخدامها في المراصد."},{"page_url":"https://en.wikipedia.org/wiki/Nutrient_cycle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Nutrient_cycle.svg","page_title":"Nutrient cycle","context_page_description":"A nutrient cycle is the movement and exchange of organic and inorganic matter back into the production of matter. Energy flow is a unidirectional and noncyclic pathway, whereas the movement of mineral nutrients is cyclic. Mineral cycles include the carbon cycle, sulfur cycle, nitrogen cycle, water cycle, phosphorus cycle, oxygen cycle, among others that continually recycle along with other mineral nutrients into productive ecological nutrition."},{"page_url":"https://pl.wikipedia.org/wiki/Ludwik_Hirszfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Ludwik_Hirszfeld_1916.jpg","page_title":"Ludwik Hirszfeld","context_page_description":"Ludwik Hirszfeld – polski lekarz, bakteriolog i immunolog, twórca polskiej szkoły immunologicznej oraz nowej dziedziny nauki – seroantropologii."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%A4%8D%E5%8A%87%E5%A0%B4%EF%BC%8D%E8%8A%B1%E7%94%B2%E7%94%B7%E5%AD%A9%E8%BD%89%E5%A4%A7%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/%E8%8A%B1%E7%94%B2%E7%94%B7%E5%AD%A9%E8%BD%89%E5%A4%A7%E4%BA%BA%E5%A0%B4%E6%99%AF%E4%B9%8B%E4%B8%80%E5%8F%B0%E4%B8%AD%E5%B8%82%E5%A4%A7%E8%82%9A%E5%8D%80%E7%91%9E%E9%8C%A6%E7%A4%BE%E5%8D%80%E5%B0%8F%E5%B7%B7.jpg","page_title":"植劇場－花甲男孩轉大人","context_page_description":"《花甲男孩转大人》是一部2017年的台湾电视剧，为台视、八大电视与公视共同监制之《植剧场》的第七部作品，为原著改编系列的第一部剧集。故事以台湾乡下望族郑家的老夫人濒临逝世为背景，描述由卢广仲饰演的郑家长孙郑花甲的自我成长，以及家族成员间争夺祖产，最后前嫌尽释的过程。全剧由卢广仲、范足妹、蔡振南、王彩桦、谢盈萱、林意箴、江常辉、严正岚、刘冠廷、曲献平、江沂宸领衔主演。在2016年11月15日开拍，2017年2月杀青。台视主频于5月26日首播，7月7日播出最终集，共7集。而该剧的未删减版《花甲男孩转大人 全》于8月25日起在台视主频首播，10月27日播出最终集，共10集。同月宣布将拍摄续集电影《花甲大人转男孩》，于10月23日开拍，12月6日杀青，并在2018年2月9日于台湾上映。\\n《花甲男孩转大人》创下《植剧场》最高收视4.16，全剧平均收视2.46，为《植剧场》全剧平均收视最高者。在2018年，该剧和另外二部作品一起获得东京国际戏剧节的海外作品特别赏，同年，饰演男主角的卢广仲凭该角色获得第53届金钟奖戏剧节目男主角奖和新进演员奖，是首位在同届金钟奖获得这两个奖项的演员，而饰演男配角的刘冠廷也赢得了戏剧节目男配角奖。此外，该剧还赢得了该届金钟奖的戏剧节目奖，并入围戏剧节目导演奖、编剧奖、女主角奖、男配角奖、女配角奖和摄影奖。该剧的主题曲〈鱼仔〉赢得第29届金曲奖的年度歌曲奖和最佳作曲人奖。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%95%D7%A0%D7%91%D7%95%D7%9C%D7%A0%D7%99%D7%A6%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Pomnik_w_W%C4%85wolnicy.jpg","page_title":"וונבולניצה","context_page_description":"וונבולניצה הוא כפר במחוז פולווי שבפרובינציית לובלין בפולין, בו התקיימה עד השואה קהילה יהודית גדולה."},{"page_url":"https://en.wikipedia.org/wiki/Woolwich_Dockyard","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ruby_%281776%29_RMG_J3623.jpg","page_title":"Woolwich Dockyard","context_page_description":"Woolwich Dockyard was an English naval dockyard along the river Thames at Woolwich in north-west Kent, where many ships were built from the early 16th century until the late 19th century. William Camden called it 'the Mother Dock of all England'. By virtue of the size and quantity of vessels built there, Woolwich Dockyard is described as having been 'among the most important shipyards of seventeenth-century Europe'. During the Age of Sail, the yard continued to be used for shipbuilding and repair work more or less consistently; in the 1830s a specialist factory within the dockyard oversaw the introduction of steam power for ships of the Royal Navy. At its largest extent it filled a 56-acre site north of Woolwich Church Street, between Warspite Road and New Ferry Approach; 19th-century naval vessels were fast outgrowing the yard, however, and it eventually closed in 1869. The former dockyard area is now partly residential, partly industrial, with remnants of its historic past having been restored."},{"page_url":"https://en.wikipedia.org/wiki/Cherbourg-Octeville","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Cherbourg_AncienneCri%C3%A9e.jpg","page_title":"Cherbourg-Octeville","context_page_description":"Cherbourg-Octeville is a city and former commune situated at the northern end of the Cotentin peninsula in the northwestern French department of Manche. It is a subprefecture of its department, and was officially formed when the commune of Cherbourg absorbed Octeville on 28 February 2000. On 1 January 2016, it was merged into the new commune of Cherbourg-en-Cotentin. The city is a Maritime prefecture and sub-prefecture of la Manche. Due to its union, it is the most populated city in its department with 37,121 inhabitants making it the first city of the department before the Saint-Lô prefecture and the second in the region after Caen.\\nCherbourg-en-Cotentin is protected by Cherbourg Harbour, between La Hague and Val de Saire, and the city has been a strategic position over the centuries, disputed between the English and French. Cited as one of the \\"keys to the kingdom\\" by Vauban, it became, by colossal maritime development work, a first-rate military port under the leadership of Napoleon I, and holds an arsenal of the French Navy."},{"page_url":"https://sv.wikipedia.org/wiki/Pyramica_sahura","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Pyramica_sahura_casent0102589_profile_1.jpg","page_title":"Pyramica sahura","context_page_description":"Pyramica sahura är en myrart som först beskrevs av Bolton 1983. Pyramica sahura ingår i släktet Pyramica och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fi.wikipedia.org/wiki/Long_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/LBCmontagebytisoy.JPG","page_title":"Long Beach","context_page_description":"Long Beach on kaupunki ja satama Yhdysvaltojen Kalifornian osavaltiossa Los Angelesin piirikunnassa. Nimensä kaupunki on saanut pitkän hiekkarantansa mukaan. Long Beach on perustettu vuonna 1882 ja hallinnollisesti siitä tuli kaupunki vuonna 1888. Kaupunki on kasvanut osana Los Angelesin metropolialuetta ja Long Beachin satama on yksi maailman vilkkaimmista. Vuoden 2010 väestönlaskennan mukaan Long Beachin asukasluku oli 462 257."},{"page_url":"https://da.wikipedia.org/wiki/Sam_Huntington","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/2013_Syfy_Press_Day_%2810173914304%29.jpg","page_title":"Sam Huntington","context_page_description":"Sam Huntington, er en amerikansk skuespiller.\\nHuntington spiller Jeremiah i filmen Detroit Rock City og Jimmy Olsen i filmen Superman Returns. Han spiller også hovedrollen i den amerikanske film Jungle 2 Jungle. Han medvirker også i filmene Rolling Kansas, Not Another Teen Movie og komediefilmen Fanboys."},{"page_url":"https://war.wikipedia.org/wiki/Carex_michelii","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Carex_michelii_%28Micheli-Segge%29_IMG_9379.JPG","page_title":"Carex michelii","context_page_description":"An Carex michelii in uska species han Liliopsida nga ginhulagway ni Nicolaus Thomas Host. An Carex michelii in nahilalakip ha genus nga Carex, ngan familia nga Cyperaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://gl.wikipedia.org/wiki/Barreiro,_Antas_de_Ulla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Barreiro_Casa_Grande.jpg","page_title":"Barreiro, Antas de Ulla","context_page_description":"San Cibrao de Barreiro é unha parroquia que se localiza no concello de Antas de Ulla. Segundo o IGE en 2009 tiña 43 habitantes, distribuídos en 5 entidades de poboación, o que supón unha diminución en relación ao ano 1999 cando tiña 67 habitantes."},{"page_url":"https://pl.wikipedia.org/wiki/Linia_kolejowa_nr_204","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Rail_POl_204.png","page_title":"Linia kolejowa nr 204","context_page_description":"Linia kolejowa nr 204 – częściowo zelektryfikowana pierwszorzędna linia kolejowa o znaczeniu państwowym łącząca Malbork ze stacją Braniewo przez Elbląg. Położona w północnej Polsce, w granicach dwóch województw: pomorskiego oraz warmińsko-mazurskiego, na obszarze Oddziałów Regionalnych PKP PLK w Gdyni i w Olsztynie.\\nLinia ta jest częścią strategicznie ważnej do 1945 roku magistrali kolejowej łączącej Berlin ze stolicą Prus Wschodnich – Królewcem."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%B6%D5%A1_%D5%AF%D5%A1%D5%BF%D5%B8%D6%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Van_Cat_1_2015.JPG","page_title":"Վանա կատու","context_page_description":"Վանա կատու, կիսաերկարագեղմ ընտանի կատուների ցեղատեսակ, որը սերում է Վանա լճի շրջակա տարածքից՝ Արևմտյան Հայաստանում՝ այժմյան Թուրքիայի կազմում գտնվող Հայկական լեռնաշխարհի մասից։\\nՎանա կատուն, ինչպես Հայկական լեռնաշխարհի բոլոր ընտանի կատուները, ներառյալ այս տարածաշրջանի կատուների հիման վրա ստեղծված կատուների ժամանակակից ցեղատեսակները՝ Թուրքական Անգորա, Թուրքական Վան և Անատոլի, գենետիկորեն պատկանում են միևնույն խմբին և հանդիսանում են հնագույն ընտանեցված կատուների ժառանգներ։ Ինչպես ցույց է տվել կատուների գենետիկ ուսումնասիրությունը, կատուն ընտելացվել է մարդու կողմից Առաջավոր Ասիայի Բերրի կիսալուսնի տարածքում մոտ 9500 տարի առաջ, երբ մարդը անցել է նստակյաց կյանքի և սկսել է զբաղվել ցորենի աճեցմամբ և առաջացել են ցորենի պաշարներ:"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_la_Corr%C3%A8ze","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Conc%C3%A8ze_-_%C3%89glise_Saint-Julien-de-Brioude.jpg","page_title":"Liste des monuments historiques de la Corrèze","context_page_description":"Cet article recense les monuments historiques de la Corrèze, en France.\\nPour les monuments historiques de Brive-la-Gaillarde, voir la liste des monuments historiques de Brive-la-Gaillarde\\nPour les monuments historiques de Collonges-la-Rouge, voir la liste des monuments historiques de Collonges-la-Rouge"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B5%82%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%86%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B5%8D_%E0%B4%B6%E0%B4%BF%E0%B4%B5%E0%B4%BE%E0%B4%B2%E0%B4%AF%E0%B4%99%E0%B5%8D%E0%B4%99%E0%B5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Muthuvara_Shiva_Temple.JPG","page_title":"നൂറ്റെട്ട് ശിവാലയങ്ങൾ","context_page_description":"ഹൈന്ദവ വിശ്വാസ പ്രകാരം വിഷ്ണുവിന്റെ അവതാരമായ പരശുരാമൻ ക്ഷത്രിയ നിഗ്രഹം കഴിഞ്ഞ് ബ്രാഹ്മണർക്ക് ദാനം ചെയ്യാനായി തന്റെ ആയുധമായ പരശു കൊണ്ട് സമുദ്രത്തിൽ നിന്ന് വീണ്ടെടുത്ത പ്രദേശമാണ് കേരളം. പരശുരാമൻ ഗോകർണത്തിനും കന്യാകുമാരിക്കുമിടയിലുള്ള ഈ പ്രദേശത്തിനെ 64 ഗ്രാമങ്ങളായി വിഭജിച്ചു. ഈ 64 ഗ്രാമങ്ങളിൽ 32 ഗ്രാമങ്ങൾ ഗോകർണ്ണത്തിനും പെരുംകുളത്തിനും ഇടയിൽ തുളു നാട്ടിലും, 32 ഗ്രാമങ്ങൾ പെരുംകുളത്തിനും കന്യാകുമാരിക്കും ഇടയിലായി മലയാളനാട്ടിലുമാണ്. ഈ 64 ഗ്രാമങ്ങളിലായി 108 മഹാശിവലിംഗ പ്രതിഷ്ഠകളും, 108 ദുർഗ്ഗാ പ്രതിഷ്ഠകളും നടത്തി. 108 ശിവക്ഷേത്രങ്ങൾ ശിവാലയസോത്രത്തിൽ പ്രതിപാദിച്ചിട്ടുണ്ട്."},{"page_url":"https://sh.wikipedia.org/wiki/Snooker","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Snooker_rest_crop.JPG","page_title":"Snooker","context_page_description":"Snooker je sport preciznosti u kojem se igra odvija na stolu oblika pravokutnika prekrivenim zelenom podlogom. Mjere stola su, izražene u SI sustavu, 3.66x1.83m, a rupe se nalaze u sva četiri kuta stola, dok su još dvije smještene u sredini stola, svaka s jedne strane. Za natjecateljsku igru potrebna su dva ili četiri igrača, štap, bijela kugla, petnaest crvenih kugli i šest boja čija je vrijednost od 2 do 7, ovisno koja je kugla ubačena. Igrač osvaja frame nakon što postigne veći broj bodova od suparnika koristeći isključivo vrh štapa sa svrhom ubacivanja crvenih i ostalih kugli po unaprijed određenim pravilima. Svaki dvoboj sastoji se od unaprijed dogovorenoga broja frameova, a pobjeđuje igrač ili momčad s većim brojem osvojenih frameova.\\nIgra je iznimno popularna u mnogim državama engleskoga govornoga područja, državama Commonwealtha i Dalekoga istoka. Najbolji profesionalni igrači tijekom karijere zarade višemilijunske iznose izražene u britanskim funtama samo od nagradnih fondova na turnirima."},{"page_url":"https://en.wikipedia.org/wiki/Arno_B._Cammerer","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Arno_Cammerer.jpg","page_title":"Arno B. Cammerer","context_page_description":"Arno Berthold Cammerer was the third director of the U.S. National Park Service."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A5%D0%B8%D1%80%D1%88%D0%B1%D0%B0%D1%85_(%D0%9C%D1%8E%D0%BB%D1%8C%D0%BA%D1%80%D0%B0%D0%B9%D1%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Hirschbach_Ortsansicht.jpg","page_title":"Хиршбах (Мюлькрайс)","context_page_description":"Хиршбах (Мюлькрайс) — Аустриядағы коммуна. Жоғарғы Аустрия федералды жеріне қарасты Фрайштадт округінің құрамына енеді.\\nҚаланың тұрақты тұрғындарының саны 1153 адамды құрайды. Алып жатқан жер аумағы 23.6 км² шамасында. Елді мекеннің автомобиль коды — FR, ресми идентификациялық коды — 4 06 05.\\n2003 жылғы сайлау нәтижесі бойынша коммунаның бургомистрі болып Штефан Визингер саналады."},{"page_url":"https://en.wikipedia.org/wiki/Vallum_(Hadrian%27s_Wall)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/The_Vallum_crossing_at_Benwell_Fort_-_geograph.org.uk_-_837826.jpg","page_title":"Vallum (Hadrian's Wall)","context_page_description":"The Vallum is a huge earthwork associated with Hadrian's Wall in England. Unique on any Roman frontier, it runs practically from coast to coast to the south of the wall.\\nThe earliest surviving mention of the earthwork is by Bede, who refers to a vallum, or earthen rampart, as distinct from the wall, or murus; the term is still used despite the fact that the essential element is a ditch, or fossa. It was long thought that the Vallum predated the stone wall, whose most elaborate phasing was presented in 1801 by William Hutton, who thought, wrongly, that the south vallum mound and the marginal mound, with a ditch between, were the work of Agricola, that the vallum ditch and north mound were added by Hadrian, and that the stone wall was the work of Severus. In fact all these elements date to Hadrian's reign, with the stone wall having been built first."},{"page_url":"https://en.wikipedia.org/wiki/Joseph_Alexandre_Camille_Madore","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Joseph_Alexandre_Camille_Madore.jpg","page_title":"Joseph Alexandre Camille Madore","context_page_description":"Joseph Alexandre Camille Madore was a Canadian politician.\\nBorn in Blue Bonnet's, Canada East, Madore was educated at the Montreal College, St. Mary's College and at McGill University, where he graduated a\\nB.C.L. in 1880. In 1881 he was called to the Quebec Bar. He was elected to the House of Commons of Canada for Hochelaga in the 1896 federal election. A Liberal, he was re-elected in 1900. In 1903, he was appointed Puisne Judge of the Supreme Court of Quebec."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1934","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Hay_Lamberts_%281961%29.jpg","page_title":"Lijst van personen geboren in 1934","context_page_description":"Dit is een lijst van personen die geboren zijn in 1934.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Grigoris_(Katholikos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Amaras_Monastery2.jpg","page_title":"Grigoris (Katholikos)","context_page_description":"Grigoris oder Krikoris bzw. Gregor aus der Familie der Gregoriden, war etwa von 327 bis 343 n. Chr. Katholikos von Albania im Kaukasus und von Iberien. Er starb als Märtyrer, wird daher als Heiliger verehrt."},{"page_url":"https://fi.wikipedia.org/wiki/Godsmack","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Godsmack.PNG","page_title":"Godsmack","context_page_description":"Godsmack on yhdysvaltalainen metallimusiikkia soittava yhtye, jonka laulaja ja lauluntekijä Sully Erna perusti vuonna 1996 Lawrencessa, Massachusettsissa. Alkuun yhtye soitti death metalia, mutta tyylisuunta muuttui sittemmin hard rock -vaikutteisemmaksi metalliksi. Godsmack on ottanut vaikutteita muun muassa Alice in Chainsilta, jonka kappaleen ”God Smack” mukaan yhtye valitsi nimensäkin.\\nGodsmack nousi suosioon debyyttialbuminsa aikoihin hittisinglejen ”Voodoo” ja ”Whatever” sekä tiiviin keikkailun ansiosta. Seuraava albumi Awake nosti yhtyettä suurempaan suosioon kappaleiden ”Awake” ja ”Greed” ansiosta. Vuonna 2002 yhtye oli ehdolla Grammy-palkinnon saajaksi parhaasta instrumentaalisesta rock-kappaleesta. Seuraavana vuonna Godsmack julkaisi kolmannen albuminsa Faceless, joka nousi Yhdysvaltojen levylistan ykköseksi ja singlet ”I Stand Alone” ja ”Straight Out of Line” nousivat hiteiksi. Faceless-albumin tapaan myös vuoden 2006 albumi Godsmack IV nousi kotimaansa ykköseksi."},{"page_url":"https://fr.wikipedia.org/wiki/Bretagne_(1855)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/French_First_Rate_Sails_Layout_1857.jpg","page_title":"Bretagne (1855)","context_page_description":"La Bretagne est un vaisseau rapide mixte de 130 canons à trois ponts inspiré du Napoléon, mais conçu par l'ingénieur polytechnicien Jules Marielle et lancé en 1855. La décision de le motoriser a été prise après la mise sur cale. Il est seul de son type. La machine de 1 200 CV comprenait un « appareil évaporatoire » de huit corps de chaudières à cinq fourneaux chacun, et qui permettait de filer 13,5 nœuds environ avec de bons chauffeurs. Il consommait 150 tonnes de charbon par 24 heures. L'hélice à deux ailes doubles pouvait être remontée afin de ne pas gêner la marche à la voile. La machine était composée de deux cylindres.\\nLe vaisseau est retiré du service actif de la flotte en 1866 pour servir de caserne, puis de navire-école aux novices et apprentis marins en rade de Brest. Il sera définitivement condamné en 1879 avant d'être démantelé l'année suivante."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B9%D0%BD_%D0%A0%D1%8D%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ayn_Rand_%281943_Talbot_portrait%29.jpg","page_title":"Айн Рэнд","context_page_description":"Айн Рэнд — американская писательница и философ, родившаяся в Российской империи. Она известна своими двумя романами-бестселлерами — «Источник» и «Атлант расправил плечи»; работала также как драматург и сценарист. Айн — создательница философской системы, названной ею объективизмом.\\nЗакончив Петроградский университет по специальности «социальная педагогика», она в 1925 году по студенческой визе уехала в США, откуда решила не возвращаться. В 1932 году студия Universal Pictures купила для экранизации её сценарий «Красная пешка», что обеспечило Рэнд известность в профессиональной среде. В 1935 и 1936 году она поставила пьесу в Бродвейском театре. Первые два романа Рэнд не были успешными. Широкая известность к ней пришла с выходом романа «Источник» в 1943 году. В 1957 году из под пера Рэнд вышла её самая известная работа — роман «Атлант расправил плечи». Впоследствии она переключилась на научную литературу, чтобы продвигать свою философию. Она начала публиковать периодические издания, а также написала несколько сборников эссе.\\nРэнд превозносила разум как единственный источник приобретения знаний и отвергала веру и религию."},{"page_url":"https://en.wikipedia.org/wiki/United_States_border_preclearance","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/YUL_U.S._Departures_Sector.JPG","page_title":"United States border preclearance","context_page_description":"United States border preclearance facilities are prescreening border controls operated by the United States Department of Homeland Security at airports and other ports of departure located outside the United States under agreement between the host country and the federal government of the United States. Travelers are subject to immigration and customs inspections by U.S. Customs and Border Protection officers before boarding their transportation onward to the United States. Preclearance applies to all passengers regardless of their nationality or purpose of travel. Upon arrival, pre-cleared passengers are treated as domestic passengers and do not need to be screened again. This process is intended to streamline border procedures, reduce congestion at American ports of entry, and facilitate travel into airports that otherwise lack customs processing facilities.\\nPreclearance facilities were first introduced in Toronto under an informal arrangement with the Canadian government, and are now available at eight major Canadian airports with facilities under consideration as sea ports and rail stations."},{"page_url":"https://hu.wikipedia.org/wiki/Solea_solea","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Seezunge_kopf.jpg","page_title":"Solea solea","context_page_description":"A Solea solea vagy közönséges nyelvhal a csontos halak főosztályának a sugarasúszójú halak osztályába, ezen belül a lepényhalalakúak rendjébe és a nyelvhalfélék családjába tartozó faj."},{"page_url":"https://fr.wikipedia.org/wiki/Peter_Singer","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Peter_Singer_MIT_Veritas.jpg","page_title":"Peter Singer","context_page_description":"Peter Albert David Singer dit Peter Singer, né le 6 juillet 1946 à Melbourne, est un philosophe utilitariste australien. Il est titulaire de la chaire d'éthique de l'université de Princeton et professeur à l'université Charles-Sturt en Australie.\\nIl a travaillé deux fois dans la chaire de philosophie de l'université Monash, où il a créé le centre de bioéthique humaine. En 1996, il se présenta sans succès en tant que candidat Vert pour le Sénat australien. En 2004, il fut reconnu comme l'humaniste australien de l'année par le Conseil des sociétés humanistes australiennes. En dehors du milieu universitaire, Singer est surtout connu pour son livre La Libération animale, considéré comme le livre fondateur des mouvements modernes de droits des animaux. Ses positions sur des questions de bioéthique développées dans Rethinking Life and Death : The Collapse of Our Traditional Ethics et Questions d'éthique pratique ont également suscité la controverse, notamment aux États-Unis et en Allemagne. Singer est partisan de l'altruisme efficace dont il décrit les principes dans The Life You Can Save et The Most Good You Can Do."},{"page_url":"https://en.wikipedia.org/wiki/List_of_oldest_known_surviving_buildings","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/PiramideTeti.jpg","page_title":"List of oldest known surviving buildings","context_page_description":"\\"Building\\" is defined as any human-made structure used or interface for supporting or sheltering any use or continuous occupancy. In order to qualify for this list a structure must:\\nbe a recognisable building;\\nincorporate features of building work from the claimed date to at least 1.5 metres in height;\\nbe largely complete or include building work to this height for most of its perimeter.\\ncontain an enclosed area with at least one entry point.\\nThis consciously excludes ruins of limited height and statues. The list also excludes:\\ndolmens, a type of single-chamber megalithic tomb, usually consisting of three or more upright stones supporting a large flat horizontal capstone. Dolmens were typically covered with earth or smaller stones to form a tumulus. In many instances, that covering has weathered away, leaving only the stone \\"skeleton\\" of the burial mound intact. Neolithic dolmens are extremely numerous, with over 1,000 reported from Mecklenburg-Vorpommern in Germany alone.\\ncairns, which are simply large piles of loose stones\\nstanding stone rings, such as Stonehenge, also do not count because they are not enclosed and do not have roofs."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D1%96%D0%BD%D0%B0%D0%B3%D1%80%D0%B0%D0%B4_%D0%B0%D0%BC%D1%83%D1%80%D1%81%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Vitis_amurensis.jpg","page_title":"Вінаград амурскі","context_page_description":"Вінаград амурскі — від драўняных ліян з роду Вінаград сямейства Вінаградавыя."},{"page_url":"https://ast.wikipedia.org/wiki/Rex%C3%B3n_de_los_Grandes_Llagos","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Great_Lakes_Region_North_America.svg","page_title":"Rexón de los Grandes Llagos","context_page_description":"La Rexón de los Grandes Llagos d'América del Norte ye una rexón binacional, estauxunidense y canadiense, qu'inclúi parte del territoriu de los estaos estauxunidenses d'Illinois, Indiana, Michigan, Minnesota, Nueva York, Ohio, Pennsylvania y Wisconsin y de la provincia canadiense d'Ontario. La rexón, na que los Grandes Llagos ocupen un llugar central, conforma una rexón con una identidá histórica, económica y cultural propia. Parte del so territoriu forma parte tamién de la Megalópolis de los Grandes Llagos.\\nLa Comisión de los Grandes Llagos, una axencia interestatal autorizada pa les sos funciones polos estaos estauxunidenses antes nomaos y poles provincies canadienses de Quebec y Ontario, ye una autoridá binacional con poderes específicos pa protexer y preservar l'agua y los recursos mediuambientales de los Grandes Llagos y de los acuíferos y cursos d'agua de la so rodiada. Los sos cabezaleros, pa selo, tienen de ser confirmaos nel so cargu polos gobiernos federales de los dos países, y polos estatales y provinciales de les sos subunidades alministratives."},{"page_url":"https://vi.wikipedia.org/wiki/B%C3%ACa_c%E1%BB%A9ng","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Playing_Cards.JPG","page_title":"Bìa cứng","context_page_description":"Bìa cứng, còn gọi là các tông hay giấy bồi là một thuật ngữ chung để chỉ một loại giấy nặng với độ dày và cứng khác nhau, từ một sự sắp xếp đơn giản của một tấm giấy cứng duy nhất đến cấu hình phức tạp gồm nhiều lớp, có thể có nếp hay gợn sóng.\\nThường là các-tông làm bằng bột giấy, bột giấy cơ học và giấy cũ, cùng với những thứ khác, trong kỹ thuật in và trong ngành công nghiệp bao bì để bảo vệ hàng hóa đóng gói, trong nghệ thuật đồ họa và thủ công mỹ nghệ làm nguyên liệu nghệ thuật và như một bề mặt thiết kế.\\nMặc dù từ các-tông được sử dụng lan rộng nói chung thuật ngữ này thường ít dùng trong các ngành kinh doanh và công nghiệp. Các ngành sản xuất vật liệu, các nhà sản xuất container, kỹ sư đóng gói, và các tổ chức định tiêu chuẩn, đã cố gắng sử dụng những thuật ngữ cụ thể hơn, thường là thuật ngữ \\"các-tông\\"\\"giấy bồi\\" được tránh, bởi vì khái niệm mơ hồ và nó không xác định bất kỳ nguyên vật liệu đặc biệt. Tùy theo vật liệu và cấu tạo bề mặt, các tông khi đó được xác định bằng những thuật ngữ chính xác hơn."},{"page_url":"https://es.wikipedia.org/wiki/Adolfo_Florensa","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Facultat_de_N%C3%A0utica%2C_Pla_de_Palau.jpg","page_title":"Adolfo Florensa","context_page_description":"Adolfo Florensa Ferrer. Arquitecto español."},{"page_url":"https://jv.wikipedia.org/wiki/Batang_utek","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Gray719.png","page_title":"Batang utek","context_page_description":"Batang utek utawa brainstem iku pérang ngisor saka utek, kang nggandhèngaké lan kanthi struktur nerisaké saluran saraf. Batang utek nyadiakake motor utama lan sensory innervation menyang rai lan gulu liwat saraf kranial. Sanadyan ukurané mung cilik, batang utek minangka pérangan kang wigati banget minangka pengubung saraf motorik lan saraf sènsor saka pérangan utama utek menyang sakujur awak. Iki kalebu corticospinal tract, posterior column-medial lemniscus pathway lan spinothalamic tract. Batang utek uga mainaké peran wigati ngenani regulasi fungsi jantung lan sistem ambegan. Batang utek uga ngatur sistem saraf pusat, lan dadi sumbu sajeroning kaanan sadhar lan ngatur siklus turu. Sawetara taksonomi mratélakaké batang utek minangka medulla oblongata lan pons, sawatara liyané kalebu ing midbrain."},{"page_url":"https://en.wikipedia.org/wiki/Soomaa_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Raudna_j%C3%B5gi-masterplaan-2008.jpg","page_title":"Soomaa National Park","context_page_description":"Soomaa National Park is a national park in south-western Estonia. Soomaa protects 390 km², the park was created in 1993. Soomaa is Important Bird Area since 1989 and a Ramsar site of protected wetlands since 1997 and a Natura 2000 area since 2004."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A5%9E%E6%88%B8%E3%82%B5%E3%83%B3%E3%83%9C%E3%83%BC%E3%83%9B%E3%83%BC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Kobe_Commerce_Industry_and_Trade_Center_Building02n3200.jpg","page_title":"神戸サンボーホール","context_page_description":"神戸サンボーホールは、兵庫県神戸市中央区にある多目的ホール。"},{"page_url":"https://en.wikipedia.org/wiki/Canada%E2%80%93United_States_border","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/USBP_snow_M14_2017.jpg","page_title":"Canada–United States border","context_page_description":"The Canada–United States border, officially known as the International Boundary, is the longest international border in the world between two countries. Shared between Canada and the United States, the border belongs to the second- and third-/fourth-largest countries by respective area. The terrestrial boundary is 8,891 kilometres long, of which 2,475 kilometres is the border of Alaska with British Columbia and Yukon. The agencies currently responsible for facilitating legal passage through the international boundary are the Canada Border Services Agency and U.S. Customs and Border Protection."},{"page_url":"https://sk.wikipedia.org/wiki/Jaroslav_Vrchlick%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Jan_Vil%C3%ADmek_-_Jaroslav_Vrchlick%C3%BD_cut.jpg","page_title":"Jaroslav Vrchlický","context_page_description":"Jaroslav Vrchlický, vlastným menom Emil Frida, bol český spisovateľ, básnik, dramatik a prekladateľ."},{"page_url":"https://no.wikipedia.org/wiki/Hans_Howaldt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Hans_Howaldt_%281888-1970%29.jpg","page_title":"Hans Howaldt","context_page_description":"Hans Howaldt var en tysk marienoffiser under begge verdenskriger, og seiler som deltok i de olympiske leker 1936 i Berlin.\\nHowaldt var en høyt dekorert ubåtskommandør i Kaiserliche Marine under første verdenskrig han ble utnevnt til kapteinløytnant. Under hans kommando stod ubåter som opererte for det meste i Den engelske kanal og som senket 76 skip på rundt 150.000 tonn. Han deltok også i den andre verdenskrig som kaptein på en stor minelegger og kommandant for en gruppe mineleggere som opererte i Østersjøen, Kattegat og Skagerak.\\nHowaldt vant en olympiske bronsemedalje i seiling under OL 1936 i Berlin. Han var med på den tyske båten «Germania III» som kom på tredjeplass i 8-metersklassen bak den italienske båten «Italia» og «Silija» fra Norge. Seilingene ble avviklet utenfor Kiel i perioden 4. til 12. august 1936. Mannskapet på «Germania III» var Howaldt, Felix Scheder-Bieschin, Alfried Krupp von Bohlen und Halbach, Eduard Mohr, Fritz Bischoff og Otto Wachs."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%88%D8%AC%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Kroger_logo_%281939%E2%80%9361%29.svg","page_title":"كروجر","context_page_description":"شركة كروجر، أو ببساطة كروجر، هي شركة بيع بالتجزئة أمريكية أسسها برنارد كروجر في عام 1883 في مدينة سينسيناتي بولاية أوهايو. إنها أكبر سلسلة متاجر في الولايات المتحدة من حيث الإيرادات، ثاني أكبر متاجر تجزئة عامة، وسابع عشر أكبر شركة في الولايات المتحدة. هي أيضًا خامس أكبر شركة تجارة تجزئة في العالم ورابع أكبر شركة خاصة مملوكة للولايات المتحدة في الولايات المتحدة. يحتل كروجر المرتبة 17 في تصنيف \\" فورتشن 500 \\" لأكبر شركات الولايات المتحدة من حيث إجمالي الإيرادات.\\nاعتبارا من 12 سبتمبر 2019، تعمل كروجر، سواء بشكل مباشر أو من خلال فروعها، بـ 2,759 سوبر ماركت ومتاجر متعددة الأقسام. يقع مقر كروجر في وسط مدينة سينسيناتي. فإنه يحافظ على الأسواق في 35 ولاية و مقاطعة كولومبيا، مع الأشكال مخزن التي تشمل محلات السوبر ماركت، محلات السوبر ماركت، المتاجر، المحلات التجارية، و 251 المجوهرات مخازن. توجد محلات البقالة التي تحمل علامتها في الولايات الوسطى والجنوبية الأمريكية. تدير الشركة 35 منشأة لمعالجة أو تصنيع الأغذية، و 1556 مركزًا للوقود في السوبر ماركت، و 2264 صيدلية، و 221 عيادة طبية صغيرة في المتجر.\\nيتم تمثيل موظفي كروجر في الغالب من خلال اتفاقيات المفاوضة الجماعية ويمثل الكثيرون من قبل نقابة عمال الأغذية والتجارة المتحدة."},{"page_url":"https://eo.wikipedia.org/wiki/Paseroformaj_birdoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Golden-headed_Manakin.jpg","page_title":"Paseroformaj birdoj","context_page_description":"Paseroformaj estas ordo de birdoj, kiu inkluzivas pli ol la duonon de ĉiu birdospecio. Foje konataj kiel ripozbirdoj aŭ, eĉ, malpli taŭge, kiel kantobirdoj, la paseroformaj formas unu el la plej diversaj teraj ordoj de vertebruloj: kun ĉirkaŭ 5,093 specioj, ĝi estas preskaŭ duoble tiom diversa kiom la plej granda ordo de mamuloj, la Ronĝuloj.\\nLa nomo \\"paseroformaj\\" devenas el Passer domesticus, la scienca nomo de la tipa specio – Pasero – kaj el la latina termino passer por la Paseroj kaj similaj etaj birdoj."},{"page_url":"https://en.wikipedia.org/wiki/Henry_Winterfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Henry_winterfeld_promo_cropped.jpg","page_title":"Henry Winterfeld","context_page_description":"Henry Winterfeld, published under the pseudonym Manfred Michael, was a German writer and artist famous for his children's and young adult novels. He emigrated to the U.S. in 1940 and lived there until his death.\\nHenry Winterfeld was married to Elsie Winterfeld, who was a designer of toys and created a patented three-headed doll."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Hronec","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Hronec_-_%C5%BEelezni%C4%8Dn%C3%A1_v%C3%BDpravn%C3%A1_budova.JPG","page_title":"Liste der denkmalgeschützten Objekte in Hronec","context_page_description":"Die Liste der denkmalgeschützten Objekte in Hronec enthält die acht nach slowakischen Denkmalschutzvorschriften geschützten Objekte in der Gemeinde Hronec im Okres Brezno."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%88%D9%86%D9%8A%D9%83%D8%A7_%D8%AA%D8%B1%D8%A7%D9%BE%D8%A7%D8%AC%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Monica_Trapaga.jpg","page_title":"مونيكا تراپاجا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمونيكا تراپاجا مغنيه من اوستراليا."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%82%BF%E3%83%AA%E3%82%A2%E3%81%AE%E9%89%84%E9%81%93%E8%BB%8A%E4%B8%A1%E4%B8%80%E8%A6%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/FS_530.jpg","page_title":"イタリアの鉄道車両一覧","context_page_description":"イタリアの鉄道車両一覧では、イタリア国内の民間・委託を含めた鉄道網を巡る鉄道車両を集めた表である。"},{"page_url":"https://sv.wikipedia.org/wiki/Sk%C3%A4lby_g%C3%A5rd,_Botkyrka_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Sk%C3%A4lby%2C_Botkyrka%2C_2018b.jpg","page_title":"Skälby gård, Botkyrka kommun","context_page_description":"Skälby var en herrgård och ett säteri i Grödinge socken, nuvarande Botkyrka kommun. Av den historiska bebyggelsen återstår idag några ekonomibyggnader och en stuga från 1800-talets slut och 1900-talets början. På Skälbys tidigare åkermark ligger sedan år 2000 Grödinge Golfcenters golfbanor."},{"page_url":"https://it.wikipedia.org/wiki/Charles_Stuart,_I_barone_Stuart_de_Rothesay","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Lady_Stuart_de_Rothesay_and_her_daughters_by_George_Hayter.jpg","page_title":"Charles Stuart, I barone Stuart de Rothesay","context_page_description":"Charles Stuart, I barone Stuart de Rothesay, è stato un diplomatico inglese. È stato due volte ambasciatore in Francia e ha anche servito come ambasciatore in Russia tra il 1841 e il 1844."},{"page_url":"https://ca.wikipedia.org/wiki/Jamesita","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Jamesite-177451.jpg","page_title":"Jamesita","context_page_description":"La jamesita és un mineral de la classe dels arsenats. Va ser descoberta l'any 1981 a la mina Tsumeb, Regió d'Otjikoto, Namíbia. Rep el seu nom en honor de Christopher James, un dels primers enginyers de mines de la mina Tsumeb."},{"page_url":"https://tr.wikipedia.org/wiki/Elsa_Triolet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Elsa-triolet-1925.jpg","page_title":"Elsa Triolet","context_page_description":"Elsa Yur'evna Triolet Moskova doğumlu Fransız yazar, çevirmen, Louis Aragon'un eşi, Liliya Brik'in kardeşi.\\n1896 yılında Moskova'da doğdu. Yahudi bir ailenin çocuğu olan Elsa Kagan'ın annesi müzik öğretmeni, babası ise avukattı. Elsa ve kızkardeşi mükemmel bir eğitim gördü. Almancayı ve İngilizceyi çok iyi konuşuyorlar ve çok güzel piyano çalıyorlardı. Elsa Moskova Mimari Akademisini bitirdi.\\nŞiiri çok seviyordu. 1915 yılında şair Vladimir Mayakovsky ile tanıştı. Kendisini eve davet ettiğinde Mayakovsky Elsa'nın kiz kardeşi Liliya Brik'e aşık oldu.1918'de Rus İç Savaşı sırasında Elsa bir Fransız süvari subayı olan Andre Triolet ile evlendi ve Fransa'ya göç etti. Ancak Triolet ile yaptığı evlilikte mutlu olamadı. Mayakovsky'nin ve diğer Rus şairlerinin şiirlerini Fransızcaya çevirdi. Daha sonra Triolet'den boşandı.\\n1920 yılında Tahiti'ye yaptığı seyahati mektuplarıyla, arkadaşı Victor Shklovsky'ye anlattı. O da mektupları Maksim Gorki'ye gösterdi. Gorki mektupların sahibinin yazarlığı düşünmesi gerektiğini söyledi.1925 yılında Rusça yayımlanan \\"Tahiti'de\\" adlı kitabı, bu mektupları temel alarak yazılmıştır.\\n1928 yılında Elsa, Fransız yazar Louis Aragon ile tanıştı."},{"page_url":"https://fr.wikipedia.org/wiki/The_Pretty_Sister_of_Jose","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/The_Pretty_Sister_of_Jose.jpg","page_title":"The Pretty Sister of Jose","context_page_description":"The Pretty Sister of Jose est un film muet américain réalisé par Allan Dwan et sorti en 1915."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Arnstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Arnstadt%2C_Markt_3-001.jpg","page_title":"Liste der Kulturdenkmale in Arnstadt","context_page_description":"In der Liste der Kulturdenkmale in Arnstadt sind die Kulturdenkmale der thüringischen Kreisstadt Arnstadt und ihrer Ortsteile aufgelistet. Mögliche Kulturdenkmale auf dem Gebiet der ehemaligen Gemeinde Wipfratal fehlen."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%98%D0%B5%D1%80%D0%B0_%D0%A0%D1%83%D1%81%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Krievijas_Rev%C4%ABzijas_pal%C4%81tas_priek%C5%A1s%C4%93d%C4%93t%C4%81js_%284187361112%29.jpg","page_title":"Списак премијера Русије","context_page_description":"Од оснивања Русије 1726. године, приближно 98 људи били су премијери у Влади Русије. Председник Владе је био члан Врховног тајног савета, који је основан 8. фебруара 1726. године по јулијанском календару од стране Катарине I Алексејевне, а од 8. септембра 1802. године усвојен је од стране Већа министра Русије, у складу са проглашењем цара Александара II Николајевича. Почевши од Александра Романовича Воронстова, најстарији официри били су де факто председници одбора. Осам година након инагурације, први законски службеник био је Николај Руманцев. Веће министара Русије је незванично формирано у октобру 1857. године као резултар реформи Александара II Николајевича. Прва седница почела је 19. децембра 1857. године. Пре стварања те функције 18. новембра 1861. године, за све је био задужен цар. Веће министара чинило је Државни савет Руске Империје, Комитет министара, и високе официре које именовао цар. Први састанак завршен је 11. децембра 1882. године након што је број докумената у Већу значајно смањен.\\nКомитет министара је функционисао истовремено са другом седницом Већа министара још шест месеци."},{"page_url":"https://fi.wikipedia.org/wiki/Juhana_III_Sobieski","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Siemiginowski_Sobieski_at_the_Battle_of_Vienna.jpg","page_title":"Juhana III Sobieski","context_page_description":"Juhana III Sobieski oli Puolan kuningas ja Liettuan suuriruhtinas vuodesta 1674 kuolemaansa saakka. Puolassa Juhana muistetaan etenkin turkkilaisista saavutetusta voitosta Wienin taistelussa vuonna 1683, mutta toisaalta Sobieski syyllistyi useisiin poliittisiin epäonnistumisiin. Muisto epäonnistumisista on kuitenkin hämärtynyt loistokkaamman sotamenestyksen varjossa ja Sobieskin valtakausi tunnetaan viimeisenä Puola-Liettuan suuruuden hetkenä."},{"page_url":"https://en.wikipedia.org/wiki/%C3%96BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Aufkleber_150_J_Eisenbahn_Oesterreich.jpg","page_title":"ÖBB","context_page_description":"The Austrian Federal Railways, now commonly known as ÖBB, is the national railway system of Austria, and the administrator of Liechtenstein's railways. The ÖBB group is owned entirely by the Republic of Austria and is divided into several separate businesses that manage the infrastructure and operate passenger and freight services.\\nThe Austrian Federal Railways has had two discrete periods of existence. It was first formed in 1923, using the Bundesbahn Österreich name, as a successor to the Imperial Royal Austrian State Railways, but was incorporated into the Deutsche Reichsbahn during the 1938–1945 Anschluss. It was reformed in 1947, under the slightly different name Österreichische Bundesbahnen, and remains in existence in this form.\\nMajor changes currently being made to the Austrian railway network are the construction of the Koralm Railway, the Semmering Base Tunnel and the Brenner Base Tunnel connection with Italy.\\nEurobarometer survey conducted in 2018 showed that satisfaction levels of Austrian rail passengers are among the highest in the European Union when it comes to punctuality, reliability and frequency of trains."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%8E%E5%9B%BD%E5%A4%AA%E7%A9%BA%E5%8F%B8%E4%BB%A4%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Seal_of_the_Combined_Space_Operations_Center.png","page_title":"美国太空司令部","context_page_description":"美國太空司令部是隸屬美國國防部的一體化作戰司令部之一，負責太空作戰。太空司令部於1985年成立，後於2002年解編，其職責併入美國戰略司令部內，直至2019年8月29日重編。"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%B3%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Nauplius_larva_of_a_cyclops_copepod.jpg","page_title":"Велигер","context_page_description":"Велигер - желкенші - көптеген теңіз құрсакаяқтылар мен қосжақтаулы былқылдақденелілердің- пелагиялық дернәсілі. Кейбір былқылдақ- денелілердің велигер жұмыртқадан шығып - басқаларында трохофора кезеңін өткізіп дамиды. Велумі- аяқтары - ішектері - көзі - тепе-теңдік - ұстау мүшелері - дернәсілдік қабыршағын - қалыптастыратын затты бөлетін қабыршакты бездері бар және оған денесінің алдыңғы бөлігі және оған басқа мүшелер мен мүшелер жүйесі тартылуы мүмкін. Кейбір велигер су қабатында ұзақ уақыт жүзеді де - ағынмен үлкен арақашықтықтарға жиі таралуы мүмкін. Су түбіне түскеннен кейін олар ересек былқылдақденелілерге айналады."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D1%88%D0%B0_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%8C%D0%BA%D0%B0_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D1%96%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/3consuls.jpg","page_title":"Перша французька республіка","context_page_description":"Перша французька республіка, офіційно Французька республіка, період французької історії з 1792 по 1804. Республіку було проголошено 21 вересня 1792 року під час французької революції; того дня формально було зміщено Людовика XVI. Офіційно республіка проіснувала до утворення 1804 року Першої французької імперії чинним першим консулом Наполеоном Бонапартом, що проголосив себе імператором, хоча де-факто Республіка перестала існувати після перевороту 18 брюмера, здійсненого тим же Бонапартом. Після цього було встановлено консулат."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B7%D5%AC%D5%A6%D5%A1_%D4%B2%D5%A5%D5%BD%D5%AF%D5%B8%D5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Tant_Gr%C3%B6n%2C_tant_Brun_och_tant_Gredelin.jpg","page_title":"Էլզա Բեսկով","context_page_description":"Էլզա Բեսկով, շվեդ հեղինակ, մանկական գրքեր պատկերազարդող: Նրա առավել հայտնի գրքերից են Tale of the Little Little Old Woman և Aunt Green, Aunt Brown and Aunt Lavender:"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_augustus_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Toni_Morrison.jpg","page_title":"Lijst van personen overleden in augustus 2019","context_page_description":"Dit is een lijst van bekende personen die zijn overleden in augustus 2019."},{"page_url":"https://vi.wikipedia.org/wiki/Th%E1%BB%8Bt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Meat_Atlas_2014_meat_consumption_developing_countries.png","page_title":"Thịt","context_page_description":"Thịt thực phẩm hay gọi thường là thịt là mô cơ của một số loài động vật như bò, lợn, gà được dùng làm thực phẩm cho con người. Con người đã săn bắt và giết động vật để lấy thịt từ thời tiền sử. Sự ra đời của nền văn minh cho phép các loài động vật như gà, cừu, thỏ, lợn và gia súc được thuần hóa. Cuối cùng đã dẫn đến việc thịt của các loài động vật này được sản xuất ở quy mô công nghiệp với sự hỗ trợ của các lò mổ.\\nThịt có thành phần chủ yếu là nước, protein và chất béo. Thịt có thể được ăn sống, nhưng thông dụng nhất là sau khi đã được nấu chín và tẩm gia vị hoặc chế biến bằng nhiều cách khác nhau. Thịt chưa qua chế biến sẽ bị ôi thiu hoặc thối rữa trong vòng vài giờ hoặc vài ngày do bị nhiễm vi khuẩn và nấm.\\nThịt đóng vai trò quan trọng trong kinh tế và văn hóa, mặc dù việc sản xuất và tiêu thụ thịt hàng loạt đã được xác định là có nguy cơ đối với sức khỏe con người và môi trường. Nhiều tôn giáo còn quy định về việc được phép ăn những loại thịt nào. Những người ăn chay và thuần chay có thể kiêng ăn thịt vì lo ngại về đạo đức, ảnh hưởng môi trường của việc sản xuất thịt hoặc ảnh hưởng dinh dưỡng của việc tiêu thụ."},{"page_url":"https://en.wikipedia.org/wiki/Shinj%C5%8D_Domain","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Sinzyou_castle_bukiyagura2.jpg","page_title":"Shinjō Domain","context_page_description":"Shinjō Domain was a Japanese domain of the Edo period, located in Dewa Province Japan and ruled by the Tozawa clan. It was centered on Shinjō Castle in what is now the city of Shinjō, Yamagata and occupied all of what is now Mogami District with 86 villages and part of Kitamurayama District with 16 villages in modern-day Yamagata Prefecture."},{"page_url":"https://en.wikipedia.org/wiki/Selver","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/TLN-2008-Torupilli_Selver.JPG","page_title":"Selver","context_page_description":"Selver is a chain of supermarkets and hypermarkets operating in Estonia. Selver is a subsidiary of Tallinna Kaubamaja. The chain was established in 1995 with the opening of Punane Selver in Lasnamäe, Tallinn. Expansion outside of Tallinn began on 10 May 2002 with the opening of Mai Selver in Pärnu. Since 18 December 2008 Selver also operated in Latvia, but in the end of 2009 due to the financial crisis Selver was forced to close all its 6 supermarkets in Latvia. There are currently 44 stores in operation all over Estonia.\\nSelver is the exclusive retailer of the products of Selveri Köök - over 250 different salads, desserts, ready-made meals, etc."},{"page_url":"https://de.wikipedia.org/wiki/Krampus_(Band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Krampus_-_Heidenfest_-_2.11.2012_Geiselwind_%288176851663%29.jpg","page_title":"Krampus (Band)","context_page_description":"Krampus ist eine italienische Folk-Metal-Band aus Udine. Der Bandname bezieht sich auf die Schreckgestalt Krampus, des alpenländischen Adventsbrauchtums."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Vigor_de_Neau","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Fresque_2_St_Vigor_de_Neau.JPG","page_title":"Église Saint-Vigor de Neau","context_page_description":"L'église Saint-Vigor de Neau est une église romane dédiée à saint Vigor, et située au sud du village de Neau en Mayenne, entre Évron et Brée. Aux origines très anciennes, elle abrite des peintures murales médiévales redécouvertes dans les années 1970."},{"page_url":"https://es.wikipedia.org/wiki/Corona_Imperial_(Sacro_Imperio_Romano_Germ%C3%A1nico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Weltliche_Schatzkammer_Wien_%28169%29pano2.jpg","page_title":"Corona Imperial (Sacro Imperio Romano Germánico)","context_page_description":"La Corona Imperial del Sacro Imperio Romano Germánico es la corona que utilizaron los \\"Reyes de los Romanos\\", título empleado por los sucesores electos del emperador del Sacro Imperio. Probablemente esta corona fue realizada en algún lugar del oeste de Alemania a finales del siglo X, durante el reinado del emperador Otón I, con algunos añadidos posteriores de la época de Conrado II o de Conrado III. La primera fuente conservada en la que se menciona la Corona del Sacro Imperio se remonta al siglo XII; en ella se la considera la corona original, afirmación que parece muy probable.\\nLa corona imperial es la más importante de las Insignias Imperiales, que incluyen la Cruz Imperial, la Espada Imperial y la Lanza Sagrada. Durante la ceremonia de coronación era entregada al nuevo monarca junto con el cetro y el Orbe Imperial y éste sólo podía utilizarlos en dicha ceremonia. La corona imperial y el resto de las insignias del Sacro Imperio Romano Germánico estuvieron custodiadas desde el año 1424 hasta 1796 en Núremberg, ciudad situada en el antiguo Ducado de Franconia que fue el centro y origen del Estado franco en tierras germanas."},{"page_url":"https://fr.wikipedia.org/wiki/Front_du_Nord_(Union_sovi%C3%A9tique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Soviet_Northern_22_JUNE_1941.png","page_title":"Front du Nord (Union soviétique)","context_page_description":"Le front du Nord est une unité militaire de l'Armée impériale russe puis de l'Armée rouge, un « front » soviétique correspondant à un groupe d'armées dans les autres forces armées.\\nPlusieurs fronts du Nord ont existé successivement. Le premier est créé par l'Armée russe pendant la Première Guerre mondiale et a existé d'août 1915 jusqu'à 1918 ; le deuxième « front du Nord » fait partie de l'Armée rouge, pour affronter le « front du Nord » des armées blanches dépendant de l'oblast du Nord autour d'Arkhangelsk pendant la guerre civile russe.\\nLe troisième fut créée le 24 juin 1941 en Union soviétique, par transformation du district militaire de Léningrad, qui couvrait les rives méridionales du golfe de Finlande, l'isthme de Carélie, la péninsule de Kola et tout le littoral de l'océan Arctique jusqu'à la Nouvelle-Zemble. Le front disparaît dès le 23 août 1941, donnant naissance d'une part au front de Carélie et d'autre part au front de Léningrad."},{"page_url":"https://fr.wikipedia.org/wiki/Racing_Club_(Argentine)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Racing_Club_-_Placa_Capital.jpg","page_title":"Racing Club (Argentine)","context_page_description":"Le Racing Club appelé parfois Racing Club de Avellaneda ou tout simplement Racing, est un club de football argentin basé à Avellaneda, fondé en 1903.\\nSurnommé la Academia, le Racing Club est le premier club argentin à avoir remporté la coupe intercontinentale et la première équipe à remporter sept championnats d'Argentine consécutifs. Il fait à ce titre partie des « cinq grands du football argentin »."},{"page_url":"https://en.wikipedia.org/wiki/Adolf_Lichtenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Adolf_Lichtenstein.jpg","page_title":"Adolf Lichtenstein","context_page_description":"Adolf Lichtenstein was a Swedish pediatrician. He was Professor of Pediatrics at the Karolinska Institute, a member of the Nobel Assembly at the Karolinska Institute and editor-in-chief of Acta Paediatrica from 1945 til 1950.\\nLichtenstein was born a Jewish family in Stockholm, where his father was a wealthy businessman. After completing his medical education he earned a doctoral degree in 1917 and became a docent in pediatrics at Karolinska Institute in the same year. From 1923 he was also chief consultant at Stockholms epidemisjukhus. In 1932 he was appointed professor of pediatrics at Karolinska Institute and chief consultant at Crown Princess Louise's Hospital for Children."},{"page_url":"https://pl.wikipedia.org/wiki/Rootzmans","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/RTZ_1.jpg","page_title":"Rootzmans","context_page_description":"Rootzmans – polski zespół muzyczny wykonujący muzykę z pogranicza popu i reggae fusion, założony w połowie 2012 roku."},{"page_url":"https://en.wikipedia.org/wiki/Giants%E2%80%93Washington_rivalry","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Washington_Football_Team_wordmark.png","page_title":"Giants–Washington rivalry","context_page_description":"The Giants–Washington rivalry between the New York Giants and the Washington Football Team, formerly known as the Redskins, of the National Football League began in 1932 with the founding of Washington's predecessors, the Boston Braves, and is the oldest rivalry in the NFC East Division. This rivalry has seen periods of great competition such as the Giants and Redskins' competition for conference and division titles in the late 1930s and early 1940s and 1980s.Experts deem the 1980s as the most hotly contested period between these teams, as the Redskins under Joe Gibbs and the Giants under Bill Parcells competed for division titles and Super Bowls. During this span the two teams combined to win 7 NFC East Divisional Titles, 5 Super Bowls and competed in the 1986 NFC Championship Game with the Giants winning 17–0. This rivalry is storied and Wellington Mara, long time owner of the Giants, always said that he believed the Redskins were the Giants' truest rival."},{"page_url":"https://it.wikipedia.org/wiki/Coppa_UEFA_1977-1978","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/PSV_Eindhoven%2C_1977%E2%80%9378_UEFA_Cup_Winners_-_01.jpg","page_title":"Coppa UEFA 1977-1978","context_page_description":"La Coppa UEFA 1977-1978 è stata la 7ª edizione dell'omonima competizione. Venne vinta dal PSV che sconfisse il Bastia nella doppia finale."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B4%9E%E6%BD%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Line_Arrow_of_Agnes_Milowka.jpg","page_title":"洞潜","context_page_description":"洞潜，全称洞穴潜水，是指在充满或部分充满水的洞穴中进行的潜水活动。它可以作为一种极限运动，也可以用来探索被淹没的洞穴以进行科学调查，或者为了寻找和救援因种种原因失联的潜水员。根据洞潜潜水环境的不同，洞潜所需要的设备包含于自由潜水和表面潜水所采用的装备之中，但是几乎所有的洞潜都采用了水肺装备，通常采用了像侧挂式水肺或者背挂式水肺这样特殊的外挂装置。休闲性质的洞穴潜水因为其在多数潜水期间无法达到水面并伴随着减压问题而通常被认为是一种技术潜水。\\n在英国，洞穴潜水是从当地更常见的洞穴探险中发展而来的。而在美国，它的起源与休闲水肺潜水密切相关。 与洞穴探险和水肺潜水相比，洞穴潜水的实践者相对较少。 这部分是由于所需的专业设备和特殊技巧，部分是由于特定环境导致的高潜在风险。\\n尽管存在着不小的风险，但洞潜依然因提供了原始与未知的自然环境和较高难度的潜水挑战，吸引着潜水员、探洞者和洞穴学家们。水下洞穴包含了多元化的地貌特征，并且可能有从未在其他地区发现的生物的存在。"},{"page_url":"https://pt.wikipedia.org/wiki/Thomas_Wright","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Thomas_Wright_%28astronomer%29_1737.jpg","page_title":"Thomas Wright","context_page_description":"Thomas Wright foi um astrônomo, matemático, fabricante de instrumentos, arquiteto e projetista de jardins inglês. Ele foi o primeiro a descrever a forma da Via Láctea e a especular que as nebulosas fracas são galáxias distantes."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Rennertshofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Rennertshofen%2C_ND_-_Bertoldsheim_-_Am_Schlossberg_Nr_2_Gh_Hornsteinschloss_v_O.jpg","page_title":"Liste der Baudenkmäler in Rennertshofen","context_page_description":"Auf dieser Seite sind die Baudenkmäler des oberbayerischen Marktes Rennertshofen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D0%B0%D0%BD_%D0%93%D1%83%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sinan_G%C3%BCler_Fenerbah%C3%A7e_Basketball_Media_Day_20180925_%281%29.jpg","page_title":"Синан Гулер","context_page_description":"Синан Гулер — турски професионален кошаркар, кој во моментот настапува за екипата на Ефес Пилсен."},{"page_url":"https://en.wikipedia.org/wiki/Pierre_Regional_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Pierre_Regional_Airport.JPG","page_title":"Pierre Regional Airport","context_page_description":"Pierre Regional Airport is a public airport three miles east of Pierre, in Hughes County, South Dakota.\\nFederal Aviation Administration records say the airport had 15,983 passenger boardings in calendar year 2008, 13,692 in 2009 and 14,686 in 2010. The National Plan of Integrated Airport Systems for 2011–2015 categorized it as a primary commercial service airport."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D0%BE%D0%B4_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%D0%9F%D0%BE%D0%BB%D0%BD%D0%BE%D0%B5_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD%D0%BE%D0%B2_%D1%82%D0%BE%D0%BC_1_%281830%29.jpg","page_title":"Свод законов Российской империи","context_page_description":"Свод зако́нов Росси́йской импе́рии — официальное издание расположенных в тематическом порядке действующих законодательных актов Российской империи, подготовленное Вторым отделением под руководством М. М. Сперанского в начале николаевской эпохи и переиздававшееся полностью или частично вплоть до Октябрьской революции. Состояло из пятнадцати томов, включавших в том числе основные законы, законодательство о губернских учреждениях, государственных финансах, правах состояния, акты в сфере административного права, гражданские и уголовные законы, а также указатели, вспомогательные материалы и другой справочный аппарат; кроме отдельных изданий томов Свода законов выходили также продолжения к Своду. В 1892 году в Свод был добавлен шестнадцатый том, в который были выделены законы о судопроизводстве."},{"page_url":"https://tr.wikipedia.org/wiki/Elektrik_%C5%9Febekesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Electricity_Grid_Schematic_English.svg","page_title":"Elektrik şebekesi","context_page_description":"Elektrik şebekesi üretilen elektrik enerjisini kullanıcılara iletmek için oluşturulmuş bileşik bir ağdır. Elektrik gücü üreten enerji santralları, üretim kaynaklarından talep merkezlerine enerji aktaran iletim hatları ve kullanıcılara bağlantı sağlayan bileşik dağıtım hatlarından oluşur.\\nEnerji santralları yakıt kaynaklarına erişim olan yerlerde, baraj bölgelerinde ya da yenilenebilir enerji kaynaklarına yakın olan bölgelerde, ve de çoğunlukla yerleşim alanlarından uzakta konumlanmıştır. Ekonomik ölçekli olması için genellikle oldukça büyük boyutlarda inşa edilirler. Üretilen elektrik enerjisi, gerilimi yükseltilerek iletim şebekesine aktarılır.\\nİletim şebekesi elektrik enerjisini uzak mesafelere, zaman zaman bir ülkenin sınırları haricinde de olabilen dağıtım merkezlerine aktarır. Bu dağıtım merkezleri genellikle yerel dağıtım ağını işleten kuruluşlardır.\\nİkincil merkeze ulaşan elektrik enerjisi, iletim hattı gerilim seviyelerinden dağıtım gerilimi seviyesine indirilir. İndirici merkez çıkışında elektrik enerjisi dağıtım şebekesine aktarılır. Son olarak da servis merkezine ulaşan elektrik enerjisi dağıtım gerilimi seviyesinden gereksinim duyulan servis gerilimine indirilir."},{"page_url":"https://no.wikipedia.org/wiki/Malachius","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Melyridae_-_Malachius_bipustulatus-002.JPG","page_title":"Malachius","context_page_description":"Malachius er en slekt av biller i delgruppen blærebiller i familiegruppen børstebiller. Det er registrert to arter i Norge, Malachius aeneus og Malachius bipustulatus.\\nDisse billene er middels store, kraftig hårete, grønnlig eller blålig metalliske, med rødoransje flekker på dekkvingespissene, disse kan dekke det meste av dekkvingene. De tilhører blærebillene som har oppblåsbare blærer nær forhjørnene av brystskjoldet og på sidene av bakkroppen. De ligner artene i slekten Axinotarsus, men er generelt endel større. Hodet og brystskjoldet hos de nordiske artene har ganske lange oppstående hår. Antennene er festet like foran fasettøynene, de har elleve ledd. Noen hanner har noen særpregede rotledd på antennen. Dekkvingene hos de nordiske artene har mørk oppstående behåring sammen med en finere liggende behåring. Dekkvingene slutter ved sidekanten og mangler en innoverbøyd fortsettelse litt inn under bakkroppen. Beina er ganske slanke, alle føtter har fem ledd."},{"page_url":"https://en.wikipedia.org/wiki/Pointe_du_Hoc","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/02_Pointe_du_Hoc.jpg","page_title":"Pointe du Hoc","context_page_description":"La Pointe du Hoc is a promontory with a 100-foot cliff overlooking the English Channel on the northwestern coast of Normandy in the Calvados department, France.\\nDuring World War II it was the highest point between the American sector landings at Utah Beach to the west and Omaha Beach to the east. The German army fortified the area with concrete casemates and gun pits. On D-Day, the United States Army Ranger Assault Group attacked and captured Pointe du Hoc after scaling the cliffs."},{"page_url":"https://es.wikipedia.org/wiki/Rai%C3%B3n_de_Mykolaiv_(Mykolaiv)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Nikolaew_rayon_gerb.gif","page_title":"Raión de Mykolaiv (Mykolaiv)","context_page_description":"Mykolaiv es un raión o distrito de Ucrania en el óblast de Mykolaiv.\\nComprende una superficie de 1429 km².\\nLa capital es la ciudad de Mykolaiv."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%97%A8%EB%A6%AC_%ED%8D%BC%EC%85%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Henry_Purcell_by_John_Closterman.jpg","page_title":"헨리 퍼셀","context_page_description":"헨리 퍼셀은 영국의 작곡가이다. 퍼셀의 대표 작품으로는 오페라, 《디도와 에네아스》가 있다."},{"page_url":"https://fr.wikipedia.org/wiki/Illustre_Confr%C3%A9rie_de_Notre-Dame","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/%27s-Hertogenbosch_Rijksmonument_21635_Hinthamerstraat_94_Zwanenhuis.JPG","page_title":"Illustre Confrérie de Notre-Dame","context_page_description":"L'Illustre Confrérie de Notre-Dame est une société œcuménique de Bois-le-Duc, fondée en 1318 pour honorer Marie. La Confrérie, engagée dans la promotion de la communion chrétienne de ses membres et la préservation de son riche patrimoine historique, a son siège à la Maison des Frères des cygnes, qui sert également de musée."},{"page_url":"https://it.wikipedia.org/wiki/8_millimetri_(film)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/8mm_and_super8_and_double8.png","page_title":"8 millimetri (film)","context_page_description":"La Pellicola 8 millimetri è un calibro di pellicola popolare ed economico introdotto nei primi anni trenta dalla Kodak, con lo scopo di proporre un formato amatoriale più economico del 16 mm. Il nome del calibro deriva dalla larghezza della pellicola fotografica che consiste in strisce da 8 millimetri. Generalmente non è utilizzato per le riprese e proiezioni di film da sala, ma piuttosto viene utilizzato da cineasti amatoriali e casalinghi assieme al 16 millimetri. Nonostante questo la pellicola 8 millimetri venne saltuariamente utilizzata per film a basso costo e più spesso nel cinema sperimentale.\\nEsistono due diversi formati di pellicola 8 millimetri: la pellicola 8 millimetri standard, anche conosciuta come regular 8 millimetri, e la pellicola super 8 millimetri, la cui perforazione viene ridotta per fare spazio ad un fotogramma dal formato più ampio. La prima è disponibile anche come pellicola doppio 8 mm – ossia una 16 millimetri con perforazione 8 mm su entrambi i lati – tagliata a metà dopo lo sviluppo al fine di avere due pellicole 8 mm proiettabili."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%BA%D1%83%D1%80%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%D0%9B%D1%83%D1%86%D0%B5%D0%BD%D0%BA%D0%BE_%D0%AE%D1%80%D1%96%D0%B9_%D0%92%D1%96%D1%82%D0%B0%D0%BB%D1%96%D0%B9%D0%BE%D0%B2%D0%B8%D1%87.jpg","page_title":"Прокурор","context_page_description":"Прокуро́р — головний законний представник обвинувачення в країнах з системою слідства або в країнах загального права, що прийняли змагальну систему.\\nОбвинувачення — сторона, що відповідає за виклад доказів проти особи, підозрюваної в здійсненні правопорушення, в ході судового розгляду у кримінальній справі.\\nФункції прокурорів в різних країнах різні і багато в чому визначаються історичним розвитком.\\nУ кримінальному процесі України згідно з КПК України прокурор виконує функцію нагляду, керівництва слідством, підтримання обвинувачення в суді та представництва інтересів громадян чи держави.\\nНагляд – це відповідна до закону діяльність прокурора щодо контролю за законністю та забезпеченням верховенства права органами досудового слідства та оперативно-розшукової юрисдикції.\\nПредставництво прокурором інтересів громадян чи держави в суді полягає у здійсненні прокурором від імені держави процесуальних та інших дій, спрямованих на забезпечення інтересів держави та захисту прав, свобод і законних інтересів громадян, у разі неспроможності ними самостійно їх захищати.\\nКерівництво слідством – нова функція прокурора."},{"page_url":"https://de.wikipedia.org/wiki/Bistum_Rzesz%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Katedra_Rzeszow.JPG","page_title":"Bistum Rzeszów","context_page_description":"Das Bistum Rzeszów ist eine in Polen gelegene römisch-katholische Diözese mit Sitz in Rzeszów."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D9%86%D8%AA%D9%87_%DA%86%D9%88%D8%B1%DB%8C%DA%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/20150328_1427_U19_AUTHRV_1364.jpg","page_title":"آنته چوریچ","context_page_description":"آنته چوریچ بیر فوتبالیست. ا. اس. رم فوتبال کولوبو و کوروواسی میلّی تیمی ترکیبینده چیخیش ائدیب و هافبک موقعیتینده اوْیناییب. یورو ۲۰۱۶ اوْیونلاریندا مئیدانا گئدیب."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B2%B3%E6%AF%9B%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/JRW_kinki-A.svg","page_title":"河毛站","context_page_description":"河毛站是一个位于日本滋贺县长滨市湖北町山胁，属于西日本旅客铁道北陆本线的铁路车站。车站编号是JR-A07。"},{"page_url":"https://pl.wikipedia.org/wiki/Korona_austro-w%C4%99gierska","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/AHK_2_1914_reverse.jpg","page_title":"Korona austro-węgierska","context_page_description":"Korona austro-węgierska – jednostka walutowa Austro-Węgier w latach 1892–1918."},{"page_url":"https://pt.wikipedia.org/wiki/Dinamarca_no_Festival_Eurovis%C3%A3o_da_Can%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Denmark_at_ESC_2011.jpg","page_title":"Dinamarca no Festival Eurovisão da Canção","context_page_description":"A Dinamarca participou no Festival Eurovisão da Canção, até ao momento, 49 vezes, estreando-se em 1957 e estando ausente de 1967 a 1978, em 1994, 1998 e em 2003."},{"page_url":"https://pl.wikipedia.org/wiki/Ziemie_Rzeczypospolitej_pod_zaborami","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Pan_Tadeusz_1834.jpeg","page_title":"Ziemie Rzeczypospolitej pod zaborami","context_page_description":"Ziemie Rzeczypospolitej pod zaborami – ziemie Rzeczypospolitej Obojga Narodów wcielone w następstwie rozbiorów do państw zaborczych."},{"page_url":"https://es.wikipedia.org/wiki/Villarcayo_de_Merindad_de_Castilla_la_Vieja","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Obras_4%C2%AA_Fase_Pol%C3%ADgono_Las_Merindades.JPG","page_title":"Villarcayo de Merindad de Castilla la Vieja","context_page_description":"Villarcayo de Merindad de Castilla la Vieja es un municipio español situado en el norte de la provincia de Burgos, comarca de Las Merindades de Castilla, de la cual es capital administrativa, dentro de la comunidad autónoma de Castilla y León. Su capital es la villa de Villarcayo, que se encuentra a una distancia de 75 km de la ciudad de Burgos, la capital provincial.\\nLa villa es atravesada por el río Nela, y se encuentra situada en la zona oeste de un amplio valle.\\nSe caracteriza por sus fiestas patronales de julio y agosto y por tener una elevada industrialización, gracias a su polígono industrial, que fue ampliado en 2012."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B7%D0%B5_(%D0%90%D1%82%D0%BB%D0%B0%D0%BD%D1%82%D0%B8%D0%BA%D0%B0%D0%BD_%D0%9B%D1%83%D0%B0%D1%80%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Rez%C3%A9_centre.jpg","page_title":"Резе (Атлантикан Луара)","context_page_description":"Резе — Францин гӀала-коммуна, лаьтта Аквитани регионехь. Коммунан департамент — Атлантикан Луара. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Hartford_County,_Connecticut","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/SuffieldCT_FirstBaptistChurch.jpg","page_title":"National Register of Historic Places listings in Hartford County, Connecticut","context_page_description":"This is a list of the National Register of Historic Places designations in Hartford County, Connecticut.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Hartford County, Connecticut, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in various online maps.\\nThere are 432 properties and districts listed on the National Register in the county, including 21 National Historic Landmarks. More than half of these listings are in the city of Hartford and the towns of Windsor, Southington and West Hartford. They are listed separately, while the 188 properties and districts in the remaining parts of the county are listed below. Four properties and districts extend into Hartford, Southington and/or New Haven County and appear in more than one list.\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%90%D0%BB%D0%B1%D0%B0%D1%80%D0%B8%D0%BD%D1%8C%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Cacho.JPG","page_title":"Албариньо","context_page_description":"Албариньо - шурă иçĕм сорчĕ."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%99%D0%BE%D1%85%D0%B0%D0%BD%D0%BD%D0%B5%D1%81%D0%B1%D1%83%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Johannesburg%2C_South_Africa_%281896%29.jpg","page_title":"Йоханнесбург","context_page_description":"Йоха́ннесбург ағылш. Johannesburg, африкаансша Johannesburg — Оңтүстік Африка Республикасының ең үлкен қаласы. Гаутенг - елдің ең бай провинциясының әкімшілік орталығы.\\n2011 жылғы халық санағы бойынша, қалада 4 434 827 адам, ал қаланың Үлкен Йоханнесбург (Greater Johannesburg Metropolitan Area) агломерациясында 7 860 781 адам тұрады. Әлемнің 40 ең ірі қалаларының бірі. Жыл сайын халық саны қарқынды өсуде.\\nЕлдің ең бай және дамыған қалаларының бірі. Қала маңында алтын және гауһар тас алынады.\\n2010 жылы Йоханнесбург қаласында Футболдан Әлем Чемпионатының ойындары өткізілген."},{"page_url":"https://hr.wikipedia.org/wiki/Mihajlo_Luki%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Mihajlo_Lukic.JPG","page_title":"Mihajlo Lukić","context_page_description":"Mihajlo Lukić bio je general u Vojsci Kraljevine Jugoslavije i general Domobranstva NDH."},{"page_url":"https://en.wikipedia.org/wiki/Kabuki-za","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Kabuki-za_Tower_Level_5_Roof_garden_2019.jpg","page_title":"Kabuki-za","context_page_description":"Kabuki-za in Ginza is the principal theater in Tokyo for the traditional kabuki drama form."},{"page_url":"https://es.wikipedia.org/wiki/Hydrophis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Hydrophis_ornatus_by_DaijuAzuma.JPG","page_title":"Hydrophis","context_page_description":"Hydrophis es un género de serpientes de la familia Elapidae y subfamilia Hydrophiinae. Incluye 46 especies de serpientes marinas venenosas que se distribuyen principalmente por el este del océano Índico y el oeste del Pacífico.​"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%98%D0%B0_%D0%88%D0%B0%D0%BF%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Yamato_en.png","page_title":"Историја Јапана","context_page_description":"Историја Јапана покрива Јапан и његов однос према свету. Карактеришу га изолационистички, полуотворени и експанзионистички периоди.\\nПрво људско пребивалиште на јапанском архипелагу прати се од праисторијских времена од око 30 000 година пре нове ере. Џомон период, названо по грнчарству са \\"жицом\\", уследило је од стране Јајојиа у првом миленијуму пре нове ере када су нове технологије уведене из континенталне Азије. Током овог периода, прва позната писана референца на Јапан забележена је у Кинеској књизи Хан у првом веку нове ере. Између четвртог и деветог века, многа јапанска краљевства и племена постепено су се обједињавала под централизованом владом, коју номинално контролише цар. Ова царска династија и даље влада над Јапаном. 794. основана је нова империјална престоница у Хјејан-кјо-у, што је означило почетак Хејан периода, који је трајао до 1185. Хејан период се сматра златним временом класичне јапанске културе. Јапански верски живот од овог доба и надаље био је спој домаћих шинтоистичких пракси и будизма."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%8A%D8%A8%D9%88%D9%84%D9%8A%D8%AA%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Hyppolitus_k%C3%A9szlet.jpg","page_title":"هيبوليتوس","context_page_description":"هيبوليتوس، في الأسطورة اليونانية، هو ابن ثيسيوس وهيبوليتي ملكة الأمازون، وهو صياد وقائد عجلة حربية مشهور ومفضل لأرتميس."},{"page_url":"https://es.wikipedia.org/wiki/Sallenelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/P1000218_%282%29.JPG","page_title":"Sallenelles","context_page_description":"Sallenelles es una población y comuna francesa, situada en la región de Baja Normandía, departamento de Calvados, en el distrito de Caen y cantón de Cabourg."},{"page_url":"https://de.wikipedia.org/wiki/Gamma-Konfiguration-Stirlingmotor","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/MM-7_Stirling_Engine.jpg","page_title":"Gamma-Konfiguration-Stirlingmotor","context_page_description":"Der Gamma-Konfiguration-Stirlingmotor ist ein Stirlingmotor, bei dem Arbeits- und Verdrängerkolben in verschiedenen miteinander verbundenen Zylindern untergebracht sind.\\nDie Gamma-Konfiguration kann auch als Abwandlung der Beta-Konfiguration gesehen werden. Bei der Abgrenzung gibt es unterschiedliche Meinungen. Die hier beschriebenen Niedertemperatur-Stirlingmotoren werden teilweise auch als Beta-Konfiguration angesehen."},{"page_url":"https://pt.wikipedia.org/wiki/Turismo_em_S%C3%A3o_Paulo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Daiane_Conterato2.jpg","page_title":"Turismo em São Paulo","context_page_description":"O turismo na cidade de São Paulo destaca-se mais pelo turismo de negócios que pelo turismo recreativo. Grandes redes de hotéis cujo público-alvo é o corporativo/empresarial estão instaladas na cidade e possuem filiais espalhadas em várias das suas centralidades. A cidade possui entre 410 e 550 hotéis, disponibilizando aos visitantes um total de quartos que varia entre 42.000 e 50.000.\\nO turismo cultural, porém, também possui relevância para a cidade, especialmente quando se têm em vista os vários eventos internacionais que ocorrem na região. A cidade conta com uma média de um evento a cada seis minutos.\\nApesar da vitalidade econômica, porém, o turismo é ainda um setor que revela as graves desigualdades sócio-econômicas presentes na cidade, visto que, segundo críticos e estudiosos, grande parte do circuito cultural e turístico da cidade exclui a própria população paulistana de usufruí-lo, visto que ele se encontra na região central metropolitana.\\nEm 2010 o turismo em São Paulo alcançou um novo recorde recebendo 11,7 milhões de turistas."},{"page_url":"https://fi.wikipedia.org/wiki/Jean-Michel_Bazire","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Jean-Michel_BAZIRE.JPG","page_title":"Jean-Michel Bazire","context_page_description":"Jean-Michel Bazire on ranskalainen raviohjastaja. Hän aloitti uransa jo 16-vuotiaana vuonna 1987 ja on toiminut myös montératsastajana.\\nJean-Michel Bazire on yksi 2000-luvun menestyneimmistä raviohjastajista Euroopassa. Hän on voittanut muun muassa maailman arvostetuimpiin ravikilpailuihin kuuluvat Prix d'Amériquen ja Elitloppetin kahdesti. Suomessä Bazire on ohjastanut ykkössijat Finlandia-ajossa neljästi sekä Kymi Grand Prix'ssa kahdesti. Koko urallaan hän on ajanut noin 5 000 voittoa, vuonna 2012 Bazire ohjasti 214 ykköstilaa. Ranskan parhaaksi raviohjastajaksi hänet on valittu 14 kertaa, ensimmäisen kerran vuonna 1998 ja sen jälkeen 13 kertaa peräkkäin vuodesta 2000 lähtien.\\nHeinäkuussa 2012 Bazire sai vakavan sairauskohtauksen ohjastaessaan Enghien-les-Bainsin raviradalla. Aivoverenvuodon saanut Bazire vietiin sairaalaan kriittisessa tilassa, mutta hän toipui nopeasti ja palasi radoille jo lokakuussa."},{"page_url":"https://fr.wikipedia.org/wiki/Wolxheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Wolxheim_Ecole.JPG","page_title":"Wolxheim","context_page_description":"Wolxheim est une commune française située dans le département du Bas-Rhin, en région Grand Est.\\nCette commune se trouve dans la région historique et culturelle d'Alsace."},{"page_url":"https://fr.wikipedia.org/wiki/L%27Assiette_au_beurre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Assiette_au_beurre_issue_1.jpg","page_title":"L'Assiette au beurre","context_page_description":"L’Assiette au beurre est un magazine satirique illustré français ayant paru de 1901 à 1936. La publication est hebdomadaire et continue jusqu'en 1912. Après une interruption, une deuxième série est publiée mensuellement de 1921 à 1925, puis décline et disparaît définitivement en 1936.\\nDans sa première période, L'Assiette au beurre est une revue innovatrice sur le plan graphique, notamment par le choix d'illustrations en pleine page et la dévolution de numéros entiers à un thème unique, voire à l’œuvre d'un seul artiste.\\nElle rassemble certains des meilleurs illustrateurs européens à une époque où, par conviction politique, des artistes délaissent l’œuvre unique pour se tourner vers l'imprimé. Tirant parti de la carte blanche qui leur est laissée, ces artistes y critiquent avec une grande liberté de ton le militarisme, le colonialisme, le cléricalisme, le féminisme et les conditions de travail.\\nProche, à ses débuts, de la sensibilité anarchiste, L'Assiette au beurre n'est cependant pas une revue militante, même si, entre 1905 et 1911, elle s'engage nettement sur le plan politique, notamment contre le colonialisme."},{"page_url":"https://es.wikipedia.org/wiki/La_Vijanera","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Vijanera-Trapaj%C3%B3n.jpg","page_title":"La Vijanera","context_page_description":"La Vijanera es una mascarada de invierno que se desarrolla en la localidad española de Silió, en Cantabria, el primer domingo de cada año. En el caso de que esta fecha coincidiese con Año Nuevo se traslada al siguiente. Debido a su popularidad y tradición está declarada como Fiesta de Interés Turístico Nacional.​ Actualmente se encuentra en proceso de ser declarada como Bien de Interés Cultural Inmaterial."},{"page_url":"https://cs.wikipedia.org/wiki/Quido_M%C3%A1nes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Quido_M%C3%A1nes_-_Old_Bachelor.jpg","page_title":"Quido Mánes","context_page_description":"Quido Mánes, byl český malíř, kreslíř a ilustrátor doby romantismu a realismu."},{"page_url":"https://es.wikipedia.org/wiki/Trompeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/3_pistons.jpg","page_title":"Trompeta","context_page_description":"La trompeta es un instrumento musical de viento, que pertenece a la familia de los instrumentos de viento metal o metales, fabricado en aleación de metal. El sonido se produce gracias a la vibración de los labios del intérprete en la parte denominada boquilla a partir de la columna del aire. Comúnmente, suele estar afinada en si ♭, es decir, un tono por debajo de la afinación escrita en el pentagrama, aunque también hay trompetas afinadas en fa, en do, en la y en mi, - bemol -.\\nAl músico que toca la trompeta se le conoce como trompetista o trompeta."},{"page_url":"https://lmo.wikipedia.org/wiki/Rh%C3%A4z%C3%BCns","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/SognGieri_Chorlinks1.jpg","page_title":"Rhäzüns","context_page_description":"Rhäzüns a l'è un cumün svizzer del distret de Imboden. in del Canton Grisun. Al gh’ha pressapoch 1338 abitant e una süperfiss de 13.28 km², e al se tröva a una altitüden de 657 meter sura al livel del mar.\\nEl cumün de Rhäzüns a l'è tacaa ai cumün de Bonaduz, Cazis, Domat/Ems, Rothenbrunnen e Versam."},{"page_url":"https://fr.wikipedia.org/wiki/Koompassia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Koompassia_excelsa%2C_the_Mengaris_Tree_%2814312506649%29.jpg","page_title":"Koompassia","context_page_description":"Koompassia est un genre de plantes dicotylédones de la famille des Fabaceae, sous-famille des Caesalpinioideae, originaire d'Asie du Sud-Est, qui compte trois espèces acceptées.\\nCe sont de grands arbres poussant dans les forêts tropicales humides en plaine. Koompassia excelsa est l'un des plus grands arbres tropicaux, pouvant dépasser 80 mètres de haut. Du fait de leur taille élevée, le houppier de ces arbres émerge souvent au-dessus de la canopée."},{"page_url":"https://fr.wikipedia.org/wiki/Lanceur_(baseball)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Baseball_pitching_motion_2004r.jpg","page_title":"Lanceur (baseball)","context_page_description":"Un lanceur est un joueur de baseball qui lance la balle vers la zone de prises près du frappeur. Son objectif est de retirer le frappeur sans qu'il puisse frapper un coup sûr ni profiter d'un but sur balles."},{"page_url":"https://de.wikipedia.org/wiki/Am_Neumarkttor_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/MerseburgANeumarkttor2.JPG","page_title":"Am Neumarkttor 2","context_page_description":"Das Haus Am Neumarkttor 2 ist ein denkmalgeschütztes Wohn- und Geschäftshaus in der Stadt Merseburg in Sachsen-Anhalt."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Western_civilization","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Punch_Rhodes_Colossus.png","page_title":"History of Western civilization","context_page_description":"Western civilization traces its roots back to Europe and the Mediterranean. It is linked to ancient Greece, the Roman Empire and with Medieval Western Christendom which emerged from the Middle Ages to experience such transformative episodes as the Renaissance, the Reformation, the Enlightenment, the Industrial Revolution, scientific revolution, and the development of liberal democracy. The civilizations of Classical Greece and Ancient Rome are considered seminal periods in Western history; a few cultural contributions also emerged from the pagan peoples of pre-Christian Europe, such as the Celts and Germans, as well as some significant religious contributions derived from Judaism and Hellenistic Judaism stemming back to Second Temple Judea, Galilee, and the early Jewish diaspora; and some other Middle Eastern influences. Western Christianity has played a prominent role in the shaping of Western civilization, which throughout most of its history, has been nearly equivalent to Christian culture. Western civilization has spread to produce the dominant cultures of modern Americas and Oceania, and has had immense global influence in recent centuries in many ways."},{"page_url":"https://vi.wikipedia.org/wiki/%C3%82m_nh%E1%BA%A1c_Vi%E1%BB%87t_Nam","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Phamduy.jpg","page_title":"Âm nhạc Việt Nam","context_page_description":"Âm nhạc Việt Nam là hệ thống tác phẩm âm nhạc tại Việt Nam. Đây là một phần của lịch sử và văn hóa Việt Nam. Âm nhạc Việt Nam phản ánh đúng những nét đặc trưng của con người, văn hóa, phong tục, địa lý, ... của đất nước Việt Nam, trải dài suốt chiều dài lịch sử của dân tộc.\\nÂm nhạc Việt Nam bắt đầu từ những nền văn minh đầu tiên qua những phát hiện khảo cổ về những nhạc cụ và tranh vẽ trong hang đá. Trải qua những triều đại phong kiến, nền âm nhạc Việt Nam có được những nét phát triển rõ rệt và đặc trưng. Tới thời kỳ đô hộ của Trung Quốc ngoài ra của các nền văn hóa ngoại lai khác như Ấn Độ, Chăm Pa, ... âm nhạc Việt Nam sớm có được những ảnh hưởng và quan điểm mới, dung hòa hoàn hảo những yếu tố ảnh hưởng từ nước ngoài với những nét nổi bật vốn có của âm nhạc truyền thống, từ đó tạo nên những loại hình âm nhạc cổ truyền của từng vùng miền như hát xẩm, chèo, ca trù, hò, cải lương, đờn ca tài tử, nhã nhạc cung đình Huế, quan họ, ...\\nGiai đoạn Pháp thuộc vào cuối thế kỷ XIX đặc biệt góp phần giúp âm nhạc Việt Nam được tiếp xúc với những phong cách và quan điểm của văn hóa phương Tây, đồng thời tiếp tục phát triển với những nét đặc trưng riêng."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B0%E0%AE%BE%E0%AE%9C%E0%AE%B8%E0%AF%8D%E0%AE%A4%E0%AE%BE%E0%AE%A9%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Jodhpur_5174663-66.jpg","page_title":"ராஜஸ்தான்","context_page_description":"இராஜஸ்தான் Rājasthān, தேவநாகரி: राजस्थान, என்பது இந்தியாவின் மாநிலங்களுள் ஒன்று. ஜெய்ப்பூர் இம்மாநிலத்தின் தலைநகராக உள்ளது. இதுதவிர உதயப்பூர் மற்றும் ஜோத்பூர் ஆகியன முக்கிய நகரங்கள் ஆகும். இராஜஸ்தானி, மார்வாரி, பஞ்சாபி, உருது மற்றும் இந்தி ஆகியன இங்கு பெரும்பான்மையான மக்களால் பேசப்படும் மொழிகள் ஆகும்.\\nஇம்மாநில தார் பாலைவனத்தில் உள்ள பொக்ரான் எனுமிடத்தில் முதன் முதலாக 1974 ஆம் ஆண்டு மே மாதம் 18-ஆம் நாளன்று சிரிக்கும் புத்தர் எனும் பெயரில் இந்தியா தன் முதல் அணுகுண்டு சோதனையை நிகழ்த்தியது. பின்னர் இரண்டாம் முறையாக அதே இடத்தில், 1998 ஆம் ஆண்டு மே மாதம் 11, 13 தேதிகளில் சக்தி நடவடிக்கை எனும் பெயரில் ஐந்து அணுகுண்டுகள் வெடித்து சோதனை செய்தது."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B1%A0%E7%94%B0%E7%94%BA%E8%A5%BF%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Tsubojiri_stn._201703-1.jpg","page_title":"池田町西山","context_page_description":"池田町西山は、徳島県三好市の町名。2019年2月28日現在の人口は836人、世帯数は221世帯。郵便番号は〒778-0031。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D1%81%D0%BA%D0%BE%D1%9E%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D1%8D%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D1%96%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Coin_of_Yaroslav_the_Wise_%28reverse%29.png","page_title":"Пскоўская рэспубліка","context_page_description":"Пскоўская рэспубліка існавала паміж другой паловай XIII ст. і першай паловай XVI ст. на тэрыторыі ўздоўж рэк Вялікая і Нарова."},{"page_url":"https://hu.wikipedia.org/wiki/Liam_Miller","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Liam_miller.jpg","page_title":"Liam Miller","context_page_description":"Liam William Peter Miller ír válogatott labdarúgó. Pályafutása során játszott a Celtic, a Manchester United és a Sunderland csapataiban is. 2004-ben szerződött az angol Premier League-be, miután lejárt a szerződése nevelőklubjánál. A Bosman-szabályt kihasználva szabadon tárgyalhatott a Manchester Uniteddel, akik ingyen szerezték meg a játékjogát. A vörös-fekete csapat első együttesében 22 tétmérkőzésen lépett pályára, majd a Sundrlandhez igazolt.\\nAz ír válogatottban 2004-ben mutatkozott be. Az ezt követő öt évben összesen 21 alkalommal viselte a címeres mezt. 36 éves korában daganatos betegség következtében hunyt el."},{"page_url":"https://la.wikipedia.org/wiki/Saint-Martin-Labouval","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Saint_Martin_Labouval_5.JPG","page_title":"Saint-Martin-Labouval","context_page_description":"Saint-Martin-Labouval est commune Francicum 176 incolarum praefecturae Oltis in regione australi Meridiano et Pyrenaeo."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_panteons_i_tombes_de_sobirans_als_Pa%C3%AFsos_Catalans","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Castell_de_Mur._Mur._Santa_Maria_de_Mur_2.JPG","page_title":"Llista de panteons i tombes de sobirans als Països Catalans","context_page_description":"Aquesta llista de llocs d'enterrament de sobirans indica on es troben les tombes de monarques, titulars i consorts, de territoris sobirans que es poden trobar en llocs de l'ambit catalanoparlant. S'hi inclouen reis, comtes sobirans i qualsevol altre monarca d’un territori independent o sobirà durant el temps de regnat d’aquestes persones."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Rolleston_on_Dove","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/9_Church_Road%2C_Rolleston_on_Dove.jpg","page_title":"Listed buildings in Rolleston on Dove","context_page_description":"Rolleston on Dove is a village and a civil parish in the district of East Staffordshire, Staffordshire, England. It contains 28 listed buildings that are recorded in the National Heritage List for England. Of these, one is listed at Grade I, the highest of the three grades, and the others are at Grade II, the lowest grade. Most of the listed buildings are houses, cottages, farmhouses, farm buildings and associated structures. The other listed buildings include a church, items in the churchyard, a former school, almshouses and associated structures, and public houses."},{"page_url":"https://cs.wikipedia.org/wiki/New_Yorker_(firma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Praha_Pankrac_Arkady_New_Yorker.jpg","page_title":"New Yorker (firma)","context_page_description":"New Yorker je mezinárodně působící německá oděvní společnost se sídlem v Braunschweigu.\\nNew Yorker má více jak 1000 obchodů ve 39 zemích a patří mezi největší prodejce oděvů v Evropě. Dnes působí v Evropě, V Severní Africe, na Blízkém Východě i v Asii. Společnost otevřela první prodejnu v německém Flensburgu v roce 1971. Dnes zaměstnává okolo 16 000 lidí na plný nebo částečný úvazek a každý měsíc zaznamenává více jak 4 miliony zákazníků. V poslední době společnost prudce vzrostla, čemuž napomohla i úspěšná expanze po Evropě."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B1%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Abgarwithimageofedessa10thcentury.jpg","page_title":"الرها","context_page_description":"الرها، هيَ مدينة في الجزيرة الفراتية، أسسها سلوقس الأول في موقع مدينة سابقة حوالي عام 302 قبل الميلاد، كانت تعرف أيضًا باسم أنطاكية على كاليرهوي في القرن الثاني قبل الميلاد. كانت عاصمة مملكة الرها شبه المستقلة حوالي العام 132 قبل الميلاد وسقطت تحت الحكم الروماني المباشر عام 242. أصبحت مركزًا مبكرًا مهمًا للمسيحية السريانية.\\nفي عام 260، وقعت معركة الرها بين الإمبراطورية الساسانية والإمبراطورية الرومانية التي كان يقودها فاليريان، وانتهت بانتصار الساسانيين. وفي عام 638 دخل الجيش الإسلامي المدينة في إطار فتح بلاد الشام. استعادت الإمبراطورية البيزنطية سيطرتها على المدينة لفترة وجيزة عام 1031، وبعد ذلك أصبحت الرها مركزًا لـ كونتية الرها الصليبية بين عامي 1098–1144. سقطت المدينة في يد الدولة الزنكية عام 1144، وضُمَّت في النهاية إلى الدولة العثمانية عام 1517. الاسم الحديث للمدينة هو أورفة، وتقع حاليًا في محافظة أورفة في منطقة جنوب شرق الأناضول في تركيا."},{"page_url":"https://vec.wikipedia.org/wiki/Distreti_de%C5%82a_Svisera","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Karte_Kanton_Solothurn_Bezirke.png","page_title":"Distreti deła Svisera","context_page_description":"A difarensa dei Stati de tipo sentrałista, 'nte ła Confederasion Svisera i cantoni i xe completamente libari de deçidere ła propria sudivixione aministrativa. Pertanto a esiste diverse struture e terminołogie par łe entità subnasionali intermedie tra i cantoni e i comuni, ciamà in generałe distreti."},{"page_url":"https://it.wikipedia.org/wiki/Museo_civico_e_della_ceramica_cerretese","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Mappa_museo_civico_della_ceramica_cerretese_sezione_arte_ceramica_contemporanea_Cerreto_Sannita.jpg","page_title":"Museo civico e della ceramica cerretese","context_page_description":"Il Museo civico e della ceramica cerretese è una esposizione permanente dedicata alla tradizione ceramica di Cerreto Sannita, in provincia di Benevento. Il museo è articolato in due sezioni:\\nla sezione della ceramica antica, contenente prevalentemente ceramiche cerretesi risalenti in gran parte ai secoli XVII-XVIII-XIX e provenienti prevalentemente dalla raccolta dell'ex Istituto statale d'arte di Cerreto Sannita e da collezioni private;\\nla sezione della ceramica contemporanea, che raccoglie le opere in ceramica donate dagli artisti che hanno partecipato alle biennali di arte ceramica contemporanea che si tengono a Cerreto Sannita."},{"page_url":"https://fr.wikipedia.org/wiki/Leo_Friedlander","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Friedlander_Sacrifice.jpg","page_title":"Leo Friedlander","context_page_description":"Leo Friedlander, né le 6 juillet 1888 à New York et mort le 24 octobre 1966, est un sculpteur américain."},{"page_url":"https://eo.wikipedia.org/wiki/Isabelle_Huppert","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Paul_Verhoeven%2C_%22Elle%22_Amsterdam_premiere_%281%29.jpg","page_title":"Isabelle Huppert","context_page_description":"Isabelle Anne Madeleine Huppert, naskiĝis la 16-an de marto 1953, estas franca aktorino. Ŝi konatiĝis pro roloj en Violette Nozière, La pianiste, Amour kaj Elle.\\nHuppert naskiĝis je la 16-a de marto 1953 en Parizo, Francio. Ŝi elkreskis en Ville-d'Avray. Huppert studis je la Nacia Konservatorio de Drama Arto de Parizo. Ŝi edziniĝis al Ronald Chammah en 1982. Ili havis tri infanojn.\\nLa aktorino Lolita Chammah, Lorenzo kaj Angelo."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9E%D7%A0%D7%A6%27%D7%99%D7%96%D7%90%D7%95%D7%A8%D7%95%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Mamench_DB.jpg","page_title":"ממנצ'יזאורוס","context_page_description":"ממנצ'יזאורוס הוא זאורופוד מתור היורה ואחד הדינוזאורים הגדולים ביותר במזרח אסיה. הוא חי באזור סין כ-150 מיליון שנים לפני זמננו. הוא נקרא על שם האזור ממנצ'י בסין בו נתגלה."},{"page_url":"https://bg.wikipedia.org/wiki/Pteropus_scapulatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Little_Red_Flying_Fox_map.png","page_title":"Pteropus scapulatus","context_page_description":"Pteropus scapulatus е вид бозайник от семейство Плодоядни прилепи."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Landshut-Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Regierungsstr._564_Landshut-1.jpg","page_title":"Liste der Baudenkmäler in Landshut-Altstadt","context_page_description":"In der Liste der Baudenkmäler in Landshut–Altstadt sind die Baudenkmäler im Landshuter Stadtbezirk 00 Altstadt aufgelistet.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Landshut. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://es.wikipedia.org/wiki/Ovis_ammon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Argali_subspecies_range.png","page_title":"Ovis ammon","context_page_description":"El argalí es una especie de muflón asiático distribuido por las montañas del centro de Asia: Himalaya, Altái y Tíbet."},{"page_url":"https://eo.wikipedia.org/wiki/Hinda_azadira%C4%A5to","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Rose-ringed_Parakeet_%28Psittacula_krameri%29_feeding_on_Azadirachta_indica_%28Neem%29_W_IMG_8122.jpg","page_title":"Hinda azadiraĥto","context_page_description":"La hinda azadiraĥto aŭ nimo\\nestas arbo el la familio de meliacoj. Ĝiaj fruktoj kaj semoj estas la fonto de hind-azadiraĥta oleo. Ĝi ofte konfuziĝas kun la bida melio, kvankam kaj la foliostrukturo kaj la floroj malsamas. Ĉe la hinda azadiraĥto tiuj ĉi blankas, sed violkoloras ĉe bida melio."},{"page_url":"https://sv.wikipedia.org/wiki/Actinocephalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Pepalantus.jpg","page_title":"Actinocephalus","context_page_description":"Actinocephalus är ett släkte av gräsväxter. Actinocephalus ingår i familjen Eriocaulaceae."},{"page_url":"https://uz.wikipedia.org/wiki/Marigny-en-Orxois","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Map_commune_FR_insee_code_02465.png","page_title":"Marigny-en-Orxois","context_page_description":"Marigny-en-Orxois Fransiyaning Pikardiya mintaqasida joylashgan kommunadir. Aisne departamenti Château-Thierry tumani tarkibiga kiradi."},{"page_url":"https://gl.wikipedia.org/wiki/Patan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Patan-Palastplatz-Garudasaeule-04-Vishwanath-2007-gje.jpg","page_title":"Patan","context_page_description":"Patan é unha cidade de Nepal situada no Val de Katmandu, a orelas do río Bagmati, no distrito de Lalitpur. Tanto o nome Patan como o de Lalitpur utilízanse para denominar a cidade.\\nA súa poboación no 2001 era de 162.991 habitantes.\\nA histórica Praza de Durbar de Patan forma parte do conxunto denominado Val de Katmandu, declarado Patrimonio da Humanidade pola UNESCO en 1979."},{"page_url":"https://fr.wikipedia.org/wiki/Philibert_de_la_Guiche","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Philibert_de_La_Guiche%2C_%C3%A9curies_du_ch%C3%A2teau_de_Chaumont_en_Charolais.jpg","page_title":"Philibert de la Guiche","context_page_description":"Philibert de La Guiche est un noble du Charolais, proche de Henri III et catholique modéré durant les guerres de religion. Il est Grand maître de l'Artillerie en 1578, gouverneur de Lyon en 1595-1607 et bailli de Mâcon."},{"page_url":"https://eo.wikipedia.org/wiki/%C3%89culleville","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%C3%89culleville_-_Baie_de_Quervi%C3%A8re_%282%29.JPG","page_title":"Éculleville","context_page_description":"Éculleville estas malaperinta franca komunumo situanta en departemento Manche, regiono Normandio.\\nĜiaj enloĝantoj nomiĝas Écullevillais.\\nĜi nun formas parton de La Hague."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AC%B4%EB%A0%B9%EC%99%95%EB%A6%89_%EC%84%9D%EC%88%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/King_Muryeong%27s_tomb_3.jpg","page_title":"무령왕릉 석수","context_page_description":"무령왕릉 석수는 충청남도 공주시 무령왕릉에서 발견된 백제 때 만들어진 석수로, 국립공주박물관에 소장 전시되고 있다. 1974년 7월 9일 대한민국의 국보 제162호로 지정되었다.\\n발굴보고서에 재료가 응회암이라고 나오나, 확인이 필요하다."},{"page_url":"https://sv.wikipedia.org/wiki/Paul_Hamilton","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Paul_Hamilton_SecNavy.jpeg","page_title":"Paul Hamilton","context_page_description":"Paul Hamilton, född 16 oktober 1762 i nuvarande Charleston County i South Carolina, död 30 juni 1816 i Beaufort i South Carolina, var en amerikansk politiker. Han var South Carolinas guvernör 1804–1806 och USA:s marinminister 1809–1812.\\nHamilton tjänstgjorde i den kontinentala armén i amerikanska frihetskriget och var därefter verksam som plantageägare.\\nHamilton efterträdde 1804 James Burchill Richardson som South Carolinas guvernör och efterträddes 1806 av Charles Pinckney.\\nHamilton tillträdde 1809 som marinminister. 1812 års krig bröt ut under Hamiltons ämbetsperiod som minister. Han avgick i slutet av 1812 och återvände till South Carolina. Hamilton avled 1816 och gravsattes på Rhodes Plantation. Jagaren USS Paul Hamilton namngavs 1995 efter Paul Hamilton."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D5%B4%D5%A1%D6%80%D5%A5_%D5%A1%D6%80%D5%A5%D5%A3%D5%A1%D5%AF%D5%B6%D5%A1%D5%B5%D5%AB%D5%B6_%D5%AA%D5%A1%D5%B4%D5%A1%D6%81%D5%B8%D6%82%D5%B5%D6%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/%D0%A1%D0%BE%D0%BB%D0%BD%D0%B5%D1%87%D0%BD%D1%8B%D0%B5_%D1%87%D0%B0%D1%81%D1%8B_%D1%81._%D0%9C%D1%80%D0%B0%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D1%80%D1%83%D0%BF%D0%BD%D0%BE_01.JPG","page_title":"Մարմարե արեգակնային ժամացույց","context_page_description":"Մարմարե արեգակնային ժամացույց, XVIII դարի ճարտարապետության հուշարձան, որը տեղադրված է Ռուսաստանի Դաշնության Սվերդլովսկի մարզի Պոլևսկոյ քաղաքային օկրուգի Մրամորսկոե գյուղի կենտրոնական հրապարակում։ Այն ուղղահայաց կատարման արեգակնային ժամացույց է։"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D8%A8%DB%8C%D9%86%E2%80%8C%D8%A7%D9%84%D9%85%D9%84%D9%84%DB%8C_%DA%98%D8%A7%D9%86_%D9%BE%D9%84_%D8%AF%D9%88%D9%85_%DA%A9%D8%B1%D8%A7%DA%A9%D9%88%D9%81-%D8%A8%D8%A7%D9%84%DB%8C%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Balice_airport.JPG","page_title":"فرودگاه بین‌المللی ژان پل دوم کراکوف-بالیس","context_page_description":"فرودگاه بین‌المللی ژان پل دوم کراکوف-بالیس یک فرودگاه همگانی، نظامی مسافربری با کد یاتا KRK است که یک باند فرود بتن دارد و طول باند آن ۲۵۵۰ متر است. این فرودگاه در شهر کراکوف کشور لهستان قرار دارد و در ارتفاع ۲۴۱ متری از سطح دریا واقع شده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Panache_(hydrodynamique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/AirPollutionSource.jpg","page_title":"Panache (hydrodynamique)","context_page_description":"En hydrodynamique, un panache est une masse d'air se distinguant de l'air environnant par une température ou une composition très différente et évoluant en fonction de sa quantité de mouvement, de la diffusion de la matière et de la flottabilité. Ceci peut s'appliquer aussi bien à un phénomène très localisé comme un panache de fumée sortant d'une cheminée que d'un flux à large échelle comme celui du flux d'humidité en météorologie."},{"page_url":"https://es.wikipedia.org/wiki/Lavit","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Blason_de_la_ville_de_Lavit_%28Tarn-et-Garonne%29.svg","page_title":"Lavit","context_page_description":"Lavit es una comuna y población de Francia, en la región de Mediodía-Pirineos, departamento de Tarn y Garona, en el distrito de Castelsarrasin. Es cabecera y mayor población del cantón homónimo.\\nSu población en el censo de 1999 era de 1.570 habitantes.\\nEstá integrada en la Communauté de communes de la Lomagne Tarn-et-Garonnaise."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9A%D2%AF%D0%BB%D0%BB%D3%99%D1%80_(%D0%A7%D0%B8%D0%BB%D3%99%D0%B1%D0%B5_%D3%A9%D0%BB%D0%BA%D3%99%D1%81%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%B2_%D0%9C%D0%B5%D0%B6%D0%B8%D0%BA%D0%B5.jpg","page_title":"Күлләр (Чиләбе өлкәсе)","context_page_description":"Күлләр — Чиләбе өлкәсенең Верхнеуральск районы составына керүче штб."},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Historic_Landmarks_in_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Verity_Keokuk.JPG","page_title":"List of National Historic Landmarks in Iowa","context_page_description":"The List of National Historic Landmarks in Iowa contains the landmarks designated by the U.S. Federal Government for the U.S. state of Iowa.\\nThere are 26 National Historic Landmarks in Iowa.\\nKey"},{"page_url":"https://sk.wikipedia.org/wiki/Smart_(automobil)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Smart_Electric_Drive.jpg","page_title":"Smart (automobil)","context_page_description":"Smart je automobilová značka Daimler AG, výrobca miniautomobilov, ktoré sú vyrábané v Hambachu vo Francúzsku a vo Böblingene v Nemecku. Je predávaný ako \\"smart\\" so všetkými malými písmenami s logom Smart, od roku 2010 s znakom písmena \\"c\\", ktoré označuje \\"compact\\" a šípkou pre \\"myslenie vpred\\"."},{"page_url":"https://de.wikipedia.org/wiki/Der_Isarfl%C3%B6%C3%9Fer","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Hinterbruehl_Isarfloesser_Fritz_Koelle_1939_Muenchen-1.jpg","page_title":"Der Isarflößer","context_page_description":"Der Isarflößer ist ein Denkmal in München mit einer auf einem Steinsockel stehenden Bronzeskulptur des deutschen Bildhauers Fritz Koelle. Das Denkmal ist als Baudenkmal in die Bayerische Denkmalliste eingetragen."},{"page_url":"https://cs.wikipedia.org/wiki/N%C4%9Bmeck%C3%A1_fotbalov%C3%A1_Bundesliga","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Championship_celebration_Borussia_Dortmund_2011.jpg","page_title":"Německá fotbalová Bundesliga","context_page_description":"Německá fotbalová Bundesliga je nejvyšší německá fotbalová soutěž. Jejím pořadatelem je Deutscher Fußball-Bund. O jejím založení bylo rozhodnuto tímto svazem 28. července 1962 v Dortmundu. Nižší soutěží je 2. německá fotbalová Bundesliga.\\nV soutěži působí celkem 18 týmů, z nichž od sezony 2011/12 3 postupují přímo do hlavní fáze Ligy mistrů a čtvrtý do jejího 4. předkola. Pátý a šestý tým z ligy hrají Evropskou ligu. Dva nejhorší týmy soutěže sestupují do 2. ligy a jsou nahrazeny prvním a druhým týmem této nižší soutěže. Šestnáctý tým hraje baráž o udržení s třetím týmem 2. ligy. Vítěz soutěže navíc dostává právo bojovat na počátku následujícího ročníku s vítězem německého národního poháru DFB-Pokal o Superpohár zvaný DFL-Supercup."},{"page_url":"https://cs.wikipedia.org/wiki/Santon_(kopec)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Santon%2C_2009_%282%29.JPG","page_title":"Santon (kopec)","context_page_description":"Santon je návrší v katastru obce Tvarožná v okrese Brno-venkov."},{"page_url":"https://pl.wikipedia.org/wiki/Chropacz%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Kosciol_Matki_Bozej_Rozancowej_w_Swietochlowicach.jpg","page_title":"Chropaczów","context_page_description":"Chropaczów — dzielnica Świętochłowic. Od północy graniczy z Bytomiem, od zachodu z Lipinami, od południa z Piaśnikami i od wschodu z Chorzowem. Zachodnia część dzielnicy leży w Dolnie Górnej Bytomki, a Wzgórza Chropaczowskie powodują, że na terenie Chropaczowa są wzniesienia sięgające 309 metrów. Leży na dziale wodnym dorzecza Odry - Bytomka i dorzecza Wisły - Rawa.\\nPierwotna wieś wzmiankowana w 1295 roku, od 1950 do 1951 roku samodzielne miasto, 1 czerwca 1951 roku włączone do Świętochłowic."},{"page_url":"https://sh.wikipedia.org/wiki/Podgorica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/PodgoricaConstruction.jpg","page_title":"Podgorica","context_page_description":"Podgorica, glavni i najveći grad Crne Gore; 250 000st. Šire područje Podgorice obuhvata 10,4 % teritorije Crne Gore i 27,3 % njenog stanovništva.\\nPodgorica se prije nazivala Ribnica i Titograd. Njen pogodan položaju na ušću reke Ribnice u Moraču u Zetsko-bjelopavlićkoj ravnici. Grad je blizu zimskim centrima na sjeveru zemlje i ljetovalištima na Jadranskom moru.\\nPodgorica se nalazi blizu ostataka rimskog grada Dokleje. U srednjem vijeku ovde je postojalo naselje koje se zvalo Ribnica, a pod ovim imenom grad se prvi put spominje 1326. Podgorica je od 1878. ušla u sastav Kneževine Crne Gore. Od 1946. je administrativno sjedište Crne Gore, a za vrijeme SFRJ Podgorica se zvala Titograd."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Schmalkalden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Schmalkalden%2C_Stiller_Gasse_21-001.jpg","page_title":"Liste der Kulturdenkmale in Schmalkalden","context_page_description":"Die Liste der Kulturdenkmale in Schmalkalden umfasst die als Ensembles, Straßenzüge und Einzeldenkmale erfassten Kulturdenkmale der thüringischen Stadt Schmalkalden, die vom Thüringischen Landesamt für Denkmalpflege und Archäologie als Bau- und Kunstdenkmale auf dem Gebiet der Stadt mit Stand von 2009 erfasst wurden. Die Ensembles wurden im Amtsblatt der Stadt veröffentlicht. Die Gesamtliste ist derzeit nicht öffentlich zugänglich, so dass im Folgenden nur die Ensembles ausgewiesen werden. Mögliche Kulturdenkmale im Ortsteil Springstille sind nicht eingearbeitet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BE%D1%82%D0%B8%D1%80%D0%B0%D0%BD%D0%BD%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Alioramus_Life_Restoration_flipped.jpg","page_title":"Эотираннус","context_page_description":"Эотираннус — род хищных динозавров из надсемейства тираннозавроид, обитавших в раннем меловом периоде около 125—120 млн лет назад, на территории современного в юго-западного побережья острова Уайт, Великобритания. Остатки были найдены в формации Уэссекс. Голотип MIWG1997.550 принадлежит молодой особи и состоит из разрозненного черепа, позвонков и костей передних и задних конечностей. Окаменелости были обнаружены в глинистом слое, наполненном окаменевшим растительным материалом и описаны Hutt et al. в начале 2001 года. Родовое название отсылает к родству с тираннозавром, а видовое — к первооткрывателю остатков."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%B4%D0%BE%D0%BB%D1%96%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Bardolino_Porta_San_Giovanni.JPG","page_title":"Бардоліно","context_page_description":"Бардоліно — муніципалітет в Італії, у регіоні Венето, провінція Верона.\\nБардоліно розташоване на відстані близько 430 км на північ від Рима, 130 км на захід від Венеції, 25 км на північний захід від Верони.\\nНаселення — 7037 осіб.\\nЩорічний фестиваль відбувається 6 грудня. Покровитель — San Nicolò."},{"page_url":"https://nl.wikipedia.org/wiki/Facheca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Vista_de_Fageca_des_de_la_Serrella.JPG","page_title":"Facheca","context_page_description":"Facheca is een gemeente in de Spaanse provincie Alicante in de regio Valencia met een oppervlakte van 10,17 km². Facheca telt 107 inwoners."},{"page_url":"https://vo.wikipedia.org/wiki/Kanorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Sherman_County_Kansas_Incorporated_and_Unincorporated_areas_Kanorado_Highlighted.svg","page_title":"Kanorado","context_page_description":"Kanorado binon zif in komot: Sherman, in tat: Kansas, in Lamerikän."},{"page_url":"https://en.wikipedia.org/wiki/1899_FA_Cup_Final","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Sheffield_utd_1899.jpg","page_title":"1899 FA Cup Final","context_page_description":"The 1899 FA Cup Final was contested by Sheffield United and Derby County at Crystal Palace. Sheffield United won 4–1, with four second-half goals scored by Jack Almond, Walter Bennett, Billy Beer and Fred Priest after John Boag had scored a first-half opener for County. This was Derby's second successive losing final and worse was to come in that regard in 1903 against Bury. The contest was photographed by Henry Jasper Redfern."},{"page_url":"https://hu.wikipedia.org/wiki/Piedipartino","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/L%27%C3%A9glise_de_Piedipartinu.jpg","page_title":"Piedipartino","context_page_description":"Piedipartino település Franciaországban, Haute-Corse megyében. Lakosainak száma 20 fő. +/- Piedipartino Carcheto-Brustico, Carticasi, Pie-d’Orezza és Stazzona községekkel határos."},{"page_url":"https://eu.wikipedia.org/wiki/Harraska","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Tiskiallas.jpg","page_title":"Harraska","context_page_description":"Harraska, sukaltarri, txurrutarri edo dala sukaldean, janaldi bakoitzaren ondoren, harrikoa egiteko erabiltzen den tokia da. Gaur egungo sukaldeetan portzelanazko edo altzairu herdoilgaitzezkoa izan ohi da, beste material batzuekin ere egiten den arren. Adibidez, esmaltedun altzairua, zeramika, haitzurdina, gresa edo konpositearekin. Txorrota bat izaten du, eta bertatik irteten da harrikoa egiteko ura. Bi zatitan banatuta dago: bata, garbitzeko erabiltzen dena, eta bestea lehortzeko. Baina azken hau gero eta sukalde gehiagotan desagertu da."},{"page_url":"https://de.wikipedia.org/wiki/Sterbetafel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Graunt_Observations.jpg","page_title":"Sterbetafel","context_page_description":"Die Sterbetafel ist eine Ausscheideordnung in Tabellenform, die darstellt, wie sich ein fiktives Kollektiv von Personen aus einer bestimmten Personengruppe durch Tod erwartungsgemäß verringert."},{"page_url":"https://en.wikipedia.org/wiki/Nung_Chan_Monastery","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Nung_Chan_Monastery_115.jpg","page_title":"Nung Chan Monastery","context_page_description":"The Nung Chan Monastery is a monastery at Beitou District, Taipei, Taiwan. It is formally founded in 1975 by Ven. Dongchu, a scholar monk and disciple of renowned Chinese Buddhist Master Taixu. It's named ' Farming Ch'an ' as its early residents dedicated themselves to Ch'an practice and grew their own food. Its spirit is based on 8th century Zen Master Baizhang Huaihai's aphorism, \\"A day without work is a day without food.\\"\\nVen. Dongchu bought the 2.5 acres land at Guandu Plain near Taipei in the end of the 1960s. As he didn't have many followers, he worked most of the land by himself and for the first few years, his only improvement is to have the land leveled. It then became a farmland worked by Ven. Dong Chu, his two disciples, and the neighboring villagers. In 1971, Ven. Dongchu finally began to build a two-story farmhouse that still existed today behind the main hall. The building was completed four years later in 1975.\\nVen. Dongchu was determined to promote Buddhist culture\\nin Taiwan and cultivating Buddhist human talent. The monastery became a center for Ven. Dongchu's cultural and educational activity, and annual winter charity events.\\nIn 1978, Ven."},{"page_url":"https://fr.wikipedia.org/wiki/Coirac","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Coirac_Mairie.jpg","page_title":"Coirac","context_page_description":"Coirac est une commune du Sud-Ouest de la France, située dans le département de la Gironde, en région Nouvelle-Aquitaine.\\nSes habitants sont appelés les Coiracais."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%88%D8%A8%D9%88%D9%83%D9%84%D9%86%D8%BA%D8%A7%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Lambang_Kota_Lubuklinggau.jpeg","page_title":"لوبوكلنغاو","context_page_description":"لوبوكلنغاو ‏ هي معلم جغرافي تقع في إندونيسيا في سومطرة الجنوبية. يقدر عدد سكانها بـ 201,217 نسمة ومساحتها 401.50 كم²."},{"page_url":"https://fr.wikipedia.org/wiki/Cimeti%C3%A8re_de_Beynost","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Tombe_de_la_famille_Chardon_%28dont_Gabriel_Chardon%29_au_cimeti%C3%A8re_de_Beynost.jpg","page_title":"Cimetière de Beynost","context_page_description":"Le cimetière de Beynost est un cimetière à Beynost dans l'Ain en France. Il se trouve sur les hauteurs de la église Saint-Julien de Beynost."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%85%D9%8A%D8%AB%D9%81%D9%8A%D9%84%D8%AF_(%D8%B1%D9%88%D8%AF_%D8%A2%D9%8A%D9%84%D8%A7%D9%86%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Smith_Appleby_House-2013.jpg","page_title":"سميثفيلد (رود آيلاند)","context_page_description":"سميثفيلد ‏ هي بلدة تقع بولاية رود آيلاند في الولايات المتحدة. تبلغ مساحتها 71.9، وترتفع عن سطح البحر 122 م، بلغ عدد سكانها 21430 نسمة في عام 2010 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 311 نسمة/كم²."},{"page_url":"https://es.wikipedia.org/wiki/Can_Colomer_(Tarrasa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/017_Xemeneia_de_la_b%C3%B2bila_de_Can_Colomer%2C_al_fons_la_de_la_b%C3%B2bila_Benaiges_%28Terrassa%29.jpg","page_title":"Can Colomer (Tarrasa)","context_page_description":"Can Colomer es una masía del municipio de Tarrasa protegida como Bien Cultural de Interés Local. Está situada al noroeste de la ciudad, fuera de la trama urbana, cerca del km 1,6 de la B-122, o carretera de Rellinars, y del barrio del Poblenou, a poca distancia del torrente de Can Colomer, o torrente Medianero de Can Amat, emisario de la Riera del Palau. La masía se encuentra en terrenos del Parque Agroforestal de Tarrasa.\\nAl este de la masía, más allá de la casa de Mon Repòs, hay los restos del antiguo tejar de Can Colomer, incluido en el Inventario del Patrimonio Arquitectónico de Cataluña, y del tejar Benaiges. Al suroeste de la casa, junto al torrente, hay los restos del roble de Can Colomer, árbol declarado de interés local, que había llegado a ser uno de los tres robles más grandes del Vallés Occidental. Se desplomó debido a un fuerte viento al final del año 2014 y se taló para hacer leña, pero actualmente vuelve a estar en pie en memoria de todos aquellos acontecimientos."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2000","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Stamp_of_Ukraine_s343.jpg","page_title":"Знаки поштової оплати України 2000","context_page_description":"Знаки поштової оплати України 2000 — перелік поштових марок, введених в обіг Укрпоштою у 2000 році.\\nЗ 5 січня по 15 грудня 2000 року була випущена 71 пам'ятна поштова марка. Тематика комеморативних марок охопила ювілеї визначних дат, подій, пам'яті видатних діячів культури та інши. До обігу надійшли знаки поштової оплати номіналом в 0,10; 0,30; 0,40; 0,60; 0,70; 0,80; 1,00; 1,50; 2,00 та 3,00 гривні, а також додатковий тираж третього випуску стандартних марок із літерним номіналом «Е».\\nМарки було надруковано державним підприємством «Поліграфічний комбінат „Україна“».\\nВідсортовані за датою введення."},{"page_url":"https://sv.wikipedia.org/wiki/Rensk%C3%B6tsel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/CartaMarina_ren2.jpg","page_title":"Renskötsel","context_page_description":"Renskötsel är att äga och kontrollera tama eller halvvilda renar och att använda dem för sin försörjning, exempelvis genom att tillvarata mjölk, kött och skinn eller genom att använda renarna som drag- eller lastdjur eller som lockdjur vid vildrensjakt. Renskötsel utövas oftast som en areell näring över stora områden men kan också bedrivas inom inhägnader.\\nRenskötsel har bedrivits i hundratals, kanske tusentals år inom Eurasien och har i sen tid införts även till Nordamerika och Grönland."},{"page_url":"https://fr.wikipedia.org/wiki/Klippe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Matterhorn_from_the_north-east.jpg","page_title":"Klippe","context_page_description":"Une klippe est une partie d'une nappe de charriage isolée du reste de celle-ci par l'effet de l'érosion. Le terme îlot a aussi été utilisé en français, ce terme date de l'époque où la nature des nappes de charriage n'était pas connue et où l'on pensait que ces lambeaux de charriage provenaient d'îlots entourés par une mer peu profonde.\\nLe Cervin en est un bon exemple, issu de la nappe de charriage africaine.\\nÀ l'inverse, des terres anciennes isolées apparaissant à la surface, entourées d'une nappe de charriage, sont appelée fenêtre géologique."},{"page_url":"https://hr.wikipedia.org/wiki/Opsadna_kula","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Grose-Francis-Pavisors-and-Moveable-Tower-Assaulting-Castle-1812.jpg","page_title":"Opsadna kula","context_page_description":"Opsadna kula je opsadna sprava koja je dizajnirana da štiti napadače i ljestve na prilazu obrambenom zidu utvrđenja. Kula je obično bila pravokutna, sa četiri kotača i visine koliki je zid, iako su nekad bile i više što je omogućavalo strijelcima da stanu na vrh i podržavaju trupe koje se iskrcavaju. S obzirom da su kule bile drvene i time podložne vatri, morale su biti obložene nekim nezapaljivim materijalom kao što je željezo ili svježa životinjska koža.\\nKoriste se još od 350 godine pr. Kr. u Europi ali i u drevna vremena na dalekom istoku. Opsadne kule su bile jako glomazne i teške za pokretanje, tako da su se uvijek podizale na samome mjestu opsade. Budući da im je trebalo dosta vremena za izgradnju, opsadne kule su se gradile samo ako je utvrdu bilo nemoguće osvojiti pomoću ljestava ili probojem kroz vrata ili sam zid udarnim ovnom.\\nOpsadne kule su služile za prebacivanje trupa preko neprijateljskih zidina. Kada bi kula prišla zidu ona bi ispustila korvus poslije čega bi pješaštvo moglo jurnuti na zidine.\\nOpsadne kule su postale jako ranjive i zastarjele pojavom topova, kada je opsada pošla sasvim drugim smjerom."},{"page_url":"https://es.wikipedia.org/wiki/El_Barraco","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Campanario_El_Barraco.jpeg","page_title":"El Barraco","context_page_description":"El Barraco es un municipio y localidad de España, en la provincia de Ávila, comunidad autónoma de Castilla y León.​\\nSituado a más de 1008 metros de altitud sobre el nivel del mar, el municipio de El Barraco se extiende sobre 153 kilómetros cuadrados aproximadamente, en cuyo territorio se organizan y distribuyen alrededor de 2165 habitantes. Sin embargo, la llegada de familiares y el creciente interés por la naturaleza que atrae el turismo rural acrecientan la cifra durante los meses estivales."},{"page_url":"https://sv.wikipedia.org/wiki/Allium_falcifolium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Allium_falcifolium_4584.JPG","page_title":"Allium falcifolium","context_page_description":"Allium falcifolium är en amaryllisväxtart som beskrevs av William Jackson Hooker och George Arnott Walker Arnott. Allium falcifolium ingår i släktet lökar, och familjen amaryllisväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://vi.wikipedia.org/wiki/Ng%C6%B0%E1%BB%9Di_Betsileo","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Tombeau_Betsileo.jpg","page_title":"Người Betsileo","context_page_description":"Người Betsileo là một dân tộc vùng cao địa của Madagascar, là dân tộc lớn thứ ba về số dân, với khoảng 1.5 triệu người và chiếm khoảng 12,1% dân số Madagascar. Cái tên \\"Betsileo\\" có nghĩa là \\"Những người bất bại\\", xuất phát từ việc vua Ramitraho của vương quốc Menabe đã không thể đánh bại người Betsileo."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1964","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Koen_de_bouw-1549791366.jpg","page_title":"Lijst van personen geboren in 1964","context_page_description":"Dit is een lijst van personen die geboren zijn in 1964.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Brodmann_area_12","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Gray726-Brodman.svg","page_title":"Brodmann area 12","context_page_description":"Brodmann area 12 is a subdivision of the cerebral cortex of the guenon defined on the basis of cytoarchitecture. It occupies the most rostral portion of the frontal lobe. Brodmann-1909 did not regard it as homologous, either topographically or cytoarchitecturally, to rostral area 12 of the human. Distinctive features: a quite distinct internal granular layer (IV) separates slender pyramidal cells of the external pyramidal layer (III) and the internal pyramidal layer (V); the multiform layer (VI) is expanded, contains widely dispersed spindle cells and merges gradually with the underlying cortical white matter; all cells, including the pyramidal cells of the external and internal pyramidal layers are inordinately small; the internal pyramidal layer (V) also contains spindle cells in groups of two to five located close to its border with the internal granular layer (IV).\\nIt is indirectly connected to the global palladius as well as the substantia nigra, due to efferents to the striatum. Glutaminergic input is turned into GABAergic input there, which allows the frontal lobes to exhibit some control over basal ganglia activity."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_C%C3%A1diz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/San_Lucas_Iglesia_Jerez_de_la_Frontera_Spain.JPG","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Cádiz","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở Cádiz."},{"page_url":"https://it.wikipedia.org/wiki/Bell_hooks","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Bellhooks.jpg","page_title":"Bell hooks","context_page_description":"Gloria Jean Watkins è una scrittrice, attivista e femminista statunitense conosciuta con lo pseudonimo bell hooks. Il nome \\"bell hooks\\" deriva da quello della bisnonna materna, Bell Blair Hooks.\\nIl focus della sua scrittura è stata l'intersezionalità di razza, il capitalismo, il genere e la loro\\ncapacità di produrre e perpetuare sistemi di oppressione e di dominio di classe. Ha pubblicato più di 30 libri e numerosi articoli accademici, è apparsa in documentari e ha partecipato a conferenze pubbliche. Principalmente attraverso una prospettiva postmoderna ha affrontato razza, classe e genere nell'istruzione, arte, storia, sessualità, mass media e femminismo.\\nNel 2014 ha fondato il bell hooks Institute al Berea College in Berea, Kentucky."},{"page_url":"https://de.wikipedia.org/wiki/Rolf_Funke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Alt_Westerh%C3%BCsen_49.JPG","page_title":"Rolf Funke","context_page_description":"Rolf Funke war ein deutscher Spielzeughersteller."},{"page_url":"https://nl.wikipedia.org/wiki/Nepenthes_rafflesiana","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Nepenthes_rafflesiana_long_tendril.jpg","page_title":"Nepenthes rafflesiana","context_page_description":"Nepenthes rafflesiana is een vleesetende bekerplant uit de familie Nepenthaceae. De soort heeft een grote verspreiding en komt voor in Borneo, Sumatra, het Maleisisch schiereiland en Singapore. Het uiterlijk van de plant is zeer variabel en er is een groot aantal variëteiten beschreven. De grootste valbekers van N. rafflesiana kunnen qua formaat wedijveren met die van N. rajah."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_de_Tourcoing","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Bataille_de_Tourcoing%2C_plan_d%C3%A9taill%C3%A9.jpg","page_title":"Bataille de Tourcoing","context_page_description":"La bataille de Tourcoing eut lieu le 18 mai 1794, dans le nord de la France, et se solda par une victoire des Français commandés par le général Souham et le général Moreau, sur les Britanniques commandés par Frederick, duc d'York et Albany, et les Autrichiens par le prince de Cobourg.\\nLe général Nicolas Pierquin fut grièvement blessé lors de la bataille."},{"page_url":"https://vi.wikipedia.org/wiki/Falanouc","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Falanouc_area.png","page_title":"Falanouc","context_page_description":"Falanouc là một loài động vật hữu nhũ trong họ Eupleridae, bộ Ăn thịt. Loài này được Doyère mô tả năm 1835. Đây loài đặc hữu Madagascar."},{"page_url":"https://ca.wikipedia.org/wiki/Introducci%C3%B3_a_la_teoria_de_grups","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Hexaaquacopper%28II%29-3D-balls.png","page_title":"Introducció a la teoria de grups","context_page_description":"En matemàtiques, la teoria de grups estudia els grups. Un grup és una estructura algebraica que consta d'un conjunt juntament amb una operació que combina qualsevol parella dels seus elements per formar un tercer element. Perquè es pugui qualificar de grup, el conjunt i operació han de satisfer unes quantes condicions anomenades axiomes de grup, aquestes condicions són: tenir la propietat associativa, tenir element identitat i element invers. Mentre que aquestes característiques són familiars a moltes estructures matemàtiques, com ara els diferents sistemes de nombres, la formulació dels axiomes se separa de la natura concreta del grup i el seu funcionament. Això permet, en àlgebra abstracta i altres camps, manejar entitats d'orígens matemàtics molt diferents d'una manera flexible, mentre es conserven aspectes estructurals essencials de molts objectes. La ubiqüitat dels grups en nombroses àrees els converteix en un principi central entorn del qual s'organitzen les matemàtiques contemporànies.\\nEls grups comparteixen un parentiu fonamental amb la noció de simetria."},{"page_url":"https://en.wikipedia.org/wiki/1926","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Garret_FitzGerald_1975_%28cropped%29.jpg","page_title":"1926","context_page_description":"1926 was a common year starting on Friday of the Gregorian calendar, the 1926th year of the Common Era and Anno Domini designations, the 926th year of the 2nd millennium, the 26th year of the 20th century, and the 7th year of the 1920s decade."},{"page_url":"https://fr.wikipedia.org/wiki/Symon_Petlioura","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Petlura_Vynnychenko.jpg","page_title":"Symon Petlioura","context_page_description":"Symon Petlioura est un homme d'État et journaliste ukrainien né à Poltava le 22 mai 1879 et mort assassiné à Paris le 25 mai 1926. Il fut l'un des personnages les plus importants du mouvement national, le Commandant suprême de l'Armée et le troisième président de la République populaire ukrainienne.\\nHomme de lettres, il fut l'une des figures du mouvement socialiste ukrainien au début du XXᵉ siècle. Autonomiste puis indépendantiste, Symon Petlioura participa à la formation d'une armée ukrainienne et lutta contre le bolchevisme et l'Armée blanche durant la révolution russe. Vaincu, il partit à l'étranger et dirigea le gouvernement ukrainien en exil.\\nLes pogroms qui se déroulèrent sur le territoire ukrainien à cette époque et le motif de son assassinat sont à l'origine d'une vive controverse sur sa personne. De ce fait, Symon Petlioura occupe une place particulière dans l'histoire des relations ukraino-juives."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%BF%D0%B0%D1%89%D0%B0%D1%8F_%D1%8F%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Entrance_to_Propashhaya_Yama_%28cave%292.jpg","page_title":"Пропащая яма","context_page_description":"Пропа́щая Я́ма — пещера в Бурзянском районе Башкортостана, в 5 километрах к юго-западу от деревни Киекбаево. Пропащая Яма находится на левом берегу реки Белой, выше по течению от Каповой пещеры.\\nОбщая длина пещерных ходов — 3218 м. Глубина — 90 метров. Площадь пола — 8,7 тыс. м², объем — 37,5 тыс. куб. м."},{"page_url":"https://nl.wikipedia.org/wiki/Aeromachus_kali","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/MachachusKali_802_4_Fitch.png","page_title":"Aeromachus kali","context_page_description":"Aeromachus kali is een vlinder uit de familie van de dikkopjes. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1885 door Lionel de Nicéville."},{"page_url":"https://nl.wikipedia.org/wiki/Scouting_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Scouting%2C_Netherlands%2C_Jamboree_2010_%282%29.JPG","page_title":"Scouting Nederland","context_page_description":"Scouting Nederland is de nationale scoutingorganisatie van Nederland, met in 2019 ongeveer 81.000 jeugdleden en ongeveer 30.000 vrijwilligers. Er zijn ruim 1.100 scoutinggroepen bij Scouting Nederland aangesloten."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9F%E0%B4%BF%E0%B4%95%E0%B4%BE%E0%B5%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/DSC03332TikalUnderjordiskSteinansikt.JPG","page_title":"ടികാൽ","context_page_description":"പുരാതന മായൻ സംസ്കാര കാലഘട്ടത്തിലെ ഏറെ പ്രാധാന്യമുള്ള വൻനഗരങ്ങളിലൊന്ന്. എ. ഡി. 600 കളിലും 700 കളിലും ഇവിടെ ജനങ്ങൾ തിങ്ങിപ്പാർത്തിരുന്നതായി കരുതപ്പെടുന്നു. പടിഞ്ഞാറൻ ഗ്വാട്ടിമാലയിലുള്ള പീറ്റനിലെ ഉഷ്ണമേഖലാ മഴക്കാടുകളിൽ ഈ സംസ്കാരത്തിന്റെ അവശിഷ്ടങ്ങൾ കാണാം."},{"page_url":"https://eu.wikipedia.org/wiki/%C5%A0enov_u_Nov%C3%A9ho_Ji%C4%8D%C3%ADna","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/%C5%A0enov_NJ_1.JPG","page_title":"Šenov u Nového Jičína","context_page_description":"Šenov u Nového Jičína Txekiar Errepublikako udalerri bat da. 2.086 biztanle ditu eta 15,62 kilometro koadroko azalera. Nový Jičíngo barrutian dago."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8C%94%EB%8B%B9%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Facade_avant_de_la_gare_de_Paldang.jpg","page_title":"팔당역","context_page_description":"팔당역은 경기도 남양주시 와부읍 팔당리에 있는 중앙선의 전철역이다."},{"page_url":"https://ceb.wikipedia.org/wiki/Bogno_(lungsod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Karte_Gemeinde_Bogno_2012.png","page_title":"Bogno (lungsod)","context_page_description":"Lungsod ang Bogno sa Nasod nga Swiss. Nahimutang ni sa distrito sa Lugano District ug kanton sa Ticino, sa habagatan-sidlakang bahin sa nasod, 160 km sa habagatan-sidlakan sa Bern ang ulohan sa nasod. 979 metros ibabaw sa dagat kahaboga ang nahimutangan sa Bogno, ug adunay 126 ka molupyo.\\nAng yuta palibot sa Bogno kay kasagaran kabukiran, apan sa amihang-sidlakan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,859 ka metro ug 1.9 km sa amihanan-sidlakan sa Bogno. Dunay mga 139 ka tawo kada kilometro kwadrado sa palibot sa Bogno medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Lugano, 11.9 km sa habagatan-kasadpan sa Bogno. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Bogno. Sa rehiyon palibot sa Bogno, kabukiran talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -1 °C. Ang kasarangang pag-ulan 1,851 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 266 milimetro nga ulan, ug ang kinaugahan Marso, sa 91 milimetro."},{"page_url":"https://it.wikipedia.org/wiki/Mercedes-Benz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Mercedes_benz_logo_1909.png","page_title":"Mercedes-Benz","context_page_description":"Mercedes-Benz è il marchio commerciale utilizzato da vari produttori nel tempo. Il suo primo utilizzo risale al 1926 dopo la fusione della Daimler-Motoren-Gesellschaft con la Benz & Cie. e la conseguente creazione del gruppo Daimler-Benz. Il marchio è stato di proprietà della Daimler-Benz dal 1926 al 1998 e della DaimlerChrysler dal 1998 al 2007. Nel 2007, a seguito del disimpegno della Daimler dal gruppo nato dall'unione con la Chrysler, Mercedes-Benz è il marchio della nuova Daimler AG unitamente a Maybach, McLaren e Smart.\\nLo stemma, collocato sul cofano motore delle vetture, rappresenta una stella a tre punte, segno distintivo della Daimler, circondata dalla corona d'alloro della Benz e dalle parole Mercedes-Benz, sempre sulla corona esterna. Il nome in questione era stato utilizzato già nel 1924 per la creazione di una prima rete di vendita in comune tra le due aziende.\\nL'origine di questa stella viene da una cartolina dove Gottlieb Daimler aveva disegnato una stella a 3 punte che rappresentava la capacità di utilizzo del suo motore per terra, aria e mare."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_Tracheophyta_de_Bosnie-Herz%C3%A9govine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Isolepis_setacea.jpeg","page_title":"Liste de Tracheophyta de Bosnie-Herzégovine","context_page_description":"Cette liste de Tracheophyta de Bosnie-Herzégovine, ainsi que d’espèces introduites est un aperçu incomplet d’espèces de mousses, de fougères, de gymnospermes et d’angiospermes citées dans la littérature disponible en langues bosniaque, croate, serbe et serbo-croate. Cet aperçu n’inclue pas des espèces cultivées ni celles occasionnellement introduites.\\nRemarque : en raison de changements répétés dans la classification biologique et/ou taxonomique, certaines espèces apparaissent deux fois dans la liste. Cela est particulièrement vrai pour ces noms de la nomenclature binomiale, encore largement utilisées aujourd'hui. Le nom du genre et de la famille sont le plus souvent changés, et parfois aussi les noms d’espèces."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A0%D7%A8%D7%99_%D7%A8%D7%99%D7%99%D7%93%D7%A8_%D7%94%D7%92%D7%A8%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/HRiderHaggard.jpg","page_title":"הנרי ריידר הגרד","context_page_description":"סר הנרי ריידר הגרד היה סופר בריטי הידוע בעיקר בשל ספריו העוסקים באפריקה דוגמת הספר מכרות המלך שלמה."},{"page_url":"https://de.wikipedia.org/wiki/Ottilie_Roederstein","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Dr_Ludwig_Edinger_Ottilie_Roederstein.jpg","page_title":"Ottilie Roederstein","context_page_description":"Ottilie Wilhelmine Roederstein war eine deutsch-schweizerische Malerin zwischen Tradition und Moderne."},{"page_url":"https://es.wikipedia.org/wiki/Diana_DeGarmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Diana_DeGarmo_performing_2005_cropped.jpg","page_title":"Diana DeGarmo","context_page_description":"Diana DeGarmo es una cantante estadounidense. Se hizo famosa al colocarse en segundo lugar en el concurso American Idol.\\nEl 29 de junio de 2004 lanzó su primer sencillo titulado Dreams. Este incluía dos canciones adicionales, las cuales son I Believe y Don't Cry Out Loud.\\nSu primer álbum se tituló Blue Skies y fue lanzado el 7 de diciembre de 2004, con ventas iniciales de 47,000 copias. Se posicionó en el puesto #52 del Billboard en Estados Unidos. Su sencillo Emotional alcanzó la posición #54 en la Mediabase Pop Chart.\\nDegarmo también interpretó la canción principal para la película Fairy Idol de la caricatura Los padrinos mágicos, la cual se estrenó el 19 de mayo de 2006 aparece en cameo cuando Cosmo obtuvo la idea de cantar y ganar, en la revista que tiene dice \\"Como cantar como Diana DeGarmo\\".\\nAdemás interpretó a Penny Pingleton en el musical Hairspray en Broadway en 2008 - 2011\\nDatos: Q464246\\nMultimedia: Diana DeGarmo"},{"page_url":"https://en.wikipedia.org/wiki/ABRIXAS","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Abrixas.png","page_title":"ABRIXAS","context_page_description":"A Broadband Imaging X-ray All-sky Survey, or ABRIXAS was a space-based German X-ray telescope. It was launched on 28 April 1999 in a Kosmos-3M launch vehicle from Kapustin Yar, Russia, into Earth orbit. The orbit had a periapsis of 549.0 kilometres, an apoapsis of 598.0 kilometres, an inclination of 48.0° and an eccentricity of 0.00352, giving it a period of 96 minutes.\\nThe telescope's battery was accidentally overcharged and destroyed three days after the mission started. When attempts to communicate with the satellite when its solar panels were illuminated by sunlight failed, the $20 million project was abandoned. ABRIXAS decayed from orbit on 31 October 2017.\\nThe eROSITA telescope is based on the design of the ABRIXAS observatory. eROSITA was launched on board the Spektr-RG space observatory on 13 July 2019 from Baikonur to be deployed at the second Lagrange point."},{"page_url":"https://pt.wikipedia.org/wiki/26_de_outubro","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Miguel_I_o_REi.jpg","page_title":"26 de outubro","context_page_description":"26 de outubro é o 299.º dia do ano no calendário gregoriano. Faltam 66 para acabar o ano."},{"page_url":"https://en.wikipedia.org/wiki/Mortuary_Temple_of_Hatshepsut","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Mortuary_Temple_of_Hatshepsut.jpg","page_title":"Mortuary Temple of Hatshepsut","context_page_description":"The Mortuary Temple of Hatshepsut, also known as the Djeser-Djeseru, is a mortuary temple of Ancient Egypt located in Upper Egypt. Built for the Eighteenth Dynasty pharaoh Hatshepsut, who died in 1458 BC, the temple is located beneath the cliffs at Deir el-Bahari on the west bank of the Nile near the Valley of the Kings. This mortuary temple is dedicated to Amun and Hatshepsut and is situated next to the mortuary temple of Mentuhotep II, which served both as an inspiration and, later, a quarry. It is considered one of the \\"incomparable monuments of ancient Egypt.\\""},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%9F%E0%A8%B0%E0%A9%88%E0%A8%95%E0%A8%9F%E0%A8%B0_%E0%A8%A8%E0%A8%BF%E0%A8%B0%E0%A8%AE%E0%A8%BE%E0%A8%A4%E0%A8%BE%E0%A8%B5%E0%A8%BE%E0%A8%82_%E0%A8%A6%E0%A9%80_%E0%A8%B8%E0%A9%82%E0%A8%9A%E0%A9%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Belarus_1220.4.jpg","page_title":"ਟਰੈਕਟਰ ਨਿਰਮਾਤਾਵਾਂ ਦੀ ਸੂਚੀ","context_page_description":"Abati\\nACO 2000\\nAebi\\nAGCO Corporation\\nAGCO\\nAGCO Allis\\nChallenger\\nFendt\\nMassey Ferguson\\nValtra\\nAgrale\\nAgri King\\nAgria\\nAgrinar\\nAgritech\\nYanmar Agritech\\nAgro Tractors Ltd\\nJohn Deere/ATL\\nAGT\\nAHS\\nAl-Ghazi Tractors\\nAl Jadah\\nAlfrat\\nAmul\\nAnglo-Thai New Holland\\nAntonio Carraro\\nApache Solis\\nAratri Biagioli\\nARGO SpA\\nFort\\nLandini\\nMcCormick Tractors\\nSEP\\nValpadana\\nARLAN-YTO\\nArmaTrac"},{"page_url":"https://es.wikipedia.org/wiki/Nemognatha_piazata","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Blister_Beetle_-_Nemognatha_piazata%2C_Okaloacoochee_Slough_State_Forest%2C_Felda%2C_Florida.jpg","page_title":"Nemognatha piazata","context_page_description":"Nemognatha piazata es una especie de coleóptero de la familia Meloidae."},{"page_url":"https://es.wikipedia.org/wiki/Luciano_Cruz-Coke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Luciano_Cruz_Coke_Carvallo.jpg","page_title":"Luciano Cruz-Coke","context_page_description":"Luciano Cruz-Coke Carvallo es un político y actor chileno que desde 2018 sirve como Diputado de la República representando al Distrito Electoral Nº10 de la Región Metropolitana de Santiago en la Cámara de Diputados y Diputadas de Chile. Se desempeñó como ministro presidente del Consejo Nacional de la Cultura y las Artes entre 2010 y 2013, durante el primer gobierno del presidente Sebastián Piñera. También es fundador y vicepresidente del partido Evolución Política.\\nComo diputado, es miembro de la Comisión de Cultura y Comunicaciones, y de la Comisión de Constitución, Legislación, Justicia y Reglamento;​ manejando iniciativas legislativas como el límite a la reelección sucesiva de autoridades, la creación del nuevo Servicio de Protección de la Niñez, y diversos mecanismos habilitadores del plebiscito constitucional de 2020.​\\nCruz-Coke ganó fama en Chile a partir de 1995, cuando debutó como actor en la teleserie Amor a domicilio. En la década de 1990 y 2000 tuvo diversos papeles protagónicos, como en Adrenalina, y Fuera de Control. En 2001 protagonizó Amores de mercado, donde interpretó la escena más vista en la historia de la televisión chilena.​"},{"page_url":"https://pl.wikipedia.org/wiki/Portret_Francisca_Javiera_de_Larrumbe","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Francisco_Javier_de_Larrumbe%2C_de_Francisco_de_Goya_%28Banco_de_Espa%C3%B1a%29.jpg","page_title":"Portret Francisca Javiera de Larrumbe","context_page_description":"Portret Francisca Javiera de Larrumbe – obraz olejny hiszpańskiego malarza Francisca Goi. Jeden z sześciu portretów dygnitarzy namalowanych przez artystę na zlecenie nowo powstałego Banku Narodowego San Carlos."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E9%87%8E%E7%90%83%E6%AE%BF%E5%A0%82%E8%A1%A8%E5%BD%B0%E8%80%85%E3%81%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Cobbruth.jpg","page_title":"アメリカ野球殿堂表彰者の一覧","context_page_description":"この一覧は、アメリカ合衆国の野球界において殿堂入り表彰を受けた人物の一覧である。表彰は野球界で偉大な業績を残した人物や野球界の発展に寄与した人物に与えられる。表彰者はニューヨーク州クーパーズタウンの野球殿堂博物館のギャラリーにレリーフが飾られる。表彰は1936年に始められ、現在まで83人の投手、181人の野手、23人の監督、10人の審判員、36人の野球発展貢献者の合計333人が表彰されている。そのうちニグロリーグからは、投手が10人、野手が19人、監督が1人、野球発展貢献が5人の合計35人が栄誉にあずかっている。"},{"page_url":"https://pt.wikipedia.org/wiki/Santana_de_Parna%C3%ADba","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Centro_velho_de_Santana_do_Parna%C3%ADba.jpg","page_title":"Santana de Parnaíba","context_page_description":"Santana de Parnaíba é um município do estado de São Paulo, localizado na Zona Oeste da Região Metropolitana de São Paulo, em conformidade com a lei estadual nº 1.139, de 16 de junho de 2011 e consequente Plano de Desenvolvimento Urbano Integrado da Região Metropolitana de São Paulo."},{"page_url":"https://hr.wikipedia.org/wiki/Duboko_bu%C5%A1enje","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Wiki_Tief_3.jpg","page_title":"Duboko bušenje","context_page_description":"Duboko bušenje je posebno područje bušenja, koje, s dubinom bušenja i do 15 metara, ima posebnu važnost za proizvodnju cijevi za različita oružja. Dubokim bušenjem se smatra bušenje provrta dubljih od 10∙D. Dubina koja se može postići s reznim alatima za duboko bušenje može dostići dubinu od 150∙D. U većini slučajeva kod dubokoga bušenja glavno rotacijsko gibanje vrši obradak a linearno posmično vrši alat. Kod dubokoga bušenja najveći problem je hlađenje alata i krutost alata, zbog toga je razvijeno više postupaka dubokog bušenja."},{"page_url":"https://fr.wikipedia.org/wiki/Mine_d%27Aidu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Aidu_mine.jpg","page_title":"Mine d'Aidu","context_page_description":"La mine d'Aidu est une mine à ciel ouvert de schiste bitumineux située en Estonie."},{"page_url":"https://de.wikipedia.org/wiki/Phlogiston","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/John_Dalton.jpeg","page_title":"Phlogiston","context_page_description":"Phlogiston ist eine von Georg Ernst Stahl eingeführte hypothetische Substanz, von der man im späten 17. und im 18. Jahrhundert vermutete, dass sie allen brennbaren Körpern bei der Verbrennung entweicht sowie bei Erwärmung in sie eindringt. Die Phlogistontheorie war bei der Deutung von Reduktions- und Oxidationsvorgängen und dem unterschiedlichen Potenzial verschiedener Verbindungen hierfür von Bedeutung und aus Sicht der Zeitgenossen erfolgreich. In den 1770er Jahren erschienen erste Widerlegungen, und man begann, die Rolle des Sauerstoffs bei Verbrennungsvorgängen näher zu beschreiben und zu quantifizieren. Die Phlogistontheorie, die von etwa 1700 bis 1775 die vorherrschende chemische Lehre war, wird daher seit langem zu den wissenschaftlichen Irrtümern gezählt und als überholtes wissenschaftliches Paradigma ihrer Zeit gesehen."},{"page_url":"https://de.wikipedia.org/wiki/Schmachtenberg_(M%C3%B6nchberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Spessart_Paul_Pfinzing_Ausschnitt_1594.jpg","page_title":"Schmachtenberg (Mönchberg)","context_page_description":"Schmachtenberg ist ein Ortsteil von Mönchberg im Landkreis Miltenberg in Bayern."},{"page_url":"https://bs.wikipedia.org/wiki/Beta_polipeptid_luteiniziraju%C4%87eg_hormona","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Human_chromosome_19_ideogram.svg","page_title":"Beta polipeptid luteinizirajućeg hormona","context_page_description":"Beta podjedinica luteinizirajućeg hormona ili alutropinska podjedinica beta ili LHβ je polipeptid koji je, skupa sa glikoproteinskog hormonat zajednički za sve gonadotropinske hormone, a stvara reproduktivne signalizirajuće moleule luteinizirajućeg hormona. Kod ljudi, njegovu sintezu kodira gen LHB."},{"page_url":"https://nl.wikipedia.org/wiki/Ville-sur-Ancre","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Map_commune_FR_insee_code_80807.png","page_title":"Ville-sur-Ancre","context_page_description":"Ville-sur-Ancre is een gemeente in het Franse departement Somme en telt 235 inwoners. De plaats maakt deel uit van het arrondissement Péronne."},{"page_url":"https://hu.wikipedia.org/wiki/Stazione_di_Catanzaro_Lido","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Catanzaro_Lido_17.JPG","page_title":"Stazione di Catanzaro Lido","context_page_description":"Stazione di Catanzaro Lido vasútállomás Olaszországban, Catanzaro Lido településen."},{"page_url":"https://ca.wikipedia.org/wiki/Cartutx_de_tinta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Cartucho.jpg","page_title":"Cartutx de tinta","context_page_description":"Un cartutx de tinta és un component substituïble d'una impressora d'injecció de tinta que conté tinta.\\nEl nom deriva del fet que correspon a un contenidor dur que s'insereix en l'interior de la màquina i que conté tinta ja sigui basant-se en l'aigua o solvent especial.\\nCada cartutx de tinta conté una o més particions dipòsits de tinta, alguns fabricants afegeixen contactes electrònics i un xip que es comunica amb la impressora.\\nLa substitució de consumibles és un ús important dels cartutxos. Aquests es fan servir en impressoras per contenir la tinta o el tòner.\\nHi ha diverses marques d'impressores amb diferents models de cartutxos: Hewlett-Packard, Epson, Lexmark, Canon Inc, Brother Industries, Okidata, entre altres."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%85%D8%A7%D9%85_%D8%A3%D9%85%D9%8A%D8%B1%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%D8%AD%D9%85%D8%A7%D9%85_%D8%A7%D9%85%DB%8C%D8%B1%DB%8C%D9%87_%D8%B4%D8%A7%D9%87%D8%B1%D9%88%D8%AF.jpg","page_title":"حمام أميرية","context_page_description":"حمام أميرية هو حمام تاريخي يعود إلى القاجاريون، ويقع في مقاطعة شاهرود."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%99%94%EC%84%B1%EB%8F%99%ED%83%84%EC%9A%B0%EC%B2%B4%EA%B5%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Byeongjeom_Post_Office.jpg","page_title":"화성동탄우체국","context_page_description":"화성동탄우체국은 대한민국 과학기술정보통신부 우정사업본부 경인지방우정청 소속의 우편물 취급기관이다. 본래 화성우체국으로 개국했으나 2019년 1월 1일부로 지금의 명칭으로 변경되었다. 경기도 화성시 노작로 240에 있다."},{"page_url":"https://en.wikipedia.org/wiki/Scottish_Americans","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Edinburgh._View_from_Calton_Hill.jpg","page_title":"Scottish Americans","context_page_description":"Scottish Americans or Scots Americans are Americans whose ancestry originates wholly or partly in Scotland. Scottish Americans are closely related to Scotch-Irish Americans, descendants of Ulster Scots, and communities emphasize and celebrate a common heritage. The majority of Scotch-Irish Americans originally came from Lowland Scotland and Northern England before migrating to the province of Ulster in Ireland and thence, beginning about five generations later, to North America in large numbers during the eighteenth century.\\nLarge-scale emigration from Scotland to America began in the 1700s, accelerating after the Jacobite rising of 1745, the resulting breakup of the clan structures, and the Highland Clearances. Displaced Scots went in search of a better life and settled in the thirteen colonies, initially around South Carolina and Virginia, and then further in successive generations."},{"page_url":"https://en.wikipedia.org/wiki/Baypointe_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Baypointe_VTA_2174_10.JPG","page_title":"Baypointe station","context_page_description":"Baypointe is a light rail station operated by Santa Clara Valley Transportation Authority in San Jose, California. This station is served by VTA's Orange Line and is the northern terminus for the Blue Line.\\nBaypointe station is differentiated from other VTA light rail stations as it features three tracks and two island platforms. Blue Line trains stop and reverse direction on the center track, while Orange Line trains use the two outer tracks. Passengers can make a cross platform transfer with either line in any direction."},{"page_url":"https://de.wikipedia.org/wiki/K-On!","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/AKG_K701.jpg","page_title":"K-On!","context_page_description":"K-On! ist eine Yonkoma-Manga-Reihe des Zeichners und Autors Kakifly, die von April 2007 bis September 2010 und erneut von April 2011 bis Juni 2012 veröffentlicht wurde. Im Jahr 2009 wurde der Manga durch Kyōto Animation aufgegriffen und als Anime-Fernsehserie adaptiert. Die Serie war sehr erfolgreich und konnte verschiedene Rekorde aufstellen. So war sie zum damaligen Zeitpunkt die in der ersten Woche am häufigsten verkaufte Anime-Fernsehserie. Eine zweite Staffel zur Anime-Fernsehserie folgte im Jahr 2010 und ein Kinofilm im Jahr 2011, beide ebenfalls von Kyōto Animation. Aber auch die Musikveröffentlichungen, die aus dem Franchise hervorgingen, waren überaus erfolgreich. Das Mini-Album Hōkago Tea Time erreichte als erstes Album, unter dem Namen von Anime-Figuren, den 1. Platz der japanischen Musikcharts und auch die mehr als zwei Dutzend Singles platzierten sich fast alle in den Top 10."},{"page_url":"https://cs.wikipedia.org/wiki/Hippodameia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Pelops_and_Hippodamia%3B_Base_relief%2C_Metropolitan_Museum%2C_New_York_City.jpg","page_title":"Hippodameia","context_page_description":"Hippodameia je v řecké mytologii dcera krále Oinomaa v élidské Píse.\\nKráli Oinomaovi dávná věštba říkala, že zahyne rukou svého zetě. A tak jeho dcera Hippodameia, vyhlášená svou krásou, dlouho marně čekala na ženicha. Její otec totiž vyhlásil, že její ruku dostane ten muž, který ho porazí v závodech s koňmi. S dodatkem, že poraženému srazí hlavu a ještě ho probodne.\\nKdyž do Písy dorazil Pelops, syn Tantalův, zdobily hradní bránu hlavy už osmnácti nápadníků. Pelopovi se však Hippodameia tolik líbila, že o ni i přesto hodlal usilovat. Požádal krále o její ruku a byl vyzván k závodu. Oba soupeři měli vynikající spřežení a k tomu vozy – ten Oinomaův byl od jeho otce, boha války Area stejně jako koně, kteří nikdy neprohráli, i když král svým soupeřům dokonce dával náskok. Vůz Pelopův měl křidélka na kolech, podle jiných ale\\nměl okřídlené koně. Pravda je, že Pelops nechtěl nic riskovat a požádal královského vozataje Myrtila, aby pro něj udělal službu."},{"page_url":"https://eu.wikipedia.org/wiki/Jariatze","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/USMC-04952.jpg","page_title":"Jariatze","context_page_description":"Biologian, jariatzea edo jariaketa zelulek edonolako substantziak kanporatzeari eta horren ondorioari deritzo."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B8%A9%E6%96%AF%E7%89%B9%E9%B2%81%E7%89%B9-%E6%B5%B7%E5%B0%BC%E5%B8%8C%E5%8E%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Wappen_Unstrut-Hainich-Kreis.png","page_title":"温斯特鲁特-海尼希县","context_page_description":"温斯特鲁特-海尼希县是德国图林根州西北部的一个县，县府米尔豪森。"},{"page_url":"https://cs.wikipedia.org/wiki/Helsing%C3%B8r","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Kromborg_View_from_the_sea.jpg","page_title":"Helsingør","context_page_description":"Helsingør je přístavní město na ostrově Sjælland na severovýchodě Dánska, 40 km severně od Kodaně. Leží při severním ústí mořského průlivu Øresund naproti o něco většímu švédskému městu Helsingborg, vzdálenému jen 4,5 km, což představuje 20 minut plavby trajektem. Helsingør, významný dopravní uzel mezi Dánskem a Švédskem, je sídlem obce, která na rozloze 122 km² zahrnuje 61 000 obyvatel."},{"page_url":"https://af.wikipedia.org/wiki/Metamorfoses","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/TitianDianaCallistoEdinburgh.jpg","page_title":"Metamorfoses","context_page_description":"Die Metamorfoses is ’n 8ste-eeuse Latynse verhalende gedig deur die antieke Romeinse digter Ovidius wat as sy magnum opus beskou word. Dit bestaan uit 11 995 reëls, 15 boeke en meer as 250 mites, en vertel die geskiedenis van die wêreld van sy skepping tot die vergoddeliking van Julius Caesar binne ’n losweg mities-historiese raamwerk.\\nHoewel dit aan die kriteria vir ’n epiese gedig voldoen, kan die werk nie in ’n eenvoudige genre geklassifiseer word nie deurdat dit verskillende temas en tone gebruik. Ovidius het inspirasie vir sy werk gekry uit die genre metamorfosepoësie, en sommige van die Metamorfoses is ontleen aan vorige behandelings van dieselfde mites; hy het egter aansienlik van al dié modelle afgewyk.\\nDie Metamorfoses is een van die invloedrykste werke in die Westerse kultuur, en het baie skrywers soos Dante Alighieri, Giovanni Boccaccio, Geoffrey Chaucer en William Shakespeare beïnvloed. Talle episodes van sy gedig is uitgebeeld in bekende werke in beeldhoukuns, skilderkuns en musiek. Hoewel belangstelling in Ovidius ná die Renaissance afgeneem het, was daar teen die einde van die 20ste eeu ’n herlewing in aandag vir sy werk."},{"page_url":"https://en.wikipedia.org/wiki/Cliff_Cave_County_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Cliffcave-21Nov12-07.jpg","page_title":"Cliff Cave County Park","context_page_description":"Cliff Cave County Park is a 525-acre public park located in St. Louis, Missouri. The park is operated by St. Louis County Parks. It is named after Cliff Cave, a natural cave located in the park that is a historical and archaeologic site. The park contains woodlands, wetlands, and rocky hillsides and is adjacent to the Mississippi River. It has three trails: the Mississippi Trail, the Spring Valley Trail, and the River Bluff Trail. The Riverside Shelter overlooks the Mississippi River. An active train track runs through the park. Cliff Cave Park is part of the Mississippi River Greenway. The park won the \\"Best View of the Mississippi\\" award in 2009, which it was granted by The Riverfront Times."},{"page_url":"https://it.wikipedia.org/wiki/Cinclus_mexicanus","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Amercan_Dipper.jpg","page_title":"Cinclus mexicanus","context_page_description":"Il merlo acquaiolo americano o merlo acquaiolo del Nordamerica, è un uccello passeriforme della famiglia dei Cinclidae."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B5%8B%E0%B4%95%E0%B5%8D%E0%B4%B8%E0%B4%BF%E0%B4%AF%E0%B5%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Pentas_flowers.jpg","page_title":"നോക്സിയേ","context_page_description":"നോക്സിയേ റുബിയേസീ കുടുംബത്തിലെ പുഷ്പിക്കുന്ന സസ്യങ്ങളുടെ സമൂഹമാണ്. 131-ഓളം സ്പീഷിസുകളും 16 ജീനസുകളും ഇതിനു കീഴിലായുണ്ട്. ഇതിന്റെ അപരയിനങ്ങൾ തെക്കെ അമേരിക്കയിലെ ഉഷ്ണമേഖലാ പ്രദേശങ്ങളിലാണ് സാധാരണയായി കണ്ടുവരുന്നുണ്ട്. പടിഞ്ഞാറൻ ഇന്ത്യൻ മഹാസമുദ്രത്തിലെ ദ്വീപുകളും, അറബ്യൻ ഉപദ്വീപുകളിലും, ഏഷ്യയിലെ ഉഷ്ണമേഖല-മിതോഷ്ണമേഖലാപ്രദേശങ്ങളിലും, വടക്കൻ ആസ്ട്രേലിയയിലും ഈ സസ്യയിനങ്ങൾ കണ്ടുവരുന്നു."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%94%B0%E4%B8%AD%E4%B8%80%E6%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/%E5%A5%84%E7%BE%8E%E5%B8%82%E3%81%AE%E7%94%B0%E4%B8%AD%E4%B8%80%E6%9D%91%E3%81%AE%E4%BD%8F%E5%B1%85%E8%B7%A1.jpg","page_title":"田中一村","context_page_description":"田中 一村は、日本画家である。中央画壇とは一線を画し、1958年、50歳で単身奄美大島に移住。奄美の自然を愛し、亜熱帯の植物や鳥を鋭い観察と画力で力強くも繊細な花鳥画に描き、独特の世界を作り上げた。本名は田中孝。奄美市名瀬有屋38番地3には、最後の10日間を過ごした家が、田中一村終焉の家として移設保存されている。"},{"page_url":"https://en.wikipedia.org/wiki/Gandhi_cap","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Indian_National_Congress%2C_New_Delhi_%2C_1937.jpg","page_title":"Gandhi cap","context_page_description":"The Gandhi cap is a white coloured sidecap, pointed in front and back and having a wide band. It is made out of khadi. It takes its name after the Indian leader Mahatma Gandhi, who first popularised its use during the Indian independence movement. Worn commonly by Indian independence activists, it became a symbolic tradition for politicians and political activists to wear it in independent India."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%84%D9%86%D8%A8%D8%AF%D8%B1%D9%8A%D8%BA_(%D9%88%D9%8A%D9%84%D8%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Llanbadrig_Church2.JPG","page_title":"للنبدريغ (ويلز)","context_page_description":"للنبدريغ (ويلز) هي منطقة سكنية تقع في المملكة المتحدة في. يقدر عدد سكانها بـ 1,392 نسمة."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%8F%E3%82%AF%E9%85%B8CoA%E3%83%AA%E3%82%AC%E3%83%BC%E3%82%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/2fp4.png","page_title":"コハク酸CoAリガーゼ","context_page_description":"GDP形成コハク酸CoAリガーゼ は合成酵素の一種。 スクシニルCoAシンターゼ、コハク酸チオキナーゼ、スクシニルCoA合成酵素、サクシニルCoA合成酵素とも言う。シンターゼ、リガーゼというのは合成酵素を指す。EC番号はEC6.2.1.4。\\n酵素学では、EC 6.2.1.4 は化学反応を触媒する酵素。\\nGTP +コハク酸+ CoA GDP +リン酸+サクシニル-CoA\\nこの酵素の3つの基質はGTP、コハク酸、およびCoAだが、その3つの産物はGDP、リン酸、およびスクシニル-CoAである。\\nこの酵素はリガーゼファミリー 、特に酸チオールリガーゼとして炭素硫黄結合を形成するリガーゼファミリーに属している。この酵素クラスの体系的な名前は、コハク酸塩：CoAリガーゼである。一般的に使用される他の名前には、スクシニルCoAシンテターゼ、スクシニルコエンザイムAシンテターゼ、コハク酸チオキナーゼ、コハク 酸チオキナーゼ、コハク酸 コエンザイムAシンテターゼ、コハク酸リン酸化酵素、P-酵素、SCS、G -STK、サクシニルコエンザイムAシンテターゼ、サクシニルCoAシンテターゼおよびサクシニルコエンザイムAシンテターゼ。この酵素はクエン酸回路とプロパノエート代謝に関与している。\\nクエン酸回路を構成する酵素の一つで、コハク酸、CoA、GTPからスクシニルCoA、GDP、リン酸を生成する反応と、逆にスクシニルCoAをコハク酸とCoAに分解する反応を触媒する。"},{"page_url":"https://sl.wikipedia.org/wiki/Erhard_Milch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Milch.jpg","page_title":"Erhard Milch","context_page_description":"Erhard Milch, nemški vojaški pilot, general, poslovnež in policist, * 30. marec 1892, † 25. januar 1972.\\nBil je letalec v prvi svetovni vojni. Nato se je zaposlil v civilnem letalstvu in postal znan kot prvi direktor Lufthanse. Po prihodu nacistov na oblast je postal minister za letalstvo in odigral ključno vlogo pri novem razvoju nemškega vojnega letalstva. Bil je znan kot delaven in sposoben vodja, ki je znal opraviti tudi najtežavnejše naloge.\\nGeneralfeldmaršal Milch je bil eden najvišjih nemških generalov Wehrmachta druge svetovne vojne. Bil je tudi neposredno udeležen pri ustanovitvi Luftwaffe leta 1935 in je v vojni zagovarjal razširitev in ojačitev letalstva, toda Hermann Göring in Adolf Hitler mu nista prisluhnila. Posledično se Nemčija ni mogla obraniti pred hudimi zračnimi napadi, ki sta jih izvajala Anglija in ZDA. Po vojni so ga obtožili zaradi odgovornosti za zločine storjene pri množični uporabi suženjske delovne sile v letalski industriji. Sprva je bil obsojen na doživljenski zapor, končno je odsedel do leta 1954. Umrl je leta 1972 v Düsseldorfu."},{"page_url":"https://sv.wikipedia.org/wiki/Pilens_backe","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/LA2_Pilens_backe.jpg","page_title":"Pilens backe","context_page_description":"Pilens backe är en gammal och ofta omtalad gata i Linköping, ett populärt motiv i konsten.\\nGatan är idag en gångväg som löper genom kvarteren Ekvatorn och Elden, norrut från Nygatan uppför en brant backe och mynnar genom ett portvalv ut mot Storgatan vid yttre borggården till Linköpings slott. Den har sitt namn efter en kopparslagare på 1700-talet som hette Pihl. På 1950-talet blev det aktuellt att riva kopparslagarfamiljen Pihls timmerhus vid Storgatan. Det flyttades 1957 till kulturreservatet Gamla Linköping, där det är beläget vid Kryddbodtorget och inrymmer Knyppelboden. Portvalvet finns kvar och utgör i sin nya placering början av Kopparslagaregränd, som är modellerad efter Pilens backe men inte lika brant. Vid Storgatan uppfördes nya hus, ritade av arkitekterna Leif Reinius och Sven Backström, som återskapar portvalvet och backen."},{"page_url":"https://de.wikipedia.org/wiki/Stadtkirche_Brandis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/KircheBrandis3.jpg","page_title":"Stadtkirche Brandis","context_page_description":"Die Stadtkirche zu Brandis ist ein evangelisches Kirchengebäude der Evangelisch-Lutherischen Landeskirche Sachsens in Brandis bei Leipzig im Landkreis Leipzig."},{"page_url":"https://en.wikipedia.org/wiki/Trout_River_Border_Crossing","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/%C3%89difice_de_la_douane_de_l%27immigration_05.JPG","page_title":"Trout River Border Crossing","context_page_description":"Trout River is a border crossing connecting Athelstan, Quebec to Constable, New York on the Canada–US border, most prominently featuring the Trout River Border Inspection Station. The crossing can be reached by New York State Route 30 on the American side and by Quebec Route 138 on the Canadian side.\\nHistorically, Trout River was the primary crossing of the Trout River, NY port of Entry. This distinction is due to the fact that the U.S. Customs and Border Protection defines a port of entry as 'any designated place at which a CBP officer is authorized to accept entries of merchandise to collect duties, and to enforce the various provisions of the customs and navigation laws'. This means that the border stations of Fort Covington and Churubusco are facilities of the Trout River Port of Entry.\\nThere are several buildings near this crossing that were built prior to the establishment of the US-Canada border in 1842. These include a former duty-free shop and two residences."},{"page_url":"https://ja.wikipedia.org/wiki/A-6_(%E8%88%AA%E7%A9%BA%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/A-6Es_VA-75_and_S-3B_VS-30_on_USS_Enterprise_1996.JPEG","page_title":"A-6 (航空機)","context_page_description":"A-6は、アメリカ海軍と海兵隊が1963年-1997年までの34年間運用した艦上攻撃機である。ベトナム戦争や湾岸戦争をはじめとする、就役期間中に発生したアメリカ海軍の艦上機が何らかの形で関わったほとんどの戦争や紛争に参加した。愛称はイントルーダー。\\n派生型にEA-6B プラウラー電子戦機が存在し、EA-6Bはアメリカ海軍で2015年まで、海兵隊では2019年まで運用されていた。"},{"page_url":"https://es.wikipedia.org/wiki/Richard_Branson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Pierre_Omidyar_Richard_Branson.jpg","page_title":"Richard Branson","context_page_description":"Richard Charles Nicholas Branson ​, normalmente citado como Richard Branson, es un multimillonario empresario inglés; conocido por su marca Virgin, con más de 360 empresas que forman Virgin Group.​ Branson fundó su primera empresa con éxito a los 16 años, cuando publicó la revista Student.​ En 1970 creó un registro por correo para las empresas. En 1972 abrió la cadena de tiendas de discos Virgin Records, más tarde conocida como Virgin Megastores y renombrada como Zavvi.​ Con su extravagante estilo competitivo, la marca Branson's Virgin creció rápidamente durante la década de 1980; creó Virgin Atlantic Airways​ y la ampliación de Virgin Records, el sello discográfico. Richard Branson es la 286.ª persona más rica del mundo ​ y la 12.ª más rica del Reino Unido, de acuerdo con Forbes, con un patrimonio neto estimado en 5100 millones de dólares.​"},{"page_url":"https://en.wikipedia.org/wiki/William_Lowthian_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Tetrahedral_hypothesis.jpg","page_title":"William Lowthian Green","context_page_description":"William Lowthian Green was an English adventurer and merchant who later became cabinet minister in the Kingdom of Hawaii. As an amateur geologist, he published a theory of the formation of the earth called the tetrahedral hypothesis."},{"page_url":"https://en.wikipedia.org/wiki/Lowell,_Idaho","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Clearwateridrivermap.png","page_title":"Lowell, Idaho","context_page_description":"Lowell is an unincorporated community in Idaho County, Idaho, United States, located at the confluence of the Selway and Lochsa rivers, where they join to form the Middle Fork of the Clearwater River. The community lies within the Nez Perce-Clearwater National Forests at an elevation of 1,486 feet above sea level, and was named after Henry Lowell, its first postmaster.\\nU.S. Route 12 is the only major highway to serve the community, and occupies the north bank of the Lochsa. Lowell is between the three rivers, and is accessed by a bridge over the terminus of the Lochsa on Selway Road. The population of Lowell is 30, and there are several motels, resorts, and campgrounds that swell the population seasonally.\\nThe site of the Kooskia Internment Camp is about 6 miles upstream of Lowell on U.S. 12, on the north bank of the Lochsa River."},{"page_url":"https://ca.wikipedia.org/wiki/Lieucourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Lieucourt.JPG","page_title":"Lieucourt","context_page_description":"Lieucourt és un municipi francès, situat al departament de l'Alt Saona i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 74 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Alfred_%C3%86theling","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Alfred_%C3%86theling_-_MS_Royal_14_B_V.jpg","page_title":"Alfred Ætheling","context_page_description":"Alfred est un prince anglo-saxon mort le 5 février 1036 ou 1037. Il est le fils du roi Æthelred le Malavisé par sa seconde épouse Emma de Normandie, et le frère cadet d'Édouard le Confesseur."},{"page_url":"https://ca.wikipedia.org/wiki/Oce%C3%A0_Pac%C3%ADfic","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Oceania_Political_Map_%28EEZ_based%29.png","page_title":"Oceà Pacífic","context_page_description":"L'oceà Pacífic és el cos d'aigua més gran del món. Aquest oceà cobreix una tercera part de la superfície terrestre, amb una àrea de 179,7 milions de km². S'estén uns 15.500 km des del mar de Bering, al nord de l'Àrtic, fins als marges gelats de l'Antàrtida al Sud; el Pacífic ateny la seva màxima amplitud E-O aproximadament a 5 graus de latitud Nord, on s'estén per uns 19.800 km, des d'Indonèsia fins a la costa de Colòmbia. El límit occidental de l'oceà se situa sovint a l'estret de Malacca. El punt de més fondària de la superfície terrestre, la fossa de les Mariannes, està ubicat al Pacífic.\\nEl Pacífic conté unes 25.000 illes, més que tota la resta d'oceans junts, la majoria de les quals es troben al sud de l'equador. Aquest oceà cobreix una àrea de 165.700.000 km². El punt més baix de la superfície de l'escorça terrestre, la fossa de les Marianes, es troba al Pacífic.\\nAl llarg dels marges irregulars del Pacífic hi ha molts mars, els més grans dels quals són el mar de Cèlebes, mar del Corall, Mar de la Xina Oriental, mar del Japó, mar de Sulu, Mar de Tasmània i la mar Groga."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%A7%D9%84_%D9%85%DA%A9%E2%80%8C%D8%B4%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Paul_McShane_2012_Sopot.jpg","page_title":"پال مک‌شین","context_page_description":"پال مک‌شین بازیکن فوتبال اهل کشور ایرلند است.\\nوی سابقهٔ ۲۸ بازی و ۰ گل ملی را برای تیم ملی ایرلند دارد و پست تخصصی این بازیکن، دفاع است."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%82%B9%E3%83%A9%E3%82%B0%E3%82%B9%E3%83%90%E3%83%8A%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Roslags_N%C3%A4sby_station_2.JPG","page_title":"ロスラグスバナン","context_page_description":"ロスラグスバナンは、スウェーデンの首都・ストックホルムと近隣都市を結ぶ891mm軌間の電気鉄道。ストールストックホルムス・ロカールトラフィークが施設を保有し、2013年以降は民間の交通運行会社であるアリーヴァが列車運行や駅の業務などを行っている。"},{"page_url":"https://en.wikipedia.org/wiki/The_Wrekin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/The_Wrekin_Summit.jpg","page_title":"The Wrekin","context_page_description":"The Wrekin is a hill in east Shropshire, England. It is located some five miles west of Telford, on the border between the unitary authorities of Shropshire and Telford and Wrekin. Rising to a height of 407 metres above the Shropshire Plain, it is a prominent and well-known landmark, signalling the entrance to Shropshire for travellers westbound on the M54 motorway. The Wrekin is contained within the northern panhandle of the Shropshire Hills AONB. The hill is popular for walkers and tourists and offers good views of Shropshire. It can be seen well into Staffordshire and the Black Country, and even as far as the Beetham Tower in Manchester, Winter Hill in Lancashire and Cleeve Hill in Gloucestershire."},{"page_url":"https://gl.wikipedia.org/wiki/Picaxuncos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Cisticola_juncidis_MHNT_232_Ramdane_Djamel_Alg%C3%A9rie.jpg","page_title":"Picaxuncos","context_page_description":"O picaxuncos ou carriza dos xuncos é un paxaro amplamente distribuído no Vello Mundo, desde o sur de Europa, a África e ao sur de Asia ata o norte de Australia. En Galicia é unha especie nativa e común. É un pequeno paxaro que se encontra principalmente en zonas de pradeira, doado de identificar pola súa mitra marrón avermellada; ademais, carece de colar dourado e a súa cola amarronada ten os extremos brancos. Durante a estación reprodutora, os machos realizan unha exhibición de voo zigzagueante acompañada dunhas chamadas regulares, que foron comparadas co ruído de abrir e pechar tesoiras. Constrúen un niño con forma de bolsa nunha mata de herbas."},{"page_url":"https://pt.wikipedia.org/wiki/Campanha_de_Marco_Ant%C3%B4nio_em_Atropatena","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/PhraatesIVProfile.jpg","page_title":"Campanha de Marco Antônio em Atropatena","context_page_description":"A Campanha de Marco Antônio em Atropatena foi uma campanha, parte da chamada Campanha parta de Marco Antônio, realizada entre os anos de 36 e 35 a.C. pelo triúnviro Marco Antônio na Média Atropatena como prelúdio de uma planejada invasão ao Império Parta depois das vitórias de seu general Públio Ventídio Basso entre 40 e 38 a.C.. e da retomada de Jerusalém em 37 a.C. Um tremendo feito de organização, logística e estratégia militar, a invasão terminou sem conseguir nenhum resultado prático. Depois de marchar quase dois mil quilômetros com o maior exército já visto na região, Marco Antônio foi obrigado a se retirar da Média, o que ele fez de forma brilhante, sem conquistar nada."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8C%80%ED%95%9C%EB%AF%BC%EA%B5%AD_%EC%A0%9C11%EB%8C%80_%EA%B5%AD%ED%9A%8C%EC%9D%98%EC%9B%90_%EC%84%A0%EA%B1%B0_%EA%B0%95%EC%9B%90%EB%8F%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/%EC%A0%9C11%EB%8C%80%EC%B4%9D%EC%84%A0%EA%B0%95%EC%9B%902.png","page_title":"대한민국 제11대 국회의원 선거 강원도","context_page_description":"대한민국 제11대 국회의원 선거 강원도는 1981년 3월 25일 치러진 국회의원 선거로 1개의 선거구에서 2인을 선출하는 중선거구제를 취해 총 6개의 선거구에서 12인이 당선되었다. 선거인 947,977명 중 834,253명이 투표를 하여 88.0%의 투표율을 기록하였다."},{"page_url":"https://hu.wikipedia.org/wiki/Tesla-tekercs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/K%C3%A9s%C5%91bbi_Tesla-tekercs.png","page_title":"Tesla-tekercs","context_page_description":"Nikola Tesla 1891-ben építette meg a róla elnevezett Tesla-tekercset. A Tesla-tekercs legalább két légmagos tekercsből áll, ami nagyfeszültséget állít elő nagyfrekvencián. A nagyfeszültség 10 000 V-tól akár 10 000 000 V-ig terjedhet, a frekvencia pedig több MHz is lehet, általában 25 kHz és 2 MHz között mozog. A Tesla-tekercs abban különbözik a transzformátortól, hogy a primer és szekunder áramköre is rezonanciában van az üzemi frekvenciával, a bevezetett feszültség frekvenciáját megváltoztatja, valamint abban, hogy légmagos kialakítású. A tekercsek tápellátását célszerűen transzformátor biztosíthatja. Tesla volt az első, aki az elektromos rezonancia jelenségét a gyakorlatban is megvalósította és felhasználta.\\nTesla több, különböző rendeltetésű és működésű Tesla-tekercset épített, ezek mindegyike egy-egy új felhasználási terület alapjait hozta létre, fejlesztései a nagyfrekvenciás generátoroknak, az elektromos áram vezeték nélküli továbbításának, az elektroterápiás készülékeknek, valamint az összes ma használatos hírközlő berendezésnek az alapvető elemévé váltak."},{"page_url":"https://pt.wikipedia.org/wiki/Jodocus_Badius","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Badius_Ascensius_trademark.jpg","page_title":"Jodocus Badius","context_page_description":"Jodocus Badius, ou ainda Josse Badius, Josse Bade, Jodoco del Badia, Jodocus Van Asche Badius foi um pioneiro da indústria de impressão, e também um renomado gramático e pedagogo flamengo."},{"page_url":"https://en.wikipedia.org/wiki/Kauno_autobus%C5%B3_gamykla","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Kag3%28b%29.jpg","page_title":"Kauno autobusų gamykla","context_page_description":"Kauno autobusų gamykla abbreviated KAG was a factory in Kaunas, Lithuanian SSR that produced about 10,000 KAG-3 buses from 1956 to 1990. The buses used chassis of the GAZ-51 truck. The factory then added wooden frames covered with metal sheets. It was the only mass-produced vehicle in Lithuania.\\nThe factory was established in an old workshop owned by Amerikos lietuvių akcinė bendrovė abbreviated as Amlit. The company imported\\nFord cars, Fordson tractors, bicycles. Around 1929, it started building passenger buses with wooden frames based on Ford chassis. About 25 buses were produced per year. The company was nationalised after Lithuania was occupied by the Soviet Union. After World War II, there was a shortage of vehicles and metal. The auto shop, then known as Kauno autoremonto gamykla, started modifying ZIS-150 trucks into L-1 buses that were first designed and produced in Leningrad in 1949.\\nIn 1952, the factory started building KAG-1 passenger buses which were copies of the Russian GZA-651 buses and were built on the GAZ-51 chassis. The factory improved the model and developed its own KAG-3 bus though it retained essentially the same specifications."},{"page_url":"https://fr.wikipedia.org/wiki/Noisseville","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Lion_guerre_1870_Retonfey.JPG","page_title":"Noisseville","context_page_description":"Noisseville est une commune française située dans le département de la Moselle en région Grand Est."},{"page_url":"https://en.wikipedia.org/wiki/Global_surveillance_disclosures_(2013%E2%80%93present)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/NSA_NIGHTSTAND.jpg","page_title":"Global surveillance disclosures (2013–present)","context_page_description":"Ongoing news reports in the international media have revealed operational details about the United States National Security Agency and its international partners' global surveillance of both foreign nationals and U.S. citizens. The reports mostly emanate from a cache of top secret documents leaked by ex-NSA contractor Edward Snowden, which he obtained whilst working for Booz Allen Hamilton, one of the largest contractors for defense and intelligence in the United States. In addition to a trove of U.S. federal documents, Snowden's cache reportedly contains thousands of Australian, British and Canadian intelligence files that he had accessed via the exclusive \\"Five Eyes\\" network. In June 2013, the first of Snowden's documents were published simultaneously by The Washington Post and The Guardian, attracting considerable public attention."},{"page_url":"https://nl.wikipedia.org/wiki/Sint-Jozef_(%27s-Heerenberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Molenstr._12%2C_voorgevel_-_%27s-Heerenberg_-_20105868_-_RCE.jpg","page_title":"Sint-Jozef ('s-Heerenberg)","context_page_description":"Sint Jozef of het Sint Jozefgebouw is een rijksmonument gelegen in 's-Heerenberg. Tot in de jaren 90 van de vorige eeuw was het een soort dorpshuis. In Sint Jozef vonden onder andere culturele activiteiten plaats zoals pronkzittingen van carnavalsvereniging d'Olde Waskupen, fancy fairs van Harmonie Crescendo en voorstellingen voor de schooljeugd in 's-Heerenberg. Later was er ook het pension van paranormaal genezer Cornielje, lokaal De Strieker gehuisvest. Het gebouw is gelegen in de Molenstraat. Thans is er in het pand een 3-sterren hotel annex restaurant, genaamd de Lantscroon gevestigd."},{"page_url":"https://nl.wikipedia.org/wiki/Neptosternus_riedeli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Neptosternus_riedeli%2C_Thailand.jpg","page_title":"Neptosternus riedeli","context_page_description":"Neptosternus riedeli is een keversoort uit de familie waterroofkevers. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1997 door Hendrich & Balke."},{"page_url":"https://az.wikipedia.org/wiki/A%C4%9Fvanlar_hamam%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/A%C4%9Fvanlar_bath.JPG","page_title":"Ağvanlar hamamı","context_page_description":"Ağvanlar hamamı — XIX əsrdə Şəkidə tikilmiş abidə. Yuxarı Baş Dövlət Tarix-Memarlıq Qoruğunun ərazisində yerləşir və təyinatı üzrə istifadə edilmir."},{"page_url":"https://sv.wikipedia.org/wiki/Bembidion_hesperium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Bembidion_hesperium.jpg","page_title":"Bembidion hesperium","context_page_description":"Bembidion hesperium är en skalbaggsart som beskrevs av Thomas Casey. Bembidion hesperium ingår i släktet Bembidion och familjen jordlöpare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://nl.wikipedia.org/wiki/Transfiguratiekathedraal_(Nizjni_Novgorod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/%D0%98%D0%BA%D0%BE%D0%BD%D0%BE%D1%81%D1%82%D0%B0%D1%81_%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D1%8F%D1%80%D0%BC%D0%B0%D1%80%D0%BE%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D0%B0.jpg","page_title":"Transfiguratiekathedraal (Nizjni Novgorod)","context_page_description":"De Kathedraal van de Transfiguratie of Spasskija Starojarmarotsjny Kathedraal is een Russisch-orthodoxe kathedraal in de Russische stad Nizjni Novgorod. De kathedraal is het oudste nog bestaande gebouw van het oude handelsgebied dat bij Nizjni Novgorod werd gevestigd, na een allesvernietigende brand in 1816 op de oude plek bij het Makarjevklooster."},{"page_url":"https://fr.wikipedia.org/wiki/Poligny_(Jura)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Ch%C3%A2teau_de_Poligny_%28Jura%29_02.JPG","page_title":"Poligny (Jura)","context_page_description":"Poligny est une commune française située dans le département du Jura en région Bourgogne-Franche-Comté. Elle fait partie de la région culturelle et historique de Franche-Comté.\\nLieu de négoce d'un fromage au lait cru très connu, Poligny est souvent citée comme « capitale mondiale du comté » alors que ce fromage n'est produit qu'en France, en Franche-Comté et dans l'est du département de l'Ain."},{"page_url":"https://de.wikipedia.org/wiki/Krymskyj_trolejbus","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Simferopol-trol.jpg","page_title":"Krymskyj trolejbus","context_page_description":"Krymskyj trolejbus, auch bekannt als Krymtrolleybus, ist die Bezeichnung eines Oberleitungsbus-Betriebs auf der Halbinsel Krim und zugleich der Name der dafür verantwortlichen staatlichen Verkehrsgesellschaft. Sie betreibt dort die weltweit längste Oberleitungsbuslinie, häufig auch Die Trasse genannt. Diese ist 86,5 Kilometer lang und verbindet den Hauptort Simferopol im Landesinneren mit der südlich gelegenen Küstenstadt Jalta. Dabei folgt sie fast auf gesamter Länge der ukrainischen Fernstraße M 18, einem Teil der Europastraße 105.\\nWichtigste Zwischenstation ist Aluschta, ab dort verläuft die Route entlang dem Schwarzen Meer. Ferner führt sie durch das Krimgebirge. Dort erreicht die topografisch anspruchsvolle Strecke am 752 Meter hohen Anharskyj-Pass ihren höchsten Punkt. Die Maximalsteigung der Passstraße beträgt dabei neun Prozent. In den drei Städten Simferopol, Jalta und Aluschta bestehen zudem jeweils lokale Obus-Netze, sie werden ebenfalls von Krymskyj trolejbus betrieben."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%82%D1%8B%D0%BF-%D0%9F%D0%BE%D0%B9%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Steep_Point.JPG","page_title":"Стып-Пойнт","context_page_description":"Стып-Пойнт — мыс, самы заходні пункт Аўстралійскага кантынента."},{"page_url":"https://en.wikipedia.org/wiki/Lebanese_cuisine","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Djejmeshwi.JPG","page_title":"Lebanese cuisine","context_page_description":"Lebanese cuisine is the culinary traditions and practices originating from Lebanon. It includes an abundance of whole grains, fruits, vegetables, fresh fish and seafood. Poultry is eaten more often than red meat, and when red meat is eaten, it is usually lamb and goat meat. It also includes copious amounts of garlic and olive oil, often seasoned with lemon juice. Chickpeas and parsley are also staples of the Lebanese diet.\\nWell known savoury dishes include baba ghanouj, a dip made of char-grilled eggplant; falafel, small deep-fried patties made of highly spiced ground chickpeas, fava beans, or a combination of the two; and shawarma, a sandwich with marinated meat skewered and cooked on large rods. An important component of many Lebanese meals is hummus, a dip or spread made of blended chickpeas, sesame tahini, lemon juice, and garlic, typically eaten with flatbread. A well known dessert is baklava, which is made of layered filo filled with nuts and steeped in date syrup or honey. Some desserts are specifically prepared on special occasions: the meghli for instance, is served to celebrate a newborn baby in the family."},{"page_url":"https://et.wikipedia.org/wiki/Myrtle_Cook","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Myrtle_Cook_of_Canada_%28left%29_winning_a_preliminary_heat_in_the_womens_100_metres_race_at_the_VIIIth_Summer_Olympic_Games.jpg","page_title":"Myrtle Cook","context_page_description":"Myrtle Alice Cook oli Kanada naiskergejõustiklane, olümpiavõitja.\\nMyrtle Cook kasvas üles Torontos Beachesi linnaosas. Hiljem asus ta elama Montréali.\\nMyrtle Cook tegeles paljude spordialadega, sealhulgas tennise, jäähoki, korvpalli, aerutamise, bowlingu ja jalgrattaspordiga. Viieteistaastaselt võeti ta Kanada kergejõustikukoondisse.\\nAastal 1923 oli Cook üks Kanada esimese ainult naistele mõeldud spordiklubi Toronto Ladies Athletic Club algatajaid.\\nCook püstitas olümpiakatsevõistlustel Halifaxis ühe esimestest 100 m jooksu maailmarekorditest ja oli 1928. aasta suveolümpiamängudel Amsterdamis, kus esimest korda naissportlased ametlikult osalesid, sel alal üks favoriite, kuid olümpiamängudel ta diskvalifitseeriti kahe valelähte tõttu lõppvõistlusel. Siiski võitis ta koos Jane Belli, Ethel Smithi ja Bobbie Rosenfeldiga 5. augustil kuldmedali naiste 4×100 m teatejooksus, kus ta jooksis viimast vahetust. Eeljooksu aeg 49,3 ja finaali aeg on ühtlasi ala esimesed olümpiarekordid. Cook jäi kuni 1931. aastani Kanada meistriks naiste 100 m jooksus ja 60 m jooksus, püstitades Kanada, Ameerika ja maailmarekordeid."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%90%E1%83%A1%E1%83%9E%E1%83%98%E1%83%A9%E1%83%90%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%97%E1%83%94%E1%83%9B%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Kaspichan_Municipality_Within_Bulgaria.png","page_title":"კასპიჩანის თემი","context_page_description":"კასპიჩანის თემი — თემი ჩრდილო-აღმოსავლეთ ბულგარეთში. შედის შუმენის ოლქში. თემის მოსახლეობაა 8 434 ადამიანი, ხოლო ფართობი შეადგენს 275.06 კმ²-ს. მოიცავს 11 დასახლებულ პუნქტს. ადმინისტრაციული ცენტრია ქალაქი კასპიჩანი."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%AA%D8%A7%D9%8A%D8%A7%D9%85%D8%A7_%D8%B4%D9%8A%D9%86%D8%AC%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Sumo_wrestler_in_Japan_%E7%89%87%E5%B1%B1%E4%BF%A1%E6%AC%A1_%282878963194%29.jpg","page_title":"كاتاياما شينجي","context_page_description":"كاتاياما شينجي هو ريكيشي ياباني، ولد في 6 سبتمبر 1979."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%BA%D9%88%D9%84_(%D9%81%DB%8C%D9%84%D9%85_%DB%B1%DB%B9%DB%B5%DB%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Giant_%281956%29_poster.jpg","page_title":"غول (فیلم ۱۹۵۶)","context_page_description":"غول آمریکا بیرلشمیش ایالتلرینده اینگیلیس دیلینده دۇزلمیش دراماتیک فیلم. فیلمین باش روْللارینی دنیس هاپر، سال مینئو، مرسدس مک‌کمبریج، چیل ویلز، جین ویثرز، کارول بیکر، جیمز دین، راک هادسن، الیزابت تئیلور جانلاندیریب."},{"page_url":"https://tr.wikipedia.org/wiki/Asteriidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Stichastrella_rosea.jpg","page_title":"Asteriidae","context_page_description":"Asteriidae, Forcipulatida takımından denizyıldızlarının oluşturduğu bir familyadır."},{"page_url":"https://fr.wikipedia.org/wiki/Suro%C3%AEt_(Mont%C3%A9r%C3%A9gie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Palais_de_justice_de_Napierville_01.JPG","page_title":"Suroît (Montérégie)","context_page_description":"Le Suroît, également appelé Haut-Saint-Laurent ou Sud-Ouest, est une région géographique et historique du Québec située au sud-ouest de la plaine du Saint-Laurent. Son territoire correspond à la partie ouest de la région administrative de la Montérégie et à l'ancienne sous-région de la Vallée-du-Haut-Saint-Laurent."},{"page_url":"https://it.wikipedia.org/wiki/Rudbeckia_laciniata","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Li%C5%9B%C4%87_kwiatu_546.jpg","page_title":"Rudbeckia laciniata","context_page_description":"La Rudbeckia comune è una pianta erbacea, perenne a fiori gialli, simile alle “margherite”, appartenente alla famiglia delle Asteraceae."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%DB%8C%D9%86%D9%88%DA%A9%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/DeepinScreenshot_select-area_20200411150708.png","page_title":"لینوکس","context_page_description":"لینْوْکس یک سیستم‌عامل شبه یونیکس است که بخش عمدهٔ آن سازگار با استاندارد پازیکس است. لینوکس نام سیستم عامل هایی است که از لینوکس کرنل یا هسته ی لینوکس استفاده میکنند.استفاده از گنو/لینوکس برای کل لینوکس به نظر سازنده ی لینوکس اشتباه است. درحالی که بنیاد نرم‌افزار آزاد سیستم‌عامل حاصل از این ترکیب‌بندی را «گنو/لینوکس» می‌نامد، اما دیگران معمولاً آن را تنها «لینوکس» می‌خوانند، این دوگانگی در نام نهادن منجر به بحث نامگذاری گنو/لینوکس شده‌است.\\nلینوکس از سخت‌افزارهای مختلفی پشتیبانی می‌کند از جمله انواع مختلف تلفن همراه، تبلت، مسیریاب، و کنسول بازی تا رایانه‌های رومیزی، رایانه‌های بزرگ و ابررایانه‌ها.\\nاگرچه ابتدا لینوکس فقط برای استفاده روی ریزپردازنده‌هایی با معماری ۸۰۳۸۶ اینتل طراحی شده بود؛ اما امروزه انواع گوناگون معماری‌ها را پشتیبانی می‌کند و در انواع و اقسام وسایل از رایانه شخصی گرفته تا ابررایانه‌ها و تلفن‌های همراه و سرورها به کار می‌رود. این سیستم‌عامل که در ابتدا بیشتر توسط افراد مشتاق به‌طور داوطلبانه گسترش پیدا می‌کرد و به کار گرفته می‌شد، توانسته است پشتیبانی شرکت‌های بزرگی چون آی‌بی‌ام و هیولت-پاکارد را به دست آورد و با بسیاری از نسخه‌های تجاری یونیکس رقابت کند."},{"page_url":"https://tr.wikipedia.org/wiki/%C5%A0ipan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Croatia_-_Elafit_Islands_-_Sipan.PNG","page_title":"Šipan","context_page_description":"Šipan, Adriyatik Denizi'nde, Hırvatistan'a bağlı olan bir adadır. Yüzölçümü 15,81 km²'dir. En yüksek noktası 224 m yüksekliğindeki Velji Vrh'tır. Nüfusu 2001 yılı itibarı ile 436 olup nüfus yoğunluğu kilometrekare başına 27,6 kişidir. Adanın ismi tarihsel kayıtlarda ilk olarak 1371 yılında geçmektedir."},{"page_url":"https://fr.wikipedia.org/wiki/Kepler-47_c","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/%D0%9Aepler-47_system_diagram_planets.jpg","page_title":"Kepler-47 c","context_page_description":"Kepler-47 c, formellement Kepler-47 c, est une exoplanète en orbite autour du système binaire Kepler-47 dans la constellation du Cygne. Il s'agit donc d'une planète circumbinaire.\\nLe système, qui comporte une autre planète, Kepler-47 b, se trouve à environ 4 900 années-lumière de la Terre. Ce système binaire est le premier de ce type où l'on a découvert plus d'une planète circumbinaire."},{"page_url":"https://de.wikipedia.org/wiki/Polnische_Kultur_im_Zweiten_Weltkrieg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Second_world_war_europe_1941-1942_map_de.png","page_title":"Polnische Kultur im Zweiten Weltkrieg","context_page_description":"Die Polnische Kultur wurde im Zweiten Weltkrieg von den beiden Besatzungsmächten Polens, dem Dritten Reich und der Sowjetunion, die beide der polnischen Bevölkerung und Kultur feindlich gesinnt waren, brutal unterdrückt. Durch eine Politik des „kulturellen Völkermordes“ kamen tausende Wissenschaftler und Künstler zu Tode. Unzählige kulturelle Andenken wurden Opfer von Raub und Zerstörung.\\nWährend sie die Mitglieder der polnischen Kulturelite verfolgten und ermordeten, plünderten oder zerstörten die Besatzer einen Großteil des kulturellen Erbes aus Polen. Polnischen Schulen wurden zum Großteil geschlossen und diejenigen, die geöffnet blieben, mussten erhebliche Veränderungen in ihren Lehrplänen hinnehmen.\\nDennoch gelang es Untergrund-Organisationen und Einzelpersonen – vor allem dem Polnischen Untergrundstaat – viele der wertvollsten kulturellen Erbstücke Polens zu retten und so viele kulturelle Institutionen und Stücke wie möglich zu erhalten. Die katholische Kirche und wohlhabende Einzelpersonen trugen zum Überleben einiger Künstler und ihrer Werke bei."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A7%D7%A8%D7%99%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Laced_woodpecker_pair.jpg","page_title":"נקריים","context_page_description":"נקריים היא משפחה בסדרת הנקראים. זוהי המשפחה הגדולה בסדרה, ולה שני נציגים בישראל: נקר סורי וסבראש מצוי.\\nהגדול במשפחה הוא נקר סלטי גדול שאורכו 50 ס\\"מ ומשקלו 450 גרם, זאת בהנחה שנכחד המין נקר אימפריאלי שמגיע לאורך 60-65 ס\\"מ. הקטן במשפחה הוא נקר בר-חזה שאורכו 8 ס\\"מ ומשקלו 7 גרם.\\nלנקריים יש בלוטות רוק מיוחדות המסייעות לתפיסת חרקים על ידי הלשון."},{"page_url":"https://vi.wikipedia.org/wiki/Diocletianus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Salona_-_amphitheatre_-_panorama.jpg","page_title":"Diocletianus","context_page_description":"Gaius Valerius Aurelius Diocletianus, thường được gọi là Diocletianus, là Hoàng đế La Mã từ năm 284 cho đến năm 305.\\nSinh ra trong một gia đình gốc Illyria có địa vị xã hội thấp ở tỉnh Dalmatia, ông đã thăng qua các cấp bậc của Quân đội La Mã để trở thành viên chỉ huy Kỵ binh của Hoàng đế Carus. Ông được xem là một chỉ huy quân đội có hoài bão lớn lao. Sau khi Carus và con là Numerian bị giết trong chiến dịch chống Đế quốc Ba Tư, Quân đội La Mã tôn Diocletianus làm Hoàng đế mới. Diocletianus đã củng cố ngôi Hoàng đế của mình bằng việc đánh bại một người con khác của Carus trong trận Margus. Với việc lên nắm Đế quyền, ông đã kết thúc cuộc khủng hoảng của Đế quốc La Mã vào thế kỷ thứ ba. Diocletianus đã bổ nhiệm bạn ông - Maximian Augustus làm đồng hoàng đế cấp cao vào năm 285. Vào Ngày 1 tháng 3 năm 293 ông lại phong tiếp Galerius và Constantius làm Caesar, đồng hoàng đế cấp dưới. Theo chính sách \\"Tứ đầu chế\\", mỗi hoàng đế sẽ cai trị một phần tư của đế quốc La Mã. Trong các chiến dịch chống lại các bộ tộc bên sông Danube và Sarmatia, những người Alamanni, và những người đoạt ngôi ở Ai Cập, Diocletianus bảo đảm được biên giới của đế chế và củng cố Đế quyền của ông."},{"page_url":"https://sv.wikipedia.org/wiki/AB_Gustavsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Karin_Bjorquist_Kobolt.jpg","page_title":"AB Gustavsberg","context_page_description":"Gustavsberg var en tillverkare av hushållsporslin, sanitetsporslin och plastprodukter med säte i Gustavsberg på Värmdö utanför Stockholm. Ett tidigare namn var Gustavsbergs porslinsfabrik.\\nTillverkning av porslin började år 1825 och tillverkning av bruksföremål i plast startade 1945. Tillverkningen av sanitetsporslin inleddes 1937 och nedlades i Gustavsberg 2014, men Gustavsbergsprodukter tillverkas av Villeroy & Boch på andra orter.\\nNumera produceras bara hushållsporslin i mindre omfattning av HPF i Gustavsberg AB samt utrustning för vattenskärning. År 2014 startade rivningen av vissa fabriksbyggnader för att ge plats för bostadshus."},{"page_url":"https://fr.wikipedia.org/wiki/Jason_Voorhees","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Montreal_Comiccon_2015_-_Jason_Voorhees_%2819458615315%29.jpg","page_title":"Jason Voorhees","context_page_description":"Jason Voorhees est un personnage fictif né avec une tête hydrocéphale adapté au cinéma par Victor Miller, Ron Kurz, Sean S. Cunningham et Tom Savini dans le film Vendredi 13 réalisé par Sean S. Cunningham en 1980. Il est le fils d'une cuisinière du camp Crystal Lake et devenu meurtrier. Jason Voorhees a également été représenté dans de nombreux romans, bandes dessinées, et un crossover avec un autre personnage des films d'horreur, Freddy Krueger.\\nIl est question de lui dans le premier film mais il y est absent, tout comme dans le cinquième. Le célèbre masque de hockey n'apparaît qu'à partir du troisième film. Jason meurt dans le quatrième et revient sous la forme d'un mort-vivant au sixième, soit à la moitié de la saga."},{"page_url":"https://el.wikipedia.org/wiki/%CE%99%CE%B2%CE%AC%CE%BD_%CE%9A%CE%BB%CE%B9%CE%BF%CF%85%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Klyun.jpg","page_title":"Ιβάν Κλιουν","context_page_description":"Ο Ιβάν Βασιλιεβίτς Κλιουν γεννήθηκε στο Μπολσίγιε Γκόρκι, της επαρχίας Βλαντιμίρ, ενώ από το 1881 ως το 1892 έζησε μαζί με την οικογένειά του στην Ουκρανία."},{"page_url":"https://es.wikipedia.org/wiki/Wilhelm_Gustloff_(1938)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bundesarchiv_B_145_Bild-P094443%2C_Stettin%2C_%22Wilhelm_Gustloff%22_als_Lazarettschiff.jpg","page_title":"Wilhelm Gustloff (1938)","context_page_description":"El KS Wilhelm Gustloff fue un transatlántico de línea alemán construido en el astillero Blohm & Voss, que entró en servicio en 1938 durante el periodo de la Alemania nazi en tiempo de paz. En la Segunda Guerra Mundial sirvió como buque nodriza de submarinos, buque hospital, y transporte de evacuación durante la Operación Aníbal hacia el final de la contienda.\\nEl prefijo KS era el acrónimo de KdF-Schiff que era equivalente a MV o SS.\\nEl 30 de enero de 1945 fue torpedeado por el submarino soviético S-13 bajo el mando de Aleksandr Marinesko, hundiéndose con 9.343 personas a bordo, ​ constituyendo la mayor tragedia marítima de la historia.​​"},{"page_url":"https://sv.wikipedia.org/wiki/Bredmunsflugor","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Platystoma_seminationis_fg01.jpg","page_title":"Bredmunsflugor","context_page_description":"Bredmunsflugor är en familj av tvåvingar. Bredmunsflugor ingår i ordningen tvåvingar, klassen egentliga insekter, fylumet leddjur och riket djur. Enligt Catalogue of Life omfattar familjen Platystomatidae 1158 arter."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_Justo_Arosemena","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Palacio_Justo_Arosemena_%28Asambea_Legislativa%29.jpg","page_title":"Palacio Justo Arosemena","context_page_description":"El Palacio Justo Arosemena, también conocido como el Palacio Legislativo de Panamá, es la sede de la Asamblea Nacional de Panamá. Este se encuentra ubicado al frente de la Plaza José Remón Cantera, en los alrededores de la Plaza 5 de Mayo. Este lleva el nombre del político y escritor Justo Arosemena Quesada, considerado el “padre de la nacionalidad panameña”.\\nEste edificio fue construido entre 1955 y 1956 por Ernesto de la Guardia III y Williams Ross, durante la administración del presidente Ricardo Arias Espinosa, y fue inaugurado el 1 de octubre de 1956, primer día de gobierno de su sucesor, Ernesto de la Guardia. ​ El Palacio Justo Arosemena fue declarado monumento histórico nacional mediante la Ley 33 de 2006, formando parte del Conjunto Monumental Histórico de Calidonia y Ancón. ​"},{"page_url":"https://nl.wikipedia.org/wiki/Sabrina_(1954)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Sabrina7.jpg","page_title":"Sabrina (1954)","context_page_description":"Sabrina is een film uit 1954 onder regie van Billy Wilder met in de hoofdrollen Audrey Hepburn, William Holden en Humphrey Bogart.\\nDe film is gebaseerd op het toneelstuk Sabrina Fair van Samuel A. Taylor. De film zou oorspronkelijk ook Sabrina Fair heten. Dit werd veranderd, opdat het publiek niet zou denken dat de film een link had met de Vanity Fair.\\nDe film was een succes in de bioscopen en behaalde een totaal omzet van 10 miljoen dollar. Ondanks een groot aantal Oscarnominaties verzilverde de film alleen de Oscar voor Beste kostuums. Ontwerpster Edith Head kreeg deze Oscar, maar eigenlijk was Hubert de Givenchy degene die de kostuums ontwierp. Critici waren zeer te spreken over de film, maar men was wel van mening dat Humphrey Bogart niet geschikt was voor het personage van Linus. In zijn plaats had William Holden Linus moeten spelen met een jongere acteur voor de rol van David."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E5%BE%97%E5%88%A9%E7%BE%8E%E8%A1%93%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Important_Cultural_Property_Western_Kings_on_Horseback_-_Google_Art_Project.jpg","page_title":"三得利美術館","context_page_description":"三得利美術館是位於日本東京都港區赤坂九丁目的一座私立美術館，主要收藏日本古美術的美術品。運營單位是公益財團法人三得利藝術財團。2005年三得利東京支社搬遷至台場時，美術館曾一度休館，在2007年3月20日重新開放。"},{"page_url":"https://fr.wikipedia.org/wiki/San_Sebasti%C3%A1n_de_los_Reyes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/SanseAlcobendasAire.JPG","page_title":"San Sebastián de los Reyes","context_page_description":"San Sebastián de los Reyes est une commune espagnole de la Communauté de Madrid située à 18 kilomètres au nord de la capitale espagnole, Madrid. La superficie de la commune est de 59,62 km² et elle comptait au 1ᵉʳ janvier 2014, 83 329 habitants. La ville est connue communément sous le nom de \\"Sanse\\", et elle est surnommée \\"La petite Pampelune\\" en raison de ses encierros."},{"page_url":"https://it.wikipedia.org/wiki/Fabrizio_Ravanelli","image_url":"https://upload.wikimedia.org/wikipedia/it/2/27/Italia_vs_Lituania_%28Reggio_Emilia%2C_1995%29_-_Fabrizio_Ravanelli.jpg","page_title":"Fabrizio Ravanelli","context_page_description":"Fabrizio Ravanelli è un allenatore di calcio ed ex calciatore italiano, di ruolo attaccante.\\nDopo diverse esperienze tra Serie C2, C1 e B, salendo alla ribalta con le maglie di Perugia e Reggiana, ha vissuto la fase più brillante della propria carriera tra le file della Juventus, club in cui ha vinto una Coppa UEFA, uno scudetto, una Coppa Italia, una Supercoppa italiana e una Champions League. Trasferitosi al Middlesbrough prima e all'Olympique Marsiglia poi, è rientrato in Italia nel 2000, ingaggiato dalla Lazio, dove ha nuovamente conquistato scudetto, Coppa Italia e Supercoppa nazionale. Ultratrentenne, ha vestito le casacche di Derby County, Dundee e nuovamente Perugia, con cui ha chiuso la carriera nel 2005.\\nSoprannominato Penna Bianca o Silver Fox a causa del candore precocemente assunto dalla sua capigliatura, viene ricordato anche per la particolare esultanza dopo ogni suo gol, da lui personalmente inventata, che consisteva nel coprirsi la testa con la maglia di gioco e continuare a correre con le braccia divaricate.\\nÈ stato candidato al Pallone d'oro nel 1995 e nel 1996, classificandosi rispettivamente 12º e 16º."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%BE%D1%80_%D0%93%D0%BD%D0%B0%D1%81%D1%81%D1%96%D0%BD%D0%B3%D0%B1%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Pascal_Bodjona_detail%2C_ABr_60037.jpg","page_title":"Фор Гнассінгбе","context_page_description":"Фор Ессозімна Гнассінгбе — тоголезький державний й політичний діяч, президент Того з 5 по 25 лютого і з 4 травня 2005 року, колишній міністр телекомунікацій, шахт і обладнання. Голова партії «Об'єднання тоголезького народу». Фор Гнасінгбе, син багаторічного авторитарного правителя Ейядеми Гнассінгбе, після закінчення навчання за кордоном розпочав свою політичну кар'єру депутатом парламенту, а в 2003 став членом уряду. 5 лютого 2005 після смерті свого батька, порушивши Конституцію та за активного сприяння армії захопив владу і став главою держави.\\nДержавний переворот викликав протести з боку міжнародної спільноти, особливо Африканського Союзу і Економічного співтовариства західноафриканських держав. Під тиском і впливом введених санкцій, Гнассінгбе звільнив пост глави держави і погодився на проведення президентських виборів. Спірне голосування, що пройшло в квітні 2005 року в атмосфері насильства, заворушень і протестів опозиції, принесло йому перемогу і повернуло йому владу. У березні 2010 й квітні 2015 років він знову переобирався президентом, однак опозиція в обох випадках звинувачувала владу у фальсифікації."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%AC%E7%89%B9%E8%AB%BE%E9%9F%B3%E6%B3%A2%E7%90%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Vellones_et_martenot.jpg","page_title":"馬特諾音波琴","context_page_description":"馬特諾音波琴，亦稱為「馬特諾電子琴」或「馬特諾琴」，是20世紀初所發明的一種電子鍵盤樂器。由法國人莫里斯·馬特諾於1928年所發明，並隨即申請其名稱及樂器的專利。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BF%D0%B8%D1%86%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%B0%D1%80%D0%BA_%D0%98%D1%81%D0%B0%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%D0%9B%D0%B0%D0%BF%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D0%9C%D0%B0%D1%80%D0%BA_%D0%98%D1%81%D0%B0%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87.jpg","page_title":"Лапицкий, Марк Исаакович","context_page_description":"Марк Исаакович Лапицкий — российский учёный, историк, американист, доктор исторических наук, профессор."},{"page_url":"https://is.wikipedia.org/wiki/L%C3%ADmlykill","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Primula_latifolia_subsp._latifolia_SOPHY_4.JPG","page_title":"Límlykill","context_page_description":"Límlykill er blóm af ættkvísl lykla."},{"page_url":"https://pl.wikipedia.org/wiki/Mount_Agrihan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/AgrihanNASA.jpg","page_title":"Mount Agrihan","context_page_description":"Agrihan – stratowulkan tworzący wyspę o tej samej nazwie w archipelagu Marianów Północnych na Oceanie Spokojnym, terytorium zależnego Stanów Zjednoczonych. Wyspa leży 350 km na północ od Guam i ma powierzchnię 47 km². Wulkan jest aktywny - ostatnia erupcja miała miejsce w 1917 r.. Wznosi się na wysokość 3999 m ponad dno morza i jest piątym pod względem wysokości wulkanem w łuku wyspowym Marianów. Mierzący 965 m szczyt, zakończony jest kalderą o rozmiarach 1 x 2 km i głębokości ok. 500 m i jest najwyżej położonym punktem w Mikronezji.\\nWyspa była ostatnim punktem oporu rdzennej ludności Czamorro przeciw Hiszpanom, którzy okupowali Mariany pod koniec XVII wieku. W 1810 r. koloniści ze Stanów Zjednoczonych i Hawajów próbowali założyć plantacje, ale w wyniku sprzeciwu administracji hiszpańskiej opuścili wyspę. W 1990 r. ewakuowano Agrihan oraz okoliczne wyspy z powodu zagrożenia aktywnością wulkaniczną, jednak erupcja nie nastąpiła. Niedługo potem umożliwiono ponowne zasiedlanie tych terenów, mimo to przez długi czas wyspa pozostawała niezamieszkana. Dopiero przed 2005 r. wrócili nieliczni mieszkańcy."},{"page_url":"https://en.wikipedia.org/wiki/Tres_Barrera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Tres_Barrera_%2848346847506%29_%28cropped%29.jpg","page_title":"Tres Barrera","context_page_description":"Felipe \\"Tres\\" Barrera III is an American professional baseball catcher for the Washington Nationals of Major League Baseball."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_Finist%C3%A8re_(P-Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Menhir_de_Lann_al_Louarn%2C_Plouguin%2C_France.jpg","page_title":"Liste des monuments historiques du Finistère (P-Z)","context_page_description":"Cet article recense une partie des monuments historiques du Finistère, en France."},{"page_url":"https://ca.wikipedia.org/wiki/Ignacio_Mariano_Martinez_de_Galinsoga","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Galinsoga_parviflora_Sturm16.jpg","page_title":"Ignacio Mariano Martinez de Galinsoga","context_page_description":"Ignacio Mariano Martinez de Galinsoga va ser metge de la reina consort Maria Luisa de Parma, fundador del Real Jardín Botánico de Madrid, i també fundador de la Real Academia Nacional de Medicina espanyola. El gènere botànic Galinsoga el recorda.\\nLes plantes del gènere Galinsoga arribaren a Europa des d'Amèrica del Sud l'any 1776 als Kew Gardens i l'any 1794 als jardins botànics de París i de Madrid. L'any 1784 va escriure un llibre titulat \\"Demostración mecánica de las enfermedades que produce el uso de las cotillas\\" on senyalava que les pageses no tenien les afeccions que causaven les cotilles a les dones de la classe alta."},{"page_url":"https://sr.wikipedia.org/wiki/Feniletilpirolidin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Phenylethylpyrrolidine.png","page_title":"Feniletilpirolidin","context_page_description":"Feniletilpirolidin je organsko jedinjenje, koje sadrži 12 atoma ugljenika i ima molekulsku masu od 175,270 Da."},{"page_url":"https://en.wikipedia.org/wiki/Hatagaya,_Shibuya","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Hatagaya_3chome81_shibuya.JPG","page_title":"Hatagaya, Shibuya","context_page_description":"Hatagaya is an area within Shibuya, Tokyo, Japan.\\nIt is served by Hatagaya Station on the Keio New Line.\\nIt is also served by bus, linking Shinjuku, Nakano, Shibuya, Asagaya and Yoyogi.\\nOlympus and Terumo have offices there. The main shopping district in Hatagaya is Rokugo dori which is a main street along which there are many shops, restaurants and bars."},{"page_url":"https://en.wikipedia.org/wiki/Sedimentary_rock","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Sedimentgesteine_auf_Malta.JPG","page_title":"Sedimentary rock","context_page_description":"Sedimentary rocks are types of rock that are formed by the accumulation or deposition of small particles and subsequent cementation of mineral or organic particles on the floor of oceans or other bodies of water at the Earth's surface. Sedimentation is the collective name for processes that cause these particles to settle in place. The particles that form a sedimentary rock are called sediment, and may be composed of geological detritus or biological detritus. Before being deposited, the geological detritus was formed by weathering and erosion from the source area, and then transported to the place of deposition by water, wind, ice, mass movement or glaciers, which are called agents of denudation. Biological detritus was formed by bodies and parts of dead aquatic organisms, as well as their fecal mass, suspended in water and slowly piling up on the floor of water bodies. Sedimentation may also occur as dissolved minerals precipitate from water solution.\\nThe sedimentary rock cover of the continents of the Earth's crust is extensive, but the total contribution of sedimentary rocks is estimated to be only 8% of the total volume of the crust."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B9%D9%81%DB%8C%D9%81%D9%87_%D8%A7%D8%B3%DA%A9%D9%86%D8%AF%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Afifa-Iskandar.jpg","page_title":"عفیفه اسکندر","context_page_description":"عفیفه اسکندر اصطیفان خواننده اواسط قرن بیستم اهل عراق بود. او یکی از بهترین خوانندگان زن تاریخ عراق به حساب می‌آمد. او به «پرنده سیاه عراق» لقب گرفت.\\nوی در ۱۰ دسامبر ۱۹۲۱ در موصل، عراق به دنیا آمد و بین سال‌های ۱۹۳۵ تا ۲۰۱۱ میلادی فعالیت می‌کرد."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B1%D1%80%D0%BE%D0%B2%D0%BE%D0%BB%D1%8C%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Kokumin_Giyutai.jpg","page_title":"Народный добровольческий корпус","context_page_description":"Народный добровольческий корпус — ополчение Японии времён Второй мировой войны, созданное в июне 1945 года как последний рубеж обороны Японских островов на случай, если союзники совершат высадку на острова и попытаются штурмовать столицу. Де-факто Народный добровольческий корпус был своеобразным аналогом немецкого фольксштурма. Командующим корпуса был премьер-министр, генерал армии Куниаки Коисо."},{"page_url":"https://pl.wikipedia.org/wiki/Inocybe_impexa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Inocybe_impexa_2.jpg","page_title":"Inocybe impexa","context_page_description":"Inocybe impexa Kuyper – gatunek grzybów należący do rodziny strzępiakowatych."},{"page_url":"https://hsb.wikipedia.org/wiki/Anguilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Sandy_Ground_Anguilla.jpg","page_title":"Anguilla","context_page_description":"Anguilla je wotwisny kupowy teritorij Zjednoćeneho kralestwa w Karibiskim morju."},{"page_url":"https://en.wikipedia.org/wiki/Viking_Age","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Viking_towns_of_Scandinavia_2.jpg","page_title":"Viking Age","context_page_description":"The Viking Age was the period during the Middle Ages when Norsemen known as Vikings undertook large-scale raiding, colonizing, conquest and trading throughout Europe, and reached North America. It followed the Migration Period and the Germanic Iron Age. The Viking Age applies not only to their homeland of Scandinavia, but to any place significantly settled by Scandinavians during the period. The Scandinavians of the Viking Age are often referred to as Vikings as well as Norsemen, although few of them were Vikings in the technical sense.\\nVoyaging by sea from their homelands in Denmark, Norway and Sweden, the Norse people settled in the British Isles, Ireland, the Faroe Islands, Iceland, Greenland, Normandy, the Baltic coast, and along the Dnieper and Volga trade routes in eastern Europe. They also briefly settled in Newfoundland, becoming the first Europeans to reach North America. The Norse-Gaels, Normans, Rus' people, Faroese and Icelanders emerged from these Norse colonies. The Vikings founded several kingdoms and earldoms in Europe: the kingdom of the Isles, Orkney, York and the Danelaw, Dublin, Normandy, and Kievan Rus'."},{"page_url":"https://vi.wikipedia.org/wiki/C%E1%BB%ADu_B%E1%BA%A3_%C4%90ao","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/2008TIBE_Day3_Hall2_SigningStage_Giddens.jpg","page_title":"Cửu Bả Đao","context_page_description":"Cửu Bả Đao là bút danh của Kha Cảnh Đằng, một tiểu thuyết gia và đạo diễn người Đài Loan. Ông tốt nghiệp Cử nhân ngành Khoa học Quản lí, Đại học Quốc gia Chiao Tung và Thạc sĩ Khoa học xã hội, Đại học Tunghai. Quyển sách đầu tiên của Cửu Bả Đao được phát hành trên mạng, và kể từ đó, ông đã hoàn thành khoảng 60 quyển sách khác nhau, nhiều trong số đó đã được sản xuất thành phim."},{"page_url":"https://pt.wikipedia.org/wiki/Little_Joe_(foguete)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Little_Joe_5_prelaunch.jpg","page_title":"Little Joe (foguete)","context_page_description":"Little Joe foi um Foguete auxiliar Americano usado em oito lançamentos entre 1959 e 1961 da base de Wallops Island Virgínia, para testar o sistema de escape e o escudo térmico para as cápsulas do Projeto Mercury. Tendo sido o primeiro foguete especificamente projetado para testes de qualificação de espaçonaves tripuladas, o foguete Little Joe foi também pioneiro na América em aplicar o princípio de cluster ou foguetes \\"em penca\\" formando um outro mais potente.\\nUm sucessor chamado, Little Joe II, foi usado para testes em voo do sistema de escape do Projeto Apollo entre 1963 e 1966."},{"page_url":"https://es.wikipedia.org/wiki/Pl%C3%A9rin","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Map_commune_FR_insee_code_22187.png","page_title":"Plérin","context_page_description":"Plérin es una población y comuna francesa, situada en la región de Bretaña, departamento de Côtes-d'Armor, en el distrito de Saint-Brieuc. Es el chef-lieu y mayor población del cantón de Plérin.​"},{"page_url":"https://hu.wikipedia.org/wiki/Saint-Cloud-en-Dunois","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Population_-_Municipality_code_28330.svg","page_title":"Saint-Cloud-en-Dunois","context_page_description":"Saint-Cloud-en-Dunois település Franciaországban, Eure-et-Loir megyében. Saint-Cloud-en-Dunois Villampuy községekkel határos."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_obci_Hubice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Hubice%2C_kostol_N%C3%A1v%C5%A1t%C3%ADvenia_Panny_M%C3%A1rie%2C_Slovensko.jpg","page_title":"Zoznam kultúrnych pamiatok v obci Hubice","context_page_description":"Toto je zoznam kultúrnych pamiatok v obci Hubice v okrese Dunajská Streda.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://ca.wikipedia.org/wiki/Magellan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Magellan_deploy.jpg","page_title":"Magellan","context_page_description":"La Magellan fou una sonda espacial no tripulada de la NASA amb l'objectiu d'estudiar el planeta Venus, especialment per obtenir un mapa topogràfic acurat mitjançant observacions de radar. Fou activa entre 1989 i 1994 i es batejà en honor de l'explorador portuguès del segle xvi Fernão de Magalhães. La sonda creà el primer mapa d'alta resolució de la superfície del planeta, que romandrà com el mapa més detallat de Venus en el futur proper, ja que en l'actualitat no hi ha plans per a missions a Venus amb l'objectiu de millorar els resultats de la Magellan."},{"page_url":"https://es.wikipedia.org/wiki/Podhrad%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Podhrad%C3%AD_%28ZL%29%2C_kaple.jpg","page_title":"Podhradí","context_page_description":"Podhradí es una localidad del distrito de Zlín en la región de Zlín, República Checa, con una población estimada a principio del año 2018 de 203 habitantes.\\nSe encuentra ubicada en el centro-este de la región, al sureste de Praga, cerca de la orilla del río Morava —un afluente izquierdo del Danubio— y de la frontera con Eslovaquia.​"},{"page_url":"https://hu.wikipedia.org/wiki/Drenov_Klanac","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Drenov_Klanac1.JPG","page_title":"Drenov Klanac","context_page_description":"Drenov Klanac falu Horvátországban Lika-Zengg megyében. Közigazgatásilag Otocsánhoz tartozik."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D0%B2%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D1%89%D0%B8%D0%BD%D0%B0_%D0%91%D0%B5%D0%BD%D0%B4%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/%D0%A1%D0%B8%D0%BD%D0%B0%D0%B3%D0%BE%D0%B3%D0%B0_%D0%B1%D0%BE%D0%BD%D0%B4%D0%B0%D1%80%D0%B5%D0%B9_14.jpg","page_title":"Еврейская община Бендер","context_page_description":"Первые данные о еврейском населении Бендер относятся к 1769 году, когда город находился в самой Бендерской крепости.\\nСм.: История города Бендер.\\nУказом Императора Александра I от 29 апреля 1818 года, город Бендеры объявлялся уездным городом Бессарабской области Российской империи. С этого момента растёт его значение, как административного центра. Тогда и потянулись сюда евреи, люди талантливые в торговых и хозяйственных делах.\\nВ XIX — начале XX века численность еврейского населения города увеличивалась за счёт переезда в Бендеры евреев из других районов Российской империи. По ревизии 1847 года бендерская еврейская община состояла из 553 семейств. В 1861 году проживало евреев: 2349 мужчин, 2263 женщин. В 1897 жителей 31797, из них евреев 10654 человек, 10384 великороссов, 6112 малороссов и 2338 молдаван.\\nОсновными занятиями евреев Бендер, как и других мест Бессарабии, были портняжный промысел и торговля. Позднее, среди них появились врачи, учителя, инженеры.\\nВ 1917 году открылась еврейская больница для лечения больных туберкулёзом и в этом же году Цви Шварцман открыл частную гимназию с преподаванием на иврите."},{"page_url":"https://vi.wikipedia.org/wiki/Ch%C3%ADnh_tr%E1%BB%8B_B%E1%BA%AFc_Kinh","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/He_Qigong2.jpg","page_title":"Chính trị Bắc Kinh","context_page_description":"Chính trị Bắc Kinh được cấu trúc theo một hệ thống chính quyền hai Đảng giống như tất cả các cơ quan quản lý khác ở Đại lục nước Cộng hòa Nhân dân Trung Hoa.\\nThị trưởng Bắc Kinh là quan chức cao cấp nhất của Chính phủ nhân dân Bắc Kinh. Tuy nhiên, trong hệ thống quản lý hai đảng của thành phố, thị trưởng vẫn phụ thuộc vào Ủy ban Thành phố Bắc Kinh Đảng Cộng sản Trung Quốc. Tạ Phú Trị, Thị trưởng và Bí thư Bắc Kinh nhiệm kỳ từ 1967 đến 1972, trước đó ông từng giữ chức Bộ trưởng Bộ Công an, có ảnh hưởng đáng kể trên toàn quốc.\\nNền chính trị ở thủ đô Bắc Kinh có ảnh hưởng rất lớn tới giới lãnh đạo Trung ương Đảng. Bí thư Bắc Kinh là người chịu trách nhiệm về trị an của thủ đô, vốn được chính phủ nước này coi là điều kiện quan trọng để đảm bảo sự ổn định trên toàn quốc. Các lãnh đạo Trung Quốc cho rằng những bất ổn ở Bắc Kinh rất dễ châm ngòi cho những biến động lớn khắp cả nước. Do đó Bí thư Thành ủy Bắc Kinh là một chức vụ cao cấp trong hệ thống chính trị Trung Quốc. Kể từ khi thành lập nước Cộng hòa Nhân dân Trung Hoa, Bí thư Thành ủy Bắc Kinh luôn giữ ghế trong Bộ Chính trị Đảng Cộng sản Trung Quốc, cơ quan cầm quyền hàng đầu của đất nước."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%85%E0%A4%81%E0%A4%97%E0%A5%8B%E0%A4%B2%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Angola_map.png","page_title":"अँगोला","context_page_description":"अंगोला हा दक्षिण अफ्रिकेतील एक देश आहे. येथे १६व्या शतकापासुन इ.स. १९७५ पर्यंत पोर्तुगालची वसाहत व आधिपत्य होते."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%93%A6%E5%B8%8C%E5%BE%B7%C2%B7%E5%93%88%E5%A7%86%E5%8D%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Vahid_Hambo.jpg","page_title":"瓦希德·哈姆博","context_page_description":"瓦希德·哈姆博是芬兰的职业足球运动员，同时也拥有波斯尼亚和黑塞哥维那国籍。他司职前锋，现效力于罗马尼亚足球甲级联赛中的阿斯特拉足球俱乐部。"},{"page_url":"https://en.wikipedia.org/wiki/Rhode_Island_Public_Transit_Authority","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/RIPTA_Flex_Shuttle_0651.jpg","page_title":"Rhode Island Public Transit Authority","context_page_description":"The Rhode Island Public Transit Authority provides public transportation, primarily buses, in the state of Rhode Island. The main hub of the RIPTA system is Kennedy Plaza, a large bus terminal in downtown Providence, Rhode Island. The authority serves 45,800 people a day, in 38 out of 39 Rhode Island communities."},{"page_url":"https://is.wikipedia.org/wiki/Mistilteinn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Viscum_album_Bart-0678_2011_12_24.JPG","page_title":"Mistilteinn","context_page_description":"Viscum album er tegund í Santalaceae, almennt þekkt sem mistilteinn. Hann er innfæddur í Evrópu og vestur og suður Asíu."},{"page_url":"https://es.wikipedia.org/wiki/Cant%C3%B3n_de_Rennes-Centro-Oeste","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Carte_rennes_cantons_bureaux_de_vote_2012.svg","page_title":"Cantón de Rennes-Centro-Oeste","context_page_description":"El cantón de Rennes-Centro-Oeste era una división administrativa francesa, que estaba situada en el departamento de Ille y Vilaine y la región de Bretaña.​"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%86%D9%87_%D8%B3%D9%88%D9%84%DB%8C%D9%86%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Anne_Sulling_in_October_27%2C_2014.jpg","page_title":"آنه سولینگ","context_page_description":"آنه سولینگ سیاست‌مدار اهل استونی است. وی از سال ۲۰۱۴ تا ۲۰۱۵ وزیر تجارت خارجی و کارآفرینی استونی بوده است."},{"page_url":"https://it.wikipedia.org/wiki/Serie_A_1929-1930_(Svizzera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/600px_Bianco_GCZ.png","page_title":"Serie A 1929-1930 (Svizzera)","context_page_description":"L'edizione 1929-1930 della Serie A svizzera vide la vittoria finale del Servette FC Genève."},{"page_url":"https://de.wikipedia.org/wiki/Franz_Radziwill","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Haus_Sielstrasse.jpg","page_title":"Franz Radziwill","context_page_description":"Johann Franz Wilhelm Eduard Radziwill war ein deutscher Künstler des Magischen Realismus. Sein Œuvre umfasst verschiedene Schaffensperioden: ein expressionistisches Frühwerk, ein magisch-realistisches Hauptwerk und ein symbolistisches Spätwerk. Bekannt sind rund 850 Ölbilder, 2000 Aquarelle, Zeichnungen und bemalte Postkarten sowie 35 druckgrafische Arbeiten.\\nDen größten Teil seines Lebens verbrachte er in dem Nordseebad Dangast bei Varel am Jadebusen, das ihn künstlerisch inspirierte. Während der NS-Zeit gehörte er der NSDAP an und war von 1933 bis 1935 als Lehrender für Freie Kunst an der Kunstakademie Düsseldorf tätig. Die offizielle Begründung für seinen Rauswurf hieß „Pädagogische Unfähigkeit“. Ab 1937 galten viele seiner Frühwerke als „entartet“, er erhielt mehrfach vorübergehend Ausstellungsverbot. Ab 1938 galt das Ausstellungsverbot für Einzelausstellungen bis zum Ende der NS-Zeit. Andererseits fand er jedoch immer wieder Anerkennung. Stilistisch ist er nicht der sogenannten Deutschen Kunst zuzuordnen.\\nÜber Vita und Werk wird bis in die Gegenwart kontrovers debattiert. Unbestritten ist seine künstlerische Ausdruckskraft."},{"page_url":"https://it.wikipedia.org/wiki/Seconda_guerra_mondiale","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/The_Katyn_Massacre%2C_1940_HU106212.jpg","page_title":"Seconda guerra mondiale","context_page_description":"La seconda guerra mondiale vide contrapporsi, tra il 1939 e il 1945, le cosiddette potenze dell'Asse e gli Alleati che, come già accaduto ai belligeranti della prima guerra mondiale, si combatterono su gran parte del pianeta. Il conflitto ebbe inizio il 1º settembre 1939 con l'attacco della Germania nazista alla Polonia e terminò, nel teatro europeo, l'8 maggio 1945 con la resa tedesca e, in quello asiatico, il successivo 2 settembre con la resa dell'Impero giapponese dopo i bombardamenti atomici di Hiroshima e Nagasaki.\\nConsiderato il più grande conflitto armato della storia, costò all'umanità sei anni di sofferenze, distruzioni e massacri, con una stima totale di morti che oscilla tra i 55 e i 60 milioni di individui; le popolazioni civili si trovarono coinvolte nelle operazioni in una misura sino ad allora sconosciuta, e furono anzi bersaglio dichiarato di bombardamenti, rappresaglie, persecuzioni, deportazioni e stermini."},{"page_url":"https://it.wikipedia.org/wiki/G%C3%BCtersloh","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Evangelisch_stiftisches_gymnasium_g%C3%BCtersloh.jpg","page_title":"Gütersloh","context_page_description":"Gütersloh è una città di 96.284 abitanti della Renania Settentrionale-Vestfalia, in Germania.\\nÈ capoluogo del circondario omonimo.\\nGütersloh si fregia del titolo di \\"Grande città di circondario\\"."},{"page_url":"https://en.wikipedia.org/wiki/CAR-15","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/GUU-5P_Carbine_%287414627680%29.jpg","page_title":"CAR-15","context_page_description":"The Colt Automatic Rifle-15 or CAR-15 was a family of M16 rifle based firearms marketed by Colt in the 1960s and early 1970s. However, the term \\"CAR-15\\" is most commonly associated with the Colt Commando; these select-fire carbines have ultrashort 10.5-inch and 11.5-inch barrels with over-sized flash suppressors.\\nThe CAR-15 name was an attempt to re-associate the AR-15 name with Colt, since the AR initially stood for ArmaLite Rifle, the original manufacturer of the ArmaLite AR-15. Colt later abandoned the CAR-15 concept, but continued to make carbine variations, using the \\"M16\\" brand for select-fire models and the \\"Colt AR-15\\" brand for semi-automatic models. However, in present usage, \\"CAR-15\\" is the generic name for all carbine-length variants made before the M4 carbine."},{"page_url":"https://sw.wikipedia.org/wiki/Pakistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/V%C3%A1ndors%C3%B3lyom.JPG","page_title":"Pakistan","context_page_description":"Pakistani ni nchi ya Asia ya Kusini. Imepakana na Ghuba ya Uarabuni upande wa kusini, Afuganistani na Uajemi upande wa magharibi, Uhindi upande wa mashariki na Uchina kaskazini-mashariki.\\nMipaka yake na Uhindi na Uchina haitambuliki kimataifa. Pakistan na Uhindi zote mbili zinadai eneo la Kashmir zikitawala kila moja sehemu za eneo hili.\\nJina la Pākistān lina maana ya \\"nchi ya watu safi\\" kwa Kiurdu.\\nPakistani ina nafasi ya sita kati ya nchi duniani zenye watu wengi.\\nNi nchi yenye Waislamu wengi duniani baada ya Indonesia."},{"page_url":"https://de.wikipedia.org/wiki/Brahea","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Brahea_Edulis.JPG","page_title":"Brahea","context_page_description":"Brahea ist eine amerikanische Palmengattung."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%96%B0%E4%BC%9A%E8%A1%8C%E6%94%BF%E5%8C%BA%E5%88%92","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Map_of_Sanwui195612-195809.PNG","page_title":"新会行政区划","context_page_description":"新会位于中国广东省中部，于晋元熙二年初置郡，隋开皇十年设县，1992年10月8日撤县设市，2002年9月1日撤市设区，现为江门市的一部分，行政区划经历多次演变。现时十一个分镇的安排，均源于1955年各区区公所的成立，而现今的行政区划最后修订于2005年。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Malle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Villa_Wildzang_Westmalle.JPG","page_title":"Lijst van onroerend erfgoed in Malle","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Malle. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D8%A7%D8%B1%D9%88%D9%86_%D8%A8%D8%B1%D9%88%D9%83%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/AaronBrooks.jpg","page_title":"هارون بروكس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nهارون بروكس لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A8%D0%B0%D1%80%D0%BB%D0%BE%D1%82_%D0%A0%D0%B0%D0%BC%D0%BF%D0%BB%D0%B8%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Charlotte_Rampling_Cannes_2011.jpg","page_title":"Шарлот Рамплинг","context_page_description":"Тесса Шарлот Рамплинг е английска актриса и модел, номинирана за Сезар."},{"page_url":"https://sh.wikipedia.org/wiki/Kviz","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Pimpampetspel.jpg","page_title":"Kviz","context_page_description":"Kviz je vrsta društvene igre zasnovane na ispitivanju znanja i vještina iz različitih područja, najčešće takmičarskog karaktera. U nekim državama kviz je vrsta testa u obrazovanju kao pokazatelj znanja, vještina ili sposobnosti."},{"page_url":"https://fr.wikipedia.org/wiki/Arnaud_de_Mareuil","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Arnaud_de_Mareuil_Compositeur.jpeg","page_title":"Arnaud de Mareuil","context_page_description":"Arnaud de Mareuil né le 27 mai 1936 à Paris, mort le 15 juin 2010 est un poète du XXᵉ siècle, qui fut aussi compagnon de l'Arche de Lanza del Vasto."},{"page_url":"https://en.wikipedia.org/wiki/Isomer","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/MaleictoFumaric.png","page_title":"Isomer","context_page_description":"In chemistry, isomers are molecules or polyatomic ions with identical molecular formulas — that is, same number of atoms of each element — but distinct arrangements of atoms in space. Isomerism is existence or possibility of isomers.\\nIsomers do not necessarily share similar chemical or physical properties. Two main forms of isomerism are structural or constitutional isomerism, in which bonds between the atoms differ; and stereoisomerism or spatial isomerism, in which the bonds are the same but the relative positions of the atoms differ.\\nIsomeric relationships form a hierarchy. Two chemicals might be the same constitutional isomer, but upon deeper analysis be stereoisomers of each other. Two molecules that are the same stereoisomer as each other might be in different conformational forms or be different isotopologues. The depth of analysis depends on the field of study or the chemical and physical properties of interest.\\nThe English word \\"isomer\\" is a back-formation from \\"isomeric\\", which was borrowed through German isomerisch from Swedish isomerisk; which in turn was coined from Greek ἰσόμερoς isómeros, with roots isos = \\"equal\\", méros = \\"part\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AD%A3%E4%BB%93%E9%99%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/8Lobed_Mirror_Inlay_Shosoin.jpg","page_title":"正仓院","context_page_description":"正仓院，位于日本奈良县奈良市东大寺内。建于八世纪中期的奈良时代，是用来保管寺院和政府财产的仓库。虽然全部为木质建筑，由于其独特的校仓建筑，完好地保存了一千多年。现在由内阁府宫内厅管理。\\n正仓院收藏有建立东大寺的圣武天皇和光明皇后使用过的服饰、家具、乐器、玩具、兵器等各式各样的宝物，总数约达9000件之多。其中也包括从唐代中国、新罗等地运来的各种精品，甚至还有从波斯而来的文物，例如由萨珊王朝波斯制造的漆胡瓶，白瑠璃碗等等。所以正仓院被称为丝绸之路的终点。\\n正仓院也是联合国教科文组织1998年登录的世界文化遗产“古都奈良的文化财”之一部分。每年秋天，奈良国立博物馆会举行正仓院展，向世人展示部分古代宝物。"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%AD%D0%B4%D0%B8%D0%BD%D1%81%D0%BE%D0%BD_%D0%9A%D0%B0%D0%B2%D0%B0%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Edinson_Cavani_2018.jpg","page_title":"Эдинсон Кавани","context_page_description":"Эдинсон Роберто Кавани Гомес — Уругвай футболчысы, Уругвай һәм Италия чемпионы, Италия, Франция һәм Франция лигасы кубоклары иясе, Франция суперкубогы иясе, Америка кубогы иясе. Италия һәм Франция чемпионатларының иң күп туп кертүчесе, Франция чемпионатының Ел уенчысы."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9F%93%E5%9C%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/100_hwan_530217_reverse.jpg","page_title":"韓圜","context_page_description":"韓圜是自1953年2月至1962年6月的大韓民國貨幣。"},{"page_url":"https://en.wikipedia.org/wiki/Food_and_drink_prohibitions","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Oysters_p1040741.jpg","page_title":"Food and drink prohibitions","context_page_description":"Some people do not eat various specific foods and beverages in conformity with various religious, cultural, legal or other societal prohibitions. Many of these prohibitions constitute taboos. Many food taboos and other prohibitions forbid the meat of a particular animal, including mammals, rodents, reptiles, amphibians, fish, molluscs, crustaceans and insects, which may relate to a disgust response being more often associated with meats than plant-based foods. Some prohibitions are specific to a particular part or excretion of an animal, while others forgo the consumption of plants or fungi.\\nSome food prohibitions can be defined as rules, codified by religion or otherwise, about which foods, or combinations of foods, may not be eaten and how animals are to be slaughtered or prepared. The origins of these prohibitions are varied. In some cases, they are thought to be a result of health considerations or other practical reasons; in others, they relate to human symbolic systems.\\nSome foods may be prohibited during certain religious periods, at certain stages of life, or to certain classes of people, even though the food is otherwise permitted."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%8C%E6%8B%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Sougou_Double_Pinyin_Scheme.png","page_title":"双拼","context_page_description":"双拼是汉语拼音输入法的一种编码方案。相对于全拼而言，使用双拼输入汉字时只需输入一个代表声母的字母，一个代表韵母的字母，就可以打出任意一个中文单字了。\\n目前Windows、Android、macOS、iOS平台上都有输入法支持双拼，包括iOS系统自带输入法、QQ输入法、百度输入法、搜狗输入法、谷歌输入法和微软必应输入法等。"},{"page_url":"https://hu.wikipedia.org/wiki/Ahmednagari_Szultan%C3%A1tus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%22Alam%22_Flag_of_the_Nizam_Shahi_dynasty_of_the_Ahmadnagar_Sultanate.png","page_title":"Ahmednagari Szultanátus","context_page_description":"Az Ahmednagari szultanátus egy késő középkori királyság volt, amely a Dekkán-fennsík északnyugati részén terült el, a Gudzsaráti és Bidzsapuri szultanátusok közt. Fővárosa Ahmednagar város volt, nyelvei a perzsa, dakhni, urdu és maráthi voltak, vallása az iszlám. Malik Ahmad, Dzsunnar bahmani kormányzója, miután vereséget mért a Dzsahangír kán által vezetett bahmani seregekre 1490. május 28-án, kikiáltotta függetlenségét és megalapította a Nizám Sahi dinasztiát. Eredetileg Dzsunnari erőd volt a fővárosa, amit később Sivnerinek neveztek el. 1494-ben lerakták az új főváros, Ahmednagar alapjait. Álamgír mogul helytartót nevezett ki a szultanátusba, majd 1636-ban bekebelezte a Mogul Birodalomba.\\nMalik Ahmad, Nizám-ul-Mulk Malik Haszán Bahri fia volt. Apja halála után rá hivatkozva megalapította a dinasztiáját, amit Nizám Sahi dinasztiának neveztek el. Ugyancsak ő alapította az új fővárost, Ahmednagart a Szina-folyó partján. Jó néhány próbálkozás után megszerezte az ország legnagyobb erődjét, Daulatabadot 1499-ben.\\nMalik Ahmad 1510-es halála után fia, Burhan, egy 7 éves srác, lett megkoronázva a palotában."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%A7%D8%BA%D9%88%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Nagoya_uitzicht.jpg","page_title":"ناغويا","context_page_description":"ناغويا هي مدينة في اليابان، وعاصمة \\"محافظة آييتشي\\"، تقع في الناحية الجنوبية من جزيرة \\"هونشو\\". يبلغ عدد سكانها حوالي 2,258,908 نسمة وتعتبر ثالث أكبر مركز تجمع سكاني ورابع مدينة من حيث أكثر عدد السكان في اليابان."},{"page_url":"https://cs.wikipedia.org/wiki/Def_Leppard","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Def_Leppard_Allstate_Arena_7-19-12.JPG","page_title":"Def Leppard","context_page_description":"Def Leppard je britská hardrocková skupina, která se zformovala v Sheffieldu v roce 1977, na vrcholu své popularity byla na přelomu 80. a 90. let 20. století.\\nPrvní vystoupení kapely se konalo o Vánocích 1977 pro 6 přátel, kdy se hrálo 6 skladeb. V roce 1980 vychází debut On Through the Night, rok na to High 'n' Dry. Během let se Def Leppard dostávali výš a výš na žebříčku popularity, velkým skokem kupředu bylo album Pyromania, prodalo se přes 7 milionů nosičů. Před nahráním tohoto alba došlo k personální změně. Kytarista Pete Willis byl pro své problémy s alkoholem nahrazen Philem Collenem.\\nDef Leppard byli několikrát stíháni nepřízní osudu. Poprvé v roce 1984, kdy bubeník Rick Allen ztratil při autohavárii levou paži. Avšak ani to nebylo překážkou pro další pokračování ve hře na bicí. Dle zpěváka Joe Elliotta se díky elektronickému systému stal Rick „lepším bubeníkem“, než byl kdy před tím. Rickova souprava byla kompletně elektronická od roku 1986 do roku 1995, poté se Rick pomalu vracel k akustickým bicím.\\nPrvním albem nahraným po Rickově nehodě je veleúspěšná Hysteria. Začíná obří světové turné, v Americe dokonce hrají „v kruhu“, tedy uprostřed haly s hledištěm kolem dokola."},{"page_url":"https://en.wikipedia.org/wiki/Cyanea_(plant)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Cyanea_lobata_full.jpg","page_title":"Cyanea (plant)","context_page_description":"Cyanea is a genus of flowering plants in the family Campanulaceae. The name Cyanea in Hawaiian is hāhā. These Hawaiian lobelioids are endemic to Hawaii with over 90% of Cyanea species are found only on one island in the Hawaiian chain. They grow in moist and wet forest habitat and are largely pollinated by birds such as the Hawaiian honeycreepers, and the seeds are dispersed by birds that take the fruits. Most Cyanea are trees with few branches or none. The inflorescence is a raceme of 4 to 45 flowers which grows from the leaf axils. The fruit is a fleshy berry. There have been several theories regarding the evolution of large prickles on plants endemic to islands that lack any mammalian or reptilian herbivores. One such theory suggests that the prickles are a defense against herbivory by the moa-nalo, a few taxa of flightless ducks that went extinct on the islands within the last 1600 years."},{"page_url":"https://sv.wikipedia.org/wiki/Calle_Flygare","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Calle_Flygare_1962.jpg","page_title":"Calle Flygare","context_page_description":"Carl Emil Anders \\"Calle\\" Flygare, född 4 juli 1907 i Malmö, död 3 december 1972 i Katarina församling i Stockholm, var en svensk skådespelare och regissör. Han var ledare för teaterskolan som bär hans namn.\\nEfter att Flygare studerat teater vid elevskolan engagerades han av Gösta Ekman. Hans självkritik var hård och han bedömde sig själv som en medelmåttig skådespelare. År 1940 grundade han hemma i sin egen lägenhet Calle Flygare Teaterskola, där bland andra Inga Landgré, Willie Andréason, Harriet Andersson, Christer Pettersson, Lars Ekborg och Mai Zetterling varit elever.\\nHan var son till teaterkritikern Carl Flygare och skådespelaren Ebba Flygare. Familjen är begravd på Norra begravningsplatsen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BC%D1%80%D1%83%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Nimrud_ivory_lion_eating_a_man.jpg","page_title":"Нимруд","context_page_description":"Нимруд — древний город в Месопотамии, на территории современного Ирака. Его руины находятся к юго-востоку от города Мосул, у реки Тигр."},{"page_url":"https://ro.wikipedia.org/wiki/Limacodidae","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Lithacodes.JPG","page_title":"Limacodidae","context_page_description":"Limacodidae sau Euclidae este o familie de molii din superfamilia Zygaenoidea sau Cossoidea; plasarea exactă este disputată. Speciile sunt câteodată denumite molii melc datorită asemănării omizilor cu melcii."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A8%D7%91_%D7%9E%D7%95%D7%92%D7%93%D7%99%D7%A9%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Battle_of_mogadishu_map_of_city.png","page_title":"קרב מוגדישו","context_page_description":"קרב מוגדישו נערך במוגדישו בירת סומליה באוקטובר 1993 בין כוחות אמריקאים ללוחמים הנאמנים למוחמד פארח איידיד, שליט מקומי.\\nכח עילית של הצבא האמריקני שכלל 160 לוחמים נשלח למוגדישו, כדי ללכוד שני בכירים בארגונו של איידיד. החיילים הגיעו לעיר באוויר וביבשה, ופעולתם הייתה אמורה להסתיים תוך כשעה. המבצע הסתבך כאשר שני מסוקי בלקהוק הופלו והמבצע התארך ל-15 שעות - במהלכן נהרגו 19 חיילים אמריקאים ו-73 חיילים נוספים נפצעו. אחד מטייסי המסוקים נשבה על ידי לוחמי מיליציות סומלים, ושוחרר מאוחר יותר. מאות לוחמים סומלים ותושבים נהרגו בקרב.\\nקרב מוגדישו השפיע על מדיניות ארצות הברית בסומליה וברחבי העולם. לאחר הקרב נסוגה ארצות הברית מסומליה ונמנעה מלסכן את חייליה במשברים ברחבי העולם.\\nמאורעות הקרב הונצחו בספרו של מרק באודן \\"בלאק הוק דאון\\" ובסרט בעל אותו שם המבוסס על הספר."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Boxtel_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Stationsstraat_42_Boxtel.JPG","page_title":"Lijst van gemeentelijke monumenten in Boxtel (plaats)","context_page_description":"De plaats Boxtel, hoofdplaats van de gemeente Boxtel, kent 149 gemeentelijke monumenten:"},{"page_url":"https://pl.wikipedia.org/wiki/Syntezator","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Roland_XP-30_synthesizer.jpg","page_title":"Syntezator","context_page_description":"Syntezator – instrument muzyczny z grupy elektrofonów elektronicznych, w którym dźwięk jest syntezowany w układach elektronicznych poprzez niezależne modelowanie poszczególnych aspektów dźwięku."},{"page_url":"https://en.wikipedia.org/wiki/Chinese_lacquerware_table","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Chinese_lacquerware_table.jpg","page_title":"Chinese lacquerware table","context_page_description":"This carved lacquerware table in the Victoria and Albert Museum in London is from the Ming dynasty. It is unique in shape and decoration and is one of the most important objects from the period. It is one of the few surviving examples in the world of a major piece of furniture produced in the 'Orchard Workshop', the Imperial lacquer workshop set up in the early Ming period and situated to the north-west of the 'Forbidden City' compound in Peking.\\nBy at least the Ming dynasty carved lacquer was being used all over the visible surfaces of pieces of furniture, a dauntingly expensive proposition. One of the best known pieces is this table, with three drawers, whose top has a typical imperial Ming design with a central dragon and phoenix, symbolizing the emperor and empress respectively; the pair also appear on the drawer-fronts. The table-top measures 119.5 cm by 84.5 cm and the table is 79.2 cm high. It was produced between 1425–1436 in the \\"Orchard Factory\\", and is the only piece of its size to survive from their production, the best period of Ming workmanship."},{"page_url":"https://it.wikipedia.org/wiki/B%C3%B3ly","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/HUN_B%C3%B3ly_COA.jpg","page_title":"Bóly","context_page_description":"Bóly è una città dell'Ungheria situato nella provincia di Baranya, nella regione del Transdanubio Meridionale di 3.970 abitanti"},{"page_url":"https://pt.wikipedia.org/wiki/M%C3%B3dena_(prov%C3%ADncia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Modena_mappa.png","page_title":"Módena (província)","context_page_description":"A província de Módena é uma província italiana da região da Emília-Romanha com cerca de 628 180 habitantes, densidade de 233 hab/km². Está dividida em 47 comunas, sendo a capital Módena.\\nFaz divisa a norte com a Lombardia, a este com a província de Ferrara e a província de Bolonha, a sul com a Toscana e a oeste com a província de Reggio Emilia.\\nA província é conhecida graças ao automobilismo, sendo a sede da Ferrari, Maserati, Pagani e De Tomaso, e à gastronomia, produzindo Vinagre Balsâmico e Parmesão."},{"page_url":"https://la.wikipedia.org/wiki/Iacobus_Gaillot","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Jacques_Gaillot_Manif-2011.JPG","page_title":"Iacobus Gaillot","context_page_description":"Iacobus Gaillot est episcopus Francicus qui fuit ab anno 1981 usque ad annum 1995, cum, Ioanne Paulo II regnante, doctrinae suae novae causa amossus est, Ebroici episcopus. Postea episcopus dioecesis in partibus infidelium Parthenia factus est."},{"page_url":"https://it.wikipedia.org/wiki/Pacifico_Sidoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Artgate_Fondazione_Cariplo_-_Sidoli_Pacifico%2C_Ritratto_femminile.jpg","page_title":"Pacifico Sidoli","context_page_description":"Pacifico Sidoli è stato un pittore italiano."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%96%E0%B8%B2%E0%B8%99%E0%B8%B5%E0%B8%A3%E0%B8%96%E0%B9%84%E0%B8%9F%E0%B8%81%E0%B8%B1%E0%B8%99%E0%B8%95%E0%B8%B1%E0%B8%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Kantang_railway_20061231_PB230150.JPG","page_title":"สถานีรถไฟกันตัง","context_page_description":"สถานีรถไฟกันตัง เป็นสถานีปลายทางของทางรถไฟสายชุมทางทุ่งสง–กันตัง ตั้งอยู่ที่ถนนหน้าค่าย ตำบลกันตัง อำเภอกันตัง จังหวัดตรัง อยู่ห่างจากสถานีรถไฟกรุงเทพเป็นระยะทาง 850.08 กิโลเมตร โดยกันตังเป็นสถานีรถไฟชั้น 3 ใช้สัญญาณแบบหลักเขตสถานี ตัวย่อของสถานีคือ กต."},{"page_url":"https://ca.wikipedia.org/wiki/Robert_Emmanuel_Pir%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Robert_Pires_2011.jpg","page_title":"Robert Emmanuel Pirès","context_page_description":"Robert Emmanuel Pirès conegut habitualment com a Robert Pirès, és un exfutbolista professional francès d'ascendència portuguesa i asturiana. Jugava de migcampista ofensiu, generalment per la banda esquerra. El seu primer equip professional fou el FC Metz."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DB%8C%DA%86_%DA%A9%DB%8C%D9%BE%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/MitchKapor.jpg","page_title":"میچ کیپور","context_page_description":"میچل دیوید کِیْپور طراح و برنامه‌نویس نرم‌افزار است.\\nاو به‌همراه جاناتان ساچس، لوتوس ۱-۲-۳ را ساخت و شرکت توسعه لوتوس را در سال ۱۹۸۲ در کمبریج تأسیس کرد و در سال ۱۹۸۶ از لوتوس کناره‌گیری کرد. میچل کیپور نرم‌افزار صفحه گسترده VisiCalc را پدید آورد.\\nکیپور در سال ۱۹۹۰ به همراه استیو وزنیاک، شرکت Electronic Frontier را که یک موسسه غیرانتفاعی مستقل بودند، برای درک تأثیرات اجتماعی انقلاب دیجیتالی در جامعه باز و آزاد را بنیاد نهاد.\\nکاپر هم‌اکنون به‌عنوان استاد مدعو در مدیاآرتز و پژوهشگر در دانشگاه MIT فعالیت می‌کند."},{"page_url":"https://it.wikipedia.org/wiki/Piombino","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Santantimo_piombino.JPG","page_title":"Piombino","context_page_description":"Piombino è un comune italiano di 33 348 abitanti della provincia di Livorno in Toscana.\\nCentro principale della val di Cornia e principale polo dell'industria siderurgica in Toscana, è il secondo porto della Toscana dopo quello di Livorno.\\nLa città conserva numerose testimonianze del suo glorioso passato, dalle origini etrusche al Principato di Piombino di cui era la capitale; la sua lunga storia è sintetizzabile nei monumenti architettonici e nelle opere d'arte che si conservano nel centro storico, al cui splendore contribuirono anche Leonardo da Vinci e Andrea Guardi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0_1925","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/F_Marshall_R_Reti_1925.JPG","page_title":"Москва 1925","context_page_description":"Москва 1925 — 1-й московський міжнародний шаховий турнір, що проходив від 10 листопада до 8 грудня у «Фонтанному залі» 2-го Будинку Рад. Проводився за спеціальним рішенням РНК СРСР з метою розвитку шахів і всебічного їх поширення серед трудящих. У турнірі взяв участь 21 шахіст: 10 радянських та 11 іноземних майстрів, у тому числі чемпіон світу Хосе Рауль Капабланка і екс-чемпіон світу Емануїл Ласкер.\\nБільшість радянських шахістів уперше брали участь у настільки сильному за складом турнірі, але виступили успішно. Впевнено і рівно провів турнір чемпіон СРСР 1924 і 1925 Юхим Боголюбов, який посів 1-е місце — 15½ ​​очок, випередивши на 1½ очка Ласкера і набравши проти іноземних шахістів 7½ очок з 11; 3-є місце посів Капабланка — 13½ очок.\\nРадянським шахістам вдалося виграти низку партій проти іноземних майстрів: Олександр Ільїн-Женевський переміг Капабланку, Френка Маршалла і Рудольфа Шпільмана; Борис Верлінський — Капабланку, Шпільмана і Акібу Рубінштейна; Григорій Левенфіш — Ласкера; Петро Романовський — Карлоса Торре і Ернста Ґрюнфельда. Турнір показав, що найкращі радянські шахісти наблизилися за силою гри до провідних майстрів світу."},{"page_url":"https://de.wikipedia.org/wiki/St._Maurinus_(L%C3%BCtzenkirchen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/LEV-L%C3%BCtzenkirchen%2C_St._Maurinus_1.JPG","page_title":"St. Maurinus (Lützenkirchen)","context_page_description":"Die Kirche St. Maurinus ist ein katholisches Gotteshaus im Leverkusener Stadtteil Lützenkirchen und seit dem 1. Januar 2011 Pfarrkirche der Pfarrgemeinde „St. Maurinus und Marien – Katholische Kirchengemeinde für Lützenkirchen und Quettingen“. Als einzige Kirche im Erzbistum Köln ist sie dem heiligen Maurinus von Köln geweiht, über dessen Persönlichkeit jedoch wenig bekannt ist. Möglicherweise war er Abt und Märtyrer. Seine Gebeine werden in der Kölner Kirche St. Pantaleon verehrt."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%A6%E6%95%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Baker_Street_tube_station_MMB_19_S_Stock.jpg","page_title":"伦敦","context_page_description":"伦敦是英国首都，也是英国最大都市、以及其构成国英格兰的首府。位于泰晤士河流域，于公元50年由罗马人建立，取名为伦蒂尼恩，在此后两个世纪内为这一地区最重要的定居点之一。伦敦是一座全球领先的世界级城市，是全球最富裕、经济最发达、商业最繁荣、生活水平最高的城市之一，在政治、经济、文化、教育、科技、金融、商业、体育、传媒、时尚等各方面影响着全世界，是全球化的典范。伦敦的历史核心区——伦敦市仍旧维持其中世纪的界限，面积1.12平方英里，2011年人口为8,072，为全英格兰最大的城市。自19世纪起，“伦敦”一称亦用于指称围绕这一核心区开发的周围地带。这一城区集合自1965年起构成大伦敦行政区，由32个伦敦自治市加上伦敦市组成，由伦敦市长及伦敦议会管辖。\\n伦敦亦是一个全球城市，名列纽伦港世界三大国际都会之一。在文艺、商业、教育、娱乐、时尚、金融、健康、媒体、专业服务、研究与发展、旅游和交通方面都具有显著的地位，同时还是全球主要金融中心之一，根据计算，为全球国内生产总值第六大的都市区。伦敦亦是全球文化首都之一，还是全球国际访客数量最多的城市，根据客流量计算则拥有全球最为繁忙的城市机场系统。伦敦是全球领先投资地，吸引很多国际零售商来投资，个人净资产值高于其它城市。伦敦拥有43所大学，其高等教育机构密集度在全欧洲最高。2012年，伦敦成为史上首座三次举办现代夏季奥林匹克运动会的城市。\\n伦敦的人口和文化十分多样，在大伦敦地区内使用的语言就超过300种。这一区域2015年的官方统计人口为8,673,713，为欧盟中最大城市，人口占全英国的12.5%。伦敦的城市区为欧盟第二大，根据2011年普查其人口达到9,787,426，仅次于巴黎。其都市区为欧洲最大，人口达13,614,409，而大伦敦政府则称伦敦都市区的总人口为2,100万。1831年—1925年间，伦敦为世界最大的城市。\\n有四项世界遗产位于伦敦，分别为：伦敦塔；邱园；威斯敏斯特宫、威斯敏斯特教堂和圣玛格丽特教堂；以及格林尼治历史区。其他著名景点包括白金汉宫、伦敦眼、皮卡迪利圆环、圣保罗座堂、伦敦塔桥、特拉法加广场和碎片大厦。伦敦亦是诸多博物馆、画廊、图书馆、体育运动及其他文化机构的所在地，包括大英博物馆、国家美术馆、泰特现代艺术馆、大英图书馆以及40家西区剧院。伦敦地铁是全球最古老的地下铁路网络。"},{"page_url":"https://fr.wikipedia.org/wiki/Golda_Meir","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Golda_Meir_03265u-2.jpg","page_title":"Golda Meir","context_page_description":"Golda Meir, née Golda Mabovitch à Kiev le 3 mai 1898 et morte à Jérusalem le 8 décembre 1978, est une femme d'État. Elle a participé à la création de l'État d'Israël, a été ministre des Affaires étrangères, ainsi que le quatrième Premier ministre d'Israël du 17 mars 1969 au 11 avril 1974.\\nEn raison de sa fermeté, elle avait gagné le surnom de « Dame de fer » de la politique israélienne avant que ce qualificatif ne soit employé pour Margaret Thatcher, Premier ministre du Royaume-Uni. Pendant sa vie politique, Golda Meir avait gagné les surnoms de « meilleur homme du gouvernement » et de « grand-mère d'Israël » par la presse populaire.\\nElle a été la première femme à devenir Premier ministre en Israël et la troisième femme dans le monde à ce niveau de responsabilité."},{"page_url":"https://de.wikipedia.org/wiki/Boghammar_Marin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/HN-speed-boat-2.jpg","page_title":"Boghammar Marin","context_page_description":"Boghammar Marin AB ist eine schwedische Schiffswerft und Familienunternehmen auf der Insel Lidingö bei Stockholm."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BD%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BB%D1%96%D1%94%D0%BD%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/ClientronU700.jpg","page_title":"Тонкий клієнт","context_page_description":"Тонкий клієнт — пристрій уведення та відображення інформації.\\nФізично тонкий клієнт - це компактний і безшумний комп'ютер без жорсткого диска, завантаження основної операційної системи якого відбувається на сервері. Всі призначені для користувача програми виконуються на термінальному сервері. Оскільки все обчислювальне навантаження лягає на сервер, то тонкий клієнт має мінімальну апаратну конфігурацію, без шкоди продуктивності.\\nТонкі клієнти застосовуються в організаціях, де більшість користувачів використовують комп'ютери для виконання однотипних завдань: робота з базами даних, інформаційні каталоги, робота з web-браузерами, робота як банківських терміналів тощо. Найпростіша схема організації мережі виглядає так:"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Kenosha_County,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Justin_Weed_House.JPG","page_title":"National Register of Historic Places listings in Kenosha County, Wisconsin","context_page_description":"This is a list of the National Register of Historic Places listings in Kenosha County, Wisconsin.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Kenosha County, Wisconsin, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 28 properties and districts listed on the National Register in the county. Another two properties were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted March 6, 2020."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E5%B1%B1%E5%AF%92%E5%8E%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/A_painting_of_birds_and_flowers_by_Kitayama_Kangan.jpg","page_title":"北山寒厳","context_page_description":"北山 寒厳は、江戸時代中期の画家である。\\n江戸麻布に生まれる。本名は馬孟煕、字を文奎、通称 大太郎・権之助。幼名は伊賀丸・兵部侍郎・大太郎など。号の寒厳は麻布の寒山房に生まれたことからという。また17世紀のバロック画家ヴァン・ダイクにかけ樊泥亀と号した。"},{"page_url":"https://sh.wikipedia.org/wiki/Commodore_16","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Commodore_116_Cont%C3%A9_%28white_bg%29_%28shadow%29.jpg","page_title":"Commodore 16","context_page_description":"Commodore 16 je kućno računalo koje je razvila tvrtka Commodore. Srce ovog kućnog računala bio je mikroprocesor 8501 koji je bio modernizirana verzija procesore MOS 6502. Na tržište je izbačeno 1984., i prodavalo se obično za 99 USD. Namjera tvrtke je bila zamjena za Commodore VIC-20 koji bi se na tržištu borio protiv jeftinih kompjutera drugih kompanija kao što su bili ZX81 i Texas Instruments TI-99/4A. Jeftinija inačica imena Commodore 116 prodavala se samo u Europi, a razlika je bila jedino u gumenoj tipkovnici i manjem kućištu."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%DA%98%D8%A7%D8%AF%D9%87%D8%A7%DB%8C_%D9%85%D8%A7%DA%A9%DB%8C%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Amrock%2C_hen%2C_3_maanden.jpg","page_title":"نژادهای ماکیان","context_page_description":"این نژادها به وسیلهٔ پرورش دهندگان آمریکایی به منظور تهیه تخم و گوشت پرورش و توسعه داده شده‌اند. نژادها و انواع مرغان این طبقه معمولاً دارای خصوصیات مشابهی هستند. برای مثال عموماً دارای پوست زردی می‌باشند، ساق پای شان پر ندارد، لاله گوش شان قرمز بوده و پوست تخم شان قهوه‌ای رنگ است. به استثنای نژاد لامونا Lamona که رنگ پوست تخمش سفید است. این نژادها از جفتگیری نژادهای کوچک مدیترانه‌ای و نژادهای بزرگ آسیایی که از آسیا و مدیترانه به آمریکا برده شده‌است به وجود آمده‌اند. این نژادها از نظر اندازه حد متوسط نژادهای مدیترانه‌ای و آسیایی می‌باشند. بلوغ جنسی در آن‌ها سریع تر از نژادهای سنگین است ولی به سرعت بلوغ جنسی در نژادهای مدیترانه‌ای نیست. حس مادری در آن‌ها زیاد است و پس از بلوغ به زودی چربی گرفته وچاق می‌شوند.نژادهای مهم این گروه عبارتند از:\\nمرغ آمریکایی Ameraucana\\nمرغ آمروک Amrock\\nمرغ آیووا آبی Iowa Blue\\nمرغ جنگجو آمریکایی American Game\\nمرغ شکلاتی Buckeye chicken\\nمرغ دلاور Delaware chicken\\nمرغ دلاور آبی Delaware Blue Hen\\nمرغ خاکستری کالیفرنیا California Gray\\nمرغ دومینیک Dominique chicken\\nمرغ پلیموت راک Plymouth Rock chicken\\nمرغ ویاندوت Wyandotte chicken\\nمرغ رود آیلند قرمز Rhode Island Red\\nمرغ رود آیلند سفید Rhode Island White\\nمرغ نیوهمشایر New Hampshire chicken\\nمرغ پینچون Pyncheon"},{"page_url":"https://tr.wikipedia.org/wiki/Amazon_Adas%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Amazon_Heykeli_ve_aslanlar_%282%29.JPG","page_title":"Amazon Adası","context_page_description":"Amazon Adası, Amisos Tepesi'nin yamacında oluşturulan ve ismini Temiskira'da yaşadıkları düşünülen Amazonlardan alan yapay ada. Adada Amazon Heykeli, Amazon kanalı, suni kayak pisti, balık restaurantları ve piknik sahaları yer almaktadır. İlerleyen dönemlerde su parkı, fitness center ve spor tesisleri de inşa edilmesi planlanmaktadır.\\nAmazon Adası'nda Amazon Köyü adıyla bir köy oluşturulmuş ve temsili Amazon balmumu heykelleri, kabartmaları, günlük eşyaları yerleştirilmiştir. Yine Amazon Adası'nda yer alan Amazon Heykeli'nin sağ ve sol taraflarına Anadolu Aslanları adı verilen iki heykel yerleştirilmiştir. Heykellerin içerisinde asansör olup aslanların ağız kısmına çıkılabilmekte ve Amazon Adası yüksekten izlenebilmektedir."},{"page_url":"https://nl.wikipedia.org/wiki/Italiaanse_bankhuizen_te_Brugge","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Dinus_rapondi.JPG","page_title":"Italiaanse bankhuizen te Brugge","context_page_description":"In de 14e en 15e eeuw waren er verschillende Italiaanse bankhuizen te Brugge actief. Hun komst was een logisch uitvloeisel van de aanwezigheid van Italiaanse handelaars in de stad."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_Zurbano","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Palacio_de_Zurbano_02.jpg","page_title":"Palacio de Zurbano","context_page_description":"El Palacio de Zurbano es una casa palacio tradicional ubicada en la calle de Zurbano, 5-7 en el barrio de Almagro, Madrid. Fue construido entre 1878 y 1881 para el conde de Muguiro, que encargó un hotel —vivienda unifamiliar rodeada de jardín— a Severiano Sainz de la Lastra. Su denominación se debe a la vía pública a la que da la entrada principal del inmueble, si bien ha tenido diversos nombres a lo largo de la historia en referencia a sus ocupantes: Palacio del Conde de Muguiro y Palacio del Marqués de Casa Riera.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B1%B1%E4%B8%9C%E7%9C%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Yellowriver_etm_2000123_lrg.jpg","page_title":"山东省","context_page_description":"山东省，简称鲁，位于中华人民共和国东部沿海、黄河下游、京杭大运河中北段，属华东地区，省会济南，经济中心青岛。山东土地面积约15.79万平方公里，为全国第19位。作为工农业大省，山东是环渤海经济圈的重要组成部分，2019年生产总值达人民币7.1兆，位列全国第三名，约占中国内地经济的9%，人均地区生产总值位居第10位。2019年山东省常住人口超过1亿人，为全国第二。其中汉族占99.3%，同时有回、满、蒙3个世居少数民族及朝鲜族等非世居少数民族。\\n山东省西部是黄河冲积平原、中部山脉丘陵、东部山东半岛，地理特征有山有海，是华北地区较多山脉分布的省份。西部逆时针分别与河北、河南、安徽、江苏四省接壤；中部为鲁中南山地丘陵区，泰山是全境最高点；东部的山东半岛向北与辽东半岛隔渤海海峡相对，往东与朝鲜半岛隔黄海相望，往南则可航行至长江口与东南沿岸，境内交通发达，铁路、高速公路网络密集。\\n山东历史悠久，是华夏文明的发祥地之一，齐文化、鲁文化与东夷文化相融合，形成独特的齐鲁文化。又因为古代人群的分布不同，分鲁南、鲁北、鲁东南、胶东四区，山东方言可大致分为中原官话、冀鲁官话、胶辽官话三个方言区，这之下又可细分为小片，各地在词法和语法上颇具特色、辨识性强。山东历史上人才辈出，东周时期就有孔丘、孟轲、管仲、孙武、孙膑等一系列历史文化名人。"},{"page_url":"https://no.wikipedia.org/wiki/Svenskeh%C3%B8let","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Svenskeh%C3%B8let_-_2012-06-09_at_13-51-14.jpg","page_title":"Svenskehølet","context_page_description":"Svenskehølet er et myrområde i Bærum, like øst for Østernvann.\\nLokale sagn fortaller at bøndene i Bærum gjemte seg her da svenskekongen Karl XII dro igjennom området våren 1716. Svenskene hadde rasert mange gårdsbruk i området, spesielt i Lommedalen, og bøndene skal ha tatt med seg folk og fe hit for å slippe unna svenskene. Området fikk dermed navnet Svenskehølet, og tjener som et lokalt minnesmerke over den store nordiske krig."},{"page_url":"https://de.wikipedia.org/wiki/Obergrafschaft_(Bentheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Bentheim_Obergrafschaft.png","page_title":"Obergrafschaft (Bentheim)","context_page_description":"Als Obergrafschaft bezeichnet man heute die südliche Region des Landkreises Grafschaft Bentheim in Niedersachsen; früher zählten auch große Teile des Nordhorner Stadtgebiets dazu. Die Obergrafschaft grenzt im Westen an die Niederlande, im Osten an den Landkreis Emsland, im Süden an die Kreise Steinfurt und Borken, beide in Nordrhein-Westfalen. Bad Bentheim war Sitz der Grafschaft Bentheim und bis 1945 auch Kreisstadt des Landkreises. Verkehrsadern sind die A 31, A 30, B 403, die Landesstraße 39, die Eisenbahnlinien der Bentheimer Eisenbahn und der Deutschen Bahn.\\nFolgende Kommunen liegen in der Obergrafschaft:\\nEinheitsgemeinde Stadt Bad Bentheim\\nSamtgemeinde Schüttorf mit\\nEngden\\nIsterberg\\nOhne\\nQuendorf\\nSamern\\nStadt Schüttorf\\nAndere Regionen der Grafschaft Bentheim sind die Niedergrafschaft und Nordhorn."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-R%C3%A9v%C3%A9rien","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/FR-58-Saint-R%C3%A9v%C3%A9rien1.JPG","page_title":"Saint-Révérien","context_page_description":"Saint-Révérien is een gemeente in het Franse departement Nièvre en telt 213 inwoners. De plaats maakt deel uit van het arrondissement Clamecy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D1%80%D0%B0%D1%87%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/TrinqueteBarrachina.jpg","page_title":"Баррачина","context_page_description":"Баррачина — муниципалитет в Испании, входит в провинцию Теруэль, в составе автономного сообщества Арагон. Муниципалитет находится в составе района Хилока. Занимает площадь км². Население — 167 человек."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A3%D0%BD%D1%96%D0%B2%D0%B5%D1%80%D1%81%D1%96%D1%82%D1%8D%D1%82_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%8B%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%9A%D1%96%D0%B5%D1%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Universytet_metro_station_Kiev_2010_17.jpg","page_title":"Універсітэт (станцыя метро, Кіеў)","context_page_description":"Універсітэт — станцыя Кіеўскага метрапалітэна на Святошынска-Броварскай лініі паміж станцыямі «Вакзальная» і «Тэатральная». Адкрыта 6 лістапада 1960 у складзе першай чаргі будаўніцтва."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B4%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87,_%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Ludwik_Zdanowicz.jpg","page_title":"Зданович, Людвик","context_page_description":"Людвик Феликс Зданович — польский римско-католический священник, церковный деятель, вспомогательный епископ и администратор Виленской епархии. Педагог, профессор, ректор."},{"page_url":"https://en.wikipedia.org/wiki/Power_pitcher","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Sandy_Koufax.jpg","page_title":"Power pitcher","context_page_description":"Power pitcher is a term in baseball for a pitcher who relies on the velocity of his pitches, sometimes at the expense of accuracy. Power pitchers usually record a high number of strikeouts, and statistics such as strikeouts per 9 innings pitched are common measures of power. An average pitcher strikes out about 5 batters per nine innings while a power pitcher will often strike out one or more every inning. The prototypical power pitcher is National Baseball Hall of Fame member, Nolan Ryan, who struck out a Major League Baseball record 5,714 batters in 5,386 innings. Ryan recorded seven no-hitters, appeared in eight Major League Baseball All-Star Games but also holds the record for most walks issued.\\nA famous fictional example of a power pitcher is Ricky \\"Wild Thing\\" Vaughn from the film Major League, a character sports journalist Scott Lauber once called \\"the power pitcher everyone on my high school baseball team wished they were\\". Actor Charlie Sheen performed that role; he had actually played baseball earlier in his life, prior to acting, as a pitcher."},{"page_url":"https://eo.wikipedia.org/wiki/Tago","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Gregorianscher_Kalender_Petersdom.jpg","page_title":"Tago","context_page_description":"Tago estas unu el multaj unuoj de tempo. Ĝi ankaŭ povas signifi la tempon inter leviĝo kaj subiro de la suno. Ankaŭ vorto \\"tago\\" povas signifi plenan ciklon de lumo kaj mallumo, tamen por la lasta pli preciza termino estas diurno. Laŭ Sistemo Internacia de Unuoj, unu diurno egalas al 86400 sekundoj, aŭ 86401 se supersekundo estas necesa.\\nLa hodiaŭa tago estas la 29-a de julio 2020. Indikon de konkreta tago oni nomas dato. La tago komenciĝas je meznokto kaj havas 24 egalajn horojn.\\nOni nomas tago al tempodaŭro kiun uzas la Tero ekde la Suno estas en la plej alta punkto super la horizonto ĝis ĝi revenas al sama punkto. Temas pri unu el la formoj por mezuri la tempon — la unua kiun havis la homo — kvankam la disvolvigo de la Astronomio montris ke, depende de la referenco uzata pora mezuri unu rond-iron, temas pri suntempo aŭ de sidera tempo — la unua uzas kiel referenco la Sunon dum la dua uzas kiel referenco la stelojn —. Se oni mencias simple nur la terminon \\"tagon\\" sen alia kromtermino, oni subkomprenas ke temas pri averaĝa suntago, bazo de la civila tempo, kiu estas dividata en 24 horoj, de po 60 minutoj, de po 60 sekundoj, kaj daŭras tiele 86.400 sekundojn."},{"page_url":"https://pl.wikipedia.org/wiki/Nicola_Cabibbo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Nicola_Cabibbo.jpg","page_title":"Nicola Cabibbo","context_page_description":"Nicola Cabibbo – włoski fizyk.\\nProfesor Sapienzy - Uniwersytetu w Rzymie. Prezes Papieskiej Akademii Nauk. Jego prace dotyczą oddziaływań słabych i ich związku z oddziaływaniami silnymi. Nagrodzony w 2010 medalem Diraca."},{"page_url":"https://pl.wikipedia.org/wiki/Hofkriegsrat","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Andreas_Hadik.jpg","page_title":"Hofkriegsrat","context_page_description":"Hofkriegsrat – Nadworna Rada Wojenna, jeden z naczelnych organów administracji centralnej cesarstwa austriackiego. Było to ciało kolegialne, na czele którego stał prezydent. Rada została utworzona w roku 1556 i działała do roku 1848."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%83%A9%E3%83%BC%E3%82%AF_(%E3%83%9F%E3%83%A5%E3%83%BC%E3%82%B8%E3%82%B7%E3%83%A3%E3%83%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Clark-Soundcheck-Mutek-2013.jpg","page_title":"クラーク (ミュージシャン)","context_page_description":"クラーク は、イギリスのミュージシャン、DJ、音楽プロデューサー、作曲家。ハートフォードシャー・セント・オールバンズ出身。2006年までの名義は、クリス・クラーク。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%B9%D0%BB%D0%BE%D1%80,_%D0%A0%D0%BE%D0%B4%D0%B6%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Queen_And_Adam_Lambert_-_The_O2_-_Tuesday_12th_December_2017_QueenO2121217-47_%2839066610085%29_Cropped.jpg","page_title":"Тейлор, Роджер","context_page_description":"Ро́джер Те́йлор — британский барабанщик, мультиинструменталист, автор песен, композитор, певец. Наиболее знаменит как участник группы Queen и солист The Cross.\\nКак барабанщик широко известен своим «объёмным» уникальным звучанием и считается одним из самых влиятельных рок-ударников 1970-х и 80-х годов.\\nСвои первые песни Тейлор начал писать, ещё будучи членом группы Smile. Для ранних альбомов Queen Тейлор лично исполнял песни собственного сочинения, но впоследствии уступил их исполнение Фредди Меркьюри. Каждый из 15 альбомов Queen содержит как минимум одну песню, написанную Роджером Тейлором.\\nДля своих сольных альбомов Роджер Тейлор самостоятельно исполнил как партии бас-гитары, ритм-гитары, клавишных, так и ударных.\\nВ прошлом сотрудничал со многими известными поп- и рок-музыкантами, такими, как: Эрик Клэптон, Роджер Уотерс, Роджер Долтри, Роберт Плант, Фил Коллинз, Genesis, Джимми Нейл, Элтон Джон, Гэри Ньюман, Shakin' Stevens, «Foo Fighters», Эл Стюарт, Стив Вай, Ёсики Хаяси и Bon Jovi.\\nВ 2005 году вошёл в TOP-10 самых великих барабанщиков в истории классического рока по версии Planet Rock."},{"page_url":"https://en.wikipedia.org/wiki/Agrostis_microphylla","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Agrostismicrophylla.jpg","page_title":"Agrostis microphylla","context_page_description":"Agrostis microphylla is a species of grass known by the common name small-leaf bentgrass. It is native to western North America from the Aleutian Islands to Baja California in Mexico, where it grows along coastal cliffs, on serpentine mountain slopes, and in vernal pools."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Schw%C3%A4bisch_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Am_Markt_3_Schw%C3%A4bisch_Hall_1.JPG","page_title":"Liste der Kulturdenkmale in Schwäbisch Hall","context_page_description":"In der Liste der Kulturdenkmale in Schwäbisch Hall sind Bau- und Kunstdenkmale der Stadt Schwäbisch Hall verzeichnet, die im „Verzeichnis der unbeweglichen Bau- und Kunstdenkmale und der zu prüfenden Objekte“ des Landesamts für Denkmalpflege Baden-Württemberg verzeichnet sind. Dieses Verzeichnis ist nicht öffentlich und kann nur bei „berechtigtem Interesse“ eingesehen werden. Die folgende Liste ist daher nicht vollständig und beruht auf den Angaben des Haller Häuserlexikons."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B5%D1%81%D0%BA%D0%BE%D0%BB%D0%B0%D0%BD%D1%87%D0%B0%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Pescolanciano-Castello.JPG","page_title":"Песколанчано","context_page_description":"Песколанча̀но е село и община в Централна Италия, провинция Изерния, регион Молизе. Разположено е на 800 m надморска височина. Населението на общината е 890 души."},{"page_url":"https://de.wikipedia.org/wiki/Center_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Windham_Civic_Center.jpg","page_title":"Center (Texas)","context_page_description":"Center ist eine Stadt im Shelby County in Osttexas und die County-Hauptstadt des Bezirks. Gegründet wurde die Ansiedlung 1856 oder 1857. Der Name bringt die zentrale Lage der Ansiedlung innerhalb des County zum Ausdruck. Zur Bezirkshauptstadt avancierte Center im Jahr 1866. 2016 verfügte die Stadt laut Daten des US-Zensus über 5.421 Bewohner."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BD%D1%96%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%C2%AB%D0%A5%D0%B0%D0%B7%D0%B0%D1%80%C2%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Dunya1.jpg","page_title":"Університет «Хазар»","context_page_description":"Університет «Хазар» — перший приватний вищий навчальний заклад в Азербайджані і один з перших недержавних вишів на пострадянському просторі."},{"page_url":"https://sw.wikipedia.org/wiki/Freestyle_Football_Tanzania","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/A_photo_of_Kotaro_Tokura_with_Morison_Mosses_the_president_of_FFT.jpg","page_title":"Freestyle Football Tanzania","context_page_description":"FREESTYLE FOOTBALL TANZANIA au FFT / Free Foot TZ ni chombo cha mchezo wa Uchezeaji wa Mpira wa Miguu nchini Tanzania kama vile serikali ama shirikisho linavyofanya shughuli zake, FFT inasimamiwa na kuendeshwa na mfumo wa utawala wa klabu moja iitwayo Genius MP Freestyle Football Club. Klabu hii ni klabu mama ya mchezo huu yenye jukumu na mamlaka ya kusimamia, kuendesha, na kuratibu mchezo huu nchini na ndio inayotoa viongozi wakutawala FFT. Klabu ina usajili wa namba NSC 11410. FFT inahusiano na shirikisho la dunia la uchezeaji mpira wa miguu ambalo balozi wake mkuu ni Ronaldinho. +255 653 910 255."},{"page_url":"https://es.wikipedia.org/wiki/Zerfaliu","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/San_Giovanni_%28Zerfaliu%29.JPG","page_title":"Zerfaliu","context_page_description":"Zerfaliu es una localidad italiana de la provincia de Oristán, región de Cerdeña, con 1.186 habitantes.​"},{"page_url":"https://hu.wikipedia.org/wiki/A_szlov%C3%A1k_korona_(1993)_p%C3%A9nz%C3%A9rm%C3%A9i","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/SK_50h96_b.png","page_title":"A szlovák korona (1993) pénzérméi","context_page_description":"A szlovák korona pénzérméi Szlovákia 2009 előtt hivatalos készpénzének részét képezik. 1993-ban, Csehszlovákia felbomlása után jelentek meg. Az érmék a körmöcbányai pénzverdében készülnek."},{"page_url":"https://fr.wikipedia.org/wiki/WWE_%2713","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Summerslam_2006.jpg","page_title":"WWE '13","context_page_description":"WWE '13 est un jeu vidéo de catch développé par Yuke's et publié par THQ sur PlayStation 3, Wii et Xbox 360. Le jeu est le deuxième titre de la série des jeux vidéo WWE et le quinzième de toutes les séries confondues. Suite de WWE '12, il est commercialisé depuis le 30 octobre 2012 en Amérique du Nord et le 2 novembre 2012 en Europe."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%97%A5%E8%90%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Pyhaejaervi_Abend.jpg","page_title":"日落","context_page_description":"日落、夕阳是每日太阳因为地球自转的结果而消失在地平线下的现象。因为日没而创造出的大气层状况，包括发生在太阳消失在地平线之前和之后的事件，通常也都与日没有关。\\n日落时间在天文学上的定义是太阳盘面的边缘完全消逝在西方地平线下的时间。由于光线在大气层内的折射，下沉的阳光路线在接近地平线的附近已经被高度的偏折，使得视太阳日没时，真实的太阳已经在地平线下约一个太阳的直径。日没不能与薄暮混淆，这是黑暗降临的时刻，此刻太阳位于地平线下18°。从日没到薄暮的期间称为暮光。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_antiker_Theaterbauten","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/France_Arles_Theatre_Antique_night1.jpg","page_title":"Liste antiker Theaterbauten","context_page_description":"Die Liste antiker Theaterbauten erfasst möglichst vollständig die erhaltenen wie die lediglich in Quellen erwähnten Theaterbauten der griechisch-römischen Antike. Ausgeschlossen aus dieser Liste sind die sogenannten kleinen Theater, d. h. die Odeia, und die Amphitheater. Eine Liste der Odeia findet sich hier."},{"page_url":"https://cs.wikipedia.org/wiki/Metro_v_Praze","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Pra%C5%BEsk%C3%A9_metro-Po%C4%8Det_p%C5%99epraven%C3%BDch_Graf.jpg","page_title":"Metro v Praze","context_page_description":"Pražské metro tvoří v současnosti základ sítě pražské městské hromadné dopravy. Jde o tzv. „těžké“ metro sovětského typu. V roce 2013 přepravilo 584 milionů cestujících, v průměru tedy 1,6 milionu denně. Jedná se o jedinou síť podzemní dráhy a zároveň jedinou dráhu, která je podle českého zákona o dráhách kategorizována jako speciální železniční dráha. Provozovatelem dráhy i drážní dopravy na ní je Dopravní podnik hlavního města Prahy a. s. První úsek pražského metra byl otevřen 9. května 1974, dosud poslední úsek byl otevřen 6. dubna 2015.\\nMetro má v současné době tři linky značené písmeny a barvami: A, B a C; linka D by se měla začít stavět v polovině roku 2020. Aktuálně probíhá geologický průzkum na budoucí trase linky D. Dohromady měří jeho síť 65,2 km. Soupravy metra zastavují celkem v 61 stanicích, z nichž tři stanice jsou přestupní. Linky podzemní dráhy jsou na čtyřech místech vedeny pod řekou Vltavou. Linka C je nad zemí v tubusu Nuselského mostu, linka A vede po otevřeném povrchu v areálu depa Hostivař, stejně tak i linka B vede nad zemí, a to mezi stanicemi Rajská zahrada a Černý Most a také mezi stanicemi Hůrka a Lužiny, kde je vedena v tubusu nad povrchem země."},{"page_url":"https://hu.wikipedia.org/wiki/Aranyb%C3%A1nya_(telep%C3%BCl%C3%A9s)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Slovakia_Zlata_Bana_5.JPG","page_title":"Aranybánya (település)","context_page_description":"Aranybánya község Szlovákiában, az Eperjesi kerület Eperjesi járásában."},{"page_url":"https://pl.wikipedia.org/wiki/Wilhelm_Liebknecht","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Wilhelm_Liebknecht.jpg","page_title":"Wilhelm Liebknecht","context_page_description":"Wilhelm Liebknecht – niemiecki socjaldemokrata, jeden z założycieli SPD oraz ojciec późniejszych działaczy lewicowych, Karla i Theodora."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A%D9%81%D8%B1_%D9%87%D8%A7%D9%8A%D8%AA%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Olson_House_River_Heights_Utah.jpeg","page_title":"ريفر هايتس","context_page_description":"ريفر هايتس هي مدينة تقع في الولايات المتحدة في مقاطعة كاش، يوتا. يقدر عدد سكانها بـ 1,769 نسمة ومساحتها 1.5 كم² وترتفع عن سطح البحر 1,396 متر."},{"page_url":"https://fr.wikipedia.org/wiki/Effectifs_du_tournoi_masculin_de_basket-ball_aux_Jeux_olympiques_d%27%C3%A9t%C3%A9_de_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Real_Madrid-Obradoiro_Santiago_mayo_2013CCropedtunecino0911.jpg","page_title":"Effectifs du tournoi masculin de basket-ball aux Jeux olympiques d'été de 2012","context_page_description":"Cette page contient la liste de toutes les équipes et leurs joueurs participant au Tournoi masculin de basket-ball aux Jeux olympiques d'été de 2012."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_Comunal_de_Siena","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/San_Bernardino_Sano_di_Pietro_02.JPG","page_title":"Palacio Comunal de Siena","context_page_description":"El Palazzo Pubblico de Siena es un edificio construido aproximadamente entre 1297 y 1310 como sede del Gobierno de los Nueve de la República de Siena. Esta función se mantiene en la actualidad, ya que es la sede de la administración municipal, además del Museo de la Ciudad. Se encuentra en la Piazza del Campo y está unido a la esbelta Torre del Mangia. En el interior conserva obras de arte de la época dorada del arte sienés, entre las que está el célebre fresco de la Alegoría del Buen y del Mal Gobierno de Ambrogio Lorenzetti, una de las representaciones profanas más significativas del siglo xiv europeo, y otras obras de Simone Martini, Duccio di Buoninsegna, Sodoma y Beccafumi."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrale_di_Nostra_Signora_degli_Angeli_(Los_Angeles)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/LA_Cathedral_Lady_of_Guadalupe_statue.jpg","page_title":"Cattedrale di Nostra Signora degli Angeli (Los Angeles)","context_page_description":"La cattedrale di Nostra Signora degli Angeli è il principale luogo di culto cattolico di Los Angeles, in California.\\nLa chiesa, sede dell'arcivescovo di Los Angeles, è stata costruita tra 1998 e 2002 per sostituire la precedente cattedrale di Santa Bibiana, danneggiata nel terremoto di Northridge del 1994. La cattedrale venne costruita in architettura postmoderna e formalmente aperta nel settembre 2002. Ci furono polemiche sul design e sugli elevati costi per il completamento l'edificio.\\nLa cattedrale è intitolata alla Beata Vergine Maria sotto il titolo patronale di Madonna degli Angeli, riecheggiando il nome completo del nucleo originario di Los Angeles. La cattedrale è nota per la presenza delle reliquie di Santa Bibiana e per il tilmàtli di Nostra Signora di Guadalupe. È la chiesa madre dei circa cinque milioni di cattolici professi in dell'arcidiocesi."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%B1%D8%A4%D8%B3%D8%A7%D8%A1_%D9%88%D8%B2%D8%B1%D8%A7%D8%A1_%D9%81%D8%B1%D9%86%D8%B3%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Freycinet2.jpg","page_title":"قائمة رؤساء وزراء فرنسا","context_page_description":"تحتوي هذه المقالة على قائمة رؤساء الوزراء الفرنسيين منذ إنشاء هذا المنصب حتى الآن في الجمهورية الفرنسية الخامسة، والذي كان يسمى رئيس مجلس الوزراء في الجمهورية الفرنسية الثالثة والرابعة."},{"page_url":"https://qu.wikipedia.org/wiki/Swindon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Swindon-view_crop.jpg","page_title":"Swindon","context_page_description":"Swindon nisqaqa Inlatirra suyupi, Hukllachasqa Qhapaq Suyupi, huk hatun llaqtam."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Besan%C3%A7on-Viotte","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Gare_Viotte_20e.jpg","page_title":"Bahnhof Besançon-Viotte","context_page_description":"Der Bahnhof Besançon-Viotte ist der wichtigste Bahnhof der französischen Stadt Besançon. Der Bahnhof wird seit 1981 durch den TGV bedient. Seit dem 11. Dezember 2011 besitzt die Stadt einen zweiten Fernbahnhof an der Neubaustrecke LGV Rhin-Rhône, es handelt sich um den Bahnhof Besançon Franche-Comté TGV."},{"page_url":"https://la.wikipedia.org/wiki/Arba_(insula)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Rab_K%C3%BCste_Norden.jpeg","page_title":"Arba (insula)","context_page_description":"Vide etiam paginam discretivam: Arba\\nArba est insula in Mari Hadriatico sita, quae ad Croatiam pertinent, praesertim Liburniam historicam regionem et Litoralem–Montanam regionem Croatiae. Insulae aream 93.60 km² occupant; incolunt insulam 9500. Incolae Arbenses appellantur.\\nArba una ex Liburnicis Insulis est."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%A7%D9%88%DA%86%D9%87_%D8%B3%D8%A8%DA%A9_%DA%A9%D9%84%D8%A7%D8%B3-%D8%A7%D8%A8%D9%87%D8%A7%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Abhay_class_corvette.JPG","page_title":"ناوچه سبک کلاس-ابهای","context_page_description":"ناوچه سبک کلاس-ابهای یک کلاس از کشتی‌های نظامی است که طول آن ۵۷٫۶ meters می‌باشد."},{"page_url":"https://fr.wikipedia.org/wiki/Cirque_Roche","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/CamilleRoche1902.jpg","page_title":"Cirque Roche","context_page_description":"Le cirque Roche a été fondé par les frères Emmanuel et Camille Roche au début du XXᵉ siècle. D'abord cirque en dur, il est devenu cirque itinérant après la Grande Guerre. Principalement présent dans les villes du Nord et de l'Ouest de la France, il présentait toujours une programmation de grande qualité. Après trente ans d'existence, il fut cédé en 1930."},{"page_url":"https://fi.wikipedia.org/wiki/Guns_N%E2%80%99_Roses","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Guns_n%C2%B4Roses_Palacio_de_los_Deportes_30-11-2016_%2831366316670%29.jpg","page_title":"Guns N’ Roses","context_page_description":"Guns N’ Roses on vuonna 1985 Los Angelesissa perustettu yhdysvaltalainen rockyhtye, jonka nykyisen kokoonpanon muodostavat laulaja Axl Rose, kitaristit Slash ja Richard Fortus, basisti Duff McKagan, kosketinsoittajat Dizzy Reed ja Melissa Reese sekä rumpali Frank Ferrer. Yhtyeen tunnetuimpaan, vuosien 1985–1990 kokoonpanoon lukeutuivat Rosen, Slashin ja McKaganin ohella kitaristi Izzy Stradlin ja rumpali Steven Adler.\\nGuns N’ Rosesin musiikki on yhdistelmä hard rockia, heavy metalia sekä puhdaspiirteisempää glam rockia, ja sitä on luonnehdittu myös sleaze rockiksi. Yhtyeen esikoisalbumia Appetite for Destruction pidetään yhtenä 1980-luvun ja koko rockmusiikin merkittävimmistä albumeista. Sitä on myyty kansainvälisesti noin 30 miljoonaa kappaletta, ja se on kaikkien aikojen kaupallisesti menestynein esikoisalbumi. Appetite for Destructionin jälkeen yhtye on julkaissut studioalbumit GN’R Lies, Use Your Illusion I ja Use Your Illusion II ja Chinese Democracy, sekä cover-kappaleita sisältävän albumin The Spaghetti Incident?."},{"page_url":"https://no.wikipedia.org/wiki/Vancouver_Millionaires","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Vancouver_Millionaires_1915.jpg","page_title":"Vancouver Millionaires","context_page_description":"Vancouver Millionaires, fra 1922 Vancouver Maroons var en profesjonell canadisk ishockeyklubb fra Vancouver i Canada. Den ble stiftet i 1911 og spilte i PCHA og WHL mellom 1911 og 1926. Laget spilte på Denman Arena, som var den første kunstfrosne isflaten i Canada og på den tid en av de største innendørs ishallene i verden, med en tilskuerkapasitet på 10 500, og den nest største i Nord-Amerika, etter Madison Square Garden i New York City.\\nVancouver Millionaires vant Stanley Cup på hjemmeis i 1915 da laget slo Ottawa Senators fra NHA i finaleserien med 3-0 i kamper. Laget er det eneste fra Vancouver som har vunnet Stanley Cup.\\nVancouver Millionaires var et av de tre lagene som var med og startet opp PCHA i sesongen 1912. Lagets drakter var vinrøde med en stor, hvit V, for Vancouver. I tillegg til seieren i Stanley Cup i 1915, spilte laget i Stanley Cup-finalene i 1918, i 1921 samt i 1922.\\nLaget byttet navn til Vancouver Maroons i 1922 og spilte i PCHA fram til 1924 da de byttet til WHL hvor de spilte de to følgende sesongene."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B8%D1%81%D1%81,_%D0%A4%D1%80%D0%B0%D0%BD%D1%86_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Franz_Riss_Skomorokhs_in_a_village.jpg","page_title":"Рисс, Франц Николаевич","context_page_description":"Франц Николаевич Рисс — русский живописец-портретист. Отец П. Ф. Рисса."},{"page_url":"https://no.wikipedia.org/wiki/Daniel_Chima_Chukwu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/DanielChukwuLegia.jpg","page_title":"Daniel Chima Chukwu","context_page_description":"Daniel Chima Chukwu er en nigeriansk fotballspiller som spiller for den kinesiske klubben Taizhou Yuanda FC.\\nHan spilte for Molde Fotballklubb fra 2010 til 2015, som han gikk til fra Lyn i 2010."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%82%D1%8B%D0%BD%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%95%D1%84%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Martynov_Summer_Palace_of_Peter_I_1809.jpg","page_title":"Мартынов, Андрей Ефимович","context_page_description":"Андре́й Ефи́мович Марты́нов — русский живописец-пейзажист, академик Императорской Академии художеств."},{"page_url":"https://pt.wikipedia.org/wiki/Antonov_An-124","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Soviet_An-124_undercarriages.JPEG","page_title":"Antonov An-124","context_page_description":"O Antonov An-124 Ruslan foi durante um longo período o maior avião do mundo, isto antes da chegada do An-225. O An-225 foi desenvolvido a partir dele, com o intuito de transportar o ônibus espacial soviético Buran. Atualmente não detém mais o título de maior avião cargueiro, mas ainda tem grandes dimensões.\\nDesenvolvido inicialmente como cargueiro militar, o primeiro protótipo An-124 voou em 26 de dezembro de 1982. Um segundo protótipo, chamado Ruslan, fez sua aparição ocidental no Airshow de Paris em Junho de 1985, anteriormente ao seu primeiro voo comercial, que ocorreu em janeiro de 1986.\\nDesde então, o An-124 estabeleceu uma série de recordes. Sua maior conquista foi a mais pesada carga transportada por via aérea, comercialmente: um gerador de 124 toneladas, associado a outros itens alocados no seu interior, com um peso total de carga de 132,4 toneladas, no final de 1993.\\nCaracterísticas notáveis incluem o nariz, as portas do compartimento de carga de cauda e 24 rodas permitindo operações de pouso em asfalto, terra, grama e neve.\\nÉ o segundo maior avião produzido em massa. Ele perde apenas para o A380 da Airbus."},{"page_url":"https://ca.wikipedia.org/wiki/Sir_George_Byng","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/George_Byng%2C_1st_Viscount_Torrington_by_Jeremiah_Davison.jpg","page_title":"Sir George Byng","context_page_description":"Sir George Byng KB PC fou un militar de la marina anglesa.\\nAls quinze anys entrà en la marina britànica. El 1703 ja era contra-almirall, prestant grans serveis als aliats durant la guerra de Successió espanyola, sobretot en la conquista de Gibraltar; ascendit a vice-almirall i a almirall del pavelló blau, apoderant-se de Menorca en aquell mateix any; frustrà la temptativa del rei James Francis Edward Stuart pretenent al tron d'Escòcia, i de 1718 a 1820 els plans del cardenal Alberoni contra Sicília i Nàpols, vencent en la Batalla del cap Passaro a la flota comanada per l'almirall Antonio Gaztañeta.\\nDes del 1710 era almirall de l'esquadra blanca, baronet i par del regne i primer lord d'almirallat britànic, lloc elevat, des del qual beneficià al mariners creant la caixa de pensions per les vídues de caps i oficials.\\nEra el pare del desgraciat John Byng, almirall de la Royal Navy afusellat per traïció."},{"page_url":"https://eu.wikipedia.org/wiki/Nacha_Pop","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Nacha_Pop.JPG","page_title":"Nacha Pop","context_page_description":"Nacha Pop, Espainiako pop rock musika talde bat da. 1978an Madrilen sortu zen, Movida madrileña delakoaren hasieran. Antonio Vega, Nacho García Vega, Carlos Villalta \\"Carlos Brooking\\" eta Antonio Martín Caruana \\"Ñete\\" taldekideek osatu zuten.\\nTaldearen abestirik ospetsuena zalantzarik gabe Chica de ayer da, espainiar pop musikaren abesti ezagunenetakoa dena."},{"page_url":"https://fr.wikipedia.org/wiki/Drapeau_ethnique","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Flag_of_the_Kumukh_people.png","page_title":"Drapeau ethnique","context_page_description":"Un drapeau ethnique est une forme de représentation utilisée par un groupe culturel, historique, linguistique, religieux ou tout cela à la fois, communément appelé « ethnie », pour être arboré là où des membres de ce groupe veulent manifester leur identité culturelle. Un drapeau ethnique n'identifie qu'une ethnie, et non une région traditionnelle, un territoire officiellement délimité ou un territoire revendiqué.\\nAucun drapeau ethnique n'a de statut officiel. Tous sont utilisés de facto là où ils sont tolérés. À titre d'exemples, le drapeau des Gagaouzes n'est pas celui de la Gagaouzie et le Drapeau du Tibet n'est pas celui de la région autonome du Tibet.\\nLes drapeaux ethniques peuvent représenter :\\ndes peuples autochtones tels qu'ils sont définis par le Haut-Commissariat des Nations unies aux droits de l'homme, représentant environ 370 millions de personnes dans le monde, dont 70 % en Asie ;\\nd'autres groupes ethniques, qui sont loin d'avoir tous choisi un drapeau, dont les définitions sont variables et discutées, et qui ne représentent parfois que des ensembles disparates, mais se reconnaissant néanmoins des appartenances communes, tels les Roms."},{"page_url":"https://nn.wikipedia.org/wiki/Aleksandr_Borisov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Borisov_Winter_tale.jpg","page_title":"Aleksandr Borisov","context_page_description":"Aleksandr Aleksejevitsj Borisov var ein russisk målar. Han vert omtala som Nord-Russlands målar. Ein del av bileta er vigd innfødde folk i det austlege Russland."},{"page_url":"https://ast.wikipedia.org/wiki/Llista_de_galaxes","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Messier_85_Hubble_WikiSky.jpg","page_title":"Llista de galaxes","context_page_description":"Llista de galaxes del Grupu Llocal\\nLlista d'oxetos Messier\\nLlista d'oxetos NGC\\nLlista d'oxetos UGC\\nLlista d'oxetos PGC\\nLlista d'oxetos IC"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BF%D0%BB%D1%8F%D1%86%D0%B5%D0%BD%D0%BD%D0%B5_(%D0%BC%D0%B0%D1%81%D1%82%D0%B0%D1%86%D1%82%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Initial_V_12th_century_Bible_Abbey_of_Pontigny.jpg","page_title":"Спляценне (мастацтва)","context_page_description":"У выяўленчым мастацтве спляценне — распаўсюджаны дэкаратыўны элемент ў сярэднявечным мастацтве. У спляценні лініі або часткі матываў паўтараюцца, заплятаюцца, завязваюцца вузламі бел. ў складаныя геаметрычныя формы, часта для запаўнення прасторы. Спляценне часта сустракаецца ў мастацтве перыяду міграцый Паўночнай Еўропы, асабліва ў астраўным мастацтве бел. Брытанскіх астравоў і паўночным мастацтве бел. Ранняга Сярэдневякоўя бел. і ў ісламскім мастацтве."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%92%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%9B%E1%83%9D%E1%83%A1%E1%83%98%E1%83%90%E1%83%A8%E1%83%95%E1%83%98%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Mosiashvili_guli_tbilisi_1989.jpg","page_title":"გული მოსიაშვილი","context_page_description":"გული მოსიაშვილი — ქართველი მიკრობიოლოგი. ბიოლოგიის მეცნიერებათა დოქტორი, პროფესორი, დამსახურებული მოღვაწე მეცნიერების სამინისტრო. დიდი სამამულო ომის მონაწილე. 1946 წლიდან კომუნისტური პარტის წევრი. აწარმოებდა კვლევით სამუშაოებს მეღვინეობის დარგში. 1945 წლიდან მიკრობიოლოგიის ლაბორატორიის ხელმძღვანელი, ძირითადი სამეცნიერო-კვლევები მიეძღვნა ღვინის მიკრობიოლოგიას. მან შეიმუშავა საფუარის გამოყენების ახალი მეთოდები სუფთა და შერეული კულტურებში, ფიზიკური მეთოდები ღვინის დაავადებებთან ბრძოლაში, საქართველოს რეგიონებში ღვინის საფუარის გავრცელების სქემატური რუკა; შემოთავაზებული აქვს სამეურნეო ნარჩენებისა და ინდ. საკვები კულტურების, საფუარისა და ნეპათოგენური ბაქტერიების გამოყენება საკვები დანიშნულების ცილებისა და ამინომჟავების მისაღებად. მის სახელზეა საფუარის 32 ახალი კულტურა. იგი არის ავტორი 126 სამეცნიერო ნაშრომისა და 14 გამოგონებისა მეღვინეობისა და მიკრობიოლოგიის სფეროში."},{"page_url":"https://fr.wikipedia.org/wiki/Faten_Hamama","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Faten_Hamama.jpg","page_title":"Faten Hamama","context_page_description":"Faten Hamama est une actrice et star de cinéma égyptienne, née le 27 mai 1931 à Al Mansurah et morte le 17 janvier 2015 au Caire\\n."},{"page_url":"https://vi.wikipedia.org/wiki/Saguinus_labiatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/White-lipped_Tamarin_area.png","page_title":"Saguinus labiatus","context_page_description":"Saguinus labiatus là một loài động vật có vú trong họ Cebidae, bộ Linh trưởng. Loài này được É. Geoffroy mô tả năm 1812."},{"page_url":"https://en.wikipedia.org/wiki/King_County_Metro_fleet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/King_County_Metro_Transit_D60HF_2353.jpg","page_title":"King County Metro fleet","context_page_description":"As of 2017, King County Metro operates the 10th largest fleet of buses in the United States, with a total of 1,540 buses.\\nUpon taking over transit operations on January 1, 1973, Metro used buses acquired from predecessor agencies Seattle Transit System and the Metropolitan Transit Company, still painted in their original colors. Metro acquired the 91-bus fleet of the Metropolitan Transit Company in December 1972 at a cost of $2.75 million. The first fleet of new 40-foot buses ordered by Metro arrived in June 1976, consisting of 145 diesel coaches manufactured by AM General. In 1978, Metro became the first large transit agency in North America to introduce articulated buses to its fleet, which required some bus stops to be rebuilt to accommodate 60-foot coaches. The fleet of 151 buses were manufactured by German maker MAN as part of a bulk order with other large U.S. transit agencies."},{"page_url":"https://es.wikipedia.org/wiki/Ley_Antibarricadas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/12_11_19_Marcha_San_Antonio%2C_Chile_%2849064861483%29.jpg","page_title":"Ley Antibarricadas","context_page_description":"La ley Anti Barricadas es una ley chilena creada en el contexto de las protestas chilenas de 2019-2020 que aumenta los castigos por hacer barricadas, saquear o lanzar objetos a personas o vehículos.​\\nEl 3 de marzo, un grupo de Primera Línea fue detenido y detenido por Carabineros, haciendo cumplir una ley recién redactada contra las barricadas. Posteriormente, solo uno de los 44 detenidos se mantuvo en prisión preventiva, los reclusos fueron puestos en libertad pero se les exigió que se reportaran y firmaran dos veces al mes.​"},{"page_url":"https://uk.wikipedia.org/wiki/1_%D0%B3%D1%80%D0%B8%D0%B2%D0%BD%D1%8F_(%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Coin_of_Ukraine_G1_05_P60_a.jpg","page_title":"1 гривня (монета)","context_page_description":"Монета номіналом 1 гривня перебуває в обігу паралельно з банкнотами зазначеного номіналу всіх випусків та є дійсним платіжним засобом України й обов’язкова до приймання без будь-яких обмежень за її номінальною вартістю до всіх видів платежів, а також для зарахування на розрахункові рахунки, вклади, акредитиви та для переказів."},{"page_url":"https://no.wikipedia.org/wiki/Eirik","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Eirik_Newth.jpg","page_title":"Eirik","context_page_description":"Eirik og Erik er mannsnavn med opprinnelse i norrøne Eiríkr, som igjen er dannet av urnordiske *Aina-rikiaR eller *Aiwa-rikiaR. Det første navneleddet er dannet av urnordiske *aina, «alene, en», eller *aiwa, «evig, alltid», og det andre navneleddet av rikiaR, «rik, mektig hersker»."},{"page_url":"https://sv.wikipedia.org/wiki/Crinum_buphanoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Crinum_buphanoides_%28as_Crinum_leucophyllum_Hook.%29_Bot._Mag._110.6783_%281884%29..jpg","page_title":"Crinum buphanoides","context_page_description":"Crinum buphanoides är en amaryllisväxtart som beskrevs av Friedrich Welwitsch och John Gilbert Baker. Crinum buphanoides ingår i släktet Crinum, och familjen amaryllisväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Dogs_of_the_Australasian_Antarctic_Expedition","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/The_final_landing_of_the_Macquarie_Island_party.jpg","page_title":"Dogs of the Australasian Antarctic Expedition","context_page_description":"In common with many of the expeditions of the Heroic Age, Douglas Mawson's Australasian Antarctic Expedition employed dog-hauled sledges as a principal means of transportation during exploration of the continent. Dog sledges could carry more weight and travel faster than man-hauled sledges; they were more reliable in the freezing temperatures than motor-sledges; and dogs had proved to be more adaptable to harsh Antarctic conditions than ponies.\\nMawson purchased fifty sledge dogs from Greenland and transported them to Antarctica on the expedition's ship SY Aurora. The trip was arduous for the dogs and by the time the expedition arrived in Antarctica on 8 January 1912 only 28 of the dogs were still alive. These were split into two groups: nineteen stayed with Mawson at the expedition's main base and the remaining nine were sent with Frank Wild to the western base. All of the original dogs at the main base were dead by the end of 1912; accidents and illness had accounted for many of them and some were killed and eaten when food ran out on Mawson's main sledging journey. At the western base two dogs survived to accompany the party home."},{"page_url":"https://hu.wikipedia.org/wiki/Fels%C5%91v%C3%ADziv%C3%A1rosi_Szent_Anna-pl%C3%A9b%C3%A1nia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/SzentAnnaFotoThalerTamas40.JPG","page_title":"Felsővízivárosi Szent Anna-plébánia","context_page_description":"A Felsővízivárosi Szent Anna-plébánia Budapest I. kerületének egyik római katolikus plébániája. Temploma, a felsővízivárosi Szent Anna-plébániatemplom, gyakran használt rövid nevével Szent Anna-templom a Batthyány tér egyik legjelentősebb épülete, a budai Duna-part látképének jellegzetes eleme. Építése 1740-ben indult meg Hamon Kristóf építőmester tervei alapján, halála után Nöpauer Máté fejezte be az épületet, 1761-ben."},{"page_url":"https://fr.wikipedia.org/wiki/Asile_d%C3%A9partemental_de_Loir-et-Cher","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Asile_psychiatrique_Blois.jpg","page_title":"Asile départemental de Loir-et-Cher","context_page_description":"L’asile départemental de Loir-et-Cher était une importante institution psychiatrique située à Blois, dans le quartier du Bourg-neuf, entre 1846 et 1943. Étendu sur plus de 70 hectares à son apogée, l'asile forme une véritable cité des fous en périphérie de la ville jusqu'à sa désaffectation par les Allemands durant l'Occupation."},{"page_url":"https://nl.wikipedia.org/wiki/Geelkopjufferduif","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ptilinopus_layardi.jpg","page_title":"Geelkopjufferduif","context_page_description":"De geelkopjufferduif is een vogel uit de familie Columbidae."},{"page_url":"https://en.wikipedia.org/wiki/Reidsville,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Reidsville_Post_Office.jpg","page_title":"Reidsville, Georgia","context_page_description":"Reidsville is a city in Tattnall County, Georgia, United States. The population was 4,944 at the 2010 census. The city is the county seat of Tattnall County. The Georgia State Prison is near Reidsville."},{"page_url":"https://fr.wikipedia.org/wiki/Carlo_Bartolomeo_Rastrelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Elizabetrh_of_Russia_by_Rastrelli_01_by_shakko.jpg","page_title":"Carlo Bartolomeo Rastrelli","context_page_description":"Carlo Bartolomeo Rastrelli, né en 1675 à Florence, Italie, et mort le 18 novembre 1744 à Saint-Pétersbourg, Russie, est un sculpteur et un architecte italien. Né en Italie, il s'installe en 1716 en Russie où il travaille jusqu'à sa mort. Ses œuvres les plus célèbres comprennent le Monument à Pierre I, une Céroplastie et différents bustes de Pierre le Grand. Son fils Francesco Bartolomeo Rastrelli est aussi un éminent architecte en Russie."},{"page_url":"https://en.wikipedia.org/wiki/Volkswagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/2018_Volkswagen_Passat_GTE_Advance_S-A_1.4_Front.jpg","page_title":"Volkswagen","context_page_description":"Volkswagen, shortened to VW, is a German automaker founded in 1937 by the German Labour Front, known for the iconic Beetle and headquartered in Wolfsburg. It is the flagship marque of the Volkswagen Group, the largest automaker by worldwide sales in 2016 and 2017. The group's biggest market is in China, which delivers 40% of its sales and profits.\\nVolkswagen translates to \\"people's car\\" in German. The company's current international advertising slogan is just \\"Volkswagen\\", referencing the name's meaning."},{"page_url":"https://hu.wikipedia.org/wiki/Az_Egyes%C3%BClt_Nemzetek_Szervezete_f%C5%91titk%C3%A1rainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Trygve_Lie.jpg","page_title":"Az Egyesült Nemzetek Szervezete főtitkárainak listája","context_page_description":null},{"page_url":"https://da.wikipedia.org/wiki/Sankt_Therese_Kirke","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/SctTherese.jpg","page_title":"Sankt Therese Kirke","context_page_description":"Sankt Therese Kirke beliggende Bernstorffsvej 56 i Hellerup i Gentofte Kommune er en katolsk kirke. Bygningen er tegnet af Alf Cock-Clausen og opført 1934-1935. Kirken blev indviet den 14. december 1935."},{"page_url":"https://it.wikipedia.org/wiki/Massimo_Ceccherini","image_url":"https://upload.wikimedia.org/wikipedia/it/3/3f/I_laureati_%281995%29_-_Tognazzi%2C_Cucinotta%2C_Ceccherini%2C_Pieraccioni.JPG","page_title":"Massimo Ceccherini","context_page_description":"Massimo Ceccherini è un attore, regista, comico e sceneggiatore italiano."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A3%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D0%B7%D0%B0%D0%BB%D0%BD%D0%B8_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD_%D0%B3%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B0%D1%86%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/NASA-JPL-Caltech_-_Double_the_Rubble_%28PIA11375%29_%28pd%29.jpg","page_title":"Универзални закон гравитације","context_page_description":"Математичар и физичар Исак Њутн у периоду од 1665. до 1685., развио је своју теорију механике, засновану на убрзању, а не само на проучавању брзине, како су то чинили Галилеј и Декарт пре њега. Кључна чињеница коју је Њутн први запазио је да је сила која делује на јабуку која пада са дрвета заправо иста сила која делује на Земљу да се окреће око Сунца. Из тог сазнања потекао је Њутнов закон гравитације, тј. универзални закон гравитације, који се убраја у четврти Њутнов закон, поред 3 основна закона класичне механике. Универзални закон гравитације је формулисан у Њутновом делу Philosophiæ Naturalis Principia Mathematica, које је прву пут било објављено 5. јула 1687. Кад је Њутн представио Књигу 1 необјављеног текста у априлу 1686. Краљевском друштву, Роберт Хук је тврдио да је Њутн добио закон инверзног квадрата од њега.\\nУ данашњем језику, закон наводи да свака тачка масе привлачи сваку другу тачку масе са силом која делује дуж линије која спаја тачке. Сила је пропорционална производу две масе, и инверзно пропорционална квадрату растојања између њих."},{"page_url":"https://en.wikipedia.org/wiki/Riverview_Terrace_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Riverview_Terrace.jpg","page_title":"Riverview Terrace Historic District","context_page_description":"The Riverview Terrace Historic District is a 15.2-acre historic district in Davenport, Iowa, United States, that was listed on the National Register of Historic Places in 1984. It was listed on the Davenport Register of Historic Properties in 1993. The neighborhood was originally named Burrow's Bluff and Lookout Park and contains a three-acre park on a large hill."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B1%D9%8A%D8%AA%D8%B2_%D8%A5%D8%AF%D9%88%D9%8A%D9%86_%D8%AA%D8%B4%D8%B1%D8%AA%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Frederic_Edwin_Church_-_Brady-Handy-crop.jpg","page_title":"فريتز إدوين تشرتش","context_page_description":"فريتز إدوين تشرتش ‏ هو مسافر ورسام أمريكي، ولد في 4 مايو 1826 في هارتفورد في الولايات المتحدة، وتوفي في 7 أبريل 1900 في نيويورك في الولايات المتحدة. كان شخصية بارزة في مدرسة هادسن ريفر لفناني المناظر الطبيعية الأمريكيين، مشهور برسم المناظر الطبيعية الكبيرة، مصورًا في أغلب الأوقات الجبال والشلالات وغروب الشمس. تُركز رسومات تشرتش على التفاصيل الواقعية وإدخال الضوء بطريقة دراماتيكية وعلى المناظر البانورامية. كان يعرض بعض أعماله الكبرى لأول مرة في معارض مؤلفة من لوحة واحدة للمشاهدين ممن يدفعون بسخاء في مدينة نيويورك. في ريعان شبابه، كان واحدًا من أشهر الرسامين في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/Fort_Worth_Fire_Department","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/STATION10.png","page_title":"Fort Worth Fire Department","context_page_description":"The Fort Worth Fire Department provides fire protection and first responder emergency medical services to the city of Fort Worth, Texas."},{"page_url":"https://sw.wikipedia.org/wiki/Nazi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/2019_Jan_15_-_Kumbh_Mela_-_Coconuts_For_Sale.jpg","page_title":"Nazi","context_page_description":"Nazi ni neno linaloweza kumaanisha:\\nNazi - tunda la mnazi\\nNazi - kifupi cha chama tawala cha Ujerumani kati ya 1933 hadi 1945 kilichoongozwa na Adolf Hitler."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Neustadt-Neusch%C3%B6nefeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Lilienstra%C3%9Fe_Leipzig_2016_020.jpg","page_title":"Liste der Kulturdenkmale in Neustadt-Neuschönefeld","context_page_description":"Die Liste der Kulturdenkmale in Neustadt-Neuschönefeld enthält die Kulturdenkmale des Leipziger Ortsteils Neustadt-Neuschönefeld, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand 2017 erfasst wurden."},{"page_url":"https://en.wikipedia.org/wiki/Carmen_Ottner","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/2013_Dr._Carmen_Ottner_%289000459891%29_%282%29.jpg","page_title":"Carmen Ottner","context_page_description":"Carmen Ottner is an Austrian musicologist, Theatre studies and General Secretary of the Franz Schmidt association."},{"page_url":"https://pl.wikipedia.org/wiki/Poliptyk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Genter_Altor.jpg","page_title":"Poliptyk","context_page_description":"Poliptyk – typ nastawy ołtarzowej charakterystyczny dla późnego gotyku.\\nNastawa w formie poliptyku to złożona struktura, malowana lub rzeźbiona, skomponowana na kilku płaszczyznach, wiążąca wiele elementów w harmonijną całość wg określonej koncepcji artystycznej i wspólnego programu ikonograficznego.\\nNastawy ołtarzowe z ruchomymi skrzydłami powstawały w krajach na północ od Alp, natomiast w krajach basenu Morza Śródziemnego poliptyki składały się z wielu powiązanych ze sobą kwater i nie zamykały się.\\nWydzielone obramieniem, malowane lub rzeźbione, pole skrzydła lub tablicy środkowej poliptyku nazywamy kwaterą. Ruchome części boczne, w poliptykach rzeźbionych lub malowanych, zamykające szafę ołtarzową, zwykle podzielone na kwatery, noszą nazwę skrzydeł. Stronę frontową skrzydła przy otwarciu nazywamy awersem lub stroną wewnętrzną, natomiast stronę tylną – rewersem lub stroną zewnętrzną.\\nPoliptykiem nazywamy również malowidło skomponowane na kilku sąsiadujących ze sobą płaszczyznach, które łączy w całość wspólny program ikonograficzny. W XIX i XX w. wykroczył poza obszar sztuki sakralnej."},{"page_url":"https://fi.wikipedia.org/wiki/Linus_Pauling","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sp3-Orbital.png","page_title":"Linus Pauling","context_page_description":"Linus Carl Pauling oli merkittävä yhdysvaltalainen kvanttikemisti ja biokemisti. Paulingin laatima The Nature of the Chemical Bond on tärkeimpiä 1900-luvulla kirjoitettuja kemian alan teoksia.\\nPauling palkittiin Nobelin kemianpalkinnolla vuonna 1954 kemiallisten sidosten tutkimuksesta ja monimutkaisten materiaalien rakenteiden selvittämisestä. Nobelin rauhanpalkinnon hän sai vuonna 1962 ydinkokeiden vastaisesta kampanjoinnista."},{"page_url":"https://ca.wikipedia.org/wiki/Llu%C3%AFsa_Maria_Adelaida_de_Borb%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Arms_of_Louise_Marie_Ad%C3%A9la%C3%AFde_de_Bourbon_as_Duchess_of_Orl%C3%A9ans.png","page_title":"Lluïsa Maria Adelaida de Borbó","context_page_description":"Lluïsa Maria Adelaida de Borbó, duquessa d'Orleans. Pertanyent a una branca de la Casa dels Borbó de França descendent del rei Lluís XIV de França, Adelaida fou coneguda com a Mademoiselle de Ivry i posteriorment de Penthièvre.\\nNascuda a París, el dia 13 de març de l'any 1753, era filla del duc Lluís de Borbó i de la princesa Maria Teresa d'Este. Adelaida era néta per via paterna del duc Lluís Alexandre de Borbó i de la duquessa Maria Victòria de Noailles i per via materna del duc Francesc III de Mòdena i de la princesa Carlota d'Orleans.\\nQuan l'any 1768 morí el seu germà gran, el príncep de Lamballe, Adelaida es convertí en hereva absoluta del patrimoni de la família Penthièvre que era considerat un dels més remarcables de la França del segle XVIII.\\nEl 5 d'abril de l'any 1769 contragué matrimoni amb el duc Lluís Felip d'Orleans, llavors duc de Chartres, fill del duc Lluís Felip d'Orleans i de la princesa Lluïsa Enriqueta de Borbó. La parella tingué quatre fills que arribaren a edat adulta:\\nSM el rei Lluís Felip I de França, nat a París el 1773 i mort a Claremont House el 1850. Es casà amb la princesa Maria Amèlia de Borbó-Dues Sicílies."},{"page_url":"https://fr.wikipedia.org/wiki/Charles_(pr%C3%A9nom)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Charles_the_Bold_1460.jpg","page_title":"Charles (prénom)","context_page_description":"Charles est un prénom porté en particulier par de nombreux personnages historiques, et fréquent dans les familles royales européennes."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%99%D0%BE%D1%80%D0%B4%D0%B0%D0%BD%D0%BA%D0%B0_%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%B5%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Yordanka_Blagoeva_1972.jpg","page_title":"Йорданка Благоева","context_page_description":"Йорданка Благоева Иванова е българска състезателка по лека атлетика в дисциплината висок скок, носителка на сребърен и бронзов олимпийски медали от олимпийските игри през 1972 и 1976 г., европейска шампионка в зала през 1972 г., първата българска състезателка, която поставя световен рекорд в дисциплина от леката атлетика."},{"page_url":"https://it.wikipedia.org/wiki/Vadims_Vasi%C4%BCevskis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/2012-06-07_Bislett_Games_Vadims_Vasi%C4%BCevskis.jpg","page_title":"Vadims Vasiļevskis","context_page_description":"Vadims Vasiļevskis è un ex giavellottista lettone, vincitore di una medaglia d'argento ai Giochi olimpici di Atene 2004."},{"page_url":"https://en.wikipedia.org/wiki/Vacuum_distillation","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Vacuum_Column.jpg","page_title":"Vacuum distillation","context_page_description":"Vacuum distillation is distillation performed under reduced pressure, which allows the purification of compounds not readily distilled at ambient pressures or simply to save time or energy. This technique separates compounds based on differences in boiling points. This technique is used when the boiling point of the desired compound is difficult to achieve or will cause the compound to decompose. A reduced pressure decreases the boiling point of compounds. The reduction in boiling point can be calculated using a temperature-pressure nomograph using the Clausius–Clapeyron relation."},{"page_url":"https://it.wikipedia.org/wiki/Martine_van_Hamel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Martine_van_Hamel.jpg","page_title":"Martine van Hamel","context_page_description":"Martine van Hamel è una coreografa, regista, ex ballerina, ex ballerina principale al National Ballet of Canada e all'American Ballet Theatre ed insegnante. È stata medaglia d'oro alla Gara Biennale Internazionale di danza di Varna, la più prestigiosa competizione di balletto del mondo, tenuta a Varna, in Bulgaria. È anche destinataria del Prix de Varna, un riconoscimento raramente concesso, per la migliore interpretazione artistica in tutte le categorie. È stata una delle più importanti ballerine classiche in America olandese."},{"page_url":"https://en.wikipedia.org/wiki/The_Amazing_Race_12","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Gold_Pan.jpg","page_title":"The Amazing Race 12","context_page_description":"The Amazing Race 12 was the twelfth installment of American reality television show The Amazing Race. It featured 11 teams of two, with a pre-existing relationship, in a race around the world.\\nThe 12th season premiered on November 4, 2007 at 8 p.m. ET/PT. It took the timeslot of the canceled CBS series Viva Laughlin. The finale aired on January 20, 2008 at 8 p.m. ET/PT.\\nNewly dating couple TK Erwin and Rachel Rosales were the winners of this season.\\nA DVD for this season was released on March 24, 2014, via Amazon's CreateSpace program."},{"page_url":"https://tr.wikipedia.org/wiki/NSA_ANT_Katalo%C4%9Fu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/NSA_FIREWALK.jpg","page_title":"NSA ANT Kataloğu","context_page_description":"NSA ANT kataloğu, Amerika Birleşik Devletleri Ulusal Güvenlik Ajansı Özel Erişim Operasyonları tarafından siber izleme için Gelişmiş Ağ Teknolojisi Bölümü tarafından kullanılabilen 50 sayfalık sınıflandırılmış bir doküman listeleme teknolojisidir. Çoğu cihaz halihazırda operasyonel olarak tanımlanmıştır ve ABD ile Five Eyes ittifakı üyeleri tarafından kullanılabilir durumdadır. 30 Aralık 2013'te kataloğu halka yayınlayan Der Spiegel'e göre, \\"Liste, NSA çalışanlarının hedeflerinin verilerine erişmek için ANT bölümünden teknoloji sipariş edebileceği bir posta siparişi kataloğu gibi görünmektedir.\\" Belge 2008 yılında oluşturulmuştur.\\nGüvenlik araştırmacısı Jacob Appelbaum, Almanya'nın Hamburg kentindeki Kaos İletişim Kongresi'nde bir konuşma yaptı ve aynı zamanda yayınladığı Der Spiegel makalesininde NSA'nın ABD ve uluslararası gözetim çabalarında kullandığı teknikleri ayrıntılı olarak detaylandırdı.\\nKatalogdaki ürünlerin fiyatları ücretsiz olmakla birlikte 250.000 ABD Dolarına kadar çıkabilmektedir."},{"page_url":"https://no.wikipedia.org/wiki/Gr%C3%B8nlandsm%C3%A5ke","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Larus-glaucoides-002.jpg","page_title":"Grønlandsmåke","context_page_description":"Grønlandsmåke er en art av måker og inngår i slekten Larus, som er den mest tallrike av måkeslektene. Arten består i kraft av to distinkte taxa."},{"page_url":"https://cs.wikipedia.org/wiki/Hayden_Peak","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Hayden_Peak%2C_Utah.JPG","page_title":"Hayden Peak","context_page_description":"Hayden Peak je hora v západní části pohoří Uinta Mountains v okrese Summit County ve státě Utah ve Spojených státech amerických. Hora je domovem pro různé druhy zvířat, mezi něž patří kamzík bělák, pika a mnoho druhů rostlin. Svůj název hora dostala po americkém geologovi Ferdinandu Haydenovi."},{"page_url":"https://it.wikipedia.org/wiki/Natal%27ja_Stepanovna_Apraksina","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Natalia_Stepanovna_Golitsyna_.jpg","page_title":"Natal'ja Stepanovna Apraksina","context_page_description":"Principessa Natal'ja Stepanovna Apraksina, è stata una nobildonna russa."},{"page_url":"https://it.wikipedia.org/wiki/Alexander_Kircher","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Austrian_mail_steamer_Pelikan_moored_at_anchor_-_1891.jpg","page_title":"Alexander Kircher","context_page_description":"Alexander Kircher fu pittore ufficiale della marina, paesaggista e illustratore austroungarico, poi austriaco e infine, dopo l'Anschluss, cittadino tedesco. Firmava i suoi quadri come Alex Kircher, a volte aggiungendo l'anno della sua creazione, altre volte firmandosi A. Kircher."},{"page_url":"https://fi.wikipedia.org/wiki/Yellowknife","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Yellowknife_City_Hall_4.jpg","page_title":"Yellowknife","context_page_description":"Yellowknife on Kanadan Luoteisterritorioiden pääkaupunki. Sen asukasluku oli vuoden 2016 väestönlaskennassa 19 569. Kaupunki rakentui 1930-luvulla perustettujen kultakaivosten ympärille. Viimeinen kultakaivos suljettiin vuonna 2004, mutta työpaikkoja on edelleen esimerkiksi julkishallinnossa, minkä lisäksi lähistöllä on aloitettu timanttien kaivostoimintaa."},{"page_url":"https://es.wikipedia.org/wiki/Giovanni_Volpato","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Giovanni_Volpato_%281735-1803%29_by_Angelica_Kauffmann.jpg","page_title":"Giovanni Volpato","context_page_description":"Giovanni Volpato fue un grabador italiano, que practicó la arqueología y el coleccionismo de antigüedades y porcelanas."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A9%D7%98%D7%A8%D7%AA_%D7%94%D7%A1%D7%93%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Bundesarchiv_Bild_101I-030-0780-05%2C_Krakau%2C_Razzia_von_deutscher_und_polnischer_Polizei.jpg","page_title":"משטרת הסדר","context_page_description":"משטרת הסדר הייתה ארגון-על שריכז כוחות משטרה, ז'נדרמריה וכוחות משטרתיים למחצה וצבאיים למחצה בגרמניה הנאצית. נקראה לעיתים \\"המשטרה הירוקה\\", בשל צבע מדיהם של שוטריה. בנוסף לשליטה בכל כוחות שמירת הסדר, השמירה ושירותי ההצלה בגרמניה הנאצית, שימשו כוחות משטרת הסדר לשליטה באזורי הכיבוש בתקופת מלחמת העולם השנייה וביצעו פשעי מלחמה רבים."},{"page_url":"https://eo.wikipedia.org/wiki/Patrick_Augustine_Sheehan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Sheehan_Letter.jpg","page_title":"Patrick Augustine Sheehan","context_page_description":"Patrick Augustine SHEEHAN estis irlanda romkatolika pastro, politikisto kaj verkisto. Li apartenis al la movado de Renouveau catholique."},{"page_url":"https://de.wikipedia.org/wiki/Oksana_Steschenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/%D0%A1%D1%82%D0%B0%D1%80%D0%B8%D1%86%D1%8C%D0%BA%D0%B0_%D1%96_%D0%9A%D0%BE%D1%81%D0%B0%D1%87%D1%96%D0%B2%D0%BD%D0%B8.png","page_title":"Oksana Steschenko","context_page_description":"Oksana Mychajliwna Steschenko war eine ukrainische Kinderbuchautorin und Übersetzerin. Sie war die Ehefrau von Iwan Steschenko und eine Vertreterin der „hingerichteten Wiedergeburt“."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%A4%D0%B0%D0%B1%D0%B5%D1%80%D0%B6%D0%B5_%D0%B2_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Fontanka_21_Shuvalov_Palace_Apr_2015_04.jpg","page_title":"Музей Фаберже в Санкт-Петербурге","context_page_description":"Музей Фаберже — частный музей в Санкт-Петербурге, расположен во дворце Нарышкиных-Шуваловых. Обладает не имеющим аналогов собранием русского ювелирного и декоративно-прикладного искусств XIX—XX вв. Наиболее ценные и известные предметы в коллекции музея — 9 императорских пасхальных яиц, созданных фирмой Карла Густавовича Фаберже. В коллекции музея, в том числе, находятся первое и последнее из императорских яиц.\\nТоржественное открытие музея состоялось 19 ноября 2013 года. Свои двери для широкой публики музей открыл в апреле 2014 года. Музей работает без выходных с 10:00 до 20:45, кассы открываются в 9:30.\\nОрганизация-учредитель музея — Культурно-исторический фонд «Связь времён», созданный в 2004 году известным российским предпринимателем Виктором Вексельбергом.\\nДиректор музея — Владимир Воронченко. Музей создан для коллекционирования, экспонирования и популяризации шедевров русского искусства. Целью создания музея является не получение прибыли, а возвращение россиянам утраченных шедевров российского искусства."},{"page_url":"https://fr.wikipedia.org/wiki/L%C3%A9on-Eug%C3%A8ne_Longepied","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/FR-10-Arcis-sur-Aube5.jpg","page_title":"Léon-Eugène Longepied","context_page_description":"Léon-Eugène Longepied, né le 10 août 1849 à Paris, où il est mort le 13 octobre 1888, est un sculpteur français."},{"page_url":"https://sco.wikipedia.org/wiki/Charles_K._Kao","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Charles_K._Kao_cropped_2.jpg","page_title":"Charles K. Kao","context_page_description":"Sir Charles Kuen Kao, GBM, KBE, FRS, FREng wis a Cheenese-born Hong Kong electrical ingineer an pheesicist wha pioneered the development an uise o fiber optics in telecommunications."},{"page_url":"https://sv.wikipedia.org/wiki/Riehen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Riehen_bus_32.jpg","page_title":"Riehen","context_page_description":"Riehen är en ort och kommun i kantonen Basel-Stadt i Schweiz. Riehen är en av kantonens tre kommuner, de andra är Basel och Bettingen.\\nI Riehen finns Fondation Beyeler, ett leksaksmuseum och kyrkan St. Martin."},{"page_url":"https://en.wikipedia.org/wiki/Pasacao,_Camarines_Sur","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Pasacao_Aerial.JPG","page_title":"Pasacao, Camarines Sur","context_page_description":"Pasacao, officially the Municipality of Pasacao, is a 3rd class municipality in the province of Camarines Sur, Philippines. According to the 2015 census, it has a population of 49,035 people."},{"page_url":"https://en.wikipedia.org/wiki/Burmese_bushtit","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Aegithalos_sharpei_distribution_map.png","page_title":"Burmese bushtit","context_page_description":"The Burmese bushtit is a species of bird in the family Aegithalidae.\\nIt is endemic to the Chin Hills of Myanmar.\\nIts natural habitat is temperate forests."},{"page_url":"https://ca.wikipedia.org/wiki/Etiologia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Jan_Verkolje_-_Antonie_van_Leeuwenhoek.jpg","page_title":"Etiologia","context_page_description":"L'etiologia és l'estudi de les causes i els orígens. La paraula es fa servir principalment en medecina i filosofia, on és utilitzada per a referir-se a l'estudi de per què ocorren les coses o fins i tot a les raons que hi ha sota de la manera en què les coses passen. La paraula es fa servir també en biologia, física i psicologia. Etimològicament prové del grec αιτιολογία, \\"donar una raó per alguna cosa\\"\\nEn medicina en particular, el terme etiologia es refereix a les causes d'una malaltia o d'una patologia. Al llarg de la història de la medicina, els metges van discutir si la causa d'una malaltia era un únic factor o bé si era el resultat d'un conjunt de factors que actuaven de manera simultània.\\nLes primeres idees sobre microorganismes són a l'antiga Roma amb l'estudiós Varró al segle I d. C., qui va formular aquesta idea en el seu llibre De Re Agricola. El pensament medieval sobre les causes de les malalties van ser influïts per Galè i Hipòcrates, i es va adoptar la teoria del miasma. Quan la pesta negra arribà a l'Àndalus al segle xiv, Ibn Khatima proposà que la infecció era causada per partícules microscòpiques que entraven al cos humà."},{"page_url":"https://vi.wikipedia.org/wiki/Astilbe_microphylla","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Astilbe_microphylla_-_Viote_03.jpg","page_title":"Astilbe microphylla","context_page_description":"Astilbe microphylla là một loài thực vật có hoa trong họ Saxifragaceae. Loài này được Knoll miêu tả khoa học đầu tiên năm 1907."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Aqaba","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/T_E_Lawrence_and_the_Arab_Revolt_1916_-_1918_Q59207.jpg","page_title":"Battle of Aqaba","context_page_description":"The Battle of Aqaba was fought for the Red Sea port of Aqaba during the Arab Revolt of World War I. The attacking forces, led by Auda ibu Tayi and advised by T. E. Lawrence, were victorious over the Ottoman Empire defenders."},{"page_url":"https://az.wikipedia.org/wiki/Aquila_heliaca","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Kaiseradler_Aquila_heliaca_4_amk.jpg","page_title":"Aquila heliaca","context_page_description":"Məzar qartalı — qartal cinsinə aid heyvan növü."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D6%80%D5%B8%D6%82%D6%80%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Truro_cathedrallane.jpg","page_title":"Տրուրո","context_page_description":"Տրուրո, Կոռնուոլի վարչական կենտրոնը։ Մեծ Բրիտանիայի ամենահարավային քաղաքն է, կարգավիճակը՝ քաղաք։"},{"page_url":"https://ast.wikipedia.org/wiki/Ximnospermes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Cupressus_sempervirens_-_kew_2.jpg","page_title":"Ximnospermes","context_page_description":"Les ximnospermes, son plantes vasculares y espermatofites, productores de grana. El nome provien del griegu γυμνός, 'desnudu', y σπέρμα, 'grana'; esto ye, 'grana desnudo'. Esti términu aplícase por cuenta de que la grana d'estes plantes nun se forma nun ovariu zarráu, sinón que tán desnudes. La so flor tien grana espuesto. Resumiendo, les Gymnospermae nun tienen frutu.\\nLes ximnospermes vivientes consisten nes cícades, el Ginkgo y un clado de coníferes y gnétides. Estos cuatro grupos representen namái unes 15 families, con 75-80 xéneros y unes 820 especies.\\nEstes plantes espolleten per tol mundu, de los 72 graos norte a los 55 graos sur, y son la vexetación dominante en munches rexones fríes y ártiques. Munches son familiares como ornamentales pa madera d'alta calidá. Ente les ximnospermes atópense los individuos más altos y de más llarga vida de les plantes.\\nL'ésitu evolutivu de les anxospermes en rellación a los otros grupos de espermatofites puede atribuyise a los vasos nel xilema y a los sos atributos pa la reproducción. Toles ximnospermes, sacante les gnétides, tienen traqueides nel so xilema. Los vasos son más eficientes pal tresporte d'agua baxo delles circunstancies."},{"page_url":"https://ca.wikipedia.org/wiki/All_We_Know_Is_Falling","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Jeremy_Davis_Soundwave.jpg","page_title":"All We Know Is Falling","context_page_description":"All We Know Is Falling —en català: Tot el que coneixem està caient— és l'àlbum debut de la banda nord-americana Paramore, llançat sota el segell Fueled by Ramen el 26 de juliol de 2005 als Estats Units. La seva producció va ser a càrrec de James Paul Wisner, Mike Green, Nick Trevisick i Roger Alan Nichols. Gairebé totes les cançons del disc van ser escrites per Josh Farro i Hayley Williams, guitarrista i vocalista de Paramore, respectivament.\\nEl procés de composició de l'àlbum es va dur a terme a Orlando, Florida, i la sortida del baixista del grup Jeremy Davis, pocs dies després d'arribar a Orlando, va servir com a temàtica principal. El fet està reflectit en la portada de l'àlbum, al seu títol i a la cançó «All We Know».\\nEs van llançar tres senzills de l'àlbum: «Pressure», «Emergency» i «All We Know». El disc va rebre comentaris variats per part dels crítics de la música, que van lloar principalment la veu de Hayley Williams. No obstant això, no va comptar amb gaires reconeixements: no va entrar al Billboard 200, malgrat que va aconseguir la posició número trenta del Top Heatseekers Albums dels Estats Units."},{"page_url":"https://en.wikipedia.org/wiki/Ixora_malabarica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Ixora_malabarica.jpg","page_title":"Ixora malabarica","context_page_description":"Ixora malabarica is a species of flowering plant in the family Rubiaceae. It is native to Karnataka and Kerala in India."},{"page_url":"https://ca.wikipedia.org/wiki/Llibre_copiador","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Spain_Andalusia_Seville_BW_2015-10-23_14-27-54.jpg","page_title":"Llibre copiador","context_page_description":"Rep el nom de Llibre copiador un manuscrit que conté la transcripció de nou cartes aparentment enviades per Cristòfor Colom als Reis Catòlics en diferents moments i que va sortir a la llum pública a Tarragona, el 1985. Per la forma de la lletra s'ha estimat que el llibre podria datar de l'últim terç del segle XVI. La majoria dels nou documents són \\"cartes-relacions\\" que narren els successos dels diferents viatges de descobriment de Colom a les Índies; set eren desconeguts anteriorment i els altres dos contenen un text sensiblement diferent del que ja es coneixia.\\nNo hi ha unanimitat sobre si el contingut transcrit al Llibre copiador és obra de Colom però la majoria dels historiadors accepten la seva autenticitat. Si es confirmés com a autèntic, la troballa del Llibre copiador constituiria el descobriment de documents relatius als viatges de Colom més important del segle XX."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%97%E0%A6%BE%E0%A6%AC%E0%A7%8B%E0%A6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Gabo%C5%A1_7-%D0%93%D0%B0%D0%B1%D0%BE%D1%88_7.JPG","page_title":"গাবোস","context_page_description":"গাবোস ভাকুবার-স্রিজিম বিভাগের একটি গ্রাম, যার জনসংখ্যা ৫১৬ জন।"},{"page_url":"https://en.wikipedia.org/wiki/Solar_eclipse_of_April_30,_2060","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/SE2059Nov05A.png","page_title":"Solar eclipse of April 30, 2060","context_page_description":"A total solar eclipse will occur on Friday 30 April 2060. A solar eclipse occurs when the Moon passes between Earth and the Sun, thereby totally or partly obscuring the image of the Sun for a viewer on Earth. A total solar eclipse occurs when the Moon's apparent diameter is larger than the Sun's, blocking all direct sunlight, turning day into darkness. Totality occurs in a narrow path across Earth's surface, with the partial solar eclipse visible over a surrounding region thousands of kilometres wide."},{"page_url":"https://en.wikipedia.org/wiki/Crowned_sandgrouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Crowned_sandgrouse_by_Bombay_Natural_History_Society_1886.jpg","page_title":"Crowned sandgrouse","context_page_description":"The crowned sandgrouse is a species of bird in the sandgrouse family, the Pteroclidae from North Africa and the Middle East."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D9%84%D8%A8%D8%A7%D8%B3_(%D8%A7%D8%B1%D9%88%D9%BE%D8%A7%DB%8C_%D8%B4%D8%B1%D9%82%DB%8C)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Slaska.jpg","page_title":"کالباس (اروپای شرقی)","context_page_description":"کالباس نوعی سوسیس سنتی در کشورهای اروپای شرقی است. این محصول به‌طور سنتی از گوشت خوک یا گاو تهیه می‌شود، اما انواع دیگری نیز دارد که از گوشت بوقلمون، مرغ، اسب، بره، گوساله و غیره تهیه می‌گردد.\\nدر ایران به تمام سوسیس‌های حجیمی که به طور سرد مصرف می‌شود، کالباس گفته می‌شود. برخی کالباس‌ها از مخلوط کردن چند نوع گوشت مختلف تهیه می‌شوند. برای ایجاد طعم‌های گوناگون، در کالباس موادی مانند سیر، خلال بادام، پسته و زیتون نیز می‌افزایند."},{"page_url":"https://hu.wikipedia.org/wiki/Bournos","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Mairie_de_Bournos.JPG","page_title":"Bournos","context_page_description":"Bournos település Franciaországban, Pyrénées-Atlantiques megyében. Bournos Aubin, Caubios-Loos, Doumy, Lonçon és Momas községekkel határos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BC%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D0%94%D0%BE%D0%BC_%D0%B2_%D0%A5%D0%BE%D1%88%D0%B8%D0%BC%D0%B8%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Deutsches_Haus_Ho_Chi_Minh_City2.jpg","page_title":"Немецкий Дом в Хошимине","context_page_description":"Немецкий Дом в Хошимине - построенный в 2017 г. комплекс зданий в районе № 1 города Хошимин. Строительство 25-этажного комплекса осуществлено в рамках двухстороннего правительственного соглашения между Германией и Вьетнамом. Комплекс включает в себя офисы и жилые помещения для сдачи в аренду, ресторанный этаж, выставочные и торговые залы. В Немецком Доме находится Генеральное консульство Германии в Хошимине, а также представительства различных немецких фирм и организаций."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%95%D7%A9%D7%9C%D7%AA_%D7%9E%D7%99%D7%A0%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/JourneytotheWest.jpg","page_title":"שושלת מינג","context_page_description":"שושלת מינג הייתה שושלת קיסרים ששלטו בסין במשך 276 שנים מ-1368 ועד 1644. היא הייתה השושלת האחרונה של קיסרים ממוצא סיני אתני. שושלת זו עלתה לשלטון במקומה של שושלת יואן של קיסרים ממוצא מונגולי והוחלפה על ידי שושלת צ'ינג של בני המאנצ'ו. סין תחת שלטון שושלת מינג הייתה קרויה \\"אימפריית מינג הגדולה\\", והיא שלטה על אזורים נרחבים: בצפונה שלטה בקוריאה, ואזורים במונגוליה ובטורקסטן של ימינו היו אזורי חסות שלה, עליהם הוטלו מיסים, ובדרומה שלטה על וייטנאם ובורמה של ימינו. שטחה של האימפריה בשיאה היה השטח הגדול ביותר שעליו שלטו קיסרים ילידי סין אי־פעם, כ-6,500,000 קילומטרים רבועים.\\nתחת שלטון שושלת מינג נהנתה סין מקרוב ל-300 שנים של יציבות יחסית. מקים השושלת, הקיסר חונגוו, ניסה לבנות מערכת חברתית שכלליה נוקשים הבנויה מקהילות כפריות עצמאיות שנועדה להבטיח ולקיים מעמד קבוע של חיילים עבור השושלת. בשירות האימפריה הוקמו צבא גדול שכלל בין כמיליון חיילים, למעל לשני מיליון חיילים והמספנות בנאנג'ינג היו הגדולות בעולם בתקופתן. הוא גם ניסה לשבור את כוחם של הסריסים ואת מעמד הסוחרים העשירים. הוא חילק טריטוריות ברחבי סין לבניו הרבים כשהוא מנסה לחייבם להתנהל לפי סדרת כללים שהכין המכונה \\"חְוָאנְג מִינְג דְזוּ שׂוּן\\". תוכניתו כשלה כאשר נכדו בן ה-22, בנו של יורש העצר שמת קודם לכן, עלה לשלטון ב-1398 כקיסר ג'יינוון."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B5%D1%81%D1%81%D0%B5_(%D0%9C%D1%8F%D0%B4%D0%B7%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%D0%9F%D0%B0%D0%BB%D0%B5%D1%81%D1%81%D0%B5._%D0%A1%D1%8F%D0%B4%D0%B7%D1%96%D0%B1%D0%B0_%D0%90%D1%81%D0%BA%D0%B5%D1%80%D0%BA%D0%B0%D1%9E_%22%D0%91%D1%83%D0%B4%D1%81%D0%BB%D0%B0%D1%9E%22_%2802%29.jpg","page_title":"Палессе (Мядзельскі раён)","context_page_description":"Пале́ссе — вёска ў Мядзельскім раёне Мінскай вобласці. Уваходзіць у склад Будслаўскага сельсавета."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%83%E3%82%BB%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Zollverein_Schacht_12.jpg","page_title":"エッセン","context_page_description":"エッセン は、ドイツ、ノルトライン＝ヴェストファーレン州の都市。人口は約58万人。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D5%BD%D5%AB%D5%B6%D5%B8_%D5%8E%D5%AB%D5%BD%D5%AF%D5%B8%D5%B6%D5%BF%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Massino_Visconti_Panorama_3.jpg","page_title":"Մասինո Վիսկոնտի","context_page_description":"Մասինո Վիսկոնտի, կոմունա Իտալիայի Պիեմոնտ մարզի Նովարա գավառում։\\nԲնակչությունը կազմում է 1088 մարդ ։ Բնակչության խտությունը՝ 181 մարդ/կմ²։ Տարածքը՝ 6 կմ²։ Փոստային ինդեքս՝ 28040։ Հեռախոսային կոդ՝ 0322։"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Wuppertaler_Wohnquartier_Nordstadt_(G%E2%80%93K)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Hochstra%C3%9Fe_63_Wuppertal_22.jpg","page_title":"Liste der Baudenkmäler im Wuppertaler Wohnquartier Nordstadt (G–K)","context_page_description":"Die Liste der Baudenkmäler im Wuppertaler Wohnquartier Nordstadt (G–K) enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Wuppertal-Nordstadt in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Wuppertal eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B1%8A%E6%A9%8B%E9%89%84%E9%81%93%E6%9D%B1%E7%94%B0%E6%9C%AC%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Toyohashi_Railroad%27s_tram_%22Odensha%22%2C_at_Hacchodori%2C_Toyohashi%2C_Aichi_%282015-02-11%29.JPG","page_title":"豊橋鉄道東田本線","context_page_description":"東田本線は、愛知県豊橋市の駅前停留場から赤岩口停留場までと、井原停留場から分岐し運動公園前停留場までを結ぶ豊橋鉄道の軌道路線である。豊橋鉄道では「豊鉄市内線」と案内している。本項目では廃止された柳生橋支線もあわせて取り上げる。"},{"page_url":"https://de.wikipedia.org/wiki/Welterbe_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Halberstadt_Blick_zum_Dom_von_Martinikirche.jpg","page_title":"Welterbe in Deutschland","context_page_description":"Zum Welterbe in Deutschland gehören 46 UNESCO-Welterbestätten, darunter 43 Stätten des Weltkulturerbes und 3 Stätten des Weltnaturerbes. Sechs dieser Stätten sind grenzüberschreitend oder transnational.\\nDie Bundesrepublik Deutschland hat die Welterbekonvention 1976 ratifiziert. Der Kaiserdom zu Aachen gehörte 1978 als einzige Stätte aus Deutschland zu den zwölf Welterbestätten, mit denen die Welterbeliste eröffnet wurde. Die Deutsche Demokratische Republik unterzeichnete den Vertrag 1988. Die für 1990 nominierten Schlösser und Gärten von Potsdam wurden bei der Sitzung im Dezember 1990, also bereits nach der Wiedervereinigung, gemeinsam mit Gebieten aus Berlin als Schlösser und Parks von Potsdam und Berlin in das Welterbe aufgenommen. Als bislang letzte Stätte in Deutschland wurden 2019 die Montanregion Erzgebirge sowie das Augsburger Wassermanagement-System in die Welterbeliste eingetragen. Deutschland ist das zweite und bislang letzte Land, in dem einer Stätte der Welterbetitel aberkannt wurde.\\nDie Anträge auf Nominierung einer Stätte zum UNESCO-Welterbe stellen in Deutschland die Bundesländer."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_bendera_kotamadya_di_wilayah_Ch%C5%ABbu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Flag_of_Former_Tonami_Toyama.JPG","page_title":"Daftar bendera kotamadya di wilayah Chūbu","context_page_description":"Halaman ini mengandung daftar bendera kotamadya di Chūbu, Jepang. Ini adalah bagian dari daftar bendera kotamadya di Jepang yang dibagi per wilayah karena jumlahnya banyak."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A4%D0%B5%D0%B3%D0%B5%D1%80%D1%81%D0%B0%D0%B9%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Fegersheim_StMaurice01.jpg","page_title":"Фегерсайм","context_page_description":"Фегерсайм — Францин гӀала-коммуна, лаьтта Гранд-Эст регионехь. Коммунан департамент — Лаха Рейн. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://no.wikipedia.org/wiki/Ordu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Ordu-osmanli-kotyora.jpg","page_title":"Ordu","context_page_description":"Ordu er en tyrkisk havneby som ligger ved en liten ved den østlige kysten av Svartehavet, og hovedstad for provinsen Ordu. Befolkning for 2012 var 147 913 innbyggere."},{"page_url":"https://en.wikipedia.org/wiki/Belarusian_ruble","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Belarus-1999-Bill-1000000-Reverse.jpg","page_title":"Belarusian ruble","context_page_description":"The Belarusian ruble or rouble is the official currency of Belarus. The ruble is subdivided into 100 copecks."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EC%B9%98%ED%95%98%EC%8B%9C_%EB%82%98%EA%B0%80%EB%A7%88%EC%82%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Ichihashi_Nagamasa.jpg","page_title":"이치하시 나가마사","context_page_description":"이치하시 나가마사는 아즈치모모야마 시대부터 에도 시대 전기까지의 무장, 다이묘이다. 에치고 산조 번 제2대 번주, 오미 니쇼지 번 초대 번주를 지냈다. 니쇼지 번 이치하시가 제2대 당주.\\n친부는 하야시 우에몬사에몬이며 그의 삼남으로 태어났다. 이치하시 나가카쓰는 나가마사의 외숙으로 어머니가 이치하시 나가토시의 딸이다. 그 인연으로 나가마사는 외숙 나가카쓰의 양자로 입적되었다."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B2%D0%B0%D0%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Ph_locator_biliran_naval.png","page_title":"Навал","context_page_description":"Навал — муніципалітет в провінції Біліран в регіоні Східні Вісаї на Філіппінах. Є адміністративним центром провінції. Згідно перепису 2015 року населення муніципалітету становило 54 692 особи."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%9F-%D7%A0%D7%90%D7%96%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Pont-Mindin.jpg","page_title":"סן-נאזר","context_page_description":"סן-נאזר היא עיר נמל במחוז הלואר האטלנטי במערב צרפת. בעיר, הנמצאת סמוך לשפך הלואר, שמונה ק\\"מ במעלה הזרם, נמצא בסמוך לנמל מבדוק יבש, מן החשובים מסוגו בעולם. בשל מיקומה סמוך לשפך הלואר וסמוך לחוף האוקיינוס האטלנטי, ובשל המתקנים אשר נבנו בה, במהלך ההיסטוריה, הייתה העיר, ועודנה, מרכז לדיג ולבניית ותחזוקת אוניות. במלחמת העולם השנייה נכבשה העיר על ידי הגרמנים, שהוסיפו למתקני הנמל והספנות הקיימים גם בסיס לצוללות. עקב כך, וכדי להוציא את מתקני הנמל והמבדוק מכלל פעולה, נערכה במהלך המלחמה הפשיטה על סן-נאזר. הפשיטה השיגה את מטרתה, אם כי תוך אבדות כבדות לפושטים. בהמשך המלחמה הופצצה העיר, בה המשיך לפעול מעגן הצוללות הגרמני, על ידי בעלות הברית, ונהרסה. העיר שוקמה אחרי המלחמה.\\nבעיר מתגוררים כ-75,000 תושבים."},{"page_url":"https://it.wikipedia.org/wiki/B%C3%A2rlad","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Barlad_jud_Vaslui.png","page_title":"Bârlad","context_page_description":"Bârlad è un municipio della Romania che, secondo l'Istituto di Statistica nel 2018, aveva una popolazione di 71 831 abitanti, ubicato nel distretto di Vaslui, nella regione storica della Moldavia."},{"page_url":"https://en.wikipedia.org/wiki/Indonesian_National_Police","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/PDH_BHARAKA_KOM.png","page_title":"Indonesian National Police","context_page_description":"The Indonesian National Police is the national police force of Indonesia. Founded on 1 July 1946, it was formerly a part of the country's military since 1962. The police were formally separated from the military on 1 April 1999 in a process which was formally completed on 1 July 2000.\\nThe organisation is now independent and is under the direct auspices of the President of Indonesia, while the Armed Forces is under the Ministry of Defense. The Indonesian National Police is responsible for law enforcement and policing duties all over Indonesia. The organisation is widely known for its corruption, violence and incompetence.\\nThe Indonesian National Police also takes part in international United Nations missions, and after special training, provided security for the UNAMID mission to protect internally-displaced people in Darfur.\\nThe strength of the Indonesian National Police stood at approximately 387,470 in 2011 and the number is increasing every year. It also includes up-to 12,000 water police personnel and an estimated 40,000 People's Security trainees who serve as a police auxiliary and report for three weeks of basic training each year."},{"page_url":"https://da.wikipedia.org/wiki/Kap_Roca","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Cabo_da_Roca_-_Sintra_-_060415_19.JPG","page_title":"Kap Roca","context_page_description":"Kap Roca er navnet på det vestligste punkt på det europæiske fastland – et forrevet klippe-forbjerg på den portugisiske atlanterhavskyst i kommunen Sintra, ca. 32 km vest for Lissabon og 12 km nordvest for Cascais. Navnet betyder “Klippens pynt” på portugisisk, og blev af romerne betegnet Promontorium Magnum og i søfarertiden som Lissabons klippe.\\nPå stedet findes et monument med en plade, der beskriver positionen som: 38° 47' N og 9° 30' W samt højden 140 meter over middelhavniveau. Den pænt afrundede koordinat ligger dog 333 m længere mod nordvest, ude i vandet. Monumentet bærer også inskriptionen:\\n“Aqui... Onde a terra acaba e o mar começa...”\\n“Her... hvor landet ender og havet begynder...” – 1600-tals digteren Luís de Camões beskrivelse af stedet.\\nUdover monumentet, findes der også et turistkontor/souvenirbutik, en bar, samt i den mere seriøse afdeling, et fyrtårn og en havradiosender."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%8A%D9%81%D9%88%D9%86_%D9%83%D8%A7%D8%BA%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Yvonne_Cagle.jpg","page_title":"إيفون كاغل","context_page_description":"إيفون دارلين كاغل ‏، رائدة فضاء من الولايات المتحدة، تعمل في ناسا. ولدت في 24 نيسان 1959."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D8%B1%DA%A4%D9%88%D8%B1%D8%B3%D9%83%D9%89_%D9%84%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Jorvorskie_Lane_2006.jpg","page_title":"چورڤورسكى لان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچورڤورسكى لان لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://it.wikipedia.org/wiki/Sahuaripa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/PresaGuisamopa.jpg","page_title":"Sahuaripa","context_page_description":"Sahuaripa è una municipalità dello stato di Sonora nel Messico settentrionale, il cui capoluogo è la località omonima.\\nConta 5.626 abitanti e ha una estensione di 5.064,46 km².\\nIl nome della località in lingua opata significa formica gialla."},{"page_url":"https://de.wikipedia.org/wiki/Wervicq-Sud","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/WervicqSudEglise.JPG","page_title":"Wervicq-Sud","context_page_description":"Wervicq-Sud ist eine französische Gemeinde mit 5413 Einwohnern im Département Nord in der Region Hauts-de-France. Sie gehört zum Arrondissement Lille und ist Teil des Kantons Lambersart. Die Einwohner werden Wervicquois genannt."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_americk%C3%BDch_eskortn%C3%ADch_letadlov%C3%BDch_lod%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/USS_Cape_Gloucester_%28CVE-109%29_off_Vasmon_Island_in_March_1945.jpg","page_title":"Seznam amerických eskortních letadlových lodí","context_page_description":"Seznam amerických eskortních letadlových lodí obsahuje přehled všech eskortních letadlových lodí Námořnictva Spojených států, které jsou seřazeny podle čísel klasifikačního symbolu trupu."},{"page_url":"https://eu.wikipedia.org/wiki/Trimble_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Trimble_municipal_building_from_northwest.jpg","page_title":"Trimble (Ohio)","context_page_description":"Trimble Ohioko herri bat da. Athens konderrian kokatua dago. 2010ean 390 biztanle zituen, 1,72 kilometro koadrotan banatuta."},{"page_url":"https://it.wikipedia.org/wiki/U.S._Route_66","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/KingmanArizonaRoute66Tower.jpg","page_title":"U.S. Route 66","context_page_description":"La United States Route 66, meglio nota come Route 66 o Strada Madre, fu una highway statunitense, aperta l'11 novembre 1926, una delle prime highway federali, che originariamente collegava Chicago alla spiaggia di Santa Monica attraversando gli stati di Illinois, Missouri, Kansas, Oklahoma, Texas, Nuovo Messico, Arizona e California, su una distanza complessiva di 3755 km.\\nUsata per la migrazione verso ovest, specialmente durante il dust bowl, supportò l'economia delle comunità attraverso le quali passava: le popolazioni prosperarono per la crescente popolarità della strada, ed alcune di queste combatterono tenacemente per tenerla in vita dopo la nascita del nuovo Interstate Highway System, ma fu ufficialmente rimossa dal sistema delle highway nel 1985, quando assieme alle altre fu rimpiazzata dallo Interstate Highway System. La strada esiste attualmente con il nome di historic Route 66 ed è così tornata sulle mappe in questa veste."},{"page_url":"https://en.wikipedia.org/wiki/Oliver_Hill_(architect)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Moor_Close%2C_Newbold_College%2C_Binfield.jpg","page_title":"Oliver Hill (architect)","context_page_description":"Oliver Falvey Hill was a British architect, landscape architect, and garden designer. Starting as a follower of Edwin Lutyens, in the 1920s he gained a reputation as a designer of country houses. He turned towards architectural modernism in the 1930s, though in doing so he did not abandon his appreciation of natural materials. His plans made abundant use of curving lines. He also became known for luxurious interior decoration. Hill was the architect of the Midland Hotel in Morecambe, Lancashire and of the British pavilion at the Paris Exposition of 1937."},{"page_url":"https://de.wikipedia.org/wiki/Hohhot","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Hohhot_Old_Town.jpg","page_title":"Hohhot","context_page_description":"Hohhot ist die Hauptstadt des Autonomen Gebietes Innere Mongolei in der Volksrepublik China. Der Name der Stadt ist mongolisch und bedeutet Blaue Stadt; die chinesische Übersetzung lässt jedoch auch andere Farben zu, daher erklärt sich die teilweise genutzte Bezeichnung Grüne Stadt seitens der Chinesen.\\nDas Verwaltungsgebiet der Stadt Hohhot hat eine Gesamtfläche von 17.271 km² und 2,27 Millionen Einwohner. Daraus ergibt sich eine Bevölkerungsdichte von 124 Einwohnern je km²."},{"page_url":"https://sh.wikipedia.org/wiki/Guazzora,_Alessandria","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/GuazzoraBorgo1.jpg","page_title":"Guazzora, Alessandria","context_page_description":"Guazzora je naselje u Italiji u provinciji Alessandria, u regiji Piemonte.\\nPrema proceni iz 2011. u naselju je živelo 308 stanovnika. Naselje se nalazi na nadmorskoj visini od 75 m."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%B3%D1%81%D0%B1%D1%83%D1%80%D0%B3_(%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Lage_des_Landkreises_Ludwigsburg_in_Deutschland.PNG","page_title":"Людвигсбург (район)","context_page_description":"Людвигсбург — район в Германии. Центр района — город Людвигсбург. Район входит в землю Баден-Вюртемберг. Подчинён административному округу Штутгарт. Занимает площадь 686,82 км². Население — 513 819 чел. Плотность населения — 748 человек/км².\\nОфициальный код района — 08 1 18.\\nРайон подразделяется на 39 общин."},{"page_url":"https://nn.wikipedia.org/wiki/Kalsitt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Calcite_ShortwaveUV_HAGAM.jpg","page_title":"Kalsitt","context_page_description":"Kalsitt eller kalkspat er eit mineral som består av kalsiumkarbonat, CaCO₃. Det er eit av dei vanlegaste minerala i jordskorpa. Under den kjemiske formelen inngår òg aragonitt. Kalsitt kan vere bergartsdannande og vert då kalla kalkstein eller marmor. Han finst i organismar med kalkskal som til dømes muslingar, korallar, foraminiferar og trilobittar. Kalsitt er eit vanlig mineral og er fargelaust, eller farga av ureinleikar. Skalenoedriske, romboedriske og prismatiske former opptrer i kombinasjonar. Det har ein seksida avsluttande pyramideform. Krystallar opptrer med breie, flate ender, eller med lange tynne spissar. Kalsitt er ofte korna eller massiv. Det er ein bestanddel i kalksteinsmarmorar og andre sedimentære og metamorfe førekomstar, og det finst i hydrotermale gangar og magmatiske bergartar."},{"page_url":"https://en.wikipedia.org/wiki/Say_My_Name","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Michelle_Williams_-_The_Drama_League_%28PNG%29.png","page_title":"Say My Name","context_page_description":"\\"Say My Name\\" is a song by the American girl group Destiny's Child from their second studio album The Writing's on the Wall. It was written by Beyoncé Knowles, LeToya Luckett, LaTavia Roberson and Kelly Rowland along with LaShawn Daniels, Fred Jerkins III and Rodney \\"Darkchild\\" Jerkins, featuring production by the latter.\\nThe song was released by Columbia Records as the album's third single on November 7, 1999, and marked the introduction of the group's second line-up with the newly-added members Michelle Williams and Farrah Franklin. The single is the most successful of the four releases from the album.\\n\\"Say My Name\\" won two Grammy Awards at the 2001 ceremony, for Best R&B Performance by a Duo or Group with Vocals and Best R&B Song, while also nominated for Record of the Year and Song of the Year. The single's music video won the 2000 MTV Video Music Award for Best R&B Video. It also won a Soul Train Lady of Soul Award for Best R&B/Soul Single, Group, Band or Duo along with a BMI Pop Award for Most Played Song. Billboard named the song number seven on their list of 100 Greatest Girl Group Songs of All Time and the best song of 2000."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%AD%E5%A4%AE%E8%97%9D%E8%A1%93%E5%9D%8A%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/KJ_Line_Pasar_Seni_Entrance_4.jpg","page_title":"中央藝術坊站","context_page_description":"中央藝術坊站位於馬來西亞吉隆坡市中心的巴生河旁，是吉隆坡 格拉那再也線與雙溪毛糯－加影線的轉換站。本站周圍有中央藝術坊、國家郵政局、宏圖大廈和吉隆坡的唐人街茨廠街，每日使用人次眾多。\\n本站屬於 格拉那再也線第一階段線路，於1998年9月1日開始運營，而雙溪毛糯－加影線站台則於2017年7月17日開始通行。兩個車站之間設有行人天橋銜接兩站的付費區通道，使乘客能直接進行站內換乘。\\n400米附近有一個通勤鐵路站 KA02 吉隆坡站，可以轉乘至芙蓉線和巴生港線的其他車站。中央藝術坊巴士站就位於車站對面，是快捷通巴士和GO吉隆坡城巴的主要停靠站點之一，許多來往雪隆區域的巴士皆會以此為出發點。"},{"page_url":"https://de.wikipedia.org/wiki/Kanton_Chocaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Atocha_Klimadiagramm.png","page_title":"Kanton Chocaya","context_page_description":"Der Kanton Chocaya ist ein Gemeindebezirk im Departamento Potosí im Hochland des südamerikanischen Anden-Staates Bolivien."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%BE%D0%BF%D0%B0_%D0%9A%D0%BB%D0%B8%D0%BD%D0%BA%D0%B0_(8-%D0%B9_%D1%8D%D1%82%D0%B0%D0%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Klingenpfad_%288th_stage%29%28V-28%29.jpg","page_title":"Тропа Клинка (8-й этап)","context_page_description":"Тропа клинка — круговой маркированный многодневный пешеходный маршрут вокруг города Золинген, проложенный в 1933—1935 годах. Восьмой этап маршрута, протяжённостью 7,2 км проходит между парком Энгельсбергер Хоф Олигской пустоши и хутором Хайдбергер Мюле в междуречье Вуппера и Иттербаха."},{"page_url":"https://en.wikipedia.org/wiki/United_States_congressional_delegations_from_Montana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Steve_Daines%2C_official_portrait%2C_113th_Congress.jpg","page_title":"United States congressional delegations from Montana","context_page_description":"Since Montana became a U.S. state in 1889, it has sent congressional delegations to the United States Senate and the United States House of Representatives. Each state elects two senators to serve for six years. Before the Seventeenth Amendment took effect in 1913, senators were elected by the Montana State Legislature. Members of the House of Representatives are elected to two-year terms, one from Montana's at-large congressional district. Before becoming a state, the Territory of Montana elected a non-voting delegate at-large to Congress from 1864 to 1889.\\nA total of 54 people have served either the Territory or State of Montana: 17 in the Senate, 32 in the House, and five in both houses. The longest-serving senator is Max Baucus, in office from 1978 to 2014. The longest-serving representative is Pat Williams, in office for 18 years from 1979 to 1997. One woman has been a member of Montana's congressional delegation, Jeannette Rankin, as a representative. She was the first woman in the United States Congress."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9ho_Tom%C3%A1%C5%A1e_Akvinsk%C3%A9ho_(Pa%C5%99%C3%AD%C5%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/%C3%89glise_Saint-Thomas-d%27Aquin_%28Paris%29_1.jpg","page_title":"Kostel svatého Tomáše Akvinského (Paříž)","context_page_description":"Kostel svatého Tomáše Akvinského je katolický farní kostel v 7. obvodu v Paříži na náměstí Place Saint-Thomas-d’Aquin mezi ulicemi Rue du Bac a Boulevard Saint-Germain."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_(%C3%A9difice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Paray_le_M_apsidy_zvenku_DSCN1130.JPG","page_title":"Église (édifice)","context_page_description":"Une église est un édifice religieux dont le rôle principal est de faciliter le rassemblement d'une communauté chrétienne. Son érection est commanditée par le clergé, financée par les dons ou les dîmes imposées aux laïcs, réalisée par les artistes et artisans. Sa construction obéit à un ordonnancement architectural évoluant au fil des siècles selon son importance et sa fonction. Son entretien est dévolu au pouvoir religieux ou aux pouvoirs publics selon les pays et la conservation des plus remarquables est prise en charge au titre des différentes politiques de protection du patrimoine culturel."},{"page_url":"https://pt.wikipedia.org/wiki/Yong-pal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/LG_%EC%98%B5%ED%8B%B0%EB%A8%B8%EC%8A%A4_3D_%26_LG_%EC%8B%9C%EB%84%A4%EB%A7%88_3D_TV_CF_%EC%B4%AC%EC%98%81_%EC%82%AC%EC%A7%84_%28cropped%29.jpg","page_title":"Yong-pal","context_page_description":"Yong-pal é uma série de televisão sul-coreana que foi transmitida pela SBS entre 5 de agosto e 1 de outubro de 2015. Foi protagonizada por Joo Won, Kim Tae-hee, Chae Jung-an e Jo Hyun-jae."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D6%80%D6%87%D5%B4%D5%BF%D5%A1%D5%A1%D6%86%D6%80%D5%AB%D5%AF%D5%B5%D5%A1%D5%B6_%D6%86%D5%B8%D6%82%D5%B6%D5%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/West_Africa_Currency_Board_20s_1953.JPG","page_title":"Արևմտաաֆրիկյան ֆունտ","context_page_description":"Արևմտաաֆրիկյան ֆունտ, արժութային միավոր Բրիտանական Արևմտյան Աֆրիկայում 1913-1961 թվականներին։ Որպես ազգային արժույթ 1957-1958 թվականներին օգտագործվել է Գանայում, 1913-1944 թվականներին՝ Լիբերիայում, իսկ Սիերա Լեոնեում կիրառվել է 1961-1963 թվականներին։"},{"page_url":"https://sv.wikipedia.org/wiki/Lilla_Edets_kraftverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Lilla_edet_kraftstation%2C_vy_fr%C3%A5n_p%C3%A5_dammen.jpg","page_title":"Lilla Edets kraftverk","context_page_description":"Lilla Edets kraftverk i Göta älv vid Lilla Edet. Det började byggas 1918 och invigdes 1926. Det hade då tre vertikala aggregat."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Stadtbezirk_M%C3%BCnster-Mitte","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Sentmaringer_Weg_16_Wohnhaus_A_IMG_2864.jpg","page_title":"Liste der Baudenkmäler im Stadtbezirk Münster-Mitte","context_page_description":"Die Liste der Baudenkmäler im Stadtbezirk Münster-Mitte enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Stadtbezirks Münster-Mitte in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Münster eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nDiese Teilliste umfasst bisher die Straßennamen von A bis S.\\nDie Denkmale der Altstadt wurden ausgelagert in eine eigene Liste.\\n→ Siehe dazu auch:\\nListe der Baudenkmäler in Münster\\nListe der Baudenkmäler im Stadtteil Münster-Altstadt\\nListe der Baudenkmäler im Stadtbezirk Münster-West\\nListe der Baudenkmäler im Stadtbezirk Münster-Nord\\nListe der Baudenkmäler im Stadtbezirk Münster-Ost\\nListe der Baudenkmäler im Stadtbezirk Münster-Süd-Ost\\nListe der Baudenkmäler im Stadtbezirk Münster-Hiltrup"},{"page_url":"https://id.wikipedia.org/wiki/Pencak_silat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Persaudaraan_Setia_Hati_Terate_-_Jongkok_saat_pembukaan.jpg","page_title":"Pencak silat","context_page_description":"Pencak silat atau silat adalah suatu seni bela diri tradisional yang berasal dari Kepulauan Nusantara. Seni bela diri ini secara luas dikenal di Indonesia, Malaysia, Brunei, dan Singapura, Filipina selatan, dan Thailand selatan sesuai dengan penyebaran berbagai suku bangsa Nusantara.\\nBerkat peranan para pelatih asal Indonesia, kini Vietnam juga telah memiliki pesilat-pesilat yang tangguh. Induk organisasi pencak silat di Indonesia adalah Ikatan Pencak Silat Indonesia. Organisasi yang mewadahi federasi-federasi pencak silat di berbagai negara adalah Persekutuan Pencak Silat Antara Bangsa, yang dibentuk oleh Indonesia, Singapura, Malaysia dan Brunei Darussalam.\\nPencak silat adalah olahraga bela diri yang memerlukan banyak konsentrasi. Ada pengaruh budaya Cina, agama Hindu, Budha, dan Islam dalam pencak silat. Biasanya setiap daerah di Indonesia mempunyai aliran pencak silat yang khas. Misalnya, daerah Jawa Barat terkenal dengan aliran Cimande dan Cikalong, di Jawa Tengah ada aliran Merpati Putih dan di Jawa Timur ada aliran Perisai Diri.\\nSetiap empat tahun di Indonesia ada pertandingan pencak silat tingkat nasional dalam Pekan Olahraga Nasional."},{"page_url":"https://sv.wikipedia.org/wiki/Antarctic_(fartyg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Antarctic_1.png","page_title":"Antarctic (fartyg)","context_page_description":"Antarctic var ett svenskt expeditionsfartyg som användes under flera svenska forskningsresor till Arktis och Antarktis åren 1898 till 1903. Från \\"Antarctic\\" genomfördes 1895 den första dokumenterade landstigningen på Fastlandsantarktis."},{"page_url":"https://sh.wikipedia.org/wiki/Issam_Tej","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Issam_Tej_20141203_2.jpg","page_title":"Issam Tej","context_page_description":"Issam Tej je tuniski rukometaš i bivši reprezentativac koji igra kao pivot za francuski US Créteil. Uz Wissema Hmama, Tej se smatra jednim od najboljih tuniskih rukometaša u historiji.\\nKarijeru je započeo u Tunisu, odakle je 2003. otišao u Francusku, prvo u SC Sélestat Handball, a onda u Montpellier HB. U devet godina igranja za Montpellier, Tej je izgradio svoj ugled i bio jedan od glavnih igrača momčadi koja je godinama dominirala francuskim rukometom. Godine 2015. potpisao je za El Jaish SC, gdje je igrao do 2017. godine, kada prelazi u US Créteil.\\nZa reprezentaciju nastupa od 1999. godine te je sudjelovao na seriji međunarodnih natjecanja, među kojima su i Svjetsko prvenstvu u Tunisu 2005. godine te olimpijski turniri 2000., 2012. i 2016. godine."},{"page_url":"https://nl.wikipedia.org/wiki/Nykvarn_(plaats)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Nykvarn_CityHall.JPG","page_title":"Nykvarn (plaats)","context_page_description":"Nykvarn is de hoofdplaats van de gemeente Nykvarn in het landschap Södermanland en de provincie Stockholms län in Zweden. De plaats heeft 6032 inwoners en een oppervlakte van 433 hectare.\\nDe plaats ligt vlak bij de Europese weg 20. Ook loopt de spoorweg Svealandsbanan door de plaats."},{"page_url":"https://en.wikipedia.org/wiki/Mini_Moke","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/%2767_Austin_Mini_Moke_%28Ottawa_British_Car_Show_%2710%29.jpg","page_title":"Mini Moke","context_page_description":"The Mini Moke is a small, front-drive utility and recreational convertible, manufactured and marketed originally by British Motor Corporation, and subsequently marketed under the Austin, Morris and Leyland brands.\\nDesigned by Sir Alec Issigonis and John Sheppard, the Mini Moke is noted for its simple, straightforward, doorless design, and its adaptability. Originally prototyped as a lightweight military vehicle using the engine, transmission and suspension parts from the Mini van, the design's small wheels and low ground clearance made it unsuitable as an off road military vehicle. The design was subsequently offered in civilian form as a low-cost, easily maintained vehicle, achieving global popularity as a lightweight, recreational and utility vehicle.\\nThe first Mokes were manufactured at BMC's Longbridge, Birmingham plant, with 14,518 produced in the UK between 1964 and 1968. 26,000 were manufactured in Australia between 1966 and 1981, and 10,000 in Portugal between 1980 and 1993 when production ended.\\nThe name combines Mini with Moke, an archaic term for \\"mule\\"."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%A9la_R%C3%A9v%C3%A9sz_(Schriftsteller)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Tihanyi_Portrait_of_B%C3%A9la_R%C3%A9v%C3%A9sz.jpg","page_title":"Béla Révész (Schriftsteller)","context_page_description":"Béla Révész war ein ungarischer Schriftsteller."},{"page_url":"https://no.wikipedia.org/wiki/Radior%C3%B8r","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Pentode-Symbol_de.svg","page_title":"Radiorør","context_page_description":"Med et radiorør menes en elektronisk komponent med minst to hovedtilkoplinger. Disse kalles alltid katode og anode. Radiorøret kan lede elektrisk strøm fra anoden til katoden. Bortsett fra i noen eksotiske utgaver varmes katoden opp slik at den avgir elektroner som virker som ladningsbærere for strømledningen. Elektrodene befinner seg i et vakuum slik at luftmolekyler ikke forstyrrer ledningsprosessen og katoden ikke bombarderes med molekyler eller ioner. Kolben er oftest laget av glass som er rørformet, derav navnet rør. Katoden varmes alltid opp ved hjelp av en elektrisk strøm gjennom en metalltråd, kalt glødetråden eller filamentet. Tråden selv kan danne katoden, eller glødetråden omgis av en elektrisk isolert metallsylinder som mottar varmeenergien.\\nDet enkleste radiorøret er dioden. Navnet er gitt av de to tilkoplingene anode og katode. Navnet er sammensatt av de greske ordene di = 'to', og ode som betyr 'vei'. Betegnelsen likeretter for en diode er også i bruk, hovedsakelig for kraftbetraktning, i motsetning til diode for signalbetraktning."},{"page_url":"https://en.wikipedia.org/wiki/International_E-road_network","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/European_Highways_UK-EI.png","page_title":"International E-road network","context_page_description":"The international E-road network is a numbering system for roads in Europe developed by the United Nations Economic Commission for Europe. The network is numbered from E1 up and its roads cross national borders. It also reaches Central Asian countries like Kyrgyzstan, since they are members of the UNECE.\\nEuropean main international traffic arteries are defined by ECE/TRANS/SC.1/2016/3/Rev.1 which consider three types of roads: motorways, express roads, and ordinary roads.\\nIn most countries, the roads carry the European route designation alongside national designations. Belgium, Norway and Sweden have roads which only have the European route designations. The United Kingdom only uses national road designations and does not show the European designations at all. Denmark only uses the European designations on signage, but also has formal names for every motorway, by which the motorways are referred to, for instance in news and weather forecasts.\\nOther continents have similar international road networks, e.g., the Pan-American Highway in the Americas, the Trans-African Highway network, and the Asian Highway Network."},{"page_url":"https://sh.wikipedia.org/wiki/Chesterville,_Ohio","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/OHMap-doton-Chesterville.png","page_title":"Chesterville, Ohio","context_page_description":"Čestervil je grad u američkoj saveznoj državi Ohajo."},{"page_url":"https://et.wikipedia.org/wiki/Edise_vasallilinnus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Edise_linnuse_asendiplaan.jpg","page_title":"Edise vasallilinnus","context_page_description":"Edise vasallilinnus oli vasallilinnus Edise külas, Jõhvi kihelkonnas, Virumaal.\\nTänapäevase haldusjaotuse järgi asuvad linnuse varemed Ida-Viru maakonnas Jõhvi vallas."},{"page_url":"https://fr.wikipedia.org/wiki/Fortin_de_Port_Maria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Ancienne_batterie_de_Port-Maria.JPG","page_title":"Fortin de Port Maria","context_page_description":"Le fort de Port Maria est un ensemble de fortifications du XVIIᵉ siècle défendant la ria de Port Maria sur la commune de Locmaria, constituant un élément de défense de Belle-Île-en-Mer dans le Morbihan."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E9%95%B7%E5%AE%89%E6%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/%E6%96%B0%E9%95%B7%E5%AE%89%E6%A9%8BIMG_3145.JPG","page_title":"新長安橋","context_page_description":"新長安橋為新北市汐止區連接基隆河南北兩岸的一座橋梁。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D0%BA%D0%B0%D0%B4%D1%81%D0%BA%D0%B5_%D0%BF%D0%BB%D0%B0%D0%BD%D0%B8%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Cascaderangemap.jpg","page_title":"Каскадске планине","context_page_description":"Каскадске планине су део Пацифичког планинског система на западу Северне Америке. Каскадске планине се простиру више од 1.100 km од планине Ласен у северној Калифорнији, кроз Орегон и Вашингтон до ушћа реке Фрејзер - југ Британске Колумбије, Канада. Многи врхови прелазе 3.000. m, као што су Худ 3.426 m, највиша тачка у Орегону, Шаста 4.321 м. у Калифорнији, Рејнир 4.392 највиши врх у Вашингтону и целим Каскадским планинама и др. Део ланца који се простире у Канадску државу Британска Колумбија нема значајних врхова, највише се уздижу до 2.440 m. Већина врхова су угашени вулкани, али у блиској прошлости Ласен 3.187 м. и неколико других планина показивала су извесну активност. Бејкер 3.285 м., Сент Хеленс 2.550 m. Од Тихог океана су удаљене око 160 до 240 km. Својим положајем мењају климатске услове на западу САД, спречавајући продоре влажних ваздушних маса са Пацифика, што доводи до смањења количине падавина у источним територијама."},{"page_url":"https://es.wikipedia.org/wiki/W._E._B._Du_Bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Congregational_Church%2C_Great_Barrington%2C_MA.jpg","page_title":"W. E. B. Du Bois","context_page_description":"William Edward Burghardt Du Bois fue un sociólogo, historiador, activista por los derechos civiles, panafricanista, autor y editor estadounidense. Nacido en Massachusetts, Du Bois creció en una comunidad tolerante y respetuosa, pero aun así experimentó racismo durante su infancia. Después de graduarse en Harvard, donde es el primer afroestadounidense en obtener un doctorado en filosofía, se convierte en profesor de historia, sociología y economía en la Universidad de Atlanta. Du Bois también fue uno de los cofundadores de la Asociación Nacional para el Progreso de las Personas de Color en 1909.\\nAlcanzó prominencia nacional cuando fue designado líder del Movimiento Niágara, un grupo de activistas afroestadounidenses que buscaban la igualdad de derechos para los negros. Du Bois y sus partidarios se opusieron al compromiso de Atlanta de Booker T. Washington, un acuerdo que estipulaba que los negros del sur trabajarían y se someterían ante la dominación política blanca, mientras los blancos del sur les garantizaban el recibimiento de oportunidades educativas y económicas básicas."},{"page_url":"https://de.wikipedia.org/wiki/Uljanowka_(Leningrad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Ulyanovka.JPG","page_title":"Uljanowka (Leningrad)","context_page_description":"Uljanowka ist eine Siedlung städtischen Typs in der Oblast Leningrad mit 11.601 Einwohnern."},{"page_url":"https://en.wikipedia.org/wiki/Minnesota_State_Capitol","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/1stMNstatecapitol-1860.jpg","page_title":"Minnesota State Capitol","context_page_description":"The Minnesota State Capitol is the seat of government for the U.S. state of Minnesota, in its capital city of Saint Paul. It houses the Minnesota Senate, Minnesota House of Representatives, the office of the Attorney General and the office of the Governor. The building also includes a chamber for the Minnesota Supreme Court, although court activities usually take place in the neighboring Minnesota Judicial Center.\\nThe building is set in a landscaped campus. Various monuments are to its sides and front. Behind, a bridge spans University Avenue, and in front others were later added over the sunken roadway of Interstate 94, thus preserving the sight lines. Set near the crest of a hill, from the Capitol steps a panoramic view of downtown Saint Paul is presented."},{"page_url":"https://ro.wikipedia.org/wiki/Co%C8%9Bofan%C4%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Sroka_Pica_Pica_II.jpg","page_title":"Coțofană","context_page_description":"Coțofana este o specie de păsări din familia Corvidae. Este răspândită în Eurasia, Africa de Nord și America de Nord. Locul unde poate fi întâlnită cel mai frecvent este Europa. Din cauza penajului său caracteristic, alb cu negru, este ușor recunoscută chiar de cei care nu sunt foarte buni cunoscători de păsări. În mitologia germană, coțofana era solul zeilor, sau era considerată zeița morții „Hel”, iar în alte culturi europene fiind considerată pasărea care este solul ce aduce nenoroc. Din cauza faptului că fură mai ales lucrurile care lucesc era temută, fiind considerată în evul mediu pasărea vrăjitoarelor sau a celor certați cu legea. În Asia, în contrast cu Europa, era considerată aducătoare de noroc și amerindienii o considerau un duh, prieten al oamenilor."},{"page_url":"https://de.wikipedia.org/wiki/ASV_Hamm_04/69_Handball","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/ASV-Hamm.jpg","page_title":"ASV Hamm 04/69 Handball","context_page_description":"Der ASV Hamm-Westfalen e.V. ist ein Handballverein aus der Stadt Hamm in Nordrhein-Westfalen. Der ASV ist der klassenhöchste Verein der Lippestadt. Der ASV Hamm-Westfalen ist Inhaber der Spielberechtigung für den Handball-Bundesligisten Handballspielgemeinschaft Ahlen-Hamm in der Saison 2010/11 gewesen und tritt seit der Saison 2011/12 als ASV Hamm-Westfalen in der 2. Handball-Bundesliga an. Spielort der Mannschaft ist die Westpress-Arena in Hamm."},{"page_url":"https://nl.wikipedia.org/wiki/Rwandese_Genocide","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Nyamata_Memorial_Site_13.jpg","page_title":"Rwandese Genocide","context_page_description":"De Rwandese Genocide was een volkerenmoord die in 1994 plaatsvond in het Afrikaanse land Rwanda. Gedurende deze genocide werden naar schatting 500.000 tot 1 miljoen Tutsi's en gematigde Hutu's in een periode van 100 dagen, van 7 april tot 15 juli 1994, vermoord. De meeste moorden werden gepleegd door twee Hutu-milities, de Interahamwe, een jeugdmilitie van regeringspartij MRND, en de Impuzamugambi van de extremistische splinterpartij CDR.\\nDe internationale vredesmacht die in de regio gestationeerd was, UNAMIR, greep niet in vanwege het krappe mandaat van de troepen. Dit is de Verenigde Naties en vooral de leden van de Veiligheidsraad op veel kritiek komen te staan.\\nDe genocide werd gestopt door de Tutsi-rebellenbeweging bekend als het Rwandees Patriottisch Front, geleid door Paul Kagame. Na de overwinning van het RPF werd Kagame vicepresident en minister van Defensie. Sinds 2000 is hij president van Rwanda."},{"page_url":"https://en.wikipedia.org/wiki/List_of_colonial_buildings_in_Bandung","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/COLLECTIE_TROPENMUSEUM_Straatgezicht_in_Bandoeng_met_onder_meer_het_pand_van_Commissionairs_J.R._de_Vries_en_Co_TMnr_10014697.jpg","page_title":"List of colonial buildings in Bandung","context_page_description":"Colonial buildings in Bandung include those that were constructed during the Dutch colonial period of Indonesia. The period started with the founding of Bandung in the beginning of the 20th century, which is relatively young compared to other Indonesian cities. The list is divided into the colonial architectural styles: Traditionalism, Dutch Rationalism, and Modernism.\\nColonial architecture in Bandung is dominated with Modernist architecture, apparent in buildings such as civic buildings and offices. Bandung contains one of the largest remaining collections of Modernist building in the world. European city planning based on garden city concept were implemented in the north part of Bandung, which is still apparent today in the architecture of the residences and villas. Most buildings in Bandung are designed by architects who lived and worked in Bandung, many of them were educated in The Netherlands. Some of the architecture were influenced with Indonesian architecture, and also North-American and British-Indies influences in the Modern architecture of pre-independent Indonesia.\\nBelow is a list of colonial buildings found in Bandung."},{"page_url":"https://de.wikipedia.org/wiki/Kleinballhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Ballhausen_-_St.-Aegidien-Kirche.jpg","page_title":"Kleinballhausen","context_page_description":"Kleinballhausen ist ein Ortsteil der Gemeinde Ballhausen im Unstrut-Hainich-Kreis in Thüringen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B7%D9%8A%D9%88%D9%86_%D8%AC%D8%A8%D9%84%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Inula_montana_general_vue.JPG","page_title":"طيون جبلي","context_page_description":"الطيون الجبلي نوع نباتي ينتمي إلى جنس الطيون من الفصيلة النجمية."},{"page_url":"https://en.wikipedia.org/wiki/Motor_Row_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Motor_Row_Historic_District_G_Chicago_IL.jpg","page_title":"Motor Row District","context_page_description":"The Motor Row District is a historic district in Chicago's Near South Side community area. Motor Row includes buildings on Michigan Avenue between 2200 and 2500 south, directly west of McCormick Place convention center, and 1444, 1454, 1737, 1925, 2000 S. Michigan Ave., as well as 2246-3453 S. Indiana Ave., and 2211-47 S. Wabash Ave. The district was built between 1905 and 1936 by a number of notable architects.\\nAuto rows developed in numerous US cities shortly after 1900 as car companies sought to create districts where the sale and repair of cars could become an easy urban shopping experience. At its peak, as many as 116 different makes of automobiles were sold and repaired on Motor Row. Current-day marques that formerly had showrooms on Motor Row included Ford, Buick, Fiat, and Cadillac. Other marques with showrooms there that have since dissolved include Hudson, Locomobile, Marmon, and Pierce-Arrow. Currently, only one car dealer still stands in Motor Row while the remaining buildings have been or are being redeveloped into condominiums, nightclubs, and retail storefronts."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Oklahoma_K%C5%ABn_(Oklahoma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Oklahoma_City_OK_Oklahoma_County_Courthouse_%28Taken_20120926%29.jpg","page_title":"Oklahoma Kūn (Oklahoma)","context_page_description":"Oklahoma Kūn sī Bí-kok Oklahoma chiu ê kūn, ū jîn-kháu 755245."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BD_(%D0%BF%D0%B0%D0%BF%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Linus_primi.jpg","page_title":"Лин (папа)","context_page_description":"Лин — җитмеш апостолның берсе. Безнең чорның 67 — 76 елларында Рим шәһәренең икенче епискобы.\\nЛин Яңа Гаһедтә искә алынган өч Рим папасының берсе. Шулай ук Рәсүл Паулның Тимутәйгә икенче хатында искә алына, монда аның Паулның соңгы көннәрендә аның белән бергә Римда булуы хәбәр ителә."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BF%D0%BE%D0%BB%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Edward_Gennys_Fanshawe%2C_Apia_Bay%2C_Upolu%2C_Navigators%27_Islands_%28Samoa%29_Septr_18th_1849.jpg","page_title":"Уполу","context_page_description":"Уполу — острів архіпелагу Самоа в Полінезії, утворений масивним базальтовим щитовим вулканом, який підіймається з океанського дна в південній частині Тихого океану."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A9%D7%9C%D7%99_%D7%99%D7%A9%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Champaigne_shepherd.jpg","page_title":"משלי ישו","context_page_description":"את משלי ישו ניתן למצוא בכל הבשורות, מלבד בבשורת יוחנן ובחלק מהבשורות הלא-קנוניות, אך הם מופיעים בעיקר במסגרת שלוש הבשורות הסינופטיות. המשלים מייצגים חלק נכבד מהבשורה והלימוד שישו לימד: יחד הם יוצרים כשליש מתורתו הכתובה. בנצרות מושם דגש ניכר על משלים אלה, מאחר שהם מיוחסים לישו, באמונה שהם מייצגים את דבר אלוהים, כפי שהודגש בבשורת יוחנן ח' 28, ובפרק י\\"ד, 10.\\nרבים ממשלי ישו כתובים בפשטות. המשלים הם סיפורים שלא בנקל ניתן לשכוח אותם, לעתים קרובות הם מכילים דימויים, שכולם מאופיינים בהעברת מסרים משמעותיים. מלומדים שונים ציינו שעל אף שמשלים אלה נראים כפשוטים, המסרים שהם מעבירים, הם בעלי משמעות עמוקה, ותופסים מקום נכבד בתורתו ובשורתו של ישו. פרשנים נוצריים שונים טוענים שהם לא רק משרתים את הנמשל, אלא גם את עצם הבנת המסרים שבבשורתו של ישו, בכך הם הופכים לעדות רוחנית.\\nרבים ממשלי ישו מתייחסים לענייני יומיום פשוטים, כגון משל האישה האופה לחם, במתי י\\"ג 33 ובלוקס י\\"ג 20–21 האיש הדופק על דלת שכנו בלילה, או משל השוד בדרך, כמו כן, הם עוסקים בנושאים של אמונה, כגון התפתחות וגדילה של מלכות האלוהים, חשיבותה של התפילה, ומשמעותה של אהבה רוחנית."},{"page_url":"https://en.wikipedia.org/wiki/Anthimus_VII_of_Constantinople","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Anthimus_vii.jpg","page_title":"Anthimus VII of Constantinople","context_page_description":"Anthimus VII or Anthimos VII Tsatsos, was the Ecumenical Patriarch of Constantinople from 1895 to 1896. He died in Halki, Turkey.\\nIn 1895, he criticized the encyclical Praeclara gratulationis publicae of Pope Leo XIII."},{"page_url":"https://ceb.wikipedia.org/wiki/Gobiidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Neogobius_melanostomus1.jpg","page_title":"Gobiidae","context_page_description":"Pamilya sa mga isda ang Gobiidae. Ang Gobiidae sakop sa kahanay nga Perciformes, klase nga isda nga adunay raya ang kapay, ka-ulo nga mananap nga adunay kord ang likod, ug kaginharian nga mananap. Ang kabanay nga Gobiidae pagsakop 1620 espesye, segun Catalogue of Life."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%82%A2%E3%83%BB%E3%82%AA%E3%83%94%E3%83%A9%E3%82%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/20100825_kia_opirus_001.jpg","page_title":"キア・オピラス","context_page_description":"オピラスは、かつて韓国の起亜自動車が生産していた高級乗用車である。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_monastic_houses_in_Ireland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Killybegs_St._Catherine%27s_Friary_SW_2012_09_16.jpg","page_title":"List of monastic houses in Ireland","context_page_description":"This is a list of the abbeys, priories, friaries and other monastic religious houses in Ireland."},{"page_url":"https://vi.wikipedia.org/wiki/Dasylirion_durangense","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Dasylirion_durangense_5.jpg","page_title":"Dasylirion durangense","context_page_description":"Dasylirion durangense là một loài thực vật có hoa trong họ Măng tây. Loài này được Trel. mô tả khoa học đầu tiên năm 1911."},{"page_url":"https://vi.wikipedia.org/wiki/Jajangmyeon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Jajangmyeon_by_KFoodaddict.jpg","page_title":"Jajangmyeon","context_page_description":"Jajangmyeon hay jjajangmyeon là phiên bản Hàn Quốc của món mì Trác tương miến từ Trung Quốc. Món ăn này trộn với nước sốt đặc sánh gồm tương Chunjang, thịt thái hạt lựu và rau được chiên qua dầu ăn. Ngoài ra món ăn này còn dùng kèm hải sản."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%9E%D7%90_%D7%A4%D7%A8%D7%99%D7%93%D7%9E%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/%D7%A4%D7%A8%D7%95%D7%A4%D7%A1%D7%95%D7%A8_%D7%A9%D7%9E%D7%90_%D7%A4%D7%A8%D7%99%D7%93%D7%9E%D7%9F.JPG","page_title":"שמא פרידמן","context_page_description":"הרב פרופ' שמא יהודה פרידמן הוא חוקר תלמוד אמריקני-ישראלי וחתן פרס ישראל בתחום זה."},{"page_url":"https://en.wikipedia.org/wiki/Hamilton-Oshawa_Port_Authority","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Domesticvoverseas.png","page_title":"Hamilton-Oshawa Port Authority","context_page_description":"The Hamilton-Oshawa Port Authority is a port authority that controls the ports in both Hamilton and Oshawa in the Golden Horseshoe region of Ontario, Canada. It was created in 2019 when the Hamilton Port Authority and the Oshawa Port Authority were merged by the Government of Canada. The amalgamated port authority replaced the Oshawa Port Authority created in 2012 and the Hamilton Port Authority which succeeded the Hamilton Harbour Commission in 2001. The port of Hamilton, located in Hamilton Harbour, is Ontario's largest and among the busiest ports in Canada. Both ports are located on opposite ends of the Greater Toronto-Hamilton Area.\\nOne of 17 Canadian port authorities created by the federal government, Hamilton-Oshawa derives its mandate from the Canada Marine Act. A 2010 study by Martin and Associates revealed that cargo transiting the Port of Hamilton is connected to $6 billion in economic activity and 38,000 jobs in the province of Ontario."},{"page_url":"https://tl.wikipedia.org/wiki/Shin_Saimdang","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Shin.Saimdang-Chochungdo-01.jpg","page_title":"Shin Saimdang","context_page_description":"Shin Saimdang ay isang Koreanong babae artist, poets, manunulat, pilosopo ng Joseon Dinastiyang. palayaw ay Saimdang, Inimdang, Imsajae, Intsik pangalan ay Inseon. matagal na may edad na siya ay pagsamba, na pinarangalan bilang isang simbolo ng matalino ina at mabuting asawa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Orgeln_in_S%C3%BCdniedersachsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Isenb%C3%BCttel_Marien_Orgel_op._64.jpg","page_title":"Liste von Orgeln in Südniedersachsen","context_page_description":"Die Liste von Orgeln in Südniedersachsen verzeichnet die erhaltenen historischen Orgeln und überregional bedeutenden Orgelneubauten in Südniedersachsen. Das hier zugrunde liegende Gebiet umfasst die Landkreise Goslar, Göttingen, Hameln-Pyrmont, Hildesheim, Holzminden und Northeim sowie die Stadt Salzgitter. An historischen Instrumenten sollen alle erfasst werden, die vor dem Ersten Weltkrieg gebaut sind. Die Liste ergänzt den Hauptartikel Orgellandschaft Südniedersachsen, wo sich weitere Literatur findet.\\nIn der vierten Spalte sind die hauptsächlichen Erbauer angeführt; eine Kooperation mehrerer Orgelbauer wird durch Schrägstrich angezeigt, spätere Umbauten durch Komma. In der sechsten Spalte bezeichnet die römische Zahl die Anzahl der Manuale, ein großes „P“ ein selbstständiges Pedal und ein kleines „p“ ein nur angehängtes Pedal, die arabische Zahl in der vorletzten Spalte die Anzahl der klingenden Register. Bedeutende erhaltene historische Gehäuse werden durch Kursivierung angezeigt."},{"page_url":"https://pt.wikipedia.org/wiki/Castelo_de_Villandry","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/VillandryCastle.jpg","page_title":"Castelo de Villandry","context_page_description":"O Château de Villandry é um palácio da França, localizado na comuna de Villandry, departamento de Indre-et-Loire. Fica situado a 15 km. de Tours pela estrada D7.\\nO Château de Villandry, terminado cerca de 1536, foi o último dos grandes châteaux construídos nas margens do Rio Loire na época do Renascimento. No início do século XX foi comprado por Joachim Carvallo, bisavô dos actuais proprietários, que o restaurou completamente.\\nO palácio é conhecido pelos seus três jardins, a torre de menagem domina o parterre decorativo, o jardim ornamental e o jardim de água.\\nO interior data do século XVIII."},{"page_url":"https://de.wikipedia.org/wiki/Bojnice","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Bojnice_a_Prievidza_%28pohlad_zo_zamku%29.jpg","page_title":"Bojnice","context_page_description":"Bojnice ist eine kleine Stadt in der Slowakei nahe dem Fluss Nitra, westlich der Stadt Prievidza."},{"page_url":"https://fr.wikipedia.org/wiki/Nikita_Mikhalkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Mikhalkov_Cannes_2010.jpg","page_title":"Nikita Mikhalkov","context_page_description":"Nikita Sergueïevitch Mikhalkov, né le 21 octobre 1945 à Moscou est un réalisateur, acteur et producteur de films russe, fondateur, en 2002, du prix de l'Aigle d'or, décerné chaque année par le cinéma russe."},{"page_url":"https://bar.wikipedia.org/wiki/Gwoxane_Vateidigungsaulog","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/RheingauerGeb%C3%BCckKarteCohausen.jpg","page_title":"Gwoxane Vateidigungsaulog","context_page_description":"A gwoxane Vateidigungsalog is a Befestigungsweak, des wos vua oim aus lebendign Buschn und Baama, owa aa aus gschlogna Baama und Flechtweak bstähd. Do hod ma zua Obwea vo oan Feind nua des gnuzt wos do woa. Des hom sei kena Schpean fia kloane Deafa, owa a Laundkroas hod ma so Vaschpead. Ja sogoa an gaunzn Gau hod ma so varammön kena. Wia a des Rheingaua Gebück."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D9%88%DB%8C%DB%8C%D8%AA%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Biz_Stone-20080723.jpg","page_title":"توییتر","context_page_description":"توییتر یک شبکهٔ اجتماعی و سرویس ارائه دهندهٔ میکروبلاگ است که به کاربران اجازه می‌دهد تا ۲۸۰ حرف، پیام متنی را که توییت نامیده می‌شود، ارسال کنند.\\nتوییت‌ها در ابتدا به ۱۴۰ حرف محدود شده بودند، اما در ۷ام نوامبر سال ۲۰۱۷، این محدودیت به ۲۸۰ حرف در هر توییت، به جز زبان‌های چینی، ژاپنی و کره ای، ارتقا پیدا کرد.\\nکاربرانی که در توییتر ثبت‌نام کرده‌اند می‌توانند توییت ارسال کنند، بازتوییت کنند و همچنین آنها را لایک کنند اما کاربران ثبت نام نشده فقط می‌توانند توییت ها را مشاهده کنند. همچنین کاربران می‌توانند از طریق وبگاه توییتر، پیامک یا نرم‌افزار کاربردی تلفن همراه به توییتر دسترسی داشته باشند.\\nتوییتر در مارس ۲۰۰۶ به دست جک دورسی، «Noah Glass»، بیز استون و اوان ویلیامز ایجاد شد و در ژوئیه ۲۰۰۶ آغاز به کار کرد. این میکروبلاگینگ در سال ۲۰۱۲ بیش از ۱۰۰ میلیون کاربر داشت که ۳۴۰ میلیون توییت در روز می‌فرستند و بیش از ۱٫۶ میلیارد جستجو در آن انجام می‌شود.\\nدر سال ۲۰۱۳، توییتر یکی از ده وبسایت برتر در فهرست محبوب‌ترین وبگاه‌ها اعلام شد و همچنین، به عنوان «پیامک اینترنتی» توصیف شده‌است.\\nاز سال ۲۰۱۸، توییتر ماهانه بیش از ۳۲۱ میلیون کاربر فعال دارد. همچنین از سال ۲۰۱۵ تا به امروز، توئیتر بحث و اخبار گسترده‌ای را برای اطلاع‌رسانی سیاست‌های ایالات متحده به وجود آورده‌است."},{"page_url":"https://en.wikipedia.org/wiki/1923_United_Kingdom_general_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/J._Ramsay_MacDonald_LCCN2014715885_%28cropped%29.jpg","page_title":"1923 United Kingdom general election","context_page_description":"The 1923 United Kingdom general election was held on Thursday 6 December 1923. The Conservatives, led by Stanley Baldwin, won the most seats, but Labour, led by Ramsay MacDonald, and H. H. Asquith's reunited Liberal Party gained enough seats to produce a hung parliament. It is the most recent such election in which a third party won over 100 seats. Likewise the highest percentage, 29.7% of the vote of any such party.\\nMacDonald formed the first ever Labour government with tacit support from the Liberals. Rather than trying to bring the Liberals back into government, Asquith's motivation for permitting Labour to enter power was that he hoped they would prove to be incompetent and quickly lose support. Being a minority, MacDonald's government only lasted ten months and another general election was held in October 1924."},{"page_url":"https://fy.wikipedia.org/wiki/Oera_Linda_Boek","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Manuscript_Thet_Oera_Linda_Bok%2C_pagina_48.jpg","page_title":"Oera Linda Boek","context_page_description":"It Oera Linda Boek is in kronyk fan de iere wrâldskiednis, út Frysk eachpunt, en in famyljekronyk fan in âlde aadlike Fryske famylje mei de fan Over de Linden, of Oera Linda. It manuskript soe in kopy út 1256 wêze, dy fia âldere kopyen weromgong op boarnen út likernôch de perioade fan 560 foar Kristus oant it begjin fan de jiertelling. De measte ûndersikers beskôgje it Oera Linda Boek as in mystifikaasje; der binne lykwols ferskillende ideeën oer de skriuwer fan it hânskrift, en oer it motyf in sabeare kronyk te skriuwen."},{"page_url":"https://sl.wikipedia.org/wiki/%C4%8Cini_Vojske_Srbije","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/6_vpvo_-_potpukovnik.png","page_title":"Čini Vojske Srbije","context_page_description":"Čini Vojske Srbije."},{"page_url":"https://pl.wikipedia.org/wiki/Premierzy_S%C5%82owenii","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Jansa-rumsfeld2.jpg","page_title":"Premierzy Słowenii","context_page_description":"Prezydenci Słowenii\\nLiderzy Socjalistycznej Republiki Słowenii"},{"page_url":"https://ur.wikipedia.org/wiki/%D9%81%D8%B1%DA%88%DB%8C%D9%86%DB%8C%D9%86%DA%88_%D8%B4%DB%8C%D9%88%D8%A7%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Ferdinand_Cheval.jpg","page_title":"فرڈینینڈ شیوال","context_page_description":"فرڈینینڈ شیوال ایک فرانسیسی ڈاکیا تھا، جس نے 33 سال میں اپنے جمع کیے پتھروں سے محل بنا لیا۔"},{"page_url":"https://es.wikipedia.org/wiki/Ixk%C3%BAn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ixkun_6.jpg","page_title":"Ixkún","context_page_description":"Ixkún es un sitio arqueológico maya precolombino ubicado en el departamento del Petén, en Guatemala. Se encuentra al norte de la ciudad de Dolores. Es un yacimiento importante que contiene un buen número de montículos sin excavar y de monumentos, algunos de los cuales están restaurados.​\\nIxkún fue la capital de un importante señorío en el valle del río Mopán. Otros señoríos que destacaron en esta región de las tierras bajas de los mayas en el Petén, fueron Curucuitz, Ixcol e Ixtontón.​ Otros ocho sitios formaron parte del señorío de Ixkún.​ La Estela # 1 de Ixkún es uno de los monumentos más altos de toda la región del Petén.​\\nEl principal periodo de actividad de Ixkún fue durante el clásico tardío. Sin embargo, el sitio estuvo ocupado desde el preclásico tardío hasta el posclásico.​"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre_de_Vienne-en-Bessin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Vienne_en_Bessin%2C_modillons_et_mur_en_ar%C3%AAtes_de_poisson_de_l%27%C3%A9glise.JPG","page_title":"Église Saint-Pierre de Vienne-en-Bessin","context_page_description":"L'église Saint-Pierre de Vienne-en-Bessin, aussi dénommée église paroissiale Saint-Pierre et Saint-Gorgon de Vienne-en-Bessin, est une église catholique située à Vienne-en-Bessin, en France."},{"page_url":"https://it.wikipedia.org/wiki/Aurora_(Torino)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Stazione_porta_Milano.JPG","page_title":"Aurora (Torino)","context_page_description":"Aurora, o frequentemente anche Borgo Aurora, è un quartiere della Circoscrizione 7 di Torino, confinante anche con il centro storico cittadino.\\nÈ delimitato:\\na nord, da Corso Vigevano - Corso Novara\\na est, dal fiume Dora Riparia\\na ovest, da Corso Principe Oddone\\na sud, da Corso Regina Margherita e dal tratto di Corso Regio Parco tra il Rondò Rivella e la Dora Riparia"},{"page_url":"https://de.wikipedia.org/wiki/Burg_(Spreewald)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Wappen_Burg_%28Spreewald%29.png","page_title":"Burg (Spreewald)","context_page_description":"Burg (Spreewald), niedersorbisch Bórkowy, ist eine Gemeinde im Landkreis Spree-Neiße im Osten von Brandenburg. Sie ist seit 2005 ein staatlich anerkannter Ort mit Heilquellenkurbetrieb. Burg wird vom Amt Burg (Spreewald) verwaltet, dessen Sitz sich in der Gemeinde befindet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9E%D7%A9%D7%9C%D7%AA_%D7%94%D7%9E%D7%A2%D7%91%D7%A8_%D7%94%D7%A8%D7%95%D7%A1%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/First_Provisional.jpg","page_title":"ממשלת המעבר הרוסית","context_page_description":"ממשלת המעבר הרוסית גובשה בפטרוגרד לאחר הידרדרות האימפריה הרוסית והתפטרות הצאר מכהונתו.\\nכאשר סמכויותיו של משטר הצאר החלו להתפורר במהלך מהפכת פברואר של 1917, שתי רשויות יריבות, הדומה וסובייט פטרוגרד, התחרו על השלטון. בתור פשרה, הוקמה ממשלה זמנית כדי להנהיג את רוסיה לבחירות לאספה מכוננת. כשהצאר ניקולאי השני התפטר מתפקידו ב-15 במרץ, ואחיו מיכאיל השני, סירב לשלוט אחריו, הממשלה הזמנית שלטה רשמית ברוסיה, אבל כוחה היה מוגבל על ידי הרשות הגודלת של הסובייט פטרוגרד. רשות זו שלטה בצבא, במפעלים ובמסילות הרכבת, וזו הייתה תקופה של שליטה של שני מוסדות, למרות שבתחילה תמך הפטרוגרד סובייט בממשלת המעבר.\\nממשלת המעבר הונהגה בתחילה על ידי הנסיך גאורגי לבוב ואחר-כך על ידי אלכסנדר קרנסקי. היא הצליחה לארגן את הבחירות, אבל לא סיימה את השתתפותה של רוסיה במלחמת העולם הראשונה, ולכן נחלשה הפופולריות שלה בין תושבי רוסיה יגעי-המלחמה. בנוסף, נמנעה הממשלה מלקבוע את מדיניותה המוחלטת של רוסיה, בעיקר מכיוון שהייתה זמנית. חולשה זו הובילה לפירוק הממשלה הזמנית במהלך מהפכת אוקטובר. הבולשביקים תפסו את השלטון, והמשטר הסובייטי החל."},{"page_url":"https://hu.wikipedia.org/wiki/Saar-vid%C3%A9k_vas%C3%BAtvonalainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/TGV_Paris-Frankfurt_in_Saarbr%C3%BCcken_Hbf.jpg","page_title":"Saar-vidék vasútvonalainak listája","context_page_description":"Ez a lista a németországi Saar-vidék tartomány vasútvonalait sorolja fel ábécé sorrendben. A lista nem teljes."},{"page_url":"https://en.wikipedia.org/wiki/Art_of_Mathura","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Colossal_Head_of_Jina_-_Gupta_Period_-_Kankali_Mound_-_ACCN_00-B-61_-_Government_Museum_-_Mathura_2013-02-23_5453.JPG","page_title":"Art of Mathura","context_page_description":"The Art of Mathura refers to a particular school of Indian art, almost entirely surviving in the form of sculpture, starting in the 2nd century BCE, which centered on the city of Mathura, in central northern India, during a period in which Buddhism, Jainism together with Hinduism flourished in India. Mathura \\"was the first artistic center to produce devotional icons for all the three faiths\\", and the pre-eminent center of religious artistic expression in India at least until the Gupta period, and was influential throughout the sub-continent.\\nChronologically, Mathuran sculpture becomes prominent after Mauryan art, the art of the Mauryan Empire. It is said to represent a \\"sharp break\\" with the previous Mauryan style, either in scale, material or style. Mathura became India's most important artistic production center from the second century BCE, with its highly recognizable red sandstone statues being admired and exported all over India."},{"page_url":"https://pl.wikipedia.org/wiki/Nel_blu_dipinto_di_blu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Eurovision_Song_Contest_1958_-_Domenico_Modugno.png","page_title":"Nel blu dipinto di blu","context_page_description":"Nel blu dipinto di blu, znane także jako Volare – utwór włoskiego wokalisty Domenico Modugno, uznawany za jedną z najpopularniejszych włoskich piosenek na świecie."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ciconiiformes_by_population","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Intermediate_Egret_%28Mesophoyx_intermedia%29_in_Hyderabad_W2_IMG_4975.jpg","page_title":"List of Ciconiiformes by population","context_page_description":"This is a list of Ciconiiformes species by global population. While numbers are estimates, they have been made by the experts in their fields.\\nThis list is incomprehensive, as not all Ciconiiformes have had their numbers quantified. The classification of this order of birds is currently in flux; the classification for this list is aligned with the IUCN's current position, but may change in the future.\\nFurthermore, some species currently listed below are no longer considered Ciconiformes; they have been reclassified under Pelecaniformes. Click the species page for a more definitive classification."},{"page_url":"https://uk.wikipedia.org/wiki/Gavrilovi%C4%87_d.o.o.","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Gavrilovi%C4%87_pa%C5%A1tete_%28Slovenija%29.jpg","page_title":"Gavrilović d.o.o.","context_page_description":"Gavrilović d.o.o. — хорватське м'ясопереробне підприємство з Петрині."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B7%A1%E6%B0%B4%E5%A4%AA%E5%AD%90%E5%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%E6%B7%A1%E6%B0%B4%E5%A4%AA%E5%AD%90%E5%BB%9F%E9%81%A0%E7%85%A7.jpg","page_title":"淡水太子廟","context_page_description":"淡水太子庙，又名崁顶太子庙，是位于台湾新北市淡水区淡海新市镇崁顶里的哪吒庙，在兴建淡海新市镇一期时获得保留。"},{"page_url":"https://en.wikipedia.org/wiki/Grand_Duchy_of_Tuscany","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Granduchy_of_Tuscany_1815_%28location%29.png","page_title":"Grand Duchy of Tuscany","context_page_description":"The Grand Duchy of Tuscany was a central Italian monarchy that existed, with interruptions, from 1569 to 1859, replacing the Republic of Florence. The grand duchy's capital was Florence. In the 19th century the population of the Grand Duchy was about 1,815,000 inhabitants.\\nInitially, Tuscany was ruled by the House of Medici until the extinction of its senior branch in 1737. While not as internationally renowned as the old republic, the grand duchy thrived under the Medici and it bore witness to unprecedented economic and military success under Cosimo I and his sons, until the reign of Ferdinando II, which saw the beginning of the state's long economic decline. It peaked under Cosimo III.\\nFrancis Stephen of Lorraine, a cognatic descendant of the Medici, succeeded the family and ascended the throne of his Medicean ancestors. Tuscany was governed by a viceroy, Marc de Beauvau-Craon, for his entire rule. His descendants ruled, and resided in, the grand duchy until its end in 1859, barring one interruption, when Napoleon Bonaparte gave Tuscany to the House of Bourbon-Parma. Following the collapse of the Napoleonic system in 1814, the grand duchy was restored."},{"page_url":"https://ca.wikipedia.org/wiki/Testimonis_de_Jehov%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Rebedor_de_l%27oficina_de_traducci%C3%B3_al_catal%C3%A0_de_Matar%C3%B3.jpg","page_title":"Testimonis de Jehovà","context_page_description":"Testimonis de Jehovà és una confessió religiosa cristiana internacional mil·lenarista i fonamentalista fundada el 1870 per Charles Taze Russell, entesa pels seus adeptes com una restauració del mode de vida i les idees originals dels primers cristians i com l'única religió verdadera. L'organització dirigeix la Societat Watchtower de Bíblies i Tractats, un grup religiós amb seu central a Warwick Nova York, considerat l'editorial més gran i poderosa del món, amb uns beneficis econòmics que la situen entre les 50.000 empreses més importants dels EUA. Els diners s'utilitzen a fer noves publicacions, mantenir el seu lloc web i canal de televisió en línia, donar suport a missioners i enviar ajut a llocs on hi hagi hagut algun desastre. El grup està registrat com a organització sense ànim de lucre i no hi ha cap notícia d'evasió d'impostos i similars delictes per part de la Watchtower Society, malgrat la pressió de certs governs per retenir-ne impostos il·legalment. Tota la seva obra està dirigida pel Consell Rector.\\nEls Testimonis de Jehovà consideren la bíblia l'única autoritat en matèria de fe i dogmes."},{"page_url":"https://es.wikipedia.org/wiki/Reino_Unido_en_la_Segunda_Guerra_Mundial","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Winston_Churchill_cph.3b12010.jpg","page_title":"Reino Unido en la Segunda Guerra Mundial","context_page_description":"El papel del Reino Unido de Gran Bretaña e Irlanda del Norte durante la Segunda Guerra Mundial fue muy trascendental. El primer ministro británico durante gran parte de la contienda, Winston Churchill, tuvo una postura firme y clara, en la cual jamás se rendiría y lucharía hasta el final por la derrota del enemigo. De hecho, fue el único país que luchó en toda la guerra, desde el 3 de septiembre de 1939 hasta el 2 de septiembre de 1945\\nEn los seis años de duración de la guerra, el Reino Unido estuvo desde un principio en desacuerdo con Hitler, y posteriormente, contra el Reino de Italia y Japón. Además de ser escenario de la batalla de Inglaterra entre 1940 y 1941, el país envió tropas a combatir en la mayoría de las batallas contra Alemania en Europa occidental, contra Italia en el norte de África y contra Japón en las colonias británicas del Pacífico. Durante la segunda mitad de la guerra, los británicos ayudaron en gran manera en la derrota de Italia durante la invasión, también estuvieron presente en el Desembarco de Normandía para seguir su avance hasta el Reich y llevaron a cabo bombardeos masivos por sobre la mayoría de las ciudades alemanas."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%81%E0%B8%81%E0%B8%A3%E0%B8%B5_%E0%B8%A1%E0%B8%B1%E0%B8%A7%E0%B8%A3%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Gary-Moore-at-Pite-Havsbad.jpg","page_title":"แกรี มัวร์","context_page_description":"โรเบิร์ต วิลเลียม แกรี มัวร์ หรือ แกรี มัวร์ ​เป็นนักกีตาร์, นักร้องและนักแต่งเพลง ชาวไอร์แลนด์เหนือ มีผลงานทางดนตรีส่วนใหญ่ในแนวเพลงบลูส์ร็อก, เฮฟวีเมทัล, แจ๊สฟิวชัน​ โดยได้รับการยกย่องจากวงการเพลงให้เป็นหนึ่งในมือกีตาร์ที่มีฝีมือระดับอัจฉริยะคนหนึ่งของโลก\\nมัวร์เกิดและเติบโตที่กรุงเบลฟาสต์​ ประเทศไอร์แลนด์เหนือ​ และได้เข้าร่วมวงดนตรีในกรุงเบลฟาสต์หลายวงในช่วงวัยรุ่น ก่อนจะย้ายไปใช้ชีวิตที่กรุงดับลิน​ สาธารณรัฐไอร์แลนด์​ จากนั้นเขาได้มาเป็นสมาชิกใหม่ของวงสกิดโรว์ ซึ่งเป็นวงดนตรีแนวบลูส์ร็อกชื่อดังของไอร์แลนด์ แทนที่ฟิล ลินอตต์ นักร้องนำคนเก่าที่แยกออกไปก่อตั้งวงทินลิซซี​ ต่อมาเขาได้ออกจากวงสกิดโรว์และได้มาเข้าร่วมวงทินลิซซีของฟิล ลินอตต์ ก่อนที่จะร่วมวงโคลอสเซียมทู วงดนตรีแนวโพรเกรสซิฟ​แจ๊สร็อก​ หลังจากนั้นเขาได้ออกอัลบั้มเดี่ยวของตนเองหลายชุดโดยมีบทเพลงที่ได้รับความนิยมอย่างกว้างขวางในชาร์ตซิงเกิลแห่งสหราชอาณาจักรเช่นเพลง เอาท์ อินเดอะ ฟีลด์ ที่ขึ้นถึงอันดับ 5 ​ และเพลง ปารีเซียง วอล์คเวย์ ที่ขึ้นถึงอันดับ 8 ​ โดยอัลบั้มที่ถือว่าประสบความสำเร็จสูงสุดของเขาคืออัลบั้ม สทิล ก็อท เดอะ บลูส์ ที่ได้รับการรับรองระดับทองคำจากสมาคมผู้ประกอบกิจการเพลงของสหรัฐอเมริกา​ และเพลงสทิล ก็อท เดอะ บลูส์ ในอัลบั้มชุดนี้เป็นซิงเกิลที่สามารถขึ้นถึงอันดับ 97 ในบิลบอร์ดฮอต 100​ของสหรัฐ ในปี ค.ศ. 1991 ​"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8A%E6%B5%B7%E4%BD%93%E8%82%B2%E5%9C%BA%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Shanghai_Stadium_Station.jpg","page_title":"上海体育场站","context_page_description":"上海體育場站位於上海徐匯區零陵路天鑰橋路，為上海軌道交通4號線的地下島式車站。"},{"page_url":"https://pl.wikipedia.org/wiki/Pomianka_(dop%C5%82yw_Prosny)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Szalonka_-_rzeka_Pomianka.jpg","page_title":"Pomianka (dopływ Prosny)","context_page_description":"Pomianka – rzeka w Polsce, dopływ Prosny.\\nPoczątek bierze w okolicy wsi Aniołka Pierwsza w gminie Trzcinica. Przez większość swojego biegu płynie w granicach powiatu kępińskiego w województwie wielkopolskim. Jedynie ujściowy odcinek znajduje się w granicach gminy Bolesławiec w powiecie wieruszowskim, w województwie łódzkim. Uchodzi lewobrzeżnie do Prosny na jej 153,5 km na wysokości około 158 m n.p.m. na północ od Podbolesławca.\\nPomianka ma długość 21,7 km. Zlewnia rzeki zajmuje powierzchnię 128,90 km². Jej podłoże budują głównie gliny zwałowe. W środkowym biegu Pomianki znajduje się duże zagłębienie wypełnione madami i piaskami rzecznymi, poprzecinane gęstą siecią niewielkich cieków i rowów melioracyjnych. W granicach zlewni cieku położone są trzy rezerwaty przyrody – „Oles w Dolinie Pomianki”, „Las Łęgowy w Dolinie Pomianki” i „Stara Buczyna w Rakowie”. Większość jej obszaru ma charakter typowo rolniczy z niewielkimi jednostkami osadniczymi.\\nWedług typologii wód powierzchniowych opracowanej przez polskie Ministerstwo Środowiska ciek zaliczany był początkowo do typu 18 – potok nizinny żwirowy, jednak następnie był określany jako typ 16 – potok nizinny lessowy lub gliniasty."},{"page_url":"https://en.wikipedia.org/wiki/Armstrong_(crater)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Armstrong_crater_5074_med.jpg","page_title":"Armstrong (crater)","context_page_description":"Armstrong is a small lunar impact crater located in the southern part of the Mare Tranquillitatis. It lies about 50 kilometers to the northeast of the Apollo 11 landing site, Tranquility Base. Named after American astronaut Neil Armstrong, the crater is the easternmost of the row of three craters named in honor of the Apollo 11 crew members. To the north is the Ranger 8 impact site.\\nThis crater was previously identified as Sabine E before being renamed by the IAU. Sabine itself is located due west of Armstrong."},{"page_url":"https://cs.wikipedia.org/wiki/Linhorka","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Star%C3%A9%2C_Kuzovsk%C3%BD_potok_%285%29.jpg","page_title":"Linhorka","context_page_description":"Linhorka je nevýrazný vrch na katastrálním území vesnice Staré, která je administrativně částí obce Třebívlice v okrese Litoměřice v Ústeckém kraji. Linhorka, která se nachází na území Chráněné krajinné oblasti České středohoří, je geologickou a mineralogickou lokalitou celostátního významu."},{"page_url":"https://en.wikipedia.org/wiki/Pizes_de_Cir","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Groedner_Joch_-_Cirspitzen.jpg","page_title":"Pizes de Cir","context_page_description":"The Pizes de Cir is a mountain range in South Tyrol, Italy. They are part of the Dolomites, north of Gardena Pass. The highest peak of this mountain range is the Gran Cir with an elevation of 2592 meters."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Thomery","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Les_murs_de_chasselas_de_Thomery.jpg","page_title":"Liste der Monuments historiques in Thomery","context_page_description":"Die Liste der Monuments historiques in Thomery führt die Monuments historiques in der französischen Gemeinde Thomery auf."},{"page_url":"https://pl.wikipedia.org/wiki/Kefar_Jechezkel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Aerial_view_on_Kfar_Yehezkel.jpg","page_title":"Kefar Jechezkel","context_page_description":"Kefar Jechezkel – moszaw położony w Samorządzie Regionu Ha-Gilboa, w Dystrykcie Północnym, w Izraelu."},{"page_url":"https://eu.wikipedia.org/wiki/Digosville","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/%C3%89glise_Notre-Dame_de_Digosville_%282%29.JPG","page_title":"Digosville","context_page_description":"Digosville Frantziako udalerria da, Manche departamenduan dagoena, Normandia eskualdean. 2013an 1.549 biztanle zituen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D1%81%D0%BA%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Wappen_Beeskow.png","page_title":"Бесков","context_page_description":"Бесков — місто в Німеччині, розташоване в землі Бранденбург. Адміністративний центр району Одер-Шпре.\\nПлоща — 77,15 км². Населення становить 8122 ос."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Verde_(Guadix)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/VerdeGMenor.jpg","page_title":"Río Verde (Guadix)","context_page_description":"El río Verde es un río del sur peninsular que discurre por la provincia de Granada. También es conocido como río Guadix ya que es la ciudad más importante que atraviesa.\\nSus fuentes se encuentran en la cara norte de Sierra Nevada de donde recoge el agua de numerosos barrancos y arroyos que darán origen a su nacimiento en el término municipal de Jérez del Marquesado. Tras un recorrido aproximado de 26 km desemboca en el río Fardes en el término municipal de Benalúa.\\nA pesar de su caudal irregular se considera junto con el río Alhama el principal afluente del Fardes."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%99%D7%A4%D7%95%D7%AA_%D7%90%D7%99%D7%A8%D7%95%D7%A4%D7%94_%D7%91%D7%9B%D7%93%D7%95%D7%A8%D7%92%D7%9C_%D7%A2%D7%93_%D7%92%D7%99%D7%9C_21_-_2011","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Viborg_Stadion_%281%29.jpg","page_title":"אליפות אירופה בכדורגל עד גיל 21 - 2011","context_page_description":"אליפות אירופה בכדורגל עד גיל 21 לשנת 2011, נערכה בדנמרק בתאריכים 11–25 ביוני 2013. זוהי האליפות ה-18 של המפעל. דנמרק נבחרה על ידי אופ\\"א לאירוח התחרות ב-10 בדצמבר 2008, וגברה על ישראל. ספרד גברה בגמר על שווייץ בתוצאה 0-2 וזכה בתואר בפעם ה-3 בתולדותיה."},{"page_url":"https://pt.wikipedia.org/wiki/Formica_pratensis","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Formica_pratensis_2.JPG","page_title":"Formica pratensis","context_page_description":"Formica pratensis é uma espécie de formiga da família Formicidae. Pode ser encontrada na Áustria, Bélgica, Bulgária, República Checa, Estónia, Finlândia, França, Geórgia, Alemanha, Hungria, Itália, Letónia, Lituânia, Luxemburgo, Moldávia, Holanda, Noruega, Polónia, Roménia, Rússia, Sérvia e Montenegro, Eslováquia, Espanha, Suécia, Suíça, Turquia, Ucrânia e Reino Unido."},{"page_url":"https://eo.wikipedia.org/wiki/S%C3%A3o_Vicente_do_Sul","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Bras%C3%A3o_S%C3%A3o_Vicente_do_Sul.jpg","page_title":"São Vicente do Sul","context_page_description":"São Vicente do Sul estas municipo en la brazila subŝtato Suda Rio-Grando, kiu havis 8.440 loĝantojn en 2010."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%82%A2%E3%83%80%E3%83%A9%E3%83%8F%E3%83%A9_(%E3%82%B9%E3%83%9A%E3%82%A4%E3%83%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ayuntamiento_Guadalajara.jpg","page_title":"グアダラハラ (スペイン)","context_page_description":"グアダラハラは、スペインの都市。カスティーリャ＝ラ・マンチャ州グアダラハラ県の県都である。マドリードの北東約60kmに位置する。人口は73,730人。\\nイベリア人によって築かれ、ローマ人が接触したときにはアリアカと呼ばれていた。カラカという名前でローマ属州ヒスパニア・タラコネンシスに編入された。アラブ人の支配下では、ワーディー・アル・ヒジャーラと呼ばれた。\\nエナーレス川にかかる橋は、ローマ人によって築かれたものである。ほかに多くの教会やインファンタード宮殿のような歴史的建造物がある。\\nメキシコの都市グアダラハラは、グアダラハラ生まれのヌーニョ・ベルトラン・デ・グスマンによって築かれた。"},{"page_url":"https://fr.wikipedia.org/wiki/Vadym_Lykhoshertsov","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Chaumont_Volley-Ball_52_vs_Fakel_Novy_Urengoy%2C_Challenge_Cup%2C_12_avril_2017_-_08.jpg","page_title":"Vadym Lykhoshertsov","context_page_description":"Vadym Viktorovitch Lykhoshertsov est un joueur ukrainien de volley-ball né le 23 janvier 1989 à Kharkiv. Il mesure 2,16 m et joue central. Il est international ukrainien."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%8A%D9%85%D9%88%D9%86_%D8%A8%D8%B1%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Photo_1_SBS.jpeg","page_title":"سيمون بروس","context_page_description":"سيمون بروس مخرج افلام من الميكسيك."},{"page_url":"https://de.wikipedia.org/wiki/Har%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Har%C3%ADa_-_Plaza_Leon_Y_Castillo_-_Iglesia_de_Nuestra_Se%C3%B1ora_de_la_Encarnaci%C3%B3n_02_ies.jpg","page_title":"Haría","context_page_description":"Haría ist eine der sieben Gemeinden der zu Spanien gehörenden Kanareninsel Lanzarote. Die Hauptstadt der Gemeinde trägt ebenfalls diesen Namen. Diese befindet sich im Tal der 1000 Palmen. Eine Sage erzählt, dass immer, wenn in Haría ein Mädchen geboren wurde, eine neue Palme wuchs."},{"page_url":"https://it.wikipedia.org/wiki/Zhuchengceratops_inexpectus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Zhuchengoceratops_skull_and_mandible.png","page_title":"Zhuchengceratops inexpectus","context_page_description":"Zhuchengceratops inexpectus Xu et al., 2010 è un genere fossile di ceratopside vissuto durante il Cretaceo superiore, circa 70 milioni di anni fa, nell'attuale area della Cina.\\nZhuchengceratops condivide alcune caratteristiche, seppur differenti, sia con i leptoceratopsidi che con altre famiglie di ceratopi, in particolare con la famiglia Ceratopsidae. Le dimensioni del taxon è imponente, simile agli altri leptoceratopsidi. Zhuchengceratops è stato riconosciuto appartenente alla famiglia del genere Leptoceratops e del genere Udanoceratops, anche se rimangono dubbi sulla relazione tassonomica fra gli esemplari."},{"page_url":"https://ro.wikipedia.org/wiki/Poissons","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Poissons-Rongeant_%283%29.JPG","page_title":"Poissons","context_page_description":"Poissons este o comună în departamentul Haute-Marne din nord-estul Franței. În 2009 avea o populație de 736 de locuitori."},{"page_url":"https://sv.wikipedia.org/wiki/Barleria_obtusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Barberio_obtusa.jpg","page_title":"Barleria obtusa","context_page_description":"Barleria obtusa är en akantusväxtart som beskrevs av Christian Gottfried Daniel Nees von Esenbeck. Barleria obtusa ingår i släktet Barleria och familjen akantusväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%99%BD%E9%9B%9C%E8%A8%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/White-noise.png","page_title":"白雜訊","context_page_description":"白雜訊，是一種功率譜密度為常數的隨機訊號或隨機過程。即此訊號在各個頻段上的功率一致。由於白光是由各種頻率的單色光混合而成，因而此訊號的平坦功率譜性質稱為「白色」，此訊號也因此得名為白雜訊。相對的，其他不具有這一性質的雜訊訊號則稱為有色雜訊。\\n理想的白雜訊具有無限頻寬，因而其能量是無限大，這在現實世界是不可能存在的。實際上，人常常將有限頻寬的平整訊號視為白雜訊，以方便進行數學分析。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Haltern_am_See","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Stolperstein_Haltern_Disselhof_36_Nathan_Lebenstein.jpg","page_title":"Liste der Stolpersteine in Haltern am See","context_page_description":"In der Liste der Stolpersteine in Haltern am See werden die vorhandenen Gedenksteine aufgeführt, die im Rahmen des Projektes Stolpersteine des Künstlers Gunter Demnig bisher in Haltern am See verlegt worden sind."},{"page_url":"https://tl.wikipedia.org/wiki/Beatipikasyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Pope_Pius_IX.jpg","page_title":"Beatipikasyon","context_page_description":"Sa Katolisismo, ang beatipikasyon ay isang pagkilala na ibinibigay ng Simbahan sa pag-akyat sa langit ng mga taong namatay. Kaakibat ng pag-akyat na ito ay ang kakayanan nilang magpahatid panangalin sa ngalan ng mga indibidwal na taong nananalangin sa kanilang pangalan."},{"page_url":"https://fr.wikipedia.org/wiki/Drapeau_blanc","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Yorktown80.JPG","page_title":"Drapeau blanc","context_page_description":"Le drapeau blanc est un signe international de paix, de trêve, de reddition d'un belligérant.\\nCe drapeau est typiquement employé en période de guerre ; des soldats portant ou agitant un drapeau blanc ne doivent pas être attaqués. Il indique à tous qu'un négociateur s'approche désarmé ou a l'intention de se rendre.\\nOn attend d'une personne portant le drapeau blanc qu'elle reste neutre et ne s'engage pas dans des actes guerriers.\\nLe drapeau blanc est reconnu par la convention de La Haye depuis 1899."},{"page_url":"https://ceb.wikipedia.org/wiki/Vyshhorod","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/%D0%92%D0%B8%D1%88%D0%B3%D0%BE%D1%80%D0%BE%D0%B4_%28Vyshhorod%29_-_%D0%86%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%87%D0%BD%D0%B8%D0%B9_%D0%BB%D0%B0%D0%BD%D0%B4%D1%88%D0%B0%D1%84%D1%82_%D0%92%D0%B8%D1%88%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B0_%28%D0%BF%D0%B2%D0%B4._%D0%B2%D0%B0%D0%BB%29.jpg","page_title":"Vyshhorod","context_page_description":"Kapital sa rayon ang Vyshhorod sa Okraniya. Nahimutang ni sa lalawigan sa Kyiv Oblast, sa sentro nga bahin sa nasod, 15 km sa amihanan sa Kiev ang ulohan sa nasod. 112 metros ibabaw sa dagat kahaboga ang nahimutangan sa Vyshhorod, ug adunay 22,080 ka molupyo. Vyshhorod nga nahimutang sa lanaw sa Kyyivs'ke Vodoskhovyshche.\\nAng yuta palibot sa Vyshhorod kay patag, ug nga tinakpan sa ubos sa sidlakan. Dunay mga 52 ka tawo kada kilometro kwadrado sa palibot sa Vyshhorod medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Kiev, 14.6 km sa habagatan sa Vyshhorod. Hapit nalukop sa kabalayan ang palibot sa Vyshhorod.\\nAng klima hemiboreal. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -8 °C."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%DA%A9%DB%8C%D8%AA%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lekeitio_harbour.jpg","page_title":"لکیتیو","context_page_description":"لکیتیو یک شهر کوچک در استان بیسکای در منطقه خودمختار سرزمین باسک در اسپانیا است که در ۵۳ کیلومتری شمال بیلبائو قرار دارد. شهرداری دارای ۷٬۲۹۳ نفر جمعیت و یکی از مهمترین بنادر ماهیگیری ساحل باسک است. گردشگری نقش مهمی در فصل تابستان دارد، شهر یکی از مراکز ساحلی پر رفت‌وآمد با یک ساحل به نام ایسونزا و ساحل کاراسپیو در شهر مندکسا می‌شود.\\nمهمترین بنای یادبود کلیسای سانتا ماریا است که یک بازیلیکا به سبک معماری گوتیک از قرن پانزده میلادی است."},{"page_url":"https://nl.wikipedia.org/wiki/Wereldkampioenschap_rally_in_1992","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/WRC-1991.png","page_title":"Wereldkampioenschap rally in 1992","context_page_description":"Het Wereldkampioenschap rally in 1992 was de twintigste jaargang van het Wereldkampioenschap rally, georganiseerd door de Fédération Internationale de l'Automobile."},{"page_url":"https://ca.wikipedia.org/wiki/Bol%C3%ADvia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Banco_Central_de_Bolivia.png","page_title":"Bolívia","context_page_description":"Bolívia o l'Estat Plurinacional de Bolívia —en castellà i oficialment, Estado Plurinacional de Bolivia — és un dels dos únics estats de l'Amèrica del Sud sense sortida a l'oceà, i a més és una de les regions més altes del món. Limita al nord i a l'est amb les regions més selvàtiques del Brasil; al sud, amb el Paraguai i l'Argentina; al sud-oest, amb Xile; i a l'oest, amb el Perú. La capital oficial i seu del poder judicial és Sucre i la seu del govern és La Paz.\\nAmb 9 947 418 habitants, Bolívia té força població indígena i la Constitució Boliviana de 2007 estableix reivindicacions territorials amb Xile per la franja d'Arica, que li permetria la sortida a l'oceà Pacífic, en referència al territori cedit per Perú i Bolívia a Xile a la finalització de la Guerra del Pacífic.\\nBolívia és un país multicultural amb molta riquesa cultural, natural i arqueològica. Se la coneix com al bressol de la cultura Tiwanaku, que aportaria els seus coneixements avançats en un munt de matèries al posterior imperi Inca.\\nTé una superfície d'1 098 581 km², la qual cosa el converteix en el cinquè país més gran de l'Amèrica del Sud després del Brasil, l'Argentina, el Perú i Colòmbia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_Deutschen_Bundestages_(19._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kerstin_Vieregge_2017.jpg","page_title":"Liste der Mitglieder des Deutschen Bundestages (19. Wahlperiode)","context_page_description":"Diese Liste gibt einen Überblick über alle Mitglieder des Deutschen Bundestages der 19. Wahlperiode nach der Bundestagswahl 2017. Die Mandatszeit der Abgeordneten begann mit der konstituierenden Sitzung am 24. Oktober 2017.\\nIm Juli 2019 lag der Frauenanteil im Bundestag bei 31,17 %, vor der Wahl bei 36,83 %."},{"page_url":"https://sl.wikipedia.org/wiki/Hivski_kanat","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Zakaukazie-Turkestan1903.jpg","page_title":"Hivski kanat","context_page_description":"Hivski kanat je bila od leta 1511 do 1920, razen v obdobju med afšaridsko okupacijo od leta 1740 do 1746, turška država v Centralni Aziji v zgodovinski pokrajini Horezm. V državi je vladalo uzbeško turško pleme Kongrati, ki je prišlo iz Astrahana. Hivski kani so bili moški potomci kana Šibana, petega sina Džingiskanovega sina Džočija. Središče kanata so bile namakane ravnine ob spodnji Amu Darji južno od Aralskega jezera z glavnim mestom Hiva. Pred prihodom Rusov v drugi polovici 19. stoletja je kanat obsegal sedanji zahodni Uzbekistan, jugozahodni Kazahstan in večino Turkmenistana.\\nLeta 1873 se je kanat zelo zmanjšal in postal ruski protektorat. Oktobrski revoluciji leta 1917 je sledila tudi revolucija v Hivi. Leta 1920 se je kanat pretvoril v Sovjetsko ljudsko republiko Horezm, ki je bila leta 1924 uradno vključena v Sovjetsko zvezo. Njeno ozemlje je zdaj večinoma v Karalpakstanu in provinci Horezm v Uzbekistanu."},{"page_url":"https://sh.wikipedia.org/wiki/Fauna_%C5%A0kotske","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Atlantic_Puffins%2C_Scotland.jpg","page_title":"Fauna Škotske","context_page_description":"Škotske životinjske vrste su uglavnom uobičajene za sjeverozapadni europski dio paleoarktičke zone, iako je nekoliko vrsta najvećih sisavaca tog područja izumrlo zbog izlova, a ljudske aktivnosti su također dovele do uvođenja raznih životinja. Različita staništa s umjerenom klimom u Škotskoj su dom za 62 vrste sisavaca, uključujući i jednu populciju divljih mačaka, velik broj sivih i običnih tuljana i najsjeverniju populaciju dobrih dupina na svijetu.\\nMnoge populacije ptica, poput tetrijeba ruševca i sjeverne snježnice žive ovdje, a ova zemlja ima svjetski važna gnijezdilišta morskih ptica kao što je bluna. Suri orao je postao nacionalna ikona, a bukoči i bjelorepani su nedavno ponovo naselili ove prostore. Škotski krstokljun je jedina podvrsta kralježnjaka endemična za Ujedinjeno Kraljevstvo.\\nMora Škotske su među biološki najproduktivnijim u svijetu; procjenjeno je da broj morskih vrsta u morima Škotske prelazi 40 000. Darwinovi brežuljci su važno područje za dubokomorske koralje koji žive u hladnoj vodi, i koji su otkriveni 1998.\\nU unutrašnjosti, skoro 400 genetički različitih populacija atlantskog lososa žive u rijekama Škotske."},{"page_url":"https://en.wikipedia.org/wiki/Calliotectum_piersonorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Seashell_Calliotectum_piersonorum.jpg","page_title":"Calliotectum piersonorum","context_page_description":"Calliotectum piersonorum is a species of sea snail, a marine gastropod mollusk in the family Volutidae, the volutes."},{"page_url":"https://lb.wikipedia.org/wiki/28._September","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Donna_Leon.jpg","page_title":"28. September","context_page_description":"Den 28. September ass den 271. Dag vum Joer am Gregorianesche Kalenner."},{"page_url":"https://fr.wikipedia.org/wiki/Esnes-en-Argonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/N%C3%A9cropole_nationale_Esnes-en-Argonne_%2806%29.JPG","page_title":"Esnes-en-Argonne","context_page_description":"Esnes-en-Argonne est une commune française située dans le département de la Meuse, en région Grand Est."},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Europameisterschaften_2014/Dreisprung_der_M%C3%A4nner","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Marian_Oprea_2015.jpg","page_title":"Leichtathletik-Europameisterschaften 2014/Dreisprung der Männer","context_page_description":"Der Dreisprung der Männer bei den Leichtathletik-Europameisterschaften 2014 wurde am 12. und 14. August 2014 im Letzigrund-Stadion von Zürich ausgetragen.\\nMit Silber und Bronze errangen die russischen Dreispringer in diesem Wettbewerb zwei Medaillen. Europameister wurde der Franzose Benjamin Compaoré. Den zweiten Rang belegte Ljukman Adams. Auf den dritten Platz kam Alexei Fjodorow."},{"page_url":"https://ro.wikipedia.org/wiki/Nephila_clavata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Cannibalization%28silk_spider%29.jpg","page_title":"Nephila clavata","context_page_description":"Nephila clavata, cunoscut și sub numele de Păianjen Jorō, este un membru al genului Nephila, păianjeni țesători sferici aurii."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%AF%D9%8A%D9%82%D8%A9_%D8%A8%D8%AD%D9%8A%D8%B1%D8%A7%D8%AA_%D9%88%D8%A7%D8%AA%D8%B1%D8%AA%D9%88%D9%86_%D8%A7%D9%84%D9%88%D8%B7%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/MooseAtCameronLake.JPG","page_title":"حديقة بحيرات واترتون الوطنية","context_page_description":"حديقة بحيرات واترتون الوطنيَّة هيَ حديقة وطنية تقع عند الزاوية الجنوبية الغربية لولاية ألبرتا الكنديَّة، وعند حدود حديقة نهر الجليد الوطنيَّة في ولاية مونتانا الأمريكيَّة. كانت حديقة بحيرات واترون رابعَ حديقة وطنيَّة تنشأ في كندا، إذ أنها أسست في عام 1895، وأطلق عليها اسمها نسبة إلى بحيرة واترتون. وتبلغ مساحة هذه الحديقة حوالي 505 كيلومترات مربَّعة، تمتد عبرَ برية واسعة من الجبال الوعرة.\\nتُشتمل حديقة بحيرات واترتون الوطنيَّة ضمن إدارة وكالة حدائق كندا، وهي تفتح أبوابها طوال العام، على الرغم من أن الموسم السياحي الرئيسي فيها يكون خلال شهري يوليو وأغسطس فقط. ولا توجد محال تجاريَّة في الحديقة سوى بجوار قرية واترتون. يتراوح ارتفاع هذه المنطقة عن مستوى البحر بين 1,290 متراً عند القرية و2,910 أمتار عند قمة بلاكستون، وقد بلغ عدد زوَّار الحديقة 367,500 عام 2004."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_S%C3%BCdb%C3%B6hmen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Bratronice%2C_z%C3%A1mek.jpg","page_title":"Liste von Burgen und Schlössern in Südböhmen","context_page_description":"Diese Liste führt Burgen und Schlösser in Südböhmen auf und umfasst die Südböhmische Region um České Budějovice und die Region Hochland um Jihlava. Sie ist Teil der Liste von Burgen und Schlössern in Tschechien. Die Liste erhebt keinen Anspruch auf Vollständigkeit. Es werden die tschechischen Namen verwendet und in Klammern die deutschen Namen angegeben."},{"page_url":"https://es.wikipedia.org/wiki/Trenque_Lauquen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Trenque_Lauquen_-_Club_Atl%C3%A9tico_Trenque_Lauquen_1_entrada.jpg","page_title":"Trenque Lauquen","context_page_description":"Trenque Lauquen es la ciudad cabecera del partido homónimo, de la provincia de Buenos Aires, Argentina. Se encuentra a 445 km de la Ciudad Autónoma de Buenos Aires por RN 5, y a 505 km de la capital provincial La Plata."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D8%A7%D9%84%D9%8A%D9%85%D8%A7%D9%87_%D9%86%D8%A7%D9%83%D8%A7%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Halimah_Nakaayi_%28cropped%29.jpg","page_title":"هاليماه ناكاى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nهاليماه ناكاى منافسه العاب قوى من اوجاندا."},{"page_url":"https://la.wikipedia.org/wiki/Schola_superior_Factionis_Communisticae_Unionis_Sovieticae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D0%92%D0%9F%D0%A8_1954.JPG","page_title":"Schola superior Factionis Communisticae Unionis Sovieticae","context_page_description":"Schola superior factionis communisticae Sovieticae pro ipso Vladimiro Lenin nominata institutum princeps politicis communisticis erudiendis in Unione Sovietica fuit."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%BD%D1%82%D0%B0%D0%B6%D1%96%D0%B2%D0%BA%D0%B0_%D1%80%D0%BE%D0%BA%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Daf_XF105-460.jpg","page_title":"Вантажівка року","context_page_description":"Вантажівка року — щорічний конкурс для визначення найкращого серед вантажних транспортних засобів, що представлені на європейському ринку. Конкурс Вантажівка року проводиться з 1977 року.\\nПереможець визначається міжнародним журі, яке складається з 20 журналістів, фахівців з комерційних автомобілів."},{"page_url":"https://en.wikipedia.org/wiki/Emil_Ruder","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/TM_Typographische_Monatsbl%C3%A4tter_1953_04.jpg","page_title":"Emil Ruder","context_page_description":"Emil Ruder was a Swiss typographer and graphic designer, who with Armin Hofmann joined the faculty of the Schule für Gestaltung Basel.\\nHe is distinguishable in the field of typography for developing a holistic approach to designing and teaching that consisted of philosophy, theory and a systematic practical methodology. He expressed lofty aspirations for graphic design, writing that part of its function was to promote 'the good and the beautiful in word and image and to open the way to the arts'. He was one of the major contributors to Swiss Style design. He taught that typography's purpose was to communicate ideas through writing, as well as placing a heavy importance on Sans-serif typefaces. No other designer since Jan Tschichold was as committed as Ruder to the discipline of letterpress typography or wrote about it with such conviction."},{"page_url":"https://tr.wikipedia.org/wiki/RMS_Titanic","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Britannic_Funnel_in_transport.jpg","page_title":"RMS Titanic","context_page_description":"RMS Titanic, White Star Line şirketine ait Olympic sınıfı bir transatlantik yolcu gemisiydi. Harland and Wolff tersanelerinde üretilmiştir. 15 Nisan 1912 gecesi daha ilk seferinde bir buz dağına çarpmış ve yaklaşık iki saat kırk dakika içinde Kuzey Atlantik'in buzlu sularına gömülmüştür.1912'de yapımı tamamlandığında dünyanın en büyük buharlı yolcu gemisiydi. Batışı 1.514 kişinin ölümüyle sonuçlanmış ve en büyük deniz felaketlerinden biri olarak tarihe geçmiştir.\\nTitanic\`in batışının yol açtığı büyük can kaybı oranı birçok nedene bağlanmaktaydı ama zamanla öne çıkan gerçek, geminin herkese yetecek kadar filika taşımıyor olmasıydı. Titanic\`in tam kapasitesi 3,547 kişi olmasına rağmen gemideki filikaların toplam kapasitesi 1,178 kişiydi. Ayrıca kaza sırasında kadınlara ve çocuklara öncelik tanındığı için toplamda ölen erkek sayısı da çok orantısızdı.\\nTitanic\`te zamanında mevcut olan en ileri teknolojiler kullanılmıştı. Birçok insan tarafından \\"batmaz gemi\\" olduğuna inanılıyordu ve bu inanış batmadan önce bu şekilde tanımlanmış ve lanse edilmişti. Bu derece ileri teknoloji ve eğitimli mürettebata rağmen batması birçok insanı şoke etti."},{"page_url":"https://en.wikipedia.org/wiki/List_of_state_and_county_courthouses_in_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Centre_County_Courthouse_Apr_09.jpg","page_title":"List of state and county courthouses in Pennsylvania","context_page_description":"This is a list of former and current non-federal courthouses in the Commonwealth of Pennsylvania. Each of the 67 counties in the Commonwealth has a city designated as the county seat where the county government resides, including a county courthouse for the court of general jurisdiction, the Court of Common Pleas. Other courthouses are used by the three state-wide appellate courts, or minor courts such as the municipal courts of Philadelphia and Pittsburgh, or magisterial district courts. As noted below, some courthouses are listed on the National Register of Historic Places."},{"page_url":"https://et.wikipedia.org/wiki/Avianca","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Avianca_Logo_2013.png","page_title":"Avianca","context_page_description":"Avianca S.A. on Colombia rahvuslik lennufirma. Lennufirmast sai 21. juunil 2018 Star Alliance´i ametlik liige."},{"page_url":"https://en.wikipedia.org/wiki/Barleria_cristata","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Barleria_cristata_W_IMG_2899.jpg","page_title":"Barleria cristata","context_page_description":"Barleria cristata, the Philippine violet, bluebell barleria or crested Philippine violet, is a plant species in the family Acanthaceae."},{"page_url":"https://ca.wikipedia.org/wiki/Proc%C3%A9s_industrial","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Dreher_an_einer_Drehbank.jpg","page_title":"Procés industrial","context_page_description":"Un procés industrial, procés de fabricació, manufactura o producció és el conjunt d'operacions necessàries per modificar les característiques de les matèries primeres. Aquestes característiques poden ser de naturalesa molt variada com ara la forma, la densitat, la resistència, la mida o l'estètica. Es realitzen en l'àmbit de la indústria. En la immensa majoria dels casos, per a l'obtenció d'un determinat producte seran necessàries multitud d'operacions individuals de manera que, depenent de l'escala d'observació, es pot denominar procés tant al conjunt d'operacions des de l'extracció dels recursos naturals necessaris fins a la venda del producte com a les realitzades en un lloc de treball amb una determinada màquina eina."},{"page_url":"https://en.wikipedia.org/wiki/Pushkin,_Saint_Petersburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Liceum_Building_in_Tsarskoe_Selo_04.jpg","page_title":"Pushkin, Saint Petersburg","context_page_description":"Pushkin is a municipal town in Pushkinsky District of the federal city of St. Petersburg, Russia, located 24 kilometers south from the center of St. Petersburg proper, and its railway station, Tsarskoye Selo, is directly connected by railway to the Vitebsky Rail Terminal of the city. Population: 92,889.\\nPushkin was founded in 1710 as an imperial residence named Tsarskoye Selo and received status of a town in 1808. The first public railways in Russia, Tsarskoye Selo Railways, were opened here in 1837 and connected the town to the capital St. Petersburg. After the October Revolution, the town was renamed to Detskoye Selo. Its name was further changed in 1937 to Pushkin to commemorate the 100th anniversary of the death of the Russian poet Alexander Pushkin. The town contains an ensemble of the 18th century \\"Tsarskoye Selo\\". This museum complex includes the Catherine Palace, Alexander Palace and other buildings and associated parks; it is a major tourist attraction of the area and is included in the list of monuments protected by the UNESCO."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Moorfleet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/R%C3%B6mische_Skulptur_Sandwisch_51_HH-Moorfleet_%281%29.jpg","page_title":"Liste der Kulturdenkmäler in Hamburg-Moorfleet","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Moorfleet enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet des Stadtteils Moorfleet der Freien und Hansestadt Hamburg.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Transparenzportal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013 unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung. Alle Denkmäler in Moorfleet, die schon nach dem Denkmalschutzgesetz vom 3. Dezember 1973, zuletzt geändert am 27. November 2007, unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Bergedorf zu finden."},{"page_url":"https://la.wikipedia.org/wiki/Theophilus_Homolle","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Theophile_Homolle.jpg","page_title":"Theophilus Homolle","context_page_description":"Theophilus Homolle Scholam Athenarum Francicae ab anno 1890 1903 usque et ab anno 1912 usque ad 1913 rexit; postea fuit administer generalis Bibliothecae Nationalis Francicae ab anno 1913 usque ad 1923."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8D%8E%E5%BF%A0%E6%B4%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Jangchungdong_junggu.png","page_title":"獎忠洞","context_page_description":"奖忠洞，是位于韩国首尔中区的一个行政洞，位于中区南部。"},{"page_url":"https://de.wikipedia.org/wiki/Studia_austriaca","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/YZ_AUS24.jpg","page_title":"Studia austriaca","context_page_description":"Studia austriaca ist ein internationales Periodikum für das Studium der österreichischen Literatur und Kultur.\\nDie Zeitschrift erscheint jährlich im Frühling als elektronische wissenschaftliche Peer-Review-Open-Access-Fachzeitschrift. Sie wird mit OJS betrieben und im Rahmen des Projekts Zeitschriften der Fakultät für Geisteswissenschaften der Universität Mailand publiziert.\\nStudia austriaca wurde 1992 von Fausto Cercignani gegründet und seitdem von ihm herausgegeben.\\nDie Zeitschrift erschien zum ersten Mal als elektronische Publikation mit Band XX.\\nDie Bände I-XIX erschienen im Druck zwischen 1992 und 2011 und sind heute als PDF-Dateien auf der Website der Zeitschrift frei zugänglich.\\nStudia austriaca ist indiziert in:\\nSCOPUS - The largest abstract and citation database\\nESCI - Web of Science’ Emerging Sources Citation Index\\nDOAJ - Directory of Open Access Journals\\nERIH PLUS - The European Reference Index for the Humanities and the Social Sciences\\nEZB - Elektronische Zeitschriftenbibliothek\\nZDB - Zeitschriftendatenbank\\nBASE - Bielefeld Academic Search Engine\\nROAD - Directory of Open Access Scholarly Resources\\nPLEIADI - Portale per la Letteratura Scientifica"},{"page_url":"https://qu.wikipedia.org/wiki/Glasgow","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Glasgow_Coat_of_Arms.png","page_title":"Glasgow","context_page_description":"Glasgow."},{"page_url":"https://es.wikipedia.org/wiki/%C3%81ngel_Antonio_Salvadores","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Flag_of_Unitarian_Party_%28Navy%29.svg","page_title":"Ángel Antonio Salvadores","context_page_description":"Ángel Antonio Salvadores fue un militar argentino de larga trayectoria que tras haber participado en la lucha contra las invasiones inglesas, la Guerra de Independencia de la Argentina y del Perú, tuvo un destacado papel en las guerras civiles argentinas, luchando por la facción unitaria hasta su muerte.\\nEra primo carnal del doctor Mariano Moreno, uno de los ideólogos de la Revolución de Mayo y secretario de la Primera Junta, resultante de la misma."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D1%83%D0%B1_%D0%9F%D1%80%D0%BE%D1%81%D1%82%D0%B0%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Coot_Club_cover.jpg","page_title":"Клуб Простака","context_page_description":"«Клуб л» — пятая книга Артура Рэнсома из серии детских книг Ласточки и Амазонки, изданных в 1934. Книга рассказывает о Дике и Доротею Каллумне, посещающих Норфолкские озера во время пасхальных каникул, стремящихся учиться пересекать озеро под парусом и таким образом производить впечатление на Амазонок, когда они возвращаются в Озерный край. Наряду с броском новых характеров, Дик и Доротея исследуют Северный и Южный Берега и становятся 'матросами'."},{"page_url":"https://en.wikipedia.org/wiki/Romanos_III_Argyros","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Histamenon_nomisma-Constantine_VIII-sb1776.jpg","page_title":"Romanos III Argyros","context_page_description":"Romanos III Argyros, or Romanus III Argyrus, was Byzantine Emperor from 15 November 1028 until his death. He was a Byzantine noble and senior official in Constantinople when the dying Constantine VIII forced him to divorce his wife and marry the emperor's daughter Zoë. Upon Constantine's death three days later, Romanos took the throne.\\nRomanos has been recorded as a well meaning but ineffective emperor. He disorganised the tax system and undermined the military, personally leading a disastrous military expedition against Aleppo. He fell out with his wife and foiled several attempts on his throne, including two which revolved around his sister-in-law Theodora. He spent large amounts on the construction and repair of churches and monasteries. He died after six years on the throne, allegedly murdered, and was succeeded by his wife's young lover, Michael IV."},{"page_url":"https://pt.wikipedia.org/wiki/Mili%C4%8Dinica","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Selo_Mili%C4%8Dinica_-_op%C5%A1tina_Valjevo_-_zapadna_Srbija_-_panorama_17.jpg","page_title":"Miličinica","context_page_description":"Miličinica é uma vila da Sérvia localizada no município de Valjevo, pertencente ao distrito de Kolubara. A sua população era de 740 habitantes segundo o censo de 2011."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%88%B1%E5%8F%B8%E5%9F%BA%E5%9C%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Ace_Of_Base_Toronto_2010_%28modified%29.JPG","page_title":"爱司基地","context_page_description":"爱司基地是一个瑞典流行音乐组合，其成员包括Jonas Berggren、Ulf Ekberg、Malin Berggren和Jenny Berggren；爱司基地乐队常被和ABBA乐队和水叮当乐队并称。"},{"page_url":"https://ast.wikipedia.org/wiki/Nuria_Cabanillas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Conjunto_espa%C3%B1ol_1995_Praga.PNG","page_title":"Nuria Cabanillas","context_page_description":"Nuria Cabanillas Provencio ye una ex ximnasta rítmica española, tricampeona del mundu y medaya d'oru nos Xuegos Olímpicos d'Atlanta 1996.\\nEn 1995 pasó a formar parte del conxuntu español absolutu de ximnasia rítmica, en tando nel conxuntu júnior y ser individual sénior. De magar, toles medayes que llogró en competiciones oficiales fueron consiguíes como miembru del conxuntu español. La so primer competición importante foi'l Campeonatu Européu en Praga, onde se proclamó subcampeona d'Europa na modalidá de 3 pelotes y 2 cintes, amás de llevase otres dos medayes de bronce nel concursu xeneral y na final de 5 aros. Esi mesmu añu proclamóse campeona del mundu per primer vegada. Sería na competición de 3 pelotes y 2 cintes nel Campeonatu Mundial de Viena. Amás d'esti oru, llevóse dos plates nel concursu xeneral y na final de 5 aros.\\nNel añu 1996 conquistó'l so segundu títulu mundial na final de 3 pelotes y 2 cintes del Campeonatu Mundial de Budapest, competición na que se llevó tamién la plata nel concursu xeneral."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD-%D1%81%D1%8E%D1%80-%D0%9C%D0%B5%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/FR-55-Han-sur-Meuse.JPG","page_title":"Ан-сюр-Мез","context_page_description":"Ан-сюр-Мез — муніципалітет у Франції, у регіоні Лотарингія, департамент Мез. Населення — 273 осіб.\\nМуніципалітет розташований на відстані близько 240 км на схід від Парижа, 55 км на південний захід від Меца, 30 км на схід від Бар-ле-Дюка."},{"page_url":"https://fr.wikipedia.org/wiki/Elle_et_lui_(film,_1939)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/CharlesBoyerinLoveAffair.jpg","page_title":"Elle et lui (film, 1939)","context_page_description":"Elle et lui est un film américain réalisé par Leo McCarey, sorti en 1939. Leo McCarey tournera en 1957 un remake en couleur de son propre film : Elle et lui avec Deborah Kerr et Cary Grant."},{"page_url":"https://en.wikipedia.org/wiki/La_Faute_de_l%27Abb%C3%A9_Mouret","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/ZolaSinFatherMouret.jpg","page_title":"La Faute de l'Abbé Mouret","context_page_description":"La Faute de l'Abbé Mouret is the fifth novel in Émile Zola's twenty-volume series Les Rougon-Macquart. Viciously anticlerical in tone, it follows on from the horrific events at the end of La Conquête de Plassans, focussing this time on a remote Provençal backwater village.\\nUnusually for Zola, the novel contains very few characters and locations, and the level of realist observation compared to outright fantasy is most uncharacteristic; however, the novel remains extraordinarily powerful and readable, and is considered one of Zola's most linguistically inventive and well-crafted works."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89cluse_de_R%C3%A9chicourt-le-Ch%C3%A2teau","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Ecluse_Rechicourt_01.JPG","page_title":"Écluse de Réchicourt-le-Château","context_page_description":"L’écluse de Réchicourt-le-Château est un ouvrage d’art construit en 1965 sur le canal de la Marne au Rhin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B5%D0%B9_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Fergana_obl_coa.png","page_title":"Список областей Российской империи","context_page_description":"Ниже приведён список всех областей, существовавших в Российской империи."},{"page_url":"https://en.wikipedia.org/wiki/Megacorma","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Megacorma_obliqua.jpg","page_title":"Megacorma","context_page_description":"Megacorma is a genus of moths in the family Sphingidae. The genus was erected by Walter Rothschild and Karl Jordan in 1903."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%93%81%E8%B7%AF%E5%88%B6%E5%8A%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Westinghouse_Memorial%E2%80%94Air_Brake.jpg","page_title":"铁路制动","context_page_description":"铁路制动装置是对铁道机车车辆实施制动的一套系统，其主要作用是控制铁道机车车辆的运行速度，使运行中的列车能迅速地减速、停车，或者在下坡道上使其按限定速度运行，防止列车在下坡时由于车辆的重力作用导致超速；即使是静止状态的机车车辆也需要对其施行制动，以免停放车辆因重力作用或风力吹动而溜逸。因此，铁路制动是保障铁路运输安全的一个重要环节，若列车高速行驶时无法依靠制动来控制速度或使之停车，必定会发生危险甚至造成严重事故。各国铁路业者根据自身的铁路运用管理经验，对列车制动距离的要求都有严格规定，这亦是反映制动装置性能和实际制动效果的主要技术指标。\\n驱动列车运行必须对列车作用以牵引力，而制动列车则必须对列车作用以制动力，制动力是由制动装置产生并且与列车运行方间相反的阻力。从物理学的角度来看，制动的本质其实就是将列车上的动能转移出去，制动装置转移动能的能力被称为制动功率。在一定的制动距离条件下，列车的制动功率是其运动速度的三次函数，即制动功率与运动速度的平方成正比，因此运行速度越高的机车车辆，对于制动装置和制动能力的要求也越高。"},{"page_url":"https://fr.wikipedia.org/wiki/Aleksandr_Derevyagin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Aleksandr_Derevyagin_at_Josef_Odlozil_Memorial_in_Prague_14June2010_116.jpg","page_title":"Aleksandr Derevyagin","context_page_description":"Aleksandr Aleksandrovitch Derevyagin, né le 24 mars 1979, est un athlète russe spécialiste du 400 mètres haies."},{"page_url":"https://en.wikipedia.org/wiki/Terminus_C%C3%B4te-Vertu","image_url":"https://upload.wikimedia.org/wikipedia/en/a/ab/Terminus_C%C3%B4te-Vertu_north_terminal.jpg","page_title":"Terminus Côte-Vertu","context_page_description":"Terminus Côte-Vertu is an Exo bus terminus partly north and partly south of the Côte-Vertu Metro station. It is located in the borough of Saint-Laurent in Montreal, Quebec, Canada.\\nBefore this new terminus was built, all bus stops were located on the streets near the Metro station entrances. This created a lot of traffic jams on Côte-Vertu and Decarie boulevards. The buses heading to the West Island were inconveniently located at the Edouard-Laurin street entrance. The southern portion of the terminus occupies part of what was once the Edouard-Laurin Streetcar Terminus."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A5%BF%E7%8F%AD%E7%89%99%E7%BB%8F%E6%B5%8E%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Factor%C3%ADa_de_salazones_001.jpg","page_title":"西班牙经济史","context_page_description":"這篇文章講述了西班牙經濟在其歷史進程中的發展。"},{"page_url":"https://pl.wikipedia.org/wiki/Szuflada_wspomnie%C5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Okladka_Szuflada_wspomnien.jpg","page_title":"Szuflada wspomnień","context_page_description":"Szuflada Wspomnień – album zespołu the G[H]OST wydany w październiku 2011 przy pomocy nieistniejącego już portalu MegaTotal. Płyta została częściowo sfinansowana przez wpłaty użytkowników serwisu Megatotal.\\nAlbum zawiera utwory autorskie zespołu, których kompozytorami i autorami tekstów są członkowie zespołu wokalista Marian Szulczyński i gitarzysta Mateusz Szulczyński.\\nNagrania zostały zrealizowane od kwietnia do czerwca 2011 r. w studiu nagraniowym ROCKSUN w Pleszewie. Realizatorem nagrań był Sergiusz Supron."},{"page_url":"https://nl.wikipedia.org/wiki/Finhaut","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Karte_Gemeinde_Finhaut_2007.png","page_title":"Finhaut","context_page_description":"Finhaut is een gemeente en plaats in het Zwitserse kanton Wallis, en maakt deel uit van het district Saint-Maurice.\\nFinhaut telt 447 inwoners.\\nOp 20 juli 2016 was Finhaut de aankomstplaats voor de 17e etappe van de Tour de France. De Rus Ilnoer Zakarin won deze rit."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%A6%D5%A4%D6%80%D5%B8%D5%BD%D5%AF%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Gray244.png","page_title":"Ազդրոսկր","context_page_description":"Ազդրոսկր, մարդու մարմնի խողովակաձև ամենամեծ ոսկրը: Մարմինն ունի գլանաձև տեսք և առջևում ինչ-որ չափով ուռուցիկ է, նրա հետևի մակերեսի երկայնքով ձգվում է անհարթ առանցք, որը ծառայում է մկանների ամրացման համար: Մարմինը ներքևի մասում լայնանում է:\\nՊրոկսիմալ ծայրի վրա գտնվում է ազդրոսկրի գլխիկը, որն ունի հոդային մակերևույթ, որը ծառայում է կոնքային խոռոչի հետ ամրացման համար: Գլխիկի մակերևույթի մեջտեղում կա փոսիկ: Գլխիկը ոսկրերի մարմնին միացված է լավ արտահայտված պարանոցով, որի առանցքը ազդրոսկրի մարմնի երկայնական առանցքի հետ կապված մոտավորապես 130 ° է: Այն վայրում, որտեղ պարանոցը վերածվում է մարմնի, կան երկու թմբիկներ\` մեծ գլխիկ և փոքր գլխիկ: Առաջինը հանդես է գալիս լետալը, հեշտությամբ շոշափվում է մաշկի տակ, երկրորդը տեղադրված է հետևից և խորքային: Մեծ գլխիկի ներսում, ազդրի վզիկի կողմից, գտնվում է ազդի գլխիկային խոռոչը: Երկու գլխիկները միմյանց են միանում դիմացից միջգլխային առանցքով, իսկ հետևից լավ արտահայտված միջգլխային սանրիկով: Այս բոլոր ելուստները ու խոռոչները ծառայում են մկանների կցման համար:"},{"page_url":"https://tr.wikipedia.org/wiki/D%C3%BCnyan%C4%B1n_Harikalar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Gizeh_Cheops_BW_1.jpg","page_title":"Dünyanın Harikaları","context_page_description":"Dünyanın Harikaları, listeleri antik çağlardan günümüze dünyanın en muhteşem doğal ve yapay güzellikler derlenerek oluşturulmuştur.\\nAntik Dünyanın Yedi Harikası klasik antik dünyanın bilinen ilk ve en dikkat çekici örneğini oluşturmaktadır. Bu liste, sadece Akdeniz çevresinde yer alan eserler arasından derlenmiştir. Yedi sayısı, o dönemde bilinen beş gezegen, güneş ve ayın toplamı olduğu için Yunanlar tarafından bereketi ve mükemmeliyeti ifade etmekteydi ve bu nedenle benzer listeler hep yedi sayısı baz alınarak oluşturulmaktaydı."},{"page_url":"https://pt.wikipedia.org/wiki/Capela_de_Nossa_Senhora_da_Concei%C3%A7%C3%A3o_(C%C3%A2mara_de_Lobos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Porta_de_entrada_da_Capela.jpg","page_title":"Capela de Nossa Senhora da Conceição (Câmara de Lobos)","context_page_description":"A capela da Nossa Senhora da Conceição, também conhecida como Capela da Nossa Senhora do Calhau, é uma capela edificada no concelho de Câmara de Lobos, Madeira, Portugal e está localizada na baía de Câmara de Lobos ao lado das embarcações de pesca. A festa anual em honra da Nossa Senhora, realiza-se a 8 de Dezembro e tem como finalidade dar graças pelos pescadores salvos e implorar que nada de mal os aconteça nos dias de hoje."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%87%D0%B5%D0%BD%D0%BE%D0%B2,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/%D0%A4%D0%B8%D0%B7%D0%B8%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8_%D0%B3%D0%B8%D1%81%D1%82%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82_%281897%29.jpg","page_title":"Сеченов, Иван Михайлович","context_page_description":"Ива́н Миха́йлович Се́ченов — русский учёный-естествоиспытатель, физиолог, педагог и просветитель. Член-корреспондент, почётный член Санкт-Петербургской академии наук. Создатель первой российской физиологической научной школы и естественно-научного материалистического направления в психологии."},{"page_url":"https://de.wikipedia.org/wiki/Havelkanal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Stra%C3%9Fenbr%C3%BCcke_Brieselang_%287%29.jpg","page_title":"Havelkanal","context_page_description":"Der Havelkanal, amtliches Kürzel HvK, ist eine Bundeswasserstraße im Bundesland Brandenburg und beginnt bei km 0,41 zwischen Nieder Neuendorf und Hennigsdorf an der Havel und endet bei km 34,59 bei Paretz in der Nähe von Ketzin wiederum an der Havel. Er ist als Wasserstraßenklasse IV mit Einschränkungen ausgewiesen; vom Güterverkehrszentrum Wustermark in Richtung Untere Havel-Wasserstraße läuft der Ausbau auf Klasse Vb.\\nEr hat eine Länge von 34,18 km und überwindet an der Kanalstufe Schönwalde einen Höhenunterschied von rund zwei Metern. Auf beiden Seiten der Schleuse liegt der Wasserstand der Havel an.\\nZuständig für die Verwaltung ist für die Anfangsstrecke bis zur Straßenbrücke Spandauer Allee in Hennigsdorf das Wasserstraßen- und Schifffahrtsamt Berlin, anschließend das Wasserstraßen- und Schifffahrtsamt Brandenburg."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%BA%D0%BE-%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%B0_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87%D0%B0_%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%BC%D1%8B%D1%80%D0%B4%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%BC%D1%8B%D1%80%D0%B4%D0%B8%D0%BD%D0%B0.jpg","page_title":"Историко-мемориальный музей Виктора Степановича Черномырдина","context_page_description":"Историко-мемориальный музей Виктора Степановича Черномырдина — автономная некоммерческая организация. Музей основан 23 марта 2011 года и расположен в селе Чёрный Отрог Саракташского района Оренбургской области — на родине В. С. Черномырдина, председателя Правительства Российской Федерации в 1992—1998 годах."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Werbelokomotiven_der_Schweizerischen_Bundesbahnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/FFS_Re_460_028-4_Zuerich_HB_180308_EC173_CANALETTO_Schaffhausen-Venezia_S_Lucia.jpg","page_title":"Liste der Werbelokomotiven der Schweizerischen Bundesbahnen","context_page_description":"Die SBB besitzen eine grosse Bandbreite an Fahrzeugen mit Werbe-Farbgebungen. Vor 1994 gab es nur vereinzelte Loks oder Wagen in anderer Farbgebung als den Standardfarben; dies änderte sich jedoch, als die ersten Re 460 Werbelackierungen erhielten. Auch verschiedene andere Fahrzeuge erhielten Werbeanstriche, so beispielsweise Re 420 oder Re 450."},{"page_url":"https://da.wikipedia.org/wiki/Paionien","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Greek_Mythological_origin_of_Paeon_%28Paionia_Paeonia%29_%28English%29.png","page_title":"Paionien","context_page_description":"Paionien var i antikken paionernes land og kongerige.\\nI Iliaden er paionierne beskrevet som Trojas allierede.\\nUnder Perserkrigene blev de besejrede paioniere taget til fange og deporteret til Asien.\\nPaionernes kong Agis døde 358 f.Kr. og det udnyttede Filip 2. ved 355-354 f.Kr. at erobre den sydlige del af Paionien, som herefter blev kaldt ”Makedonsk Paionien”. Dette område omfattede byerne Astraion, Stenae, Antigonea med flere.\\nPaioniens grænser er ikke kendte, men man ved, at det lå umiddelbart nord for Kongeriget Makedonien"},{"page_url":"https://id.wikipedia.org/wiki/Desy_Ratnasari","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Desy_Ratnasari.jpg","page_title":"Desy Ratnasari","context_page_description":"Hj. Desy Ratnasari, M.Psi., M.Si. merupakan aktris film dan sinetron, model, bintang iklan, penyanyi, pembawa acara papan atas, dan politisi Indonesia. Sejak 2014, Desy terpilih sebagai anggota DPR RI dari Partai Amanat Nasional yang akan berakhir pada tahun 2019."},{"page_url":"https://de.wikipedia.org/wiki/Schweizer_Truppen_in_niederl%C3%A4ndischen_Diensten","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Karte_Haus_Burgund_5.png","page_title":"Schweizer Truppen in niederländischen Diensten","context_page_description":"Von 1568 bis 1829 standen 31 Schweizer Truppen in niederländischen Diensten, schätzungsweise gesamthaft rund 80'000 Mann.\\nSie waren in drei Abschnitten der Geschichte der Niederlande im Einsatz: erstmals vom 16. bis zum 18. Jahrhundert, im 18. Jahrhundert in Afrika und Asien für die Niederländische Ostindien-Kompanie und im 19. Jahrhundert in der Armee der nach dem Wienerkongress 1815 entstandenen konstitutionellen Monarchie des Vereinigten Königreichs der Niederlande.\\nSchweizer Truppen in fremden Diensten waren der von Behörden der Schweizer Eidgenossenschaft mit Staatsverträgen geregelte Solddienst von geführten, ganzen Truppenkörpern im Ausland.\\nDiese Verträge enthielten ein Kapitel, das die militärischen Angelegenheiten regelte: die sogenannte Kapitulation."},{"page_url":"https://en.wikipedia.org/wiki/Victor_Rodman","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/The_Spotted_Lily_%281917%29_-_1.jpg","page_title":"Victor Rodman","context_page_description":"Victor Rodman was an American actor best known for his work on two Jack Webb NBC television programs, Dragnet and Noah's Ark."},{"page_url":"https://it.wikipedia.org/wiki/Terzo_Tempio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/IndependenceTemple3.jpg","page_title":"Terzo Tempio","context_page_description":"Il Terzo Tempio, o Tempio di Ezechiele in ebraico: בית המקדש השלישי‎, è un Tempio Sacro per Dio del popolo ebraico, popolo eletto, descritto architetturalmente e profetizzato nel Libro di Ezechiele, luogo di preghiera per tutti, con servizio liturgico di sacrifici. Viene descritto da Ezechiele come un edificio eterno e dimora permanente del Dio di Israele sul Monte del Tempio di Gerusalemme."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%BC%E3%82%AF_B_%E4%B8%AD%E6%88%A6%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/MediumMarkB3.jpg","page_title":"マーク B 中戦車","context_page_description":"マークB中戦車とは、第一次世界大戦時にホイペット中戦車の後継として開発されたイギリスの戦車である。しかし、最終的に性能不足であることから戦争終結の時点で量産がキャンセルされた。"},{"page_url":"https://id.wikipedia.org/wiki/Daniel_Petric","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/TaurusPT92.jpg","page_title":"Daniel Petric","context_page_description":"Daniel Petric adalah seorang pembunuh asal Wellington, Ohio, Amerika Serikat yang telah dipenjarakan sejak tanggal 12 Januari 2009. Saat berumur 16 tahun, ia menembak kedua orangtuanya dengan pistol dengan alasan perselisihan mengenai video game. Akibatnya, ibunya meninggal dunia karena tertembak serta ayahnya mengalami luka parah. Namun, ayahnya segera sembuh dari luka parah tersebut."},{"page_url":"https://de.wikipedia.org/wiki/Peyton_Siva","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Peyton_Siva_%28cropped%29.jpg","page_title":"Peyton Siva","context_page_description":"Peyton Robert Siva junior ist ein US-amerikanischer Basketballspieler. Während seines Studiums in seinem Heimatland gewann Siva 2013 mit seiner Mannschaft Louisville Cardinals die NCAA Division I Basketball Championship und wurde individuell mit dem Frances Pomeroy Naismith Award ausgezeichnet. Nachdem er im NBA-Draft 2013 von den Detroit Pistons ausgewählt worden war, konnte er sich dort jedoch nicht durchsetzen und kam über die NBA Development League nach Europa. Nach einer Saison in der italienischen Lega Basket Serie A spielt Siva in der Basketball-Bundesliga 2016/17 für Alba Berlin in Deutschland."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%98%D7%99%D7%A3_%D7%93%D7%95%D7%91%D7%93%D7%91%D7%A0%D7%99%D7%9D_(%D7%9B%D7%A9%D7%9C_%D7%9C%D7%95%D7%92%D7%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Temperaturanstieg-vergleich-zwischen-ausschnitt-und-gesamtverlauf.gif","page_title":"קטיף דובדבנים (כשל לוגי)","context_page_description":"קטיף דובדבנים הוא דימוי המתאר הצגה סלקטיבית של נתונים במטרה לתמוך בעמדה מסוימת. כלומר, הצגת נתונים שיש בהם כדי לאשש דעה או טענה כלשהי, תוך התעלמות מנתונים שיש בהם כדי להפריך דעה או טענה זו או להחלישה. קטיף דובדבנים הוא אחד מן הכשלים הלוגיים של תשומת לב סלקטיבית, בדומה להטיית אישור‏. קטיף דובדבנים נעשה לעיתים בכוונה ולשם הטעייה, אך גם באופן לא מודע.\\nהמינוח שואב השראה מתהליך קטיף ממשי, שבו מצופה מן הפועל לקטוף רק את הפירות הטובים עבורו. מי שיראה רק את הפירות שנקטפו עלול להסיק כי רוב הפרות במטע, או אף כולם, הם באיכות הטובה ביותר. מסקנה זו שגויה, משום שהפירות שנקטפו אינם מדגם מייצג של כלל הפירות.\\nהטיה אחרת שלעיתים מתבלבלים בינה לבין קטיף דובדבנים, היא איסוף סלקטיבי של הפירות הקלים להשגה, תוך התעלמות מפירות קשים להשגה.\\nשיטה של קטיף דובדבנים הנפוצה בקהילות של פסאודו-מדע ותאוריות קונספירציה היא כריית ציטוטים. מינוח זה שואב השראה מתהליך הכרייה של מינרלים נדירים ויקרי מציאות. בתהליך זה סורקים באופן שיטתי מסמך הנתפס כבעל סמכות ואמינות גבוהות, למשל ספר מדע או מאמר מדעי של מומחה הנחשב בר-סמכא בתחומו, במטרה לאתר ציטוטים אשר, כאשר מנתקים אותם מהקשרם, עשויים להשמע כתומכים בעמדותיהם של הכורים."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Plan%C3%A9_(okres_Tachov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Plan%C3%A1%2C_d%C5%AFm_%C4%8Dp.10.jpg","page_title":"Seznam kulturních památek v Plané (okres Tachov)","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Planá v okrese Tachov vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Orgeln_in_Wien","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Orgel_St._Benedikt_Liebhartstal.jpg","page_title":"Liste der Orgeln in Wien","context_page_description":"In der Liste der Orgeln in Wien werden sukzessive alle Orgeln in Wien erfasst."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D1%83,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/RobertoGrau.jpg","page_title":"Грау, Роберто","context_page_description":"Роберто Габриель Грау — аргентинский шахматист, национальный мастер.\\nПрофессиональный журналист."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Les_Grangettes","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Map_commune_FR_insee_code_25295.png","page_title":"Les Grangettes","context_page_description":"Les Grangettes sī ūi-tī Hoat-kok Franche-Comté tōa-khu Doubs séng ê chi̍t-ê commune."},{"page_url":"https://cy.wikipedia.org/wiki/Breisach_am_Rhein","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Breisach_73.850.jpg","page_title":"Breisach am Rhein","context_page_description":"Dinas yn ardal Breisgau, yn rhanbarth Breisgau-Hochschwarzwald o dalaith Baden-Württemberg yn yr Almaen yw Breisach am Rhein, neu yn fyr Breisach. Saif ar lan ddwyreiniol afon Rhein, sy'n ffurfio'r ffîn a Ffrainc yma. Mae tua hanner y ffordd rhwng Freiburg a Colmar, tua 20 km o bob un. Ar ochr arall yr afon, gyda phont yn eu cysylltu, mae Neuf-Brisach yn Alsace, Ffrainc. Roedd y boblogaeth yn 2007 yn 14,352.\\nCeir olion hen sefydliad Celtaidd ar y bryn lle saif yr hen ddinas, ac mae'r enw ei hun o darddiad Celtaidd. Ar un adeg, pan fyddai llif yn yr afon, byddai'r bryn yn troi'n ynys. Dim ond wedi i Johann Gottfried Tulla sythu cwrs yr afon yn y 19g y daeth hyn i ben.\\nDechreuwyd adeiladu Eglwys Gadeiriol Sant Steffan yn y 13g, ac yn y 16g roedd Breisach yn gaer bwysig yn perthyn i'r Ymerodraeth Lân Rufeinig. Dinistriwyd rhan helaeth o'r ddinas yn 1793, yn y rhyfeoledd a ddilynodd Chwyldro Ffrainc, ac eto tua diwedd yr Ail Ryfel Byd wrth i'r Cyngheiriaid ymladd i groesi afon Rhein.\\nMae cynhyrchu gwin yn bwysig yma, ac mae Badische Winzerkeller eG yn Breisach yn un o seleri gwin mwyaf Ewrop."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%A1%E4%BE%BF%E6%AE%BF_(%E5%BA%83%E5%B3%B6%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Hiroshima_City_Map_1945.jpg","page_title":"御便殿 (広島市)","context_page_description":"御便殿は、かつて広島県広島市にあった天皇の行在所。現在は建物自体存在していない。"},{"page_url":"https://it.wikipedia.org/wiki/Universit%C3%A0_Georg-August_di_Gottinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Auditorium_G%C3%B6ttingen_sign.jpg","page_title":"Università Georg-August di Gottinga","context_page_description":"L'Università Georg-August di Gottinga è un'università pubblica che si trova a Gottinga, nel Land tedesco della Bassa Sassonia. Chiamata semplicemente Università di Gottinga, Georgia Augusta, o solo Gottinga, fu fondata nel 1737 da re Giorgio II di Gran Bretagna, divenendo presto un ateneo prestigioso e frequentato."},{"page_url":"https://nl.wikipedia.org/wiki/Operatie_Seel%C3%B6we","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/German_paratroopers_jumping_From_Ju_52s_over_Crete.jpg","page_title":"Operatie Seelöwe","context_page_description":"Operatie Seelöwe was een Duits plan voor een invasie in het Verenigd Koninkrijk tijdens de Tweede Wereldoorlog. Na de snelle Duitse overwinning in het westen in mei en juni 1940, werden er plannen gesmeed om ook het Britse vasteland binnen te vallen. Het plan werd nimmer uitgevoerd, mede door de verloren slag om Engeland."},{"page_url":"https://en.wikipedia.org/wiki/Cairo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Nasr_road.jpg","page_title":"Cairo","context_page_description":"Cairo is the capital of Egypt and the largest city in the Arab world. Its metropolitan area, with a population of over 20 million, is the largest in Africa, the Arab world, and the Middle East, and the 6th-largest in the world. Cairo is associated with ancient Egypt, as the famous Giza pyramid complex and the ancient city of Memphis are located in its geographical area. Located near the Nile Delta, Cairo was founded in 969 AD by the Fatimid dynasty, but the land composing the present-day city was the site of ancient national capitals whose remnants remain visible in parts of Old Cairo. Cairo has long been a centre of the region's political and cultural life, and is titled \\"the city of a thousand minarets\\" for its preponderance of Islamic architecture. Cairo is considered a World City with a \\"Beta +\\" classification according to GaWC.\\nCairo has the oldest and largest film and music industries in the Arab world, as well as the world's second-oldest institution of higher learning, Al-Azhar University. Many international media, businesses, and organizations have regional headquarters in the city; the Arab League has had its headquarters in Cairo for most of its existence."},{"page_url":"https://hu.wikipedia.org/wiki/Szkeptikus_T%C3%A1rsas%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/V%C3%A1g%C3%B3_Istv%C3%A1n_a_2008-as_Szkeptikus_Konferenci%C3%A1n.jpg","page_title":"Szkeptikus Társaság","context_page_description":"A Szkeptikus Társaság egy Magyarországon tevékenykedő non-profit szervezet, amely tagja a Szkeptikus Szervezetek Európai Tanácsának, egyes témák mentén számos hazai és külföldi civil szervezettel együttműködik és céljának tekinti „a tényeken alapuló racionális gondolkodás értékének, a tudomány eredményeinek ismertetését, valamint az irracionális, áltudományos irányvonalak kritikáját”. Az egyesület nevében is megjelenő szkeptikus szó nem a köznyelvben használt kétkedő attitűdre, hanem a tudományos szkepticizmusra utal."},{"page_url":"https://lt.wikipedia.org/wiki/Ikikolumbin%C4%97_Amerika","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Mexico.Pue.Cholula.Pyramid.01.jpg","page_title":"Ikikolumbinė Amerika","context_page_description":"Ikikolumbinė Amerika – Amerikos žemynas iki Kristupo Kolumbo atvykimo 1492 m. ir po jo sekusios žemyno kolonizacijos. Ikikolumbinėje Amerikoje buvo susikūrusios ilgą istoriją turinčios indėniškos civilizacijos. XVI a. šios civilizacijos buvo sunaikintos, užgožtos Vakarų civilizacijos, atneštos užkariautojų ir kolonizatorių iš Europos šalių.\\nIkikolumbinės kultūros savarankiškai nuo „Senojo Pasaulio“ pasiekė įvairių laimėjimų astronomijos, matematikos, architektūros, inžinerijos, žemės ūkio srityse, sukūrė raštą. Kaip ir kitos civilizacijos, senovės amerikiečiai statė miestus, pasižymėjusius savo įspūdinga monumentaliąja architektūra. Buvo išvystyta sudėtinga socialinė hierarchija, prekybos, susisiekimo tinklai."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%DB%8C%D8%A7%D9%85%D9%88%D9%86%D8%AA%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Virgen_de_las_Angustias_de_Ayamonte.jpg","page_title":"آیامونته","context_page_description":"آیامونته ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و اوئلوا اوستانینده یئرلشیب. بۇ شهرین مساحتی ۱۴۲ کیلومتر موربّع دیر. ۶۳ متر دنیز سویه‌سیندن اۇجالیقی وار. سوْن نۆفوس تخمین‌لرینه گؤره ۱۹۷۳۸ نفر دیر."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_the_City_of_Westminster","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/BlewCoatSchool.jpg","page_title":"Grade I listed buildings in the City of Westminster","context_page_description":"There are over 9,000 Grade I listed buildings in England. This page is a list of these buildings in the City of Westminster."},{"page_url":"https://de.wikipedia.org/wiki/Paul_M%C3%B6bius_(Architekt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Waldstrasse4_Leipzig.jpg","page_title":"Paul Möbius (Architekt)","context_page_description":"Paul Möbius war ein deutscher Architekt des Jugendstils und gilt als wichtigster Vertreter dieser Stilrichtung in Leipzig."},{"page_url":"https://sl.wikipedia.org/wiki/Krona_Svetega_rimskega_cesarstva","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Holy_Roman_Empire_Crown_%28Imperial_Treasury%292.jpg","page_title":"Krona Svetega rimskega cesarstva","context_page_description":"Krona Svetega rimskega cesarstva je bila krona s krošnjo svetega rimskega cesarja od 11. stoletja do razpada Svetega rimskega cesarstva leta 1806. Krono so uporabili pri kronanju rimsko-nemškega kralja, naslov cesar je prevzel takoj po izvolitvi. Izdelana je bila v poznem 10. ali začetku 11. stoletja. Za razliko od mnogih drugih kron ima osmerokotno in ne okroglo obliko, zgrajena pa je iz osmih povezanih ploščic. Ploščica v sprednjem delu krone je nadvišana s križem, en sam lok pa povezuje sprednji in zadnji del krošnje. Krona se hrani v cesarski zakladnici v Hofburgu na Dunaju v Avstriji."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B8%D0%B1%D0%BE%D1%80%D1%87%D0%B8%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3_15","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Mykola_Dzhyha.jpg","page_title":"Виборчий округ 15","context_page_description":"Виборчий округ 15 — виборчий округ у Вінницькій області. В сучасному вигляді був утворений 28 квітня 2012 постановою ЦВК №82. Окружна виборча комісія цього округу розташовується в приміщенні ради сільськогосподарських виробників за адресою м. Шаргород, вул. Героїв Майдану, 220.\\nДо складу округу входять Мурованокуриловецький, Томашпільський, Тульчинський, Чернівецький, і Шаргородський райони. Виборчий округ 15 межує з округом 14 на півночі, з округом 18 на північному сході, з округом 17 на сході, з округом 16 на півдні, з округом 204 на південному заході та з округом 193 на заході. Виборчий округ №15 складається з виборчих дільниць під номерами 050721-050769, 051095-051128, 051165-051209, 051285-051319, 051344-051348 та 051350-051395."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%91%D7%9C_%D7%91%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Yuval_Baer3.jpg","page_title":"יובל בר","context_page_description":"יובל בר הוא אדריכל ישראלי ומרצה באקדמיה לאמנות ועיצוב בצלאל."},{"page_url":"https://it.wikipedia.org/wiki/Pista_della_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/HastingsCutoff.gif","page_title":"Pista della California","context_page_description":"La Pista della California fu una delle principali vie di migrazione verso l'Ovest degli Stati Uniti d'America a metà del XIX secolo, che partiva dallo stato del Missouri e andava fino alla California. Fu utilizzata da più di 250.000 coloni e poi cercatori d'oro, per arrivare ai terreni agricoli e ai campi auriferi della California, dal principio degli anni 1840 fino alla costruzione delle linee della ferrovia, alla fine del 1860.\\nLa pista originale aveva molte diramazioni e percorreva più di ottomila chilometri. Circa 1.600 km del tracciato della pista per il Gran Bacino si conservano ancora e sono stati dichiarati come «Pista storica nazionale della California», come evidenza storica della grande migrazione di massa verso l'Ovest, e sono gestiti dal Servizio dei parchi nazionali."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_26_mei","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Portret_van_Frederik_Willem_Conrad_door_Hendrik_Johannes_Haverman.jpg","page_title":"Lijst van personen geboren op 26 mei","context_page_description":"Dit is een lijst van personen die geboren zijn op 26 mei.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n1264 - Koreyasu, Japanse Shogun bewerken\\n1478 - Paus Clemens VII, Franse paus, Camerlengo van het Heilig College van Kardinalen en kardinaal, rooms-katholiek priester bewerken\\n1536 - Hendrik van den Corput, Nederlandse theoloog bewerken\\n1562 - Jakob III van Baden-Hachberg, Duitse markgraaf, heerser bewerken\\n1566 - Mehmet III, sultan van het Ottomaanse Rijk uit het Ottomaanse Rijk bewerken\\n1583 - Susanna Shakespeare, arts, dichter en schrijver bewerken\\n1591 - Dirk Janszoon Sweelinck, componist en organist uit de Republiek der Zeven Verenigde Nederlanden bewerken\\n1602 - Philippe de Champaigne, Franse hofschilder, kunstschilder bewerken"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1949/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/V%C3%ADt%C4%9Bzslav_Nov%C3%A1k.jpg","page_title":"Lijst van personen overleden in 1949/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1949.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Blackrock,_Dublin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Methodist_Church%2C_Georges_Avenue%2C_Blackrock%2C_Dublin.JPG","page_title":"Blackrock, Dublin","context_page_description":"Blackrock is a suburb of Dublin, Ireland, 3 km northwest of Dún Laoghaire."},{"page_url":"https://en.wikipedia.org/wiki/Elberry_Cove","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Old_bathing_house%2C_Elberry_Cove_-_geograph.org.uk_-_1071855.jpg","page_title":"Elberry Cove","context_page_description":"Elberry Cove, also known as Elbury Cove, is a shingle beach surrounded by woodland and fields, that lies between Brixham and Paignton in Devon, England. It is important for its eelgrass beds, breeding grounds for native seahorses, as well as mussels that are farmed in the waters nearby. It is on the South West Coast Path.\\nThe coast around Elberry Cove is generally sheltered from the wind so is popular with water skiers. A ski lane is provided in the summer months.\\nAt its eastern end are the ruins of Elberry bathhouse, which was built for Lord Churston in the 18th century, when seawater bathing became fashionable after George III took a dip at Weymouth. Standing three stories high, with the ground floor being flooded when the tide rose, the lord could swim into the sea through a gated doorway, preserving his dignity. The buildings also held a \\"hot-bath\\" room where seawater was heated and pumped in.\\nThe cove features in one of Agatha Christie’s novels, The ABC Murders, as the setting of Sir Carmichael Clarke’s untimely death."},{"page_url":"https://de.wikipedia.org/wiki/VW_Golf_Cabriolet","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/2013_Volkswagen_Golf_GTI_Cabrio_%2810052707673%29.jpg","page_title":"VW Golf Cabriolet","context_page_description":"Als Golf Cabriolet oder Golf Cabrio werden mehrere Fahrzeugmodelle des Automobilherstellers Volkswagen bezeichnet. Ab März 1979 wurde das erste Modell auf der technischen Basis des Golf I hergestellt, es folgten Modelle auf Basis des Golf III und Golf VI. Vom Golf I Cabriolet wurden bis August 1993 389.000 Wagen hergestellt; von September 1993 bis April 1998 wurde das Nachfolgemodell auf Basis des Golf III 171.000-mal produziert. Von April 1998 bis Juni 2002 gab es eine Facelift-Version des Golf III Cabriolet mit der Optik des Golf IV.\\nAlle Golf-Cabriolet-Generationen stellte Karmann in Osnabrück her, die auch an der Entwicklung des offenen Golf beteiligt waren und noch bis Januar 1980 das Vorgängermodell Käfer Cabrio produzierten. Einzelne Fahrzeuge der Baureihen Golf III und Golf IV Cabriolet produzierte auch Volkswagen de México im Werk Puebla.\\nDas Golf Cabriolet war von Frühjahr 1979 bis zu seiner Produktionseinstellung Mitte 2002 stets eines der beliebtesten offenen Fahrzeuge auf dem deutschen und österreichischen Markt.\\nIm Juni 2011 brachte Volkswagen ein neues Golf Cabriolet auf Basis des Golf VI auf den Markt, das im März 2011 auf dem Genfer Auto-Salon vorgestellt wurde."},{"page_url":"https://ru.wikipedia.org/wiki/Callisto_Network","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Callisto-logo.png","page_title":"Callisto Network","context_page_description":"Callisto Network — это децентрализованная криптовалютная платформа с открытым исходным кодом, основанная на исходном коде Ethereum и имеющая собственную криптовалюту Callisto. Разработку платформы возглавляет Dexaran, основатель Ethereum Commonwealth. Callisto Network — самостоятельный блокчейн, интегрированный с основным блокчейном ETC, и имеющий собственный генезис-блок. В момент запуска сети Callisto Network в ней были инициализированы балансы сети Ethereum Classic на момент блока 5500000.\\nНовая платформа будет использоваться для тестирования экспериментальных протоколов, сбора и анализа информации для дальнейшей разработки Ethereum Classic.\\nДенежная политика Callisto основывается на фиксированной капитализации, как и ETC. Callisto реализует протокол Cold Staking, который будет вознаграждать держателей монет за то, что они являются участниками сети."},{"page_url":"https://lv.wikipedia.org/wiki/Jorkas_hercogs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Pr%C3%ADncipe_Andr%C3%A9_do_Reino_Unido.jpg","page_title":"Jorkas hercogs","context_page_description":"Jorkas hercogs ir hercoga tituls, kuru angļu, bet vēlāk arī britu karaļi piešķīra saviem ģimenes locekļiem. Titula nosaukums cēlies no Jorkas, vienas no Britānijas vecākās, pilsētas nosaukuma."},{"page_url":"https://de.wikipedia.org/wiki/Nissan_Pivo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/2007_Nissan_Pivo2_01.jpg","page_title":"Nissan Pivo","context_page_description":"Der Nissan Pivo ist ein Konzeptauto des Automobilherstellers Nissan, welches 2005 auf der Motorshow in Tokio vorgestellt wurde. Das Design wurde von Takashi Murakami geschaffen. Dieses 2700 mm lange, 1600 mm breite und 1660 mm hohe Auto sollte in Zukunft in den städtischen Ballungsgebieten eingesetzt werden. Seine Kraft bekommt er von zwei Elektromotoren, die nach belieben alle vier Räder einzeln ansteuern können. Der Clou an dem Konzeptauto ist die Fahrgastkabine, die sich um 360 Grad drehen lässt, um noch einfacher aus Parklücken kommen zu können. Eine große Schiebetür gibt den Bereich im Fahrzeuginneren frei, wo Passagiere auf drei Sitzplätzen Platz finden. Der Pivo ist mit technischen Neuheiten wie einem Telematiksystem, womit die Audioanlage nur noch mit einfachen Handauf- oder Handabbewegungen gesteuert wird, ausgestattet."},{"page_url":"https://de.wikipedia.org/wiki/Nissan_Pivo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/2007_Nissan_Pivo2_01.jpg","page_title":"Nissan Pivo","context_page_description":"Der Nissan Pivo ist ein Konzeptauto des Automobilherstellers Nissan, welches 2005 auf der Motorshow in Tokio vorgestellt wurde. Das Design wurde von Takashi Murakami geschaffen. Dieses 2700 mm lange, 1600 mm breite und 1660 mm hohe Auto sollte in Zukunft in den städtischen Ballungsgebieten eingesetzt werden. Seine Kraft bekommt er von zwei Elektromotoren, die nach belieben alle vier Räder einzeln ansteuern können. Der Clou an dem Konzeptauto ist die Fahrgastkabine, die sich um 360 Grad drehen lässt, um noch einfacher aus Parklücken kommen zu können. Eine große Schiebetür gibt den Bereich im Fahrzeuginneren frei, wo Passagiere auf drei Sitzplätzen Platz finden. Der Pivo ist mit technischen Neuheiten wie einem Telematiksystem, womit die Audioanlage nur noch mit einfachen Handauf- oder Handabbewegungen gesteuert wird, ausgestattet."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E8%97%8F%E5%8E%86%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Tibetan_Monks_arrested_in_2008_%E9%81%AD%E9%80%AE%E6%8D%95%E7%9A%84%E8%A5%BF%E8%97%8F%E5%83%A7%E4%BE%B6.jpg","page_title":"西藏历史","context_page_description":"西藏位於亞洲腹地的青藏高原。在中文中，西藏既可以指傳統意義上的西藏，即包括整個藏區，又稱大西藏地區；也可以特指其西南部地區，即清朝以來分割邊界後的行政區劃，面積略大過現在的中華人民共和國西藏自治區之範圍。本條目正文中所指的西藏，若無特別說明，通常指大西藏地區，以更加方便和準確地闡述包含各個藏區的西藏整體的歷史。由於青藏高原的平均海拔在4000米以上，是世界上面積最大、海拔最高的高原，故素有「世界屋脊」之稱。自古以來，西藏特殊的地理位置阻絕外來勢力的侵擾，也保留獨特的地域文化。自石器時代即在西藏高原活動的人類，逐漸發展成今日的藏族，而其綿延至今的文化中最引人矚目的，正是在他們的生活中無所不在的宗教色彩。\\n生活在青藏高原的藏族人自稱為「博」。「博」是集民族、地域、政權於一體的總稱。滿語、蒙語中則稱「博」為「ᡨᡠ᠋ᠪᡝᡨ 」、「tübat」。除了「博」和「圖波特」這兩個語彙以外，在歷史上還可以找到「吐蕃」、「唐古特」、「土伯特」等其他對於西藏的稱謂。對於在東部藏區生活的藏民，部分漢族人會稱呼他們作「西番」或「西羌」等等。\\n除藏族人外，世代生活著西藏地區的還有漢族、門巴族、珞巴族等。"},{"page_url":"https://pl.wikipedia.org/wiki/La_Tribune_des_Peuples","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/La_tribune_des_peuples_-19c.jpg","page_title":"La Tribune des Peuples","context_page_description":"La Tribune des Peuples – międzynarodowy dziennik polityczny, głoszący idee Wiosny Ludów, wydawany w języku francuskim od 15 marca do 13 czerwca 1849 i ponownie od 1 października do 10 listopada tego samego roku w Paryżu. Łącznie ukazało się 158 numerów."},{"page_url":"https://it.wikipedia.org/wiki/Condizione_della_donna_in_Marocco","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Paire_berb%C3%A8re.jpg","page_title":"Condizione della donna in Marocco","context_page_description":"La storia delle donne, il loro ruolo di genere, la condizione femminile e i diritti delle donne in Marocco comprendono la loro vita prima, durante e dopo l'arrivo dell'Islam nel paese del Nordafrica.\\nNel 622 d.C., quando la fede musulmana giunse in terra marocchina, le donne ricevettero tre diritti religiosi fondamentali: il diritto di vivere, il diritto ad essere onorate e rispettate come madri e il diritto di lavorare ed impiegarsi professionalmente.\\nDal 1940 fino alla dichiarazione d'indipendenza del Marocco dalla tutela dell'impero coloniale francese avvenuta nel 1956 le donne vissero in unità familiari chiuse o harem, in cui comunità estese convivevano assieme e dove le donne rimanevano isolate con il bisogno di richiedere l'autorizzazione ad un uomo prima di poter lasciare una famiglia. Le donne sposate godevano di maggiori diritti delle donne ripudiate.\\nL'importanza di una donna nella società dipendeva dall'età e dallo status nella famiglia e nella comunità; le donne erano dedite ai lavori domestici, al ricamo e alle attività di artigianato, alla frequentazione della Madrasa e dei bagni noti come hammam."},{"page_url":"https://sv.wikipedia.org/wiki/Cransac","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Salle_des_fetes_de_Cransac.jpg","page_title":"Cransac","context_page_description":"Cransac är en kommun i departementet Aveyron i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Aubin som ligger i arrondissementet Villefranche-de-Rouergue. År 2009 hade Cransac 1 665 invånare."},{"page_url":"https://tr.wikipedia.org/wiki/Zincir_z%C4%B1rh","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Suit_of_chain_mail_from_DHM_museum_Berlin.jpg","page_title":"Zincir zırh","context_page_description":"Zincir zırh ya da örme zırh, küçük metal halkaların birbirine bağlanarak örgü şekli verilmesiyle oluşmuş bir çeşit zırhtır."},{"page_url":"https://en.wikipedia.org/wiki/Marine_wildlife_of_Baa_Atoll","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Coris_frerei_Landaagiraavaru.JPG","page_title":"Marine wildlife of Baa Atoll","context_page_description":"The marine wildlife of Baa Atoll consists of marine species living in a circular archipelago in the Maldives, inside the administrative division of Baa Atoll, which is the southern part of Maalhosmadulu Atoll. Baa Atoll was named a biosphere reserve by UNESCO in 2011.\\nThe whole is approximately 38 km by 46 km, covering a surface of 1,127 km². However, the atoll shelters only 5.5 km² of emerged land, consisting of sandy islands not higher than 3.19 m, and of which half do not exceed an area of 10 hectares. The administrative subdivision of Baa, shelters 11,910 inhabitants, distributed on 13 of the 75 islands, 8 other islands being island resorts; the capital is Eydhafushi.\\nThe archipelago has been located inside the UNESCO Biosphere reserve since 2011. Its shallow waters, particularly rich in coral and fish as well as turtles and dolphins, madk a favored place for seaside and underwater tourism.\\nThe ecosystem is characterized by a very high rate of coral cover, highly diverse and dominated by table, digitate and branched corals of the genus Acropora. The shallow waters of this atoll and its particular richness in corals and fish have made it destination for underwater tourism."},{"page_url":"https://de.wikipedia.org/wiki/Halen_(Niederrhein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Halen_Br%C3%BCcke.jpg","page_title":"Halen (Niederrhein)","context_page_description":"Das etwa 1596 durch Rheinüberflutungen untergegangene Dorf Halen lag am linken Rheinufer auf dem Gebiet des heutigen Duisburger Stadtteils Baerl. Bereits im Jahr 900 als Halon bekundet, hatte es über Jahrhunderte mit Rheinlaufverlagerungen und Überschwemmungen zu kämpfen. Die Stelle der im Jahr 1595 vom Hochwasser unterspülten und dann im Rhein versunkenen Halener Dorfkirche befindet sich heute unmittelbar nördlich der hier über den Rhein führenden Autobahnbrücke der BAB 42. An das untergegangene Dorf erinnern nur noch der „Niederhalener Dorfweg“ in Baerl und die „Halener Straße“ im Duisburger Stadtteil Alt-Homberg."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%97%E1%83%94%E1%83%9A%E1%83%90%E1%83%95%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Telavi17.jpg","page_title":"თელავი","context_page_description":"თელავ — ნოღა ბჟაიოლ საქორთუოს, გომბორიშ გვალაშ ოორუე-ბჟაიოლ კართეშ ბორკის, ალაზანიშ რზენს. კახეთიშ რეგიონიშ დო თელავიშ რაიონიშ ადმინისტრაციული ცენტრი. ზუღაშ სიმაღალაშე 550-800 მეტრას. თელავქ ოფიციალურო ნოღათ გინირთჷ 1801 წანას. 19 629 ვითოში მახორუ.\\nთელავიშ ასეიან ტერიტორიას მაართა დოხორელ აბანქ ბრინჯაოშ ბორჯის ერჩქინდჷ, ელინისტურ ხანას გევითარჷ დო გვიან ანტიკურ ხანას თიშ ტერიტორიას ნოღურ დოხორელ აბანქ ერჩქინდჷ."},{"page_url":"https://hu.wikipedia.org/wiki/Germanus_Gyula","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Germanus_Gyula_1930s_%28Grayscale%29.jpg","page_title":"Germanus Gyula","context_page_description":"Germanus Gyula felvett nevén Julius Abdulkerim Germanus,\\nnemzetközi hírű magyar orientalista, arab nyelvészeti, kultúrtörténeti író, irodalmár, nyelvész, történész, országgyűlési képviselő, több arab nemzeti akadémia tagja."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%89%B4%EC%9A%95_%EB%8C%80%ED%95%99%EA%B5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/NYU_%282011%29_02.JPG","page_title":"뉴욕 대학교","context_page_description":"뉴욕 대학교는 미국 뉴욕주 뉴욕에 있는 사립 연구 중심 대학이다. 뉴욕 대학교는 1831년에 세워졌으며, 세계화 대학으로서 학생들은 포털 캠퍼스인 뉴욕 대학교 아부다비와 뉴욕 대학교 상하이에서 졸업할 수 있을 뿐만 아니라 전 세계 12곳에 있는 학술관에서 공부할 수 있다.\\n2019년 3월을 기준으로 37명의 노벨상 수상자와 8명의 튜링상 수상자, 5명의 필즈상 수상자, 30명 이상의 퓰리처상 수상자, 30명 이상의 아카데미상 수상자, 수백 명의 전미과학공학의학한림원 회원과 미국 의회 의원 등이 뉴욕 대학교를 졸업했거나 뉴욕 대학교에서 가르쳤다."},{"page_url":"https://fr.wikipedia.org/wiki/Nage_en_eau_vive","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Hydrospeed.jpeg","page_title":"Nage en eau vive","context_page_description":"La nage en eau vive est une activité sportive de glisse et de pleine nature dans laquelle les nageurs descendent le cours d'une rivière, à l'aide d'un flotteur en se propulsant et dirigeant à l'aide de palmes.\\nCe sport est couramment appelé hydrospeed, marque commerciale d'un des premiers flotteurs d'eau vive fabriqué en série pour cette discipline. Les pratiquants sont dénommés « nageurs » ou plus rarement « hydrospeedeurs »."},{"page_url":"https://tl.wikipedia.org/wiki/Bagyong_Iniki","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Hurricane_Iniki_11_sept_1992_2358Z.jpg","page_title":"Bagyong Iniki","context_page_description":"Ang Bagyong Iniki ay isang bagyo na natama sa Hawaii."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_Borges","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Estaci%C3%B3n_Borges_primer_plano.jpg","page_title":"Estación Borges","context_page_description":"Borges es una estación ferroviaria ubicada en el barrio de Olivos, partido de Vicente López, provincia de Buenos Aires, Argentina."},{"page_url":"https://no.wikipedia.org/wiki/Harald_B%C3%B8dtker","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Bekkelaget_kirke_20081026-3.jpg","page_title":"Harald Bødtker","context_page_description":"Harald Waldemar Bødtker var en norsk arkitekt. Han var i årene 1899-1923 kommunearkitekt i Aker og stod i den forbindelse for utformingen av en rekke kirker og skoler i det som nå er Oslo. Fra en omfattende produksjon kan nevnes arbeider ved Aker sykehus.\\nBødtker arbeidet en tid praksis som assistent hos arkitekt Nissen i Kristiania, og hos arkitekt Holm Munthe samme sted. Han studerte ved Akademie der bildenden Künste Wien under Theophilus Hansen i perioden 1880–1883.\\nEtter avsluttet akademiutdanning arbeidet han en tid som assistent hos Theophilus Hansen i Wien. Der var han medarbeider på store prosjekter i Wien og Athen, og Christiansborg i København. Etter tiden ved Hansens kontor, arbeidet Bødtker noen år ved tyske arkitektkontorer i Buenos Aires og Rio de Janeiro. Deretter var han i rundt fem år bygningssjef i Petrópolis ved Rio de Janeiro, før han åpnet egen arkitektpraksis i Kristiania i 1896. Han var kommunearkitekt i Aker i perioden 1899–1923.\\nI Keysers gate 8 i Oslo, tegnet han på slutten av 1800-tallet en stor bygning for Statens pensjonskasse, den såkalte «Enkekassen». Dette er et tidlig eksempel på bruk av råkopp i en hel fasade."},{"page_url":"https://pl.wikipedia.org/wiki/Metropolia_Santa_Fe_de_Antioquia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Catedral_Bas%C3%ADlica_de_la_Inmaculada_Concepci%C3%B3n_de_Santa_Fe_de_Antioquia.jpg","page_title":"Metropolia Santa Fe de Antioquia","context_page_description":"Metropolia Santa Fe de Antioquia − metropolia rzymskokatolicka w Kolumbii utworzona 18 czerwca 1988 roku."},{"page_url":"https://es.wikipedia.org/wiki/Central_hidroel%C3%A9ctrica_Francisco_Moraz%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/El_Cajon_Dam_Honduras.jpg","page_title":"Central hidroeléctrica Francisco Morazán","context_page_description":"La Central Hidroeléctrica Francisco Morazán está situada en el curso del río Comayagua, en el departamento de Cortés, Honduras.​ La represa de El cajón es del tipo de arco doble, la cual distribuye parabólicamente el agua hacia las paredes de las montañas que actúan como contrafuertes. Es la planta hidroeléctrica y de control de inundaciones más grande de Honduras. También es la quinta represa más alta de América, la decimosexta más alta en el mundo. Además es la represa en arco más alta del hemisferio occidental y la sexta en el mundo. A través de esta represa se obtiene gran parte de la energía del país en ella hay más de 50 mil galones de agua."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%82_%D0%9B%D0%B0-%D0%9A%D0%B0%D1%80%D1%83%D0%BD%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Flag_maritime_coruna.svg","page_title":"Порт Ла-Карунья","context_page_description":"Порт Ла-Карунья — іспанскі порт, які знаходзіцца ў горадзе Ла-Карунья, у правінцыі Ла-Карунья, на беразе Атлантычнага акіяна. Ён з'яўляецца сэрцам эканомікі горада Ла-Карунья. Ён мае больш за 6 км прычалаў і прымае судны з самымі рознымі грузамі ад рыбы да вугля і паліва."},{"page_url":"https://no.wikipedia.org/wiki/Lykia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Close_up_of_Xanthian_Obelisk.jpg","page_title":"Lykia","context_page_description":"Lykia var en geografisk og politisk region i Anatolia i oldtiden og antikken i hva som i dag er provinsene Antalya og Muğla på sørkysten av Tyrkia, og provinsen Burdur i innlandet. Det er historiske opptegnelser om Lykia i oldtidens Egypt og i hettittenes rike i sen bronsealder. Landet var befolket av et folk innenfor den luviske språkfamilien. Skriftlige nedtegnelser begynte å bli innrisset på stein i lykisk språk etter at Lykia frivillig hadde lagt seg inn under Akamenide-dynastiets Perserriket i jernalderen. På denne tiden var antallet som snakket luvisk allerede i nedgang, og det kom i tillegg en tilstrømning av folk som snakket iransk.\\nLykia kjempet på persernes side i de gresk-persiske krigene, men da Akamenide-dynastiet led nederlag for grekerne, ble landet periodisk mer selvstendig. Etter et kort medlemskap i det athenske sjøforbundet, skilte det seg ut og ble uavhengig, og kom deretter inn under perserne igjen, gjorde opprør, ble erobret av Mausollos av Karia, vendte tilbake til perserne, og havnet deretter i under makedonerne da Aleksander den store beseiret Perserriket."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A7%DB%8C%D8%A7%D9%86_%DA%AF%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ryan_Garry_1.png","page_title":"رایان گری","context_page_description":"رایان گری فوتبالیست اهل بریتانیا است.\\nاز باشگاه‌هایی که در آن بازی کرده‌است می‌توان به باشگاه فوتبال ای. اف. سی بورنموث، باشگاه فوتبال آرسنال، و تیم ملی فوتبال زیر ۱۷ سال انگلستان اشاره کرد.\\nوی همچنین در تیم‌های ملی فوتبال زیر ۱۷، ۱۹، ۲۰ سال انگلستان بازی کرده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Delfine_Rouffignac","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Delphine_Rouffignac.JPG","page_title":"Delfine Rouffignac","context_page_description":"Delfine Rouffignac est une actrice française née le 6 septembre 1991 à Draguignan dans le Var."},{"page_url":"https://fr.wikipedia.org/wiki/Royal_Air_Force_Bomber_Command","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Thor_RAF.jpg","page_title":"Royal Air Force Bomber Command","context_page_description":"Le Royal Air Force Bomber Command était l'organisation qui commandait les forces de bombardement de la Royal Air Force. Elle fut créée le 14 juillet 1936 à partir de la section de bombardement de l'Air Defence of Great Britain et fut absorbée par le RAF Strike Command en 1968. Sa devise était « Strike Hard Strike Sure »."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%86%D9%82%D8%A7%D8%B1%D9%8A%D8%A7%D8%AA_%D8%A7%D9%84%D8%B1%D8%A3%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Henry_at_Invercargill.jpg","page_title":"منقاريات الرأس","context_page_description":"منقاريات الرأس أو خطميات الرأس، هي رتبة من الزواحف. تضم رتبة خطيمة الرأس نوعين فقط وهي حيوانات كبيرة تشبه العظايا. ويصل طولها نحو نصف متر. المكان الوحيد الذي يضم هذا النوعان المهددان بالانقراض هي في جزر قرب سواحل نيوزيلندا. حالياً تضم فصيلة واحدة فقط ما زالت موجودة حتى الآن. الفصيلة الوحيدة المُتبقية هي الطراطرات."},{"page_url":"https://fr.wikipedia.org/wiki/Juliaca","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Escudo_juliaca.png","page_title":"Juliaca","context_page_description":"Juliaca est une ville du sud du Pérou et la capitale de la province de San Román. Elle est située à proximité du lac Titicaca. Sa population s'élève à 218 485 habitants."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%8A%D8%B3%D8%AA%D9%8A%D8%A7%D9%86_%D8%A8%D9%8A%D8%AF%D8%B1%D8%B3%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Kristian_Pedersen_%2834059341572%29.jpg","page_title":"كريستيان بيدرسن","context_page_description":"كريستيان بيدرسن ‏ هو لاعب كرة قدم دانمركي في مركز الدفاع. شارك مع منتخب الدنمارك تحت 21 سنة لكرة القدم. أما مع النوادي، فقد لعب مع HB Køge."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D0%BD%D1%85%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Grenchen_waldrand.JPG","page_title":"Гренхен","context_page_description":"Гренхен — місто у Швейцарії, у кантоні Золотурн. Адміністративний центр округу Леберн."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E7%94%A3%E3%83%87%E3%82%A3%E3%83%BC%E3%82%BC%E3%83%AB%E3%83%BB%E3%82%B9%E3%83%9A%E3%83%BC%E3%82%B9%E3%82%A2%E3%83%AD%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Sanyo_kanko_U-RA520RBN_fuzizyu_7HD.jpg","page_title":"日産ディーゼル・スペースアロー","context_page_description":"スペースアローは、UDトラックスが2010年まで生産していたハイデッカーの大型観光バスシリーズの総称。スーパーハイデッカーとしては、スペースウイングを生産していた。\\n本項目では、日産ディーゼル工業の大型観光バスを一括して扱う。"},{"page_url":"https://sv.wikipedia.org/wiki/Vitbukspapegojor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Pionites_melanocephalus_-Tiputini-6c.jpg","page_title":"Vitbukspapegojor","context_page_description":"Vitbukspapegojor är ett litet släkte med fåglar i familjen västpapegojor inom ordningen papegojfåglar som återfinns i Amazonområdet. Vanligtvis omfattar släktet två arter, men Birdlife International har nyligen urskilt ytterligare två:\\nSvarthuvad vitbukspapegoja\\nRosthuvad vitbukspapegoja\\n\\"Svartbent vitbukspapegoja\\" – urskiljs av Birdlife International som egen art\\n\\"Gulstjärtad vitbukspapegoja\\" – urskiljs av Birdlife International som egen art"},{"page_url":"https://af.wikipedia.org/wiki/Nobelprys_vir_Vrede","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Nadia_Murad_in_Washington_-_2018_%2842733243785%29_%28cropped%29.jpg","page_title":"Nobelprys vir Vrede","context_page_description":"Die Nobelprys vir Vrede is een van vyf Nobelpryse wat nagelaat is deur die Sweedse nyweraar en uitvinder Alfred Nobel. Die pryse vir chemie, fisika, geneeskunde en letterkunde word jaarliks in Stockholm, Swede, toegeken, terwyl die Nobelprys vir Vrede in die Noorse hoofstad Oslo oorhandig word. Die Noorse Nobelkomitee word deur die Noorse parlement gekies, wat weer die pryswenner kies.\\nTen tye van Nobel se dood was Swede en Noorweë in 'n posisie onderling waar die Sweedse parlement slegs verantwoordelik was vir buitelandse sake en Sweedse binnelandse sake, en die Noorse parlement slegs vir Noorse binnelandse sake. Nobel het dus stipuleer dat die Vredesprys deur Noorweë toegeken moes word, omdat hy gevrees het dat die verkiesingsproses negatief beïnvloed sou kon word deur 'n buitelandse moondheid. Volgens sy testament behoort die prys toegeken te word aan diegene \\"wat die beste of die meeste werk gedoen het vir die bevordering van broederskap tussen nasies én vir die totnietmaking of vermindering van weermagte én vir die ophou en bevordering van vredeskongresse\\"."},{"page_url":"https://pt.wikipedia.org/wiki/Raci%C3%A1ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Ratiaria_plan.jpg","page_title":"Raciária","context_page_description":"Raciária foi uma cidade fundada ao longo do rio Danúbio pelos mésios, uma tribo daco-trácia, no século IV AEC. Na época romana, era chamada Colônia Úlpia Trajana Raciária.\\nEstá localizada a dois quilômetros a oeste da atual vila de Archar na [Vidin |Província de Vidin]], no noroeste da Bulgária. As cidades modernas mais próximas são Vidin e Lom. Um museu arqueológico local foi recentemente criado em Dimovo."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D8%BA%D8%A9_%D8%A3%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Int-mother-lang-day-monument.jpg","page_title":"لغة أم","context_page_description":"اللغة الأولى، اللغة الأم، هي اللغة التي تعرض لها الشخص منذ الولادة أو خلال الفترة الحرجة. في بعض البلدان، يشير مصطلح اللغة الأم أو إلى لغة المجموعة العرقية للمرء بدلاً من لغة المرء الأولى.\\nفي بعض الأحيان، يتم استخدام مصطلح \\" اللغة الأم \\" أو اللغة التي تعلمها الشخص عندما كان طفلاً. يمكن للأطفال الذين ينشأون في منازل ثنائية اللغة، وفقًا لهذا التعريف، أن يكون لديهم أكثر من لغة أم أو لغة أصلية.\\nاللغة الأولى للطفل هي جزء من الهوية الشخصية والاجتماعية والثقافية لذلك الطفل. تأثير آخر للغة الأولى هو أنها تجلب انعكاسًا وتعلمًا للأنماط الاجتماعية الناجحة في التمثيل والتحدث. وهي أيضًا مسؤولة بشكل أساسي عن التمييز بين الكفاءة اللغوية في التمثيل. بينما يجادل البعض بأنه لا يوجد شيء مثل \\"المتحدث الأصلي\\" أو \\"اللغة الأم\\"، فمن المهم لفهم المصطلحات الأساسية وكذلك لفهم ما يعنيه أن تكون متحدثًا \\"غير أصلي\\"، والآثار التي يمكن أن تكون على حياة الشخص. تشير الأبحاث إلى أنه في حين قد يتطور المتحدث غير الأصلي بطلاقة في لغة مستهدفة بعد حوالي عامين من الانغماس، يمكن أن يستغرق ذلك الطفل ما بين خمس وسبع سنوات ليكون على نفس مستوى العمل مثل نظرائهم الناطقين بها.\\nفي 17 نوفمبر 1999، عينت اليونسكو 21 فبراير اليوم العالمي للغة الأم."},{"page_url":"https://en.wikipedia.org/wiki/Lytchett_Matravers","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Lytchett_Matravers%2C_Prospect_House_-_geograph.org.uk_-_517498.jpg","page_title":"Lytchett Matravers","context_page_description":"Lytchett Matravers is a village and civil parish in Dorset, England. The 2011 census recorded the parish as having 1,439 households and a population of 3,424."},{"page_url":"https://de.wikipedia.org/wiki/Dabelowsee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Godendorfer_M%C3%BChlenbach-Hegensteinflie%C3%9F.png","page_title":"Dabelowsee","context_page_description":"Der Dabelowsee ist ein natürlicher See im Verlauf des Mühlenfließes, das in Brandenburg Thymenfließ genannt wird und im Thymensee in den Havel­zufluss Hegensteinfließ mündet. Das Mühlenfließ erreicht ihn aus dem östlich gelegenen Großen Brückentinsee. Im Nordwesten gibt es zwei kleine Zuflüsse aus dem Kleinen und dem Großen Gadowsee\\nDer Dabelowsee liegt im Naturpark Feldberger Seenlandschaft, im Landkreis Mecklenburgische Seenplatte in Südostmecklenburg. Der namensgebende Ortsteil Dabelow liegt südlich des Sees. Der See liegt etwas südlich des Ortsteiles Brückentin von Wokuhl-Dabelow. Er hat eine ungefähre Länge von 1500 Metern und eine ungefähre Breite von 1400 Metern. Der See besteht aus einem bis zu 30 Meter tiefen Westbecken mit großer Nord-Süd-Ausdehnung und einem kleineren nur sechs Meter tiefen Ostbecken. Der Nordteil des Sees ist bewaldet, der Süd- und Ostteil ist von Feldern und Weiden umgeben. Am Nordufer befindet sich die Jugendnaturschutzakademie Brückentin."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%AF%D8%BA%D8%A7%D8%B1_%D8%AF%D8%A7%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Edgar_Dey%2C_Pittsburgh_Bankers.jpg","page_title":"إدغار داي","context_page_description":"إدغار داي هو لاعب هوكي الجليد كندي، ولد في 1 مايو 1883 في أوتاوا في كندا، وتوفي في 13 فبراير 1912 في هاليفاكس في كندا."},{"page_url":"https://de.wikipedia.org/wiki/Electrola","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Phonomuseum_Alte_Schule_2014p.jpg","page_title":"Electrola","context_page_description":"Electrola ist eines der marktführenden deutschen Musiklabels, das jahrzehntelang seinen Sitz in Köln hatte und im Dezember 1925 seine Lizenz erhielt."},{"page_url":"https://nn.wikipedia.org/wiki/Philippe_Senderos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Senderos061115-02.jpg","page_title":"Philippe Senderos","context_page_description":"Philippe Senderos er ein sveitsisk fotballspelar, som har spela i forsvar for Fulham i engelsk Premier League, og for det sveitsiske landslaget. Han gjekk til Fulham frå Arsenal etter sju år der, 9. juni 2010. Han debuterte for Sveits sitt A-landslag i mars 2005 i ein kamp borte mot Frankrike."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D9%86%D9%88%DA%A9%D8%8C_%D8%AA%DA%AF%D8%B2%D8%A7%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/TXMap-doton-Snook.PNG","page_title":"اسنوک، تگزاس","context_page_description":"اسنوک، تگزاس یک شهر در ایالات متحده آمریکا با جمعیت ۵۶۸ نفر است که در تگزاس واقع شده‌است."},{"page_url":"https://ceb.wikipedia.org/wiki/Discoglypha","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Discoglypha_hampsoni01.jpg","page_title":"Discoglypha","context_page_description":"Henero sa mga alibangbang ang Discoglypha. Ang Discoglypha sakop sa kabanay nga Geometridae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Peter_G._Ten_Eyck","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Peter_G._Ten_Eyck.jpg","page_title":"Peter G. Ten Eyck","context_page_description":"Peter Gansevoort Ten Eyck was an American politician who served as a U.S. Representative from New York from 1913 to 1915 and again from 1921 to 1923. He was a member of the Democratic Party."},{"page_url":"https://sv.wikipedia.org/wiki/Maxillariella_sanguinea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Maxillariella_sanguinea_-_Flickr_004.jpg","page_title":"Maxillariella sanguinea","context_page_description":"Maxillariella sanguinea är en orkidéart som först beskrevs av Robert Allen Rolfe, och fick sitt nu gällande namn av Mario Alberto Blanco och Germán Carnevali. Maxillariella sanguinea ingår i släktet Maxillariella och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sk.wikipedia.org/wiki/%C3%9Aherce_(okres_Plze%C5%88-sever)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Uherce.JPG","page_title":"Úherce (okres Plzeň-sever)","context_page_description":"Úherce je obec v Česku v okrese Plzeň-sever v Plzenskom kraji. 1. januára 2012 tu žilo 309 obyvateľov, z toho 152 mužov a 157 žien, pričom priemerný vek v obci bol 38,3 roka."},{"page_url":"https://en.wikipedia.org/wiki/West_Point,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/West_Point_%28Georgia%29_Freight_Depot.JPG","page_title":"West Point, Georgia","context_page_description":"West Point is a city in Troup and Harris counties in the U.S. state of Georgia. It is located approximately halfway between Montgomery, Alabama and Atlanta along Interstate 85. As of the 2010 census, it had a population of 3,474, and in 2015 the estimated population was 3,728. Most of the city is in Troup County, which is part of the LaGrange Micropolitan Statistical Area, and hence part of the Atlanta-Athens-Clarke County-Sandy Springs, GA Combined Statistical Area. A sliver in the south is in Harris County, which is part of the Columbus Metropolitan Statistical Area."},{"page_url":"https://de.wikipedia.org/wiki/Milton_Keynes","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/ConcreteCows.jpg","page_title":"Milton Keynes","context_page_description":"Milton Keynes ist eine Großstadt in England im Borough of Milton Keynes. Es handelt sich um die größte der Planstädte, die in den 1960er Jahren gebaut wurden. Die Stadt hat etwa 230.000 Einwohner. Sie gehörte früher zur Grafschaft Buckinghamshire, aber 1997 wurde das Borough zu einem selbständigen Stadtkreis, einer Unitary Authority."},{"page_url":"https://en.wikipedia.org/wiki/Rosa_%27Great_Maiden%27s_Blush%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Blush_rose_1.jpg","page_title":"Rosa 'Great Maiden's Blush'","context_page_description":"Rosa 'Great Maiden's Blush' is an old rose cultivar known since the 14th century. Like other Rosa × alba cultivars, it is very winter hardy, a tall shrub with arching branches, and the flowers are sweetly scented.\\nIt blooms in spring only. The young buds tend to have a creamy yellow color on the outside. The flower petals are creamy-white or white in the bud, then pale pink, and finally fade again to white. It is not overly pricky, has relatively few thorns. It tolerates shade and it can be grown on or beside north-facing walls. It has enough strength and vigour that it can be used as a climber.\\nThis cultivar is known by many other names, including 'Cuisse de Nymphe', 'Incarnata', 'Maiden's Blush' and 'Loyalist'."},{"page_url":"https://de.wikipedia.org/wiki/Antoine_Louis_Rouill%C3%A9,_Comte_de_Jouy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/ROUILLE_%28Antoine-Louis_de%2C_comte_de_Jouy%29.jpg","page_title":"Antoine Louis Rouillé, Comte de Jouy","context_page_description":"Antoine-Louis Rouillé, Comte de Jouy war ein französischer Staatsmann des 18. Jahrhunderts.\\nEr gehörte als Außenminister zu den Unterzeichnern des ersten Vertrags von Versailles am 1. Mai 1756. Ort der Unterzeichnung war sein Schloss in Jouy-en-Josas. 1751 wurde er Ehrenmitglied der Académie royale des sciences."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%86%DB%8C%D8%AF%D9%88%D8%B1%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Tossal_de_la_Cala.jpg","page_title":"بنیدورم","context_page_description":"Levante and Poniente beaches, Balcón del Mediterráneo, night skyline, Gran Hotel Bali, Intempo, and Neguri Gane buildings.\\nبنیدورم ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و آلیکانته اوستانینده یئرلشیب. ۱۵ متر دنیز سویه‌سیندن اۇجالیقی وار. بۇ شهرین مساحتی ۳۸٫۵۱ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۶۹۰۱۰ نفر دیر."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Gabriel_Marchand","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Battle_of_Loano.jpg","page_title":"Jean Gabriel Marchand","context_page_description":"Jean Gabriel Marchand, né le 10 décembre 1765 à L'Albenc dans le Dauphiné et mort le 12 novembre 1851 à Saint-Ismier en Isère, est un général de division français de la Révolution et de l’Empire. Il exerce tout d'abord son métier d'avocat, avant de devenir capitaine dans l'armée révolutionnaire. Il sert d'abord en Italie sous les ordres d'un certain nombre de généraux, puis participe à la première campagne d'Italie de 1796 à 1797. Marchand devient colonel la même année et remplit différentes fonctions en Italie. En 1799, il combat à la bataille de Novi avec le général Joubert, qui y est tué. Promu général de brigade peu après, il est transféré à l'armée du Rhin en 1800.\\nEn 1805, au début des guerres napoléoniennes, Marchand dirige sa brigade à Haslach-Jungingen et Dürenstein. Il est ensuite nommé général de division dans le corps du maréchal Ney, et prend part à la bataille d'Iéna et au siège de Magdebourg en 1806. À la fin de l'année, avec sa division, il parvient à vaincre 3 000 soldats prussiens, et en 1807 se distingue à Eylau, Guttstadt et Friedland. Napoléon, pour le récompenser, le fait grand aigle de la Légion d'honneur et comte de l'Empire."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Coat_of_Arms_of_Balabanovo_%28Kaluga_oblast%29.png","page_title":"Список городов России","context_page_description":"В список городов России включены все 1117 городов Российской Федерации с указанием численности населения по данным предварительных итогов Всероссийской переписи населения 2010 года, а также даты их основания или первого упоминания в исторических источниках. Города федерального значения и центры регионов выделены цветовой заливкой ячеек.\\nНаселение городов Республики Крым и Севастополя, присоединенных к РФ в 2014 году, указано по данным переписи населения, проведённой властями РФ на территории Крымского федерального округа в октябре 2014 года."},{"page_url":"https://an.wikipedia.org/wiki/Bermeu","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Gaztelugatxe_doniene_eskailarak_1.jpg","page_title":"Bermeu","context_page_description":"Bermeu ye un municipio d'o País Vasco, provincia de Vizcaya y ye o lugar mas important d'a comarca de Busturialdea. A suya población ye de 17.144 habitants.\\nA suya economia ye basata en o sector d'a pesca, mas que mas en a industria conservera."},{"page_url":"https://ca.wikipedia.org/wiki/Sinodelphys_szalayi","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Sinodelphys_szalayi.JPG","page_title":"Sinodelphys szalayi","context_page_description":"Sinodelphys szalayi és actualment el fòssil de marsupial més antic conegut, amb una edat estimada de 125 milions d'anys. Fou descobert a voltants del 2003 a la província de Liaoning, Xina, per un equip de científics que incloïen John Wible i Zhe-Xi Luo. Sinodelphys szalayi només feia quinze centímetres de llarg i pesava possiblement uns trenta grams. El seu esquelet fossilitzat està envoltat d'impressions de pelatge i de teixit tou, gràcies a l'excepcional sediment, que preserva aquests detalls. L'estructura de les potes de Sinodelphys mostra que aquest petit marsupial era arborícola, com el seu contemporani placentari Eomaia. Sinodelphys caçava probablement cucs i insectes. La majoria de marsupials mesozoics han estat descoberts a Nord-amèrica, Sud-amèrica i Àsia. La majoria visqueren durant el Cretaci superior, entra fa 90 i 65 milions d'anys."},{"page_url":"https://pl.wikipedia.org/wiki/Grenadyna","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Grenadine.jpg","page_title":"Grenadyna","context_page_description":"Grenadyna – syrop z owocu granatu, używany często jako składnik koktajli.\\nZe względu na dużą gęstość i ciężar właściwy, grenadyna osiada na dnie szklanki, co pozwala na przygotowanie koktajli wielokolorowych. Grenadyna jest niezbędna do przygotowania koktajlu Tequila Sunrise.\\nDolewanie grenadyny do herbaty, zamiast syropu malinowego, jest popularne na południu Europy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D1%82%D0%BE%D0%BD%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Cantabria_Santo%C3%B1a_Chiloeches_lou.JPG","page_title":"Сантонья","context_page_description":"Сантонья — город и муниципалитет в Испании, входит в провинцию Кантабрия в составе автономного сообщества Кантабрия. Муниципалитет находится в составе района Трасмьера. Занимает площадь 11,5 км². Население — 11584 человека. Расстояние до административного центра провинции — 48 км.\\nПокровителем города считается Святая Мария дель Пуэрто."},{"page_url":"https://fr.wikipedia.org/wiki/Lunel-Viel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/B%C3%A2timent_voyageurs_de_Lunel-Viel_par_Cramos.JPG","page_title":"Lunel-Viel","context_page_description":"Lunel-Viel est une commune française située dans le département de l'Hérault, en région Occitanie.\\nSes habitants sont appelés les Lunelviellois."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%BB%8D%E6%B5%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Gunpo_Gyeonggi_South_Korea.svg","page_title":"軍浦","context_page_description":"軍浦（韓文：군포시／軍浦市 ᴳᵘⁿᵖᵒ ˢⁱ /）係韓國京畿道中部嘅一個市。總面積有36.41平方公里，275857人喺嗰度住。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D8%AA%D8%B4%D9%8A%D8%AA%D9%88_%D8%AF%D9%88%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/RO_IS_Schitu_Duca_1.jpg","page_title":"ستشيتو دوكا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nستشيتو دوكا, قريه فى رومانيا."},{"page_url":"https://la.wikipedia.org/wiki/Terra_Australis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Hessel_Gerritsz_-_Worldmap_of_1612_including_the_discovery_of_La_Austrialia_del_Espiritu_Santo_by_Pedro_Fernandes_de_Queir%C3%B3s.png","page_title":"Terra Australis","context_page_description":"Terra Australis est continens opinabilis qui in tabulis Europaeis inter saecula quintum decimum et duodevicensimum adumbrabatur. Quamquam magna copia terrestris in tabulis divulgatis monstrabatur, Terra Australis per veram talis terrae inspectionem non condita est, sed ex coniectura continentes in Hemisphaerio Septentrionali aequis ponderibus terrae in Hemisphaerio Australi librari debuisse.\\nSaeculo undevicensimo ineunte, Matthaeus Flinders explorator Britannicus nomen Australia ex locutione Terra Australi populo acceptum faciebat, fuisse dicens \\"nullam probabilitatem\\" ullius copiae terrestris significantis ad australem Australiae inventuram. Exploraturus est continens Antarctica appellaturus decennia post editionem eius libri de Australia, quem ipse A Voyage to Terra Australis appellaverat, et postquam nomen populo acceptum tulit."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D9%88%D8%B3%D9%81_%D8%A7%D9%84%D8%B9%D8%B8%D9%85%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Maysaloun2.jpg","page_title":"يوسف العظمة","context_page_description":"يوسف العظمة اسمه الكامل يوسف بن إبراهيم بن عبد الرحمن بن محمد بن إسماعيل بن إبراهيم بن إسماعيل باشا آل العظمة قائد عسكري سوري استشهد في مواجهة الجيش الفرنسي الذي قدم لاحتلال سوريا ولبنان حيث كان وزير الحربية للحكومة العربية في سوريا بقيادة الملك فيصل الأول، أتقن العربية والتركية والفرنسية والألمانية والإيطالية والإنجليزية، في كل عام في ذكرى استشهاده يقام احتفال في مقبرة الشهداء في ميسلون حيث تحمل إليه الأكاليل من مختلف الديار العربية. لم يخلف من الذرية إلا ابنته الوحيدة، رحلت مع أمها إلى تركيا وأنجبت هناك. ويذكر أن منزله حالياً تحول إلى متحف خاص بمقتنياته."},{"page_url":"https://no.wikipedia.org/wiki/Peterhof_(by)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Peterhof_cascade_2048px.jpg","page_title":"Peterhof (by)","context_page_description":"Peterhof er en by i Petrodvortsovyj-distriktet i den føderale byen St. Petersburg i Russland. Den ligger ved sørkysten av Finskebukta, rundt 30 km vest for sentrum av St. Petersburg. Innbyggertall: 64 791.\\nByen har navnet etter palasskomplekset Peterhof, som byen er bygget opp rundt. Peterhof-palasset består av en rekke palasser og et omfattende park- og hageområde. Det ble bygget etter ordre fra Peter den store, og blir av og til kalt «Russlands Versailles». Palasskomplekset inngår i verdensarvstedet St. Petersburg.\\nByen er også hjemby for det ene av Statsuniversitetet i St. Petersburgs to campuser."},{"page_url":"https://nl.wikipedia.org/wiki/Jacob_Cornelis_Overvoorde","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Overvoordebank_in_Dordrecht.jpg","page_title":"Jacob Cornelis Overvoorde","context_page_description":"Jacob Cornelis Overvoorde was een Nederlands jurist, historicus en archivaris.\\nOvervoorde studeerde rechten en staatswetenschappen in Leiden en promoveerde in 1891 in beide richtingen op een proefschrift getiteld De ontwikkeling van den rechtstoestand der vrouw, volgens het oud-Germaansche en oud-Nederlandsche recht. Hij werkte toen al sinds 1890 als rechtskundig ambtenaar bij het Utrechts Archief. Van 1892 tot 1901 was hij archivaris van Dordrecht, waarna hij van 1901 tot zijn overlijden dezelfde functie bekleedde in Leiden. Mede door zijn toedoen werd in beide steden kort na zijn aanstelling een plaatselijke historische vereniging opgericht. In 1892 was dit in Dordrecht de Vereniging Oud-Dordrecht en in 1902 in Leiden de Historische vereniging Oud-Leiden.\\nHij was een linkse liberaal en lid van de Radicale Bond. Na zijn promotie raakte Overvoorde nauw betrokken bij de emancipatie van de vrouw. Hij trok in publicaties fel van leer over de maatschappelijke en wettelijke achterstelling van de vrouw, vond dat haar kiesrecht toekwam en dat haar de toegang tot het hogere onderwijs niet mocht worden belemmerd, wat vaak praktijk was."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E9%95%B7%E6%B2%A2%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/JR_Higashinagasawa_sta_001.jpg","page_title":"東長沢駅","context_page_description":"東長沢駅は、山形県最上郡舟形町長沢にある、東日本旅客鉄道陸羽東線の駅である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%96%E5%A0%80%E5%B7%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Sanzaemonbori.jpg","page_title":"外堀川","context_page_description":"外堀川は、野田川水系の支流で兵庫県姫路市の南部を流れる二級河川。外濠川とも表記し、一般には三左衛門堀と呼ばれる。野田川を介して姫路港につながる。\\n「三左衛門堀」の名は、姫路城を本格築城した池田輝政の異名に因む。"},{"page_url":"https://en.wikipedia.org/wiki/Viking_expansion","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Evariste-Vital_Luminais_-_Pirates_normands_au_IXe_si%C3%A8cle_%28esquisse%29.jpg","page_title":"Viking expansion","context_page_description":"Viking expansion is the process by which Norse explorers, traders and warriors, the latter known in modern scholarship as Vikings, sailed most of the North Atlantic, reaching south to North Africa and east to Russia, Constantinople and the Middle East as looters, traders, colonists and mercenaries. Vikings under Leif Erikson, the heir to Erik the Red, reached North America and set up a short-lived settlement in present-day L'Anse aux Meadows, Newfoundland, Canada. Longer lasting and more established settlements were formed in Greenland, Iceland, the Faroe Islands, Great Britain, Ireland and Normandy.\\nIt is debated whether the term Viking represents all Norse settlers or just those who raided."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%BC%D0%B5%D0%B3%D0%B0%D0%BB%D0%B8%D1%82%D0%B8%D1%82%D0%B5_%D0%B2_%D0%91%D1%8A%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Megalithic_sanctuary_Skumsale_Streltcha_BG.jpg","page_title":"Списък на мегалитите в България","context_page_description":"Това е списък на някои от мегалитите в България."},{"page_url":"https://is.wikipedia.org/wiki/K%C3%B3pavogur","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/K%C3%B3pavogur_Vesturb%C3%A6r.JPG","page_title":"Kópavogur","context_page_description":"Kópavogsbær er sveitarfélag á höfuðborgarsvæðinu sem liggur sunnan við Reykjavík og norðan við Garðabæ og á jafnframt landsvæði á Sandskeiðum og Húsfellsbruna. Bærinn dregur nafn sitt af voginum sunnan við Kársnes. Kópavogur er fjölmennastur þeirra bæja sem liggja í kringum Reykjavík og er jafnframt næstfjölmennasta sveitarfélag á Íslandi, með 35.246 íbúa í janúar árið 2017.\\nÞar var Kópavogsfundurinn haldinn árið 1662, en allt fram á 20. öld voru einungis nokkrir bústaðir og býli í Kópavogi. Á 4. áratug 20. aldar var byrjað að úthluta lóðum í landi Kópavogs og ollu þjóðfélagsaðstæður því að fólksfjölgun var mikil og hröð. Kópavogshreppur klofnaði frá Seltjarnarneshreppi árið 1948 og fékk svo kaupstaðarréttindi 1955. Undir lok 20. aldarinnar og í byrjun 21. aldar var mikil uppbygging í Kópavogi. Framan af var aðallega íbúðasvæði í Kópavogi, en vegna staðsetningar sinnar í miðju höfuðborgarsvæðisins er einnig mikið af atvinnustarfsemi og þjónustu í bænum. Þar er stærsta verslunarmiðstöð landsins, Smáralind, hæsta bygging landsins Smáratorg 3 og mikil viðskiptastarfsemi.\\nLandsvæði Kópavogsbæjar er fjölbreytt."},{"page_url":"https://en.wikipedia.org/wiki/2009_G20_Pittsburgh_summit","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/G20_peoples_march.jpg","page_title":"2009 G20 Pittsburgh summit","context_page_description":"The 2009 G20 Pittsburgh Summit was the third meeting of the G20 heads of state/heads of government to discuss financial markets and the world economy.\\nThe G20 is the premier forum for discussing, planning and monitoring international economic\\ncooperation.\\nThe summit was held at the David L. Lawrence Convention Center in Pittsburgh, Pennsylvania, United States on September 24–25, 2009. Announced shortly after the April 2009 G20 London summit, U.S. President Barack Obama volunteered to host this summit, initially planning to hold it in New York City and coordinating it with the opening of the United Nations General Assembly. However, due to coordination issues, on May 28, 2009, the Obama Administration announced a change of venue to Pittsburgh in order to highlight the city's economic recovery following the collapse of its manufacturing sector in the latter half of the 20th century. In response to the Global credit crisis, a G20 summit in one year was proposed shortly after the London summit in April 2009.\\nAmongst the issues discussed was a proposal to radically reform the International Monetary Fund."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BC%D0%B0%D1%82%D0%B0%D0%BD%D1%82%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Starr_080103-1178_Nematanthus_wettsteinii.jpg","page_title":"Нематантус","context_page_description":"Немата́нтус — род цветковых растений семейства Геснериевые."},{"page_url":"https://pl.wikipedia.org/wiki/Bosilegrad","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Bosilegradzastava.png","page_title":"Bosilegrad","context_page_description":"Bosilegrad – miasteczko w Serbii, w okręgu pczyńskim, siedziba gminy Bosilegrad. W 2011 roku liczyło 2624 mieszkańców."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Br%C3%BCcken_in_Hamburg-Ohlsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Vor_dem_Berge.jpg","page_title":"Liste der Straßen und Brücken in Hamburg-Ohlsdorf","context_page_description":"Die Liste der Straßen und Brücken in Hamburg-Ohlsdorf ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Ohlsdorf vorhandenen Straßen und Brücken. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://ast.wikipedia.org/wiki/Pen%C3%ADnsula_de_Taitao","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/SRTM-W75.80E71.50S47.00N46.00.Chilechico.png","page_title":"Península de Taitao","context_page_description":"La península de Taitao ta allugada na Rexón d'Aysén, nel sur de Chile, y ta xunida al continente pol istmu de Ofqui.\\nNel llugar converxen trés plaques teutóniques: la de Naza y l'Antártica, que se mueven escontra l'este, y la Suramericana, que se mueve escontra l'oeste.\\nLa península de Taitao tien una xeografía bien irregular. La intensa actividá glacial esculpió fondos valles, que depués del fundimientu aniciaron los numberosos fiordos esistentes nes veres de les canales y que permanecen inexplorados.\\nAl norte de la península atopa'l archipiélagu de los Chonos y al sur d'ella, dixebraes pol Golfu de Penas, tán les islles Guayaneco."},{"page_url":"https://nl.wikipedia.org/wiki/Dorpskerk_(Spijkenisse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/SP_KERKEN_DORPSKERK_041_Dorpskerk_Spijkenisse_1969.jpg","page_title":"Dorpskerk (Spijkenisse)","context_page_description":"De Dorpskerk van Spijkenisse is een laat-gotische kruiskerk in het centrum van Spijkenisse. Het is het oudste gebouw van Spijkenisse, voltooid in 1521. De Dorpskerk is nog steeds in gebruik voor kerkdiensten en wordt ook voor andere doeleinden gebruikt."},{"page_url":"https://no.wikipedia.org/wiki/Brev_fra_en_ukjent_(novelle)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Stefan_Zweig2.png","page_title":"Brev fra en ukjent (novelle)","context_page_description":"Brev fra en ukjent er en novelle av den østerrikske forfatteren Stefan Zweig, publisert i 1922."},{"page_url":"https://tr.wikipedia.org/wiki/Jerzy_Kukuczka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Katowice_-_Graffiti_Jerzy_Kukuczka.jpg","page_title":"Jerzy Kukuczka","context_page_description":"Józef Jerzy Kukuczka, Polonyalı dağcı. Bir kömür madeninde elektrik mühendisi olarak çalıştı."},{"page_url":"https://de.wikipedia.org/wiki/Arcos_de_Valdevez","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Arcos-de-Valdevez_IMG_0222.JPG","page_title":"Arcos de Valdevez","context_page_description":"Arcos de Valdevez ist eine Kleinstadt in Portugal mit 22.847 Einwohnern."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%91%E3%83%BC%E3%83%A0%E3%83%BB%E3%82%B8%E3%83%A5%E3%83%A1%E3%82%A4%E3%83%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Dubai_Wingsuit_Flying_Trip_%287623566780%29.jpg","page_title":"パーム・ジュメイラ","context_page_description":"パーム・ジュメイラは、アラブ首長国連邦のドバイ政府所有の企業ナキールが作ったペルシア湾の人工島で、ドバイ市街地の西郊のジュメイラ地区の海岸部に建設された。パーム・アイランド3島の一つで、パーム・アイランド3島の中でも最小であり、最初に作られた。パーム・ジュメイラ建設によりドバイの海岸線は520km長くなった。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E5%BD%A2%E7%9C%8C%E3%81%AE%E5%B8%82%E7%94%BA%E6%9D%91%E6%97%97%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Flag_of_Obanaza_Yamagata.JPG","page_title":"山形県の市町村旗一覧","context_page_description":"山形県の市町村旗一覧は、山形県内の市町村に制定されている、あるいは制定されていた市町村旗の一覧である。なお、一覧の順序は全国地方公共団体コード順による。廃止された市町村旗は廃止日から順に掲載している。"},{"page_url":"https://nl.wikipedia.org/wiki/Lustgarten_(Potsdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Stadtschloss_Potsdam_%281900%29.jpg","page_title":"Lustgarten (Potsdam)","context_page_description":"De Lustgarten is het oudste park in Potsdam. Het ontstond rond 1660 tijdens de regeerperiode van Frederik Willem van Brandenburg. Als voorbeeld diende het park in de stad Kleef dat door de combinatie van park en kasteel veel bezoekers trok. De Lustgarten zelf werd onderdeel van de nieuwe combinatie van Stadtschloss, Alter Markt en de oever van de Havel. Het strekte zich uit vanaf de zuidzijde van het Stadtschloss tot aan de Havel. In het park waren lanen aangelegd die omzoomd waren met bomen. Daarnaast was er een bijzondere vijver aangelegd met daarin beelden van onder andere Neptunus.\\nIn opdracht van koning Frederik Willem I werd rond 1720 een groot deel van de Lustgarten in een exercitie- en paradeterrein veranderd voor de soldaten van het Pruisische leger. Zijn definitieve vorm kreeg de Lustgarten pas in 1829. De beroemde landschapsarchitect Peter Joseph Lenné maakte het ontwerp hiervoor. Hierna bleef de Lustgarten tot aan het einde van de Tweede Wereldoorlog bijna onveranderd.\\nNa de Tweede Wereldoorlog was de Lustgarten zwaar beschadigd en werd op het terrein een stadion gebouwd waardoor het park grotendeels verdween."},{"page_url":"https://it.wikipedia.org/wiki/Premuda_(isola)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Kirche_St_Jakob.JPG","page_title":"Premuda (isola)","context_page_description":"Prèmuda è un'isola della Croazia, situata nel mare Adriatico a sud di Lussino e a ovest di Pago, nelle isole Liburniche meridionali.\\nAppartiene al territorio di Zara, nella regione zaratina e vi risiedono 64 abitanti.\\nAnticamente era conosciuta anche come Pamodos, Pyrotima e Primodia e, in tedesco, Permud."},{"page_url":"https://fr.wikipedia.org/wiki/Tom%C3%A1%C5%A1_Fleischmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Tomas_Fleischmann_2012-03-09.JPG","page_title":"Tomáš Fleischmann","context_page_description":"Tomáš Fleischmann est un joueur professionnel tchèque de hockey sur glace. Il évolue au poste d'ailier gauche."},{"page_url":"https://hu.wikipedia.org/wiki/M%C3%B3cs","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/RO_CJ_Mociu_people_on_horseback.jpg","page_title":"Mócs","context_page_description":"Mócs falu Romániában, Kolozs megyében, az azonos nevű község központja."},{"page_url":"https://pl.wikipedia.org/wiki/Szczokino","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Shchyokino-Railway-Station.jpg","page_title":"Szczokino","context_page_description":"Szczokino – miasto w zachodniej Rosji, w obwodzie tulskim, liczące 60.351 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Giorgio_De_Lullo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Giorgio_De_Lullo.jpg","page_title":"Giorgio De Lullo","context_page_description":"Giorgio De Lullo was an Italian actor and stage director.\\nBorn in Rome into a humble family, in 1943 De Lullo enrolled at the Silvio d’Amico Academy of Dramatic Arts, but after two years he was forced to leave the courses as he had contravened the strict academic regulations appearing in a stage work directed by Mario Landi and held at the Teatro Manzoni in Milan. The same year he got critical acclaim for his performance in Il Candeliere directed by Orazio Costa. In 1946 he made his film debut, and worked on stage with Luchino Visconti, with whom he collaborated intensively in the following years. In 1954 De Lullo co-founded the theatrical company \\"La compagnia dei giovani\\" together with Rossella Falk, Anna Maria Guarnieri, Romolo Valli and Umberto Orsini, and the company achieved national and international success. He debuted as a stage director in 1955, with an adaptation of Colette's Gigi. He died of cirrhosis of the liver."},{"page_url":"https://tr.wikipedia.org/wiki/III._Konrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Konrad_III_Miniatur_13_Jahrhundert.jpg","page_title":"III. Konrad","context_page_description":"III. Konrad Hohenstaufen Hanedanı'ndan ilk Almanya kralı. Swabia Dükü I. Friedrich ile Agnes'in oğludur. Annesi, IV. Heinrich'in kızıdır.\\nKonrad'ın ilk eşi Gertrude von Komburg'dan hiçbir erkek mirasçı olmadı. 1136'da Sulzbach kontu II. Berengar'ın kızı ve Bizans imparatoru I. Manuil'in ilk karısı Bertha von Sulzbach'ın kız kardeşi Gertrud von Sulzbach ile evlendi. Gertrude, Konrad'ın çocuklarının annesi ve Bizans ile olan ittifakını güçlendiren bağlantıydı."},{"page_url":"https://de.wikipedia.org/wiki/Christo_und_Jeanne-Claude","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Floating_Piers_%E2%80%93_San_Paolo.jpg","page_title":"Christo und Jeanne-Claude","context_page_description":"Christo und Jeanne-Claude waren ein Künstlerehepaar, das ab den 1960er Jahren vor allem mit gemeinsam realisierten spektakulären Verhüllungsprojekten bekannt wurde.\\nChristo wurde bekannt, nachdem er sich 1960 der von Pierre Restany und Yves Klein in Paris gegründeten Gruppe „Nouveau Réalisme“ angeschlossen hatte, wiewohl er nie offizielles Mitglied der Gruppe war. Wie bei den meisten Protagonisten der aus dem Nouveau Réalisme hervorgegangenen soziologisch inspirierten Kunstauffassung entwickelte sich seine Kunst ursprünglich aus der Assemblage.\\nSpäter realisierte Christo zusammen mit seiner Frau Jeanne-Claude Verhüllungsaktionen an Gebäuden und Großprojekte in Landschaftsräumen, Industrieobjekten oder bekannten Bauwerken. Dabei wird er als der Künstler beschrieben, sie als die Organisatorin. 1995 dementierten beide diese Unterscheidung.\\nIn Deutschland wurde das Künstlerpaar insbesondere durch die Verhüllung des Berliner Reichstagsgebäudes im Jahre 1995 populär. Das Lebenswerk von Christo wurde nach dessen Tod im Jahr 2020 von der Bundesregierung gewürdigt."},{"page_url":"https://en.wikipedia.org/wiki/List_of_guitar_tunings","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Double_drop_D_tuning.png","page_title":"List of guitar tunings","context_page_description":"This list of guitar tunings supplements the article guitar tunings. In particular, this list contains more examples of open and regular tunings, which are discussed in the article on guitar tunings. In addition, this list also notes dropped tunings."},{"page_url":"https://fy.wikipedia.org/wiki/Wynmotors_yn_Frysl%C3%A2n","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Windmotor_Koudum_05c.JPG","page_title":"Wynmotors yn Fryslân","context_page_description":"Der stiet in frij grut tal wynmotors yn Fryslân, mear as yn oare provinsjes fan Nederlân."},{"page_url":"https://la.wikipedia.org/wiki/Os_hamatum","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Ospoignet_-_Hamate_bone.png","page_title":"Os hamatum","context_page_description":"Os hamatum vel, olim, os unciforme est os carpi ordinis distalis. Connectitur os hamatum cum metacarpi osse metacarpali IV et osse metacarpali V, velut carpi ossium, cum osse triquetro, osse lunato, osse capitato. Pars conspicua est hamulus, protuberantia extrema ulnare canalis carpi et radiale canalis ulnaris formans.\\nFracturae ossis hamati rarae sunt, at si adest, tunc saepe artibus arthleticis fractura per fatigationem agnota."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%AF%9B%E9%87%8C%E5%A1%94%E5%B0%BC%E4%BA%9A%E9%93%81%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Map_Mauritania_Railway.png","page_title":"毛里塔尼亚铁路","context_page_description":"茅利塔尼亞鐵路，是茅利塔尼亞的一條704公里長單線准軌鐵路，連接努瓦迪布港和祖埃拉特鐵礦。\\n這條鐵路在1940年茅利塔尼亞還是法國殖民地時被提出，1961年開始建設，1963年投入使用。這條鐵路基本上沿著茅利塔尼亞和西撒哈拉邊界修建。為了避開當時西班牙統治的西撒哈拉，鐵路有一段2公里長的隧道。西班牙撤出西撒哈拉後，茅利塔尼亞曾短暫占領鄰近地區並將鐵路移動到西撒哈拉境內，隧道不再使用。目前相關地區實際上大部分被波利薩里奧陣線占領。\\n鐵路上運行的列車一般全長2500米，包括3-4節易安迪柴油機車和200-210節貨車，有的貨車上也有人員乘搭。"},{"page_url":"https://la.wikipedia.org/wiki/Paulus_Signac","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Paul_Signac_Deux_stylistes_Rue_du_Caire.jpg","page_title":"Paulus Signac","context_page_description":"Paulus Signac fuit pictor et graphicus Francicus. Erat amicus Vincentii van Gogh et anarchista de idea. Cum Georgio Seurat artifex illustrissimus generis impressionismi novi et punctillorum multorum fuit."},{"page_url":"https://en.wikipedia.org/wiki/List_of_ancient_tribes_in_Illyria","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/IllyricumAD6RomanConditionofTribes.png","page_title":"List of ancient tribes in Illyria","context_page_description":"This is a list of ancient tribes in the ancient territory of Illyria. The name Illyrians seems to be the name of a single Illyrian tribe that was the first to come into contact with the ancient Greeks, causing the name Illyrians to be applied to all people of similar language and customs. The locations of Illyrian tribes/peoples prior to the Roman conquest are approximate, as sometimes many wholly different locations are given by ancient writers and modern authors.\\nAfter the Great Illyrian Revolt, the Romans deported, split, and resettled Illyrian tribes within Illyria itself and to Dacia, sometimes causing whole tribes to vanish and new ones to be formed from their remains, such as the Deraemestae and the Docleatae, some of them mixed with Celtic tribes. Many tribal names are known from Roman civitates and the number of their decuriae, formed of the dispersed tribes in Illyria."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%98%87%E6%8C%AF%E7%94%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/%E8%98%87%E6%8C%AF%E7%94%B22.jpg","page_title":"蘇振甲","context_page_description":"苏振甲，字鼎三。甘肃省靖远县糜滩乡人。民国37年在甘肃省第一选区当选第一届立法委员"},{"page_url":"https://de.wikipedia.org/wiki/Ausfalltor_(K%C3%B6nigsberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/ID004651_E120_Ausfalltor.jpg","page_title":"Ausfalltor (Königsberg)","context_page_description":"Das Ausfalltor in Königsberg war Teil der Fortifikationsanlage aus dem 19. Jahrhundert. Es befand sich genau an der gleichen Stelle, wie schon der frühe Befestigungsring von 1626, an der Kreuzung Friedrich-Ebert-Straße mit dem Deutschordensring. Das Tor war ein langer, dunkler Tunnel durch den Festungswall und konnte nur von Fußgängern benutzt werden. Die Reste sind heute noch vorhanden."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Frankfurt-H%C3%B6chst","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Frankfurt_Am_Main-Leverkuser_Strasse_7_von_Nordosten-20100524.jpg","page_title":"Liste der Kulturdenkmäler in Frankfurt-Höchst","context_page_description":"In der Liste der Kulturdenkmäler in Frankfurt-Höchst sind alle Kulturdenkmäler im Sinne des Hessischen Denkmalschutzgesetzes von Frankfurt-Höchst, Stadtteil von Frankfurt am Main aufgelistet. Die gut erhaltene Höchster Altstadt enthält den Großteil der Kulturdenkmäler und steht seit 1972 unter Denkmalschutz. Die meisten Fachwerkhäuser auf mittelalterlichem Stadtgrundriss stammen aus der Zeit nach dem großen Stadtbrand von 1586.\\nGrundlage ist die Denkmaltopographie aus dem Jahre 1994, die zuletzt 2000 durch einen Nachtragsband ergänzt wurde. Zusätzlich wird auf die 2008 erschienene Ausgabe des Handbuchs der Deutschen Kunstdenkmäler für den Regierungsbezirk Darmstadt sowie das 1979 erschienene Werk Fachwerk in Frankfurt am Main zurückgegriffen, sofern dort aktuellere oder zusätzliche Informationen vorhanden sind. In der Denkmaltopographie überwiegend abgekürzte Namen von Architekten, Baumeistern und Künstlern sind, soweit möglich, nach der unter dem Abschnitt Werke zu Architekten und Künstlern genannten Literatur aufgelöst."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B8%A4%E6%B5%B7%E4%B8%AD%E4%BA%AC%E5%9F%8E%E9%81%97%E5%9D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/%E6%B8%A4%E6%B5%B7%E4%B8%AD%E4%BA%AC%E5%9F%8E%E9%81%BA%E5%85%A8%E6%99%AF.jpg","page_title":"渤海中京城遗址","context_page_description":"渤海中京城遺址，即西古城城址，渤海國重要的都城遺址，位於中華人民共和國吉林省延邊朝鮮族自治州和龍市西城鎮古城村。"},{"page_url":"https://gl.wikipedia.org/wiki/Nicolao_III,_papa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/PopeNicholasIIICameo.jpg","page_title":"Nicolao III, papa","context_page_description":"Nicolao III naceu en Roma entre 1210 e 1220; faleceu en Soriano, cerca de Viterbo, o 22 de agosto de 1280, probablemente dun ataque de apoplexía.\\nFoi papa entre 1277 e 1280. Era membro da poderosa familia dos Orsini. Foi o primeiro papa que viviu regularmente en Roma, onde estableceu a residencia pontifical. Ténselle reprochado o seu nepotismo."},{"page_url":"https://la.wikipedia.org/wiki/Chassagny","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Chassagny_-_Ch%C3%A2teau.jpg","page_title":"Chassagny","context_page_description":"Chassagny est commune Francicum 1'272 incolarum praefecturae Rhodani in regione orientali Rhodano et Alpibus."},{"page_url":"https://nl.wikipedia.org/wiki/Havenbedrijf_Rotterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/World_Port_Center_from_Euromast.jpg","page_title":"Havenbedrijf Rotterdam","context_page_description":"Havenbedrijf Rotterdam N.V. is beheerder, exploitant en ontwikkelaar van het Rotterdamse haven- en industriegebied, de haven van Rotterdam.\\nHet Havenbedrijf Rotterdam is een van oorsprong gemeentelijke instantie van de gemeente Rotterdam. De dienst werd in 1932 opgericht als Havenbedrijf der Gemeente Rotterdam, een naam die in de jaren 1980 werd gewijzigd in Gemeentelijk Havenbedrijf Rotterdam. Op 1 januari 2004 werd het Gemeentelijk Havenbedrijf Rotterdam verzelfstandigd en omgevormd tot een naamloze vennootschap. Deze heeft twee aandeelhouders: de gemeente Rotterdam en de Staat."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1948","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/AM_Brouwer.jpg","page_title":"Lijst van personen overleden in 1948","context_page_description":"Dit is een lijst van personen die zijn overleden in 1948."},{"page_url":"https://id.wikipedia.org/wiki/Reaktor_cepat_berpendingin_timbal","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Lead-Cooled_Fast_Reactor_Schemata.svg","page_title":"Reaktor cepat berpendingin timbal","context_page_description":"Reaktor cepat berpendingin timbal adalah desain reaktor nuklir yang menggunakan spektrum neutron cepat serta didinginkan dengan lelehan timbal atau paduan timbal-bismut. Lelehan semacam ini berguna sebagai pendingin reaktor karena memiliki tangkapan neutron yang kecil dan memiliki titik leleh rendah. Uni Soviet pertama kali mengembangkan jenis reaktor ini, dan membuatnya untuk reaktor beberapa kapal selam nuklir serta 2 reaktor nuklir di darat antara dekate 1960an dan 1990an. Selain itu, jenis reaktor ini juga diteliti di Eropa Barat, Jepang, Korea Selatan, dan Amerika Serikat."},{"page_url":"https://en.wikipedia.org/wiki/Nicodemus_Knob","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Nicodemus_Knob.jpg","page_title":"Nicodemus Knob","context_page_description":"Nicodemus Knob is a 30-feet pillar of Portland stone, left as a landmark and quarrying relic at East Cliff on the Isle of Portland, Dorset, England. A similar artificial pillar formed through quarrying is Pulpit Rock at Portland Bill."},{"page_url":"https://en.wikipedia.org/wiki/Steinach_am_Brenner","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Steinach_am_Brenner_01.JPG","page_title":"Steinach am Brenner","context_page_description":"Steinach am Brenner is a market town in the district of Innsbruck-Land in the Austrian state of Tyrol located south of Innsbruck in the Wipptal at the Sill River."},{"page_url":"https://en.wikipedia.org/wiki/South_African_Class_3B_4-8-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/SAR_Class_3B_1479_%284-8-2%29.JPG","page_title":"South African Class 3B 4-8-2","context_page_description":"The South African Railways Class 3B 4-8-2 of 1912 was a steam locomotive.\\nIn 1912, the South African Railways took delivery of ten Class 3B steam locomotives with a 4-8-2 Mountain type wheel arrangement which had been ordered by the Natal Government Railways the year before."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D1%98_%D1%81%D0%B0%D0%B2%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%B5_%D1%83%D0%BC%D0%B5%D1%82%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D1%83_%D0%A1%D0%BA%D0%BE%D0%BF%D1%99%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Muzej_na_sovremenata_umetnost_-_Skopje_%282%29.jpg","page_title":"Музеј савремене уметности у Скопљу","context_page_description":"Музеј савремене уметности у Скопљу је музеј смештен на брду Кале, у непосредној близини тврђаве Скопско кале, са посебним фокусом на модернизам.\\nМузеј је званично основан 1964. године, изградња зграде музеја започета је 5. априла 1969. године, а завршена је 13. новембра 1970. године, када је свечано отворена. Зграда је донација Владе Пољске. Данас, овај музеј је јединствена институција у Северној Македонији који прикупља и обрађује документацију македонске уметности и приказује важне историјске филмове. Прво реновирање музеја од његовог оснивања било је 22. фебруара 2014. године, када је уједно отворена и изложба „Солидарност - непотпун пројекат“.\\nМузеј је стациониран у оквиру Старе скопске чаршије."},{"page_url":"https://war.wikipedia.org/wiki/Stichophthalma_camadeva","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/StichophthalmaCamadeva158_1a.jpg","page_title":"Stichophthalma camadeva","context_page_description":"An Stichophthalma camadeva in uska species han Lepidoptera nga ginhulagway ni John Obadiah Westwood hadton 1848. An Stichophthalma camadeva in nahilalakip ha genus nga Stichophthalma, ngan familia nga Nymphalidae. Waray hini subspecies nga nakalista."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%82%D1%8B%D0%B2%D0%B5%D0%BD_%D0%A1%D1%96%D0%B3%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Steven_Seagal_November_2016.jpg","page_title":"Стывен Сігал","context_page_description":"Стывен Сігал — амерыканскі кінаакцёр, айкідзін, музыкант, шэрыф. З 4 жніўня 2018 г. спецпрадстаўнік МЗС Расійскай Федэрацыі па гуманітарных сувязях з ЗША\\nСігал вядомы прарасійскімі ўчынкамі і падтрымкай палітыкі У. Пуціна датычна Грузіі і Украіны, называе амерыканскія СМІ прадузятымі да Расіі. Сігал таксама вядомы паездкай у Чачню на асабістае запрашэнне Рамзана Кадырава і наведваннем байкерскага шоў у Севастопалі, дзе ён выканаў гімн «Данецкай Народнай Рэспублікі» і атрымаў футболку з партрэтам Пуціна ў падарунак.\\n24 жніўня 2016 г. адбылася нефармальная сустрэча з прэзідэнтам Беларусі А. Лукашэнка."},{"page_url":"https://es.wikipedia.org/wiki/Ballst%C3%A4dt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Wappen_Ballstaedt.png","page_title":"Ballstädt","context_page_description":"Ballstädt es un municipio situado en el distrito de Gotha, en el estado federado de Turingia, a una altitud de 270 metros. Su población a finales de 2016 era de unos 670 habitantes y su densidad poblacional, 70 hab/km².​​\\nSe encuentra ubicado a poca distancia al oeste de Erfurt, la capital del estado."},{"page_url":"https://de.wikipedia.org/wiki/Harry_J._Collins","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Major_General_Harry_J._Collins_1945.jpg","page_title":"Harry J. Collins","context_page_description":"Harry J. Collins war Generalmajor der US-Truppen in Österreich."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%98%A4%ED%83%80%EB%A3%A8_%EC%9A%B4%ED%95%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Otaru_Canal_Dusk_in_summer.jpg","page_title":"오타루 운하","context_page_description":"오타루 운하는 일본 홋카이도 오타루시에 있는 운하이다.\\n1923년 완성되었다. 일본에서는 유일하게 난바다 매립 방식으로 만들어졌고 완만하게 구부러져 있는 것이 특징이다. 전체 길이 1,140m이다. 1986년에 운하의 일부를 매립해 폭의 절반이 되어 도로가 되고 산책로가 정비되면서 오타루시의 관광지가 되었으며, 주변 지역을 포함하여 관광지로 변모했다. 산책로에는 63개의 가스등이 설치되어 있다."},{"page_url":"https://en.wikipedia.org/wiki/Bart_Tommelein","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Collins_Nweke_and_Bart_Tommelein%2C_2012.jpg","page_title":"Bart Tommelein","context_page_description":"Bart Joris Tommelein is a Belgian politician of Open Vld who was minister in the Bourgeois Government and is the incumbent mayor of Ostend."},{"page_url":"https://et.wikipedia.org/wiki/Ehalkivi","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Letipea_hiidrahn.jpg","page_title":"Ehalkivi","context_page_description":"Ehalkivi on Eesti suurim rändrahn, mis asub Lääne-Viru maakonnas Viru-Nigula vallas Kunda lähistel Letipea neeme tipus madalal merevees.\\nNime sai Ehalkivi sellest, et päike loojudes tema taha tervenisti ära kaob.\\nKivi koordinaadid on 59° 32′ 59″ N, 26° 35′ 15″ E."},{"page_url":"https://pt.wikipedia.org/wiki/Wangerooge","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/2012-05-13_Nordsee-Luftbilder_DSCF9125.jpg","page_title":"Wangerooge","context_page_description":"Wangerooge é um município da Alemanha localizado no distrito de Friesland, estado de Baixa Saxônia."},{"page_url":"https://nl.wikipedia.org/wiki/Gerace","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Gerace_San_Martino.jpg","page_title":"Gerace","context_page_description":"Gerace is een gemeente in de Italiaanse provincie Reggio Calabria en telt 2938 inwoners. De oppervlakte bedraagt 28,6 km², de bevolkingsdichtheid is 107 inwoners per km²."},{"page_url":"https://fr.wikipedia.org/wiki/Blaff_de_poissons","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Blaff_de_poissons_1.jpg","page_title":"Blaff de poissons","context_page_description":"Le blaff de poissons ou court-bouillon de poisons à l'antillaise est une recette de cuisine traditionnelle des cuisines antillaise et guyanaise, à base de ragoût de poissons déposés dans une marinade de jus de citron vert, oignon, bouquet garni, piment de Cayenne, puis cuits au court-bouillon."},{"page_url":"https://ar.wikipedia.org/wiki/NGC_3825","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/NGC3825_-_SDSS_DR14.jpg","page_title":"NGC 3825","context_page_description":"NGC 3825 في الفهرس العام الجديد، هي مجرة، تقع في كوكبة العذراء. اكتشفت في 15 مارس 1784 بواسطة ويليام هيرشل."},{"page_url":"https://eo.wikipedia.org/wiki/Grandega_fasciolo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/G._truncatula_and_R._peregra.jpg","page_title":"Grandega fasciolo","context_page_description":"Grandega fasciolo, latine Fascioloides magna estas 4–8 cm longa kaj 2,5–3,5 cm larĝa helminto apartenanta al klaso de trematodoj kun dorse-ventra platigita korpo kaj du suĉiloj, kiu parazitas en hepato de libere vivantaj, sed ankaŭ de hejmaj remaĉuloj. La trematodo vivtenas sin per sango de definitiva gastiganto kaj ĝia komplika evola ciklo okazas tra intergastiganto - tra gastropodoj. La trematodo devene troviĝis en Nord-Ameriko, kie al la ĉefaj gastigantoj apartenas blankavosta cervo, ruĝa cervo kaj boaco. Sed en la dua duono de la 19-a jarcento la parazito estis haŭlita sur teritorion de Eŭropo komune kun importado de bestaro. La trematodo bone adaptiĝis en la eŭropaj kondiĉoj kaj ĝi trovis por si ĉi tie novajn definitivajn gastigantojn kaj intergastigantojn. Malsaniĝo, kiun tiu ĉi parazito kaŭzas, nomiĝas fascioloidozo. Al terapio de la libere vivantaj remaĉuloj estas uzata triklabendazolo aŭ rafoksanido."},{"page_url":"https://en.wikipedia.org/wiki/Meiji_(era)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Khalili_Collection_Japanese_Meijji_waves_panel.jpg","page_title":"Meiji (era)","context_page_description":"The Meiji era is an era of Japanese history which extended from October 23, 1868 to July 30, 1912. This era represents the first half of the Empire of Japan, during which period the Japanese people moved from being an isolated feudal society at risk of colonisation by European powers to the new paradigm of a modern, industrialised nation state and emergent great power, influenced by Western scientific, technological, philosophical, political, legal, and aesthetic ideas. As a result of such wholesale adoption of radically-different ideas, the changes to Japan were profound, and affected its social structure, internal politics, economy, military, and foreign relations. The period corresponded to the reign of Emperor Meiji. It was preceded by the Keiō era and was succeeded by the Taishō era, upon the accession of Emperor Taishō.\\nTo convert any Gregorian calendar year between 1868 and 1912 to Japanese calendar year in Meiji era, 1867 needs to be subtracted from the year in question."},{"page_url":"https://es.wikipedia.org/wiki/Paro_(But%C3%A1n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Paro%27s_main_street_2.jpg","page_title":"Paro (Bután)","context_page_description":"Paro es una ciudad del Distrito de Paro, en el reino de Bután. La ciudad contaba en 2005 con aproximadamente 20.000 habitantes. Allí se encuentra el único aeropuerto en ese país, con un terminal de techos verdes donde llega Druk Air, la línea aérea nacional de Bután, desde India, Nepal, Bangladés y Tailandia."},{"page_url":"https://pt.wikipedia.org/wiki/Jean_Piaget","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Jean_Piaget_in_Ann_Arbor.png","page_title":"Jean Piaget","context_page_description":"Jean William Fritz Piaget foi um biólogo, psicólogo e epistemólogo suíço, considerado um dos mais importantes pensadores do século XX. Defendeu uma abordagem interdisciplinar para a investigação epistemológica e fundou a Epistemologia Genética, teoria do conhecimento com base no estudo da gênese psicológica do pensamento humano.\\nEstudou inicialmente biologia na Universidade de Neuchâtel onde concluiu o seu doutorado e, posteriormente, se dedicou à área de Psicologia, Epistemologia e Educação. Foi professor de psicologia na Universidade de Genebra de 1929 a 1954, e tornou-se mundialmente reconhecido pela sua revolução epistemológica. Durante sua vida Piaget escreveu mais de cinquenta livros e diversas centenas de artigos.\\nPiaget também teve um considerável impacto no campo da ciência da computação. Seymour Papert usou o trabalho de Piaget como fundamentação ao desenvolver a linguagem de programação Logo. Alan Kay usou as teorias de Piaget como base para o sistema conceitual de programação Dynabook, que foi inicialmente discutido em Xerox PARC."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D1%8C%D0%B4%D0%B8%D0%B2%D0%B0%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%BE%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Flag_of_Valdivatskoe_%28Ulyanovsk_oblast%29.png","page_title":"Вальдиватское сельское поселение","context_page_description":"Вальдива́тское се́льское поселе́ние — муниципальное образование в составе Карсунского района Ульяновской области. Административный центр — село Вальдиватское."},{"page_url":"https://fr.wikipedia.org/wiki/Gio_Colucci","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Paris%2C_France._RODIN_MUSEUM_%28Hotel_Biron%29%28Facade%29.%28PA00088697%29.jpg","page_title":"Gio Colucci","context_page_description":"Gio Colucci, né à Florence en 1892 et mort à Paris le 5 octobre 1974, est un artiste italien.\\nProlifique et éclectique, l'italien Gio Colucci, parfois connu en France sous le nom de Géo Colucci, exerça en tant que peintre, graveur, illustrateur, céramiste et sculpteur."},{"page_url":"https://it.wikipedia.org/wiki/Space_Shuttle_Discovery","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Sts-114-patch.png","page_title":"Space Shuttle Discovery","context_page_description":"Lo Space Shuttle Discovery è uno Space Shuttle della NASA. Il suo primo volo risale al 30 agosto 1984. Fu il terzo Shuttle a essere operativo e il più vecchio rimasto in servizio dato che i suoi predecessori Columbia e Challenger sono andati perduti in missione. L'orbiter ha concluso con successo la sua ultima missione il 9 marzo 2011.\\nDeve il proprio nome alla nave HMS Discovery, che trasportò l'esploratore James Cook nell'ultimo dei suoi tre viaggi principali. Non ufficialmente, lo Shuttle trae il proprio nome da Discovery, l'astronave del film 2001: Odissea nello spazio.\\nFu lo Shuttle che mise in orbita il Telescopio Spaziale Hubble e due delle tre missioni di manutenzione del telescopio vennero effettuate con la stessa navicella. Ha anche lanciato la sonda Ulisse e tre satelliti TDRS. È stato sempre il Discovery a riprendere i voli della NASA dopo i disastri del Challenger e del Columbia."},{"page_url":"https://en.wikipedia.org/wiki/2008_Emirates_Cup","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Arsenal_vs_Real_Madrid-bigger-view.jpg","page_title":"2008 Emirates Cup","context_page_description":"The 2008 Emirates Cup was a pre-season football friendly tournament hosted by Arsenal at its home ground, the Emirates Stadium in London. It was the second Emirates Cup, an invitational competition inaugurated in 2007. Held on the weekend of 2–3 August 2008, the participants of the tournament were Arsenal, Real Madrid, Juventus, and Hamburg.\\nEach team played two matches, with three points awarded for a win, one point for a draw and none for a loss. An additional point is awarded for every goal scored. Arsenal did not face Hamburg, and Real Madrid did not play against Juventus. On the opening day of the tournament, Real Madrid beat Hamburg 2–1, while Arsenal lost to Juventus by a single goal. Although the hosts defeated Real on day two, Hamburg won the Emirates Cup as they recorded a 3–0 victory against Juventus."},{"page_url":"https://hr.wikipedia.org/wiki/Filipinske_regije","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Ph_fil_eastern_visayas.png","page_title":"Filipinske regije","context_page_description":"Na Filipinima, regije su administrativna podjela koja služi prvenstveno za organiziranje provincija zemlje za administrativnu praktičnost. Trenutno su Filipini podijeljeni na 17 regija. Regije same ne posjeduju zasebnu lokalnu vladu, s iznimkom Autonomne regije Muslimanski Mindanao, koja ima izabranu regionalnu skupštinu i guvernera. Administrativna regija Cordillera je prvotno trebala biti samostalna, ali dva referenduma su to poništila. Svaka regija je podjeljena na provincije i nezavisne gradove."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8C%E3%82%A2%E3%82%A4%E3%82%A8%EF%BC%9D%E3%83%A2%E3%83%BC%E3%83%9A%E3%83%AB%E3%83%86%E3%83%A5%E3%82%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Mairie_Nouaill%C3%A9-Maupertuis.JPG","page_title":"ヌアイエ＝モーペルテュイ","context_page_description":"ヌアイエ＝モーペルテュイ は、フランス、ヌーヴェル＝アキテーヌ地域圏、ヴィエンヌ県のコミューン。"},{"page_url":"https://eu.wikipedia.org/wiki/Industrializazioa_Euskal_Herrian","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%22La_Algodonera_San_Antonio%22_enpresako_langileak.jpg","page_title":"Industrializazioa Euskal Herrian","context_page_description":"Industrializazioa Euskal Herrian XIX. mendean abiatu zen, nahiz eta aurretik metalurgiari lotutako burdinola asko egon. Industrializazioa batez ere Bizkaia eta Gipuzkoan hasi zen, jada zituzten portuak, burdina eta azpiegiturak baliatuz, XIX. mendearen bigarren erditik aurrera, bereziki Bigarren Karlistaldiaren ondoren. Bereziki Bizkaian, meatzaritzari eta portuari lotutako industriak aldaketa sakonak eragin zituen demografian eta politikan. Siderurgian oinarritutako industria izan zen Bizkaian gehien garatu zena, Gipuzkoan papergintza eta ehungintza izan ziren bitartean.\\nXX. mendean Araba, Nafarroa Garaia eta Lapurdi ere industrializatu ziren, baina Nafarroa Beherea eta Zuberoan apenas izan zen industrializaziorik. Industrializazio honen ondorioz, gaur egun ere bigarren sektoreak garrantzi handia du.\\nLangile-mugimenduaren sorrera, lehenengo mugimendu sozialista eta komunistekin eta prozesu honi lotutako euskal nazionalismoaren hastapenak hurrengo mende osoan eragingo zuen."},{"page_url":"https://en.wikipedia.org/wiki/Trousdale_Estates","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Trousdale-Trousdale_Pl_and_Loma_Vista_Dr_looking_South-West_2015.jpg","page_title":"Trousdale Estates","context_page_description":"Trousdale Estates is a neighborhood of Beverly Hills, California, located in the foothills of the Santa Monica mountains. It was developed in the 1950s and 1960s and is named after Paul Trousdale, a real estate developer.\\nAs of September 2019, the average sale price of a home in Trousdale Estates is over $11 million."},{"page_url":"https://hu.wikipedia.org/wiki/Theodor_Mommsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Theodor_Mommsen_02.jpg","page_title":"Theodor Mommsen","context_page_description":"Christian Matthias Theodor Mommsen német történész, egyike a 19. század legjelesebb ókortudósainak. A Római Birodalom történetéről szóló műveit a mai kutatók is alapvető fontosságúnak tartják. 1902-ben irodalmi Nobel-díjjal tüntették ki, elsősorban a Römische Geschichte című művére tekintettel."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B3%D0%BD%D1%96%D1%82%D0%BD%D0%B0_%D0%B3%D0%BE%D0%BB%D0%BE%D0%B2%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/VHS_head_drum_2.jpg","page_title":"Магнітна головка","context_page_description":"Магнітна головка — пристрій для запису, стирання і зчитування інформації з магнітного носія: стрічки або диска."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%A4%D7%A0%D7%94_%D7%91%D7%9E%D7%93%D7%99%D7%A0%D7%95%D7%AA_%D7%94%D7%9E%D7%A2%D7%A8%D7%91_%D7%91%D7%A2%D7%A9%D7%95%D7%A8_%D7%94%D7%A9%D7%A0%D7%99_%D7%A9%D7%9C_%D7%94%D7%9E%D7%90%D7%94_%D7%94-20","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Mode._Hattar._Modeplansch_fr%C3%A5n_1911_-_Nordiska_Museet_-_NMA.0033994.jpg","page_title":"אופנה במדינות המערב בעשור השני של המאה ה-20","context_page_description":"האופנה במדינות המערב בעשור השני של המאה ה-20 הייתה מגוונת במיוחד ואקזוטית במחצית הראשונה של העשור, בניגוד לפרקטיות הקודרת של בגדים בתקופת מלחמת העולם הראשונה."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D0%B0%D0%B5%D0%B4%D0%B4%D1%96%D0%BD-%D0%B1%D0%B5%D0%B9_I_%D0%9A%D0%B0%D1%80%D0%B0%D0%BC%D0%B0%D0%BD%D1%96%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Muradhudavendigar.jpg","page_title":"Алаеддін-бей I Караманід","context_page_description":"Алаеддін-бей — 13-й правитель бейлика Караманогуллари. Алаеддін-бей був сином Халіла-бея та братом Сулеймана-бея. Алаеддіна-бея часто помилково називають Алаеддін Алі-бей. Правління Алаеддіна прославилося збільшенням впливу Караманідів у Анатолії. Причиною цього результату був шлюб Алаеддіна із Нефісе Мелек Хатун, дочкою Османського султана Мурада I. Цей шлюб був першим династичним союзом караманідів із османами. Аладдін відстоював незалежність бейлика від османів, тому неодноразово воював із Мурадом і Баязидом. У 1397/98 був страчений Баязидом"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D9%8A_%D9%81%D9%8A%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Joy_Villa_and_Michael_Johns_%28cropped%29.jpg","page_title":"جوي فيلا","context_page_description":"جوي فيلا ‏ هي عازفة قيثارة ومغنية وكاتبة أغاني وممثلة أمريكية، ولدت في 25 أبريل 1986 في أورانج في الولايات المتحدة."},{"page_url":"https://pl.wikipedia.org/wiki/Gerlachowska_Kopa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Wielicki_Kocio%C5%82_a1.jpg","page_title":"Gerlachowska Kopa","context_page_description":"Gerlachowska Kopa, Gierlachowska Kopa – szczyt o wysokości 2600 m n.p.m. stanowiący północny, najniższy wierzchołek Zadniego Gerlacha w słowackich Tatrach Wysokich. Znajduje się w grani głównej Tatr Wysokich pomiędzy Lawinowym Szczytem, oddzielonym Wyżnią Gerlachowską Przełączką, a Wyżnią Wysoką Gerlachowską, oddzieloną Pośrednią Gerlachowską Przełączką.\\nNa Gerlachowską Kopę nie prowadzą żadne znakowane szlaki turystyczne, jest dostępna jedynie dla taterników.\\nPodobnie jak w przypadku Lawinowego Szczytu historia pomiarów Gerlachowskiej Kopy jest bardzo długa. Według dawniejszych pomiarów jej wysokość to ok. 2630 m, jednak pomiary te były niedokładne. Nieco nowsze pomiary aneroidowe wykazały, że jej wysokość to ok. 2605 m. Ostatecznie pomiary trygonometryczne, które wydają się najdokładniejsze, określiły wysokość Gerlachowskiej Kopy na ok. 2600 m.\\nPierwsze wejście na Gerlachowską Kopę, choć nieturystyczne, miało miejsce w lipcu lub w sierpniu 1895 r. Dokonali tego żołnierze, być może wraz z przewodnikami. Celem wejścia było umieszczenie sprzętu pomiarowego, który stał na wierzchołku kilka lat."},{"page_url":"https://fi.wikipedia.org/wiki/Bugatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Bugatti_veyron_in_Tokyo.jpg","page_title":"Bugatti","context_page_description":"Automobiles Ettore Bugatti oli ranskalainen automerkki, jonka perusti italialainen Ettore Bugatti. Yhtiö lakkautettiin vuonna 1963 Hispano-Suizan ostettua sen.\\nVuonna 1968 yhtiö päätyi SNECMAn haltuun.\\nVuonna 1998 Volkswagen Group osti Bugattin jäänteet ja perusti Bugatti Automobilesin."},{"page_url":"https://cs.wikipedia.org/wiki/Katedr%C3%A1la_Notre-Dame_(Pa%C5%99%C3%AD%C5%BE)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Notre_dame_view_from_Montparnasse_Tower.jpg","page_title":"Katedrála Notre-Dame (Paříž)","context_page_description":"Katedrála Notre-Dame v Paříži, francouzsky Cathédrale Notre-Dame de Paris, je gotická katedrála stojící na východní polovině pařížského ostrova Île de la Cité na řece Seině v Paříži. Je katedrálou pařížské římskokatolické arcidiecéze. Byla postavena v letech 1163–1345. Je považována za jeden z nejkrásnějších příkladů francouzské gotické architektury a patří k významným památkám evropské středověké architektury, zejména pro svůj unikátní přechod od pozdně románské ke gotické architektuře. Je proslulá rovněž použitím vnějších opěrných oblouků obvodových zdí. Průčelí je zdobeno četnými sochami. Výška předních věží je 69 m. 15. dubna 2019 katedrálu zachvátil požár, který zničil krov a sanktusovou věž."},{"page_url":"https://bs.wikipedia.org/wiki/Brzo_klizanje_na_Zimskim_olimpijskim_igrama_2014_%E2%80%93_500_m_(mu%C5%A1karci)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Men%27s_500m%2C_2014_Winter_Olympics%2C_Michel_Mulder_%283%29.jpg","page_title":"Brzo klizanje na Zimskim olimpijskim igrama 2014 – 500 m (muškarci)","context_page_description":"Takmičenje u brzom klizanju na 500 m u muškoj konkurenciji na Zimskim olimpijskim igrama 2014. u Sočiju održalo se u kompleksu za brzo klizanje Adler arena 10. februara 2014."},{"page_url":"https://fr.wikipedia.org/wiki/Culture_du_Br%C3%A9sil","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Catedral_Metropolitana_Ortodoxa_03.JPG","page_title":"Culture du Brésil","context_page_description":"La culture du Brésil, pays d'Amérique du Sud, façade atlantique, désigne d'abord les pratiques culturelles observables de ses habitants.\\nLa tradition culturelle brésilienne est extrêmement riche et variée grâce à son fort métissage, notamment du point de vue musical, chorégraphique et culinaire, mais aussi sur le plan religieux et mythologique."},{"page_url":"https://pl.wikipedia.org/wiki/Stal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Allegheny_Ludlum_steel_furnace.jpg","page_title":"Stal","context_page_description":"Stal – stop żelaza z węglem, plastycznie obrobiony i obrabialny cieplnie, o zawartości węgla nieprzekraczającej 2,11%, co odpowiada granicznej rozpuszczalności węgla w żelazie. Węgiel w stali najczęściej występuje w postaci perlitu płytkowego. Niekiedy jednak, szczególnie przy większych zawartościach węgla, cementyt występuje w postaci kulkowej w otoczeniu ziaren ferrytu.\\nIm większa zawartość węgla, a w konsekwencji udział twardego i kruchego cementytu, tym większa twardość stali. Węgiel w stalach niskostopowych wpływa na twardość poprzez wpływ na hartowność stali; im większa zawartość węgla tym dłuższy czas jest potrzebny do przemiany perlitycznej – co w konsekwencji prowadzi do przemiany bainitycznej i martenzytycznej. W stalach stopowych wpływ węgla na twardość jest również spowodowany tendencją niektórych metali, głównie chromu, do tworzenia związków z węglem – głównie węglików o bardzo wysokiej twardości.\\nWedług Polskiej Normy PN-EN 10020:2003 stal definiuje się jako materiał zawierający więcej żelaza niż jakiegokolwiek innego pierwiastka, o zawartości węgla w zasadzie mniejszej niż 2% i zawierający inne pierwiastki."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Bal_du_rat_mort","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Shrimpers_on_horseback.jpg","page_title":"Le Bal du rat mort","context_page_description":"Le Bal du rat mort est une bande dessinée fantastique belge scénarisée par Jan Bucquoy et dessinée par Jean-François Charles. Elle est parue en 1980 aux éditions Michel Deligne et a été rééditée chez Glénat en 1986.\\nUnique travail collaboratif des deux auteurs, Le Bal du rat mort raconte en 45 pages une invasion de rats manipulés par un homme qui se comporte comme un vampire.\\n« Le bal du Rat mort » est un bal masqué organisé lors du carnaval d'Ostende.\\nPlusieurs maisons de production se sont intéressées à la transcription de cette bande dessinée en un long métrage, mais aucun des projets n'a abouti"},{"page_url":"https://lb.wikipedia.org/wiki/Kapstad","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Kapstad-Panorama---w.jpg","page_title":"Kapstad","context_page_description":"Kapstad ass eng Stad a Südafrika an huet 827.218 Awunner. Mat de Faubourgen an de Townships maachen et eng 3.740.000 Awunner. Kapstad ass de Sëtz vum Parlament. D'Stad ass dominéiert vum Tafelbierg."},{"page_url":"https://en.wikipedia.org/wiki/Jan_van_Speyk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Jan_van_Speyk.jpg","page_title":"Jan van Speyk","context_page_description":"Jan Carolus Josephus van Speijk, also written Van Speyk, was a Dutch naval lieutenant who became a hero in the Netherlands for his opposition to the Belgian Revolution."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A4%D7%A0%D7%95%D7%9F_%D7%93%D7%95%D7%A4%D7%A7_%D7%9E%D7%A7%D7%95%D7%93%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Pcm.svg","page_title":"אפנון דופק מקודד","context_page_description":"אפנון דופק מקודד היא שיטה לייצוג דיגיטלי של אותות אנלוגיים.\\nבשיטה זו, עוצמת האות האנלוגי נדגמת בתדירות קבועה, ואז נשמרת כמילת קוד דיגיטלית, הקרובה ביותר לעוצמה האנלוגית שנדגמה.\\nשיטת ה-PCM משמשת כבר שנים להעברה דיגיטלית של שיחות טלפון, כקידוד השמע הנפוץ ביותר בקובצי wav, ובתקליטורים, וגם כקידוד סטנדרטי בפורמטי וידאו. שימוש נוסף הוא להעברת מידע לטווחים קצרים או בתוך מערכות."},{"page_url":"https://fr.wikipedia.org/wiki/Pir_Panjal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/ManiMahesh_Lake.JPG","page_title":"Pir Panjal","context_page_description":"La chaîne Pir Panjal, en ourdou پیر پنجال, en pendjabi ਪੀਰ ਪੰਜਾਲ, est un massif de montagnes d'Asie situé en Inde et au Pakistan et faisant partie de l'Himalaya. Il entoure intégralement la vallée du Cachemire et culmine à 6 221 mètres d'altitude à l'Indrasan."},{"page_url":"https://ceb.wikipedia.org/wiki/Dee_Island","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Dee-Island.jpg","page_title":"Dee Island","context_page_description":"Pulo ang Dee Island sa Antartika. Siya nahimutang sa amihanang bahin sa kontinente. Arhentina, Tsile, ug Hiniusang Gingharian nag-angkon sa maong dapit."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A5%E3%82%BF%E3%82%A4%E3%83%B3%E3%83%8F%E3%83%BC%E3%82%B2%E3%83%B3_(%E3%83%B4%E3%82%A7%E3%82%B9%E3%83%88%E3%83%95%E3%82%A1%E3%83%BC%E3%83%AC%E3%83%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Steinhagen_%28Westfalen%29_-_Obersteinhagen-Neuapostolische_Kirche.jpg","page_title":"シュタインハーゲン (ヴェストファーレン)","context_page_description":"シュタインハーゲン は、ドイツ連邦共和国ノルトライン＝ヴェストファーレン州デトモルト行政管区のギュータースロー郡に属す町村である。"},{"page_url":"https://de.wikipedia.org/wiki/Familienaufstellung","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Family_Board.JPG","page_title":"Familienaufstellung","context_page_description":"Familienaufstellung bezeichnet ein Verfahren, bei dem Personen stellvertretend für Mitglieder des Familiensystems eines Klienten konstellativ angeordnet werden, um aus einer dazu in Beziehung gesetzten Wahrnehmungsposition gewisse Muster innerhalb jenes Systems erkennen zu können. Das Familienstellen gründet auf der Vermutung, dass innerlich-grundlegende Beziehungen auch innerlich räumlich abgespeichert wirken – je nach Ausprägung funktional bis dysfunktional. Es handelt sich bei Aufstellungen nicht um Rollenspiele."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%B8_%D0%B0%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D1%8B_(%D0%94%D1%8E%D1%81%D1%81%D0%B5%D0%BB%D1%8C%D0%B4%D0%BE%D1%80%D1%84-%D0%91%D0%B5%D0%BD%D1%80%D0%B0%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Schloss_Benrath_Jan2012.jpg","page_title":"Памятники архитектуры (Дюссельдорф-Бенрат)","context_page_description":"Перечень памятников архитектуры Бенрата включает в себя 68 охраняемых законом и каталогизированных памятников архитектуры, представляющих историческую и художественную ценность. Этот перечень включен в общий список памятников архитектуры Дюссельдорфа на основании закона о памятниках архитектуры Северного Рейна-Вестфалии."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%B8%D1%81%D1%82%D0%BE%D1%8F%D0%BD%D0%BD%D1%8F_%D0%BD%D0%B0_%D0%93%D1%80%D1%83%D1%88%D0%B5%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Hrushevskyi_street_-_2014_Jan_22_-_21.jpg","page_title":"Протистояння на Грушевського","context_page_description":"Протистояння на вулиці Грушевського — події в Києві, що відбувалися з 19 по 22 січня 2014 року в ході Європейської революції в Україні як реакція на загострення протистояння Євромайдану з офіційною владою України після прийняття 16 січня «Законів про диктатуру» та знаменували початок гарячої фази протистояння.\\nШтурм розпочався після того, як лідер партії Батьківщина Арсеній Яценюк на вимогу Майдану назвати єдиного лідера спротиву оголосив, що «Тут є лідер. Це український народ», частина людей з Євромайдану вирішили пройти до будівлі Верховної Ради, щоб висловити свій протест. Дорогу їм перекрили сили «Беркуту», які загородилися автобусами та вантажівками безпосередньо біля входу на стадіон «Динамо» імені Валерія Лобановського. Кілька тижнів до цього цей проїзд також був заблокований силовиками."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%8C%97%E8%A7%92%E5%8C%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Harbour_North_Phase_2_B1_Yata_interior_202007.jpg","page_title":"北角匯","context_page_description":"北角汇是新鸿基地产的一个商场、连接住宅项目海璇。商场总面积约22万方呎，包括住宅基座商场14.6万方呎及酒店商场7.4万方呎，分别楼高4层与5层，提供约120至130间铺，面积约150至14,000方呎，呎租较同区为高，意向呎租由60至300元。商户组合方面，以时尚服饰及饮食为主，前者占30至35%，后者占30%，美容化妆占15%，生活用品及超市占10%，影音视讯占5至10%，钟表珠宝则仅占5%。商场现已开始招预租，目前已有逾100个零售商户有意承租，其中一田百货进驻2.9万方呎铺位。商场零售项目总投资额达32亿元，招租阶段宣传费约1,000万元。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%BE-%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%A1%D0%B0%D0%BC%D0%B0%D1%80%D0%B0%D0%BD%D1%87%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Museu_Ol%C3%ADmpic_Joan_Antoni_Samaranch.JPG","page_title":"Олимпийско-спортивный музей имени Самаранча","context_page_description":"Олимпийско-спортивный музей имени Самаранча был открыт в 2007 году, расположен в Барселоне. В июне 2010 года он был назван в честь Хуана Антонио Самаранча, президента Международного олимпийского комитета в 1980—2001 годах. Расположен напротив Олимпийского стадиона, на ограниченном участке."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_du_convoi_de_Malte","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Bruix-Charpentier.jpg","page_title":"Bataille du convoi de Malte","context_page_description":"La bataille du convoi de Malte était un engagement naval faisant partie des guerres de la Révolution française. Il eut lieu le 18 février 1800, durant le siège de Malte. La garnison française de la ville maltaise de La Valette était assiégée depuis dix-huit mois. Elle était bloquée du côté des terres par une armée composée de Britanniques, Portugais, et de troupes irrégulières maltaises. Du côté de la mer, un escadron de la Royal Navy britannique était présent, placé sous le commandement global de Lord Nelson depuis sa base sicilienne de Palerme. En février 1800, le gouvernement napolitain remplaça les troupes portugaises par les siennes, et les soldats furent amenés à Malte par Nelson et Lord Keith, arrivant le 17 février. Depuis le début des années 1800, la garnison française manquait cruellement de vivres. Dans un effort désespéré pour ravitailler la garnison, un convoi, sous le commandement du contre-amiral Jean-Baptiste Perrée, fut organisé à Toulon, chargé de vivres, d'armement et de renforts pour La Valette. Le 17 février, le convoi français approchait Malte depuis le sud-est, espérant longer la côte et échapper au blocus de l'escadron britannique."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D1%82%D0%B0%D0%B1_%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B3%D0%BE%D0%BB%D0%BE%D0%B2%D0%BD%D0%BE%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D1%83%D0%B2%D0%B0%D1%87%D0%B0_%D0%9E%D0%97%D0%A1_%D0%9D%D0%90%D0%A2%D0%9E_%D0%B2_%D0%84%D0%B2%D1%80%D0%BE%D0%BF%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Guenter_Kiessling.jpg","page_title":"Штаб Верховного головнокомандувача ОЗС НАТО в Європі","context_page_description":"Штаб Верховного головнокомандувача ОЗС НАТО в Європі — центральний штаб збройних сил НАТО в Європі. З 1967 року і по цей час штаб знаходиться в містечку Касто, що на півночі від бельгійського міста Монс, з 1951 по 1967 рік — штаб-квартира знаходилася у Парижі."},{"page_url":"https://nl.wikipedia.org/wiki/2Amsterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/2Amsterdam_I_%282019.06.09%29%281%29.jpg","page_title":"2Amsterdam","context_page_description":"2Amsterdam is een gebouwencomplex aan de Eduard van Beinumstraat in Amsterdam-Zuid.\\nDe twee gebouwen, voorheen aangeduid als De Tweeling of The Twins werden gebouwd op het terrein van een voormalig hoofdkantoor van de Nederlandse Middenstandsbank. Architect W.Th. Ellerman ontwierp voor deze plek, die tussen de Strawinskylaan en de Rijksweg 10 ligt, twee bijna identieke kantoortorens tussen het World Trade Center Amsterdam en kantoorcomplex Atrium. Het was een toevoeging aan het financieel centrum aan wat later de Zuidas zal worden genoemd. Vanaf 1989 werd er nog tegen de zin van de plaatselijke schoonheidscommissie gebouwd en in 1992 werden de gebouwen geopend. De torens van 68 en 76 meter hoog kregen destijds de naam De Stibbe Torens mee, vernoemd naar de eerste gebruiker van de torens, advocatenkantoor Stibbe, die vanaf 1992 in beide torens gevestigd was. AkzoNobel en andere firma’s traden op den duur op als medegebruiker van een van de torens. De torens vielen bij oplevering op vanwege hun witte kleur. Bovendien volgden ze een trend die begin 21e eeuw heerst in de Europese architectuur, namelijk dat ze de indruk wekken uit het lood te staan."},{"page_url":"https://bg.wikipedia.org/wiki/Eupatorium_sessilifolium","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Eupatorium_sessilifolium_drawing_01.png","page_title":"Eupatorium sessilifolium","context_page_description":"Eupatorium sessilifolium е вид растение от семейство Сложноцветни. Видът е незастрашен от изчезване."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%90%D0%BD%D0%B6%D0%B5%D0%BB%D0%B8%D0%BD%D0%B0_%D0%A8%D0%B2%D0%B0%D1%87%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Angelina_Shvachka.jpg","page_title":"Анжелина Швачка","context_page_description":"Анжелина Швачка нь Оросын дуучин юм."},{"page_url":"https://de.wikipedia.org/wiki/H%C3%B6veln_(Adelsgeschlecht)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/H%C3%B6vel%28n%29-Wappen.png","page_title":"Höveln (Adelsgeschlecht)","context_page_description":"Höveln, auch Hoevelen, Hövell, ist der Name eines ursprünglich aus Westfalen stammenden Adelsgeschlechts, das im Lübecker Patriziat aufstieg und in dieser Stadt über fünf Generationen Ratsherren und Bürgermeister stellte. Heute nennt sich das Geschlecht von Hövell, ist jedoch nicht mit den ebenfalls aus Westfalen stammenden, namensähnlichen, aber nicht stammesverwandten von Hövel zu verwechseln."},{"page_url":"https://it.wikipedia.org/wiki/Museo_Tripisciano","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Michele_Tripisciano_-_statua_del_Belli_08.JPG","page_title":"Museo Tripisciano","context_page_description":"Il Museo Tripisciano o mostra permanente delle opere di Michele Tripisciano è sita a Caltanissetta in Largo Paolo Barile, ed è ospitata in quattro sale dello storico Palazzo Moncada o Bauffremont della prima metà del XVII secolo.\\nLe attività museali sono gestite dalla locale Pro loco.\\nAttualmente non sono esposte diverse opere conservate, custodite nei magazzini del museo."},{"page_url":"https://en.wikipedia.org/wiki/Houmt_El_Souk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Tunesien_Houmt_Souk_Bordj_el_Kebir_1.jpg","page_title":"Houmt El Souk","context_page_description":"Houmt Souk, meaning literally: \\"The Market neighborhood\\", is a commune and the main town of the island of Djerba, Tunisia. A popular tourist destination, it is best known for its traditional souk and the Aghlabid fortress.\\nIt is located at approximately 20 km from Ajim and 22 km from El Kantara by the Roman road. It is also the chief town and a municipality with 75,904 inhabitants. The city itself shelters a population of 44,555 inhabitants as of 2005. The city developed on the old site of a Roman city called Gerba or Girba which had the honor of giving birth to two Roman Emperors, Trebonianus Gallus and his son Volusianus."},{"page_url":"https://en.wikipedia.org/wiki/Nydri","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Nidri_panorama2.jpg","page_title":"Nydri","context_page_description":"Nydri is a town and a community on the eastern coast of the island of Lefkada, Greece. It is part of the municipal unit Ellomenos. The community includes the small village Rachi. The Greek National Road 42 passes through the town. Nydri is a popular tourist town. In the sea in front of Nydri are several small islands including Madouri, Skorpios, Skorpidi and Sparti. The island Skorpios is the property of the Ribolovlev family.\\nThe German archaeologist Wilhelm Dörpfeld, having examined the geographical descriptions of Homer in the Iliad and the Odyssey believed that Lefkada was Homer's Ithaca, and that the palace of Odysseus was located west of Nydri on the south coast of Lefkada. He performed extensive excavations at Nydri and uncovered Mycenaean tombs, walls, ruins and artefacts which supported his hypothesis. Dörpfeld spent the last years of his life at Nydri and he is buried there."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2008","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Carolvanherwijnen.jpg","page_title":"Lijst van personen overleden in 2008","context_page_description":"Dit is een lijst van personen die zijn overleden in 2008."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8C%8C%EB%9D%BC%EB%82%A0_%EC%B2%9C%EB%AC%B8%EB%8C%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Paranal_Observatory_-_Instruments.png","page_title":"파라날 천문대","context_page_description":"파라날 천문대는 칠레 안토파가스타에서 남쪽으로 약 120km 떨어진, 2,635m 높이의 파라날 산에 위치한 천문대이다. 라 실라 천문대와 함께 유럽 남방 천문대가 운영하는 천문대이다. 천문대의 가장 큰 망원경은 네 개의 8.2m 지름의 거대망원경이다. 이 네 망원경을 하나로 연결하여 거대망원경 간섭계로 이용할 수 도 있다. 추가로 VLTI는 1.8m 지름의 보조 망원경 네 개와도 연결할 수 있다. 넓은 화각을 갖춘 4.1m의 VISTA 탐사망원경과, 2.6m의 VLT 탐사망원경들은 하늘의 아주 넓은 영역을 탐사하는데 주로 쓰인다."},{"page_url":"https://ast.wikipedia.org/wiki/Edificiu_Chrysler","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Chrysler_Building_Lobby_2.jpg","page_title":"Edificiu Chrysler","context_page_description":"L'Edificiu Chrysler ye un rascacielos d'estilu art déco asitiáu na interseición de la Cai 42 con Lexington Avenue, nel East Side de Midtown Manhattan, Nueva York, nel barriu de Turtle Bay. Con 77 plantes y 319 metros d'altor, foi l'edificiu más altu del mundu mientres once meses, hasta que lo superó'l Empire State Building en 1931. Sigue siendo l'edificiu de lladriyos más altu del mundu, anque la so estructura ye d'aceru. Tres la destrucción del World Trade Center nos atentaos del 11 de setiembre de 2001, convertir de nuevu nel segundu edificiu más altu de Nueva York. Anguaño ye'l quintu más altu de Nueva York, por detrás del One World Trade Center, el 432 Park Avenue, el Empire State Building y la Bank of America Tower.\\nL'Edificiu Chrysler, diseñáu pol arquiteutu William van Alen, ye un exemplu clásicu de l'arquiteutura art déco y munchos arquiteutos contemporaneos considerar unu de los meyores edificios de Nueva York. Foi la sede de la empresa Chrysler dende 1930 hasta mediaos de los años cincuenta. Anque l'edificiu construyóse y diseñó específicamente pal fabricante de coches, la empresa nun pagó la so construcción y nunca foi la so propietaria, por cuenta de que Walter P."},{"page_url":"https://en.wikipedia.org/wiki/Star_Wars:_From_the_Adventures_of_Luke_Skywalker","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/AlanDeanFoster2007-05-26.jpg","page_title":"Star Wars: From the Adventures of Luke Skywalker","context_page_description":"Star Wars: From the Adventures of Luke Skywalker is the original title of the novelization of the 1977 film Star Wars. Ghostwritten by Alan Dean Foster, but credited to George Lucas, it was first published on November 12, 1976, by Ballantine Books, several months before the release of the film. In later years, it was republished under the title Star Wars: A New Hope to reflect the retroactive addition of a subtitle to the film in 1981.\\nAlthough the book contains some differences from the film, it also includes references to Palpatine and his rise to power in the prologue, setting up the backstory for future films."},{"page_url":"https://de.wikipedia.org/wiki/Kaltenleutgebner_Bahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Bahnhof_Perchtoldsdorf_S%C3%BCdostseite.JPG","page_title":"Kaltenleutgebner Bahn","context_page_description":"Die Kaltenleutgebner Bahn oder auch Kaltenleutgebener Bahn ist eine Nebenlinie der Südbahn von Wien-Liesing nach Kaltenleutgeben in Niederösterreich. Sie wurde im Jahr 1883 als Localbahn Liesing–Kaltenleutgeben in Betrieb genommen und diente ursprünglich sowohl dem Personen- als auch dem Güterverkehr. Ein Großteil der ursprünglich 6,7 Kilometer langen Strecke führt über Perchtoldsdorfer Gemeindegebiet. In den 1950er Jahren wurde der Personenverkehr eingestellt und der Streckenabschnitt zwischen Waldmühle und Kaltenleutgeben abgetragen. Nach der gänzlichen Einstellung des Zementwerks in Waldmühle wurde die Bahnstrecke per Bescheid des Verkehrsministeriums mit 29. Jänner 2014 als öffentliche Eisenbahn stillgelegt. Seit Anfang 2015 wird die Strecke von der Immobiliengesellschaft der Gemeinde Perchtoldsdorf mit Kaufoption gepachtet und soll, vorerst für den Nostalgiezugverkehr, erhalten bleiben, am 3. September 2017 wurde die Strecke für Nostalgiefahrten wiedereröffnet. Seit dem Jahr 2017 ist die Strecke juristisch eine Anschlussbahn."},{"page_url":"https://sv.wikipedia.org/wiki/Sch%C3%B6nwalde_am_Bungsberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Schoenwalde_in_OH.png","page_title":"Schönwalde am Bungsberg","context_page_description":"Schönwalde am Bungsberg är en kommun och ort i Kreis Ostholstein i förbundslandet Schleswig-Holstein i Tyskland.\\nKommunen ingår i kommunalförbundet Amt Ostholstein-Mitte tillsammans med ytterligare fyra kommuner."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%88%D8%A7%D8%AF_%D8%A7%D9%88%D9%84%DB%8C%D9%87_%D9%82%D8%A7%D9%84%DB%8C%E2%80%8C%D8%A8%D8%A7%D9%81%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Cotton_%288145399540%29.jpg","page_title":"مواد اولیه قالی‌بافی","context_page_description":"دردامنهٔ کوه‌های البرز ورشته کوه زاگرس به ویژه در نواحی سنندج و کرمانشاه و نواحی شمال خراسان وبلوچستان و نقاط مرکزی ایران گوسفند‌هایی پرورش می‌یابند که پشم‌های مرغوب آن‌ها در تهیهٔ فرش‌های بادوام ومناسب به کار می‌روند. نژادهای معروف گوسفندان ایران عبارت انداز:\\nبیشتر گوسفندان ایران از نوع نژادهایی با پشم ضخیم هستند و متجاوز از۶۵تا۷۰٪پشم آن‌ها از نوع هتروتیپ است. بر اثر این کیفیت تار پشم زبرتر، ضخیم‌تر و مستحکم تر بوده و برای قالی بافی کاملاً مناسب است. قطر تار پشم نژادهای گوسفندان ایران بین۳۵تا۵۰ میکرون {۳۵تا۵۰میلی‌متر}و طول آن‌ها حتی تا۳۸سانتی‌متر نیز می‌رسد. گوسفندانی که در کوهستان وهوای معتدل پرورش می‌یابند نسبت به گوسفندان نقاط پست و مرطوب پشم‌های مرغوب تری تولید می‌کنند. همچنین پشم‌هایی که در فصل بهار چیده شده باشند کیفیت بهتری نسبت به پشم‌های پاییزه دارند. پشم‌های سفید رنگ خاصیت رنگ پذیری بهتری نسبت به سایر پشم‌ها دارند. ناگفته نماند رنگ پشم گوسفندان نژاد سفید کاملاً سفید روشن نیست بلکه درحقیقت نخودی ویا زرد روشن است. تنها پشم برخی از نژادها مانند گوسفندان سیستانی به‌طور کامل سفید و براق هستندکه بعد از رنگرزی شفافیت و جلوهٔ خاصی پیدا می‌کنند.قطر پشم‌های مناسب برای قالی بافی درحدود۳۰تا۴۰میکرون است."},{"page_url":"https://de.wikipedia.org/wiki/Oldendorp","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/ChurchOldendorp.jpg","page_title":"Oldendorp","context_page_description":"Oldendorp im Rheiderland ist eine Ortschaft in der Gemeinde Jemgum im niedersächsischen Landkreis Leer in Ostfriesland. Das Haufendorf hat 87 Einwohner."},{"page_url":"https://en.wikipedia.org/wiki/Alexandria_in_the_Caucasus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/AlexanderIndiaMap.jpg","page_title":"Alexandria in the Caucasus","context_page_description":"Alexandria in the Caucasus was a colony of Alexander the Great. He founded the colony at an important junction of communications in the southern foothills of the Hindu Kush mountains, in the country of the Paropamisadae.\\nIn Classical times, the Hindu Kush were also designated as the \\"Caucasus\\" in parallel to their Western equivalent, the Caucasus Mountains between Europe and Asia."},{"page_url":"https://fr.wikipedia.org/wiki/Jiang_Wen","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/2008-03-14_Jiang_Wen_et_Patrice_Ch%C3%A9reau.jpg","page_title":"Jiang Wen","context_page_description":"Jiang Wen est un acteur, réalisateur, scénariste et producteur chinois, né à Tangshan en Chine le 5 janvier 1963. Il est surtout connu en Occident en tant qu'acteur pour son duo avec Gong Li dans le film de Zhang Yimou Le Sorgho rouge."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B7%D0%B0%D1%87%D1%8C%D1%8F_%D1%88%D0%BB%D1%8F%D1%85%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Rigelman_1786._Hetman._Polkovnyk.jpg","page_title":"Казачья шляхта","context_page_description":"Казачья шля́хта — привилегированное военное сословие Речи Посполитой, выделенное из реестрового казачества и, впоследствии, положившее начало родовому малороссийскому дворянству."},{"page_url":"https://en.wikipedia.org/wiki/Thiruvananthpuram%E2%80%93Korba_Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/%28Trivandrum_-_Korba%29_Express_Route_map.png","page_title":"Thiruvananthpuram–Korba Express","context_page_description":"The 22648 / 47 Thiruvananthapuram Central - Korba Express is a Superfast express train belonging to Indian Railways Southern zone that runs between Thiruvananthapuram Central and Korba in India.\\nIt operates as train number 22648 from Thiruvananthapuram Central to Korba and as train number 22647 in the reverse direction serving the states of Kerala, Tamil Nadu, Andhra Pradesh, Telangana, Maharashtra & Chhattisgarh."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B3%B5%EC%8B%9D_%EA%B2%BD%EA%B8%B0%EA%B5%AC_(%EC%B6%95%EA%B5%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Top_Star-1958.jpg","page_title":"공식 경기구 (축구)","context_page_description":"공식 경기구 또는 공식 시합구 또는 공식 사용구 또는 공식 지정구는 대회 혹은 리그의 주관단체가 해당 대회의 공식 경기에 독점 사용을 공인한 축구공이다.\\n한국에서는 공인구라고 많이 불린다."},{"page_url":"https://id.wikipedia.org/wiki/Dodge_Dart_(PF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Dodge_Dart_2.0_Rallye_2014_%2814217526095%29.jpg","page_title":"Dodge Dart (PF)","context_page_description":"Dodge Dart adalah sedan kompak yang menggunakan platform Fiat Compact yang muncul pertama kali di North American International Auto Show 2012. Dart adalah sedan kompak pertama Dodge setelah Dodge Neon didiskontinu tahun 2005."},{"page_url":"https://es.wikipedia.org/wiki/Bupleurum_stellatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Bupleurum_ranunculoides_001.JPG","page_title":"Bupleurum stellatum","context_page_description":"Bupleurum stellatum es una especie de planta herbácea perteneciente a la familia de las apiáceas."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Hoh-Andlau","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Haut-Andlau.JPG","page_title":"Burg Hoh-Andlau","context_page_description":"Die Burg Hoh-Andlau ist die Ruine einer Höhenburg auf der Gemarkung der französischen Gemeinde Andlau im elsässischen Département Bas-Rhin. Mit ihren charakteristischen zwei Türmen ist sie ein weithin sichtbares Wahrzeichen der Umgebung und ein beliebtes Ausflugsziel. Sie gehört zu den bekannten Burgruinen im Elsass und steht nicht weit entfernt von der benachbarten Spesburg."},{"page_url":"https://eo.wikipedia.org/wiki/Paul_Langerhans","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Friedrich_Theodor_von_Frerichs.jpg","page_title":"Paul Langerhans","context_page_description":"Paul Langerhans estis germana kuracisto, patologo, fiziologo, biologo, esploristo, filo de la politikisto Paul Langerhans, kaj duonfrato de Robert Langerhans kaj Richard Langerhans. La juristo Wilhelm Langerhans estis frato de lia patro. Li estas fama pro kelkaj esploroj faritaj en la medicina kampo, tiel kiel la Insuletoj de Langerhans, la \\"Tavolo de Largerhans\\", la \\"Ĉeloj de Langerhans\\" kaj la proteino \\"Langerino\\"."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Hohensch%C3%B6nhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Schloss_Hohensch%C3%B6nhausen_Berlin_-_Otto_Hennig_-_Radierung_1920_a.jpg","page_title":"Schloss Hohenschönhausen","context_page_description":"Das Schloss Hohenschönhausen ist ein Gutshaus, das sich im Ortsteil Alt-Hohenschönhausen des Bezirks Lichtenberg von Berlin befindet. Es ist seit 2008 im Besitz des Fördervereins Schloss Hohenschönhausen und steht auf der Berliner Denkmalliste."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Gervais-sur-Roubion","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/St_Gervais-sur-Roubion%2C_Dr%C3%B4me.jpg","page_title":"Saint-Gervais-sur-Roubion","context_page_description":"Saint-Gervais-sur-Roubion est une commune française située dans le département de la Drôme en région Auvergne-Rhône-Alpes."},{"page_url":"https://eo.wikipedia.org/wiki/Tiofosforila_fluorido","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Fluorosulfuric_acid_molecule_ball.png","page_title":"Tiofosforila fluorido","context_page_description":"Tiofosforila fluorido aŭ PSF₃ estas neorganika fluora komponaĵo de sulfuro kaj fosforo, senkolora, brulema, eksplodema gaso kun irita odoro, uzata en kemiaj sintezoj kie fluoriga, fosforiga kaj sulfurigagento. Ĝi spontanee brulas en aero per malvarma flamo. En akva medio ĝi hidroliziĝas en fluoridan acidon, sulfidan acidon kaj fosfatan acidon. Per varmo ĝi malkomponiĝas en fosforan trifluoridon kaj sulfuron.\\nFluorido de tiofosforila estis unue sintezita en 1888 de la britaj kemiistoj James Wyllie Rodger kaj Thomas Edward Thorpe. Samkiel Henri Moissan kiu malkovris aliajn fosforilojn, ili preparis tiofosforilan fluoridon reakciigante tiofosforilan kloridon kun arsena trifluorido."},{"page_url":"https://ca.wikipedia.org/wiki/Es_Peirons","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Entree_espeyroux_2008.jpg","page_title":"Es Peirons","context_page_description":"Espeirós és un municipi francès, situat al departament de l'Òlt i a la regió d'Occitània."},{"page_url":"https://fr.wikipedia.org/wiki/James_Guthrie_(homme_politique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/James-Guthrie-sig.jpg","page_title":"James Guthrie (homme politique)","context_page_description":"James Guthrie a été sénateur du Kentucky puis Secrétaire du Trésor sous l'administration du Président Franklin Pierce de 1853 à 1857. Guthrie a aussi été un des candidats à la primaire démocrate pour l'élection présidentielle de 1860."},{"page_url":"https://pt.wikipedia.org/wiki/Grammy_Award_para_melhor_desempenho_de_R%26B_tradicional","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Aretha_Franklin_on_January_20%2C_2009.jpg","page_title":"Grammy Award para melhor desempenho de R&B tradicional","context_page_description":"Grammy Award para Best Traditional R&B Vocal Performance é uma das categorias do Grammy Awards, uma cerimónia estabelecida em 1958 e originalmente denominada como Gramophone Awards, concedido para os artistas de gravação de obras de qualidade nos álbuns do gênero musical \\"R&B\\". As várias categorias são apresentadas anualmente pela National Academy of Recording Arts and Sciences dos Estados Unidos em \\"honra da realização artística, proficiência técnica e excelência global na indústria da gravação, sem levar em conta as vendas ou posições nas tabelas musicais\\".\\nEsta categoria é diferente de Best Female R&B Vocal Performance e Best Male R&B Vocal Performance, que foram ambos premiados entre 1968 a 2011. Entre 1999 e 2002, este prêmio era originalmente conhecido como Best Traditional R&B Vocal Album. Ela foi renomeada em 2003, sendo premiado como Best Traditional R&B Vocal Performance. A partir de 2012, o prêmio será conhecido como \\"Best Traditional R&B Performance\\".\\nA cantora Aretha Franklin detém o recorde de mais vitórias, com duas."},{"page_url":"https://no.wikipedia.org/wiki/Aleppo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Aleppo.jpg","page_title":"Aleppo","context_page_description":"Aleppo er en by i Syria, og hovedstad for guvernementet Aleppo, det mest folkerike syriske guvernementet. Med en offisiell befolkning på 2 132 100 mennesker, i henhold til folketelling av 2004, var den ikke bare den største byen i Syria men også en av de største byene i Levanten. I århundrer var Aleppo også den største byen i Storsyria og den tredje største i Det osmanske rike, da etter Konstantinopel og Kairo.\\nFra 2012 har det i forbindelse med Borgerkrigen i Syria pågått et slag om byen. Aleppo har vært utsatt for store ødeleggelser og regnes som den verst rammede byen i borgerkrigen. Per september 2016 holder regjeringsstyrker hjulpet av Russland, Hizbollah og andre sjia-styrker den vestre delen av byen mens opprørsstyrker bestående av Den frie syriske armé og islamistiske grupper holder den østre delen. Den hovedsakelig kurdiske bydelen Sheikh Maqsood holdes av kurdiske YPG. Slaget om Aleppo har blitt omtalt som «Syrias Stalingrad»."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%AD%B7%E6%B3%95%E9%81%8B%E5%8B%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Li_Yuan-hung.jpg","page_title":"護法運動","context_page_description":"護法運動，又稱護法之役，是由孫文領導反對段祺瑞主導的北洋政府，維護中華民國臨時約法、恢復中華民國國會，在廣州建立中華民國軍政府的行動。\\n護法運動因陳炯明反對後失敗，並向段祺瑞主持的北洋政府和談。在中國國民黨歷史中，亦稱為「三次革命」。所謂「護法」指的是護衛《中華民國臨時約法》。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%AC%D5%A1%D5%A4%D5%AB%D5%B4%D5%AB%D6%80_%D4%B7%D5%BC%D5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Earl%D0%9C.jpg","page_title":"Վլադիմիր Էռլ","context_page_description":"Վլադիմիր Էռլ, ռուս բանաստեղծ, արձակագիր, տեքստաբան:\\n1960-ականներին հարում էր «Մալայա Սադովայի բանաստեղծների» շրջանակին, եղել է հելենուկտներ գրական խմբի առաջնորդը: Այդ ժամանակվանից հրապարակվում է «ինքնահրատում»: Որպես հրատարակիչ՝ թողարկել է ավելի քան 100 «ինքնահրատ» գրքեր: 1980-ականների կեսերից առավելաբար հանդես է գալիս բանասիրական և տեքստաբանական աշխատանքներով: Անդրեյ Բելիի մրցանակի դափնեկիր է:"},{"page_url":"https://es.wikipedia.org/wiki/Leire_Bilbao","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Leire_Bilbao_%28Aitor_Unamuno%29.jpg","page_title":"Leire Bilbao","context_page_description":"Leire Bilbao Barruetabeña es una escritora española."},{"page_url":"https://nl.wikipedia.org/wiki/Medetera_setiventris","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Medetera_setiventris_01.JPG","page_title":"Medetera setiventris","context_page_description":"Medetera setiventris is een vliegensoort uit de familie van de slankpootvliegen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1955 door Thuneberg."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8E%9F%E5%AD%90%E8%BD%A8%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/F4M0.png","page_title":"原子轨道","context_page_description":"原子軌域，又稱軌態，是以數學函數描述原子中電子似波行為。此波函數可用來計算在原子核外的特定空間中，找到原子中電子的機率，並指出電子在三維空間中的可能位置。「軌域」便是指在波函數界定下，電子在原子核外空間出現機率較大的區域。具體而言，原子軌域是在環繞著一個原子的許多電子中，個別電子可能的量子態，並以軌域波函數描述。\\n現今普遍公認的原子結構是波耳氫原子模型：電子像行星，繞著原子核運行。然而，電子不能被視為形狀固定的固體粒子，原子軌域也不像行星的橢圓形軌道。更精確的比喻應是，大範圍且形狀特殊的「大氣」，分布於極小的星球四周。只有原子中存在唯一電子時，原子軌域才能精準符合「大氣」的形狀。當原子中有越來越多電子時，電子越傾向均勻分布在原子核四周的空間體積中，因此「電子雲」越傾向分布在特定球形區域內。\\n在原子物理學的運算中，複雜的電子函數常被簡化成較容易的原子軌域函數組合。雖然多電子原子的電子並不能以「一或二個電子之原子軌域」的理想圖像解釋，它的波函數仍可以分解成原子軌域函數組合，以原子軌域理論進行分析；就像在某種意義上，由多電子原子組成的電子雲在一定程度上仍是以原子軌域「構成」，每個原子軌域內只含一或二個電子。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkmale_in_Waiblingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/4584_Eiche_Waiblingen.jpg","page_title":"Liste der Naturdenkmale in Waiblingen","context_page_description":"Die Liste der Naturdenkmale in Waiblingen nennt die verordneten Naturdenkmale der im baden-württembergischen Rems-Murr-Kreis liegenden Stadt Waiblingen. In Waiblingen gibt es insgesamt 31 als Naturdenkmal geschützte Objekte, davon 23 flächenhafte Naturdenkmale und 8 Einzelgebilde-Naturdenkmal.\\nStand: 29. Oktober 2016."},{"page_url":"https://pt.wikipedia.org/wiki/Milaim_Rama","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Milaim_Rama_-_Lausanne_Sport_vs._FC_Thun_-_22.10.2011.jpg","page_title":"Milaim Rama","context_page_description":"Milaim Rama - em servo-croata, Milajim Rama é um ex-futebolista profissional suíço que disputou a Eurocopa de 2004."},{"page_url":"https://it.wikipedia.org/wiki/Palazzo_Modignani","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Lapide_palazzo_Modignani.jpg","page_title":"Palazzo Modignani","context_page_description":"Palazzo Modignani, noto anche come palazzo Pitoletti, è un edificio storico della città di Lodi, in via XX Settembre all'angolo con corso Roma. La sua costruzione risale al XVIII secolo."},{"page_url":"https://hu.wikipedia.org/wiki/Smaragdz%C3%B6ld_piton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/JBR_7494.jpg","page_title":"Smaragdzöld piton","context_page_description":"A smaragdzöld piton a hüllők osztályának pikkelyes hüllők rendjébe, ezen belül a pitonfélék családjába tartozó faj."},{"page_url":"https://it.wikipedia.org/wiki/Lerici","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Johann_Gottfried_Steffan_Lerici.jpg","page_title":"Lerici","context_page_description":"Lérici è un comune italiano di 10 028 abitanti della provincia della Spezia in Liguria. È il quarto comune della provincia per numero di abitanti.\\nCon il capoluogo di provincia e Porto Venere è uno dei tre comuni che si affacciano sul Golfo dei Poeti. La sua frazione Tellaro è compresa nel circuito dei borghi più belli d'Italia.\\nPer molti anni, Lerici ha ospitato Lord Byron, Mary Shelley e Percy Bysshe Shelley. È uno dei borghi marinari più famosi della Liguria e del nord dell'Italia in generale, è infatti meta di moltissimi turisti durante tutto l'arco dell'anno; un fenomeno che si sta verificando da ormai alcuni decenni è quello dell'acquisto di abitazioni estive da parte di persone provenienti in special modo dalla Lombardia e dall'Emilia-Romagna."},{"page_url":"https://cs.wikipedia.org/wiki/Nikolaj_Alexandrovi%C4%8D_Chodorovi%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Nikolaj.Alexandrovich.Chodorovich.%281857-1936%29.gif","page_title":"Nikolaj Alexandrovič Chodorovič","context_page_description":"Nikolaj Alexandrovič Chodorovič byl ruský generál, který byl jedním z těch, kdo se zasadil o vznik České družiny - předchůdkyně ruských československých legií. Po vítězství bolševiků v Rusku odešel do Československa. Zde mu byla přiznána penze a po jeho smrti mu byly vzdány stejné pocty jako kterémukoliv československému generálovi."},{"page_url":"https://pt.wikipedia.org/wiki/Castelo_de_Malbork","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Malbork_-_Zamek_%C5%9Aredni.JPG","page_title":"Castelo de Malbork","context_page_description":"O Castelo de Malbork é um castelo construído pela Ordem dos Cavaleiros Teutónicos, uma ordem religiosa católica romana alemã de cruzados. Situa-se cerca de 60 quilómetros a sudeste de Gdansk, na cidade polaca de Malbork. A ordem chamou-lhe Marienburg, o mesmo nome que receberia a cidade que cresceu à sua volta.\\nConstruído por Siegfried von Feuchtwangen, o castelo encontra-se em posição dominante sobre a margem direita do rio Nogat, afluente do Vístula, sendo assim acessível aos navios mercantes e às barcaças. Este era inicialmente um convento, depois transformado num castelo com todos os efeitos. Em constante evolução durante quase duzentos e trinta anos, o castelo é o exemplo clássico duma fortaleza medieval.\\nAquando da sua conclusão, em 1406, era o maior castelo gótico de tijolos no mundo. Entre 1309 e 1454 foi o castelo-sede do Grão-Mestre da Ordem Teutónica no Estado da Prússia Oriental. É o maior edifício de tijolos da Europa e o maior no mundo em área de construção, constituído maioritariamente por tijolos vermelhos, erguendo-se no sítio do antigo castelo de Trappeinen."},{"page_url":"https://de.wikipedia.org/wiki/Juan_van_der_Hamen_y_Le%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Juan_van_der_Hamen_y_Le%C3%B3n_-_San_Isidro.jpg","page_title":"Juan van der Hamen y León","context_page_description":"Juan van der Hamen y León war ein spanischer Maler des Barock, dessen Schaffen in die Zeit des Siglo de Oro fiel. Seine Familie hatte einen flämischen Hintergrund. Sein Vater und er dienten in der flämischen Garde der Bogenschützen des spanischen Königs. 1615 beendete er seine künstlerische Ausbildung, über die wenig bekannt ist, und eröffnete sein Atelier. Das Stillleben wurde früh sein künstlerisches und finanzielles Standbein. 1619 wurde er an den spanischen Hof berufen, wo er sich um Anerkennung als Porträt- und Historienmaler bemühte, um seine Chancen auf die Berufung als Hofmaler zu steigern. 1627 bewarb er sich erfolglos um diese Position. Juan van der Hamen starb bereits im Alter von 35 Jahren in einer Zeit, als er sich verschiedenen Gattungen der Malerei widmete und sich auch der autonomen Landschaftsmalerei zugewandt hatte.\\nVan der Hamen y León ist vor allem für seine Stillleben bekannt, hinter denen die weiteren Facetten seines Gesamtwerks zurücktreten. Tatsächlich war er bei seinen Zeitgenossen aber auch für seine Porträts und seine Historienmalerei anerkannt."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%A7%DB%8C%D8%B2%D9%87_%D8%A7%D8%AF%D8%A8%DB%8C_%DA%AF%D9%88%D8%AA%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Wis%C5%82awa_Szymborska_2009.10.23_%281%29.jpg","page_title":"جایزه ادبی گوته","context_page_description":"جایزه ادبی گوته معتبرترین جایزه ادبی آلمان است. جایزهٔ «گوته» هر سه سال یک‌بار طی مراسمی در فرانکفورت، موطن «گوته» شاعر سرشناس آلمانی، به برنده‌اش اعطا می‌شود. این جایزه در روز تولد «یوهان ولفگانگ گوته» به برندگان آن اهدا می‌شود. از سال ۱۹۲۷ زمان افتتاح اهدای این جایزه، هرمان هسه در سال ۱۹۴۶، توماس مان ۱۹۴۹ و زیگموند فروید در سال ۱۹۳۰ و آدونیس مفتخر به دریافت آن شده‌اند."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%8B%B1%E6%A0%BC%E4%B8%80%E4%B8%96_(%E6%8C%AA%E5%A8%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Haakon_Herdebreis_saga-Kong_Inges_haerfylking-W._Wetlesen.jpg","page_title":"英格一世 (挪威)","context_page_description":"英格·哈拉尔松，挪威国王，是为英格一世。英格一世的统治在挪威历史上称为内战时期的开始。英格一世从来不是唯一统治者。因为他身体残疾，他通常被称为驼背的英格。 然而，这种绰号并没有出现在中世纪的资料中出现。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%B0-%D0%86%D0%B0%D0%B0%D0%BD%D0%B0-%D0%91%D0%B0%D0%B3%D0%B0%D1%81%D0%BB%D0%BE%D1%9E%D1%81%D0%BA%D1%96_%D0%B6%D0%B0%D0%BD%D0%BE%D1%87%D1%8B_%D0%BC%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80_(%D0%94%D0%B0%D0%BC%D0%B0%D1%88%D0%B0%D0%BD%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Dama%C5%A1any._%D0%94%D0%B0%D0%BC%D0%B0%D1%88%D0%B0%D0%BD%D1%8B._%D0%A1%D0%B2%D1%8F%D1%82%D0%B0-%D0%86%D0%B0%D0%B0%D0%BD%D0%B0-%D0%91%D0%B0%D0%B3%D0%B0%D1%81%D0%BB%D0%BE%D1%9E%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B0%D1%80%D0%BA%D0%B2%D0%B0.jpg","page_title":"Свята-Іаана-Багаслоўскі жаночы манастыр (Дамашаны)","context_page_description":"Свята-Іаана-Багаслоўскі жаночы манастыр ― жаночы манастыр у вёсцы Дамашаны Смалявіцкага раёна Мінскай вобласці. Знаходзіцца побач з могілкамі."},{"page_url":"https://nn.wikipedia.org/wiki/WiMP","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/WiMP_vertical_logo.png","page_title":"WiMP","context_page_description":"WiMP er ei teneste for direkte avspeling av musikk som vart starta av dei norske selskapa Aspiro Music AS, Platekompaniet og Telenor. Tenesta gjev full tilgang til avspeling av om lag 20 millionar låtar og er lansert i Noreg, Sverige og Danmark. Per 14. mars 2012 eigde Schibsted 74,3 prosent av aksjane, men totalbudet på 340 millionar svenske kroner vakte også motstand hjå mindre aksjonærar.\\nSom registrert brukar hjå tenesta får ein tilgang til å spela av all musikken i biblioteket til WiMP. Kopiar av musikken blir ikkje lagra lokalt, men ein har fri tilgang til all musikken gjennom strøyming over internett. Det er også mogeleg å kjøpa enkeltlåtar og album. Den musikken ein kjøper blir lagra lokalt, utan kopisperre.\\nWiMP tilbyr musikk frå alle dei store plateselskapa i tillegg til tusenvis av uavhengige små plateselskap. Dei fleste nye albuma er tilgjengelege same dagen som dei er tilgjengeleg i platebutikkar. Musikkbiblioteket veks jamleg og WiMP set for tida spesielt fokus på å utvida utvalet av lokal musikk i dei landa dei tilbyr tenesta i.\\nProgrammet gjer det mogeleg å søkja etter artistar, album og låtar, og anbefaler relatert musikk."},{"page_url":"https://es.wikipedia.org/wiki/Parleboscq","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Map_commune_FR_insee_code_40218.png","page_title":"Parleboscq","context_page_description":"Parleboscq es una población y comuna francesa, situada en la región de Aquitania, departamento de Landas, en el distrito de Mont-de-Marsan y cantón de Gabarret."},{"page_url":"https://fr.wikipedia.org/wiki/Qaanaaq","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Qaanaaq%2C_Greenland.jpg","page_title":"Qaanaaq","context_page_description":"Qaanaaq, aussi connu sous ses anciens noms Thulé et Nouvelle Thulé est une localité de la municipalité d'Avannaata, au nord-ouest du Groenland. En 2019, elle comptait 621 habitants."},{"page_url":"https://it.wikipedia.org/wiki/G8_del_2001","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/ChiracUSA.jpg","page_title":"G8 del 2001","context_page_description":"Il 27º vertice del G8 si è svolto in Italia a Genova, in Liguria dal 20 al 22 luglio 2001. La riunione è stata guidata dal presidente del Consiglio Silvio Berlusconi al Palazzo Ducale. È tristemente nota soprattutto per le manifestazione no-global denominati Fatti del G8 di Genova avvenuti dal 19 al 22 luglio.\\nQuesto è l'ultimo vertice tenuto in una grande città, i membri del G8 hanno deciso, a causa degli eventi e degli attentati dell'11 settembre 2001, di tenere i loro incontri in luoghi meno accessibili."},{"page_url":"https://it.wikipedia.org/wiki/Hippolyte_Jouvin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/H._J._%28Hippolyte_Jouvin%2C_1825-ca.1887%29_-_n._631_-_Venise%2C_Pont_des_soupirs.jpg","page_title":"Hippolyte Jouvin","context_page_description":"Hippolyte Jouvin è stato un fotografo francese.\\nJouvin fu un pioniere della fotografia, ritraendo le strade di Parigi con una visione stereoscopica. Tra i vari soggetti, fotografò Rouen e la Comune di Parigi.\\nJouvin è presente nelle collezioni del museo d'Orsay e della Biblioteca nazionale di Francia.\\nUna delle fotografie più note è Il viale di Strasburgo, a Parigi, che si rifà ai vari paesaggi cittadini dipinti da pittori come Gustave Caillebotte o Claude Monet. Un elemento importante di queste rappresentazioni è proprio la visione dall'alto, spesso da una finestra, che indica il distacco dell'artista e il suo desiderio di rappresentare gli elementi di luce e colore del paesaggio, piuttosto che le figure umane."},{"page_url":"https://en.wikipedia.org/wiki/Province_of_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/A_new_mapp_of_East_and_West_New_Jarsey_%28sic%29_-_being_an_exact_survey_LOC_97683601_%28cropped%29.jpg","page_title":"Province of New Jersey","context_page_description":"The Province of New Jersey was one of the Middle Colonies of Colonial America and became New Jersey, a state of the United States in 1783. The province had originally been settled by Europeans as part of New Netherland, but came under English rule after the surrender of Fort Amsterdam in 1664, becoming a proprietary colony. The English then renamed the province after the Isle of Jersey in the English Channel. The Dutch Republic reasserted control for a brief period in 1673–1674. After that it consisted of two political divisions, East Jersey and West Jersey, until they were united as a royal colony in 1702. The original boundaries of the province were slightly larger than the current state, extending into a part of the present state of New York, until the border was finalized in 1773."},{"page_url":"https://de.wikipedia.org/wiki/Schw%C3%A4bisches_Bauernhofmuseum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Illerbeuren_Museum_Spalier_5.jpg","page_title":"Schwäbisches Bauernhofmuseum","context_page_description":"Das Schwäbische Bauernhofmuseum in Illerbeuren, einem Ortsteil von Kronburg, liegt zehn Kilometer südlich von Memmingen im Illertal. Es zählt zu den älteren Freilichtmuseen in Deutschland. 1955 war es das erste dieser Art im Süden der Bundesrepublik. Träger ist ein kommunaler Zweckverband, dem der Bezirk Schwaben, der Landkreis Unterallgäu und der Verein Heimatdienst Illertal angehören."},{"page_url":"https://lt.wikipedia.org/wiki/Cadillac_CTS","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Cadillac-CTS-2014-gray_IAA2013_rear-view_LWS2811.jpg","page_title":"Cadillac CTS","context_page_description":"Cadillac CTS yra verslo klasės automobilis, kurį gamina General Motors koncerno dukterinė markė Cadillac. Pirmą kartą pristatytas 2002 metai kaip 4-durų sportiškas sedanas, užėmęs tuomet jau nebegaminamo Cadillac Catera modelio poziciją. Tai buvo pirmasis serijinės gamybos automobilis pristatęs naują Cadillac dizaino kryptį - \\"Menas ir mokslas\\". Šia dizaino kryptimi buvo bandoma persiorientuoti į jaunesnę pirkėjų demografiją, senuosius modelius keičiant sportiškesniais, griežtesnio dizaino automobiliais. CTS buvo gaminami iki 2019 metų, kuomet šį modelį pakeitė Cadillac CT5.\\nCadillac CTS šešis kartus pateko į žurnalo Car and Driver kasmetinį 10 geriausių automobilių sąrašą bei du kart tapo žurnalo Motor Trend metų automobiliu."}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},G={class:"card-container"},F={key:0,class:"empty-state"},I=["disabled"],N